INSERT INTO `Pessoa` VALUES (2,'Daniel Lemos','BRANCA','MASCULINO','MASCULINO','1979-05-03','Jornalista e professor da UFRN.\r\nMilitante de Direitos Humanos e pela democratização da mídia.   Cristão evangélico defensor de que as igrejas devem ser inclusivas a respeito da orientação sexual e identidade de gênero das pessoas.','danieldantas79@globo.com','10205752970058537'),(4,'Richard Pasquale','BRANCA','MASCULINO','MASCULINO','1991-10-07','Estudante de direito, candidato a vereador, gay assumido. Sempre lutando pela causa LGBT desde o colégio , faz parte de vários comitês e setoriais que defendem e levantam a bandeira LGBT. ','richard.gutierris@gmail.com','962012207242742'),(8,'Evelyn Macedo','BRANCA','FEMININO','FEMININO','1980-07-08','Me chamo Evelyn Macedo tenho 36 anos, sou mãe de 4 filhos lindos. Sou mãe, mulher, esposa, guerreira, sou da luta, sou lésbica.\r\n\r\nNatural da Bahia, nasci em berço político, mudei para o estado do Espirito Santo com 10 anos de idade, onde dei continuidade ao que cresci aprendendo: Fazer uma boa política.\r\n\r\nO bairro Dr. Pedro Feu Rosa, onde morei 26 anos,  foi onde iniciei minha trajetória de vida e política no nosso querido município da Serra.\r\nFilha de comerciantes, herdei de meus pais o dom de batalhar desde muito cedo, exerci vários ofícios: também fui comerciante; professora de inglês; cuidadora social, na secretaria municipal de ação social (SEMAS) no projeto “Casa Lar”\r\n\r\nApós passar os últimos 15 anos me preparando para esse momento, vejo agora a possibilidade e me sinto preparada, para concretizar sonhos, que eu tenho certeza que não são só meus. Defendo uma nova maneira de se fazer política e trago a temática: Por uma Serra que deixe o AMOR falar mais alto. \r\nE que AMOR é esse?\r\n# O AMOR pelo cidadão Serrano. Um amor que não prioriza apenas bairros, mais um município como um TODO;\r\n# Um AMOR que cuida das mães que precisam trabalhar o dia inteiro e sofrem com a falta de creches em período integral;\r\n# Um AMOR que cuida das famílias de baixa renda, que não têm condições para pagar um transporte escolar privado na área urbana e que sofrem com a necessidade do filho andar grandes e perigosas distâncias; \r\n# O AMOR por nós, as minorias, sejam elas de gênero, racial, cultural e/ou, religiosa, que sofrem preconceitos, desigualdades, agressões e intolerância.\r\n# O AMOR às mulheres vítimas de violência doméstica, às mães que criam seus filhos sozinhas, onde a maioria sofre preconceitos, desigualdades, agressões, alienações, abandono e exclusão da por parte da sociedade. \r\n# Um AMOR pelas famílias que sofrem com seus familiares que precisam fazer hemodiálise e não têm um transporte adequado até o seu local de tratamento.\r\n# Um AMOR que me causa dor. Amor pelas famílias vítimas do câncer.\r\nNo ano de 2011, perdi meu herói, meu Pai, para o câncer. Me recordo como se fosse hoje o sofrimento que eu e minha família enfrentamos sem os devidos recursos e infraestrutura que precisávamos, pela falta de um hospital que atendesse meu Pai, ou um transporte que o levasse  e trouxesse das suas inúmeras e massacrantes quimioterapias. Quantas vezes tive que implorar por carona ou pegar ônibus lotado com meu herói que naquele momento não tinha forças para lutar.\r\nPassar por toda essa situação me fez enxergar um quadro de abandono dos poderes públicos para com essas famílias. Eu vivi e vivo na pele. Eu entendo sua dor, conheço suas necessidades e quero poder lutar por NÓS.\r\n \r\nMeu nome é Evelyn Macedo e  meu número é 15.129. Vamos juntos lutar por uma Serra que deixe o amor falar mais alto.\r\nA vida é da cor que você pinta,\r\nSua luta é a nossa missão.','evelyntjgr@hotmail.com','753740314766629'),(9,'Sérgio Gondaski','BRANCA','MASCULINO','MASCULINO','1994-08-06','Sérgio Gondaski, 22 anos, nascido em Toledo-Paraná. Estudou do ensino fundamental ao ensino médio em escolas públicas, bem como se graduou em Serviço Social pela Universidade Estadual do Oeste do Paraná. Gay, militante LGBT (Lésbicas, Gays, Bissexuais Travestis e Transexuais) e das causas da população. Na defesa de uma sociedade sem desigualdade, exploração de classe, opressão, machismo, racismo e LGBTfobia. Com a construção de um projeto coletivo de sociedade que respeite todos e todas e tenha a liberdade como direito fundamental na construção da igualdade e do socialismo.\r\n\r\nPOR UMA TOLEDO DE TODAS AS CORES, 50050!','serginhogondaski@hotmail.com','1018768588221366'),(12,'Douglas Butzke','BRANCA','MASCULINO','MASCULINO','1987-03-07','Nasci em Sapucaia do Sul/RS. Tenho 29 anos e sou estudante de Gestão Pública.\r\nMilitei no movimento estudantil e sigo atuante nos movimentos de juventude como JPT e Fora da Ordem. Sou coordenador da região Sul da Artgay e trabalhei junto a Secretaria Municipal de Direitos Humanos da nossa cidade promovendo palestras para a garantia de direitos, a superação do preconceito e o respeito à diversidade de gênero e religiosa e sou organizador da Parada LGBT da minha cidade.\r\nPela primeira vez, sou candidato a vereador de Sapucaia do Sul. Temos #NovasIdeias, quero #UmaNovaPolitica','maycon.alvess@hotmail.com','1101583279932194'),(13,'Marlyy Mattos','PARDA','MASCULINO','MASCULINO','1978-01-22','Vamos decidir pra revolucionar nosso voto em Alagoa nova em todos os municípios onde tiver uma candidatura LGBT, em todo o Brasil.\r\n\r\nSou Marly Matos , sou travestir desde que me entendi por gente na minha adolescência, estou colocando meu nome como a primeira alternativa que já atua como ativista da ong lgbt do brejo agreste paraibano, que por falta de apoio decidido em nosso município, desde 2011 ainda não saiu do papel.\r\n\r\nPercebi que nossa pauta das reivindicações locais para a comunidade gay, passa necessariamente por vontade política e por casas que legislam leis ou não, para beneficiar os coletivos do campo e da cidade, Quilombolas, lgbt, mulheres, jovens, prevenção as dsts, em fim, todas as pautas voltadas as políticas públicas que realmente interessam não acontecem porque estamos sofrendo uma crise de representatividade.\r\n\r\nVi que na minha condição posso fazer a diferença , mas preciso de sua aprovação nas urnas , digite 14555 e certamente pela primeira vez faremos história,\r\nporque vou encarar essa oportunidade como um emprego e uma porta inclusiva para as minorias em nosso município.\r\n\r\nmeu fone de contato; 0xx83981789669\r\n\r\nmais sobre mim; https://www.youtube.com/watch?v=dOcuxpwU_xM','marlyymattos14555@yahoo.com','160263414416070'),(15,'Astrid Roza','BRANCA','FEMININO','FEMININO','1992-09-17','Nascida no Rio de Janeiro, criada e educada desde os 8 anos na cidade de Curitiba, a qual é extremamente apaixonada. Estudante de engenharia química e militante de uma política baseada no respeito, onde não haja preconceitos.\r\nEstou me candidatando a vereadora pelo Partido Verde pela causa contra o preconceito, de um modo geral, seja ele racial, orientação sexual ou identidade de gênero, social, cultural. Meu lema é \"- preconceito + amor e respeito\" pois creio que seja o que está faltando nas pessoas atualmente. Espero trazer um pouco de respeito para todos e fazer com que as pessoas de um modo geral consigam enxergar isso da melhor forma possível, além de que falta pessoas jovens na política com iniciativas.\r\nMinhas propostas iniciais são:\r\n- DISCRIMINAÇÃO PELA ORIENTAÇÃO SEXUAL OU IDENTIDADE DE GÊNERO\r\nA violência em nossa cidade tem aumentado, a violência e discriminação pela orientação sexual não é diferente. Temos um problema grave que prejudica pessoas, famílias e toda nossa comunidade. Na sociedade em que vivemos não há mais espaço para preconceitos.\r\nTrabalharemos com um enfoque e conscientização no Disque Direitos Humanos (Disque 100), informando a comunidade de seus direitos quanto cidadão, indiferente do gênero, raça ou cor.\r\n- CONSCIENTIZAÇÃO ESCOLAR PARA COMBATER O BULLYING\r\nO bullying prejudica o individuo quanto cidadão, atrasa seu crescimento pessoal, relacionamento coletivo e leva muitos a depressão.\r\nTemos como prioridade o respeito, e acreditamos que a conscientização dos males que o Bullying traz e como evita-los auxiliam o desenvolvimento humano e do individuo. Precisamos de politicas que tragam menos preconceito e mais amor. Essa é nossa bandeira.\r\nhttps://www.facebook.com/astridroza/','astrid_roza@hotmail.com','1098415986909461'),(17,'Joanna Douat','BRANCA','FEMININO','FEMININO','1985-03-11','Eu estudei na primeira sala de Exatas do Colégio Bandeirantes. Aos 17 anos, ingressei na Fundação Getulio Vargas, em São Paulo. Me formei em Administração de Empresas e tenho pós-graduação em Economia. Aos 25 anos, concluí duplo-mestrado na London School of Economics e na HEC-Paris. Trabalhei por alguns anos no mercado de trabalho, em empresas nacionais e estrangeiras. Hoje, aos 31 anos, faço Doutorado, sou pesquisadora, professora universitária e candidata a vereadora pelo partido NOVO em São Paulo.\r\n\r\nComo vereadora, vou lutar por inovações na política e, principalmente, para assegurar uma educação de qualidade. Hoje, no Brasil, temos um grande número de analfabetos funcionais, que não sabem resolver operações matemáticas ou ler um texto mais complexo. Somente 8% das pessoas com idade para trabalhar podem ser consideradas plenamente capazes de entender e se expressar por meio de letras e números. *\r\n\r\nA solução para este problema tem que vir da educação primária, ensinando o cidadão desde pequeno a interpretar e solucionar problemas, pois é nessa fase que se inicia o desenvolvimento intelectual de cada indivíduo.\r\n\r\nMinha principal proposta é tornar a iniciativa privada parceira do poder público para trazer inovação na gestão e no ensino escolar.\r\nPara isso, vou lutar para replicar em São Paulo um modelo já existente em diversos países desenvolvidos, que são referências em Educação, como a Suécia e o Canadá.?A partir de parcerias bem desenhadas, é possível que nossas escolas públicas tenham a qualidade e a estrutura de escolas privadas, sem ter que cobrar mensalidade. Desta maneira, as escolas ganham uma maior autonomia para inovar e aplicar métodos que valorizam o potencial individual.\r\n \r\nTambém, como proposta de mandato, vou lutar para aproximar as instituições particulares do ensino público. Quero estabelecer parcerias com as associações do tipo “empresa júnior” para promover concursos entre alunos e start-ups. Buscarei trazer novas tecnologias para facilitar a educação e a qualidade de vida dos moradores de São Paulo.\r\n \r\nAlém disso, eu assumo os seguintes compromissos:\r\n\r\n- Economizar dinheiro público e reduzir os gastos de gabinete;\r\n- Receber pequenos e médios empreendedores, pelo menos uma vez ao mês, para conhecer os principais desafios por eles enfrentados;\r\n- Fiscalizar as contas da prefeitura e criar mecanismos para uma maior transparência via plataformas digitais;\r\n- Buscar inovação para os serviços municipais;\r\n- Lutar pela livre concorrência: contra as proibições de aplicativos e tecnologias que não apenas facilitam o dia-a-dia da população, mas também são usados como ferramenta de trabalho (ex: Uber, Waze, Whatsapp, internet ilimitada)\r\n\r\n*Fonte: Estudo conduzido pelo  IPM e pela ONG Ação Educativa, disponível em http://educacao.uol.com.br/noticias/2016/02/29/no-brasil-apenas-8-escapam-do-analfabetismo-funcional.htm)','joanna30002@gmail.com','10154482092504872'),(18,'Maria Isabel Rodrigues Teixeira','BRANCA','FEMININO','FEMININO','1964-04-02','Sou Isabel Teixeira, nasci em São Paulo e tenho 52 anos. Sou formada em Engenharia Civil pela Escola Politécnica da USP, mestranda em Engenharia Civil também pela Poli e trabalhei nos últimos anos como engenheira perita de obras. Sou casada há 27 anos, tenho 3 filhos (Júlia, Lucas e Luisa) e sou moradora da Zona Sul de São Paulo, no bairro do Morumbi.\r\nCansada de tanto abandono, corrupção e incompetência na administração pública decidi me candidatar a vereadora de São Paulo para dedicar meu tempo e conhecimento para a fiscalização do executivo municipal e a proposição de leis e projetos que venham atender as demandas e desafios de nossa cidade.\r\nAs bandeiras que venho defender são proteção dos animais e acessibilidade. \r\nComo engenheira, eu convivo com as normas de acessibilidade na construção e adaptação de espaços há anos, mas como candidata pretendo levar essas questões para o debate público! Eu trabalho para que a inclusão e a garantia dos direitos sejam a base da acessibilidade, para integrar as pessoas e fazer uma sociedade melhor.\r\nDesde pequena eu cresci com animais e sempre tive paixão por eles. Hoje, tenho dois gatinhos que adotei da rua e eles fazem parte da família. Como candidata quero ajudar outros animais a encontrar um lar ou ajuda quando precisarem, para que possam viver saudáveis e felizes. Ao mesmo tempo, desejo auxiliar outras famílias a terem condições de cuidarem de seus bichinhos, evitando doenças com as campanhas de vacinação e de castração, ou mesmo com o hospital público veterinário em mais regiões da cidade. E as empresas também podem ajudar! Por isso vamos chamar a iniciativa privada para trabalhar conosco em prol da cidade, mudando a vida dos animais e trazendo mais cidadania a todos os habitantes de São Paulo, inclusive para os de quatro patas!','m.isabel.rt@terra.com.br','1151668241520564'),(19,'Dalmare Anderson','PARDA','MASCULINO','MASCULINO','1989-11-29','Farmacêutico de 26 anos, militante desde os 18 anos no movimento estudantil de farmácia. A vivência no movimento fez eu me aceitar homossexual, desde então luto para que os espaços de militância sejam sempre locais de braços abertos a todos. Sou um candidato da defesa do SUS, da população LGBT e da juventude. \r\n\r\nOs nossos sonhos não estão representados, a juventude QUER voar!\r\n\r\nVeja minhas propostas em www.facebook.com/dalmaresa\r\n\r\n#Dalmare65456\r\n#AJuventudeQuerVoar','dalmare.anderson@gmail.com','1168294506579071'),(20,'Luiza Coppieters','BRANCA','MASCULINO','MASCULINO','1979-07-06','Luiza Coppieters é professora de filosofia há 16 anos. Formada pela Universidade de São Paulo (USP), defende uma educação pública, gratuita e de qualidade. Como militante do movimento feminista e do movimento de Lésbicas, Gays, Bissexuais e Transexuais (LGBT), Luiza participa de discussões sobre gênero e feminismo – tanto nos espaços acadêmicos quanto nas periferias. Foi eleita pelo segmento de mulheres transexuais para o Conselho Municipal de Políticas LGBT da cidade de São Paulo.','luizacoppieters50@gmail.com','608471055991165'),(21,'Paulo Pimentel','BRANCA','MASCULINO','MASCULINO','1980-05-12','Paulistano, 36 anos,formado em medicina com residência em oftalmologia pela FAMERP, morador da zona sul, bairro Paraíso,solteiro, dois filhos ( guilherme e doc, cãozinho de estimação), ambos com 4 anos.Rodou o mundo estudando e trabalhando desde os 15 anos, e hoje se divide entres SP, Franco da Rocha, Mato Grosso e o mundo atuando como médico oftalmologista privado e SUS, e médico clínico voluntário no INSTITUTO KALEO, organizando e participando de missões humanitárias no Brasil e ao redor do mundo.','Paulinhousa@icloud.com','10210462826836388'),(22,'Carla Salasário Ayres','BRANCA','FEMININO','FEMININO','1988-03-15','QUEM É CARLA AYRES?\r\nPaulista, nasceu em 15 de março de 1988 em Jales interior de São Paulo, Carla Ayres desde muito jovem desenvolveu atividades de militância. Ainda no ensino fundamental integrou grêmio estudantil de sua escola e filiou-se ao Partido dos Trabalhadores daquele município aos 16 anos. Graduou-se em Ciências Sociais (2007-2010) pela Universidade Estadual de Maringá no Paraná,  fez Mestrado em Ciência Política (2011-2013) na Universidade Federal de São Carlos em São Paulo. Hoje aos 28 anos, Carla Ayres cursa doutorado em Sociologia Política na Universidade Federal de Santa Catarina (UFSC) e desponta atuante no município de Florianópolis entre os movimentos de mulheres e feministas, bem como ao movimento LGBT. \r\nIntegrou a Comissão Pró-Criação do Conselho Estadual LGBT junto à Secretaria Estadual de Assistência Social, o que na prática significou auxiliar na construção do PL 315/13 que objetiva a implementação do Conselho Estadual LGBT em Santa Catarina. No Município de Florianópolis, Carla Ayres também atuou junto ao Movimento LGBT local na construção da Lei que garante a criação do Conselho Municipal LGBT. Dialogou com vereadores, secretários do município e coordenadorias. O Conselho fora aprovado em abril de 2016; Carla Ayres integrou ainda equipe de organização das Conferências Municipal e Estadual de Políticas LGBT.\r\nEntre os anos de 2012 e 2013 Carla Ayres foi Conselheira Nacional junto ao Conselho Nacional de Combate à Discriminação LGBT; e entre os anos de 2013 e 2014 atuou profissionalmente como Consultora do Programa das Nações Unidas para o Desenvolvimento (PNUD/ONU) numa pesquisa sobre o desenvolvimento de Políticas Públicas LGBT no Brasil, o que lhe trouxe um patamar ainda mais elevado na experiência e conhecimento das diferentes realidades e necessidades acerca do assunto. \r\n\r\nCOMO CARLA AYRES PRETENDE ATUAR?\r\n“Eu entendo que a atividade legislativa deve ser a mais aberta e próxima da população possível. Compreendo que o município já dispõe de diferentes Planos Municipais de Políticas Públicas de várias temáticas, e que na maioria dos casos estas propostas foram debatidas em sua concepção em audiências e conferências públicas. Pretendo valorizar e tomar estes princípios como base de minha atuação. Além disso, caso eleita, pretendo realizar um mandato participativo com plenárias cidadãs periódicas para debater junto com a população as matérias em tramitação da Câmara de Vereadores, a fim de orientar meus posicionamentos; pretendo dialogar com as cidadãs e cidadãos as prioridades a serem levadas à Câmara, bem como as estratégias de atuação. Somente desta forma o título de ‘representante do povo’ faz sentido”. \r\n\r\nQUAIS SÃO AS PROPOSTAS DE CARLA AYRES?\r\nO que norteia minha plataforma é a defesa dos direitos já democraticamente conquistados pela luta dos movimentos populares. Acredito que pensar a cidade é uma tarefa que deve vir acompanhada da participação social e da diversidade de pensamentos, inclusive nos espaços políticos de representação, como a Câmara de Vereadorxs. Por este motivo, defendo a construção de uma cidade #Plural por meio de uma gestão laica que vise a democratização do acesso ao conjunto de seus espaços públicos.\r\nPrecisamos juntas(os) construir e garantir políticas públicas de combate à violência contra as mulheres e contra pessoas LGBT; precisamos construir medidas de valorização da mobilidade urbana na melhoria do transporte coletivo e alternativos, valorizar as diferentes expressões culturais, e melhorar a vida das e dos jovens.','carlazzl@hotmail.com','1235438759842087'),(24,'Tulio Cária','BRANCA','MASCULINO','MASCULINO','1994-03-28','Jovem, 22 anos, engajado e visionário: esse é Tulio Caria. \r\nTulio tem uma história de envolvimento com trabalhos em favor da justiça social, de uma educação para a cidadania e para a valorização da vida, e em favor das liberdades civis, que remonta à sua adolescência, quando atuava junto às Pastorais da Juventude Estudantil da Igreja Católica e também no Grêmio Estudantil dos colégios onde estudou.\r\n\r\nParceiro dos movimentos da juventude, secundaristas, LGBTs, negros, de mulheres e índios, Tulio participa de ações que combatem os preconceitos de gênero, a intolerância, o fundamentalismo religioso e a violência contra a mulher. Também está atento e atuante com relação aos direitos dos animais indefesos da cidade.\r\n\r\nTulio é graduando em Direito pelo Centro Universitário Newton Paiva, foi eleito Presidente do Diretório Acadêmico Juscelino Kubitschek para os mandatos 2013-2016, trabalhou como assessor parlamentar na Câmara dos Deputados, é membro ativo da OAB Jovem e das Comissões de Direito Médico e da Saúde e Direito Empresarial e também é membro do projeto Direito na Escola, onde voluntariamente leciona aulas de Direito nas escolas públicas. Túlio já sabe de qual lado está: ao lado do povo!','tuliocaria@yahoo.com.br','1086412114740276'),(25,'Edson Vander','PARDA','MASCULINO','MASCULINO','1971-07-03','Presidente da OGES, militante  pelos direitos de iqualdade , conhecedor e autor de projetos  como \'festival OrgulhoLGBT=VIX, projeto social \"Dando uma mão\" de resgate social  identificando e direcionando ao mercado de trabalho pessoas da sociedade civil em geral, e em especial pessoas trans .\r\n\" Diversidade não é só de gênero é religiosa, racial etc.\r\n.A diversidade é uma dádiva,\r\ne todos temos que estar orgulhosos de\r\nquem somos.\r\nAceitar a diversidade è colaborar por um futuro melhor para todos !\"\r\n\r\n  EDINHO BLANCHER 23111 VITÓRIA DE TODOS!\r\n','blancher@outlook.es','10207337502291545'),(27,'Fernando Galdino','BRANCA','MASCULINO','MASCULINO','1977-06-10','','MAXGALDINUS@HOTMAIL.COM','180623272366796'),(33,'Mauro Fernandes','BRANCA','MASCULINO','MASCULINO','1979-11-13','Publicitário de formação, artista por vocação. \r\nSou o quarto filho da Dona Marina e do \"Seu\" Joao, em 2016 completo 37 anos.\r\nBem casado e feliz papai dos gatos Cleo e Otto e do cachorrinho Igor. \r\nTodos vira-latinhas adotados que estavam no nosso destino com todos os lambejos e \"probleminhas\" que cada um trouxe consigo.\r\nEmpresário do ramo de entretenimento me dedico ha 29 anos a dança e o fazer artístico que envolve TV, radio, teatro e musica. \r\nPresidente e fundador de diversos movimentos culturais como o UNIDAS sou também conselheiro do COMUC e CMIC em BH com o objetivo de garantir que as ações culturais sejam legitimadas e realizadas sem desvios. \r\nNenhum desses cargos e remunerado e o faco por plena indignação.\r\n\r\n','mauro.incd@gmail.com','1058080580905621'),(36,'Vitor Carvalho Rodrigues','BRANCA','MASCULINO','MASCULINO','1989-10-15','Sou Vitor Carvalho Rodrigues, Relações Públicas, estudante de Direito e militante do PSOL.','vitor_carvalho16@hotmail.com','10207283729311222'),(41,'Carina Silva','BRANCA','FEMININO','FEMININO','1986-02-10','Mulher, lésbica, vegetariana. Militante da pauta de criança e adolescente, assim como da Juventude. A partir da atuação de conselheira tutelar, identifiquei várias demandas locais que requerem atenção, uma delas são as comunidades distritais.\r\nOcupo a candidatura como resistência ao cenário nacional (também municipal) que tem atuado de forma extremamente machista e patriarcal.\r\nO uso de dread no período de pré campanha é respeito e admiração a população negra, saber das dificuldades de enfrentar o racismo, não é ser vítima dessa prática excludente.\r\nPor vivenciar situações de preconceito, me coloco a disposição para representar as demais pautas que de \"minoria\" são somente os direitos:\r\n- Pessoa Idosa\r\n- Pessoa portadora de deficiência','ser.carina@gmail.com','1062111137236759'),(42,'Ed Marte','BRANCA','MASCULINO','MASCULINO','1968-04-03','Ed Marte- não binária, queer, artista visual e educador social, vem de Martinho Campos, interior de Minas, e se fez\r\n\r\ncidadão belorizontino, assim como milhares de pessoas que buscam aqui um lugar para viver e\r\n\r\ntrabalhar. Ed Marte é fruto das recentes lutas sociais da população da capital, como as\r\n\r\nmanifestações de 2013, a Praia da Estação e do movimento político-artístico- cultural que\r\n\r\ndeságua na mobilização da população LGBTIQ’s, no renascimento dos blocos de carnaval, na\r\n\r\nluta por moradia e por um ensino que ofereça oportunidades iguais para todos, na busca de\r\n\r\nrespeito aos direitos humanos e na defesa da arte e cultura plural e descentralizada. Hoje Ed\r\n\r\nMarte é reconhecido por sua entrega ativa e amorosa à cidade de BH, movido pelo sonho de\r\n\r\ntornar nossa cidade um espaço fraterno, onde a vida feliz, a democracia cidadã e os interesses coletivos sejam prioridades.\r\n\r\nEd Marte desenvolveu um modo afetivo e criativo de se relacionar com a cidade. O\r\n\r\nreconhecimento das classes artística e cultural, dos ativistas, das juventudes, dos passantes,\r\n\r\nconfirma sua inserção na paisagem da cidade, que tece a cada dia novos projetos de\r\n\r\nparticipaçao e cidadania. Sua formação em Relações Públicas, Teatro e Artes Visuais estimulou\r\n\r\nseu encontro com a cidade, suas pessoas e seus desejos. Na experiência do Arena da Cultura\r\n\r\n(Escola Livre de Artes), foi aluno e se tornou professor nas áreas de Patrimônio Cultural e Artes\r\n\r\nVisuais.\r\n\r\n Atualmente, Ed Marte é Yogi e professor da Rede Estadual de Educação, na Escola Estadual\r\n\r\nJovem Protagonista, trabalhando com adolescentes em cumprimento de medidas nos Centros\r\n\r\nde Internação Sócio-educativos. Atua como mobilizador social na ONG Favela é Isso Aí, além\r\n\r\nde fazer parte da rede de apoiadores de diversas ocupações urbanas no centro e nas\r\n\r\nperiferias.\r\n\r\nEsse acumulo de vivências levou-o ao coletivo “Muitas” e ao PSOL, que este ano apresenta\r\n\r\nalternativas à sucessão na câmara de vereadores de BH. A candidatura de ED Marte é o\r\n\r\nresultado do sonho de discutir e trabalhar com todas as vozes da cidade pela “Cidade Que\r\n\r\nQueremos“.\r\n','edmarte2010p@gmail.com','1235851753126353'),(44,'Bruno Maia','BRANCA','MASCULINO','MASCULINO','1981-04-13','Militante das causas populares, o candidato é presença constante em diversas mobilizações de rua desde 2012, especialmente no embate contra o fundamentalismo religioso e sua infiltração nos poderes, como na última disputa das eleições municipais de São Paulo, quando o candidato da Igreja Universal, Celso Russomanno, liderava as pesquisas. Essa luta, inclusive, acaba de recomeçar, pois Russomanno está processando Todd na esfera eleitoral e civil, depois dele ter publicado um texto com razões para não votar no candidato.  \r\n\r\nOutro embate foi quando forças teocráticas ultraconservadoras dominaram a Comissão de Direitos Humanos da Câmara Federal, na figura de Marco Feliciano. Todd iniciou esse enfrentamento com protestos de rua e uma petição com mais de meio milhão de assinaturas. Também foi a primeira figura do mundo político a alertar sobre o perigoso Eduardo Cunha, quando este ainda era um ilustre desconhecido e candidato à presidente da Câmara. Organizou diversos atos em todo o Brasil contra Cunha já no inicio de 2015.\r\n\r\nA campanha aborda temas progressistas que entram em rota de colisão com interesses econômicos poderosos, como a especulação imobiliária, a máfia dos transportes, além da proteção para setores religiosos vulneráveis, especialmente os de matriz africana. A pauta irá abordar ainda os grupos LGBT, observando a particularidade de cada uma dessas populações, que possuem demandas específicas, como as travestis e transexuais.\r\n\r\nTodd Tomorrow lutará pelo direito dos grupos minorizados e historicamente estigmatizados, como negros e mulheres, além da valorização do estado laico, princípio para ele inegociável.','toddtomorrow@protonmail.com','1000512920065665'),(46,'Fred Buriti','PARDA','MASCULINO','MASCULINO','1983-08-08','Sou metropolitano e como milhares de pessoas me tornei belo-horizontino escolhendo BH como minha cidade, minha casa, meu lugar.\r\n\r\nHoje estou candidato a vereador por uma cidade que estimule e promova mais participação popular, inclusão e representatividade, em especial, da população de LGBTIQ, da qual faço parte.\r\n\r\nEm nossa cidade, centenas de pessoas sofrem discriminação por serem quem são. A LGBTfobia exclui, machuca e mata. Não é mais possível ficarmos fora dos lugares onde são tomadas decisões importantes sobre nossos direitos e nossas vidas. \r\n\r\nPor inclusão e representatividade LGBTIQ, vote Fred Buriti 50.888.','fredmesmo@gmail.com','709821035833803'),(47,'Gleyk Silveira','PARDA','MASCULINO','MASCULINO','1981-08-10','Trabalhei na Prefeitura de Santa Luzia por quase 10 anos , onde atuei politicamente na cidade . Vim para Belo Horizonte há 9 anos onde ajudei , sou atuante e co-fundador de movimentos de Direitos Humanos, LGBT e de minorias. No último ano conversamos sobre nos colocarmos à frente das disputas eleitorais, tendo como incentivadora a deputada federal Jo Moraes , que sempre foi apoiadora dessas pautas e chegamos à concluisão de que precisamos realmente de representatividade na camâra municipal de Belo Horizonte , principalmente na questão LGBT, pnde ser aliado não é a mesma coisa que estar à frente das lutas. Durante os últimos 4 anos ouvi de todos e todas LGBT que precisamos de representatividade , que queriam LGBT em todos os espaços , inclusive o político , visto que apoiadores não conseguem apresentar nossas pautas de forma concreta e foi pelo clamor desses LGBt que me candidatei. Espero que essas falas sejam realmente um apoio para nossas candidaturas visto que muitos LGBT apoiam héteros por várias questões , esquecendo até mesmo de suas palavras enquanto no movimento. Precisamos avançar nas políticas e somente um de nós pode fazer isso com seriedade e comprometimento. ','gleyksilveira@gmail.com','10202129475196186'),(48,'Isadora Penna','BRANCA','FEMININO','FEMININO','1991-03-28','Meu nome é Isa Penna, sou advogada trabalhista formada pela PUC-SP, especialista em casos de assédios e candidata a vereadora de São Paulo/SP pelo PSOL. Durante todo o ano articularmos a campanha #SPPrasMinas, que realizou uma série de reuniões com mulheres de diferentes cantos da cidade de São Paulo para construir um programa coletivo em cima das principais demandas sentidas na pele por nós. Chegamos na formulação do PL #SPPrasMinas, que visa criar um Fundo Municipal de Investimento pelo Direito das Mulheres para ampliar e qualificar a Rede de Enfrentamento à violência contra mulher, promover campanhas educativas e qualificar servidores sob a perspectiva de gênero.\r\n\r\nMinhas principais pautas são o combate a violência contra as mulheres; a defesa da universalização das vagas em creches e a construção de restaurantes e lavanderias comunitárias; a criação de centros esportivos femininos; o aumento da iluminação pública nas periferias de São Paulo e o atendimento humanizado para mulheres em situação de violência sexual, com coquetel antiDST e realização do aborto seguro. Construímos uma campanha coletiva e aberta, que também tem como objetivo aumentar a participação política das mulheres e da juventude.\'','isa.penna.psol@gmail.com','643668402462024'),(49,'Denilson Costa','BRANCA','MASCULINO','MASCULINO','1977-09-11','Dezessete anos junto aos movimentos sociais lutando pela cidadania LGBT, ex Coordenador de Políticas Públicas para Diversidade Sexual da Cidade de Barueri, membro fundador do Grupo Diversidade Barueri que foi responsável pela I Conferência Livre LGBT da Região Oeste da grande São Paulo, colaborador do Projeto Transempregos, membro da Comissão de Atenção à Diversidade Sexual de Osasco e Região da Comissão da Diversidade Sexual e Combate à Homotransfobia da 117ª Subseção da OAB Barueri e 56ª Subseção da OAB Osasco – SP.\r\n\r\n','denilson_egbara@hotmail.com','861478560620689'),(51,'Thiago Costa','PARDA','MASCULINO','MASCULINO','1988-07-14','Quem é Thiago Costa 54765 Vereador?\r\n\r\nJovem Ativista e Militante LGBT de 28 anos, é morador da Comunidade do Loteamento Santa Terezinha no Bairro Novo Mondubim em Fortaleza que vem de uma família tradicional do Bairro Parque São José também em Fortaleza com raízes nos municípios Canindé e Quixadá no interior do Ceará. \r\n\r\nThiago Costa 54765 Vereador é engajado com movimentos sociais, líder comunitário reconhecido e envolvido com grupos de Terceira Idade, Escolinhas de Futebol, Campanhas do Abraço e o Dia D – Dia das Crianças nas Comunidades.\r\n\r\nGestor de Recursos Humanos, formado pela UNIP – Universidade Paulista e Acadêmico de Serviço Social. Fundador e Presidente de Honra da ASTER – Associação Comunitária de Moradores e Amigos do Loteamento Santa Terezinha e Adjacências, do Grupo Movimente-se (formado por jovens LGBT) e da ANLGBT – Associação Nordestina de Lésbicas, Gays, Bissexuais, Travestis e Transexuais, Secretário de Diversidade Sexual do PPL Fortaleza, além de Suplente de Vereador de Fortaleza e de Deputado Estadual do Ceará. \r\n\r\nThiago Costa 54765 Vereador vem se destacando a frente da comunidade LGBT, como ativista e militante independente, nas esferas municipal, estadual e nacional, desenvolvendo ações que promovem visibilidade, interação e luta por garantia dos direitos da população LGBT, bem como de toda a população que vive à margem da sociedade.\r\n\r\n#eulutopelosdireitoshumanos?\r\n?#eulutopelapopulaçãolgbt?\r\n?#SomosMaisThiagoCosta54765Vereador?\r\n?#OFuturoComeçaAgora?!','thiagoscostas@globo.com','798164546953257'),(52,'Leonardo Cisneiros','BRANCA','MASCULINO','MASCULINO','1976-08-04','Leo Cisneiros é professor de filosofia na UFRPE, ativista incansável pelo direito à cidade e está agora candidato a vereador do Recife pelo PSOL. É uma das pessoas que fez o debate crescer no Recife e trazer à tona, frente aos desafios do bem estar cotidiano e das desigualdades, a relação entre a mobilidade, a moradia, os espaços públicos, o meio ambiente, o patrimônio histórico-cultural e o planejamento urbano no sistema que forma a cidade.  Sua participação no grupo Direitos Urbanos tem testado os limites de nossa democracia: por um lado, prova que todo cidadão pode muito e, por outro, tem mostrado que poder compartilhado incomoda e é preciso lutar a cada passo para fazê-lo valer. ','leonardo.cisneiros@gmail.com','1384139744933730'),(53,'Ivan Moraes Filho','BRANCA','MASCULINO','MASCULINO','1976-05-24','Para Ivan Moraes, estar mobilizado e disposto para debater – suas ideias ou outras completamente diferentes - é algo tão espontâneo quanto respirar, alimentar-se, amar. É assim há 40 anos, desde criança nas ruas do Recife, onde nasceu em maio de 1976.\r\n?\r\nA primeira causa que o atraiu perdeu-se em sua memória, mas lembra do interesse pelas primeiras eleições presidenciais após o fim da ditadura militar, principalmente do acirrado segundo turno entre Fernando Collor e Lula. Só não participou mais dos comícios e passeatas porque mal havia entrado na adolescência.\r\n?\r\nPouco tempo depois estava na Escola Técnica Federal (o atual IFPE), matriculado no curso de Química. Foi quando conheceu a uma escola pública. Também viveu ali sua primeira experiência de engajamento, no caso uma brevíssima participação na diretoria do grêmio da escola.\r\n?\r\nIvan acabou se formando, anos à frente, em Jornalismo. Afinal de contas queria escrever, viajar e mudar o mundo. Trabalhou em jornais e até numa agência de publicidade. Durante alguns anos, ganhou a vida assim. Até que largou tudo e danou-se para a África.\r\n?\r\nTrabalhar pouco mais de um ano como voluntário em Moçambique, em um programa de controle da epidemia do vírus HIV, se não mudou sua vida, representou uma fase de autoconhecimento e a definição do caminho que pretendia seguir dali em diante.\r\n?\r\nSem água encanada, sem dinheiro no bolso e dedicando seus dias para contribuir com a prevenção da Aids e melhorar a vida de uma população muito vulnerável o fez descobrir que a felicidade não está em ter carro de luxo, casa própria, roupas caras e muitos objetos caros. Na África, Ivan descobriu que a receita da felicidade é muito simples.\r\n?\r\nVoltou a decidido a só trabalhar em atividades que contribuíssem para mudar o mundo. A “fazer o bem”, como costuma dizer para simplificar as coisas. De tanto desejar e procurar, foi contratado pelo Centro de Cultura Luiz Freire, em Olinda, onde completou sua formação em Direitos Humanos.\r\n?\r\nNo CCLF – onde ainda atua -, participou da luta pela comunicação como um direito humano, por uma educação de qualidade e inclusiva, pela garantia do estado laico e por políticas culturais realmente democráticas. Conheceu o movimento antiproibicionista e tem lutado pela implementação plena da Rede de Assistência Psicossocial (RAPS) e contra o desmonte das poucas políticas sobre drogas em nossa cidade e nosso estado.\r\n?\r\nNos debates e discussões gerados por essas lutas, Ivan destacou-se não apenas pelo seu compromisso, mas também pela sua capacidade de escutar e de falar com clareza, sem agredir ou desrespeitar o interlocutor – qualidade rara!\r\n?\r\nHá mais de uma década, Ivan participou ativamente da fundação do Fórum Pernambucano de Comunicação (Fopecom) e criou – muito antes das redes sociais – o OmbudsPE, espaço pioneiro de análise diária e leitura crítica da mídia pernambucana, em que a sociedade dialoga com os jornalistas e os representantes dos veículos de mídia. Colocar no ar a Rádio Frei Caneca, a recém fundada emissora pública da Fundação de Cultura do Recife, foi outra causa que contou com o empenho de Ivan.\r\n?\r\nA necessidade de contrapor-se ao discurso da mídia tradicional fez com que Ivan, junto a amigos e amigas da produtora Ateliê, criassem o programa Pé na Rua, que vai ao ar nas tevês públicas desde agosto de 2009. De lá para cá, em cinco temporadas, produziu quase 100 programas que aumentaram a voz da periferia da Região Metropolitana do Recife e a mais de 120 municípios de cinco estados nordestinos. A iniciativa consolidou sua crença de que o protagonismo das pessoas é fundamental para a libertação de suas comunidades.\r\n?\r\nNo campo do direito à cidade atuou ativamente do movimento #Ocupe Estelita, participando das audiências públicas, da construção de estratégias da sociedade civil - inclusive de comunicação -, do dia-a-dia da ocupação, da resistência na desocupação. Isso tudo na busca pela garantia a uma cidade mais justa e igualitária para as pessoas, em que estas tenham voz e possam decidir sobre a sua cidade.\r\n?\r\nFruto de toda a dedicação com a causa dos direitos humanos, em 2011, Ivan ganhou o prêmio James Wright e em 2016 foi escolhido pela revista Good Magazine como uma das 100 pessoas no mundo que estão agindo para um mundo melhor.\r\n?\r\nCom essa maneira de ver o mundo e de atuar, a candidatura de Ivan Moraes a vereador do Recife não poderia ser resultado de uma ambição pessoal. Pelo contrário, é resultado de uma mobilização coletiva de milhares de pessoas que percebem que Ivan já representa e defende seus sonhos e convicções. Essa mobilização gerou a iniciativa Agora é com a gente, criada em abril de 2016 para potencializar a participação política de quem não se acomoda e não aceita a extinção dos direitos dos mais vulneráveis e das minorias.\r\n?\r\nHoje, Ivan Moraes se lança como candidato a um assento como vereador da cidade do Recife no mandato de 2016 a 2020 e se propõe a ser a nossa voz na Câmara Municipal da Cidade, propondo legislações que coadunam com o que a cidade precisa em diálogo direto com a população. Ivan também se propõe a atuar na fiscalização do orçamento público e da gestão municipal, algo que Ivan sempre fez, faz e que dá continuidade a sua exemplar trajetória política. Fiscalizar e legislar em prol de uma cidade mais justa, menos desigual. Uma cidade de e para todas e todos!\r\n','ivanzinho@hotmail.com','10157305834265618'),(54,'Pedro Josephi','PRETA','MASCULINO','MASCULINO','1990-03-07','Sou filho dos professores José Maria Silva, da cidade de Palmeirina, e Denise Maria de Souza e Silva, da cidade de João Alfredo, ambos do interior de Pernambuco. Daí minha matutice. Nasci e me criei no bairro da Estância (ou Areias? Nunca soube), na altura da Avenida Recife, no Residencial Ignez Andreazza, maior conjunto habitacional fechado da América Latina (nossas manias de grandezas próprias do Recifense).\r\n.\r\nEstudei no Colégio Souza Leão, no IPSEP, depois no Imaculada Conceição, no Barro, e mais tarde naquele que contribuiu de maneira fundamental na minha educação, o Colégio Nóbrega, no bairro da Boa Vista. Terminei no ensino médio, no Salesiano. Desde muito jovem participei ativamente das pastorais e grupos jovens da Igreja Católica, em especial àqueles na antiga Capela de Santo Antônio, hoje Paróquia, localizado na Vila Tamandaré.\r\n.\r\nCursei Direito na Universidade Católica de Pernambuco, onde participei ativamente do movimento estudantil, integrando o Coletivo MUDA e sendo presidente e secretário do Diretório Acadêmico Fernando Santa Cruz e secretário do Diretório Central dos Estudantes Dom Hélder Câmara. Ainda na graduação, construi e coordenei a FENED – Federação Nacional de Estudantes de Direito – percorrendo o Brasil com debates e caravanas pelas Faculdades de Direito a mobilizar os (as) estudantes para as pautas progressistas, populares e uma maior aproximação junto aos movimentos sociais.\r\n.\r\nNa UNE, participei da Oposição de Esquerda, atuando no Movimento Rompendo Amarras e posteriormente no JUNTOS! Em 2012, ajudei a fundar a Frente de Luta pelo Transporte Público de Pernambuco, sucessora dos antigos Comitês Contra o Aumento das Passagens e Movimento Passe Livre. E no ano seguinte, durante as Jornadas de 2013, colaboramos de maneira fundamental naqueles numerosos atos e movimentos na defesa do transporte e da mobilidade urbana. Em 2014, fui candidato a deputado estadual pelo PSOL Pernambuco, quando conseguimos eleger o primeiro deputado estadual pelo partido, Edilson Silva.\r\n.\r\nJá formado, e como jovem advogado, passei a integrar o Movimento A Ordem é Para Todos e coordenei a campanha para OAB Pernambuco do advogado Jefferson Calaça, no ano de 2015. Atualmente, curso o Mestrado em Direito na Universidade Católica de Pernambuco, faço parte da Direção da AATP – Associação de Advogados Trabalhistas de Pernambuco, colaboro com a RENAP – Rede Nacional de Advogados (as) Populares e integro a banca do escritório JM Advogados. Eu sou Pedro Josephi, essa é minha história e hoje sou candidato a vereador da cidade do Recife pelo PSOL!','pedrojosephi@hotmail.com','1070372096382527'),(56,'Cristina Biscaia','BRANCA','FEMININO','FEMININO','1971-10-13','Cristina Biscaia, é graduada em Direito pela Universidade Cândido Mendes, advogada de Propriedade Intelectual com Pós-Graduação pela PUC-RJ e Mestrado pelo Munich Intellectual Property Law Center - Alemanha. É professora universitária pela mesma universidade em que se graduou.  Sempre teve forte ligação com o mundo das artes, é poeta e escritora com dois livros publicados. Estudou canto como hobby, o que a fez assumir um papel junto à Associação Brasileira de Canto - ABC, da qual chegou a ser Vice Presidente. É ativista do movimento #partidA feminista e atualmente tem como hobby tocar percussão nos blocos de carnaval do Rio de Janeiro (Quizomba e Chinelo de Dedo). É filiada à Associação Brasileira de Famílias Homoafetivas - ABRAFH. Quer trasnformar o Rio na Capital da Mulher, mas em todos os substantivos femininos que sustentam uma cidade: ética, segurança, educação, saúde, cultura e folia. ','cnbiscaia@hotmail.com','10155129788874045'),(58,'Nilcea Freire','BRANCA','FEMININO','FEMININO','1952-09-14','Sou carioca, divorciada, mãe de dois filhos, avó de três netas. Médica formada pela UERJ, militei ativamente contra a ditadura militar. Na UERJ,  fui professora, Vice-Reitora e em 2000 fui eleita para o cargo de Reitora. Como dirigente da UERJ tive o privilégio de Implantar pioneiramente o sistema de cotas raciais e sociais numa universidade pública brasileira.\r\n\r\nEntre 2004 e 2010, exerci o cargo de  Ministra da Secretaria de Políticas para as Mulheres. Entre as muitas conquistas deste período  destacam-se a “Lei Maria da Penha”, a criação do Ligue 180 e do Pacto Nacional de Enfrentamento à Violência contra as Mulheres. \r\n\r\nComo Ministra , conduzi as duas primeiras Conferências Nacionais de Políticas para as Mulheres e presidi o Conselho Nacional de Direitos da Mulher, em permanente diálogo com os movimentos feministas e de mulheres, resguardando sua autonomia e diversidade.\r\n\r\nNos últimos cinco anos, atuei apoiando projetos, em particular os de combate ao racismo e à desigualdade visando a inclusão dos segmentos mais negligenciados pelas políticas públicas e sociais, em especial, mulheres, em toda sua diversidade, indígenas, jovens, negros e negras. \r\n\r\nAgora,  pretendo utilizar toda a  experiência que acumulei durante estes anos , para um mandato na câmara de Vereadores que seja dinâmico, popular e que ajude a cada carioca a viver num Rio de direitos. ','nilcea.freire@gmail.com','1417990654884572'),(59,'João Francisco Ferreira','PRETA','MASCULINO','MASCULINO','1974-09-19','João Ferreira serviu às Forças Armadas durante sete anos, trabalhou na  Secretaria de Saúde da Prefeitura do Rio de Janeiro por cinco anos e atualmente é servidor público do Estado do Rio de Janeiro.\r\nCasado, evangélico, consciente das necessidades urgentes das comunidades. Tem como prioritários  a educação integral de jovens e adolescentes, melhoria das condições de acessibilidade, dos transportes e  implementação de projetos de gestão e conscientização ambiental nas áreas carentes do município.','vantagemparavoce@gmail.com','1246735582023903'),(62,'Adriann Passos','PARDA','MASCULINO','MASCULINO','1978-09-10','Adriann Passos, Educador Social, filho de (Gel)  Eugelia F. de Araujo e Ademir  \r\ndos Passos, todos nascidos e criados no bairro da várzea. Conhece o bairro e \r\nas pessoas como ninguém. Foi um dos fundadores do Grupo Atuação, de Jovens e Homens Pelo Fim da Violência Contra as Mulheres e do Grupo Gaymado da Várzea na Luta por Direitos Iguais a população – LGBT (Gays, Lésbicas, Bissexuais, Travestis e \r\nTransexuais) e os Direitos Humanos, trabalhou por quase seis anos na área de saúde no - Centro de Saúde Olinto Oliveira (Posto de Saúde da Caxangá ) e na Policlínica \r\nLessa de Andrade ( Posto da Madalena) como Agente Administrativo no setor de Marcação de Consultas, Vacinação e na Psiquiatria. Depois foi convidado a trabalhar na Secretaria de Direitos Humanos e Segurança Cidadã \r\nna Gerencia de Livre Orientação Sexual da Prefeitura do Recife na defesa e \r\ngarantia dos direitos de todos e todas os/as cidadãos recifenses, \r\nprincipalmente dos/as LGBTs, Pessoas Idosa, Crianças e Adolescentes, Pessoas com Deficiência, Negros(as), Mulheres, Juventudes e de Combate a Tortura. \r\nAdriann Passos conhece bem o Recife e as dificuldades vivida por muitos/as \r\nrecifenses e vem para a disputa do pleito para defender, garantir e fazer a \r\ndiferença na vida das pessoas e das comunidades do Recife.\r\n Adriann Passos assim como você e se cansou de ouvir promessas e demagogia de políticos que só pensam em garantir seus mandatos e de ganhar dinheiro as custa do sofrimento do povo.\r\nAdriann Passos entrou na política através dos movimentos estudantis e de juventude aos 14 anos e foi um dos fundadores do Grupo Atuação, grupo de Homens Jovens na luta Pelo Fim da Violência Contra as Mulheres e 2005 fundou juntos os amigos o Grupo Gaymado da Várzea na Luta por Direitos Iguais a população – LGBT (Gays, Lésbicas, Bissexuais, Travestis e Transexuais) e dos Direitos Humanos. \r\nAdriann Passos apoiou diversos políticos, que assim como você acabou se decepcionando com a política e alguns políticos.\r\nMas agora chegou à vez do povo ter voz e voto para decidir onde será usado o dinheiro \r\npúblico do município e seu primeiro desafio será e criar leis que o Recife precisa para se desenvolver com propostas e leis que busquem dá uma melhor qualidade de vida e a garantia dos direitos humanos e basicos para os/as recifenses. ','adriannpassos2@gmail.com','10205054277036835'),(64,'Leandro Alano','','','','1980-08-01','Nascido de mãe cabeleireira e do lar, e pai segurança e motorista, no bairro Santana, Leandro cresceu na Cohab Cavalhada, Partenon e Gloria e estudou em escolas públicas. Cursou jornalismo e filosofia na Federal e na Jesuíta e também é radialista. Ministro religioso, cumpriu missão no exterior ensinando uma mensagem de reconciliação com a paz e a felicidade na família e no amor. Como trabalhador, atuou em diversas áreas, desde militar, carteiro, até comercio e indústria, enquanto custeava os estudos. De volta ao Brasil, atualmente trabalha em um banco público, é casado e pai de dois filhos.\r\nComo militante político desde 1988, fez campanha, atuou no movimento estudantil secundarista e universitário, foi dirigente de juventude partidária e de grêmio estudantil. Também foi vice-presidente de Conselho Escolar. Progressista, filiou-se ao PT em 1995 e se converteu monarquista em 2007. Lidera criação da frente monarquista Aliança Restauração Nacional, do comitê político suprapartidário Progressista-Teodemocrata e do coletivo Restaurar o PT, grupo interno com visão crítica da direção partidária. Se reaproximou do partido para se candidatar a vereador e usar candidatura e mandato na organização da classe trabalhadora e resistência ao avanço do conservadorismo e do fascismo.','leandroalano@icloud.com','10208104970435158'),(65,'Adriana Alves','BRANCA','FEMININO','FEMININO','1979-02-01','ADRIANA ALVES 23979, nascida no Recife aos 01/02/1979. Filha de Edmilson Roberto da Silva e Luzinete Alves dos Santos,  estou determinada à juntos com a minha comunidade, trazer grandes projetos, principalmente na área da educação. ','adrianaalves1977@hotmail.com','1098639656895060'),(66,'Luisa Stern','BRANCA','FEMININO','FEMININO','1966-03-16','Luisa Stern é mulher transexual, advogada, transfeminista, militante dos Direitos Humanos, dos direitos LGBT e pela cidadania de travestis e transexuais, integrante da Comissão Especial da Diversidade Sexual e de Gênero da OAB/RS e atualmente é Vice-Presidenta do Conselho Municipal de Direitos Humanos de Porto Alegre.\r\n\r\nTem atuação destacada no movimento social de travestis e transexuais, atuando como assessora jurídica da ONG Igualdade RS - Associação de Travestis e Transexuais do Rio Grande do Sul.\r\n\r\nTambém atua como advogada voluntária em serviço de assessoria jurídica universitária, especialmente em casos de violência doméstica da Lei Maria da Penha, discriminação contra pessoas LGBT e em mutirões de processos de retificação do registro civil de travestis e transexuais.','luisa.stern@gmail.com','10209491830586209'),(71,'Kátia Bastos','PARDA','FEMININO','FEMININO','1979-03-30','Sou professora, casada, mãe e acredito em uma politica honesta com um mandato participativo do população do município de SP.\r\nSOZINHO O PROBLEMA É SEU, JUNTOS O PROBLEMA É NOSSO.','katya.sabino@yahoo.com.br','1068021823312817'),(73,'Luiz Rogério Guarani Kaiowá','PARDA','MASCULINO','MASCULINO','1984-12-26','Luiz Rogério da Silva \r\nBlog. www.luizrogeriodasilva.blogspot.com.br/\r\nSite. www.facebook.com/LuizRogeriodsilva/\r\nFace. www.luizsilvarogerio.wixsite.com/rede18\r\n\r\nNascido na zona leste de São Paulo é morador do Aricanduva, Luiz Rogério da Silva é Vegetariano, brasileiro, nascido em 1984, começou sua atuação na política ainda jovem, começou sua atividade política ainda jovem quando inicio o curso de Filosofia pela Pontifícia Universidade Católica SP onde começou a participar do movimento estudantil. e na luta pelo passe livre.  Tipico cidadão paulistano que enfrenta as dificuldades diárias da grande cidade, Jovem Sonhador, ativista político, militante pelas ideias da sustentabilidade.  \r\n\r\nDesde então não parou mais de buscar caminhos para melhoria da sociedade atuando em diversas mobilizações em São Paulo, sendo a mais relevante as grandes manifestações contra aumento das tarifas em SP que culminou com as grandes manifestações de junho 2013.\r\n\r\n\"Nesta árdua trajetória, muitos foram os ensinamentos, conflitos as angústias, mas acima de tudo sempre tive firmeza nos propósitos a chegar. Quero ajudar nossa sociedade promovendo mais políticas publicas que possam transformar a realidade do cidadão paulistano,  ajudar a construir um novo Brasil, uma São Paulo mais justa e Sustentável\".\r\n\r\nNossas propostas para São Paulo esta intitulado no programa São Paulo Sustentável que pode ser lido abaixo. \r\n\r\nSão Paulo Sustentável \r\nUm Projeto Político em Construção\r\n\r\nSaudações a todos (a)s, é com grande alegria que venho através deste manifesto anunciar minha Candidatura á Vereador ao pleito eleitoral de 2016, pela cidade de São Paulo. Esta decisão não foi fácil, primeiramente pela busca sob qual agremiação política sairia este processo, na minha visão política não basta apenas filiar se a um partido sem comprometimento, tem que conectar-se ao seu conteúdo programático, pelos valores, pela relação entre as pessoas, pela ética partidária e busca dos valores universais, garantindo assim um maior processo de participação direta.\r\nNeste momento a REDE SUSTENTABILIDADE  é o caminho.\r\n\r\nO século XXI passa por transformações significativas em todos os aspectos da sociedade; culturalmente, economicamente, socialmente e ambientalmente.\r\nNão podemos compactuar com a lógica nefasta do poder pelo poder, pelo político desonesto que coloca os interesses privados acima dos interesses públicos, pela corrupção, o descaso com a sociedade.\r\n\r\nOs governos do Mundo passam por uma crise estrutural, proveniente da ausência de sinergia com os anseios e lutas da sociedade. E cada vez mais o sociedade mostra sua insatisfação com a classe política.\r\n\r\nVenho através desta Candidatura, propor um novo pacto com sociedade trazendo uma gestão política baseada em valores que há muito tempo foi perdida pela velha classe política que se guia unicamente por interesses pessoais, corporativos.\r\nA juventude pode revolucionar, e este processo esta em curso, basta observarmos a realidade. Do movimento intitulado primavera árabe pela derrubada dos ditadores, por um novo mundo, os movimentos de ocupações de símbolos do velho mundo capitalista, pelas lutas dos jovens na América Latina.\r\n\r\nAo longo da sua leitura você irá se deparar com as principais propostas que farão parte da minha orientação política neste processo. Acredito que mudar é possível, que sonhar é viável, e pela mudança, pela nova forma de se fazer política neste país que me apresento à sociedade como protagonista, como sendo a força jovem para transformação, pelos novos valores, pelo resgate das ideais/sonhos há muito tempo perdida pela velha classe política.\r\n“a educação que liberta e propõe a conscientização do sujeito torna-se uma educação critica como instrumentalização para prática social.”\r\n        \r\n        Luiz Rogério da Silva - Candidato Vereador 18101 - Rede Sustentabilidade\r\nNascido na zona leste de São Paulo é morador do Aricanduva, Luiz Rogério da Silva é o tipico cidadão paulistano que enfrenta as dificuldades diárias da grande cidade, Jovem Sonhador, ativista político, militante pelas ideias da sustentabilidade.\r\n                          \r\n                               \r\n\r\nSumario\r\n\r\nManifesto político                                                   \r\nDesenvolvimento Sustentável                                \r\nPropostas de gestão                                                \r\n. O conceito de Governabilidade                  \r\n. São Paulo sustentável                                          \r\n. Juventude                                                      \r\n. Arte, Cultura e Dança                                          \r\nOutras Iniciativas                                                   \r\n       . Habitação \r\n       . Saúde  \r\n       . Mobilidade Urbana \r\nConsiderações Finais                                               \r\n\r\n\r\nO que significa; Desenvolvimento Sustentável.\r\nDesafios para o Século XXI\r\n\r\nA crise social planetária coloca á humanidade a urgência de refletir sobre os rumos para o futuro em todas as suas variantes, econômica, sociais e ambientais.\r\nSustentado sobre á visão de crescimento econômico a qualquer custo, por anos de exploração irresponsável dos recursos naturais do planeta, incentivo ao consumo irresponsável da sociedade impondo padrões de consumo de forma que sejamos seduzidos a adquirir um determinado produto sem nenhum tipo de reflexão sobre sua utilidade e origem. É hora de mudar!\r\nChegamos ao limite do sistema capitalista de produção, não podemos mais continuar negligenciando os acontecimentos, que nos mostram que estamos indo contra a realidade dos fatos, dia após dia a natureza vem nos dizendo da pior forma possível, com perdas de vidas, sofrimento e destruição.\r\nQue esta mãe que nos acolheu por milhões de anos dando abundância e riqueza já não aguenta mais sofrer calada.\r\nA milhões de anos sob a lógica de domino da natureza pelo homem, vem alterando o meio ambiente conforme suas necessidades e luxos, porém chegamos à reflexão que estamos errados. É necessário que estejamos em sintonia com o sistema biológico que nos circunda, necessitamos entender que fazemos parte desta grande cadeia viva chamada Planeta Terra. Com o avanço da sociedade industrial do século XIX e o processo de globalização do século XXI o processo destrutivo tornou-se mais rápido, intenso e selvagem.\r\nOs danos são irreparáveis e irreversíveis, porém podemos diminuir a intensidade de retirada de matéria prima da natureza respeitando seu ritmo e diminuindo a emissão de CO2 na atmosfera, minimizando o aquecimento global e reduzindo a temperatura da Terra em mais 2°C. Nosso projeto é pautado por três pilares fundamentais dos quais isoladamente não conseguem dar respostas eficientes há esta nova realidade da sociedade brasileira e mundial.\r\nO Projeto de Sustentabilidade vem em alternativa á discussão crise social planetária coloca á humanidade a urgência de refletir sobre os rumos para o futuro em todas as suas variantes, econômica, sociais e ambientais.\r\nSustentado sobre á visão de crescimento econômico a qualquer custo, por anos de exploração irresponsável dos recursos naturais do planeta, incentivo ao consumo irresponsável da sociedade impondo padrões de consumo de forma que sejamos seduzidos a adquirir um determinado produto sem nenhum tipo de reflexão sobre sua utilidade e origem. É hora de mudar!\r\nChegamos ao limite do sistema capitalista de produção, não podemos mais continuar negligenciando os acontecimentos, que nos mostram que estamos indo contra a realidade dos fatos, dia após dia a natureza vem nos dizendo da pior forma possível, com perdas de vidas, sofrimento e destruição.\r\nEsta mãe chamada Planeta TERRA que nos acolheu por milhões de anos dando abundância e riqueza já não aguenta mais sofrer calada.\r\n\r\nA milhões de anos sob a lógica de domino da natureza pelo homem, vem alterando o meio ambiente conforme suas necessidades e luxos, porém chegamos à reflexão que estamos errados. É necessário que estejamos em sintonia com o sistema biológico que nos circunda, necessitamos entender que fazemos parte desta grande cadeia viva chamada Planeta Terra. Com o avanço da sociedade industrial do século XIX e o processo de ão do velho modelo desenvolvimentista, propondo uma nova relação entre os seres humanos, e por sua vez, entre a natureza. O elemento novo consiste justamente em entender uma nova maneira de se pensar o ordenamento social, bem como a promoção de novos valores sociais.\r\n\r\nSegundo a definição consagrada e simplificada do Relatório “Nosso futuro comum” (Comissão Brundtland), desenvolvimento sustentável deve ser entendido como “aquele que satisfaz as necessidades do presente sem comprometer a capacidade das gerações futuras satisfazerem as suas próprias necessidades” ( Comissão, 1988 )\r\n\r\nDesenvolvimento Sustentável, este é o projeto que defendemos ao Brasil, mas o que vem a ser este conceito que vem sendo apropriados por muitos demagogos e diferentes sujeitos, nos mais diversos contextos sociais, assumindo diversos sentidos.\r\nSustentabilidade pode ser conceituada como o “processo de mudança social e elevação das oportunidades da sociedade, compatibilizando no tempo e no espaço, o crescimento e a eficiência econômica, a conservação ambiental, a qualidade de vida e a equidade social, partindo de um claro compromisso com o futuro e da solidariedade entre gerações”. 1 (Buarque, 1994)\r\nO desenvolvimento sustentável cria duas solidariedades: sincrônica, com a geração à qual pertencemos, e diacrônica, com as gerações futuras (Sachs, 1990)Ou seja que as necessidades de subsistência das gerações atuais, não pode comprometer a oportunidades e necessidades da futura.\r\nPodemos destacar três eixos fundamentais para designar o projeto de desenvolvimento Sustentável;\r\n\r\n. a elevação da qualidade de vida e a equidade social constituem objetivos centrais do modelo de desenvolvimento, orientação e propósito final de todo esforço de desenvolvimento no curto, médio e longos prazos;\r\n\r\n. a eficiência econômica e o crescimento econômico constituem pré-requisitos fundamentais, sem os quais não é possível elevar a qualidade de vida com equidade. Dessa forma, representa uma condição necessária, embora não suficiente, do desenvolvimento sustentável;\r\n\r\n. a conservação ambiental é um condicionante decisivo da sustentabilidade do desenvolvimento e da manutenção no longo prazo, sem a qual não é possível assegurar qualidade de vida às gerações futuras e equidade social sustentável e contínua no tempo e no espaço.\r\n\r\nPorém os conceitos apresentados vêm em conjunto de uma série de outros pontos indissociáveis de nossa proposta, no qual a matriz necessária para que toda esta visão colocada seja possível é justamente o trabalho de consciência social.\r\nEducar para a sustentabilidade é estabelecer entre suas dimensões e princípios uma proposta para um novo paradigma que estimule a democracia e a participação em amplo aspecto entre os seres humanos junto ao meio em que se vive.\r\n\r\nO processo de consciência na historia da humanidade sempre foi o agente capaz de transformar a realidade para a emancipação de um novo processo civilizatório.\r\nAtualmente, o avanço para uma sociedade sustentável é permeado de obstáculos, na medida em que existe uma restrita consciência na sociedade a respeito das implicações do modelo de desenvolvimento em curso. Pode-se afirmar que as causas básicas que provocam atividades ecologicamente predatórias são atribuídas às instituições sociais, aos sistemas de informação e comunicação e aos valores adotados pela sociedade.\r\n\r\nMas aos poucos notamos uma nítida abertura da sociedade para este novo conceito de desenvolvimento, as empresas, a sociedade cível organizada e alguns setores governamentais já realizam este debate, reconhecendo que este é o passo para o futuro.\r\nPorém para que haja mudança significativa nas estruturas da sociedade moderna de produção não podemos limitar a proposta de sustentabilidade apenas ao Brasil ou qualquer outro país isolado, todas as nações do Mundo necessitam entender esta realidade, pois não adianta um processo evolutivo em determinado canto do planeta se não for uma base de orientação comum a todos.\r\nUm novo padrão de desenvolvimento, formulado dentro dos princípios da sustentabilidade exige novos pressupostos políticos e ético, decorrentes de um processo democrático fortalecido e da ampliação da cidadania, baseados no principio de ação direta da sociedade nos problemas que as norteiam, enfase da aproximação da sociedade civil organizada com o poder público. O desenho de nossas políticas públicas, os nossos processos de produção e os nossos padrões de consumo ainda não induzem ao uso responsável dos recursos naturais, à conservação de energia em todas as suas formas e ao combate ao desperdício.\r\nÉ preciso sair do modelo vigente reducionista, mecânico e sem vida para um modelo complexo, holístico, vivo e orgânico.\r\nSustentabilidade vai muito além da questão ambiental, a questão do meio ambiente é condição necessária, mas não o suficiente para esse novo modelo de Brasil que queremos, este novo modelo de Brasil inclui um comprometimento profundo com a ética, com a inclusão social, á transparência, combate a corrupção com a responsabilidade dos gestores públicos, com a penalização daqueles que assumem suas funções publicas, mas na verdade tem interesse privado.                    \r\n\r\nPlataforma de ação para uma cidade forte, justa e preparada para enfrentar os desafios de sec. XXI.\r\nPropostas de gestão para São Paulo. \r\n\r\n   O conceito de Governabilidade. \r\n Uma nova forma de se fazer política.\r\n\r\nVivemos uma crise de representação em toda esfera do Poder Público; Municipais, Estaduais e Federais, frutos de um longo período de práticas nefastas que não condizem com o cargo publico a tal qual a sociedade os confiou. Má utilização dos recursos púbicos, corrupção, enriquecimento ilícito, utilizar estrutura publica para fins privados ou de outros interesses essas são algumas condutas de maus gestores públicos.Estado cada vez mais se afasta da sociedade, e desconhece totalmente sua realidade tratando o povo como numero, estatísticas, dados. E esquecem que por trás de vários relatórios existem seres humanos que sofrem, que tem sentimento que são violentados diretamente e indiretamente pela ineficiência do Poder Público, pela má administração, pela falta da visão estratégia na aplicação dos recursos ao município.\r\nMas a sociedade do século XXI, não é mais conivente com este tipo de postura, e cobra do poder público maior transparência na gestão e participação. Trago uma nova forma de atuação política para construir um amplo movimento em torno para um projeto político junto com a sociedade civil. Promover a participação cidadã, incentivar a ação da sociedade e levar suas demandas ao poder competente.\r\n\r\n\r\nAlgumas iniciativas na gestão pública que adotarei na condição de Vereador por São Paulo. \r\nDa gestão Administrativa e o mandato de Vereador. \r\n\r\nAção Direta/ Democracia Participativa; este é o novo método de conduta política que levarei para administração pública no que compete às atribuições Vereador pela Cidade de São Paulo aproximando a sociedade junto ao poder publico.\r\n\r\nTrabalhar para fortalecer e disseminar desde as subprefeituras até a câmara municipal, os mais diversos canais de participação do munícipe na construção e consolidação nos recursos do orçamento e na criação de novas leis que atendam a necessidade e especificidade de cada distrito da cidade.\r\n\r\nTrabalhar com metas e indicadores; Todos os setores da administração devem trabalhar em sintonia, sob um conjunto de indicadores e metas que permitirão avaliar o alcance e resultados das ações.\r\n\r\nTransparência de ação e fiscal; no processo de gestão administrativa é fundamental expor a sociedade de que forma esta sendo conduzidas a ação do parlamentar a qual foi confiado o gerir e fiscalização da administração pública. Com esta prática colocamos a sociedade a confiança na ação parlamentar.\r\n\r\nSão Paulo Sustentável\r\n\r\nNo Brasil a população urbana chega a cerca de 85%, na medida que as cidades vão crescendo em espaço e população, fica cada vez mais inviável manter o equilíbrio nas mais diversas variáveis; ambiental, social e espacial.\r\nVivemos em uma cidade com cerca de 11.253.503 habitantes, São Paulo esta entre uma das cidades mais populosas do Brasil, do continente americano e de todo hemisfério sul do mundo, considerada a quarta maior aglomeração urbana do mundo.\r\n\r\nResta-nos uma pergunta, sob a lógica do desenvolvimento sustentável como podemos promover ações e implementar leis, com o intuito de criar uma cidade melhor, garantindo a qualidade de vida da população e manter todos os avanços que construímos durante gestões públicas anteriores ?\r\nNão é uma tarefa fácil, não existe um modelo a seguir bem definido, mas é o momento primordial para nossa cidade.\r\n\r\nUm estudo realizado na capital aponta que cerca de mais de  80% das leis criadas em 2010 até os dias atuais refere-se a mudanças de nomes de ruas e honrarias, fato esse demonstra a ineficiência dos atuais vereadores a responderem por demandas prioritárias para cidadão paulistano.   \r\nQual será o grau de relevância dessas leis ao município ?  Qual seu o impacto na vida cotidiana da sociedade ? \r\n\r\nPodemos avançar muito mais na criação de uma legislação mais aprimorada que responda a real necessidade que os bairros carecem e promova a visão de uma cidade modelo.   \r\nAssumo como compromisso em defesa, estudo e proposições e aprovação de PLs encaminhados pela executivo a Câmara Municipal do PROGRAMA CIDADES SUSTENTÁVEIS, elaborado pela Rede Nossa São Paulo, Rede Social Brasileira por Cidades justas e Sustentáveis e Instituto Ethos, em parceria com outras entidades. \r\n  \r\nNecessitamos Vereadores compromissados em edificar uma cidade baseada na lógica do desenvolvimento aliada ao compromisso com o bem estar social e ambiental. Aplicando nas várias estâncias da administração publica indicadores e metas para Sustentabilidade, tornando nossa São Paulo uma Cidade modelo.\r\n\r\nManter o desenvolvimento econômico aliado à equidade social e responsabilidade ambiental, esse é o desafio que várias cidades do mundo irão enfrentar neste século. São Paulo não pode ficar na retaguarda deste novo pensar, somos importante neste processo para dar o pontapé inicial nesta empreitada e servir de modelo para os diversos municípios da federação.\r\nAs frentes de ações são muito amplas e envolvem vários agentes sociais; o poder público, o setor empresariado e a sociedade civil. O gestor público tem a responsabilidade de buscar esta aproximação dos mais diversos setores e atores sociais na promoção de leis de incentivo as políticas públicas voltadas ao conceito de cidade sustentável.\r\n\r\nPolítica Municipal de Meio Ambiente;\r\n\r\n. Fortalecer política municipal de coleta seletiva em parceria com órgãos governamentais, ONGs, movimentos sociais ( Movimento de Catadores). Ou seja, 100% de Coletiva Seletiva do Lixo e com grande participação da população. Hoje apenas 2% da cidade tem coleta seletiva do lixo.\r\n\r\n. Licitação sustentável; Fortalecer Projeto de lei que atenda as compras do executivo em processos de licitações sustentáveis e aprimorar a legislação vigente em âmbito Municipal. Conforme acordo assinado pela secretária do verde e meio ambiente no seminário “conexão sustentável”.\r\n\r\n. Criação de projeto de lei que obriga a todo novo prédio público que for entrar em operação seja edificada de forma sustentável em todos os aspectos, desde sua construção (quando necessário) até a finalização com equipamentos de para captar luz do sol para produção de energia e aproveitar água das chuvas e reuso.\r\n\r\n. Fiscalizar e fortalecer o projeto de lei 530/2008, que institui a política municipal de mudanças climáticas.\r\n\r\n. fomento e ampliação da construção dos parques lineares.\r\n\r\n. Consolidação da lei municipal de resíduos Sólidos, capacitando e valorizando os coletores de materiais recicláveis em um modelo de prestadores de serviços ambientais urbanos.\r\n\r\nECONOMIA VERDE; Na linha da geração de empregos na economia verde , promover a recuperação e a promoção ambiental como oportunidade para a geração de novas promoções de trabalho, renda e empregos. Enfatizar a recuperação das áreas degradadas, o reflorestamento, a logística reversa e a reciclagem, a produção de biocombustíveis e de energias limpas, o transporte pouco poluente e o turismo sustentável.\r\n\r\n. Promover as “comprar públicas sustentáveis” para que os Estado dê o exemplo e utilize seu poder de compra para induzir as transformações na direção da economia verde do século XXI.\r\nEstabelecer estímulos fiscais e tributários á produção limpa (com destaque ás atividades de reciclagem e logística reversa intensas em utilização de mão de obra) e onerar as atividades mais poluentes e que mais desperdiçam recursos naturais, sem, no entanto, elevar o nível geral de impostos. Aplicar, em conjunto como os municípios, os instrumentos da política nacional.\r\n\r\n. Desenvolver o transporte público de qualidade no município de São Paulo, com investimentos maciços na ampliação da rede, nos corredores de trólebus, na ampliação de ciclovias e ciclo faixas e restrição progressiva de carros em regiões classificadas da cidade.\r\n\r\nEducação \r\nA qualidade da educação talvez seja o exemplo mais candente de nossas contradições. Vivemos um modelo educacional baseado na lógica da formação para o mercado, no qual inibe o processo de formação e estimulo ao ser pensante e à formação do senso critico. Vivemos novos tempos e não cabe mais um sistema de ensino baseado na lógica do século passado.\r\nApenas 60% dos estudantes completam a 8ª série, e, dos que chegam ao ensino médio, menos da metade completam o ciclo. Nas avaliações de qualidade de ensino comparando mais de 41 países o Brasil aparece em 37º em leitura e penúltimo em matemática e ciências. São grandes os desafios que temos pela frente com relação há temática da educação.\r\n\r\n. Adequar o sistema educacional aos desafios do desenvolvimento sustentável, com a inclusão no currículo escolar, desde o ensino fundamental ao ensino médio como matéria obrigatória à temática socioambiental.\r\n\r\n. Solução urgente de CRECHE para todas as Crianças da Cidade. São cerca de 174.000 de Crianças sem Creche. A Cidade mais rica do Brasil não pode continuar com esta grave EXCLUSÃO DAS CRIANÇAS.\r\n\r\n.  Fomentar a formação de professores através de leis de incentivo e melhoria de salários e ambiente de trabalho.\r\n\r\n. Concentrar investimentos na educação, principalmente no ensino médio profissionalizante. (definir parâmetros).\r\n\r\nCultura, arte e Dança\r\nConsiderada modalidade esportiva, a dança de salão pode ser bem mais que uma simples atividade de recreação.Benéfica à saúde, a prática auxilia na prevenção e tratamento de doenças físicas e emocionais.\r\nA dança em si, além de uma prática prazerosa, pode ser um método terapêutico para ajudar no combate a diversos males, mas há inúmeros benefícios relacionados à dança que são pouco conhecidos pela maioria das pessoas, como o aumento na capacidade de fixação do cálcio nos ossos, consequentemente na prevenção da osteoporose; na correção da postura; na melhora da circulação sanguínea e no combate ao sobrepeso. Para que mais pessoas possam desfrutar deste beneficio a Dança pode tornar-se política pública para o bem estar do cidadão.\r\n\r\n. Caminhando de acordo com  Projeto de Lei 7032/10, do Senado no qual estabelece como disciplinas obrigatórias da educação básica as artes visuais, a dança, a música. Estabelecer políticas claras de incentivo e prática de Dança contemporânea, Salão entre outras “O incentivo ao ensino dessas linguagens artísticas propicia, simultaneamente, o desenvolvimento pessoal do indivíduo e a preservação da cultura nacional e a Inter regionalidade .\r\n\r\n\r\nJUVENTUDE\r\nA juventude significa força e potencia, cuidar dos nossos jovens é garantir um futuro prospero e virtuoso. Ser jovem é uma etapa fundamental da nossa vida, este período é fator decisivo para escolha da carreira, na construção da família, na agregação de valores. Entendo que a juventude é à base de sustentação do nosso futuro a União, os Estados e Municípios tem a grande responsabilidade com o processo de formação deste segmento.\r\nA realidade que a juventude passa nos dias atuais é de grande abandono por conta do poder público.\r\n. Trabalhar em sintonia com a Coordenadoria Estadual e Municipal de Juventude a fim de avançar na implementação das PPJ (Política Pública de Juventude).\r\n. Promover centros de juventude para fins de desenvolvimento de todo tipo de aptidão seja elas nas áreas de esporte, arte, musica, teatro, capacitação profissional e centro de sociabilizarão.\r\n. Fazer valer conforme lei aprovada a criação de 1 estação de juventude por subprefeitura. (definir Paremetros) \r\n. Criação de programas de escolarização e profissionalização de jovens em conflitos com a lei.\r\n\r\nOUTRAS INICIATIVAS   \r\n\r\nPolítica Municipal de Habitação; \r\nPolíticas estratégicas a cidade com a finalidade de acabarem com o desordenamento social urbano, garantindo maior qualidade de vida à população e proteção das áreas de proteção permanente (APP).\r\n\r\n. Fortalecer iniciativas de projetos que busquem a revitalização do centro de São Paulo, reformando e ocupando os prédios públicos abandonados para fins de moradia popular.\r\n\r\n. Política de desenvolvimento e divulgação de técnicas alternativas para a construção de baixo custo;\r\n\r\n. Ampliar o investimento na urbanização de favelas e em mutirões comunitários.\r\n\r\n. Garantir equipamentos, serviços e áreas verdes em todos os programas habitacionais.\r\n\r\nSaúde; \r\nOutro problema a enfrentar e a degeneração da saúde pública, as superlotações em hospitais. È inadmissível ouvir noticia de pessoas morrendo na espera de atendimento dentro do hospital, o investimento do SUS, Sistema Único de Saúde tem que ser entendido como fundamental para garantir aqueles que não dispõem de uma rede hospitalar particular para ser atendido em caso de urgência. Temos que fazer da Saúde Publica um exemplo á ser seguido garantindo um ótimo atendimento qualitativo e preventivo.\r\n\r\n. Garantir a agilidade no agendamento e realização de consultas, retornos, exames, entrega de resultados e cirurgias, mediante ampliação e valorização do profissional da rede pública.\r\n\r\nPromoção de leis em defesa de segmentos vulneráveis; Lutar e implementar políticas públicas para combater todas as formas de discriminação; étnica, racial, religiosa, homofobia, sexismo e garantir a cada grupo espaço próprio de participação política e de respeito e atenção às suas demandas específicas, ou seja, uma porta de entrada para suas reivindicações, clara e bem identificada.\r\n\r\n. Incentivar a criação nas subprefeituras de redes não-governamentais de atendimento a vitima de violência domestica, violência de gênero, violência racial, pedofilia e exploração sexual e todo tipo de atentado aos Direitos Humanos em parceria com a Comissão de Direitos Humanos do Município de São Paulo.\r\n\r\nPromoção e assistência social; Implementar políticas sociais que garantam uma renda mínima escolar associada às estratégias de formação profissional, sintonizadas as novas demandas do mercado econômico do século XXI, de forma a favorecer a inclusão produtiva e comunitária.\r\n\r\nMobilidade Urbana;\r\nInvestir e incentivar o transporte público em São Paulo é garantir maior qualidade de vida a sociedade uma vez que muitos trabalhadores que utilizam do atual sistema de Transporte Urbano passam horas presos em enormes engarrafamentos causados pelo grande volume de veículos trafegando pelas vias da cidade no qual não comportam mais tal situação. Estaremos contribuindo com o meio ambiente, uma vez que incentivaremos o transporte coletivo colaborando com a diminuição da emissão de gases que agravam o problema do aquecimento global.\r\n. Introdução de políticas restritivas ao transporte individual a fim de beneficiar o transporte público. Fortalecendo as propostas já existentes de redução das áreas de estacionamento, criação do pedágio urbano, ampliação das calçadas.\r\n           \r\n                             \r\nCONSIDERAÇÕES FINAIS\r\n\r\n\r\nÉ com humildade, mas não com menos firmeza que através da REDE SUSTENTABILIDADE faço um pacto com as aspirações da sociedade civil, que os mesmos valores que norteiam o nosso Partido será o guia de atuação política na gestão pública do Município de São Paulo. São grandes os desafios aqui propostos e será necessária uma grande coalizão para que os indicadores acima sejam alcançados, mas uma vez assumido o compromisso com a sociedade temos que lutar o máximo possível para poder cumprir as necessidades e carências de políticas publicas de qualidade. \r\n\r\nA força que inquieta as almas juvenis em busca de mudanças radicais é a mesma energia que me faz acreditar que um novo modelo de gestão pública é possível, que uma nova forma de relação entre poder público e sociedade esta surgindo. Vários foram os movimentos que sacudiram o mundo e que alteraram as relações sociais de forma considerável, no qual o espírito da força, dos sonhos, das bandeiras de lutas dos jovens em movimento levou ao atual estagio democrático no Mundo.\r\n\r\nOs valores que norteiam nossas propostas são visões dos valores humanos e solidários num movimento de caráter universal, rumo à abundância e à paz?\r\n\r\nSei que o caminho não será fácil, porém assim como muitos anônimos lutaram na aspiração de um mundo melhor, sinto-me na obrigação de colocar-me a frente deste processo de mudança por acreditar que OUTRO mundo é possível.\r\n\r\nLuiz Rogério da Silva \r\nCandidato a Vereador São Paulo\r\nREDE SUSTENTABILIDADE\r\nVOTE 18101 \r\n  ','luizsilvarogério@hotmail.com','10205624855135820'),(76,'Danilo Strano','BRANCA','MASCULINO','MASCULINO','1987-12-13','Com 28 anos Danilo Strano, filiado ao PT desde 2008, é um jovem político criado somente por sua mãe Josefina.\r\nFormado em Ciências Políticas pela PUC-SP, atualmente tem uma agência de comunicação digital.\r\nFundador do #ExisteCarnavalemSP, tag de expansão orgânica nas redes sociais, criada em 2013 para estimular os recentes blocos de rua da cidade de São Paulo, milita em grupos da juventude pela ocupação do espaço público.','strano_danilo@yahoo.com.br','1173998375999934'),(77,'Salvador Serrato','BRANCA','MASCULINO','MASCULINO','1962-03-11','Sou Consultor Sênior em Finanças, Palestrante e Professor, escrevo Artigos em Blog, Jornais, Revistas, sou Membro do GEAF - Grupo de Excelência Financeira do CRA SP, Membro do CADES – Conselho Regional de Meio Ambiente, Desenvolvimento Sustentável e Cultura da Paz, Assinei o Apoio ao Projeto Cidades Sustentáveis da Rede Nossa São Paulo, com ampla experiência em Gestão Empresarial nos segmentos de Indústria, Comércio e Serviços.\r\n\r\nMBA em Gestão Empresarial pela FGV – Fundação Getúlio Vargas de São Paulo, Pós Graduado em Administração de Empresas com ênfase em Finanças, pela FECAP – Fundação Escola de Comércio Álvares Penteado, Graduado em Ciências Contábeis pela Universidade Capital – SP. Vasta experiência profissional no Empreendedorismo, Cooperativismo e Associativismo, como Dirigente, Gestor. Atuante no Voluntariado. \r\n \r\nSempre próximo à Gestão Pública, Serrato traz como propostas de trabalho, atuar no fortalecimento e melhoria das condições de atuação, no que concerne às responsabilidades do Município e futuras parcerias: das Pequenas e Médias Empresas, do Empreendedorismo, Cooperativismo e Associativismo, da Sustentabilidade e Saneamento Básico,\r\n \r\nJuntos, fortaleceremos as Ações em prol do Crescimento e Desenvolvimento das Pessoas e do Município de São Paulo. \r\n\r\nSalvador Serrato Vereador DEM 25255\r\n','salvador.serrato@hotmail.com','10205802903905997'),(80,'Givanildo Giva','INDÍGENA','MASCULINO','MASCULINO','1968-10-11','Givanildo é indígena da etnia fulni-ô, nascido no interior de Pernambuco. Como boa parte das famílias nordestinas, migrou para São Paulo ainda na infância, tendo crescido no Jardim São Luís (bairro periférico da zona sul de São Paulo). \r\n\r\nO processo de formação política de Givanildo teve início logo na sua adolescência, aos 14 anos, através da inserção das Comunidades Eclesiais de Base nas periferias da cidade na década de 80. Formou-se em História pela PUC, no entanto, teve as seguintes atuações profissionais: Conselheiro Tutelar em primeira gestão em 1992; Educador Social na antiga Febem, tendo auxiliado na elaboração do ECA, como coordenador do Fórum Estadual de Defesa dos Direitos da Criança e do Adolescente; Educador Social da Assistência Social para a criança e adolescente em situação de rua, abrigos e medida sócio-educativa. Atualmente trabalha como Educador em projetos de formação de trabalhadores da Assistência Social que atuam em diversas áreas.\r\n\r\nComo atuações militantes, entre outras, tem as seguintes lutas: \r\n\r\n- Lutas pelos Grêmios Livres (início de sua militância em 1983);\r\n\r\n- Militante em Direitos Humanos;\r\n- Movimento pela Defesa dos Direitos da Criança e do Adolescente (educador social e autor do livro \"Cidadão criança, cidadão adolescente\"), @[NjQyMTgzOTU5MjA4MTA3Omh0dHBcYS8vd3d3LmRobmV0Lm9yZy5ici9kYWRvcy9saXZyb3MvYVxicGRmL2xpdnJvXGJnaXZhbmlsZG9cYmNpZGFkYW9zXGJjYS5wZGY6Og==:http://www.dhnet.org.br/dados/livros/a_pdf/livro_givanildo_cidadaos_ca.pdf])\r\n\r\n- Fundador e militante do Comitê pela Desmilitarização da Polícia e da Política (organizador do livro Desmilitarização da Polícia e da Política: uma resposta que virá das ruas, boitempo) @[NjQyMTgzOTU5MjA4MTA3Omh0dHBzXGEvL2Rlc21pbGl0YXJpemFjYW8ud29yZHByZXNzLmNvbS86Og==:https://desmilitarizacao.wordpress.com/])\r\n\r\n- Militante e membro da Coordenação Estadual do Movimento Terra Livre (luta pela reforma agrária e pela democratização do acesso à moradia nos centros urbanos, @[NjQyMTgzOTU5MjA4MTA3Omh0dHBcYS8vbWFpcy51b2wuY29tLmJyL3ZpZXcvMXB6cGFkcjVqa2dqL3F1YWwtby1tb2RlbG8tZGUtY2lkYWRlLXF1ZS1xdWVyZW1vcy0tcXVhdHJvdi0tZXAtMTItMDQwMjRFOUIzMTZBRDhCMTUzMjY/dHlwZXM9ViUyQ0YuLi4lMkNGLi4uJTJDRi4uLiUyQ0Y6Og==:http://mais.uol.com.br/view/1pzpadr5jkgj/qual-o-modelo-de-cidade-que-queremos--quatrov--ep-12-04024E9B316AD8B15326?types=V%2CF...%2CF...%2CF...%2CF]...&)\r\n\r\n- Organizador do evento \"Tribunal Popular: O Estado Brasileiro no Banco dos Réus\" (o qual se desdobrou como movimento de denúncia e combate permanentes aos crimes e violações de direitos perpetrados pelo Estado, @[NjQyMTgzOTU5MjA4MTA3Omh0dHBcYS8vdHJpYnVuYWxwb3B1bGFyMjAwOC5ibG9nc3BvdC5jb20uYnIvOjo=:http://tribunalpopular2008.blogspot.com.br/]).\r\n\r\n- Fundador do Grupo de Trabalho Indígena (vinculado ao Movimento Tribunal Popular, o GT atua em defesa dos povos indígenas na floresta e na cidade, @[NjQyMTgzOTU5MjA4MTA3Omh0dHBzXGEvL3VuaWFvY2FtcG9jaWRhZGVlZmxvcmVzdGEud29yZHByZXNzLmNvbS8yMDE0LzEwLzI0L21hbmlmZXN0by1kby1ndC1pbmRpZ2VuYS1kby10cmlidW5hbC1wb3B1bGFyLW8tZXN0YWRvLWJyYXNpbGVpcm8tbm8tYmFuY28tZG9zLXJldXMvOjo=:https://uniaocampocidadeefloresta.wordpress.com/2014/10/24/manifesto-do-gt-indigena-do-tribunal-popular-o-estado-brasileiro-no-banco-dos-reus/]).\r\n\r\n- Fundador e militante do Movimento Amparar - Associação de Amigos e Familiares de Presos(as) (@[NjQyMTgzOTU5MjA4MTA3Omh0dHBcYS8vYXNzb2NpYWNhb2FtcGFyYXIuYmxvZ3Nwb3QuY29tLmJyLzo6:http://associacaoamparar.blogspot.com.br/]).','givaluden2@hotmail.com','1815814422034394'),(81,'Marcelo Rocha Garcia','PARDA','MASCULINO','MASCULINO','1988-06-15','Médico, ativista do movimento LGBT, trabalhador do SUS desde que me formei, em 2012. Militante do movimento LGBT, em defesa da cultura de matriz africana e em defesa do SUS e da saúde pública desde 2008.\r\nPraticante de religião de matriz africana desde os 14 anos.','marcelorocha88@gmail.com','1040263909425677'),(83,'Edmar Luz','BRANCA','MASCULINO','MASCULINO','1960-06-15','Quem é Edmar Luz \r\nEu nasci em Jacinto, no Vale do Jequitinhonha (MG), uma das regiões mais pobres do Brasil e do mundo. \r\nSou formado em Jornalismo pela Universidade Federal de Juiz de Fora (MG), atuei em diversos jornais, revistas e TVs, como O Globo, Manchete, A Gazeta, TV Vitória (ex-Rede Manchete), Folha da Tarde, Diário do Comércio e Indústria, Shopping News e Diário do Grande ABC. Conquistei dois Prêmios Esso Regionais de Reportagem, pelo jornal “A Gazeta”, de Vitória-ES, com os temas “Juventude de periferia” e “A crise e a fé”. A partir de 1996, passei a editar revistas sobre empreendedorismo e a atuar na coordenação de campanhas eleitorais na Grande São Paulo, em especial nas cidades de Santo André e São Bernardo do Campo. Como filiado ao PPS, fui assessor parlamentar na Assembleia Legislativa do Estado de São Paulo (2007-2008) e, em seguida, Secretário Municipal de Comunicação de São Bernardo do Campo, de 2009 a 2011.\r\nNuma breve passagem pelo PMDB, fui candidato a vereador de São Bernardo, em 2012, e a deputado federal, por São Paulo, em 2014.\r\nDe volta ao PPS, sou o único candidato a vereador da cidade de São Paulo, onde resido desde 1988, ateu militante em defesa do Estado laico e no combate à intolerância religiosa e contra a mistura de política com religião, o que só gera corrupção.','edmarluz@hotmail.com','1263717123640406'),(84,'Anderson Ott','PRETA','MASCULINO','MASCULINO','1992-01-06','24 anos. Educador Social, Conselheiro Tutelar, Policial do Exército e formando em Políticas Públicas pela UFRGS. Nossas principais bandeiras são o respeito à diversidade, a proteção das crianças e adolescentes e o desenvolvimento das comunidades mais carentes. ','anderson.ott@gmail.com','1210583008962829'),(85,'Arthur Gonçalves','BRANCA','MASCULINO','MASCULINO','1989-04-09','Prof. Lucas da Rocha, defensor de uma educação popular, democrática, libertária e emancipadora, ativista LGBTQ e dos direitos animais, conselheiro de Cultura em Gravataí e defensor dos direitos humanos.','arthursgoncalves@gmail.com','1219246251440178'),(88,'Gustavo Bueno','BRANCA','MASCULINO','MASCULINO','1966-07-03','Comecei minha militância política ainda na escola, participando do grêmio e depois na faculdade. Me aproximei da vida partidária pelo PDT, na campanha para o primeiro governo Brizola, no Rio de Janeiro. Me desiludi muito com o segundo governo Brizola e me afastei da militância. Ingressei novamente na vida partidária pelo PT e novamente me decepcionei quando vi o partido se aliando ao que havia de pior na política brasileira em nome da tal \"governabilidade\". Foi quando surgiu o PSOL e passou a ser minha opção de voto, nunca me afastando das discussões de micro política nos bairros onde morei. Meu namoro com o PSOL foi longo, mas quando percebi já estava engajado na militância novamente, em defesa do Complexo do Maracanã. Participei de diversas lutas como contra a demolição da escola Friedenreich, Aldeia Maracanã, Estádio de Atletismo Célio de Barros, Parque Julio Delamare, Campo de Golfe Olímpico, remoções... Pronto, lá estava eu novamente na Primavera Carioca e nas ruas, renovado e confiante na possibilidade de mudança. Me tornei mais ativo nas lutas de bairro  e em defesa de espaços públicos, como no enfrentamento da prefeitura em defesa da Praça Nobel, no Grajaú, onde evitamos a destruição da praça e ganhamos, definitivamente, protagonismo na política local. Já militando de forma atuante no Núcleo Anticapitalista Primeiro de Maio do PSOL, na Grande Tijuca, incentivei a construção o Núcleo Grajaú mantendo uma \"banquinha\" física em uma praça do bairro desde 2012, na primeira campanha do Freixo para prefeito,sempre no segundo domingo do mês. Muitas são as construções locais das quais participo hoje. Minha candidatura surgiu como consequência natural desta ampliação da luta no PSOL, que ajudo a construir com muita convicção de podermos promover as mudanças tão necessárias para ampliar a participação popular, pedagogicamente, e o empoderar as comunidades construindo pautas para a transformação da cidade em um local mais justo e igualitário. Luta que segue. \r\n','comb@mundocomb.com.br','1403484386346550'),(92,'Douglas Belchior','PRETA','MASCULINO','MASCULINO','1978-11-24','Douglas Belchior nasceu e cresceu no fundão das periferias da cidade, nos limites entre Itaim Paulista, divisa com Ferraz de Vasconcelos, Itaquaquecetuba e Poá. É formado em História na PUC-SP e faz mestrado em Ciências Sociais e Humanas na Universidade Federal do ABC.  Iniciou sua trajetória na Pastoral de Juventude e no Movimento Estudantil; participou da construção de redes de cursinhos populares e comunitários, Educafro (por 10 anos) e UNEafro-Brasil (nos últimos 7 anos), pelo direito do povo preto e periférico ter acesso à universidade; ajudou a construir a Frente Pró Cotas Raciais do Estado de São Paulo e é um dos fundadores do Comitê de Luta Contra o Genocídio do Povo Preto, Pobre e Periférico.\r\n\r\nÉ ganhador do prêmio “Virada Sustentável/Catraca Livre”, em 2014 e dos prêmios “Movimento Nacional de Direitos Humanos e “Dr. Benedicto Galvão – Presidente da OAB-SP”, ambos em 2015, todos em reconhecimento ao trabalho em defesa dos direitos humanos e no enfrentamento ao racismo e à violência, e do  Prêmio  Almerinda Farias Gama (2016), que reconhece mídias voltadas à promoção da igualdade racial no município, feitas por comunicadores negros e negras.\r\n\r\nDouglas também escreve no blog @NegroBelchior na Carta Capital e também atua como colunista de Lutas Sociais no Jornal da TVT.\r\n \r\n\r\n ','campanhasomosnos@gmail.com','657217944444979'),(97,'Ronei Oliveira','BRANCA','MASCULINO','MASCULINO','1962-08-10','Sou Ronei Rosa, sou PDT, sou POVO e vou lutar pela educação, trabalhismo e melhor qualidade de vida!\r\n','ronei1008@hotmail.com','1265653680114399'),(99,'Déia Fraga','BRANCA','FEMININO','FEMININO','1963-11-20','Atuo como voluntária no conselho local de saúde UBS CERES,liderança por uma saúde mais digna,mais médico e capacitação na inclusão social\r\nAtuo como coord. Do FRJS-PARTENON, onde atuamos no fortalecimento das nossas comunidades no sentido de ir e vir.Não é um Fórum de denúncias! \r\nMais mulheres na política \r\nPolítica pública para mulheres \r\nMais Inclusão Social \r\nAnimais tbem tem direito! Vamos preservar,nossa fauna e flora. \r\nUma Porto Alegre mais humana! ','alsaquiana@gmail.com','10207169783178257'),(100,'Renata Vieira','BRANCA','FEMININO','FEMININO','1981-11-15','Assim como muitas mulheres que acumulam afazeres e papéis, sou múltipla.\r\nTenho 34 anos, sou mãe de duas meninas, casada. Baiana radicada em São Paulo há 17 anos. Advogada, graduada em Direito pela FMU-SP, especialista em Direito Contratual pela PUC-SP.\r\n\r\nMeu descontentamento com a sociedade injusta e desigual que vivemos e o repúdio a toda politicalha que nos tolhe direitos a cada dia me fizeram ingressar na Rede Sustentabilidade, em 2015. Tenho muita gana para lutar, para fazer com que a minha voz seja ouvida. Sei que serei uma voz sozinha. Porque essa voz sempre esperou a resposta do Estado para as demandas diárias e se cansou de esperar. Assim como muitas outras.\r\n\r\nApós assumir o desafio de ser Coordenadora de Organização da Rede Sustentabilidade em Sampa, aceitei a missão de me candidatar a vereadora no município de São Paulo em 2016 para ocupar e mostrar a força da mulher na política. Participei de rodas de escutas, palestras e eventos que abordaram a democracia participativa como nova forma de fazer política. A sustentabilidade como meio de exercê-la, para a proposição de uma nova forma de gerir a cidade de forma colaborativa, inteligente e viva. \r\n\r\nMeu objetivo como candidata é mediar a força cívica dos cidadãos paulistanos com a Câmara Municipal de São Paulo, para que esta de fato seja a Casa do Povo, fazendo ecoar nossas vozes, disponibilizando no governo os ideais das pessoas que querem construir uma verdadeira democracia direta. \r\n\r\nO futuro começa agora.\r\n\r\nVamos unir e fortalecer nossas vozes?\r\n\r\n#MaisMulheresNaPolítica\r\n#OcuparPolítica\r\n#ÀgoraEmSampa\r\n#ASãoPauloQueSonhamos','renatavieira.rede@gmail.com ','10206892718576957'),(102,'Mandato Verador Reis','PRETA','MASCULINO','MASCULINO','1961-10-03','Paulo Batista dos Reis, hoje conhecido como Vereador Reis, iniciou sua vida profissional na CMTC. Foi condutor, metalúrgico, policial militar, professor da Rede Estadual de Ensino e policial civil. Nasceu e foi criado na região de Campo Limpo, onde iniciou a militância nos movimentos sociais por educação, saúde, moradia, transporte e melhorias para os bairros. Conhece profundamente os problemas da periferia. Para lutar contra as desigualdades sociais e para encaminhar problemas estruturais dos bairros, em 2012, candidatou-se a vereador, sendo eleito com mais de 28 mil votos. Neste primeiro mandato como vereador de São Paulo elaborou projetos de leis consequentes que visaram à inclusão social, melhoria na saúde e na educação, funcionamento e oferta de serviços públicos para a população.','reisvereador13651@gmail.com','2108067359418843'),(103,'Henrique Lima','PARDA','MASCULINO','MASCULINO','1985-11-19','QUEM SOU\r\nHenrique Lima é jornalista, músico, servidor público e militante da Juventude do Partido dos Trabalhadores (JPT/PE). Candidato a vereador pelo PT, acredita na política como meio de transformação social e ferramenta capaz de promover uma verdadeira participação popular para a construção da cidadania. Sua plataforma de trabalho está ligada às causas da juventude, combate ao racismo, mulheres, população LGBT, cultura e saúde.','Recifedagente2016@gmail.com','10209129661611236'),(106,'Pedro Markun','BRANCA','MASCULINO','MASCULINO','1986-01-13','Trabalho com transparência e participação há mais de 10 anos, fundei em 2009 a Transparência Hacker, movimento com mais de 1800 pessoas no Brasil todo.\r\n Sou um dos criadores do Ônibus Hacker, um laboratório sobre rodas que leva cultura e educação política por todo Brasil.\r\n Além disso, já desenvolvi inúmeros aplicativos e projetos de transparência como Verdinhas e o Jogo da Política.','pedro@markun.com.br','10154404980694462'),(108,'Karla Falcão','PARDA','FEMININO','FEMININO','1992-07-30','Sou Karla Falcão, tenho 24 anos, sou graduada em História pela UFRPE. Bissexual e candomblecista, sinto na pele uma série de discriminações no meu dia a dia. Trabalhei 3 anos e meio na Câmara de Vereadores do Recife e uma das coisas que mais me revoltava era ver representantes do povo disseminando discursos de ódio sem nenhum tipo de contraposição séria. Foi também trabalhando na Câmara que tive oportunidade de fiscalizar todas as escolas, creches e CMEIS da rede pública municipal, modo através do qual conheci todos os bairros da cidade e a dura realidade não mostrada nas propagandas oficiais, mas enfrentada por toda população e mais especialmente pelos educadores e crianças que compõem o sistema. Acredito em três valores básicos para a construção de uma política efetivamente transformadora: liberdade, participação e transparência. Para por um fim na omissão do poder legislativo acerca dos problemas mais sérios da cidade, resolvi sair dos bastidores e usar a experiência, o conhecimento e a disposição que tenho para assumir essa candidatura e conquistar seu voto ;) #é17700','karlaffalcao@gmail.com','1076259385742695'),(109,'Cínthia Vieira','BRANCA','FEMININO','FEMININO','1992-11-25','Bacharel em Direito, socialista, feminista, LGBT, com atividade política junto aos movimentos sociais  é candidata à vereadora pelo PSOL em Caicó/RN.','cinthia_kvs@hotmail.com','533002933491256'),(112,'Dario de Moura','BRANCA','MASCULINO','MASCULINO','1965-05-10','Filósofo, ativista e defensor da ampla transferência de conhecimentos entre as pessoas: um hacker social. Entre suas propostas está a ampliação da participação popular nas decisões públicas e a criação de políticas que combatam a violência contra jovens. Um usuário que saiu do armário para o debate sobre a descriminalização e a legalização da maconha. Dário lutará pela auditoria da dívida pública municipal e pela mobilidade urbana gratuita. Pela desmilitarização da vida, dos corpos, da cidade.\r\nRadicalização da democracia. É importante permitir que a população tenha acesso a mais canais de participação nas decisões públicas. Para isso será necessário levar as discussões para fora da Câmara, fazendo com que plataformas digitais possam dar apoio aos debates. É necessário inverter o pensamento: as pessoas precisam dizer quais são os problemas e a soluções para a cidade e não a Prefeitura e a Câmara.\r\nDescriminalização das drogas. No âmbito municipal devemos atuar de maneira que possamos reduzir a violência contra jovens, usuários de drogas, discriminados por sua condição financeira, região onde mora e cor da pele. Um dos principais passos a serem dados nesse sentido é a legalização da maconha, porta de entrada para uma política de drogas mais racional e humana, que respeite as liberdades individuais. No que toca a segurança pública, urge desmilitarizar a polícia e devolver à Guarda Municipal sua real função de cuidar do patrimônio público e não de ser um órgão repressor com aparatos de tropa de choque.\r\nOcupação do espaço físico. Priorização do debate sobre a melhor forma de se oferecer o transporte de massa digno, priorizar as vias de ciclismo e o metrô do Barreiro, garantindo que o direito de ir e vir seja expandido. É possível implantar o conceito de mobilidade gratuita em Belo Horizonte.\r\nAuditoria da dívida pública. Importante ferramenta que deve permitir o maior controle e acompanhamento das atividades do prefeito. Acesso aos microdados financeiros da cidade. Rever os contratos de transporte e da PBH Ativos S.A.\r\n','Dariodemoura@gmail.com','1120968417938678'),(113,'Cicero Firmino','BRANCA','MASCULINO','MASCULINO','1973-03-10','Olá sou Cicero candidato a vereador pela cidade de são paulo. nasci no ceara, nasci em uma família bem humilde onde eu vi a dificuldade da da falta da comida. Para deixar essa pagina triste no meu passado, aos 18 anos vim para são paulo para melhorar de vida. estudei aos 19 anos comecei a trabalhar na empresa de trasporte coletivo campo belo onde trabalho até hoje, quando cheguei  em são paulo morrei no bairro do capão redondo, hoje moro no bairro campo limpo. Sempre fui engajado nos problemas sociais e políticos tanto no meu bairro quanto no meu trabalho, sou casado e tenho 3 filhos dos quais hoje posso dar oportunidades de estudo. este ano sou candidato a vereador de são paulo para que possa de forma efetiva resolver os problemas sociais da nossa cidade.   ','cicerodasilvafirmino@gmail.com','517034781815919'),(119,'Diego Grossi','BRANCA','MASCULINO','MASCULINO','1982-10-30','Diego Grossi, 33 anos publicitário CANDIDATO A VEREADOR PELA PRIMEIRA VEZ, Carioca de coração e apaixonado pelo Rio de Janeiro Diego mora há mais de 20 anos no Rio e conhece muito bem as necessidades do nosso município, com projetos sociais inovadores, ele vai lutar e defender os que mais precisam. Política de novas ideias. \r\nDiego sempre participou de inúmeras ações solidarias e sociais lutando pela diminuição das desigualdades sociais, seu lema é: juntos somos MAIS! ','Contato@diegogrossi.com','1773083019640671'),(120,'Benedito Serafim','PARDA','MASCULINO','MASCULINO','1989-11-25','A inquietação sempre moveu meus passos e nessa estrada tenho buscado meios de contribuir para uma revolução social. Esse pensamento vem desde os tempos em que comecei nos palcos. Eu só tinha 13 anos quando essa história começou. O cinema entrou na minha vida há seis anos. \r\nO que tenho aprendido com isso? Que fazer arte é um ato de resistência e sim, resistir é preciso. \r\nA geografia faz parte dos meus dias. São oito anos de uma grande paixão. Ser educador é ver a mudança na vida das pessoas diariamente.  É perceber a transformação social que o conhecimento provoca. \r\n Já fui chamado de agitador cultural. De provocador. Fui presidente do Grêmio da ETEPAM, C.A de Geografia da UPE campus Mata Norte e D.A da Upe campus mata norte. Sim, a inquietação me move. \r\nFui convidado para ser candidato a vereador pela cidade do Recife. Confesso, que fiquei em dúvida. Esse projeto não estava nos meus planos, mas depois de conversar com amigos, pessoas próximas e com meus sócios no Caras de Pau do Vestibular vi o quanto isso faria parte de um movimento concreto de mudança. Movimento que eu percebo tanta gente acreditar. \r\nEm momentos tão conturbados da nossa politica. Em dias em que corremos o risco de perder direitos conquistados ao longo de anos, inclusive na sala de aula, com o andamento de um projeto de lei como “Escola sem partido”. Chegamos todos a um consenso: - Precisamos lutar. Não podemos nos calar. Não é possível permitir que nos calem. Não podemos deixar a nossa jovem democracia se perder. \r\nEu não sou político, sou um artista, um educador em busca de lutar pelo que um movimento inteiro de pessoas acredita.\r\nEu não vou fazer essa campanha que já estamos vendo nas ruas. Comitês gigantescos, panfletagem, adesivos, gente sendo paga para dizer que vota. Aquela corrupção que começa ainda antes das urnas e na cara dura. Não vou tirar foto comendo pastel de feira, caldo de cana ou caçando pokemon. \r\nEu vou apresentar minhas ideias, projetos e o que vou fazer pela cidade. Essa é a minha estratégia. Ser honesto, franco e direto. \r\nNão sou o candidato com sobrenome, aquele que o coronelismo impera e que trabalha com a política da troca de votos. Se é isso que você procura. Não quero seu voto. \r\nEu sou apenas o Bené e agora sou candidato a vereador.','Bene_dedao@hotmail.com','1485228484824293'),(122,'Maria Aparecida Vilhena Falabella','BRANCA','FEMININO','FEMININO','1960-01-16','Olá! Sou Cida Falabella, atriz, diretora e professora. Nascida em Belo Horizonte, resido há mais de três décadas no bairro Serrano, na periferia de BH. É lá também que coordeno, há quase 15 anos, um espaço cultural independente, onde buscamos pesquisar, participar e traduzir a realidade social, em nossas criações teatrais e nas ações permanentes, realizadas com – e, sobretudo, para – a comunidade.\r\nSou formada em História e Mestre em Artes pela UFMG. Comecei cedo minha trajetória teatral, e boa parte dela foi como integrante da Cia Sonho & Drama, hoje rebatizada como ZAP18. São 40 anos de dedicação ao teatro e suas lutas. \r\nMeus primeiros passos na vida política foram nos movimentos estudantis e culturais. Ainda na ditadura militar combati a censura e o regime de exceção. Desde esta época, e para sempre, criei minha convicção na democracia como única possibilidade para se governar um país, um estado, e uma cidade como a nossa. Por isso participei ativamente de muitas iniciativas, como o Movimento Brasileiro de Teatro de Grupo e, em Minas, fui uma das fundadoras do MTG e, por duas vezes, presidenta. Na esfera pública fiz parte do Conselho da Cidade, em 2001, e fui representante eleita do setor das Artes Cênicas no 1º Conselho Municipal de Cultura de BH. \r\nSempre ao lado de meus colegas, e sem jamais temer os que ameaçam conquistas coletivas, participei recentemente da ocupação da Funarte MG, defendendo direitos da classe artística que são, consequentemente, direitos de todos os brasileiros. Estive em Brasília, como representante do nosso movimento no #OcupaMinC, uma experiência marcante, que ocupou espaços culturais públicos em  todos os estados do Brasil, mobilizando a classe cultural contra o golpe que sofremos. \r\nA gravidade do momento que vivemos cobra novos compromissos e, por isso, resolvi ser candidata à vereadora. Faço parte das MUITAS pela CIDADE QUE QUEREMOS, um movimento que ocupa a política com ousadia e cidadania. Juntas, chegamos ao PSOL.\r\nMinha candidatura é um chamado para reunir pessoas que acreditam na cultura como caminho para uma sociedade mais justa e humana. Uma forma de nos encontrarmos para uma caminhada coletiva e criativa pelo direito à felicidade. É a #CulturaPelaCidade, agregando as pessoas, ocupando os lugares para viver e pensar o espaço público. A cultura que afeta, educa e transforma. A cultura que deseja construir uma cidade viva, inclusiva e democrática. A cultura atravessando todas as lutas por nenhum direito a menos! \r\nÉ com a cultura que faremos as verdadeiras transformações!\r\n','domingocida2014@gmail.com','1829558623942691'),(123,'Adriano Machado Silva','BRANCA','MASCULINO','MASCULINO','1974-09-17','Profissional de saúde, professor universitário e técnico. Formado em Engenharia de Produção com especialização lato sensu em infomatica em saúde e também MBA em Gestão Hospitalar.\r\nAtualmente aluno de Mestrado em Tecnologia Ambiental como vereador serei atuante na fiscalização dos direitos dos animais, saúde pública e educação fundamental.\r\nQuero ser a voz do povo dentro da Câmara Municipal, mas para isso preciso do seu voto de confiança e participação.','prof.admsilva@gmail.com','337800929898690'),(125,'Fabia Kisa','BRANCA','FEMININO','FEMININO','1976-01-14','Meu nome é Fábia Euflázia da Silva, nascida no Rio de Janeiro. Estudei no Colégio Brigadeiro Newton Braga de 1986 até 1993. Entrei para a FAB em 1996, na área de Enfermagem, como sargento da Aeronáutica. Me graduei em Farmácia pela Universidade do Grande Rio. Trabalho na área de saúde há 20 anos, especificamente na área de Enfermagem (na Aeronáutica) e já trabalhei como Farmacêutica Responsável Técnica de drogaria, Responsável Técnica de empresas de comércio e distribuição de produtos médicos hospitalares. Pela primeira vez, sou candidata ao cargo de vereadora, pelo Partido Rede Sustentabilidade. Venho nesta candidatura com objetivos de mudança. Com novas idéias de forma a contribuir positivamente para a renovação na educação, a melhoria na saúde e a preservação crescente do meio ambiente. Há alguns anos, realizo alguns trabalhos sociais, sem que isso estivesse direcionado a ações políticas. Este tipo de trabalho é o de doação de medicamentos para as pessoas que não tem condições de comprar, recolhimento de doações(de roupas, alimentos e brinquedos). em casas de amigos, familiares e voluntários para posterior entrega em Orfanatos, Asilos e algumas residências(dentro de comunidades). Essas ações realizadas em conjunto com amigos, simplesmente com a intenção de ajudar voluntariamente e aos poucos gerar oportunidades de reduzir a desigualdade, que nos deparamos no nosso dia a dia.','fabiakisa@hotmail.com','1312534908791297'),(126,'Linda Brasil','PARDA','MASCULINO','MASCULINO','1973-04-14','Linda Brasil, 43 anos, estudante do curso de Letras na UFS, cabeleireira, militante LGBT, feminista e transfeminista. Comecei minha vida política no momento em que decidi ser quem sempre fui, uma mulher trans. Luto por liberdade, igualdade e direitos, buscando sempre mostrar que o  melhor de nós está na diversidade de ser e pensar. Defendo que e educação é maior ferramenta para transformação social, por precisamos conscientizar nossos jovens sobre o respeito a diversidade. Nessa eleição sou o símbolo da luta de todas mulheres(trans, cis, negras, brancas, lésbicas, bissexuais, héteros, jovens, estudantes, trabalhadoras) e resistência das pessoas mais oprimidas. Por isso que precisamos de Diversidade e representatividade SIM.','lindabrasil@hotmail.It','1057234267718103'),(128,'Michely Coutinho','PARDA','FEMININO','FEMININO','1982-02-19','?Michely Coutinho é advogada, educadora, radialista, servidora técnica da UFG e ativista social. Atualmente ocupa as funções de diretora de Relações Étnico-Raciais, Gênero e Diversidade do SINT-IFESgo (Sindicato dos técnico-administrativos da UFG, IFG, IF Goiano e Ebserh), de Responsabilidade Social da FAJE-Goiás (Federação das Associações de Jovens Empreendedores de Goiás), e da Associação Mulheres na Comunicação – AMARC Brasil, onde integra a produção dos programas “Palavra de Mulher”, Rádio Difusora e do “Voz da Mulher”, Rádio Universitária.  Independência e transparência são as marcas da trajetória profissional e de ativismo de Michely Coutinho. Com atuação sempre combativa pelo trabalho, educação e direitos humanos, sua história foi pautada em fazer valer a voz pelo direito a ter direitos, aliando dinamismo e inovação. Mais informações em: www.facebook.com/michelycoutinho.\r\n','email@michelycoutinho.com.br','1283277568363393'),(129,'Reginete Bispo','PRETA','FEMININO','FEMININO','1963-01-23','MULHER NEGRA e MÃE\r\nReginete Bispo construiu sua trajetória política junto aos movimentos sociais de esquerda há mais de 30 anos. Sua atuação é orientada pela luta permanente na promoção da igualdade racial e de gênero, em defesa da liberdade e, das políticas de combate a todas as formas de preconceito e discriminações. NRA DE VEREADORES\r\nAOS EXCLUÍDOS\r\nCientista Social, especialista em Direitos Humanos pela UFRGS, natural de Marau e ingressou na política no início dos anos 80. E hoje, dirige O Instituto Akanni – Organização de Mulheres Negras.\r\nNO GOVERNO OLÍVIO, dirigiu o Departamento de Desenvolvimento de Recursos Humanos da Secretaria de Justiça e Segurança do RS, cuja atuação foi condecorada pelo Comando da Brigada Militar, em 2011, com a Medalha de Honra ao Mérito de Ensino.\r\nNA ASSEMBLEIA LEGISLATIVA, de 2005 a 2011, assessorou a Comissão de Direitos Humanos, em temas relativos às mulheres, negros, indígenas e quilombolas. De 2015 a 2016 - assessorou a Comissão de Segurança e Serviços Públicos e a Frente Parlamentar de Acompanhamento e Solidariedade aos Imigrantes e Refugiados do RGS.\r\nNO GOVERNO TARSO, no Conselho de Desenvolvimento Econômico e Social – CDES. Coordenou as Câmaras Temáticas de Qualidade de Educação e Direitos Sociais, sendo uma das principais articuladoras para a criação do Comitê do Povo de Terreiro e do Centro de Direitos da Pessoa Idosa no Estado.\r\n\r\nEm 2012, participou como palestrante do IV Congresso Nacional Africano, representando o governo brasileiro na África do Sul. \r\nEm 2015 visitou o Senegal a convite do Parlamento Senegalês, a fim de conhecer a realidade política, sócio econômico do país e, construir alternativas aos imigrantes senegaleses, solicitantes de refugio e residentes em nosso estado.\r\n','reginetebispo@gmail.com','10202199869276184'),(130,'Fabiano Yamashita','BRANCA','MASCULINO','MASCULINO','1980-11-18','Sou Fabiano Yamashita , mestiço, e com muita vontade de fazer algo pela minha região zona oeste de São Paulo. Venho de uma Família de Comerciante no ramo de Supermercado que à 40 anos contribuímos com o crescimento do nosso bairro . Sempre fiz de coração meus trabalhos voluntários e esse ano decidi que quero mas. Penso que ainda não temos votos distritais , mas se cada Vereador foca-se em sua região consegue riamos fazer uma nova Politica . Muito obrigado. ','japayama@hotmail.com','1186387128088803'),(131,'Ailton Lopes','BRANCA','MASCULINO','MASCULINO','1978-04-22','Sou professor e bancário, militante sindical e LGBT. Iniciei minha militância como lutador social na Pastoral da Juventude. \r\n\r\nEm 1998, comecei a participar ativamente do movimento estudantil da Universidade Estadual do Ceará, fiz parte do Centro Acadêmico 9 de Setembro, da Executiva Nacional dos Estudantes de Veterinária e do Diretório Central dos Estudantes. \r\n\r\nFui militante do PT, partido com o qual rompi ao perceber a sua integração à ordem vigente. Dedico-me, então, desde 2005, a construir uma alternativa de esquerda socialista que possa ser uma ferramenta de transformação social necessária para o povo brasileiro: o PSOL. \r\n\r\nNo PSOL, fui candidato a deputado estadual em 2006 e, posteriormente, a vereador de Fortaleza em 2008. Em 2014 fui candidato a Governador do Ceará, alcançando 102.394 votos, quando nós da Frente de Esquerda Socialista fizemos uma campanha como contraponto aos demais candidatos que representavam, em sua maioria, mais do mesmo: o governo dos ricos e exploração dos trabalhadores, continuação da opressão e destruição da natureza. Foi também uma campanha necessária para fortalecimento da comunidade LGBT e tantas outras lutas em nosso estado. \r\n\r\nHoje, atuo profissionalmente como bancário, professor de português e espanhol e linguista crítico e dedico a minha militância às causas sindicais, à oposição bancária e ao movimento pela diversidade sexual.\r\n\r\nQuero nessa candidatura a vereador, ser a expressão de um movimento por uma cidade que possa ser reapropriada por todas e todos que nela vivem.\r\n\r\nPelas trabalhadoras e trabalhadores. Por quem mora na rua, por quem usa o transporte público, por quem anda de bicicleta, de patins, a pé ou de skate, por quem canta, dança, atua, por quem escreve e compõe, por quem pinta, picha, por quem sonha, por quem declama a Fortaleza de nossa existência, a convocação às lutas.\r\n\r\nUma cidade que se conjuga no coletivo de nossa diversidade. Das mulheres, dos negros e negras, das LGBTs, das pessoas com deficiência, das juventudes, dos idosos e das crianças, não apenas adulta, mas multigeracional.\r\n\r\nUma cidade dos humanos, das plantas e dos animais. Uma Fortaleza de Todas as Cores.\r\n\r\nConheça nosso manifesto no link: http://bit.ly/29E9w5s','ailton_socialista@hotmail.com','1197427130321868'),(132,'Silvia Dos Reis','PARDA','FEMININO','FEMININO','1970-08-31','Projeto social com crianças,mais benefícios para os idosos,seguranca e educação','silviadosreis@live.com','1144373065655892'),(133,'Bel Sa','PRETA','FEMININO','FEMININO','1967-03-26','Bel Sá , 49 anos , negra ,lésbica e periférica. É Micro Empreendedora Individual. Se compromete a defender à continuidade e ampliação de políticas públicas cada vez mais efetivas para as mulheres , LGBT\'s , juventude e trabalhadoras/trabalhadores informais.','belsa13124@gmail.com','525657220960623'),(134,'Adriano Ferreto','BRANCA','MASCULINO','MASCULINO','1982-03-12','Acadêmico de Direito na Universidade Paulista e de Ciências Sociais na Universidade Federal de Goiás, Vice Presidente do Grupo DiverCidade, Produtor de eventos, Ativista de Direitos Humanos, Defensor de todas as famílias.\r\n\r\nEm 2013 foi escolhido pelo Prefeito Paulo Garcia para assumir a Primeira Assessoria que foi responsável pela pauta LGBT do município e com ele as politicas para essa população foi incluídas na prioridade da nossa capital. Esteve a frente dessa pasta até Maio de 2015 e depois assumiu a Coordenação de Politicas de Assistência Social para a População LGBT na Secretaria Municipal de Assistência Social.\r\n\r\nEm sua gestão conseguiu que o Plano de Saúde do Município atendesse o cônjuge do servidor municipal LGBT sem nenhuma outra exigência além da já exigida para o cônjuge heterossexual;\r\n\r\nGanhou do Ministério Público do Trabalho a 1ª Unidade Móvel de Atendimento LGBT do Brasil, a \"TrânsVânia\" e com ela realizou mais de 50 mil atendimento entre agosto de 2014 e Maio de 2015;\r\n\r\nCapacitou cerca de 9 mil servidores municipais da Educação, Assistência Social, Saúde e da Guarda Civil Metropolitana;\r\n\r\nConquistou a criação do Comitê Técnico de Saúde LGBT do Município que servirá para debater a saúde integral da população LGBT;\r\n\r\nAlcançou o direito da população Trans a usarem seus nomes sociais através do Decreto 265/2015;\r\n\r\nEm parceria com o Ministério Público do Trabalho e a Câmara Municipal, realizou a maior campanha contra a discriminação no mercado de trabalho com o tema IGUAIS COMO VOCÊ E EU, foram mais de 01 milhão de reais investidos em publicidade na TV, Rádio, Internet, Outdoor\'s, Outbus, cartazes e panfletos que mostravam representantes de várias \"minorias\" e evidenciava sua historia de vida e competência para o trabalho;\r\n\r\nDeixou pronto o Projeto para a Criação do Conselho Municipal LGBT e conseguiu junto com o Prefeito Municipal e o Secretário de Saúde a implantação do Ambulatório para Travestis e Transexuais que está em fase final aguardando somente a licitação dos hormônios;\r\n\r\nSeus eventos foram marcantes e fizeram as datas comemorativas da população LGBT serem especiais como a 1ª Semana da Visibilidade Lésbica e a 1ª Semana da Visibilidade Trans. Realizou com o movimento de lésbicas e mulheres bissexuais a 1ª Parada Lésbica, realizou Seminários, Shows e proporcionou a ocupação das praças, espaços públicos da capital;\r\n\r\nLutou e conseguiu a Institucionalização da Assessoria LGBT, que antes não estava prevista em lei e que agora faz parte do Organograma Oficial da Prefeitura de Goiânia.\r\n\r\nEssas conquistas fazem parte da sua trajetória e que afirmam seu compromisso com a garantia dos Direitos Humanos da população LGBT e todas as minorias de nossa cidade.','adrianoferreto@gmail.com','1038912609560550'),(135,'Ronaldo Alves','PRETA','FEMININO','FEMININO','1982-01-02','Maria Alves é casada tem uma filha de 13 anos e dois filhos sendo um de 10 anos e o outro de 7 anos, dona de casa reside no bairro Aroeiras em Teresina Piauí, catolica praticante, milita junto a valorização das familias e dignidade das pessoas.','ronalves.pt@gmail.com','10207268422856986'),(136,'Daniel Filho','BRANCA','MASCULINO','MASCULINO','1983-01-21','Sou Daniel Filho, formado em letras pela AESA-CESA. Pós-graduado pela UPE em programação do Ensino de Língua Portuguesa. Concluí o mestrado em Psicanálise na Educação e o curso de Gestão Escolar PROGEPE, tendo outros cursos de extensão e formação continuada em filosofia, estudos políticos e sindicais.\r\nProfessor efetivo da rede estadual de ensino com dois vínculos. Um lotado na Escola Jatobá, outro cedido para as atividades sindicais. Coordeno regionalmente o SINTEPE.\r\nEm sala de aula busquei desenvolver uma pedagogia que aliasse teoria e prática a partir das artes, formação e discussão política de temas, tidos como tabus, em diversos projetos de intervenção desenvolvidos nas escolas que lecionei.\r\nDestaco os projetos INTEGRANDO A SÉTIMA ARTE, onde crianças e jovens, há sete anos, produzem curtas-metragens que são exibidos gratuitamente em praças públicas. O projeto já conta com mais de 50 filmes em seu acervo, todos produzidos e estrelados por crianças e jovens de Petrolândia.\r\nO projeto JOVENS DEPUTADOS, jovens secundaristas fundaram partidos e estatutos, e, em assembleia, votaram o Projeto de lei 122 que criminaliza a homofobia. Nossa experiência repercutiu mundo afora. A APOLGBT (Associação da Parada do Orgulho LGBT de São Paulo) nos premiou com o 13° Prêmio Cidadania em Respeito à Cidadania e Diversidade. Concedido anualmente a pessoas que, em seus segmentos, contribuem para a discussão e promoção de igualdade de gênero e cidadania. Nesta edição receberam ainda o prêmio grandes nomes como: Laerte, Daniela Mercury, o deputado Jean Willys, Drauzio Varella, o presidente do Uruguai José Mujica, entre outros. O feito ganhou reportagem no Jornal do Commércio em 12 de Junho de 2013.\r\nEm 2014 estreei o BLOG GOTA D’ÁGUA, fazendo desse espaço uma tribuna popular denunciando descasos, abusos, entrevistando políticos e promovendo um espaço de opinião acerca de temas relacionados ao meio ambiente, educação, cultura e política.\r\nFiliado ao PT desde 2006, hoje faço parte da Frente Popular Petrolândia, instrumento de luta formado por partidos de esquerda, sindicatos e movimentos sociais.\r\n','danozzy2005@msn.com','10210424323034071'),(139,'Alexandra Braga','BRANCA','FEMININO','FEMININO','1977-07-31','Sou Alexandra Braga, 39 anos, mulher transexual, militante pelos direitos humanos LGBT, Mulher, Negro e Periferia, Fundadora e membro do Fórum Mogiano LGBT, ativista politica pelo Psol e formada em Pedagogia e pós graduada em Psicpedagogia. Minha luta é pela dignidade, respeito e vida da pessoa humana fuziladas pelo fundamentalismo,  burgues, branco e hétero sexual cis gênero. Direitos nem mais nem menos. ','xandaloiraa@hotmail.com','1050268575043008'),(140,'Airton Costa','PARDA','MASCULINO','MASCULINO','1997-08-25','Olá, eu me chamo Airton Costa e sou candidato a vereador de Teresina pelo PSOL. \r\nSou o único candidato assumidamente gay de esquerda da capital piauiense.\r\nBom, sou morador da periferia, sou negro, gay, tenho 19 anos e sou filiado ao PSOL há dois anos. Procurei o partido em 2014, quando as falas de Luciana Genro e Maklandel Aquino me chamaram atenção. Após as eleições, me filiei e desde então venho participando de atividades, tanto dentro quanto fora do partido. Estive presente em alguns atos como \'Fora Temer\', caminhada contra o estupro; já internamente, pretendo ajudar na criação do setorial LGBT do partido, logo após as eleições; também estou a frente da Secretária de Juventude do PSOL no estado.\r\nResolvi me candidatar devido ao avanço do conservadorismo na Câmara de Teresina e a falta de representatividade. Inclusive, no programa eleitoral gratuito, falo justamente sobre isso e peço \"[...] uma Teresina sem LGBTfobia\". Mas uma Teresina sem preconceito só é possível se tivermos uma pessoa na Câmara que lute a favor da comunidade. E mais que lutar, quero representar a comunidade LGBT e barrar projetos que ameacem nossos direitos.','euairtoncosta@hotmail.com','648985528609833'),(141,'Lúcio Beltrão','BRANCA','MASCULINO','MASCULINO','1985-03-22','Lúcio Beltrão é Profissional de Educação Física desde 2008 (graduado em Licenciatura Plena pela UPE) e Advogado desde 2011 (graduado em Direito pela Uninassau). Além dessas duas graduações tem ainda 04 (quatro) pós-graduações.\r\n\r\nDesde 2004 é filiado ao PSDB. Exerceu diversos cargos. Foi Presidente da Juventude do partido em Recife e vice-presidente estadual.\r\n\r\nLúcio é um esportista nato. Foi atleta da seleção pernambucana e Brasileira de Karatê. Conquistou diversos títulos nacionais e internacionais. Também foi técnico da seleção pernambucana.\r\n\r\nLúcio foi aprovado em todos os concursos que fez na área de Educação Física. Prestou também consultoria em várias cidades na área de gestão esportiva. Elaborou o programa de Governo, na área de\r\nesportes, de várias prefeituras e do Governo de Pernambuco.\r\n\r\nLúcio fez Residência Multiprofissional em Saúde Mental na Faculdade de Ciências Médicas (FCM) da UPE. Traz na sua formação o comprometimento com a saúde coletiva, a saúde mental, enfim a saúde pública como direito de todas as pessoas.\r\n\r\nSua candidatura para vereador representa – além das pessoas que militam na saúde, educação, juventude, esportes, segurança e mobilidade – a certeza de que é possível desenvolver na Câmara dos Vereadores novas ideias e uma nova cultura política.\r\n\r\nEssa candidatura é um convite à ousadia e a construção de um projeto coletivo de pessoas que buscam a renovação das práticas políticas e uma sociedade mais justa e igualitária. Junte-se a nós!\r\n\r\nConheça Lúcio e seu modo de fazer politica e de fazer campanha. Sem mentiras e sem compras de votos. Política com decência é possível. Basta saber votar.\r\n\r\nO Recife precisa eleger Lúcio Beltrão. Um homem decente, corajoso, ético e competente.','luciobeltrao@gmail.com','1713824908943124'),(144,'Giana De Marco','BRANCA','FEMININO','FEMININO','1990-05-03','Giana De Marco é curitibana, jovem, filha de professores estaduais. Estudou em escola pública e viveu toda sua vida na região norte da cidade de Curitiba, nos bairros Barreirinha, Santa Cândida e Atuba.\r\n\r\nÉ advogada, formou-se em Direito pela UNICURITIBA e é especialista em Direito de Família e Sucessões pela Academia Brasileira de Direito Constitucional (ABDCONST). É integrante do Instituto Brasileiro de Direito de Família (IBDFAM), e atual integrante da Comissão de Estudos sobre a Violência de Gênero (CEVIGE), da OAB/PR. É profunda e incansável batalhadora pelo direito das mulheres, dos jovens, das pessoas com deficiências e da causa LGBT. Indicada a fazer parte de mais uma gestão da Comissão Diversidade Sexual e de Gênero da OAB/PR, participa também como assessora jurídica de organizações não governamentais na área, bem como é integrante de associações voltadas à filantropia.\r\n\r\nPrecursora na advocacia em ações de registro civil de filiação homoafetiva, leva agora para a vida pública toda sua energia, juventude, empenho, disponibilidade e comprometimento – características pessoais que já são notoriamente reconhecidas pela sociedade civil e em nível institucional, para trabalhar em prol de uma sociedade mais inclusiva, mais plural, mais ética, mais humana, com foco na família e nos direitos de todas e de todos.','larademarco@gmail.com','10208873068478580'),(149,'Maria Rita Casagrande','PRETA','FEMININO','FEMININO','1980-09-22','Maria Rita Casagrande, mulher negra, LGBT, mãe e feminista. Moradora de Pirituba, periferia de São Paulo, há mais de 30 anos, aos 36 anos sou ativista e militante de diversas causas, com destaque para as lutas das mulheres, negros e população LGBT. Minha história foi construída nas ruas a partir da manifestação de alunos e professores na greve do professorado por melhores condições em 1993.\r\n\r\nCoordeeno, desenvolvoa e produzo o Blogueiras Negras (http://blogueirasnegras.org) website criado para dar voz as mulheres negras e o BNteen (http://bnteen.com.br), uma versão voltada para adolescentes. Criadora do Por Mais Mulheres , plataforma de empregabilidade e aprendizado em STEM (ciencias, tecnologia, engenharia e matemática) online para mulheres. Graduada em Análise de Sistemas, pós graduanda em Desenvolvimento de aplicações WEB. Criadora do True Love site voltado para o publico feminino de lésbicas e bissexuais e do Coletivo Audre Lorde de lésbicas e Bissexuais Negras e Afrodescendentes (http://coletivoaudrelorde.com).','casagrande.mariarita@gmail.com','10210415974820205'),(150,'Beatriz Silva','BRANCA','FEMININO','FEMININO','1987-12-09','Sou a Beatriz Silva, 28 anos, professora universitária e Vegana.\r\nDefendo a Causa Animal, sou fundadora e presidente da Ong Bendita Adoção, que cuida atualmente de quase 270 animais resgatados vítimas de maus-tratos e abandono,sendo eles bovinos, equinos, cães e gatos ! \r\n? Atuante em Ações de Libertação Animal, como no caso dos Beagles Resgatados do Instituto Royal e dos Porcos do Acidente do Rodoanel. \r\n?Na ONg, realiza ações de conscientização pró-veganismo, acolhimento e tratamento de diversos tipos de animais (como cães, gatos, coelhos, bovinos, equinos, suínos, ovinos e alguns silvestres vítimas de tráfico). \r\n?É educadora nas Comunidades Carentes, Coordenadora o Projeto de Pré Vestibular Gratuito da Comunidade no Jd Bonança em Osasco. \r\n?Responsável pelo Grupo Bendita Ação, que distribui todas às quintas, mais de 100 refeições veganas às pessoas em situação de rua há alguns anos na região de Osasco.\r\n\r\n?Como vereadora, pretendo propor um projeto que disponibilize atendimento veterinário gratuito, castração em massa nos bairros, implantação de albergues que permitam o acolhimento de pessoas em situação de rua juntamente com seus animais de estimação para receber atendimento humanizado, luta por moradia popular, fim das carroças e criação clandestina de animais (bem como todo tipo de exploração), atividades de conscientização pró-veganismo nas unidades escolares (opções de merendas veganas etc).\r\n\r\n\"Vamos dar Continuidade em Todos o Trabalhos que já realizo (mesmo sem recursos) Cotidianamente, mas se eleitos, com maior condição de realizar em larga escala, em benefício do meio ambiente, dos animais e das pessoas, trabalhando sempre em prol do BEM\"\r\n\r\nBEATRIZ SILVA PARA VEREADORA ?65 393','benditaadocao@gmail.com','1385226034825756'),(152,'Wagner Romao','BRANCA','MASCULINO','MASCULINO','1975-12-19','Tenho 40 anos, sou professor do Departamento de Ciência Política da Unicamp e pesquisador sobre participação, democracia e políticas públicas. Acredito na importância da participação cidadã para melhorarmos a democracia e a ação do Estado. Tenho experiência na formulação e avaliação de políticas de cultura, juventude, educação, sgurança pública, desenvolvimento local, transferência de renda, transparência e controle social do poder público. Sou casado, pai de dois filhos, ciclista amador e candidato pela primeira vez a vereador em Campinas.','profwagnerromao@gmail.com','1208236392567908'),(153,'Adriana Ramalho','BRANCA','FEMININO','FEMININO','1980-12-02','Adriana Ramalho nasceu em São Paulo, fruto de uma mistura pra lá de interessante... Juntou \r\na honestidade e a determinação do pai paraibano, criado na lavoura, com a alegria e a\r\nbondade da mãe baiana. Adriana cresceu nos bairros de São Miguel Paulista e Campo Limpo,\r\nsempre estudando em escolas públicas da região.\r\n\r\nDesde pequena demonstrou o dom de ajudar o próximo, engajando-se em ações sociais\r\nenvolvendo arrecadação de roupas e alimentos, tanto na escola quanto na igreja que\r\nfrequentava.\r\n\r\nAos 18 anos, já formada em ballet clássico, conseguiu combinar a leveza da dança com a \r\nforça e determinação de querer transformar vidas... E foi assim, ensinando voluntariamente\r\ncrianças e jovens a dançarem que recontou histórias vitoriosas.\r\n\r\nEsse encontro de leveza e força, tão raro, sempre a permitiu conciliar o humanismo com \r\na capacidade de lutar por uma sociedade melhor. Na verdade a sua formação profissional, \r\nnão seria surpresa para ninguém...  Formou-se em Direito com especialização em Direito \r\nSindical.\r\n \r\nAtuou entre 2005 e 2015 no Sinthoresp (Sindicato dos Trabalhadores em Hotéis e \r\nRestaurantes) prestando assessoria jurídica e minimizando os conflitos entre empregados\r\ne empregadores.\r\n \r\nParalelamente, Adriana Ramalho teve passagens importantes por organizações que\r\nprofissionalizam e capacitam mulheres para atuação na construção civil, como por\r\nexemplo, o Instituto Construa no projeto Mulheres que Constroem.\r\n \r\nOutra relevante organização que conta com Adriana Ramalho é o Instituto Akhanda, que\r\ndesenvolve atividades direcionadas ao bem-estar dos idosos. Seu principal objetivo é continuar expandindo o projeto através \r\nde parcerias com a iniciativa pública ou privada. “A população está vivendo cada vez mais – e cuidar da terceira idade é \r\nfundamental” afirma Adriana.\r\n \r\nO tema “Direito da Mulher” é especial para Adriana Ramalho. Ela luta pela igualdade de direitos e deveres e pelo fim dos\r\npreconceitos. Sua forte relação com esta causa trouxe o convite para ingressar no PSDB Mulher em 2015, já na posição de \r\nPresidente de Honra da Capital Paulista. \r\n \r\nÉ lá que Adriana Ramalho mantém um amplo diálogo com diversos setores da sociedade pela valorização da mulher, pelo \r\napoio aos que mais precisam e por ações de inclusão e integração para todos. \r\n \r\nAdriana Ramalho, uma mulher de fibra que luta lado a lado com você!\r\n \r\n\r\n \r\n ','contato@adrianaramalho.com.br','661206670722051'),(156,'Nabil Bonduki','BRANCA','MASCULINO','MASCULINO','1955-02-04','Arquiteto e urbanista, Professor Titular de Planejamento Urbano da FAU-USP. Foi Superintendente de Habitação Popular (1989/92), Secretário de Recursos Hídricos e Ambiente Urbano do Ministério do Meio Ambiente (2011/12) e Secretário Municipal de Cultura (2015/16). Foi relator do Plano Diretor Estratégico (2002 e 2014). Autor de 13 livros de habitação, urbanismo e patrimônio cultural. Prêmio Jabuti de 2015 na categoria Arquitetura, urbanismo, artes e fotografia. ','nabil@nabil.org.br','10154504063079663'),(158,'Jairo Silva Amaral','PRETA','MASCULINO','MASCULINO','1989-08-26','educador e comunicador social , articulador jovem da plataforma dos centros urbanos PCU & viva melhor sabendo jovem , comunista pobre preto e da periferia','samaljairo@hotmail.com','10207530668604573'),(159,'Antonia Elizabete','PARDA','FEMININO','FEMININO','1977-01-28','Sou mulher da periferia, trabalhadora do comércio   (atualmente Loja Catran) a 15 anos, militante do Movimento Popular e Estudantil desde a adolescência nos morros e córregos do Ibura e Guabiraba, militante Feminista,  LGBTT, atuando no combate ao extermínio de mulheres, juventude e população negra nas periferias, discordo de mais polícia armada como política de diminuição da violência. Na defesa do Movimento Antiproibicionista, compreendo a cidade do Recife como NOSSA, devendo ter mandatos que estejam DE FATO a serviço de toda população recifense, comprometidos com um conceito de inclusão social que respeite e inclua as diferenças e as/os diferentes. Defendo políticas públicas contra a precarização do trabalho e na defesa de trabalhadores e trabalhadoras formais e informais. Um olhar que RESSIGNIFIQUE o termo cidadania, que se comprometa a ser um mandato POR UMA CIDADE DE SONHOS E LUTAS.','mulherdeluta@hotmail.com','10202332749356690'),(162,'Maira Pinheiro','BRANCA','FEMININO','FEMININO','1990-07-19','Sou a Maira, tenho 26 anos e sou mãe solo da Betânia e feminista. Comecei minha militância no movimento estudantil no Centro Acadêmico XI de Agosto , da Faculdade de Direito da USP e na União Estadual dos Estudantes. Com a maternidade, me envolvi na luta pela saúde das mulheres e pela humanização da assistência ao parto e nascimento. Tive minha filha em um parto domiciliar e decidi me tornar doula, e desde então divido meu trabalho entre acompanhar mulheres na gestação e no parto e como empreendedora individual com minha marca de slings (carregadores de bebê).\r\nQuero ser vereadora porque acredito na importância de as mulheres e a juventude ocuparem a política. Por mais que a política partidária e institucional tenha suas limitações, é preciso disputar esses espaços e fazer com que nossa voz seja ouvida e nossas demandas colocadas como prioridade.\r\nQueremos uma política que dê conta desse nosso anseio por liberdade, que entenda as novas formas de expressão e reivindicação que vêm surgindo. Que seja protagonizada pelo povo, em especial pela juventude, pelas mulheres, pelos negros e negras, pelos LGBTs, e por todas e todos aqueles que estão nas trincheiras da luta combatendo a caretice e o retrocesso. A luta que fazemos na rua, nós queremos levar para dentro da Câmara Municipal.','maira.pinheiro@hotmail.com','10154350075106223'),(164,'Rose Abreu','BRANCA','FEMININO','FEMININO','1967-08-20','Sou protetora de animais por vocação, trabalho como cuidadora de crianças autista, atuo na causa LGBT e movimentos sociais, formada em gestão ambiental, militante partidária desde 1984.\r\n','roseabreu20@yahoo.com.br','1301553693188821'),(165,'Leonardo Kauffmann','BRANCA','MASCULINO','MASCULINO','1996-05-14','  Meu nome é Leonardo Kauffmann Barreto Mourão, 20 anos, solteiro, Ensino Médio completo cursado no SESI Leme - SP, Cursando Medicina Veterinária na Anhanguera Educacional Leme - SP, Trabalho com TI, sempre a procura do conhecimento, começando minha trajetória na política em busca de mais igualdade a todos, tendo em mente conquistas muito importantes para o meu Município, onde fiscalizarei o Executivo, onde irei propor projetos e ideais para o bem do cidadão onde todos tenha o direito de opinar e discutir sobre os mesmo.\r\n  Santa Cruz da Conceição - SP  é o Município onde nasci e cresci, uma cidade tranquila de se viver. Em minha campanha como Candidato a Vereador, não prometerei nada que não possa fazer, porém posso prometer que vera muito suor derramado, trabalho árduo, responsabilidade e comprometimento com a população em geral.','leo-kbm@hotmail.com','1290919137607564'),(167,'Jef Kaibers Candidato','BRANCA','MASCULINO','MASCULINO','1979-02-24','Sou professor concursado da Rede Estadual de Ensino, ativista de movimentos como LGBT, Cultural, Meio Ambiente e apoio outros.  Organizo a nossa Parada Pela Diversidade e já fizemos diversos enfrentamentos a vereadores preconceituosos e fundamentalistas daqui de Cascavel.  Queremos conquistar um espaço na Câmara para apoiar os movimentos sociais todos, dar visibilidade a causa LGBTQ+ e discutir propostas.\r\nNa nossa página: jeff kaibers 50 123  postamos nossas propostas que são direcionadas a diversas áreas como educação, mobilidade urbana, estudantes, cultura, esporte, saúde, além das políticas para LGBTs.\r\nObrigado, conto com seu voto e apoio!','kaiberss@gmail.com','1921451044752496'),(169,'Sâmia Bomfim','BRANCA','FEMININO','FEMININO','1989-08-22','Sâmia tem 27 anos, é formada em Letras na USP e trabalhadora na universidade. Jovem, mulher e feminista, tem atuação no movimento de trabalhadores, estudantil, de juventude e de mulheres. Foi uma das organizadoras das manifestações contra Eduardo Cunha, Feliciano e a cultura do estupro. Sua luta lhe rendeu embates com figuras conservadoras com Sara Winter, Marisa Lobo e Alexandre Frota, de quem sofreu um processo por ter atuado contra a cultura do estupro. Atua nas redes sociais, universidades, escolas e nas ruas contra o conservadorismo e em defesa das liberdades e dos direitos. Agora, Sâmia Bomfim pode ser uma de nós na Câmara de São Paulo!','samiabomfim@gmail.com','1372756476082961'),(173,'William Pamplona','BRANCA','MASCULINO','MASCULINO','1983-05-02','*Justificativa para minhas respostas \"Não\" ao final. Aberto ao debate.*\r\nMeu nome é William Figueiredo. Sou carioca da gema, tijucano, tenho 33 anos.\r\nPela primeira vez, apresento minha candidatura a vereador porque sou apaixonado pelo Rio e como a maioria dos brasileiros entende que chegou a hora do Brasil mudar pra melhor, começando pela renovação do quadro político. Estudei, me especializei e hoje me sinto preparado para servir à população carioca de forma mais efetiva que nossos atuais representantes na Câmara dos Vereadores.\r\nSou economista pela UFF e Mestrando em Administração Pública pela FGV. Atuo como especialista em desenvolvimento econômico da FIRJAN - Federação das Indústrias do Estado do Rio de Janeiro. \r\nDez anos de atividades profissionais na FIRJAN me tornaram especialista em economia fluminense. Já publiquei estudos e realizei pesquisas em diversas áreas como educação, saúde, emprego, segurança, habitação, transporte, produção industrial, economia criativa, construção civil, comércio exterior e carga tributária. \r\nComo profundo conhecedor das questões econômicas, políticas e sociais de nossa cidade, participei de reuniões com secretários, parlamentares, prefeitos e governadores, para apresentar propostas e buscar soluções para os desafios do Rio. Nesse momento, o que o Rio de Janeiro mais necessita é preservar o equilíbrio das finanças públicas. Não podemos deixar que a capital entre em uma profunda crise financeira como a que passa nosso Estado.\r\nNesse sentido, sei muito bem que posso oferecer à população carioca uma enorme contribuição, garantindo que o dinheiro arrecadado com seus impostos seja gasto de forma mais racional e eficiente pelo poder público. Como candidato, esta é minha promessa: eficiência.\r\nEficiência é fazer mais com menos. É garantir a segurança nas vias públicas, a pontualidade no sistema de transportes, a qualidade na educação, o pronto atendimento na saúde, a atração de investimentos que gerem emprego e renda e a execução de obras dentro do orçamento, sem ter que se cobrar mais impostos, taxas, contribuições ou aumentar tarifas.\r\nEu conheço minhas competências e os problemas do Rio. Estou certo de que, como vereador, posso contribuir – e muito – para solucioná-los.\r\nSerá uma honra poder representar você na Câmara dos Vereadores pelos próximos quatro anos. Vamos juntos fazer novamente do Rio uma cidade maravilhosa para se viver, trabalhar e empreender.\r\nWilliam Figueiredo – 25100\r\n100% comprometido com nosso Rio de Janeiro\r\n-Sou contra cotas por gênero ou raça, por entender que somos iguais e temos as mesmas capacidades. Mas sou a favor de cotas por questões socioeconômicas, como para estudantes de escola pública, de baixa renda, etc...\r\n- Violência contra a mulher é apenas um tipo de crime de milhares de crimes presentes em nossa legislação. A Lei da Ficha limpa já impede que condenados em 2ª instância disputem cargo eletivo. Sou a favor do fortalecimento da Lei da Ficha limpa.\r\n- Em âmbito estadual temos polícia militar e civil. Quem disse que se tornar tudo polícia civil a segurança do Rio vai melhorar? Em todas as profissões há bons e maus profissionais. Sou a favor de maior integração das forças e de maior participação da guarda municipal na segurança preventiva da cidade do Rio, sobretudo em áreas de lazer, escolas e áreas turísticas, liberando as policiais para combate a crimes de maior periculosidade.\r\n- Sou a favor do respeito aos contratos. Se o governo quiser desapropriar uma área, que pague ao proprietário seu devido valor.\r\n- Licenciamento ambiental é para preservar o meio ambiente. É o documento mais burocrático de se conseguir devido ao rigor das secretarias de ambiente. Para um grande empreendimento conseguir sua licença ambiental leva às vezes anos de estudos e vistorias.\r\n- Sou a favor do respeito aos contratos. Nossos representantes, no caso do Rio, os vereadores, tem que ser mais atentos e responsáveis ao ratificar um contrato da prefeitura. Se o atual contrato é prejudicial à população, que se retirem os representantes que o assinaram, através do voto, e que busque, se existir, meio jurídico legal para sua revisão.','alomeurio@hotmail.com','1338540362823047'),(175,'Francis R. Teixeira','BRANCA','MASCULINO','MASCULINO','1985-10-30','Francis Ribeiro Teixeira, nascido em Santa Maria, vivi toda a minha vida na nossa cidade. Sou proprietário da empresa Pégasus Informática, empresa santamariense construída\r\ncom muito suor. Casado, 30 anos, vivo diariamente junto aos meus clientes o \r\nflagelo e o desafio de empreender e gerar empregos. Defensor incondicional da liberdade e da justiça.\r\n','francis.tsm@gmail.com','1151733314920445'),(176,'Romildo Rocha','PARDA','MASCULINO','MASCULINO','1965-08-23','ROMILDO nasceu na cidade de Pimenteiras, no Piauí, tenho 51 anos, vivo em São Paulo há 34 anos. Atualmente moro em Americanópolis, região do Jabaquara. Casado, tenho 3 filhos e atuo na área da construção civil.\r\n\r\nMinhas propostas se eleito for. \r\nInclusão digital em projetos voltados para crianças com deficiência relacionada ao desenvolvimento motora.\r\n\r\nCursos profissionalizantes com foco nas pessoas com mais de 40 anos e na 3ª idade\r\n\r\nProjeto de resgate e recuperação de animais abandonados.','rochalima245@gmail.com','338702739804881'),(178,'Waldemar Martins','BRANCA','MASCULINO','MASCULINO','1957-06-18','PAULISTANO DO BAIRRO DO TATUAPÉ, SUPERIOR INCLOPLETO, 59 ANOS, CASADO E PAI DE 05 FILHOS, VAMOS LUTAR POR MAIS ESCOLAS TEMPO INTEGRAL COM ENFASE EM ESPORTE E CULTURA, MAIOR CONTIGENTE DA GUARDA MUNICIPAL, PARA ESCOLAS E COMERCIO EM GERAL.','waldemarsmartins@gmail.com','1128769857178441'),(183,'Washington Ricardo','BRANCA','MASCULINO','MASCULINO','1988-10-19','Washington Ricardo, 27 anos, estudante de Comunicação Social, atua profissionalmente com marketing.\r\nIniciou sua militância aos 19 anos, atuando em defesa das minorias, visando sempre o diálogo na construção de uma sociedade mais justa e sem preconceito\r\nAtuou como Conselheiro de Atenção á Diversidade por três mandatos.\r\nFoi conselheiro de Cultura.\r\nFundou o Coletivo GLAM...','washingtonrp@gmail.com','1213124988708020'),(184,'Katrini Alves da Silva','BRANCA','FEMININO','FEMININO','1986-03-23','Professora de sociologia em escola pública, licenciada em Ciências Sociais pela UNESP-Araraquara mestranda em Educação pelo PPGE-UFSCar, militante feminista e LGBT.','katrinialves@gmail.com','10205680918862293'),(186,'Fábio Costa','BRANCA','MASCULINO','MASCULINO','1970-05-09','FABIO COSTA é um Carioca criado na periferia do Rio de Janeiro, no bairro de Bonsucesso, com 46 anos e pai de quatro filhos. Apaixonado pelo Rio e suas manifestações culturais, tornou-se compositor de várias Escolas de Samba. Profissionalmente atua há mais de vinte anos na Gestão e implantação de redes de hotelaria e condomínios. Sempre preocupado com o bem-estar social, liderou várias ações de cidadania com grande adesão em diversas comunidades, levando-o a perceber a necessidade de transformar essas ações em algo permanente e mais abrangente.\r\nSua candidatura a Vereador tem o objetivo de lutar por questões sociais que há muito tempo estão abandonadas em nossa Cidade e, assim, fazer com que o Rio volte a ser uma cidade preocupada com o bem-estar dos Cariocas, com melhores perspectivas e oportunidades para crianças, jovens e idosos. Sua missão é deixar para trás a memória do tempo de caos em que vivemos há décadas.\r\n     Chega uma hora em que nós, cidadãos de bem, temos que arregaçar as mangas e lutar por aquilo em que acreditamos. Nada se conquista sem ação! E quando essa certeza nos envolve, devemos sair das ideias para o trabalho.\r\n\r\n     Assim como você, FABIO COSTA viu o Rio de Janeiro tornar-se uma cidade estagnada, onde pouco ou quase nada é feito em prol dos cidadãos. Seu desejo é contribuir para que aqueles desejos tornem-se realidade, que a nossa cidade volte a crescer e que os Cariocas voltem a ser respeitados.\r\n    FABIO COSTA pode (e vai) ajudar! E isso não é apenas uma promessa vazia, é um COMPROMISSO! Durante todo o seu mandato FABIO COSTA manterá a transparência de suas ações, divulgando suas propostas e ações para que todos os seus eleitores possam acompanhar a concretização dos projetos de campanha. Contamos com você para votar, divulgar a campanha para seus amigos e familiares, e, principalmente, para formar uma população consciente e batalhadora por um Rio de Janeiro melhor. Sabemos que dá para fazer mais e melhor. Essa é a nossa hora!\r\n\r\n    Vamos juntos fazer uma nova história!\r\n\r\n\r\n\r\n    Nas eleições para VEREADOR, vote FABIO COSTA, vote 44221.','fabio.costa_2011@hotmail.com','1793888474230506'),(189,'Luciana Batista','PARDA','FEMININO','FEMININO','1975-04-23','Boa noite pesso desculpas por demorar a responder.  Minha pretensão se vier a ser candidata e não prometer o que não vou poder cumprir mas com muita dedicação e força de vontade contando com a ajuda da população e melhorar a qualidade da saúde e educação por estar precária e tentar aumentar o índice de trabalho com salários dignos e sempre estar à disposição da população para o que der e vier. Faço parte do povo e não pretendo abrir mão disso. É aceito sugestões também obrigada \r\n','luciana_2011_gata@hotmail.com','1121682911241870'),(191,'Juliana Cardoso','BRANCA','FEMININO','FEMININO','1979-10-22','Juliana Cardoso é a única mulher de esquerda na Câmara Municipal. Indígena, nascida e criada na periferia da Zona Leste, iniciou sua militância nas Comunidades Eclesiais de Base.\r\n\r\nAtualmente exerce seu segundo mandato, que se consolidou como instrumento da luta dos movimentos sociais. Seu trabalho cotidiano é pautado pelas batalhas das trabalhadoras e dos trabalhadores e por suas reivindicações.\r\n\r\nNa luta de todas as horas, são alicerces do mandato o fortalecimento do SUS, a luta por moradia digna, a defesa dos direitos das mulheres, a inclusão cidadã da população LGBT, a batalha pelo parto humanizado, pela defesa dos diretos da crianças e adolescentes e pela luta contra o extermínio da juventude negra, pobre e periférica. O seu compromisso com a educação pública de qualidade com igualdade de gênero é também marca da sua atuação. \r\n\r\nJuliana é candidata nesta difícil conjuntura em que o país é governado por golpistas, que agem contra a classe trabalhadora, com a retirada de direitos. A reeleição de uma vereadora comprometida com a conquista e ampliação de direitos é fundamental para que a periferia e os movimentos populares continuem tendo voz ativa na Câmara Municipal de São Paulo.\r\n\r\nCom Haddad prefeito queremos continuar o trabalho por uma cidade mais justa, livre, socialista e democrática.','julianacardosopt@yahoo.com.br','1214213475296248'),(192,'Delma Rigo','BRANCA','FEMININO','FEMININO','1968-09-23','Nascida na zona Sul de São Paulo, precisamente no bairro da Pedreira, precisamos mudar, quando a prefeitura desapropriou os moradores dizendo que iria passar a linha de trem na região. Aos oito anos de idade, fomos para o jardim Umuarama na Cidade Ademar. Estudei todo ciclo escolar em escolas públicas da Grande São Paulo e fiz o último ano do ensino médio em Itatiba, São Paulo. \r\nAo retornar procurei um trabalho e com o passar dos anos sem acreditar na possibilidade de fazer uma faculdade realizei vários cursos profissionalizantes até que trabalhando no grupo Pão de açúcar ao saber que pagavam 50 por cento da faculdade me matriculei e me formei em Ciências Biológicas na UNIB – Universidade Ibirapuera onde obtive o título de bacharel como Bióloga e Licenciatura plena; Lecionei em Escola Pública por 5 anos e percebendo a dificuldade do professor em sala de aula resolvi fazer um curso de Especialização na Faculdade de Saúde Publica da USP – Especialização em Entomologia Médica e Soro epidemiologia; depois em seguida Cursei Mestrado no IMT – Instituto de Medicina Tropical da Faculdade de Medicina da USP.\r\nRealizei o sonho de ser mãe, hoje me sensibilizo com causas de mães com filhos com deficiência. Existe leis para amparar, porém na prática não há o cumprimento por parte de algumas instituições de ensino, precisamos de muita luta por essa causa. \r\nAgora uma nova fase inicia como candidata a Vereadora pelo Partido Verde, me identifiquei com seus princípios sendo o primeiro deles a Ecologia.\r\nComo Professora uma das minhas lutas será pela Educação e como Bióloga tenho a obrigação pela preservação do Meio Ambiente.\r\nComo Vereadora cumprirei a função de representar o meu Eleitor e cobrar que se cumpra as reivindicações feitas em cada localidades pelas Subprefeituras e fiscalizar onde está sendo empregado o dinheiro público da Saúde, Segurança, Educação e Transporte. \r\nCom o Apoio do Eleitor e a presença nas audiências públicas faremos juntos um mandato com muita transparência. \r\nPretendo por em prática a Agenda 2030 buscando a Igualdade Social e Respeito ao Meio Ambiente promovendo a Sustentabilidade. \r\nColocando sempre Deus na frente para realizar uma gestão Abençoada.','delmarrc@usp.br','10202241658598567'),(194,'Washington Souza II','PARDA','MASCULINO','MASCULINO','1990-12-19','Washington Souza nascido em Olinda \r\nFoi candidato a deputado estadual em 2014 ','taylonpe@live.com','638123506355714'),(195,'Adriano Cordeiro','BRANCA','MASCULINO','MASCULINO','1971-09-03','Sou Adriano Cordeiro, casado, católico, pai de 02 filhos. Formado em Administração de Empresas pela AESO Barros Melo e Radialista pelo SENAC. Sou Micro empresário atuando sistemas para o setor hoteleiro. Me sinto preparado para exercer o cargo de Vereador na Cidade do Recife, onde buscarei fiscalizar firmemente as ações e obras realizadas na cidade. Desenvolver projetos de ampliação e reforma na educação, criando espaços para o esporte e a cultura. Aumentar a sinalização nas ruas e avenidas, para facilitar e melhorar o trânsito, assim como criação e ampliação de ciclovias. Mobilidade, saneamento, pavimentação e criação de novas áreas verdes na cidade. Na saúde buscar ampliar os postos médicos afim de desafogar os hospitais da cidade.','adriano-cordeiro@hotmail.com','1203715369651630'),(196,'Washington Reis','PARDA','MASCULINO','MASCULINO','1983-01-25','Carioca de Irajá, 33 anos, pai, graduado em Letras pela UFRJ e pós-graduado em Língua Latina pela UERJ.\r\n\r\nFoii diretor e vice-presidente financeiro do Cordão da Bola Preta entre 2008 e 2011.','profwashingtonreis@gmail.com','1215460225185499'),(197,'Candidato Denis Veiga','BRANCA','MASCULINO','MASCULINO','1960-11-05','Nasceu na Vila Maria em 05 de novembro de 1960, então bairro distante da zona norte de São Paulo, onde também passou grande parte de sua juventude, desde cedo adotou o hábito da leitura de seus pais, que devoravam jornais e revistas, sobretudo o “Pasquim” com seu jeito debochado, denunciava os crimes da tirania militar que infelicitava o Brasil e seu povo.\r\n Militou de forma discreta no movimento secundarista e na universidade. Advogado formado pela Pontifícia Universidade Católica – PUC de São Paulo em 86, integrou a chapa “Opinião” situada à esquerda no espectro ideológico do movimento estudantil de então.\r\n  Foi todavia, no movimento comunitário e sobretudo nas batalhas em defesa do Sistema Único de Saúde – SUS é que se projetou como genuína liderança popular. Fez história no Real Parque já como conselheiro do orçamento participativo, quando então organizou junto com o povo, a luta exitosa pela construção da nova UBS; a “casa de bonecas” que a Prefeitura recebeu como UBS, isto porque, inúmeras inadequações arquitetônicas impediam que funcionasse como equipamento de saúde, fez com que o povo do Real Parque e do Jardim Panorama retomassem a luta e de novo, foram vitoriosos; foi eleito em primeiro lugar com mais de trezentos votos para o Conselho da Supervisão de Saúde do Butantã, e, liderou a organização de seminário para discutir a implantação das Organizações Sociais de Saúde na cidade de São Paulo,.    Lutas e vitórias na defesa do SUS, alçaram-no à representação dos usuários da região oeste de São Paulo no Conselho Municipal de Saúde, na época do Prefeito Serra que não hesitou, em autoritariamente impedir “manu militari”  a posse dos conselheiros legitimamente eleitos, porém, o Poder Judiciário, provocado pelo Ministério Público de São Paulo que abraçou a causa do Controle Social..entre outras sou  membro da Rede  Butantã há mais de dez anos, faz parte do Movimento Parque Chácara do Jóquei....    \r\n        Desde a juventude, defende a emancipação da classe trabalhadora da exploração capitalista; da liberação das mulheres de toda opressão machista; a luta anti-racista; contra todo o preconceito e homofobia, por uma cidade mais humana, inclusiva e tolerante, por uma cultura de paz, pelo fim do extermínio da juventude, pobre, preta e periférica, pela valorização da cultura popular, pela soberania nacional e pela democracia, contra o imperialismo, inimigo dos povos.','denisveigajunior1960@gmail.com','174276673009618'),(199,'Leonora Áquilla','BRANCA','MASCULINO','MASCULINO','1970-09-06','Leonora Áquilla, 45 anos, casada, tem 2 filhos, formada em Jornalismo pela Anhembi-Morumbi e cursou Pós-Graduação em Política pela PUC-SP. Nasceu em Teófilo Otoni-MG, mas foi criada na cidade de São Paulo, desde 1 ano de idade.\r\n\r\nO interesse pela política surgiu desde infância, onde sofreu muito preconceito e sempre teve esperança que poderia fazer muita coisa para mudar e ajudar o próximo.\r\n\r\nComo foi muito pobre e sofreu preconceitos na vida, Léo sempre superou isso com muita garra e quis ajudar quem passa pela mesma situação. Há anos ela ajuda mais de 200 crianças no Capão Redondo, bairro onde foi criada e sempre investiu na educação e criação de seres humanos melhores. Por ser uma artista conhecida, muitas instituições e pessoas a procuram e ela ajuda e contribui da melhor forma possível para quem precisa, sempre fazendo tudo com muito Amor e respeito ao próximo.\r\n\r\nLéo também dá muitas palestras por todo território nacional, levando mensagens e amor e contra preconceitos, sempre enfatizando que a educação é a opção para formar seres-humanos melhores.\r\n\r\nComo vereadora, Leonora quer uma São Paulo com mais educação para construir um futuro melhor para todos.\r\n','leoaquilla19789@gmail.com','957083231086136'),(200,'Ariton Santana','PARDA','MASCULINO','MASCULINO','1979-12-02','Pastor Ary Santana 27222\r\nSou Ariton dias de Santana, filho de Gabriel Jose Santana E Alzira Santos Dias, nasci na cidade de Santa Luzia sou casado com Ana Paula Pereira da Silva tenho três filhos, o Pedro, Aliny e Aryel, cheguei a coroa vermelha no ano de 1995 e no ano de 1996 comecei a trabalhar no Hotel Capitania onde tive um crescimento profissional gradativamente começando como serviços gerais chegando ao cargo de gerente Geral onde trabalhei por 18 anos, sou PASTOR CAPELÂO e JUIZ DE PAZ ECLESIASTICO pela CLAC “Confederación Latinoamericana de Capellania y Misiones ”REG. 231BR, CBO 2631 atuei como pastor da Igreja Mundial do Poder de Deus, tenho programa evangélico na radio 104,9 e sou pastor presidente na Igreja Mundial Jeova Jire, Campo Verde, Santa Cruz Cabrália BA.\r\nPROPOSTAS DO MEU MANDATO COMO VEREADOR:\r\nBuscando o melhor para nossa cidade que e a terra mãe do descobrimento e um melhor cenário Político de Santa Cruz Cabrália, no sentido de poder ajudar a construir uma sociedade livre, justa, fraterna e solidária, PRETENDEMOS ( JUNTOS EU EO POVO):\r\nCuidar do bem-estar de todos do nosso município e turistas, sem preconceitos de origem, raça, sexo, cor, idade, estado civil, religião, convicções políticas e quaisquer outras formas de discriminação;\r\n* fomentar o desenvolvimento municipal, de modo a assegurar a qualidade de vida de sua população e a integração urbana e rural;\r\n* minimizar a pobreza absoluta, analfabetismo e a marginalização e, reduzir as demais desigualdades sociais;\r\n* Fiscalizar o executivo, nas contas públicas, tanto quanto mau uso das verbas ou desvios, pois o vereador junto com população tem o poder de afastar o prefeito ou vice-prefeito, a exemplo do que vimos no âmbito nacional \r\n- Unir o povo e o VEREADOR é de ser representante do povo, e de longe a mais legitima de todas, para ouvir a comunidade em loco e despachar na presença dos interessados, fato que me permitirá o efetivo contato, realmente participativo, e transparência no trabalho, ouvindo e dando respostas aos eleitores, que com certeza se sentirão amparados, respeitados e honrados com minha presença em suas comunidades.\r\n- Total atenção voltada a incluir propostas e projetos sociais envolvendo as nossas crianças e adolescentes, com ênfase no desporto, com estimulo de parcerias entre as Secretárias de Saúde, Educação e Assistência Social;\r\nEDUCAÇÃO:\r\nFiscalizar para que o estudante seja matriculado na escola mais próxima da sua residência;\r\nAcompanhar, nas escolas, a distribuição e a qualidade da merenda escolar.\r\nViabilizar junto ao Executivo a criação de Cursos Profissionalizantes para Jovens carentes da Rede Pública de Ensino, com ênfase nas áreas de maior absorção, rede hoteleiras e ambulantes\r\nSAÚDE:\r\nLevar e criar projetos para aperfeiçoar os atendimentos nos Postos de Saúde, CAPS, na distribuição de medicamentos, com melhorias nos transportes, ambulâncias.\r\nVisitar periodicamente os postos de saúde e Pronto Socorro Municipal para acompanhar como esta o atendimento ao cidadão.\r\nApoio irrestrito aos Conselhos Municipais, todos, com ênfase ao Conselho Municipal de Segurança, da Criança e Adolescente, Sobre Drogas, Saúde, Assistência Social e Educação.\r\nAtuar junto ao Conselho Municipal sobre Drogas, a fim de solicitar ao Executivo (Médicos, Psicólogos, Terapeutas, Assistente Social, etc..) para enfrentarmos a Dependência de Substâncias (em especial o CRACK), que infelizmente assola nossa cidade, destruindo o futuro dos nossos jovens e desestruturando famílias. Com o objetivo a oferecer atendimento à população, realizar o acompanhamento clínico e a reinserção social dos usuários pelo acesso ao trabalho, lazer, exercício dos direitos civis e fortalecimento dos laços familiares e comunitários. Buscar melhorias para os Centros de Atenção Psicossocial (CAPS), entre todos os dispositivos de atenção à saúde mental, tem valor estratégico para a Reforma Psiquiátrica Brasileira.\r\n\r\nAssistência Social:\r\nApresentar indicações ao Executivo para criação de convênios com entidades filantrópicas para ajuda aos dependentes químicos e alcoólatras. Acompanhar a distribuição de verbas para entidades filantrópicas, bem como o uso destinado e a atuação dessas instituições;\r\nFiscalizar o cadastro e o atendimento dos diversos programas federais; Acompanhar atendimento ao idoso;\r\nDivulgar o trabalho dos conselheiros tutelares e outras entidades que lidam com a criança e o adolescente;\r\n- Fazer indicação ao Executivo na criação de um centro de conciliação de conflitos familiares;\r\n-Fazer indicação ao Executivo para a criação de um centro de convivência e atividades para 3ª idade;\r\nSEGURANÇA:\r\nApoio a Policia Militar, dentro do que a Lei permite, no sentido de oferecer melhores condições de trabalho, alinhado a expectativa da população, a fim de proporcionar uma melhor segurança aos nossos cidadãos e incentivo às atividades de prevenção Apoio a Policia Militar Rodoviária, no sentido de ajudar ao Comando junto às atividades voltadas a prevenção de acidentes nas rodovias que envolvem a nossa cidade.\r\nCobrança junto a Empresa Elétrica e Prefeitura Municipal, para uma melhoria na qualidade da iluminação em áreas deficitárias, a fim de proporcionar melhor segurança aos cidadãos, que inclusive pagam uma taxa para isso;\r\nESPORTE:\r\nApoio irrestrito ao Esporte, com incentivo a todas as modalidades de Esportes em todas as classes etárias, com total apoio a criança e ao adolescente e também aos integrantes da terceira idade;\r\nCULTURA:\r\nTotal apoio a Fundação Assisense de Cultura, no sentido de proporcionar a Rede Municipal de Educação, peças de Teatro, filmes no cinema, cursos, e tudo que vier de encontro ao anseio dos professores e diretores das Escolas, para uma formação adequada das nossas crianças e nossos jovens;\r\nSANEAMENTO BÁSICO:\r\nCobrança sobre a situação da Prefeitura com relação ao que se pode proporcionar em contrapartida pela exploração do serviço de água e esgoto da cidade, como redução da necessidade de uso de carros pipas, cursos e palestras para os cidadãos e empresas;\r\nLevar rede de esgoto onde necessário, principalmente nos bairros esquecidos pelo poder publico.\r\nINFRAESTRUTURA:\r\nDiscutir junto ao Executivo a melhoria URGENTE do terminal turístico e shopping ( dito dos brancos e índios), com remodelação, melhorias no asfalto, rede de esgoto, Internet, revisão das Empresas existentes e fomentar e atrair a vinda de novas empresas para nossa cidade, a fim de gerar empregos.\r\nPropor ao executivo a urgente criação do Terminal Rodoviário tanto em coroa Vermelha como em Cabrália, \r\nPropor a criação de ciclovias, primeiramente na orla de ligação entre Cabrália e os hotéis onde se torna necessário em função da deficiência de transportes nos horários da manha e noite.','ary@capitaniahotel.com.br','1078259155544137'),(203,'André Ribeiro','PARDA','MASCULINO','MASCULINO','1989-07-24','André Ribeiro trabalha com os jovens do Jumas a 14 anos,  radialista na área do jornalismo e sertanejo,  destaca-se com sua luta e superação com uma doença de osteoneocrose a 17 anos...  Já morou no MS,  SP,  Curitiba.\r\nTrabalhou nas emissoras de rádio Yara FM como jornalista apresentador e entrevistador, Rádio Tomburi FM, é fotógrafo, Cinegrafista e ator com apresentação em teatros como Jesus a 6 anos, Poeta Venâncio ,  participação no Filme Despertar onde vive o personagem Miranda,  figurante na novela Os Mutantes TV Record 2009,  Curso de atores e modelos Casa Blanca. \r\nCom amor em tudo o que faz a deficiência física o fez ir muito mais longe pela garra e coragem. ','andre_jumas@hotmail.com','10207158970481322'),(204,'Paulo Leonardo Ppl','PRETA','MASCULINO','MASCULINO','1977-09-12','Tenho 39 anos, sou filho de um encanador e uma diarista (aposentados), sou casado, pai de dois filhos, advogado, pós graduando em direito previdenciário, resido na Cidade Tiradentes desde 1985, milito pela defesa dos interesses de algumas associações que trabalham para retirar viciados em dogras das ruas, que buscam a igualdade racial e que tem projetos sociais.\r\nSou evangélico e como tal, busco ajudar os necessitados em suas demandas, promovendo eventos que acalentem os corações.\r\nAmo a verdade, vivo pela justiça e fico indignado com o descaso dos políticos e a inércia do povo.\r\n','pldoppl@hotmail.com','1041741472612206'),(205,'Carlos Alberto Franco Bueno','BRANCA','MASCULINO','MASCULINO','1966-11-02','A REDE GUARULHOS NÃO COLIGOU PARA VEREADOR => Portanto, votar 18.181 só dará voto para mim e para os Vereadores da Rede !\r\n\r\nColegas,\r\n\r\nSempre conquistei meus objetivos, sejam eles profissionais, educacionais e de hobby.\r\n\r\nLevei 2 anos, mas entre os 12 anos e meus 14 anos, aprendi a fazer o Cubo mágico, sozinho (apenas um movimento aprendi, mas já montava o cubo levando apenas 1 dia, e criei o meu método, que não vi ninguém ainda usando igual – Após aprender esse movimento, passei a montar em 2 minutos em média – meu record é 28 segundos).\r\n\r\nDesenvolvo sistemas de informática na minha própria empresa, mas já coordenei equipes de até 26 pessoas, e sempre as treinei, deixando-os livres para acharem seus caminhos e soluções, intervindo quando necessário ao ver que estavam se perdendo tecnicamente ou com falta de incentivos.\r\n\r\nApesar de estar na área de Desenvolvimento principalmente, mais da metade do tempo atendo aos clientes, e negocio com eles tanto a venda de meu sistema e serviço técnico quanto a melhor solução ao seu negócio. Tenho clientes em Lojas de todos os tipos e ramos, Restaurantes de todos os tipos, Jornais, Assistencias técnicas, Industrias, Buffets, etc...\r\n\r\nJá trabalhei em Empresas de Serviços, Jornais, Industrias, Setor Financeiro e outros setores ! Auxiliei a consultoria diretamente em mais de 200 empresas, sendo funcionário ou através de meus sistemas e treinamento.\r\n\r\nFiz mais de 50 cursos em minha área, visitei mais de 10 países, falo inglês razoável (leio muito bem, e entendo bem), meu sotaque é meio ruim... Falava alemão, agora já não sei...\r\n\r\nInformática foi sempre usada por mim como uma ferramenta de agilização de processos, de redução de custos, transparência nos gastos, nas compras, nas vendas, nas negociações de atrasos, de contratos, evitando erros e desvios dos funcionários e de empresas Abertas ao Mercado Bovespa. Exatamente o que considero que falta no setor Público.\r\n\r\nSempre lembro que pesquisei e através da informática, provei e evitei vários desvios de conduta de funcionários, que ocorrem infelizmente de forma muito comum também no setor Privado. Também é uma tarefa que será necessária no cargo de vereador.\r\n\r\nDesde pequeno sei que o mais necessário ao nosso desenvolvimento como nação é EDUCAÇÃO! De qualidade ! Temos que fazer com que toda criança tenha acesso a Educação de Qualidade ! Saúde será menos necessária, já que as pessoas com educação sabem como evitar doenças, tornam-se médicas, pesquisam remédios, produzem vacinas e tratamentos. Segurança será menos necessária, porque teremos mais empregos, e menos pobres abaixo da linha absoluta de pobreza.','cafbueno@guaru.com.br','1378705812158304'),(206,'Alessandro Buzo','BRANCA','MASCULINO','MASCULINO','1972-09-25','Alessandro Buzo é escritor, autor de 12 livros e organizador de outros 10. \r\nFez reportagens sobre cultura da periferia de 2008 à 2011 no Programa Manos e Minas da TV Cultura e de 2011 à 2014 no SPTV 1a edição da Globo. \r\nDiretor do filme Profissão MC \r\nPersonagem do filme CONVICTO, sobre o Sarau Suburbano. \r\nIdealizador e apresentador do evento Favela Toma Conta, 12 de outubro de 2016, 30a edição, desde 2004. \r\nProprietário da Livraria Suburbano Convicto, 9 anos de atividade, única do país especializada em Literatura Marginal. \r\nNa Livraria acontece o evento SARAU SUBURBANO que Buzo apresenta toda terça-feira.\r\nPai do Evandro, esposo da Marilda Borges. \r\nSe auto intitula Suburbano Convicto e usa o slogam #SuburbanoVotaConvicto \r\nBlog: www.buzo10.blogspot.com\r\nTwitter: @Alessandrobuzo \r\nCANAL: www.youtube.com.br/alessandrobuzo ','suburbanoconvicto@hotmail.com','635634593276866'),(208,'Lucia Neves','PRETA','FEMININO','FEMININO','1983-12-05','Sou a Bibi silva pela força jovem trazendo novos tempos , esse ano tomei a inciativa e juntos com a coragem para entrar neste meio politico estou colocando uma cara nova na politica : A minha pois mim candidato pela primeira vez a vereadora da cidade do recife ,sou a Bibi silva recifense, vivendo ate hoje entres bairros de periferia ,sou de família humilde ,no qual os valores adquirindo ao longo da vida sempre norteando a minha trajetória , com principio éticos e morais , desde cedo , decidida e comprometida com co o que faço e a favor do bem estar do ser humano , fui atuante de movimentos estudantil , percorri vários estados a traves de foros  de politicas e vivenciando de perto a necessidade de cada um através de debates políticos . Decidi a me candidatar para poder vivenciar o atual momento politico , com objetivo de trabalhar pelos interesses da comunidade e tentar mudar o discurso de que politico não faz nada , promovendo a interação da politica na sociedade a traves de uma juventude atuante ,fundamentando a verdadeira inclusão social.             ','fabiindia@hotmail.com','673481609469040'),(210,'Valdelina Guilherme','PRETA','FEMININO','FEMININO','1964-11-12','Valdelina Guilherme mulher guerreira moradora do bairro de areias agente de saúde à 20 anos ajudou a organizar associação dos acs de Recife participou da organização do sindcas e na qual fui diretora lutei em Brasília pela efetivação e piso salarial da categoria, atuei em programas sociais pela visão mundial e atuei em defesa dos direitos dos portadores de necessidades especiais e atualmente tenho um trabalho social com grupos de idosos na minha comunidades luto pelos direitos das mulheire na minha comunidade contra violência doméstica abuso sexual por isso estou colocando o meu nome à disposição de vocês eleitores recifenses valdelina 28500. \r\n','valdelinaacs@hotmail.com','900768043390697'),(212,'Marina Medeiros Helou','BRANCA','FEMININO','FEMININO','1987-08-25','Marina Helou, é mulher, paulistana e tem 29 anos. É formada em Administração Pública pela Faculdade Getúlio Vargas (FGV-SP), tem especialização em negócios, sustentabilidade e inovação pela Fundação Dom Cabral/ Cambridge University.\r\n\r\nPreocupada com as questões relacionadas ao meio ambiente e a sustentabilidade, trabalhou em uma pequena empresa (start-up) chamda Sotkon que estava trazendo para o Brasil novas formas de coleta de resíduos sólidos.\r\n\r\nEntrou no programa de trainee da Natura focando sua atuação na área responsável pela diversidade e inclusão de pessoas com deficiência, fazendo uma articulação entre essas pessoas, entidades organizadas, governo e a empresa. Tornou-se responsável por essa área na empresa, desenvolvendo um trabalho e grande impacto na vida de muitas pessoas e colocando a Natura como referência no mercado. Está na Natura há 5 anos e neste momento tirou uma licença não remunerada para poder se dedicar á campanha.\r\n \r\nSeu interesse pela política começou desde cedo e acredita que as mudanças que queremos para o país passam necessariamente pela política institucional, para que possamos ter um país mais justo, próspero, solidário, democrático e sustentável. Em 2015 fortaleceu a proximidade da politica ingressando na RAPS –Rede de Ação Politica pela Sustentabilidade por meio do programa Jovem RAPS. A Raps é uma rede de formação para a politica institucional que conta com as melhores lideranças politicas comprometidas com a ética, a sustentabilidade e uma forma conectada de fazer politica.\r\n \r\nÉ comprometida com os direitos humanos e com o combate a todas as formas de discriminação e defende o empoderamento feminino por meio da política como forma de construir uma democracia mais participativa. Atualmente, as mulheres representam 51,4% da população brasileira, mas na Câmara dos Vereadores em SP o número de mulheres não chega a 10%. Para Marina, é fundamental aumentar essa participação e ter mais mulheres na política, para que haja políticas públicas mais efetivas voltadas para as mulheres e representatividade! Politica é sim lugar de mulher!\r\n \r\nParticipa do partido REDE SUSTENTABILIDADE desde a sua criação, e acredita na forma como o partido considera as questões da sustentabilidade para desenvolver suas propostas, além da seriedade com que trata as questões da ética e transparência na política. Em 2016 vai fazer a sua estreia na política institucional, concorrendo ao cargo de vereadora pela cidade de São Paulo pela primeira vez.\r\n \r\nNas eleições de 2016, Marina é uma das candidatas apoiadas pela Bancada Ativista – um movimento suprapartidário que busca ajudar a eleger candidatos que se identifiquem com seus princípios, focados principalmente na garantia dos direitos humanos, no combate às desigualdades e na total transparência como forma de combater a corrupção.\r\n\r\nSua principal bandeira é resgatar o papel do vereador parlamentar de conectar as pessoas dos espaços de poder. Para isto quer descomplicar a política, aproximando as pessoas por diferentes meios: Com transparência, utilizando a tecnologia da informação, reuniões itinerantes e dialogo de todos os temas da Câmara Municipal com os movimentos vivos da cidade.\r\n\r\nQuer com isto construir uma cidade mais acessível para as pessoas com deficiência. Tema de competência municipal e sub-representado na Câmara. Acredita no poder da diversidade para uma cidade melhor para todos.\r\n\r\nUma cidade mais empreendedora, reconhecendo e valorizando as iniciativas de geração de valor na cidade. Desde o empreendedorismo de start-up até a economia criativa e os negócios sociais.\r\n\r\nUma cidade mais sustentável. Cuidando e valorizando o meio-ambiente, pressionando por uma transição de matriz energética e valorizando a energia solar e colocando a interligação dos temas sociais, econômicos e ambientais na pauta! \r\n\r\nConheça mais das propostas no site!\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n','mmhelou@gmail.com','10153841799541709'),(214,'Elizeu De Souza Gomes','PARDA','MASCULINO','MASCULINO','1990-05-22','','ver.elizeu@gmail.com','1204868872866815'),(215,'Otavio Zini','PARDA','MASCULINO','MASCULINO','1971-03-31','Balneário Camboriú como as mais diversas cidades tem realidades diferentes que necessitam de atenção e decisões coerentes, pensar uma cidade é antes de tudo, pensar o povo que nela vive, em toda a sua diversidade, não apenas uma elite, para seu povo a cidade tem de ser mais que apenas uma estética, ela tem de ser funcional e responder aos anseios desta população, provendo condições não apenas de sobrevida, mas de vida plena e agradável, com saúde, educação, transporte e lazer, Nossa luta é por um povo que não baixa a cabeça, gente como você que não se conforma, gente que batalha por uma vida melhor.\r\nNós podemos ter e fazer essa cidade, para isso conto com seu voto e apoio!\r\nOtavio Zini 50123.\r\npropostas: https://issuu.com/otaviozini/docs/propostas_do_candidato_a_vereador/1','lasherssa@hotmail.com','10209025397451223'),(216,'Marielle Franco','PRETA','FEMININO','FEMININO','1979-07-27','Sou Marielle Franco, mulher, negra, mãe e cria da favela da Maré. Socióloga formada pela PUC-Rio, sou mestra em Administração Pública pela Universidade Federal Fluminense (UFF). Trabalhei em organizações da sociedade civil como a Brasil Foundation e o Centro de Estudos e Ações Solidárias da Maré (Ceasm). Coordenei a Comissão de Defesa dos Direitos Humanos e Cidadania da Assembleia Legislativa do Rio de Janeiro (Alerj), ao lado de Marcelo Freixo. \r\n\r\nEu Sou Feminista, Porque Nós Somos Mulheres Guerreiras!','mariellefranco@gmail.com','1335018743174967'),(217,'Nego Lelo','PRETA','MASCULINO','MASCULINO','1971-12-08','Na câmera de vereadores, pretendo ampliar o meu trabalho que já vem sendo realizado na comunidade, assumindo o compromisso de lutar de forma permanente pela construção de politicas publicas efetivas em beneficio das comunidades mais carentes de Porto Alegre, Trabalhar em defesa, prevenção e de sensibilidade da sociedade no intuito de zelar pelo bem-estar de nossas crianças, adolescentes e jovens que orientando e cuidando na infância, para que no futuro teremos cidadão de Bem, em defesa da proteção, ampliação, garantia e comprimento dos direitos das mulheres, na busca de paridade/ equilíbrio entre homens e mulheres, buscando o respeito da integridade física e moral da mulher, combater o preconceito, a desigualdade, racismo e a descriminação em todos os gêneros, lutar pela educação, Esporte e a Cultura em todos os âmbitos, fazer cumprir a Lei nº 10.639, mostrar a temática “História e Cultura Afro-Brasileira” nas escolas a história dos nossos antepassados tem que ser lembrada sob novas perspectivas e visão, com material didático e também nos meios de comunicação, ouvir as demandas da classe dos servidores públicos municipais, prevenção e a fiscalização do meio ambiente, construções de creche comunitárias, participar e fiscalizar as demandas das 17 regiões do Orçamento Participativo.  ','124535@gmail.com','1123741884377200'),(218,'Stefano Ferrara','BRANCA','MASCULINO','MASCULINO','1990-10-16','Tenho 25 anos, curso Gestão Pública na UFMG e gosto muito de soluções urbanas criativas. Penso que a cidade deveria ser pensada para todos de uma maneira inteligente e sustentável.\r\nPor isso proponho o IPTU Verde, a prática de políticas sustentáveis e participativas, a eficiência na gestão e a defesa dos direitos animais. \r\nToda a minha plataforma foi pensada de acordo com os potenciais de BH, que são muitos. O setor público é responsável por criar um ambiente mais favorável para a inovação, tecnologia, sustentabilidade e negócios. Assim a cidade gera mais empregos qualificados e melhora a qualidade de vida das pessoas.','stefanoferrarabh@gmail.com','10210469969248407'),(222,'Albanise Pires','BRANCA','FEMININO','FEMININO','1966-09-27','Albanise é fundadora e atual Presidenta do PSOL Pernambuco. Mulher, mãe, feminista, sindicalista,  engenheira, servidora do Ministério Público Federal e candidata a vereadora do Recife. Sua candidatura busca ampliar na Câmara de Vereadores as experiências exitosas do PSOL nos legislativos Estadual e Federal, em defesa das populações historicamente oprimidas,  como mulheres, negras e negros e LGBT. ','albapsol@yahoo.com.br','976254399169520'),(224,'Maria Do Céu','BRANCA','FEMININO','FEMININO','1967-03-10','Maria do Céu é recifense, mãe de quatro filhos, e psicóloga. Foi servidora municipal, modelo profissional,produtora cultural e presidente do Instituto Boa Vista – ONG que promove a ocupação do Recife através de ações organizadas na direção do respeito aos Direitos Humanos e à natureza. Atualmente, é coordenadora estadual do PPS diversidade. Há mais de 20 anos, Maria do Céu trabalha com entretenimento voltado, principalmente, à comunidade LGBT, abrindo espaços livres de preconceitos e repletos de acolhimento. Maria participa de ações de conscientização na área da saúde e dos Direitos Humanos. Apoia e ajuda a construir celebrações culturais como o Love Noronha e o Recifest – festival de cinema da diversidade sexual e de gênero. Além disso, Maria do Céu também é grande apoio e engajadora da Parada da Diversidade de Pernambuco, maior evento político da comunidade LGBT no Recife. Pelos serviços prestados à cidade, recebeu a Medalha do Mérito José Mariano, em 2010, na Câmara Municipal. Maria do Céu pretende ser vereadora do Recife para ampliar as lutas que ajuda a compor há anos, promovendo o empoderamento coletivo e aumentando o respeito à diversidade humana na cidade, através do exercício amplo da cidadania, da abertura de portas e da inclusão de todos e todas.','contato@recifelivre.org','1178922825508409'),(226,'Marcio Black','PRETA','MASCULINO','MASCULINO','1977-02-16','Meu nome é Marcio Black, sou produtor cultural, cientista político e integrante do Coletivo Sistema Negro.\r\n\r\nCresci na periferia de Osasco e encontrei na ocupação das ruas de São Paulo com cultura e ativismo uma estratégia de existência e da importância da garantia de direitos para estar nela. \r\n\r\nEstratégia de existência numa cidade que trata muito mal sua população negra assim como outros segmentos marginalizados. ','marcioblack@gmail.com','10207833568021992'),(227,'Ciça Chaves','BRANCA','FEMININO','FEMININO','1969-09-04','Sou portadora de necessidades especiais, luto por saúde e acessibilidade melhor e de qualidade sem demora.','cicacha@hotmail.com','1118989361472118'),(228,'Eduardo Cavalcanti Dos Santos','BRANCA','MASCULINO','MASCULINO','1963-05-11','Sou Bel. em Ciências Econômicas, Prof. Matemática e Contabilidade, Corretor de Imóveis.\r\nDefendo maiores investimentos nas áreas de educação e cultura, saúde, esporte e lazer,  segurança pública, mais atenção às causas das criadas e adolescentes, pessoas idosas e aposentadas. Exigir das autoridades competentes o cumprimento das leis na defesa da sociedade como um todo, com relevância aos direitos das mulheres, dos negros e do respeito aos movimentos LGBT.','eduardo2012santos@hotmail.com','10207302832194679'),(231,'Denivaldo S Santana Santana','PARDA','MASCULINO','MASCULINO','1973-10-12','Eu Denivaldo da Silva Santana tenho apreço pelas pessoas sendo elas de qualquer ideologia ,racial,identidade masculino ou feminina .reconheço que todas as pessoas tem o direito de escolher a sua forma vida em que se sinta bem,na democracia é livre a escolha de viver em sociedade como todo,não diferenciando o cidadão ,as suas crenças é de direito constitucional para todos cidadão Brasileiro.\r\nEntendo que o direito a vida e liberdade e para todos, não sendo a escolha permitida a qualquer  individuo que não seja o mesmo ,agradeço ao povo brasileiro e a sociedade pelo espaço fornecido a todos que aqui vive ,mantendo o respeito a todo cidadão brasileiro e estrangeiro  que soma com este país.\r\nAt.Denivaldo','denivaldo.10@bol.com.br','1238256529539953'),(232,'Luciano Egidio Palagano','BRANCA','MASCULINO','MASCULINO','1982-02-17','Tenho 34 anos e milito em causas sociais desde os 15 anos de idade, pelo menos, iniciei minha militância nas Pastorais Sociais da Igreja Católica (Pastoral da Juventude e Pastoral Operária), sou Bacharel e Licenciado em História pela Universidade Estadual do Oeste do Paraná (Campus de Marechal Cândido Rondon), atualmente ocupo o cargo de Secretário de Comunicação do Centro Regional de Direitos Humanos (CRDH), milito junto a causa indígena (na luta do Povo Guarani pela reconquista de sua terra na Região Oeste do Paraná) e também como ambientalista. Sou funcionário público na Rede Estadual de Ensino do Paraná, filiado a APP-Sindicato, onde na Greve de 2015 (que resultou no sangrento e fatídico 29 de Abril) integrei o comando Regional de Greve do Núcleo Sindical de Toledo, também sou colaborador do Projeto Brasil de Fato Paraná e Secretário Geral do Partido Socialismo e Liberdade em Marechal Cândido Rondon.','conde-palagano@hotmail.com','1201204446568310'),(233,'Danielle Braz','PARDA','FEMININO','FEMININO','1990-05-26','Sou advogada, mestranda em Ciências Sociais e militante do movimento feminista. Iniciei minha militância no movimento estudantil e contribui com a organização popular de vários grupos em minha cidade, desde o movimento hip hop até cooperativa de trabalhadores. Hoje integro o Coletivo Feminista Independente As Benditas, nos reunimos quinzenalmente para debater vários temas relacionados à questão de gênero e temos o intuito de começar a trabalhar nos bairros, com apoio jurídico e psicológico às mulheres em situação de violência. Defendo um mandato coletivo, onde os apoiadores da campanha possam discutir e definir os projetos que vou defender e as posições que vou tomar na Câmara de Vereadores. Defendo o direito a todos contribuírem para a construção de uma cidade mais justa, igualitária e democrática. ','daniellebraz00@gmail.com','10205658986353371'),(234,'Luciene Cavalcante da Silva','BRANCA','MASCULINO','MASCULINO','1964-06-03','Formado em Engenharia, atuei por 18 anos em empresa metalúrgica localizada na região sul da capital.\r\nIngressei no serviço público em 1998, quando passei no concurso público para a carreira de Auditor-Fiscal Tributário. Eu me formei, posteriormente, em Direito, com Mestrado na área de Direito Tributário, sempre defendendo a tese de uma justiça fiscal, com redução da carga tributária. Atuei também como presidente da 4ª Câmara Julgadora do Conselho Municipal de Tributos e Diretor da Divisão de Fiscalização de Serviços da Secretaria de Finanças de São Paulo.\r\nFui eleito para o cargo de presidente do Sindicato dos Auditores-Fiscais do Município de São Paulo, por 3 mandatos consecutivos, ao mesmo tempo em que ocupei a vice-presidência da região sudeste da Federação dos Auditores-Fiscais Municipais.\r\nIrmão do Deputado Carlos Giannazi, tenho atuado sempre apoiando e participando ativamente das lutas pela melhoria dos serviços públicos de qualidade, valorização dos servidores que prestam os serviços públicos, e investimentos prioritários do orçamento municipal com Educação, Saúde, Transporte, Cultura e Lazer.\r\nCom vasta experiência, atuando na área de finanças públicas, tenho condições de exercer um papel fundamental na fiscalização e acompanhamento da elaboração e correta execução do orçamento municipal.','clgianna@uol.com.br','902342386537489'),(235,'Pedro Rebelo','BRANCA','MASCULINO','MASCULINO','1991-05-16','Sou Pedro Rebelo, tenho 25, sou professor de História e criado no município de São Gonçalo RJ. Minha militância na cidade passa pelo movimento estudantil, luta por moradia e movimento comunitário de pré vestibular. A insatisfação com a velha política me trouxe até aqui e agora é hora de fazer uma candidatura compromissada com as minorias, com os movimento sociais e em defesa de uma educação pública, laica e de qualidade, assim como lutamos pelo direto à cidade, da juventude e contra a intolerância religiosa.   ','pedrorebelo.m@gmail.com','1102028399880919'),(236,'Izinho Benfica Benfica','BRANCA','MASCULINO','MASCULINO','1961-09-03','\r\nEu sou Clair José Benfica (Izinho Benfica),  natural de Belo Horizonte, tenho 55 anos, cresci e me eduquei  na região da Lagoa do Nado, confluência de treis regionais, Pampulha, Norte e Venda Nova, no  bairro Planalto, onde morei 36 anos,  hoje moro no bairro Santa Tereza onde estou  criando meu filho e  atuando na comunidade.\r\nSou funcionário da Secretaria de Estado do Meio Ambiente e Desenvolvimento Sustentável de MG a mais de vinte anos, formei  em Administração em Gestão Ambiental e Recursos Naturais. Tive a oportunidade também de trabalhar no Instituto Estadual de Florestas/IEF, Instituto Mineiro de Gestão das Águas/IGAM e na Prefeitura de BH na Secretaria Municipal de Meio Ambiente, Fundação  de Parques e URBEL.\r\nMinha atuação nos movimentos sociais iniciou ainda na adolescência quando junto com vários amigos participei do movimento que mais tarde se consolidou em uma entidade ambientalista a Associação Cultural Ecológica Lagoa do Nado, que possibilitou varias conquistas como a criação do Parque Lagoa do Nado e tantas outras áreas verdes em BH e no estado de MG. Militando no movimento ambientalista tive a oportunidade de atuar  em várias áreas, como na questão artística, cultura da criança, indígena , direitos dos animais, agricultura urbana, desenvolvimento urbano, moradia, bairros,  movimento cultural e de várias formas na área do desenvolvimento sustentável.\r\nEstou na construção da Rede Sustentabilidade desde o inicio, em 2013, participei de todas as instâncias, nacional estadual e agora estou como Porta Voz da Rede em BH. Acredito e trabalho para que a Rede realmente possa fazer a diferença, ser um referencial para nossa sociedade no fazer política, de que governar é um ato de todxs e para todxs e que o partido é um instrumento de participação e transformação social. \r\n\r\n\r\n','izinhobenfica@gmail.com','10210817239695163'),(237,'Hilton Coelho Psol','PRETA','MASCULINO','MASCULINO','1971-06-22','Hilton Barros Coelho é natural de Salvador e nasceu no dia 22 de junho de 1971. É servidor público federal.\r\nMilitante do Partido Socialismo e Liberdade (PSOL), atua desde jovem nos movimentos sociais, defendendo os ideais do socialismo referenciado no histórico de resistência e lutas do nosso povo! É Mestre e graduado em História pela Universidade Federal da Bahia (UFBA) onde completou seu Mestrado na mesma área.\r\n\r\n Foi eleito vereador nas eleições de 2012, sendo o segundo mais votado na cidade, com 16.408 votos (1,27% dos válidos) pela Coligação “Chega de Vender Nossa Cidade” (PSOL-PCB).  Atua no movimento sindical na direção do Sindicato dos Servidores do Judiciário na Bahia (licenciado). É membro da Corrente Sindical Resistência e Luta.\r\n\r\nEnquanto Vereador  tem um mandato atuante e combativo. Entre outras  ações, realizou audiência sobre a situação da população LGBT no mercado de trabalho e apresentou projetos que combatem a discriminação no mercado de trabalho e facilitam a contratação de travestis e transexuais. Hilton é um aliado de primeira hora das lutas de Lésbicas, gays, bissexuais, travestis, transexuais e intersex. Foi um dos mais aguerridos na disputa em torno do Plano Municipal de Educação para garantir as discussões de gênero e diversidade nos currículos.\r\n\r\nSão objetivos do seu mandato ser uma trincheira a serviço da luta, do povo guerreiro da nossa cidade, a serviço dos movimentos sociais, das causas justas, da transparência no trato com a coisa pública, com a democracia e a participação popular. Um canal e um instrumento da resistência negra, indígena, feminista, LGBT, ecossocialista e popular na Câmara de Vereadores e nas ruas de Salvador.\r\n','canaldaresistencia@gmail.com','546348338905160'),(238,'Sergio Paulo da Silva','BRANCA','MASCULINO','MASCULINO','1964-03-31','Ativista das causas ambientais a 25 anos.\r\nProtetor de animais e mantenho um abrigo com mais de 50 gatos.\r\nVegetariano a 25 anos, com ideal Vegano. \r\nEstudante de Direito.\r\nDefensor da Ecologia e Sustentabilidade.\r\nPropostas para regularização dos mototaxistas e motofretistas.\r\nMedidas de prevensão para evitar acidentes com motociclistas e pela Paz no Transito.\r\nApoio so terceiro cetor com a liberação e regularização dos foodtrucks nas praças e  ruas de Recife.\r\nMais praças e áreas públicas e vamos fazer de Recife um lugar bom pra viver!','vereadorsergiopaulo43210@hotmail.com','10211019854799297'),(239,'Raquel Auxiliadora','BRANCA','FEMININO','FEMININO','1983-07-19','Pedagoga, especialista e mestre em educação pela Universidade Federal de São Carlos. É professora da Educação de Jovens e Adultos (EJA) no Centro de Atenção Psicossocial (CAPS).\r\nAtuante desde o movimento estudantil. É coordenadora do coletivo Promotoras Legais Populares e já foi gestora de Política para as Mulheres no município de São Carlos (2007-2012) quando foi implantado o Centro de Referência da Mulher.\r\n','raquel.auxiliadora13180@gmail.com ','10210542967954037'),(240,'Naty Veiga','PARDA','FEMININO','FEMININO','1982-12-24','A Produtora Cultural, Produtora Musical e DJ NatyVeiga, iniciou sua formação artística estudando na Academia Internacional de Música Eletrônica de Curitiba - AIMEC ( Ganhadora 2011,2012,2013,2014 e 2015 Prêmio de melhor Escola/Curso para DJS do Brasil pela RIO MUSIC CONFERENCE, conferência realizada todos os anos no Rio de Janeiro.\r\nEstudou curso de DJ e Produção Musical baseado no programa ABLETON LIVE. \r\n \r\nEstudou Produção Musical baseado no programa LOGIC PRO X na DJ BAN/ São Paulo/SP.\r\nEstudou Teoria e Percepção Musical com professor e produtor Thomas Gruetzmacher na DJ BAN/ São Paulo/SP.\r\n \r\nDJ do programa FALA AÍ / Tv Cultura Manaus desde 2010.\r\n \r\nFormou-se na Universidade do Sul de Santa Catarina em Produção Multimídia.\r\n \r\n\r\n\r\n \r\nSAP 2013 ( Semana de Atividade Publicitária ) - IFAM\r\n- Idealizadora e facilitadora da Oficina de Sound Design no Cinema.\r\n- Idealizadora e facilitadora da Oficina A Música e suas possibilidades Criativas.\r\n \r\nAutora da Palestra \"DJ e Músico \" na World DJ - 10 de Março 2012 - Amadeu Teixeira.\r\n \r\nIdealizadora e produtora do projeto TACAPEIA IN CONCERT - Espetáculo de Música\r\nEletrônica com sons amazônicos, reunindo os melhores artistas da cena amazonense. Bateria, baixo e DJ. Ganhou prêmio da Manauscult SOM NA CIDADE 2013. \r\n \r\nProdução Musical - Ritual Amazon Eletrônico no desfile de moda Cabedal de Criadores - Da Vinci Hotel - Junho 2014.\r\n \r\nPaisagem Sonora - Espetáculo \"Chico: o corpo em cores e sons.\" Companhia ContémDança.\r\n \r\nProdução Musical - Espetáculo \"Quase Invisível\" 2014 - ContémDança - 6º Festival Amazonas de Dança - Teatro Amazonas.\r\n\r\nCriação Musical - Espetáculo \" A rua Dança \" 2015 - ContémDança.\r\n \r\nIdealizadora do projeto TACAPEIA MANAUS - Guia Didático de Bolso de Música Eletrônica. Objetivo: Popularizar a profissão DJ e a Música Eletrônica.\r\n \r\nJurada noo 58º Festival Folclórico do Amazonas.\r\nJurada no 7 º Festival dos Botos de Maraã - 2014\r\n \r\nProdutora do workshop TACAPEIA MANAUS E AIMEC ( Academia Internacional de Música Eletrônica de Curitiba ) em Manaus, na Associação Batukada, com Ilan Kriger ( Um dos sócios na época ) . 2012.\r\n\r\nProdução/Criação Musical de 4 trilhas para desfile Amazon Fashion Avenue.\r\nProjeto Game Hits ( Criação de música de 8 bits, música retrô para games.\r\n\r\nCriação de sons e músicas para seis jogos eletrônicos produzidos em Manaus: Malyn, Music Beat, DuckEscape, James Turtle, Loona, Gravity Hero.\r\n\r\n','veiga_naty@hotmail.com','1233881213330024'),(241,'Fernando Dutra Dos Santos','PRETA','MASCULINO','MASCULINO','1954-12-28','Assim como eu, você tambem tem motivos de sobra para não votar, pois tudo que vemos e ouvimos nestes tempos são coisas vazias e sem conteudo pratico para a melhoria de vida das pessoas.\r\nPor este motivo coloco meu nome para sua apreciação, pois entendo que se nos não nos colocarmos em defesa da de uma melhor qualidade de vida de todos , não estaremos cumprindo com nossa obrigação humana.\r\n Não podemos mais ser governados por corruptos bandidos e delinquentes e chegada a hora dos homens e mulheres de bem.\r\nSou Fernando Shopping numero 27777,   tenho certeza que honrarei e valorizarei seu voto a ponto de você nunca esquecer em quem votou. \r\nMuito agradecido pela oportunidade.  ','fernandocultural@hotmail.com','10207355713358498'),(245,'Dorinha Andorinha','PARDA','FEMININO','FEMININO','1966-02-09','Sou enfermeira,atuo na saúde pública, por uma Cidade mais humana,,tenho projetos mobilidade urbana, valorização do profissional de saúde,inclusão social para idosos,educacação unificada de qualidade,onde a escola deve ser um atrativo para quem quiser Abrir uma janela para o futuro.E contra o abismo social na distribuição de renda.','dogaha@hotmail.com','1073906346033852'),(250,'Anna Paula Carvalho','BRANCA','FEMININO','FEMININO','1967-08-10','Sou Enfermeira, Fisioterapeuta, Pós-graduada, Secretária Estadual do PV Mulher.\r\n\r\nSão 26 anos como cidadã comum nas ruas, nas audiências públicas, na Camara dos Vereadores, na ALEPE lutando pela saúde. E atualmente ninguém nos escuta. Só os políticos são ouvidos; por isso resolvi ser política para lutar por Respeito, Valorização e Cidadania.\r\n\r\nNos dias atuais conseguir atendimento no SUS é uma loteria. \r\n\r\nO 0800 fez com que a fila dos ambulatórios fossem para tráz de uma linha telefônica que só dá ocupado e quando por um milagre a secretária eletrônica atende manda ligar no outro dia por falta de vaga.\r\n\r\nOs prprofissionaisa saúde trabalham em condições insalubres, adoecem físico e mentalmente por causa da falta de humanização para com eles; os da Enfermagem são submetidos a carga horária escrava.\r\n\r\nA Saúde, Educação e Segurança estão na UTI e como parlamentar quero representar o cidadão recifense defendendo toda a demanda que chegar ao meu gabinete que será Multiprofissional. ','annapaulamc35@hotmail.com','1202878043068557'),(254,'Silvia Palma','AMARELA','FEMININO','FEMININO','1958-07-18','Sou Graduada (Licenciada e Bacharelada) em Psicologia pela UNIP - Universidade Paulista e Pós-graduada em Administração e Gestão Educacional pela PUCAMP. Atuo como terapeuta comportamental atendendo jovens, adultos e casais.\r\nTambém sou Professora de Graduação e Pós-Graduação com larga experiência em treinamentos e palestras para equipes de diferentes níveis hierárquicos.  \r\nAtuando como Consultora Técnica e mediadora de conflitos na área de Beleza ( Congressos de Estética e Salões de beleza), procuro estar em constante aprimoramento, aperfeiçoando os meus conhecimentos especificamente na “Humanização da Gestão de Equipes”. \r\n','sepprpu@gmail.com','10206259750607126'),(255,'Denny Thame','PARDA','FEMININO','FEMININO','1978-07-04','Defende o meio ambiente, o combate à corrupção e os incentivos à economia verde. É professora de Direito Ambiental, Cultura, Mídia e Entretenimento. Nunca exerceu cargo político. Acredita que agora é a hora para mudar a forma como é feita a política neste país.\r\nComo legisladora municipal pretende reformular as leis existentes e propor alternativas coordenadas para servirem de base para políticas públicas criativas e eficientes.\r\n\r\nMídias sociais:\r\nhttps://m.facebook.com/DennyThamePV\r\nhttps://twitter.com/dany_thame\r\nhttps://www.instagram.com/denny.thame/\r\nhttp://dennythame.com.br','danythamepv@gmail.com','10155245348197468'),(256,'José Police Neto','BRANCA','MASCULINO','MASCULINO','1972-09-29','José Police Neto (PSD), 43 anos, está em seu 3º mandato como vereador da cidade de São Paulo. Tem biografia e histórico de compromisso com os Direitos Humanos na cidade. Entre 2006 e 2007 foi Secretário Municipal de Participação e Parceria para administrar as políticas públicas e coordenadorias da Diversidade Sexual, de Políticas para Mulher, Assuntos da População Negra, da Juventude, do Idoso, da Inclusão Digital e do FUMCAD - Fundo Municipal da Criança e do Adolescente.\r\n\r\nDefendeu e articulou o acordo de assinatura de um Termo de Ajustamento de Conduta, entre MP, sociedade e Prefeitura que manteve a Parada do Orgulho Gay na Av. Paulista. Inaugurou 5 Centros de Referência da Mulher para acolhimento e orientação de mulheres, em regiões com altos índices de violência contra mulher (Perus, Santo Amaro, Itaquera, Grajaú e Parelheiros). \r\n\r\nIncentivou e aumentou de R$2 milhões para R$ 80 milhões os investimentos no Fundo da Criança e Adolescente, com centenas de contratos assinados para abertura e manutenção de creches conveniadas com associações sem fins lucrativos. Maioria dos recursos com doações e isenção fiscal de grandes empresas previsto na legislação do ECA - Estatuto da Criança e do Adolescente.\r\n\r\nEm 2011, aos 38 anos, foi o mais jovem presidente da história da Câmara Municipal. Adotou transparência total dos dados públicos: dados, contratos e salários foram abertos e publicados no site da Casa para consulta pública. Foi também em sua gestão que todas as reuniões da Câmara passaram a ser transmitidas online.\r\n\r\nDefensor e autor do PL em favor da regulamentação dos aplicativos de transporte como UBER e outros apps, tem como proposta para 2017, regulamentar o setor de aluguel de apartamentos e quartos de hotéis como AirBnB. \r\n\r\nFoi eleito o melhor parlamentar pela ONG Voto Consciente por duas vezes consecutivas, no primeiro e segundo mandatos. Em 2014, ocupou o segundo lugar no ranking da entidade. Também é autor da emenda que criou os Conselhos Participativos e da eleição para escolher os Subprefeit@s nas Subprefeituras e criou a Política Municipal de Inclusão Digital na Capital.\r\n\r\nNão utiliza o carro oficial da Câmara. Ciclista, usa bicicleta, transporte público, carona ou serviço de transporte individual de passageiros para se locomover entre seus compromissos de trabalho. É autor do projeto aprovado PROGRAMA BIKE SP de incentivo ao uso da bicicleta e autor da lei que criou o nome Parque Minhocão!\r\n\r\nÉ autor de quatros leis na área de habitação. Uma delas é a Lei nº 15.234/2010, da Função Social da Propriedade Urbana, Que busca combater a especulação imobiliária de imóveis ociosos ou subutilizados que estão em zoneamento voltado para habitação social.  É autor da Lei de Regularização Fundiária, de 24 de abril de 2013, que possibilita a utilização de financiamento do programa Minha Casa, Minha Vida, para a urbanização de loteamentos irregulares na cidade de São Paulo, assim como facilita a legalização desses loteamentos e a entrega do título de propriedade aos moradores destes loteamentos. É autor ainda da Lei do Consórcio Imobiliário e do Retrofit Social.\r\n\r\nAtento a qualidade dos serviços públicos formulou a Lei 14.173/2006 que estabelece os Indicadores de Desempenho dos Serviços Públicos paulistanos e criou o “Procon” do serviço público, que equipara o usuário ao consumidor e lhe confere os mesmos direitos, e da Lei dos Indicadores de Desempenho deste Serviço Público.\r\n\r\nSaiba mais: policeneto.com.br','policeneto@policeneto.com.br','1080086762060191'),(259,'Marcão Da Mancha','BRANCA','MASCULINO','MASCULINO','1965-04-08','Advogado há 30 anos anos, militando sempre na defesa dos direitos e por mais humanismo nas relações das Leis , entidades e pessoas. Marcão  Contra  Opressão nasceu da necessidade que o Cidadão tem de ser representado por alguém que pense primeiro nas pessoas e trate a questão monetária como solução do poder público para com o Cidadão e não tornar o aparelhamento das Cidades prioridade antes do ser humano , pois não somos empresas e temos sentimentos a serem resgatados . Nosso orgulho não tem preço é podemos mais com esperança em nossos corações.  Cobrança eficaz por parte do mandatário em prol do Povo e seus direitos fazem parte do munus de quem postula trabalhar para pessoas . A Lei é boa , mas o cumprimento dela não ...','drmarcaodamancha@gmail.com','1287960354547500'),(260,'Adriano Couto','PARDA','MASCULINO','MASCULINO','1977-08-19','Meu nome é Adriano Couto, casado, pai de um casal de filhos, Bacharel em Direito, com duas especializações na área, servidor público há mais de 14 anos, morador da Zona Oeste da cidade há mais de 35 anos. Estou vindo candidato a Vereador pelo Município do Rio de Janeiro, sendo esta minha primeira eleição.\r\n\r\nTenho como propostas iniciais de campanha:\r\n1) A educação especial na perspectiva da educação inclusiva;\r\n2) A municipalização da segurança pública;\r\n3) Redução e/ou isenção de IPTU;\r\n4) Redução e/ou isenção de ISS;\r\n5) Regulamentação do serviço UBER ou similares;\r\n6) A integração social dos esportes nas escolas públicas municipais, com ênfase nas modalidades Judô, Karatê, Jiu Jitsu e Capoeira.\r\n7) A transparência nas informações prestadas pelos hospitais e clínicas de saúde municipal, com vistas a grade de horários e nomes dos profissionais nos serviços diários;\r\n8) Provimento no mesmo local de consulta, o atendimento para os exames.\r\n9) A desburocratização de serviços de alvarás e licenças por meio eletrônico.','adrianocouto.rj@gmail.com','1782867595288998'),(265,'Naomy Schölling','BRANCA','FEMININO','FEMININO','1965-08-14','“Como sociedade, tratemos com a dignidade que merecem os que não conseguem proteger a si próprios: crianças, idosos e animais.  \r\nA Cultura é um poderoso instrumento de educação e conscientização.\r\nTransparência e boa gestão é a solução.”\r\n\r\nQuem é\r\nFormada em Tradução-Interpretação e Letras, após morar 4 anos em Londres e trabalhar 7 anos no mercado financeiro em SP, resolveu transformar hobby em profissão e foi estudar teatro na Escola de Arte Dramática – USP.  Artista multi-facetada, protagonizou óperas no Teatro São Pedro e Municipal de SP, fez parte do Teatro Oficina e agora atua em Teatro Musical.  \r\n\r\nSolteira, não teve filhos, mas agora tem um de 89 anos que tem diversas necessidades específicas – o pai.  Assim sendo, pode falar sobre Terceira Idade com domínio de causa.\r\n\r\nAma os animais e, por isso, não come carne.  Sugere a ideia do projeto “Segunda Sem Carne” aos interlocutores que não abrem mão de carne em sua dieta.  \r\n\r\nSepara lixo reciclável em casa e acredita que essa atitude deveria ser incentivada de forma eficaz, o que diminuiria nosso problema com lixo.  Ama a Natureza e o mar.\r\n\r\nPor que é candidata\r\nAcredita que, se pessoas bem intencionadas unirem esforços e se engajarem na política, podemos mudar o modo desavergonhado e desrespeitoso como ela é feita no Brasil. \r\n\r\nAlém de acompanhar atentamente as finanças da cidade, priorizará transparência total e corte de gastos. \r\n\r\nVê como desafios a serem conquistados: Segurança a nível municipal e socorro à Saúde. \r\n\r\nProporá e apoiará iniciativas de melhoria das condições precárias em que se encontra nossa abandonada e querida cidade de São Paulo.\r\n\r\nSaiba mais em    www.naomy.com.br    www.facebook.com/naomy.br\r\n\r\n','NAOMYSCHOLLING@GMAIL.COM','10210359933816756'),(266,'Sérgio Urt Moraes','BRANCA','MASCULINO','MASCULINO','1972-10-01','\r\n\r\nNosso projeto “SIM! ESTAMOS JUNTOS!”, trás de volta o papel da sociedade como coadjuvante principal na construção e no modo de fazer política para a cidade do Recife. Construído de forma conjunta nas diversas visitas e contatos diretos com moradores e demandantes da presença mais eficaz e real do poder público. Verifica-se que as necessidades almejadas nas diversas localidades, identificam-se, em sua totalidade, com nossa pauta que pretendemos defender e lutar na Câmara Municipal. Esses nossos compromissos foram propostos a partir de exemplos positivos em outras cidades, de ideias coletadas com base em pareceres técnicos de conhecedores dos assuntos, da sensibilidade e respeito de escutar a população para procurar ofertar objetivamente o que é prioritário e eficiente para cada situação daquelas localidades e para toda cidade como um todo. Agrega-se, de forma muito particular, o conhecimento político conseguido na minha vida acadêmica, de ativismo e agente ativo na busca de causas sociais. O transparente material revela toda plataforma que almeja a candidatura de Sérgio Urt Moraes para vereador do Recife. Com uma visão de esquerda, comprometido com o combate a todo tipo de política que não olhe para o coletivo, para as pessoas.  \r\n\r\n','sergio_urt@hotmail.com','10154550147123011'),(268,'Fernando DaSilva','BRANCA','MASCULINO','MASCULINO','1985-03-03','Sou maconheiro-jardineiro, advogado, redutor de danos e ativista pela LEGALIZAÇÃO DA MACONHA.\r\n\r\nDesde 2009 atuo na Marcha da Maconha SP, em 2012 semeei a Associação Cultural Cannábica de SP, em 2015 brotou o Escritório de Defesa do Usuário de Cannabis (EDUCannabis) e colhemos o CONNABIS - Congresso on-line sobre Maconha... entre otras cositas más :-D\r\n\r\nBora esfumaçar a política!','profeciaverde@gmail.com','297778730600533'),(269,'Eduardo Sol','PARDA','MASCULINO','MASCULINO','1982-08-16','Eduardo Sol tem 34 anos, é geógrafo, professor universitário e, nos últimos dois anos, ganhou destaque como uma das principais jovens lideranças políticas do Rio de Janeiro: à frente do Movimento Vem Pra Rua, ele exerceu protagonismo na organização das manifestações anti-corrupção e pró-impeachment da cidade. \r\n\r\nSol é ligado às causas sociais e milita no combate a todos os tipos de desigualdades e discriminação social, racial ou de gênero. É o fundador do Tucanafro  - segmento negro do PSDB - no Estado do Rio, atua em favor da causa dos deficientes físicos; dos jovens - com foco em emprego e renda; do empreendedorismo; por uma educação de qualidade, especialmente a da primeira infância, a melhor maneira de lutar contra a desigualdade social.  \r\n\r\nSol tem o apoio do deputado Otavio Leite e de artistas e personalidades engajados na luta contra a corrupção e pelo combate às desigualdades, como o humorista Marcelo Madureira, e o líder do AfroReggae, José Júnior. \r\n\r\nAlgumas Bandeiras \r\n\r\n- Pela defesa dos direitos das pessoas com deficiência; \r\n- Por uma educação de qualidade, especialmente a da primeira infância, a melhor maneira de lutar contra a desigualdade social; \r\n- Combate à todas as formas de discriminação, social, racial ou de gênero.\r\n- Pelos jovens, os que mais sofrem com o desemprego que atingiu o país: qualificação, capacitação, emprego e renda, com foco no empreendedorismo.','eduardosol2@gmail.com','1120501068041906'),(271,'Athayde Lucena','PRETA','MASCULINO','MASCULINO','1974-07-13','Athayde Gomes de Lucena com apelido de Thaydinho devido ter o nome do meu pai tomo a liberdade em sirigir-me a você cidadão carioca como eu, onde dedico-me a buscar soluções para nossos problemas. Ficha limpa, fui dirigente sindical na área de telecomunicações e sai que a política deve ser voltada para o eleitor e não pro próprio umbigo e por ser    atuante em prol da categoria me mandaram embora com estabilidade se diretor e mandaram correr atrás de meu prejuízo na justiça o que ainda tramita no Trt. Sei o que o povo sofre com os que hoje nos representam na Câmara de vereadores, onde a maioria não cumpre com suas obrigações. Sei que o eleitor não acredita mais em ninguém,  e quem quer fazer a diferença sofre pela quantidade erros cometidos: tanta corrupção, inflação maquiada, aumento de impostos sem retorno pro cidadão, aumento dos remédios, saúde falida pelo simples fato de não dar votos, aumento da violência, educação que o futuro do nosso país como massa de manobra, sustentabilidade não aplicada, transporte sem qualidade e inúmeras reclamações do cidadão. Por isso peço crédito de confiança pra fazermos diferente e enfrentar na linha de frente o sistema e não deixar o eleitor na mão. Renovar e preciso, o cidadão não pode esperar de quem não vive a realidade da nossa região e dessa povo que é batalhador e deve ter o mínimo de dignidade e qualidade de vida. ','Athaydegomes@gmail.com','1171149772928617'),(272,'Fernanda Melchionna','BRANCA','FEMININO','FEMININO','1984-02-02','Fernanda  nasceu em Alegrete em 1984 e participa da política desde muito cedo. É formada em Biblioteconomia na UFRGS e é bancária licenciada do Banrisul.  Foi eleita pela primeira vez vereadora de Porto Alegre em 2008 ao lado de Pedro Ruas, atualmente candidato a vice-prefeito pelo PSOL. Foi a mulher mais votada na disputa à Câmara de Vereadores nas eleições de 2012, pois sempre construiu um mandato a serviço da juventude e dos trabalhadores. \r\n\r\nAo lado de Luciana Genro, nossa candidata à Prefeitura, Fernanda quer seguir construindo um mandato necessário na Câmara Municipal para as lutas do povo. Fez parte da primeira bancada do PSOL na Câmara de Vereadores, ao lado de Pedro Ruas. Um dos grandes marcos de seu mandato foi ter entrado na justiça e, junto à força das mobilizações da juventude nas ruas, reduziu o preço da tarifa de ônibus por duas vezes na capital.  \r\n\r\nComo sempre fez Luciana Genro, o mandato de Fernanda também combate o privilégio dos ricos e dos políticos, votando anualmente contra o aumento do salário dos vereadores. E nesse ano, quando não conseguiu barrar, está doando o dinheiro do reajuste dos vereadores a instituições de caridade e com fim social. [As doações do mês de julho, agosto e setembro (totalizando R$2.400,00) serão doados em outubro, independente do resultado eleitoral] \r\n\r\nAo longo dos anos de 2013 e 2015, Fernanda presidiu a Comissão de Defesa do Consumidor, Direitos Humanos e Segurança Urbana (CEDECONDH) na Câmara Municipal, sendo linha de frente das lutas contra quaisquer tipo de opressões. O mandato feminista de Fernanda sempre lutou pela igualdade de gênero na cidade. À frente da CEDECONDH, em 2013, Fernanda lançou a cartilha “Enfrentando a Violência Contra a Mulher”. Em 2015, após a negligência no atendimento a uma vítima de estupro, realizou um diagnóstico da Rede de proteção às mulheres vítimas de violência em Porto Alegre, mapeando os espaços de atendimento às mulheres.\r\n\r\nFernanda sempre lutou pela valorização dos servidores municipais seja da saúde, da educação e de outras áreas prioritárias para o município. Em 2015, conquistou o projeto de lei, ao lado dos trabalhadores, que corrigiu o efeito cascata que reduziria indevidamente o seus salários.\r\n\r\nO mandato de Fernanda sempre defendeu a cultura de rua como um princípio. Lutou, em 2011, contra o decreto que queria acabar com a Cidade Baixa como espaço de lazer, gastronomia e música. Em 2013, junto com os artistas, elaborou e aprovou a Lei do Artista de Rua e em 2016 está lutando contra a minuta que prevê a cobrança do uso dos espaços públicos na capital. Tmabém sempre esteve conectado com as demandas da juventude, lutando contra o genocídio da população negra, o projeto escola com mordaça, o cercamento dos parques e a derrubada das árvores; na defesa do Cais Mauá, na luta por mais ciclovias e pela manutenção das políticas de gênero e sexualidade do Plano Municipal de Educação, entre outras.\r\n\r\nFernanda sempre lutou em defesa do livro e da leitura. Em 2009, criou a Frente Parlamentar de Incentivo à Leitura, e na luta ao lado de escritores, bibliotecários, professores, técnicos em biblioteconomia, bibliotecas públicas e comunitárias, associações de moradores conquistou, através do seu mandato, o Plano Municipal do Livro e da Leitura. Em 2016, conseguiu gravar no orçamento do município 200 mil reais a serem destinado para ações de descentralização e ampliação de acesso à leitura!','imprensa.vereadorafernanda@gmail.com','1115793665124150'),(275,'Rosi Dias','BRANCA','FEMININO','FEMININO','1962-12-25',' Produtora de eventos Rosi Dias se destaca pela criatividade e empreendedorismo. Ao longo de meus de 25 anos de carreira no artesanato, participei de revistas especializadas das Editoras Escala, Casa Dois e Abril , além de programas femininos como Mulheres (TV Gazeta), Note e Anote (Rede Record) e Mulheres em foco (Rede Mulher).\r\nTenho me dedicado à produção de eventos, reunindo os melhores profissionais como ocorreu nas duas edições do Aniversário com Arte, realizados nos anos 2006 e 2007 no Mercado Municipal de São Paulo.\r\n\r\nParticipei da  LUTA PELA AUTONOMIA POLÍTICA DA CIDADE DE SANTOS: DA CARAVANA  LEONARDO ROITMAN em  2 de agosto de 1983\r\nO mais importante acontecimento político de Santos a autonomia política, que restituiu aos santistas o direito de eleger prefeitos. Após 14 anos de regime de exceção, a mudança ocorreu por intermédio da assinatura do Decreto-Lei 2.050 pelo presidente da República em exercício, Aureliano Chaves.','rosidias@msn.com','10202261942267890'),(277,'Denise Pessôa','PRETA','FEMININO','FEMININO','1983-06-17','Filha de Oscar e Benta Pessôa. Arquiteta e Urbanista com MBA e Especialização em Políticas Públicas. Servidora Pública na Prefeitura de Caxias do Sul.\r\n- Trajetória política\r\nJá foi presidenta do DA de Arquitetura; dirigente do DCE/UCS; assessora de encontros da Pastoral da Juventude; assessora da Deputada Estadual Marisa Formolo.\r\nComo Vereadora:\r\n- Preside a Frente pelo Fim da Violência Contra as Mulheres;\r\n- Foi a única vereadora mulher eleita em 2012;\r\n- Presidiu as Comissões de Direitos Humanos, Cidadania e Segurança;\r\n- É Conselheira Municipal de Juventude e Conselheira Estadual das Cidades.\r\n\r\nDenise trabalhou e vai continuar trabalhando por:\r\n- Mais vagas na educação infantil. Compromisso com a efetivação do Plano Municipal de Educação. Em defesa da UERGS e do IFRS. Implantação do Campus da UFRGS em Caxias do Sul.\r\n- Fortalecimento da segurança pública, vinculado à ações sociais e à cultura da paz.\r\n- Ações que promovam a igualdade racial, a diversidade cultural e combate à xenofobia.\r\n- Visibilidade, prevenção e combate à violência contra a população LGBT.\r\n- Combate a todas as formas de violência contra as mulheres.\r\n- Fortalecimento do SUS.\r\n- Efetivação de políticas públicas para a regularização fundiária.\r\n- Preservação do meio ambiente.\r\n- Luta pelo fim do monopólio do serviço de transporte coletivo.\r\n- Inserção da bicicleta na mobilidade urbana e melhorias no transporte público.\r\n- Preservação do patrimônio cultural.\r\n- Apoio e desenvolvimento da economia criativa.\r\n- Respeito aos direitos trabalhistas, defesa do trabalho digno. \r\n- Garantia da acessibilidade dos PCDs aos serviços públicos e à cidade.\r\n- Apoio à agricultura orgânica e conscientização para a alimentação saudável.\r\n- Ampliação do Gabinete Itinerante.\r\n- Defesa da democracia.','dspessoa@gmail.com','10154372845832367'),(278,'Claudia Grimberg','BRANCA','FEMININO','FEMININO','1967-04-02','Assistente Social com\r\nprojetos na área de Mobilidade Urbana para Portadores de Necessidades Especiais e Idosos.\r\nAtendimento específico no combate ao preconceito do Autismo e Síndrome de Down.\r\nPolítica Pública para as Mulheres na área de Saúde,Discriminação e Assédio Moral,Tratamento para \r\nDependentes Químicos com reintegração ao mercado de trabalho e Atendimento a Classe LGBT com Casas Acolhedoras com Cursos Profissionalizantes para o Desenvolvimento da Profissão com Cursos Tecnicos e Suporte de Renda .','claudiagrimberg@uol.com.br','10205489481115213'),(282,'Carla Cristina Carvalho','BRANCA','FEMININO','FEMININO','1980-08-13',' Eu sou Carla Carvalho. Sou paulistana do Jardim Miriam, bairro onde nasci e cresci e berço das minhas famílias migrantes nordestina e mineira. Sou professora de Educação Infantil e Ensino Fundamental I da rede pública há 17 anos, sendo 13 anos na rede da cidade de São Paulo. Militante pela educação pública desde o “ Curso Normal” no fim dos anos 90. \r\n\r\nEstudei na PUC, onde militei no Movimento Estudantil. A educação pública, gratuita, laica, popular e cidadã e sua integração plena com a cultura e a arte foi a causa pela qual militei toda a vida.  No ímpeto de aproximar a política à vida cotidiana das cidadãs e mais precisamente do dia a dia das escolas, estudei Gestão De Políticas Públicas na USP  e me envolvi com o estudo das políticas educacionais da cidade de São Paulo ao acompanhar o processo de construção do Plano Municipal de Educação em todas as suas etapas.  Na última delas, na Câmara Municipal , como feminista que sou desde criancinha, assisti desolada a investida vitoriosa do fundamentalismo cristão sobre a exclusão do debate de gênero e sexualidade nos Planos de Educação e daí o questionamento sobre o quanto nós, mulheres feministas precisamos recuperar os espaços que nos foram negados pelo patriarcado. \r\n\r\nEm busca de aprender e executar muitas das coisas que o machismo nos faz deixar pra trás, surgiu na militante o desejo de externalizar a musicalidade através dos discos que colecionava desde a infância, aprendendo assim a discotecar para levar à resistência feminista às festas e bailes ( como genuínas expressões políticas que são). Conheci a #partidA feminista na sua fundação e junto com essas mulheres, me convenci de que só ocupando os espaços de poder e nos fazendo representar poderemos ampliar a luta por uma sociedade mais igualitária, justa e livre. Socialista, feminista e libertária. \r\n\r\nÉ a hora das mulheres. É hora de conhecer o “Lado B” da história,onde mulheres, negras e negros, Lgbts, indígenas e todos os povos que foram marginalizados sejam os protagonistas de suas narrativas. É hora de virar o disco por uma cidade mais humana e compartilhada! \r\n\r\ncarlacarvalho.com.br  \r\nfacebook.com/carlacarvalho.partidA','profcarlacsc@gmail.com','10210760319864130'),(285,'','BRANCA','MASCULINO','MASCULINO','1941-06-21','Sou Economista, professor aposentado da Fundação Getúlio Vargas de São Paulo. Fui Secretário de Direitos Humanos e Cidadania de São Paulo na gestão Fernando Haddad (2015-2016). Fui Senador de 1991/2014, Vereador (1989-1990), Deputado Federal (1983-1986) e Estadual (1979/1981).\r\n','emsuplicy@uol.com.br','547045908830561'),(287,'Ailza Trajano','PARDA','FEMININO','FEMININO','1963-07-06','Sou poetisa, militante feminista emancipacionista, comunista, sou mãe e sonhadora. Busco um caminho melhor no meu mundo e no seu.  Eu amo meu lugar, minha cultura, sou uma parte dessas mulheres que, no caminho, lutam pelos direitos de todas e todos, que enxergam no ser   humano uma companheira, um companheiro na  caminhada para um mundo melhor. \r\nEu sonho, pois é com esse incentivo do sonhar que o meu caminhar vai tornando-se real, entre as pedras que no decorrer do trajeto  aparecem.Vou assim determinada a transformá-las em pavimentos para pisar, olhando o agora e o futuro.\r\nDefendo uma nova sociedade, a sociedade socialista. E neste momento político, quero continuar lutando pela igualdade nos direitos e na vida. E neste momento, igualdade na política, como também a garantia e ampliação dos nossos direitos.\r\nNa minha caminhada, durante todo o trajeto, venho aprendendo e aprimorando a forma de vida construída no coletivo. Precisamos estar conectadas/os com as mudanças gritantes em nosso mundo, e este começa a partir da nossa casa, da nossa cidade. É aprendendo de dentro pra fora que busco melhorar minha caminhada, meus projetos e sonhos.\r\nÉ com o pensamento de coletividade, de construção de  uma  sociedade  mais  justa  e digna que  venho com a  proposta  de  avançarmos, olhando para  nossa  cidade  com  atenção  e  trabalhando com o compromisso de quem  almeja estar como representante  de  todos e todas.\r\nVamos seguindo nessa construção coletiva, pois juntxs  somos  maioria!\r\n','ailza.andradetrajano@gmail.com','1243922235658447'),(288,'Luis Rabello','BRANCA','MASCULINO','MASCULINO','1988-05-11','Luis Rabello nasceu em Campinas, tem 28 anos e sempre morou em Valinhos. Formou-se em Geografia na Unicamp, universidade onde é funcionário concursado desde 2010. Há 10 anos filiou-se no PT e atuou na fundação da EVA - entidade em defesa do meio ambiente de Valinhos. Ao entrar na Unicamp, Luis participou do movimento estudantil e em coletivos LGBT, o que o impulsionou a defender os interesses de uma das parcelas mais oprimidas da sociedade. Luis Rabello passou a participar ativamente do Movimento de Direitos Humanos, atuando junto a diversas lideranças nacionais. É secretário de juventude do PT de Valinhos, setorial que desenvolve políticas públicas importantes para a juventude brasileira.','luisfcrabello@gmail.com','1147192358698492'),(289,'Riselda Tenorio Pereira Tenorio','BRANCA','FEMININO','FEMININO','1963-06-02','Vamos fazer uma Eleição Limpa e com clareza, Não concorde em vendas de Votos, Assim você tira o direito de cada Vereador, cumprir com os seus deveres dentro da sua comunidade.vamos valorizar mais os eleitores, mudar e inovar a câmera dos vereadores. Vote em   Pereirão 55163 Riselda Pereira.','riselda.t@hotmail.com','899042133559373'),(290,'Hendel Machado','BRANCA','MASCULINO','MASCULINO','1985-02-04','Nasci em Porto Alegre, onde cresci e me formei em direito na UFRGS (2007). Em 2009, iniciei meu escritório, no qual atuo até hoje. Sou também Mestre em Direito Empresarial pela Universidade de Coimbra, onde aprendi muito sobre a liberdade.\r\nMembro do Conselho Comunitário de Segurança do Petrópolis e do IBGC.','hendelmac@gmail.com','1084181091628996'),(292,'Taciana Valença','BRANCA','FEMININO','FEMININO','1964-11-21','Administradora, formada na Universidade Federal de Pernambuco, produtora cultural e editora de uma revista.\r\n\r\nGrande divulgadora da Cultura do Estado de Pernambuco assim como do turismo local, artistas e escritores.\r\n\r\nAcredita num trabalho feito junto às pessoas, de acordo com as necessidades de cada bairro e da escuta dos moradores. \r\n\r\nDentre outras prioridades está levar as artes para dentro das escolas como ferramenta de aprendizado e descoberta de talentos.\r\n','tacianalvalenca@gmail.com','1116386251744219'),(297,'Vinicius Recio','BRANCA','MASCULINO','MASCULINO','1995-04-13','Sou um dos mais jovens candidatos a vereador da cidade de São Paulo. Entrei na política para tenta corrigir injustiças , lutar contra a corrupção e dar qualidade de vida as pessoas.','viniciusrecio@hotmail.com','1136456059753868'),(301,'João Junior','PRETA','MASCULINO','MASCULINO','1985-03-08','Um dos coordenadores da bem sucedida Campanha Nacional pelo Casamento Civil Igualitário no Brasil campanha essa que conseguiu a  Regulamentou o casamento civil entre pessoas do mesmo sexo no país (casamento gay). \r\n\r\nMestre em Antropologia e Sociologia pela UFRJ, fui o idealizador e articulador da ação que provocou o Conselho Nacional de Justiça, e que semanas depois emitiu a resolução 175, regulamentando o casamento civil entre pessoas do mesmo sexo por todo o país.\r\n\r\nCriei a campanha #NossaFamíliaExiste, campanha nacional de visibilidade das famílias homoafetivas e que teve como resultado frear o avanço do nefasto e homofóbico projeto \"Estatuto da Família\".\r\n\r\nUm dos articuladores da ação que está no STF e que busca a equiparação da homofobia ao racismo pelo ordenamento jurídico brasileiro. \r\n\r\nEstou na linha de frente da ação que está hoje no STF que tem como objetivo derrubar as restrições ainda existentes e finalmente permitir que homens homossexuais possam doar sangue. Essa restrição já não faz nenhum sentido nos dias de hoje. \r\n\r\nComo jovem negro, nascido em Realengo, zona oeste e pobre da cidade do Rio de Janeiro, acredito que o empreendedorismo pode ser uma importante arma de empoderamento da juventude negra, LGBT e das mulheres sendo um grande instrumento de empoderamento e emancipação econômica. \r\n\r\nMesmo aqueles que não se interessam por política tem sua vida fortemente influenciada por quem se interessa. Por isso é preciso que possamos dar um passo para além da simplória gestão do discurso progressista. É preciso propor e implementar as soluções concretas e efetivas que trarão a melhoria da qualidade de vida para as pessoas que defendemos e procuramos representar. \r\n','jbatista0803@gmail.com','1205908809430095'),(304,'Beto Goes','PARDA','MASCULINO','MASCULINO','1971-03-19','Tomo a liberdade de divulgar meu nome como candidato a vereador em BH. Sou casado e pai de 3 filhos. Realizei um trabalho voluntário como diretor do Clube Jaraguá, durante 6 anos, com uma aprovação que muito me honra por parte da diretoria, dos associados e funcionários do clube. Hoje sou Administrador no  Escritório RTS Advogados.\r\n Assim, apresento abaixo minhas propostas para Belo Horizonte:\r\n•	Fiscalização nas contas públicas, nos contratos de obras e serviços;\r\n•	Fiscalização no atendimento aos cidadãos nas UPAs e Postos de Saúde;\r\n•	Fiscalização da merenda escolar e das instalações nas escolas municipais;\r\n•	Desenvolvimento de projetos de cultura e recreação nas praças e parques públicos para toda a família;\r\n•	Conscientização da importância da longevidade com qualidade;\r\n•	Fiscalização para que a Lei Nacional da Transparência seja efetivamente cumprida em Belo Horizonte;\r\n•	Projeto Adote um Vereador, que visa incentivar o cidadão a fiscalizar as atividades de um vereador, avaliando e criticando suas ações; \r\n•	Trabalho de valorização da juventude, incentivando a participação dos jovens na política para surgimento de novas lideranças para a vida pública;\r\n•	Trabalhar pela segurança pública com iniciativas para disseminação e desenvolvimento da cultura da paz e da não violência, bem como fiscalização de serviços como iluminação pública, poda de árvores, lotes vagos, olho vivo e outros;\r\n•	Iniciativas de projetos de proteção e respeito aos animais;\r\n•	Apoio a aplicativos e serviços inteligentes que melhorem a mobilidade urbana e levem a uma Belo Horizonte do futuro;\r\n•	Fiscalização da sinalização adequada ao trânsito e do adequado funcionamento dos radares de trânsito;\r\n•	Administração do gabinete do vereador de modo compartilhado com os assessores, atendendo a todas as regiões de BH;\r\n•	Políticas públicas municipais de valorização do trabalhador;\r\n•	Acompanhamento do comércio, lojas, bares e restaurantes afim de protegê-los contra abusos da fiscalização da prefeitura;\r\n•	Trabalhar para implantar o semáforo inteligente nos cruzamentos de BH;\r\n•	Fiscalização das ações da prefeitura no combate à dengue e outras doenças;\r\n•	Exigir da prefeitura as obras necessárias para evitar enchentes e os problemas decorrentes das mesmas;\r\n•	Maior transparência e democratização na aprovação de projetos pela Lei Municipal de Cultura, afim de atender um maior número de artistas e projetos;\r\n•	Apoio e incentivo para realização de feiras de artesanato como forma de geração de renda;\r\n•	Apoiar a inclusão de conteúdo que informe sobre todo o funcionamento do governo municipal e dos conselhos municipais na escolas públicas.\r\n\r\n\r\n','betocgoes@yahoo.com.br','1163766503686980'),(306,'Erton Serafim Araujo','BRANCA','MASCULINO','MASCULINO','1978-02-01','Estamos junto contra o preconceito!! ','ertonfrancisco1978@hotmail.com','1064782693635035'),(307,'Poliana Santos','PRETA','FEMININO','FEMININO','1983-04-07','Formada em história pela Universidade Estadual de Londrina, atuo como Agente Educacional na escola pública e milito pelos movimentos populares de mulheres, movimento étnico racial e LGBT.\r\nSempre em defesa da dignidade humana e de uma sociedade mais justa para todas e todos, desenvolvi minha vida política sempre lutando contra os preconceitos e discriminação de uma sociedade elitista e patriarcal.\r\n','poliparanoia@gmail.com','1074645165946561'),(308,'Guilherme Cohen','PARDA','MASCULINO','MASCULINO','1990-02-15','Guilherme Cohen tem 26 anos, é estudante de Psicologia na Universidade Veiga de Almeida e militante dos Direitos Humanos e das causas da juventude. Integrou desde cedo o Habonim Dror, movimento juvenil progressita da comunidade judaica e participa anualmente da Caminhada em Defesa da Liberdade Religiosa. Mora atualmente na Tijuca, bairro na zona norte do Rio de Janeiro.\r\n\r\nEm janeiro de 2016, teve a oportunidade de levar Jean Wyllys para Israel e Palestina, com o objetivo de ampliar o debate sobre a LGBTFOBIA, o racismo e a intolerância religiosa. \r\n\r\nGuilherme acredita que a luta política é uma luta pedagógica e se sente preparado para representar a juventude na política e construir coletivamente o projeto de uma cidade mais democrática, participativa e livre de toda forma de intolerância.\r\n\r\nA prioridade deve ser a educação. Precisamos garantir uma educação pública, democrática, de qualidade e livre de qualquer censura ou retrocesso. \r\n\r\nQuer ser uma voz da juventude em uma Câmara dos Vereadores em que a média de idade é de 55 anos, onde poderá lutar por mobilidade urbana eficiente  e liberdade religiosa. O Rio é a capital do Estado com mais casos de Intolerância Religiosa registrados no país. É preciso construir uma cidade laica, preservando a liberdade de crença e também de não crença. \r\n \r\nAlém disso, a mobilidade urbana deve ser entendida como um direito à cidade. Estas são as propostas que construímos junto com jovens de diversos bairros, crenças e com muita vontade de mudança.','guicohen10@gmail.com','1440285375987510'),(309,'Mariana Jardim Reis','PARDA','MASCULINO','MASCULINO','1974-05-25','Renato Cinco é sociólogo e participou dos principais movimentos populares dos últimos 25 anos. Estudou no Colégio Pedro II e na UFRJ, se destacando na luta pela educação pública. Militante ecossocialista e libertário de longa data, Cinco defende a legalização da maconha e o fim da “guerra aos pobres”. Sempre se posicionou contra as privatizações, em defesa da democracia, dos direitos humanos e trabalhistas e contra todas as opressões. Agora, frente à crise econômica e a um governo golpista e neoliberal, não se cansa de repetir: FORA TEMER! Eleições gerais Já!    \r\nRenato Cinco foi eleito vereador em 2012. Combater a desigualdade e defender os pobres e oprimidos foi sua prioridade. Por isso, aprovou leis em defesa dos camelôs da Lapa e da Feira Cícero Guedes de pequenos produtores rurais. Aprovou também a lei de combate ao machismo nas escolas, buscando através da educação mudar uma realidade tão revoltante.      \r\n\r\nCinco combateu a guerra aos pobres fantasiada de guerra às drogas. Denunciou a violência estatal em bairros populares e a arbitrariedade das internações compulsórias. Ao mesmo tempo, propôs uma política municipal de redução de danos.      \r\n\r\nMembro da Comissão de Direitos Humanos, defendeu o direito de manifestação e apoiou as lutas contra as remoções forçadas. Presidiu a Comissão sobre o Colapso Hídrico e apresentou projeto que obriga a divulgação da qualidade da água no município. Defendeu que o acesso à água é um direito humano fundamental e que seu abastecimento não pode ser privatizado.\r\n  \r\nCinco apresentou, entre outros, projetos ampliando a licença paternidade para 30 dias, criando o passe livre para desempregados e estudantes de pré-vestibulares comunitários e o aviso prévio para mudanças nas linhas de ônibus. Votou sempre a favor dos trabalhadores e apoiou suas lutas. Em uma Câmara de Vereadores dominada pelo conservadorismo, foi uma necessária voz de oposição!  ','renatocinco@renatocinco.com','1203623993030321'),(310,'Renato Moreli Guimarães','BRANCA','MASCULINO','MASCULINO','1966-03-13','Renato Guimarães é um lutador das causas sociais e militante comunitário. Foi vereador, conselheiro tutelar, atuando na defesa dos direitos das crianças e adolescentes e de políticas públicas.\r\n\r\nNos últimos anos afastou-se da disputa eleitoral, priorizando a luta pelos direitos dos trabalhadores, das comunidades e defesa do meio ambiente. Formou-se em Direito para exercer a advocacia e atuar na defesa dos movimentos sociais e dos mais necessitados de nossa cidade.\r\n\r\nDiante deste momento de abandono das comunidades e perdas dos direitos democráticos, trabalhistas e previdenciários, Renato Guimarães é convocado por amigos, familiares e companheiros a disputar uma vaga de vereador.\r\n\r\nQuem o conhece atesta que sua trajetória tem sido sempre a mesma: a busca constante da organização e das lutas por melhores condições de vida para o povo.','renatomgpsol@gmail.com','1142260995853659'),(316,'Daniel Antunes','PARDA','MASCULINO','MASCULINO','1984-12-19','A democracia brasileira está ameaçada e uma onda conservadora vem devastando os direitos e a representatividade das populações mais oprimidas, dentre elas a LGBT. Fragilizada pela violência e repressão em um país que ignora cada vez mais a nossa causa, a saída é lutar diariamente para não sermos levados por esta onda devastadora. \r\nNunca foi tão fundamental sermos visíveis e estarmos à frente de nossa luta. Respeitar e fazer ecoar a voz da diversidade do nosso país é cada vez mais necessário e é nisso que Daniel acredita: em uma democracia que nos enxerga e nos leva a sério. Se joga na luta com ele!\r\n\r\nVote 50550!','sejoganaluta@gmail.com','10153648425921710'),(318,'Arilton Cardoso','BRANCA','MASCULINO','MASCULINO','1967-03-20','Eu moro na Vila Santa Rosa, no Rubem Berta, Porto Alegre, há mais de 40 anos. Sou taxista há 20. Sou católico também, mesmo que as pessoas achem estranho, por ser filiado e candidato por um partido de esquerda, mas as minhas convicções são ainda maiores do que isso. A família é uma coisa muito importante na minha vida, sem os meus filhos e a minha esposa eu não seria o que sou hoje, eles são a minha base, tudo o que tenho.\r\nAcredito de verdade que eu posso ser um bom vereador, que as vozes serão representadas, o gabinete vai estar na rua, o que qualquer cidadão precisar eu vou estar disponível. Eu sou presidente da Associação dos Moradores da Grande Santa Rosa agora, sou suplente do conselho do livro, acho a cultura e a educação fundamentais para nossa construção. O homem não existe sem cultura.\r\n','ariltonsc50@hotmail.com','757595064381925'),(319,'Fabia Andrade','PARDA','FEMININO','FEMININO','1963-09-15','Pretendo mudar a cara da câmara municipal. Contruindo creches escolas. Junto a sds planejar uma cidade segura para as mulheres ','fabiaacsandrade@gmail.com','1179009818836935'),(320,'Mario Dago','BRANCA','MASCULINO','MASCULINO','1964-04-02','Mário Dagoberto Abreu Quadros - MARIO DAGO - é Bacharel em Serviço Social, formação realizada através do ProUni. Casado há 35 anos com Eliane Garin Quadros, pai da Heide Garin Quadros e filho do Manoel Inácio da Costa Quadros - Seu Maneca - e Carmen Abreu Quadros (in memorian).\r\n\r\nMorador do bairro Camaquã há 49 anos, trabalhou pela melhora do bairro e cercanias, através do Orçamento Participativo - OP. MARIO DAGO participa pela primeira vez de uma eleição para Vereador, na condição de candidato.\r\n\r\nNesse diálogo queremos estabelecer com você uma relação duradoura e profícua, pois entendemos que somos diferentes, mas conectados por causas e sonhos.\r\n\r\nTer você ao nosso lado é a 1º vitória, as demais virão da união de nossos esforços e a troca de idéias.','mario.quadros@hotmail.com','174896052918372'),(322,'Luciano Victorino','BRANCA','MASCULINO','MASCULINO','1994-06-10','Estudei comunicação, curso Direito na UFRGS, tenho 22 anos. Ajudo a construir na nossa cidade as políticas LGBTs como Coordenador-Geral do Diretório Central de Estudantes (DCE) da UFRGS em 2015 e como militante do PSOL desde 2012. Hoje integro a equipe de programa LGBT e Direitos Humanos de Luciana Genro. Aceitei, não por acaso, o desafio de levantar a bandeira LGBT nessas eleições ao lado de Luciana Genro e Jean Wyllys, que muito me encorajam.\r\n\r\nSair do armário não foi fácil para mim, como não deve ser para milhares de nós. Ainda mais no Brasil, um dos países que mais mata LGBTs no mundo. Infelizmente os políticos pouco se preocupam com nossas vidas e em Porto Alegre as poucas políticas implementadas não estão à altura dos desafios que os direitos humanos exigem.\r\n\r\nQueremos construir de forma coletiva uma Porto Alegre onde as políticas LGBTs sejam eixo do nosso mandato e do governo Luciana. Políticas transversais diretamente relacionadas à educação, à segurança e à saúde. Queremos uma educação voltada à diversidade e sem censura, um sistema de segurança pleno e acolhedor e uma atenção especial com a saúde de LGBTs. Uma grande responsabilidade que te convido a compartilhar comigo. Vamos colorir juntos Porto Alegre de direitos!\r\n','luciano.victorino@gmail.com','1102185213197686'),(324,'Fabio Assis','BRANCA','MASCULINO','MASCULINO','1971-12-09','Sou Servidor Público Federal e desenvolverei uma política séria e transperente, de verdade, com total atenção aos programas voltados para a sustentabilidade, com inclusão social e sem distinçao de gêneros.','fabioassis09@yahoo.com.br','10153941300301864'),(326,'Rodrigo Castilhos Furtado','BRANCA','MASCULINO','MASCULINO','1985-11-05','Sou um libertário e voluntarista, programador há 10 anos e, atualmente, um estudante de filosofia na UFRGS. Possuo um escritório compartilhado, um coworking, no bairro Menino Deus, onde possibilito que diversas pequenas startups e profissionais liberais prosperem. Há anos, faço voluntariamente eventos beneficentes no meu espaço e participo ativamente da comunidade.\r\nNasci e me criei em Porto Alegre. Já morei em quatro bairros distintos: Centro, Boa Vista, Auxiliadora e, atualmente, no Menino Deus. Diria que conheço bem a nossa cidade e seus problemas. Embora nunca tenha vivido nos subúrbios, conheço as pautas através de ONGs e por alguns encontros com voluntários, que organizo no meu escritório coletivo.\r\nTenho uma farta leitura política e econômica, tanto de esquerda quanto direita, e os principais autores que me marcaram e mudaram são Frederic Bastiat, Hayek, Milton Friedman, Ayn Rand, Nozick e Rothbard.\r\nCaso eleito estou prometendo abrir mão de meu salário e os cargos em comissão, economizando mais de um milhão de reais aos cofres públicos, pois não acredito na coerção e imposição do Estado e sim na tecnologia e nas opções e trocas voluntárias.','rodrigo@catali.se','1244992662212366'),(329,'Fidélis Alcântara','BRANCA','MASCULINO','MASCULINO','1973-11-29','Fidélis Alcântara foi candidato a Governador pelo Psol-MG em 2014. Nas diversas lutas em que está envolvido defende direitos que nos são negados. Mobilidade urbana gratuita, segurança pública, assim como saúde e educação, são direitos de todos. Desde 2010 acompanha a luta dos Barraqueiros do Mineirão pelo direito ao trabalho e o cotidiano da população em situação de rua em busca de amparo e dignidade. Defende o direito a cidade e o acesso aos equipamentos públicos para todos. ','fidelisoa@gmail.com','10154014469385914'),(330,'Jonh Januario','BRANCA','MASCULINO','MASCULINO','1961-04-25','Filósofo, professor de xadrez, paraquedista, Embaixador da Paz, fui abandonado pelos meus genitores fui entregue para ser criado na antiga FEBEM. Fui adotado  a Mãe adotiva morreu a madrasta me colocou na rua. Morei nas ruas da cidade de São Paulo. Na época do alistamento o exército me tirou das ruas.\r\n\r\nMorei em na cidade de Porto Alegre sou amigo pessoal da ex-presidente Dilma, minhas proposta é a defesa dos direitos humanos. O combate contra a violência Policial vou lutar pela educação e pelo respeito a cidadania. Lutar pelos moradores de rua para que tenham  uma vida melhor.\r\n\r\nMeu saite é JOSIAS JANUARIO PARA A DIVULGAÇÃO.','januarioconsultor@gmail.com','300956203609510'),(331,'Osvaldo Meneses Meneses','BRANCA','MASCULINO','MASCULINO','1967-08-14','1) Sou Osvaldo MENESES presto serviço na área de Segurança Pública e tenho nível superior em Tecnólogo em Gestão Ambiental;\r\n2) Minha querida Companheira chama-se Rita de Cassia Barbosa e tenho Quatro Filhos;\r\n3) Pretendo utilizar minha experiência na área de Segurança para modificar e melhorar a sensação de segurança com a Guarda Civil Metropolitana trabalhando em conjunto com a Polícia Militar;\r\n4) Na área de meio ambiente penso em realizar projeto de incentivo a coleta seletiva, preservação da fauna e flora com a catalogação de todas as árvores com probabilidade de risco de queda.  ','menesesoms@hotmail.com','756878971122064'),(333,'Glaucia Soares','BRANCA','FEMININO','FEMININO','1968-06-17','Tenho 48 anos, sou publicitária, bem casada, tenho 1 filha, paulistana, morei mais recentemente em 2 países, EUA e China, tenho mais de 20 anos de experiência profissional em grandes multinacionais nas áreas de administração, comercial e marketing. Considero-me pessoa e profissional de sucesso de muita fibra, determinação e coragem.\r\nAos 12 anos  ingressei no mercado de trabalho, amadureci e cresci sob o valor da honestidade, liberdade, esforço e meritocracia como pilares para definir o rumo da minha própria história. O cenário de falência do sistema político e seus principais personagens, o caos econômico, o medo, a insegurança, falta de ética, a inversão de de valores, nossas liberdades sendo muitas vezes de forma mascarada cerceadas, me inquietaram e me fizeram questionar: Como melhorar nossas vidas e das futuras gerações com o que aí está? Comecei participando do movimento de rua, Vem Pra Rua, e mais tarde conheci o Partido NOVO, me encontrei verdadeiramente alinhada com os valores e desafios, e de forma decisiva e consciente, convicta que nosso país precisa de novas lideranças que conduzam esses valores e o espírito de mudança resolvi me candidatar. Minha contrariedade com o que aí está, só confirma a minha decisão que precisamos barrar essa crescente e invasiva atuação do estado, que ataca nossas liberdades, afeta nossas vidas, nossos valores. Vivemos em plenitude se somos livres, respeitados, se entendermos que liberdade deve ser sempre guiada por responsabilidades e que somos agentes de transformação para uma vida digna e plena. As funções do estado devem se ater em proteger nossa integridade física, garantir segurança, proteção coletiva, de fronteiras, do produzimos material e não material, educação básica e saúde emergencial de qualidade, podemos pensar em outras questões após essas devidamente superadas, bem resolvidas. Não quero o estado definindo o rumo da minha história ou de qualquer outro individuo.\r\n','Glaucia.soares.novo@hotmail.com','10205516886001363'),(335,'João Valois','BRANCA','MASCULINO','MASCULINO','1969-03-05','Carioca, morador da Barra da Tijuca desde 1972, comerciante de automóveis. Protetor, ativista, amante de trabalhos sociais e amigo de todos os animais. Fundador da página CADEIA PARA QUEM MALTRATA OS ANIMAIS em 2010.\r\n\r\nhttps://www.facebook.com/Cadeia2010/','joaovalois@hotmail.com.br','1103352966407646'),(336,'Daniel Piasecki','BRANCA','MASCULINO','MASCULINO','1994-11-28','Estudante de Filosofia. Sempre incomodado com as questões sociais e como é entendida a política. Acredito numa maior participação na política pelas pessoas, para isso é preciso haver menos centralização. 21 anos. Nato de Guarapuava. Usuário do transporte público.','danielpiasecki@gmail.com','1193093337414270'),(338,'Elpídio Araújo','PARDA','MASCULINO','MASCULINO','1970-09-29','Trabalho com Politica desde meus 12 anos trabalhando junto com meu Avô Elpídio Birunda para campanha do Governador Cid Sampaio na década de 70 se não me engano, desde então depois disso trabalhei para campanha de um sobrinho dele a deputado estadual e foi eleito e outros amigos e amigas, perdi quase trinta anos de minha vida acreditando em Políticos quando um Padre me chamou a atenção para não mais votar em Ninguém e sim me candidatar, foi ai que em 2014 sai Candidato a Deputado pelo PHS e não recebei apoio algum do partido, só fazendo campanha pelas redes sociais e fui votado em 32 Municípios de Pernambuco com míseros 400 votos, e hoje pela segunda vez disputando as Eleições para Vereador do Recife praticamente sem apoio algum também, pois ser politico hoje no Brasil é ter sorte de ser escolhido pelo partido para ser um fantoche deles, apoio a causa animal, sou o único candidato da causa  que mantem um abrigo de animais a muitos anos, os demais são só faixada e dizem que estão a anos e nada fazem para ajudar na causa animal, já tirei mais de trezentos animais de rua sem apoio algum de qualquer instituição ou políticos de Pernambuco.','arcanjosgabriel2010@hotmail.com','1093657247391800'),(340,'Andreia Grezzana','BRANCA','FEMININO','FEMININO','1976-08-15','Sou Andreia Grezzana Candidata a Vereadora, Filha de Luiz Maria Grezzana Fundador da FGT (Fundação Gaúcha do Trabalho), atual FGTAS. Venho seguir a orientação de um grande homem, o qual me ensinou a ter princípios, coragem, dignidade, humildade e principalmente FÉ. No decorrer da minha história de vida descobri que minha Vocação é poder estar auxiliando com ações e atitudes para uma sociedade mais justa e Humana. Podemos juntos mudar o rumo das nossas gerações, precisamos estar cientes que precisamos mudar nossas atitudes e comportamentos, precisamos sim, fazer parte e atuar presente no dia a dia desde nossas ações dentro de nossas casas. Vamos construir um Mundo mais Sustentável em todas as áreas, onde fortalecendo a Base da Família, do Trabalho e da Educação, toda engrenagem passa a funcionar... Quem tem valores de família, não rouba... Quem tem valores do Trabalho, não passa fome... Quem tem valores da Educação, aprende e evolui... Precisamos fazer a nossa parte... Vamos juntos reconstruir as bases da FAMÍLIA.','agrezzana@hotmail.com','1078229298893025'),(343,'Bruno Siebra','PARDA','MASCULINO','MASCULINO','1983-03-27','Jornalista, professor, músico e escritor, Bruno Siebra é membro da Academia Varzealegrense de Letras. Sua militância política vem desde antes da militância partidária, quando foi um dos pioneiros de Várzea Alegre a utilizar a internet para fazer jornalismo de opinião com o site \"A Bagaceira\", no ar entre 2009 e 2013. \r\nFoi um dos organizadores dos protestos de rua que ocorreram na cidade em 2013, por melhores condições de saúde, saneamento básico e contra a corrupção. \r\nEm 2015 funda o PSOL na cidade, atuando na luta em prol dos direitos LGBT, contra a violência sofrida pelas mulheres na cidade e em defesa dos recursos hídricos.\r\nÉ candidato a vereador. ','bruno_siebra@hotmail.com','1090984290979270'),(345,'Genilson Monteiro da Silva','PRETA','MASCULINO','MASCULINO','1982-07-12','Sou Genilson Monteiro, 34 anos. Formado em eletrotécnica e comunicação Social e cursando Física na UFRPE. Pai de Jean, Clarice e Ian. Amo animais, tenho 3 cachorros e 8 gatos. Apaixonado por política, literatura e artes. Respeito acima de tudo a qualquer religião, orientação sexual e ideologias. Candidato a vereador em Recife pela primeira vez. ','monteiro_silva1982@hotmail.com','860548997412347'),(347,'Isabella Gonçalves','BRANCA','FEMININO','FEMININO','1988-11-20','Bella Gonçalves é uma mulher de luta, cientista política e pesquisadora, e atuante por uma Reforma Urbana popular, estrutural e feminista há quase 10 anos. Na disputa à Câmara de Vereadores de BH fundamenta sua pauta em três eixos prioritários: direito à cidade, feminismo e democracia com poder popular.\r\n\r\nNo atual cenário de retrocessos entende que é preciso abandonar a política de conciliação com os golpistas e lançar uma agenda de luta e esperança. Por isso, a candidatura coletiva de Bella Gonçalves luta por nenhum direito à menos e propõe uma agenda radical de Reforma Urbana de forma a garantir o direito à cidade.\r\n\r\nPor justiça social urbana propõe uma política de #DespejoZero zero e regularização das ocupações urbanas. Por um planejamento urbano popular propõe o controle da especulação imobiliária e combate aos mecanismos de financeirização e privatização dos bens comuns urbanos. \r\n\r\nSonha e luta por uma cidade bonita, diversa e inclusiva, livre da lgbtfobia e de todas as formas de preconceito, onde a mobilidade seja um direito, os parques e praças dominem a paisagem, com agroecologia no centro e na periferia, onde o trabalho feirante e informal seja respeitado e toda a população tenha acesso integral a UMEIs, escolas e equipamentos de saúde. Por uma cidade onde caibam TODAS e TODOS!','bellagm2@hotmail.com','10154283834831311'),(352,'Francisco Vinicius','BRANCA','MASCULINO','MASCULINO','1987-12-01','Olá, tenho 28 anos, há 17 vivo em uma moradia popular no centro da Cidade de São Paulo. Sou formado em Comércio Exterior, vegetariano, fui voluntário fora do país cuidando de jovens autistas e por conta disso tive a oportunidade de conhecer outros países, mais e menos desenvolvidos que o Brasil. Sou o primeiro da família a chegar na faculdade e viver fora do país.  \r\n===================================================================================================\r\nAlgumas de minhas propostas são:\r\n\r\nREDUZIR SALÁRIOS E BENEFÍCIOS DOS VEREADORES;\r\nCRIAR MILHARES EMPREGOS COM SUSTENTABILIDADE;\r\nCAMPEONATO MUNICIPAL ESCOLAR DE FUTEBOL;\r\nDEMOCRACIA DIRETA E PARTICIPATIVA.\r\n\r\n====================================================================================================\r\n\"São Paulo precisa ir pra frente, sem deixar ninguém pra trás!\"\r\n===================================================================================================\r\n\r\nSaiba mais:\r\nhttps://www.facebook.com/franciscovinicius18123/','francisco.vinicius@gmail.com','1475927182421114'),(356,'Madalena Buzzo','BRANCA','FEMININO','FEMININO','1961-07-20','Me entendo uma provocadora e provocada por essa Cidade que vai de Linda a Fria.\r\n\r\nCheguei em São Paulo, com 18 anos em 1980, cheia de sonhos e medo, tudo misturado.\r\n\r\nEm primeiro lugar fui procurar emprego, vim com a especialização de Datilógrafa e sim, fui contratada como datilógrafa, numa Instituição Financeira e daí já conseguia estudar para entrar numa Faculdade.\r\n\r\nNão é tão simples assim, ter que estudar e trabalhar ao mesmo tempo, mas nada também é impossível para uma garota de menos de 20 anos e cheia de sonhos e assim, me graduei em Administração de Empresas e passei a ter melhores oportunidades de trabalho.\r\n\r\nTempos depois me especializei em Mediação de Conflitos, pois acredito que somente nós, PESSOAS, temos o poder de reinventar nossas relações, nossas Cidades e o nosso Planeta.\r\n\r\nJunto com o nascimento de meu filho, em 2000, nasceu também o desejo de deixar uma cidade mais humana e justa para ele.\r\n\r\nPara alcançar esse objetivo, em 2010 decidi participar ativamente do meu entorno. Conhecer meus vizinhos, ajudar a cuidar da praça perto da minha casa… Envolver-me com as demandas locais. Foi então que conheci caminhos através da participação cidadã, que me deram condições mais objetivas para construir soluções conjuntamente com o Poder Público.\r\n\r\nHoje, entendendo que posso contribuir mais, eu me disponibilizo para ser o “através”: A conexão entre a participação cidadã e a representação junto ao Poder Público.','madalena@madalenabuzzo.com.br','1212975978773928'),(358,'Douglas Belchior','PRETA','MASCULINO','MASCULINO','1978-11-24','Douglas Belchior nasceu e cresceu no fundão das periferias da cidade, nos limites entre Itaim Paulista, divisa com Ferraz de Vasconcelos, Itaquaquecetuba e Poá. É formado em História na PUC-SP e faz mestrado em Ciências Sociais e Humanas na Universidade Federal do ABC.  Iniciou sua trajetória na Pastoral de Juventude e no Movimento Estudantil; participou da construção de redes de cursinhos populares e comunitários, Educafro (por 10 anos) e UNEafro-Brasil (nos últimos 7 anos), pelo direito do povo preto e periférico ter acesso à universidade; ajudou a construir a Frente Pró Cotas Raciais do Estado de São Paulo e é um dos fundadores do Comitê de Luta Contra o Genocídio do Povo Preto, Pobre e Periférico.','negrobelchior@gmail.com','10205420705712145'),(362,'Marlene Alves','BRANCA','FEMININO','FEMININO','1974-06-28','Marlene Aves, 42 anos, natural de Presidente Dutra MA, formada em pedagogia. Atualmente exerce a função de Conselheira Tutela. Iniciou sua luta pela comunidade ainda jovem quando fez parte dos movimentos da Igreja Católica trabalhando com crianças na catequese e com jovens nos grupos: JINAC e TEPASS. \r\nEm 1996 casou-se com Carlos Magno, a quem tem como pilar de sustentação. Tem três filhos.\r\nIniciou sua historia profissional em 1993, no Centro Comunitário Nossa Senhora de Fátima ( creche dos padres) desenvolvendo ações diretamente com as famílias daquela comunidade. Em 1999 participou da 1ª Escolha do Conselho Tutelar, sendo a mais votada assumiu a função onde apaixonou se pela militância em defesa de crianças, adolescentes e jovens. Em 2013 recebeu o convite para assumir o Departamento de Políticas Para as Mulheres, onde juntamente com a primeira dama e então secretaria da mulher Maria de Fátima Sodré desenvolveu ações e projetos em prevenção a Violência Contra a Mulher, através de palestras, cursos de incentivo a geração de emprego e renda.\r\nHoje lança seu nome a concorrer uma cadeira na câmara de vereadores de Presidente Dutra Ma, com o numero 10.001, para que se torne possível seus anseios e objetivos em busca de melhorias para a juventude, mulheres e famílias do município.\r\nTem a família como base primordial de uma sociedade.','carlosmagno.os@gmail.com','1053362028117867'),(363,'Edson Jóia','PRETA','MASCULINO','MASCULINO','1970-03-16','Sou cantor e compositor sambista, ator de teatro amador e radialista, fui eleito Rei Momo do carnaval de Campinas por 5 carnavais, e atualmente estou presidente da LESCA - Liga das Escolas de Samba de Campinas.\r\nQuero trabalhar para as questões de culturas populares, viabilizar a inclusão através das culturas na periferia, trazendo a auto estima de jovens e adolescentes.\r\nTrabalhar para que as escolas de samba tenham suas quadras e viabilizar a construção da \"Fabrica do Carnaval\" um espaço onde serão ministrado cursos com relação as questões carnavalescas.\r\nMais médicos e mais remédios nos postos de saúde, mais agilidade no atendimento aos pacientes.\r\nResumindo, trabalhar para que o dinheiro público seja bem aplicado.','edsonjoia@gmail.com','832330280203291'),(364,'Martha Andreza','BRANCA','FEMININO','FEMININO','1984-09-13','Recifense, formada em administração, casada, mãe de três filhos. Sempre trabalhei em busca de meus sonhos e ao longo de minha vida passei a entender a importância das pessoas em uma sociedade mista. Luto por ideais que mudem uma sociedade e unam pessoas diferentes. Precisamos entender os principais pontos a serem melhorados em nossa cidade sem esquecer que pessoas moram nela. Os direitos das pessoas devem ser prioridade na hora de gerir uma cidade e esse é  o objetivo de quem quer lutar por uma sociedade igualitária, sem discriminar seja por raça, cor, idade, classe social, tipo físico ou opção sexual. Vamos mudar o nosso Recife lutando por igualdade! Conto com você sempre!','martha.andreza@hotmail.com','1199771033429911'),(365,'Vinicius Coca','BRANCA','MASCULINO','MASCULINO','1977-09-01','Fisioterapeuta, professor universitário e comprometido com a qualidade na prestação dos serviços de saúde, comprometido com o SUS e comprometido com os profissionais de saúde da equipe multidisciplinar','drviniciuscoca@oi.com.br','1148690795201258'),(367,'Livia Lazaneo','BRANCA','FEMININO','FEMININO','1984-04-10','Lívia Lazaneo tem 32 anos, é limeirense, militante feminista, arquiteta e urbanista formada pela FAU-USP, concursada pela Prefeitura Municipal de Limeira. A rede de coletivos da qual participa atua no combate a toda forma de discriminação, principalmente contra o machismo, o racismo e a LGBTfobia.\r\n\r\nLívia participa ativamente da luta pela preservação do patrimônio histórico da cidade, que vem sofrendo grandes perdas nos últimos anos. Dentre outras propostas, defende que os edifícios públicos sejam utilizados com funções escolhidas em conjunto com os cidadãos.\r\n\r\nA participação da população nas grandes decisões é fundamental e prevista em lei, mas o desconhecimento disso concentra ainda mais o poder nas mãos de poucos, que o direcionam para benefício próprio. Novas formas de participação são necessárias e estão sendo criadas no mundo todo, e o jovem é protagonista nesta transformação. \r\n\r\nQUANDO O POVO SOUBER O PODER QUE TEM, TEREMOS A CIDADE QUE QUEREMOS!\r\n\r\nAs ações culturais devem ser descentralizadas, as atividades de formação artística precisam ser ampliadas, e deve haver incentivo e apoio aos artistas locais e às manifestações culturais independentes.\r\n\r\nA CULTURA ESTÁ EM TODOS OS CANTOS E DEVE SER RECONHECIDA!\r\n\r\nOs conhecimentos e habilidades dos servidores podem ser melhor aproveitados, trazendo mais qualidade aos serviços prestados, mas falta liberdade para o servidor propor melhorias e participar ativamente da gestão. \r\n\r\nCHEGAREMOS MUITO MAIS LONGE QUANDO O SERVIDOR DE CARREIRA FOR OUVIDO E VALORIZADO!\r\n\r\nCom relação à violência contra a mulher, é preciso criar campanhas de incentivo à denúncia pela vítima, humanizar o atendimento, tratar os agressores e ampliar o funcionamento da Delegacia da Mulher para 24 horas. As ruas e os espaços públicos precisam ser seguros para as mulheres, e assim serão seguros para todas as pessoas. \r\n\r\nLUGAR DE MULHER É ONDE ELA QUISER!','livialazaneo@gmail.com','1517960508219827'),(368,'Jefferson Moura','BRANCA','MASCULINO','MASCULINO','1973-08-27','Sou filho de mineiros, das montanhas de Minas aos rios de aço. Nasci em Volta Redonda (1973). Sou carioca de coração. Amo esta cidade. Aqui conheci minha esposa, Ana Paula, e foi aqui que nasceram João Pedro e Ana Carolina, meus queridos filhos.\r\n\r\nNa Pastoral da Juventude aprendi o significado da luta pela libertação de nosso povo e fiz a opção preferencial pelos pobres.\r\n\r\nNa escola pública, comecei a participar do movimento estudantil que marcou minha alma e meu compromisso em defesa da educação pública, gratuita e de qualidade. Na Juventude do PT, conheci a militância partidária, era 1988. Neste ano, o Exército ocupou a CSN (Companhia Siderúrgica Nacional) para derrotar a greve dos operários e assassinou Willian, Walmir e Barroso. O jovem militante amadurece rapidamente em meio às lutas sindicais e políticas.\r\n\r\nEm 1992, no “Fora Collor”, a defesa da ética e a luta contra a corrupção se tornaram princípios concretos em minha vida.\r\n\r\nFui metalúrgico na CSN. Conheci a solidariedade de classe. Em 1994, iniciei os estudos em Ciências Sociais na UERJ. As ciências sociais e a ciência da vida se misturam.\r\n\r\nEm 1995, participei da fundação do PSTU e comecei a trabalhar no TCE (Tribunal de Contas do Estado) como servidor público concursado.\r\n\r\nÉ caminhando que se faz o caminho. Em 2003, na ABI (Associação Brasileira de Imprensa), participei da reunião que, mais tarde, se desdobraria na fundação do PSOL. Continuava na luta por liberdade e socialismo com Heloísa Helena presidente em 2006.\r\n\r\nEm 2010, tive a honra de ser candidato a governador do Rio de Janeiro, defendendo o que acredito: ética, transparência, educação, mobilidade urbana, sustentabilidade socioambiental, democracia, liberdade e luta contra todas as formas de opressão e preconceito.\r\n\r\nSou mestre e doutor pela Faculdade de Serviço Social da UERJ e em 2012 tive a imensa alegria de ser eleito vereador pelo voto de nosso povo. Exerci esse mandato até aqui lutando para honrar a confiança e o compromisso com os que sonham com uma cidade justa, fraterna e igualitária.\r\n\r\nVivi intensamente as lutas de 2013. Transbordamento das bordas, ações autorais, crise de representação. Diante da necessidade de ampliar o campo político democrático e progressista, participo da fundação da Rede Sustentabilidade.\r\n\r\nVida, história, vivências e um sentido de ser que é ser com outros. Não quero a paz sem voz, não quero ficar sentado no sofá, reclamando do mundo. Quero estar nas lutas que acredito, nos núcleos vivos onde pulsa minha cidade. Aqui é o lugar onde eu e as pessoas que amo vivem. Quero o melhor para o Rio! Juntos podemos tecer sonhos e lutar lutas honradas. O Rio não é deles. O Rio é nosso! Vamos juntos!','vereador@jeffersonmoura.com.br','182047205563368'),(370,'Josias Januario','BRANCA','MASCULINO','MASCULINO','1961-04-25','FILÓSOFO  ENXADRISTA PARAQUEDISTA CURSO DE TEATRO EMBAIXADOR DA PAZ  HOMENAGEADO NA CÂMARA MUNICIPAL DE SÃO PAULO  COM O TITULO DE CIDADÃO PAULISTANO  TITULO DE EMBAIXADOR DA PAZ  CONGRESSO NACIONAL  COLAR DA CIDADE DE REVOLUÇÃO PAULISTA DE 1932. MEDALHA CONTITUCIONALISTA MMDC  E   MEDALHA CONSTITUCIONALISTA PEDRO DE TOLEDO. MEDLHA CRUZ ACADÊMICA E MEDALHA CÂMARA CASCUDO.\r\n\r\nJÁ MOREI NAS RUAS DA CIDADE DE SÃO PAULO, SOU DEFENSOR DOS DIREITOS HUMANOS  SOU CONTRA QUALQUER TIPO DE DISCRIMINAÇÃO SEJA ELA RELIGIOSA  POLITICA OU POR OPÇÃO SEXUAL. VAMOS LUTAR PELOS DIREITOS DA CAUSA LGBT.\r\n\r\nLUTAR PELA SÁUDE COM QUALIDADE NOS POSTOS DE SÁUDE PELA SEGURANÇA E PELO COMBATE A VIOLÊNCIA SOU A FAVOR DA GUARDA MUNICIPAL NAS ESCOLAS E NAS PRAÇAS E NÃO PARA MULTAR AS PESSOAS.OBRIGADO PELO SEU APOIO VOTE CERTO.','JANUARIOCONSUTOR@GMAIL.COM','1660836104230299'),(373,'Érico Santos','PARDA','MASCULINO','MASCULINO','1982-02-17','Cresci nas periferias da cidade do Recife, venho de um lar onde a política sempre esteve presente através da minha mãe que liderou ocupações populares na zona norte da cidade, e fez parte ativa do Movimento Popular. Fui estagiário no Grupo Tortura Nuca Mais, tenho me formação através do instituto IDEA na Espanha.\r\nSei a realidade que vivem os qu estão as margens do alcance do poder público municipal, sei por ter vivido essa realidade na própria pele, carrego um preparo técnico e a paixão necessária para assumir a função de vereador na minha cidade.\r\nDefendo a equiparação salário do vereador ao professor da rede municipal de ensino. Dessa forma valorizaremos o corpo docente e enfrentaremos de forma direta uma das muitas regalias da classe política.\r\nDesenvolvi o aplicativo mandato colaborativo, onde um percentual da população recifense estará cadastrada, recebendo de forma online tudo que ocorre na câmara, e definindo através de votação simple, qual deve ser minha posição é decisões que devo tomar. Assim sendo o mandado carregará real representatividade, pois as decisões estarão nas mãos do cidadão ao qual o mandato realmente pertence.\r\nDefendo a regulamentação do uso de aplicativos de transporte, a exemplo do UBER.\r\nMaiores informações meu facebook Érico Santos','ericosantos23@hotmail.com','10208893564874667'),(374,'Binho Alves','PRETA','MASCULINO','MASCULINO','1980-07-04','Binho Cultura, Cientista Social, Escritor e Produtor Cultural, idealizador da Flizo Festa Literária da Zona Oeste, conhecido como fazedor e parceiro de iniciativas sociais, educativas e defesa de direitos não somente na cidade Carioca, como dentro e fora do Brasil. Sua história tem como ponto de partida a Vila Aliança em Bangu, utiliza a Cultura como instrumento de democratização do acesso ao conhecimento, combate ao extermínio da juventude negra e ruptura de paradigmas. \r\nEntre as suas pautas, estão a Defesa em favor da liberdade religiosa, combate à homofobia, geração de oportunidades para a Juventude, o que já faz há anos mesmo sem ter cargo eletivo algum.\r\nSua agenda política é firmada nos pilares da Educação, tendo a Cultura e o Esporte como facilitadores na formação cidadã, acreditando que em contraturno no horário escolar crianças, adolescentes e jovens poderão ampliar sua perspectiva a partir das contribuições que vêm do Esporte e da Cultura.','binhocultura@gmail.com','586605908190266'),(375,'Guilherme Zugliani','BRANCA','MASCULINO','MASCULINO','1973-09-22','Sou Ambientalista, 42 anos, lutador de causas sociais e humanitárias, não só no Rio de Janeiro mas pelo Brasil.\r\nBusco soluções sustentáveis para o descarte responsável do Resíduo Sólido, respeito e atenção para o diagnóstico e tratamento de crianças especiais, com foco no TEA (Transtorno do Espectro Autista). Brigo pela valorização da Guarda Municipal, que os agentes fiquem mais próximos dos cidadãos, observar a qualidade da iluminação nas ruas para melhorar na segurança da população e diminuir os gastos públicos. Sou contra o foro privilegiado e benefícios excessivos para vereadores. Busco uma Nova ideologia Política.','guilhermezugliani@hotmail.com','10201982812890117'),(376,'Paulo Pinheiro','BRANCA','MASCULINO','MASCULINO','1949-01-22','Sou carioca, médico, casado, tenho dois filhos, três enteadas e cinco netos. Por oito anos, fui diretor diretor do Hospital Miguel Couto, onde se tem contato com o essencial da vida humana. Tenho uma convicção: Saúde é para todos.\r\n\r\nEm 1996 deixei o exercício exclusivo da Medicina para lutar por políticas públicas capazes de tornar o Rio de Janeiro mais justo. Seja como Deputado Estadual ou como Vereador, todos os meus mandatos foram pautados no respeito à conduta ética, na valorização da participação popular e na fiscalização implacável das ações de governo.','paulopinheiro@camara.rj.gov.br','1039495262835036'),(380,'Claudio Villeroy Schneider','BRANCA','MASCULINO','MASCULINO','1969-01-24','Tenho 47 anos, casado, 2 filhos. Sou Administrador de Empresas, especialista em Gestão de Pessoas e Gestão de Projetos. Sou empresário de TI a 15 anos. Fui Diretor da ASSESPRO-RS, entidade que reúne as empresas de TI, durante 10 anos, passando pela gestão de 5 presidentes. Coordenador de treinamento do Comitê de Informática do PGQP durante 3 anos. Professor de Graduação e Cursos Técnicos.\r\n\r\nIrei usar minha experiência como gestor e empreendedor para ajudar na gestão e na aplicação de recursos em nosso município.','claudio@compumedia.com.br','10211536585996800'),(381,'Rodrigo Araújo','BRANCA','MASCULINO','MASCULINO','1982-06-10','Candidato a vereador em Manaus pela Rede Sustentabilidade com o número 18.789.\r\n\r\n34 anos, casado e pai de 2 filhos.\r\nServidor da Polícia Federal há 12 anos\r\nEstudante de Direito da UFAM\r\n\r\n- Principais bandeiras de luta: democratização da política, direitos das minorias e sustentabilidade.\r\n- Não concorrerei à reeleição;\r\n- Não terei assessores. Seremos todos co-vereadores atuando com independência, assim faremos um mandato coletivo, com mais produtividade e mais conquistas;\r\n- Minha campanha não utiliza material impresso;\r\n- Usaremos o aplicativo Mandato Interativo, onde o eleitor acompanhará e opinará sobre os gastos do gabinete, debates e votações, projetos de lei e informará problemas da cidade, enviando fotos e localização e recebendo um número de protocolo.\r\n- Uso a bicicleta como meio de transporte na campanha e usarei para ir à Câmara;\r\n- Plantarei uma mudinha para cada voto recebido;\r\n- O mandato buscará, principalmente, melhorias nas políticas públicas voltadas para mulheres, negros, lgbt, pessoas com deficiência, ciclistas, crianças, idosos e população de baixa renda.\r\n','rodrigo.rsca@gmail.com','1152963441450050'),(385,'Rodrigo Rodrigues','BRANCA','MASCULINO','MASCULINO','1971-11-30','Nasci em Belo Horizonte/MG em 30/11/1971. Aos 16 anos de idade comecei a trabalhar no extinto Banco Real, como escriturário, deixando o Banco como caixa pouco mais de 3 anos depois. Aos 22 anos ingressei por concurso público na Polícia Rodoviária Federal. Aos 25 anos me formei em Direito na Faculdade Milton Campos, de Belo Horizonte/MG. Aos 28 anos me mudei pra Porto Alegre/RS onde exerci as funções de Corregedor da Polícia Rodoviária Federal por 3 anos e meio. Além desta função também exerci a chefia do Núcleo de Apoio Jurídico, do Núcleo de Comunicação Social e de Chefe substituto da 1ª Delegacia da PRF localizada em Porto Alegre. Sou instrutor de Aspectos Legais dos Procedimentos Policiais no Departamento de Polícia Rodoviária Federal desde 2000. Desde 2005 atuo na área operacional da 1ª Delegacia desempenhando as competências do cargo de Policial Rodoviário Federal. Paralelamente a esta atividade desde 2003 ministro cursos de Processo Administrativo Disciplinar para a Controladoria Geral da União (CGU) e para a Escola Superior de Administração Fazendária (ESAF/RS). Neste período ministrei cursos de PAD em Porto Alegre/RS, Santa Maria/RS, Pelotas/RS, Bagé/RS, Belo Horizonte/MG, São Luís/MA e Teresina/PI.','rodrigo.prf@oi.com.br','1239368176154810'),(387,'Vinícius De Franceschi','BRANCA','MASCULINO','MASCULINO','1988-11-13','Meu nome é Vinícius, sou advogado e tenho meu escritório próprio faz pouco mais de um ano.\r\n\r\nSempre me interessei por saber da política, mas nunca havia participado ativamente, e é minha primeira candidatura. Não sou político profissional e nem viso a ser, sou um cidadão comum que quer mudar Porto Alegre.\r\n\r\nSou um liberal convicto, acredito no livre mercado como melhor método de arranjo econômico e acredito nas liberdades individuais, devendo todos nós sermos livres quanto à religião, sexualidade, valores, desejos e objetivos, sem preconceitos.\r\n\r\nA maioria das minhas propostas se relacionam à mobilidade urbana: regulamentação do transporte hoje visto como clandestino, liberdade nos transportes, apoio às novas tecnologias como Uber, Cabify e Bora, regularização do moto-táxi, aceleração e fiscalização do plano cicloviário.\r\n\r\nSou radicalmente a favor da descriminalização gradual de todas as drogas, a começar pela maconha.\r\n\r\n','vinifranceschi@hotmail.com','1086498301434636'),(388,'Genys Alves Jr','BRANCA','MASCULINO','MASCULINO','1976-06-23','Genys Alves Jr é paulistano, nasceu na zona leste da capital, onde as famílias de seus pais residiam e mantinham pequenos negócios de varejo e serviços nos bairros de Vila Ré, Arthur Alvim e Vila Nhocuné. Sexto filho, entre cinco mulheres, perdeu o pai quando tinha 11 anos de idade, vítima de câncer. É casado e tem um filho.\r\n\r\nSua educação, nos ensinos fundamental e médio, aconteceu em escolas públicas municipal e estadual. Após formação técnica em projetos de mecânica, estagiou no ramo metalúrgico. Em seguida, começou a trabalhar na pequena empresa imobiliária da família.\r\n\r\nFormou-se advogado, pela Universidade São Judas Tadeu, com pós-graduação em MBA em Gestão Empresarial pela Fundação Getúlio Vargas (FGV). Corretor de imóveis há 18 anos, está inscrito no CRECI sob nº 57.272, abriu seu próprio negócio, tornando-se dono da Alves Jr. Consultoria, Imóveis e Administração.\r\n\r\nAlém da vida empresarial, tem expressiva atuação na área social, participa fortemente no desenvolvimento de projetos socioeducacionais. Foi idealizador, fundador, primeiro-secretário executivo e responsável pela criação dos estatutos do IDEAS - Instituto de Desenvolvimento Educacional e Assistência Social.','genys@alvesjr.com.br','10202403358241099'),(389,'Jorge da Reta','PARDA','MASCULINO','MASCULINO','1977-08-11','   Eu sou o jorge da reta, venho candidato a vereador pelo município do rio pela primeira vez. \r\nQuero fazer a diferença e não promessas. Ser corrupto é fácil, quero o mais difícil ser honesto.','jorgelukas@hotmail.com','1095199660557520'),(394,'Tatiana Picerno Guerra','BRANCA','FEMININO','FEMININO','1966-09-07','Sou carioca, psicóloga, advogada, ecologista, mãe, trabalhei na procuradoria geral do município do Rio de Janeiro, como advogada, atualmente trabalho com psicologia clínica, atendo em consultório particular e em uma associação, atendendo pessoas de baixa renda.  Estou engajada em movimentos contra a violência, defesa e empoderamento da mulher também para a melhora nas condições do ensino e da saúde.  Acredito que ensino e saúde de QUALIDADE é um direito humano BÁSICOS é fundamental. Assim como o bom uso do dinheiro público.  E é pela ausência desses direitos que decidi me candidatar. Meu compromisso além desse acima é lutar pelo fim da corrupção e pela transparência na  política. ','tatianapicerno@hotmail.com','10209198667538926'),(395,'Washington Santos','PRETA','MASCULINO','MASCULINO','1977-09-18','Filho de pai Baiano açougueiro e Uma carioca merendeira, nascido e criado na Maré, de família humilde e cristã.\r\nComeçou a trabalhar com 14 anos, como todo jovem pobre de comunidade carente, com muita dificuldades, apertos e muito esforço, terminou os estudos e formou-se em Gestão de Recursos Humanos. Esteve engajados em vários projetos sociais e na luta constante pela igualdade racial e de gêneros. Prezar a liberdades de todos os pensamentos e ideais por um Rio de Janeiro melhor.\r\nLuta contra a homofobia. E atuante pensador na liberdade de gêneros, todos tem o direito de ser feliz bem como desejar. \r\nNão que eu seja homossexual mas preso a  libertar de pensamentos que não sejam retroados e homofóbicos, xenofóbicos e racistas.\r\nRapidez e mudança já, para tudo que esta acontecendo em nosso pais. \r\n45300 vote 45300 vote 45300 acredite!!! Eu posso te representar sem te roubar...','was18rio@hotmail.com','1081069888609414'),(397,'Thiago Bagatin','BRANCA','MASCULINO','MASCULINO','1983-01-23','Thiago Bagatin tem 33 anos e nasceu em Curitiba. Atualmente é presidente licenciado do Sindicato dos Psicólogos do Paraná. Ocupou uma cadeira no Conselho Municipal de Saúde de Curitiba. É formado em psicologia, mestre em educação e doutorando em psicologia pela UEM. Trabalha como professor no curso de psicologia da PUC-PR. Atuou no sistema prisional como psicólogo, trabalhou no Complexo Médico Penal e na Penitenciária Feminina do Paraná. Foi coordenador geral do DCE-UFPR em 2005, co-fundador do Movimento Passe Livre Curitiba em 2005 e integrou o Centro Acadêmico de Psicologia da UFPR durante a graduação. Trabalhou como Psicólogo, Educador Social, Coordenador de Projetos e na Elaboração e Articulação de Projetos no Instituto de Defesa dos Direitos Humanos (IDDEHA), entre 2008 e 2013.\r\n','thiagobagatin@gmail.com','1105820916174279'),(398,'Lincoln Morais','PARDA','MASCULINO','MASCULINO','1990-12-18','Vamos ser transparentes e trabalhar para atender as reivindicações do povo, atuar de forma vigorosa em defesa da justiça social, dos direitos, dos deveres e garantias. Vou melhorar o sistema de ensino de nosso Município com projetos e mecanismos que trará qualidade para nossa Educação. \r\n\r\nVamos trabalhar em prol da universalização do atendimento médico, cuidar do maior patrimônio que temos que é o nosso Povo Cabense, Cuidando da vida e lhe assegurando tranquilidade, segurança e paz; promover o bem estar dos habitantes com eventos multiculturais em todos os bairros.\r\n\r\nA tribuna vai finalmente falar a voz do Povo!\r\nA #EscolhaCerta É #CincoOnzeOnze Curta nossa página \r\n\r\n   >>  https://www.facebook.com/lincolnmoraispe','lincoln.morais.keysck@hotmail.com','1061583720623960'),(399,'Nilo Garçom','BRANCA','MASCULINO','MASCULINO','1963-04-19','me chamo Nilo . casado 53 anos, nascido em Orós  Ceará criado em sp desde 1969, moro na zona sul de sp santo amaro ,já trabalhei como vendedor , inspetor de alunos e sou garçom a quase 30 anos , de família simples e honesta morador no mesmo bairro a mais de 45 anos pessoa digna e guerreiro ','nilo_psol@hotmail.com','966533226791560'),(403,'Ariane Leitão','BRANCA','FEMININO','FEMININO','1981-07-20','Ariane Leitão, tem 35 anos, é mãe do Francisco, militante do movimento de mulheres e feminista. Graduada em Direito, é Conselheira Municipal da Mulher em Porto Alegre e foi Secretária de Estado de Políticas para as Mulheres durante o governo Tarso Genro.\r\n \r\nIniciou sua trajetória muito jovem no movimento popular, atuando também no movimento estudantil secundarista e universitário. Com experiência em formulação de políticas públicas, atuou no legislativo e no executivo. Esteve no MEC durante o Governo do Presidente Lula e também na Casa Civil no Governo Tarso. \r\n \r\nMilitante da Marcha Mundial de Mulheres, é ativista pelos direitos humanos e das causas da infância. Consultora em políticas públicas de gênero na ONG Coletivo Feminino Plural, que trabalha com mulheres e meninas, é autora do livro Tráfico de Mulheres: A exploração Sexual no Brasil e a Violação aos Direitos Humanos. Ariane é uma militante em defesa de uma cidade livre da intolerância!\r\n \r\nEm 2012  foi uma das mulheres  mais votadas do PT para vereadora, conquistando a suplência. Em 2015 assumiu na Câmara, aprovando iniciativas que garantem os direitos das mulheres e das crianças em Porto Alegre, fortalecendo a igualdade pela cidade. É autora da lei do Disque-Denúncia no transporte público (Lei 12.105/2016), que prevê a obrigatoriedade em todo o transporte público municipal, em local visível, os telefones de emergência de atendimento às mulheres vítimas de violência. \r\n\r\nNesta eleição Ariane está junto com Raul e Silvana para retomar Porto Alegre e renovar a Câmara Municipal com mais mulheres no parlamento. Contra o golpe e a favor da democracia.\r\n','arianecl@gmail.com','10207119373567124'),(404,'Paulo César','PRETA','MASCULINO','MASCULINO','1986-04-11','Para começar, que fique claro que sou candidato, mas não sou político. Aliás, acho que não sou nem candidato, mas a antítese de um candidato.\r\n\r\nConservadores em geral não vão com a minha cara. Creio que isso é um bom sinal.','paulocesar18500@gmail.com','179675452467467'),(405,'Sharylaine Bakhita','PRETA','FEMININO','FEMININO','1969-04-10','Sharylaine iniciou seu artevismo cantando Rap em 1986, é rapper, cantora, compositora, arte educadora, produtora cultural e uma ativista cultural, social e política.\r\nDesde 2000 vem atuando nas proposições de políticas públicas de inclusão para a população periférica.\r\nNos últimos dez anos vem trabalhando diretamente com políticas públicas.\r\nSuas principais bandeiras para este pleito são voltadas a Cultura e Educação.\r\nÉ uma legítima representante da periferia e da mulher negra, para uma Camara de 55 cadeiras (vagas) onde 55 são ocupadas por homens e nenhuma mulher negra.\r\nHoje com 47 anos abraça o desafio de concorrer pela primeira vez a uma candidatura de vereança pela cidade de São Paulo, cidade onde nasceu, cresceu e que conhece como poucos, pois seus trabalhos a levaram a circular, conhecer e atuar, inclusive as regiões extremas da cidade. \r\nAcredita que só é possível mudar o cenário que a população vê, se indigna e repudia na política com a efetiva participação popular, tanto no processo de proposição e construção, quanto no processo de acompanhamento.\r\n\r\n\"É preciso mudar, mudar com qualidade e responsabilidade\" Sharylaine','sharylainesil@hotmail.com','1403939082954460'),(406,'Everton Braz','PRETA','MASCULINO','MASCULINO','1981-02-27','Lutar Por Justiça Social.','corretoejusto@gmail.com','1755203068085635'),(411,'Laila Seller','BRANCA','FEMININO','FEMININO','1954-11-05','Trabalho a mais de 15anos com educação popular e redução de danos, fiz parte de associação de bairros por mais de dez anos. No momento sou vice presidente da recém fundada organização Novo Mundo POA que tem suas funções voltadas para o humanitário como por exemplo: cursos capacitação para educadores ou estudantes de cursos relacionados com a saúde afim de instruir física e psicológica a inclusão social de crianças com algum tipo de deficiência.\r\nAcompanhamento e acessoramento a egressos do sistema penitenciário bem como de seus familiares, ajudando e encaminhado aos diversos tipos de auxílio afim de evitar a reincidência no crime e tambémevitar que filhos ou irmãos sigam pelo mesmo caminho.\r\nEncaminhar a população a cursos proficionalizantes gratuitos. Orientar a forma de empreender seu negócio afim de aproveitar cem por cento sua formação .\r\nDisponibilizar acesso mais fácil aos diversos tipos de ongs e órgãos aos cidadãos desinformados, que necessitem de atendimento especializados. \r\nConstrução de um abrigo para adolescentes recém saídos de algum sistema corretivo e que não tenham apoio de seus familiares .\r\nEnfim, caminho árduo e longo que ainda pretendo seguir e para facilitar acredito que como Vereadora poderei fazer mais e abrir  muitas portas afim de melhorar substancialmente a vida de centenas de famílias que não sabem o que fazer ou pra onde ir.\r\nAcredito\r\n no sistema multiplicador   que cada pessoa que for alcançada outras dez possam receber a mesma informação.\r\n','lailabestseller@gmail.com','1208399232544646'),(414,'Aline Déa','PRETA','FEMININO','FEMININO','1984-01-04','.','aline-dea@hotmail.com','1088163034553216'),(417,'Renan Araujo','BRANCA','MASCULINO','MASCULINO','1989-09-14','Historiador, Professor da Rede Privada de Educação, Acadêmico de Pedagogia, Amante das Artes e da Arquitetura. Defendo Maior controle das contas Públicas; Redução de Salários e Privilégios para ocupantes de cargos políticos. Busco abertura a juventude, nos campos de capacitação e mercado de trabalho, bem como o respeito e dignidade aos indivíduos dentro de sua Liberdade e diversidade.','frasrenan@hotmail.com','1274704295894903'),(420,'André Wagner Rodrigues','BRANCA','MASCULINO','MASCULINO','1980-10-08','ANDRÉ WAGNER RODRIGUES tem 35 anos, é casado e atua como professor universitário e diretor do Instituto Educar para a Liberdade. Sua trajetória política se caracterizou na luta pela valorização dos profissionais da Educação e também por mudanças pedagógicas e estruturais nas Escolas da cidade de São Paulo. Através do projeto “RELATOS DA JUVENTUDE” foi vencedor do prêmio de Educação em DIREITOS HUMANOS promovido pela Prefeitura e a Secretaria de Direitos Humanos da cidade de São Paulo.\r\n \r\nEntre suas pautas, irá acompanhar as políticas públicas e o investimento de verbas para a efetiva viabilização de recursos pedagógicos, técnicos e científicos para as escolas da rede Municipal de Ensino. Atuará também na formação continuada de professores, viabilizando projetos escolares sobre a igualdade racial, social e de gênero que ainda estão distantes do cotidiano de sala de aula.\r\n \r\nHistoriador de formação, o professor André Wagner se intitula como um educador militante, preocupado com o estágio atual de descaso político e social com a Educação, pretendendo assim ser um representante legítimo dos profissionais do Ensino que podem atuar na recuperação da dignidade dos docentes e de melhores condições de Ensino nas Escolas.','andrewunesp@gmail.com','1150270278344787'),(422,'Edson Mota','PARDA','MASCULINO','MASCULINO','1990-01-19','Quem é Edson Mota?\r\n? Morador da Zona Norte de Porto Alegre\r\n? Membro ativo e co-criador do grupo A Zona Norte Que Queremos(existe também Zona Sul).\r\n?\r\nO que já fiz: \r\n? Universitário - Graduando em Economia\r\n? Voluntário e Coordenador da Copa em 2014, gerenciando a logística de turistas.\r\n ?Serviço voluntário de  2011/2013, no Amazonas, Acre, Roraima e Rodônia.\r\n? Seminários de Liberalismo, pela Instituição Friederich Naulmann.\r\n? Seminários de Propostas Liberais para uma Cidade Melhor, pela Instituição Friederich Naulmann.\r\n? Curso de ENEAGRAMA, o estudo da personalidade de origem com análises de diferentes tipos de perfis.\r\n? Coordenador Local Senior do EPL (Estudantes Pela Liberdade).\r\n? Membro do MBL (Movimento Brasil Livre)\r\n Brigham Young University - PATHWAY.','edsonmotars@gmail.com','1667415106908636'),(423,'Ailton Amaral','PRETA','MASCULINO','MASCULINO','1970-11-16','SOU BACHAREL EM ADMINISTRAÇÃO, PÓS GRADUADO, ADMINISTRADOR E PROFESSOR DE ENSINO SUPERIOR NA ÁREA DE NEGÓCIOS, COM ATUAÇÃO TAMBÉM COMO INSTRUTOR DO PROGRAMA JOVEM APRENDIZ NOS ÚLTIMOS 4 ANOS.\r\n\r\nMINHA CARREIRA FOI NA ÁREA ADMINISTRATIVA, COM MAIOR PARTE DELA NAS ÁREAS DE GESTÃO, MARKETING E COMERCIAL. OS ÚLTIMOS 20 ANOS ATUEI EM EMPRESAS DE SEGURANÇA ELETRÔNICA E TECNOLOGIA.\r\n\r\nMINHA VIDA POLITICA NÃO COMEÇOU EM PARTIDOS, MAS EM ATUAÇÕES SOCIAIS E MOVIMENTOS, DESDE O MOVIMENTO ESTUDANTIL, PASSANDO PELO MOVIMENTO NEGRO E COLABORANDO EM MOVIMENTOS DE DIVERSIDADE, APOIANDO AS LUTAS DAS MULHERES E DOS TRABALHADORES DE FORMA GERAL, EM GREVES E ATOS CONTRA OS ATAQUES AOS DIREITOS TRABALHISTAS.\r\n\r\nSOU UM APOIADOR INCONDICIONAL DAS LUTAS FEMINISTAS, DAS LUTAS DOS LGBT\'S E PELA DIVERSIDADE E IGUALDADE DE DIREITOS. SOU UM LUTADOR PELAS CAUSAS RELACIONADAS A NEGRITUDE E PELA IGUALDADE SOCIAL. RESPONSABILIDADE SOCIOAMBIENTAL FAZEM PARTE DA MINHA VISÃO DE MUNDO.\r\n\r\nESTIVEMOS NAS RUAS PELO FORA COLLOR, EM GREVES DE PROFESSORES, APOIANDO OS, EM REIVINDICAÇÕES DA SOCIEDADE COMO UM TODO. EM BRASILIA, FOMOS A VÁRIOS ATOS CONTRA POLÍTICOS QUE HOJE RETORNARAM AO PODER PELO VOTO POPULAR, COMO POR EXEMPLO, CONTRA O RENAN, O SARNEY E CONTRA AS MUDANÇAS PREVIDENCIÁRIAS.\r\n\r\nSOU FILIADO AO PSOL POR ENCONTRAR NELE QUEM ME REPRESENTE E TER COMO BASE OS MELHORES POLÍTICOS DO PAÍS.\r\n\r\nÉTICA, IGUALDADE, JUSTIÇA SOCIAL E RESPEITO A COISA PÚBLICA SÃO ESSENCIAIS PARA MIM COMO POLÍTICO. POR CONTA DESTES PRINCÍPIOS NÃO FAÇO CAMPANHA COM PAPEL, PREFERINDO ATUAR NOS MEIOS DIGITAIS E BOCA A BOCA. OUTRO PRINCIPIO QUE NÃO ABRO MÃO É FAZER CAMPANHA SEM DOAÇÕES, O QUE PERMITE MINHA INDEPENDÊNCIA DE ATUAÇÃO, MANTENDO A INTEGRIDADE ÉTICA E MANTENDO-ME COERENTE COM MEUS PRINCÍPIOS.\r\n\r\nACREDITO EM UMA FORMA DIFERENTE DE FAZER POLITICA, POR ISSO CONSTRUO ESTA VISÃO A PARTIR DO PONTO DE VISTA QUE APRESENTO COMO BASE PARA MINHAS CAMPANHAS. PRECISAMOS ANTES DE FALAR EM POLÍTICOS HONESTOS SER PEDAGÓGICOS COM A SOCIEDADE, É DISSO QUE SE TRATA MINHA CAMPANHA, PODER TRAZER A POLITICA PARA AS PESSOAS QUE SÃO AFETADAS POR ELA DE FORMA CLARA E SEM MENTIRAS.','ailtonamaral@hotmail.com','10209236678466032'),(427,'Valter Luis','PARDA','MASCULINO','MASCULINO','1993-09-18','Valter Luis é líder do movimento LGBT \"Coletivo Crisálida\". Mora há nove anos no Cruzeiro do Sul, é graduando em engenharia de Produção, inspetor de qualidade, catequista há três anos na igreja Nossa Senhora Aparecida. É membro do Conselho de Juventude de Santa Bárbara d\'Oeste e ator na Companhia de teatro Ocuparte. Quer lutar pelas causas da juventude e do movimento LGBT.','vlccosta@outlook.com','10206925195115075'),(428,'Vinicius Escobar','BRANCA','MASCULINO','MASCULINO','1986-11-05','Vinicius Escobar decidiu concorrer pela primeira vez a um cargo público, pois acredita que a política precisa inovar. Professor por vocação e formação – pós- graduado aos 29 anos –, Vinicius tem na sua história a sala de aula e a política. Apaixonado por literatura, teve como maior incentivador nas letras o escritor Assis Brasil e na política, outro grande nome do Estado, o ex-prefeito e atual vereador de Porto Alegre, Guilherme Socias Villela','vinicius_escobar@terra.com.br','942105122566451'),(429,'Anderson Severiano Gomes','PRETA','MASCULINO','MASCULINO','1973-11-07','Anderson Severiano, tem 42 anos, é casado, mestre em Educação, pedagogo, Diretor de Escola Pública, professor universitário e um apaixonado pela vida, pelo trabalho, pela educação, em especial, a pública. \r\n\r\nSerá um dos mais críticos, independentes e combativos vereadores da Câmara Municipal. Objetiva fiscalizar o governo, denunciar as irregularidades, organizar audiências públicas apoiando lutas sociais dos diversos segmentos da sociedade na nossa cidade e apresentar projetos de lei que efetivem  a participação popular.\r\n\r\nAcredita na transformação do mundo, das pessoas, dos espaços. É um convicto que acredita que transformação está na participação. Para isso, devemos acreditar na potência humana que somos coletivamente. Assim, faremos juntos com que a Cidade seja das Pessoas, que São Paulo seja nossa!\r\n\r\nTarifa Zero a todos, mobilidade urbana, igualdade racial, poder feminino, comunidades LGBTs, inclusão social e de deficientes e moradia, são algumas de suas propostas.\r\n\r\nMais em: www.educanderson.com.br','anderson.educ@gmail.com','1373860295975365'),(430,'Margot Jung','BRANCA','FEMININO','FEMININO','1967-08-30','Faço parte da Marcha Mundial de Mulheres e sou vice-presidebte da Associação LGBT de Maringá. Coordeno grupo de mães e pais de LGBT e faço palestras nas escolas Estaduais sobre LGBTfobia na escola. Participa da coordenação da Parada LGBT de Maringá e da Semana LGBT. Quero ser vereadora e estou preparada para representar a população LGBT de Maringá. ','contato@margotjung.com.br','10205399403224469'),(435,'Mateus Braga','BRANCA','MASCULINO','MASCULINO','1990-02-26','Mateus do Nascimento Braga, 26 anos, filho desta terra de ferro, formado em Engenharia de Produção, professor, guerreiro, ficha limpa, engajado com a comunidade, pessoa que sabe ouvir, respeita e quer o melhor para o povo. \r\nIrei como vereador, fiscalizar, lutar pelo bem da COLETIVIDADE e das demandas SOCIAIS e propor melhorias.\r\nVou buscar para João Monlevade, mais ações na SAÚDE, SEGURANÇA PÚBLICA, EDUCAÇÃO PROJETOS SOCIAIS E DE SUSTENTABILIDADE, gerando mais qualidade de vida para nossa cidade.\r\nPor uma Monlevade Renovada! #Vem com a Gente\r\n','mateusnbraga@gmail.com','963059653802717'),(436,'Osmano Torres de Brito','PARDA','MASCULINO','MASCULINO','1970-05-03','Meu nome é Osmano Torres de Brito, sou morador de Araguanã, casado, pai de cinco filhos que foram e são estudantes de colégios públicos.\r\nCaro amigo eleitor, ao ver meus filhos terem que sair de Araguanã por falta de emprego, vi que este é o maior problema da nossa comunidade. A falta de emprego e renda separa a maioria das famílias, falta ainda uma voz forte na Câmara Municipal em defesa do funcionário público e do humilde morador, que fica submisso e é perseguido pelos políticos com mandato.\r\nEstamos a poucos dias da eleição, é agora que se escolhe o político que vai lhe representar. A Câmara de vereadores precisa de pessoas inteligentes, de caráter, honestos e que saibam defender com garra o povo, eu Osmano 13222 tenho conhecimento e vou entender os Projetos de Leis votados na Casa de Leis e somente aprovarei aqueles que sejam justos para todos;\r\nEu Osmano 13222 tenho capacidade e sei representar muito bem o povo do meu município; você me elegendo seu vereador, a Câmara anda, a cidade melhora, porque eu Osmano 13222, vou trabalhar ombro a ombro com o prefeito para Araguanã ter mais saúde, mais educação, e acima de tudo ter a geração de emprego e renda, com turismo sustentável, projetos de apoio a família, ao agricultor, ao criador, ao comerciante, ao funcionário público e ao autônomo.\r\nEu Osmano 13222 sou uma voz forte falando por você e garanto: você terá um vereador acessível, terá um amigo na Câmara Municipal que estará continuamente lutando pelos direitos humanos.\r\nEleja-me seu vereador porque Araguanã precisa de um projeto de vida melhor para você pai, você mãe, para seus jovens e crianças.\r\nPorque sou um pai de família e sei das necessidades de todos nós vou lutar para termos uma Câmara respeitada, que trabalhe, onde não faça vergonha assistir uma sessão e se discuta projetos para a população.\r\nAnote esse numero 13222 e no dia 2 de outubro não esqueça: vote Osmano numero 13222 porque quero ser seu vereador.\r\nPara falar comigo meu celular é: 63 9 9289-3682\r\n','osmanobr@hotmail.com','898955620247819'),(437,'Maroca Aron','BRANCA','FEMININO','FEMININO','1977-03-18','Paulistana, psicóloga social, professora universitária e pesquisadora de psicologia política e políticas públicas. Filha de mãe migrante nordestina e pai paulistano.\r\n\r\nAtuo e milito nas áreas de saúde (atenção primária em saúde), educação (leciono), sustentabilidade (ambiental, cooperativismo - fui eleita delegada do meio-ambiente para o município de São Paulo em 2013 e ajudei a elaborar o Plano Nacional de Resíduos Sólidos) e social (população em situação de vulnerabilidade,elaboração e execução de políticas públicas).','marianaaron@hotmail.com','10153724198912016'),(438,'Henri Maeda','PARDA','MASCULINO','MASCULINO','1967-12-25','','henri.maeda@gmail.com','10210700650218498'),(439,'Valeria Valente','PRETA','FEMININO','FEMININO','1961-01-23','Professora, graduada em Educação Física, há mais de 30 anos na profissão.','valeria.s.f.valente@gmail.com','928696580592777'),(440,'Anderson Luiz Luiz','PRETA','MASCULINO','MASCULINO','1983-06-25','OLÁ, SOU O ANDERSON DA CONSTRU RIO E QUERO AGRADECER O APOIO E AMIZADE PARA REPRESENTAR COM IGUALDADE DE DIREITOS OS CIDADÃOS DA CAPITAL DO RIO DE JANEIRO. COM SANEAMENTO, SAÚDE E EDUCACÃO.','andersonluizsilva@zipmail.com.br','1124384347640355'),(446,'Hermés Bento','BRANCA','MASCULINO','MASCULINO','1990-06-21','A juventude não pode mais ser excluída pelos nossos governantes! \r\nNão é justo que tenhamos que ir embora atrás de estudo e qualidade de vida!\r\nNossos artistas carecem de visibilidade.\r\nChega de nos negarem as rua, o parque as praças! A cidade é nossa!!!\r\n','hermes.noronha@hotmail.com','1108241482592656'),(447,'Ivone Pita','BRANCA','FEMININO','FEMININO','1970-08-13','Eu sou Ivone Pita, ativista, mulher, lésbica, feminista, professora, protetora dos animais, estudante. Sofro com um sistema de transporte caro e ruim. Com um sistema público de saúde que não atende toda a população da maneira como deveria. Minhas preocupações centrais são as mulheres, os LGBTs, os animais, a saúde, o transporte, a educação, a acessibilidade. É muito, eu sei, e nem falei do caos da moradia, do saneamento e tantos outros problemas, mas é que o Rio de Janeiro precisa ser todo refeito, não no sentido higienista e ainda mais segredador, mas numa perspectiva igualitária e inclusiva. E, por isso mesmo, precisamos não apenas eleger mulheres, mas mulheres feministas, progressistas, gente comprometida com o rompimento do que temos tido até aqui e que tenham compromisso com as minorias e todos os que vivem sendo empurrados à margem da sociedade. \r\n\r\nPor isso cheguei aqui. Foi processo. Estive em tantas lutas. Eu tenho 46 anos, dos anos 80 para cá, quanta luta,  quanta rua, acreditando, estabelecendo laços, me fortalecendo.  Hoje, tendo amadurecido e me fortalecido, quero ocupar um lugar na Câmara, num mandato popular, coletivo, continuar a luta por uma cidade mais justa e igualitária, uma cidade que seja realmente pensada para todos os moradores, com uma administração pública que chegue a todos os bairros, sem as discriminações que hoje atravessam o Rio, tão dividido e tão negligenciado. Permaneçamos firmes, fortes e unidos para refazer nossa cidade. Sigamos. o/  ','ivonepita50005@gmail.com','284062851975417'),(448,'Geisel Barbosa','PARDA','MASCULINO','MASCULINO','1976-08-30','me candidatei com a intuição de fazer a história na politica da minha querida Igarapava,','geiseljoiasdeprata@hotmail.com','1175721255821097'),(452,'Rique Peres','BRANCA','MASCULINO','MASCULINO','1992-01-16','Estudante, forjado na luta, tenho 24 anos e desde 14 Milito no movimento estudantil, o que me levou a outros demais segmentos sociais. Hoje sou Conselheiro Municipal de Juventudes de Campina Grande. Coloquei meu nome a disposição por conta da insatisfação com a política atual e para levar ao povo mais politização e menos politicagem. Acredito que passamos por um processo de avanço conservador, e caso não estejamos nos colocando também nesses espaços e enfrentando de frente esse processo, corremos o risco de perca de mais direitos. Além disso a necessidade de representações de Juventudes no poder, juventude de luta e não aqueles ou aquelas que representam a continuidade das oligarquias no poder. ','rico.peres@gmail.com','1090749651001225'),(457,'Fernando Lima','BRANCA','MASCULINO','MASCULINO','1959-12-20','Jornalista, trabalho há 30 anos na Fundação de Artes do Estado do Rio de Janeiro/FUNARJ, fundação responsável pelos aparelhos culturais do estado,  e há 16 estou à frente da Associação de Servidores desta fundação, sempre lutando pela valorização dos servidores, pela transparência na gestão dos equipamentos culturais e pela preservação de nosso patrimônio artístico e cultural. Na área social, encerrei mandato frente à Associação de Moradores da Vila Benjamin Constant, na Urca, onde luto pela regularização fundiária e no fomento às ações culturais na comunidade.','gustav109@ig.com.br','10205552388247755'),(459,'André Luiz Marangoni','BRANCA','MASCULINO','MASCULINO','1978-10-18','Sou nascido e criado em Sales Oliveira, filho de uma família humilde e grande, a qual sempre foi muito importante para mim. A vida não foi nada fácil para mim, para estudar precisei trabalhar como servente de pedreiro, tratorista e até mesmo na fazenda. Hoje sou professor de Geografia e Filosofia, durante algum tempo fui professor contrato pelo estado onde trabalhei em Sales Oliveira, e hoje leciono em São Joaquim da Barra. E continuo minha luta por uma Sales Oliveira com mais oportunidades, uma Sales Oliveira maior e mais forte.','andre_marangoni@hotmail.com','1076946279009514'),(461,'Caroline Ohki Germano','PARDA','FEMININO','FEMININO','1992-11-20','Caroline Germano é candidata a Vereadora.\r\n\r\nNascida em São Roque, viveu em Ibiúna durante a infância e adolescência. Filha de servidor público e professora, é a caçula de três irmãos. Estudou nas mais variadas escolas da cidade, o que possibilitou observar, reconhecer e tratar a diversidade entre classes, gêneros, etnias, raças e religiões. \r\n\r\nComeçou sua carreira profissional aos 16 anos trabalhando em call center. Aos 19 anos, mudou-se para São Paulo em busca de melhores oportunidades de emprego e acadêmicas. \r\nIniciou os estudos em Direito na Universidade São Judas Tadeu, sendo orientada por consagrados professores em Direito, Teoria Geral do Estado, Economia Política e Pesquisa. Essa experiência foi primordial ao seu entendimento de mundo e militância das questões dos trabalhadores urbanos e rurais, feministas, dos negros e da comunidade LGBTT.\r\n\r\nFoi colaboradora em escritório jurídico de empresas na área de tecnologia dos transportes públicos de São Paulo e  franquiadora de auditoria fiscal e tributária em mercado nacional.\r\n\r\nEm 2015 com os efeitos da crise econômica e política, retornou à Ibiúna para continuar os estudos com o apoio familiar.\r\n\r\nDurante o breve período de tempo que estagiou no Fórum de Ibiúna, pode conhecer a realidade de trabalho dos servidores públicos da cidade, tal como a dos condenados e privados de liberdade.\r\n\r\nA partir do acumulo dessas experiências, em reflexão à situação educacional, iniciou um novo caminho acadêmico com o ingresso no curso de Filosofia pela Universidade de Sorocaba. \r\n\r\nHoje atua profissionalmente na  Cooperativa Agropecuária de Ibiúna.\r\n\r\nFiliou-se ao PSOL em 2015 e desde então vem junto com os demais militantes do partido, como professores, jornalistas, programadores e advogados repensando a política e o papel do Estado em nossas vidas. \r\n','caroline__germano@hotmail.com','10202203229439538'),(463,'Alvaro Tasso','BRANCA','MASCULINO','MASCULINO','1977-06-13','Sou o Tasso 15015, tenho 39 anos, casado , tenho 1 filho , natural de Campinas , comerciante e bacharel em Direito.\r\n   Revoltado com o cenário político atual , resolvi me candidatar para poder renovar e realmente melhorar nossa Cidade de Campinas.\r\n   Meu principal trabalho será por mais trabalho e renda para a população de Campinas junto com a secretaria de trabalho e renda da Prefeitura Municipal de Campinas.\r\nProfissionalizar jovens , adultos e idosos a partir dos 14 anos .Quando fizer 16 anos e retirar sua carteira de trabalho , esse jovem estará empregado em uma empresa parceira que já fez a lista de vagas de empregos , na secretaria.\r\n   Ampliar o projeto de hortas comunitárias em bairros periféricos, aumentando o emprego e renda , gerando mais alimentos orgânicos , destinados a merenda escolar e creches.\r\n      Fiscalizar o executivo e suas contas.\r\n  ','alvarotasso@hotmail.com','1118696464852489'),(464,'Everton De Lima Oliveira','BRANCA','MASCULINO','MASCULINO','1973-12-16','Éverton de Lima Oliveira é gay, casado, guaxupeano e médico com residência em Medicina Preventiva e Social e pós graduação em Medicina de Família e Comunidade, em Homeopatia e em Administração Pública. Trabalhou como médico do Programa de Saúde de Família. Atualmente, trabalha como médico perito previdenciário no INSS e vice-presidente do CEAS - Centro de Estudos e Assistência Social, que atua na área de educação e esporte para crianças e adolescentes em vulnerabilidade social. Ativista pelos Direitos Humanos e pela Cidadania LGBT, Éverton é administrador do site, do grupo e da fanpage \"LGBT Brasil\" e co-autor das Cartilhas LGBT Eleições 2012, 2014 e 2016 que visam dar subsídios à comunidade LGBT e à população em geral para que escolham candidatos realmente comprometidos com a cidadania LGBT e com os Direitos Humanos de Todas e Todos.','elocoll@uol.com.br','1406561136027373'),(465,'Rafael Fioratto','BRANCA','MASCULINO','MASCULINO','1982-03-28','Sou professor, artista, funcionário público . Graduado e pós graduado em Artes Visuais e Teatro. Mantenho um trabalho de valorização da Mata Atlântica, resgate da identidade cultural de Itatiaia e oportunidade através da educação.  Minha projeção artística e profissional me projetou para a política por acreditar que uma mudança verdadeira é possível. A representação do povo na câmara de vereadores precisa levar em conta conhecimento, formação, trabalho e boa vontade. Meu lema para esta campanha é \"A mudança que você quer, nós podemos fazer juntos\".  E com propriedade no discurso e nas ações reafirmo: Vamos fazer juntos!','rafaelferreira28@gmail.com','1323470661026575'),(468,'Marcus Menezes','BRANCA','MASCULINO','MASCULINO','1983-03-25','Professor Marcus Menezes\r\n\r\nSuburbano, nascido e criado na Ilha do Governador. Formado em Educação Física pela UFRJ, onde foi professor substituto por 2 anos e treinador da equipe de futsal feminino. Foi professor em Nova Iguaçu por 4 anos, atualmente é professor em Queimados e Rio de Janeiro. É diretor licenciado do Sepe Queimados e membro do Coletivo Luta Educadora. Está na direção do Psol Carioca, coordenador do Setorial Ecossocialista do Rio e fundador do núcleo Psol Ilha.','professormarcusmenezes@gmail.com','10208563238173295'),(473,'Rafael Guimarães','BRANCA','MASCULINO','MASCULINO','1987-07-22','“Nascido e criado as margens do rio juquiá, como todo filho de nossa terrinha, sai em busca de oportunidades, e ao longo de 10 anos de experiência nas áreas de desenvolvimento social, desenvolvimento sustentável, agricultura e agronegócio, atuando em projetos de âmbito mundial, e sendo colaborador de algumas multinacionais, percorri muitos estados brasileiros. Gostaria de buscar uma oportunidade de representar a nossa população nesta cidade tenho minha residência junto a minha esposa, e nossas três filhas. Cidade essa que ao longo dos últimos anos vejo sendo abandonada, a ponto de perdermos nossas identidades. Não quero que minhas filhas tenham que ir para longe para ter oportunidade, ou mesmo sentir-se bem. Minha luta será para resgatar nossa identidade, enfatizando nossa cultura, nossas historias, nosso povo. Meus objetivos como vereador será atuando com intenções coletivas,sendo porta voz das demandas da população, buscando atender as demandas, e principalmente buscar desenvolver uma infra-estrutura digna para receber os milhares de turistas que passam por aqui e não param por não ter o que fazer .O amor que tenho por Juquiá, cidade a qual represento pelos quatro cantos do Brasil, junto ao seu atual abandono me serve de combustível para participar destas eleições municipais.\r\n\r\n “É IMPOSSIVEL TER RESULTADOS DIFERENTES FAZENDO AS MESMAS ESCOLHAS’’ \r\n\r\n#RafaelGuimarães ','preservale@gmail.com','1182383505161441'),(475,'Agnes Helena','BRANCA','FEMININO','FEMININO','1985-03-08','Sou arquiteta urbanista formada pela USP (graduação em 2010 e mestrado em 2015) com especialização em patrimônio cultural e planejamento urbano. Trabalhei na construção civil com gerenciamento e fiscalização de obras comerciais e residenciais, além de projetos na área de restauro de edifícios históricos. Atualmente administro minha microempresa no ramo de design de móveis que, contra todas as estatísticas, sobreviveu ao seu primeiro ano de vida. Morei em Pirituba na zona Oeste da capital durante 29 anos e recentemente me mudei para a Vila Mariana na zona Sul. Sou voluntária há 3 anos em uma ONG que cuida de animais de rua em São Paulo e me interesso por assuntos como empoderamento e educação econômica, desenvolvimento científico, empreendedorismo e maior eficiência na gestão urbana.','agneshelena@gmail.com','10209093377026126'),(476,'Romildo Lima De Andrade Rocha','PARDA','MASCULINO','MASCULINO','1965-08-23','ROMILDO nasceu na cidade de pimenteiras, no Piauí, tem 51 anos, e vive em São Paulo há 34 anos. Atualmente reside em Americanópolis, região de Jabaquara, casado tem 3 filhos e atua como micro individual na área de construção civil.\r\n\r\nPrestei serviço no Bank Boston por 10 anos  na área de arquivo geral.\r\n\r\nMINHAS PROPOSTAS:\r\nInclusão digital em projetos voltados para crianças com deficiência relacionada ao desenvolvimento motora.\r\n\r\nCursos profissionalizante com foco nas pessoas com mais de 40 anos e na 3ª idade.\r\n\r\nProjeto de resgate e recuperação de animais abandonados. ','rochalima245@gmail.com','208806669535510'),(478,'Jessica Michels','BRANCA','FEMININO','FEMININO','1990-12-20','Jessica Michels é fotógrafa, estudante de Jornalismo e ativista de direitos humanos. Atua principalmente nas causas feministas e LGBT. Como vereadora, pretende lutar contra todas as opressões sistemáticas (machismo, racismo, LGBTfobia), incentivando a interseccionalidade em todas as políticas públicas na cidade. ','michelsfotografia@gmail.com','1395641487120268'),(479,'Marcio Barboza','PRETA','MASCULINO','MASCULINO','1979-05-15','\r\n','marcio_barboza_6@hotmail.com','10208495309075273'),(482,'Leonardo Quintino','BRANCA','MASCULINO','MASCULINO','1983-07-31','Jornalista, pós-graduado em Administração Pública pela PUC Minas. Sou diretor da Quintinos Comunicação e da DL Gráfica e Editora. Fui presidente da ONG Ação Comunitária Novo Rumo. \r\n\r\nA frente da ONG Ação Comunitária coordenei projetos que contribuíram para o resgate da dignidade e cidadania de milhares de pessoas. O nosso trabalho levou saneamento básico, calçamento de ruas, legalização de bairro, entre inúmeros outros benefícios para diversas comunidades de BH.\r\n\r\nFiz pós-graduação em Administração Pública na PUC Minas e estudei em detalhes a complexa estrutura da prefeitura e da câmara de vereadores, além de todas as leis que envolvem o tema. Assim sou capaz de cumprir plenamente o papel do vereador: legislar e fiscalizar os atos do prefeito. Além de propor soluções para resolver os problemas da cidade e melhorar a vida dos cidadãos.\r\n\r\nSou um candidato independente. Não faço \"acordo\" com prefeito ou empresas. Meu compromisso é com o cidadão e a cidade.','leoquintino@gmail.com','10208221904769891'),(483,'Babi Fabricia Maldonado','BRANCA','FEMININO','FEMININO','1956-08-17','Sou empresaria, gosto muito de animais, fui salva por um cãozinho, e jurei um dia fazer algo por eles, só quem ama animais sabe o amor infinito que nos dá, fui convidada pelo partido PSD para candidatar a vereadora, entao vi essa oportunidade para tentar fazer algo grande em relação aos animais.\r\nE muito difícil vc concorrer com grandes nomes de carreira Política, tenho trabalhado muito e com poucos recurso na atual crise financeira. \r\nNao tive muito apoio de Partido, nem de amigos que acham uma loucura, no momento de crise Política no Pais, enfim vamos lutando, PRECISO de  VOCÊ! APOIE ESTA CAUSA!\r\n\r\nPROJETOS DE MINHA CAMPANHA\r\n\r\nPOLITICAS PUBLICAS em Defesa dos direitos dos animais\r\nA Constituição Federal em seu Artigo 225, inciso VI, estabelece que todos são detentores do Direito a um meio ambiente ecologicamente equilibrado. E dispõe que cabe ao Poder Público: “ Proteger a fauna e a flora, vedadas, na forma da lei, as práticas que coloquem em risco sua função ecológica, provoquem a extinção de espécies, ou submetam os animais a crueldade. (Art. 225, § 1º, VII) “ \r\n\r\n•	CRIAÇÃO DE UM CANIL MUNICIPAL OS CÃES RESGATADOS PRECISAM PASSAR POR UMA TRIAGEM DE EXAMES, RECEBER A MEDICAÇÃO EFICAZ PARA O POSSÍVEL PROBLEMA, VACINADOS, VERMÍFUGOS, CASTRADOS E DISPONIBILIZADOS PARA ADOÇÃO. \r\n\r\n•	PROGRAMA SAÚDE DOS ANIMAIS\r\n\r\n•	Programa de atendimento veterinário gratuito aos munícipes de baixa renda dada a importância e a necessidade, evitando o sofrimento de animais da população carente e que determinadas zoonoses contaminem pessoas sem acesso as clinicas particulares\r\n\r\n•	Criar mais campanhas de vacinação e diversificar as vacinas, \r\n\r\nHoje a prefeitura só disponibiliza antirrábica; \r\nExemplos de vacinas que faltam, cães vacina V10 e V11 - principais doenças que esta vacinas combate hepatite infecciosa canina e leptospirose, vacina gripe canina e vacina contra giardíase e para gatos vacina quadrupla e quíntupla que previne a leucemia e outros \r\n\r\nNo campo da proteção animal, \r\n•	Combate constante à crueldade, maus tratos e abandono, através de ações práticas como; programa “Cidadão de Amanhã”, a ser implantado para crianças, com orientação de respeito e amor aos animais.\r\n\r\n•	Desenvolver atividades voltadas ao bem estar animal com o apoio institucional a diversas entidades e programas de proteção animal, assim como as parcerias com entes que atuam defendendo a guarda responsável e os direitos dos animais\r\n\r\n•	Melhoria nos trabalhos de castração, identificação e conscientização da população em prol da posse e guarda responsável.\r\n\r\n•	Realizar simpósios, congressos, palestras com temas educacionais de amor e preservação aos animais e seus direitos à vida.\r\n. CONSCIENTIZAR OS PROPRIETÁRIOS DA IMPORTÂNCIA DOS CUIDADOS BÁSICOS DE HIGIENE E SAÚDE DOS ANIMAIS, OS DEVERES E OBRIGAÇÕES DE UM PROPRIETÁRIO RESPONSÁVEL, ASSIM COMO OS BENEFÍCIOS DA ESTERILIZAÇÃO PARA O ANIMAL E PARA O FIM DO ABANDONO DE CÃES DE RUA. \r\n\r\nFarei tudo que puder em prol de realizar isso. CONTO com VC!\r\n','fabricya@gmail.com','1296978253668122'),(484,'Bia Querido','BRANCA','FEMININO','FEMININO','1985-03-12','Sou filha de Antonio, motorista de táxi há 40 anos e Maria das Graças, técnica de enfermagem aposentada.\r\nNasci aos 12 de março de 1985 no Hospital das Clinicas localizado no bairro de Cerqueira César em São Paulo capital, na época em que minha era técnica em enfermagem no InCor. Freqüentei a creche do HC até aos 3 anos depois, fui para a creche do Hospital Israelita Albert Einstein.\r\nEstudei toda infância até completar o colegial em colégio de freiras, Lar Escola João XXIII.\r\nMeu curso superior foi no Centro Universitário UniFIEO, localizado em Osasco.\r\nAtualmente exerço a profissão que meu pai me ensinou, sou taxista há 6 anos.\r\nDecidi entrar na vida política, pois também está em meu DNA, meu Avô materno e Tio materno foram vereadores na cidade natal da minha mãe.','biataxistasp@gmail.com','10207681682663221'),(486,'Tatiana Trarbach','BRANCA','FEMININO','FEMININO','1966-05-02','Sou Tatiana Trarbach, natural de Santa Cruz do Sul. Sempre fui militante da esquerda e é primeira  vez que me candidato. Luto pela inclusão social, direito de igualdade para todos,defensora das mulheres  e a prática de esportes em espaços públicos.','decoratati@msn.com','10206804960224408'),(487,'Daniela Peño Paiva','BRANCA','FEMININO','FEMININO','1974-04-28','História de Luta e Formação Política\r\n\r\nSou gaúcha de Porto Alegre, tenho 42 anos, hoje a minha casa é Corumbá desde 2013, quando vim para a cidade estudar Psicologia na Universidade Federal de Mato Grosso do Sul (UFMS). Sou também Professora, com Pós-Graduação na área da Educação pela Universidade Federal do Rio Grande do Sul (UFRGS), militante dos Direitos Humanos e sobretudo pela Educação em Direitos Humanos há mais de 20 anos, trabalhando em projetos vinculados à diversas universidades públicas federais e estaduais. Luto pelas políticas públicas para o segmento da Diversidade Sexual e das Identidades de Gênero, no senso comum mais conhecido como movimento LGBT, pesquiso a temática Gênero e Sexualidade, com Projetos de Extensão realizados na Universidade Federal de Mato Grosso do Sul. Transfeminista, defendendo a participação dos homens (CIS e TRANS) no movimento feminista e a inserção das Travestis e Transexuais como pertencentes ao Feminino, de igual para igual à Mulher biologicamente nascida (CIS). Protetora dos Animais, contra os maus tratos e a favor da aplicação da Lei de Crimes Ambientais, a utilização de animais de tração, venda de animais, defendendo o controle da natalidade (castração), albergues/abrigos públicos para animais, hospitais veterinários públicos e CCZ´s mais atuantes no controle epidemiológico e nas ações de esclarecimento e conscientização com relação à Saúde Pública do que a matança indiscriminada de animais doentes. Atuante no Movimento Estudantil, reivindicando a garantia de direitos e o final da violação dos direitos dos estudantes e do assédio moral no Campus do Pantanal e na UFMS como um todo. Possuo denúncias nominais no Ministério Público Federal, Polícia Federal, Ministério Púbico Estadual, Polícia Civil, PROCON, Conselhos Municipais e Fóruns, materializando o verdadeiro Controle Social.\r\n\r\nSite: < http://www.rotadodesenvolvimento.com.br/rota16/index.php/2016-08-01-23-22-34/79-daniela-peno-paiva >.\r\nFacebook: < https://www.facebook.com/DaniPPS23444 >.\r\nCelular e Watsapp: (67) 98168-6113 Vivo','rizoma.psi@gmail.com','1115464121822541'),(488,'Samir Squeff','BRANCA','MASCULINO','MASCULINO','1978-05-26','Sou um jovem, empreendedor, estudante de Direito, oriundo de comunidade carente, identificado com as demandas prioritárias do povo que mais precisa. Em meu mandato quero fazer diferente, acredito que no Poder Legislativo não é lugar pra se fazer \"Carreira Política\", um Vereador precisa mostrar para seus eleitores, a seriedade de um bom gestor, a política precisa ter alternância de poder, para isso, acredito que no máximo dois mandatos são mais do que suficientes.\r\nDentre os planos que temos para o próximo pleito, encontra-se o gabinete móvel, levaremos para dentro das comunidades, trimestralmente, nosso gabinete, tendo assim uma maior afinidade e sapiência das necessidades prioritárias daquele determinado bairro.','mukavermelho@hotmail.com','10210601146774467'),(496,'Rogério Lima','PARDA','MASCULINO','MASCULINO','1977-09-21','Olá amigos! Sou, Rogério Lima músico filho de Cruz das Almas e, quero representar, você músico e artista popular na nossa cidade...#NOSSAVEZNOSSAVOZ!','babyllina49@hotmail.com.br','1139817709427273'),(498,'Ruben Sousa','PARDA','MASCULINO','MASCULINO','1958-09-06','Turismólogo, diretor de produção pelo SATED MG , Professor de cursos profissionalizantes onde nos últimos 17 anos formamos mais de 9600 alunos,possiblitando a eles renda e emprego.Produtor de eventos .Nascido em Bom Despacho MG e veio para capital aos seis anos...Atua na área tb de assistência social, direitos humanos e pela causa LGBT...36696 PTC Rubén Sousa (Rubinho) Vereador em BH.','champanhecomruben@gmail.com','1055089774590220'),(500,'Antonio Valdo','PARDA','MASCULINO','MASCULINO','1973-02-09','Antonio Valdo de Souza, morador da zona leste,\r\nonde trabalho como Corretor de Imóveis.\r\n\r\nQuero lutar pela educação\r\npública, gratuita e de qualidade em nossa\r\ncidade. A começar pela valorização dos\r\nprofessores e maior investimento na estrutura\r\ndas escolas. Sem quadras, laboratórios, teatro\r\ne merenda reforçada, nossas crianças e jovens\r\nterão mais dificuldade para enfrentar os\r\ndesafios da vida. Em um país que teve tanto\r\ndinheiro para ser desperdiçado com corrupção\r\ne com os bancos, não é certo que a educação\r\nsobreviva de maneira tão precária.\r\nLutarei em defesa dos funcionários públicos\r\nda saúde e segurança pública, além de melhores\r\ncondições de trabalho. Afinal, os serviços\r\npúblicos estão em péssimo estado, e sem os\r\nservidores em boas condições de trabalho não\r\nmudaremos essa situação.\r\nVamos brigar por isenção de impostos para\r\nque indústrias se instalem nos bairros.\r\nAproximando o local de trabalho das\r\nmoradias, poupando os trabalhadores das muitas\r\nhoras dentro dos ônibus superlotados. Retirando\r\no pouco tempo que temos para passar\r\ncom as nossas famílias.','testarossa.consultoria@hotmail.com','1106158369421578'),(501,'Joao Bosco Lopes','BRANCA','MASCULINO','MASCULINO','1968-04-25','Sou joão bosco dantas lopes  ,nascido em são paulo do potengi RG ,  filho mais novo de 9 irmãos .\r\n          estudei em escolas publicas, fiz comercio exterior na ibero americana  .\r\nTenho  duas filhas lindas  ,que são minhas vidas. e por elas que luto por um Brasil melhor\r\nComerciante no ramo  de compra e vendas de veiculos automotivos\r\nTenho projetos , na areas de reciclagem,e cooperativismos . \r\n\r\nwww.sospeace.org,br      entrem no site  olhem um pouco do meu trabalho','bosco10lopes@gmail.com','10205646584803997'),(502,'Mestra Emília','BRANCA','FEMININO','FEMININO','1971-02-22','\r\nPresidente Executiva da \" Fraternidade Francisca Domingues  \"\r\nGrupo de assistência e amparo a Migrantes Nordestinos ,LGBTs,Moradores de Rua \r\nE toda e qualquer  pessoas em situação de risco social .\r\nSediada na Cidade de Campinas desde 2009\r\n\r\nCoordenadora do Centro de Cultura Afro brasileira  Ilé Ayrá Túnjí \" Casa de Boiadeiro \"\r\nSediado na cidade de Campinas desde 2009\r\nOnde desenvolve projetos culturais junto a comunidades carentes \r\ndando ênfase a cultura Afro Brasileira\r\n\r\nDirigente do Templo de Caridade Casa de Boiadeiro \r\nna cidade de Campinas desde 2009 \r\n\r\nGestora do MÃE “ Movimento Asé Ecológico “ \r\ntrazendo a ecologia para dentro e fora das casas de acolhimento e publico em geral \r\nCom oficinas de artesanato com reciclados  ,e oficiando palestras educativas \r\nEm escolas ,associações e pontos de cultura na cidade de Campinas desde 2014\r\n\r\nCoordenadora Municipal da Renafro Saúde  \r\nRede Nacional de religiões Afro Brasileiras e Saúde\r\né uma instância de articulação da sociedade civil que envolve iniciados(as) nas religiões de matriz africana, gestores e profissionais de saúde, integrantes de organizações não governamentais, pesquisadores e lideranças do movimento negro visando a promoção da saúde do povo de santo e simpatizantes das religiões de matriz africana ,em Campinas desde 2014\r\n\r\nIdealizadora e produtora Cultural do grupo de  Samba de Coco \"Coco  Encantado \"\r\nCoordenando aulas e ensaios abertos ,shows gratuitos nas praças da cidade\r\nOferecendo oficinas de música,dança folclórica ,e confecções de instrumentos\r\nna cidade de Campinas desde 2014\r\n\r\nIdealizadora e Diretora  da \"C&A Bellaoyá\" de teatro ancestral e folclore \r\nResgatando historias e lendas afro brasileiras em pequenas intervenções de teatro ancestral \r\noficiando costura e confecções de figurino embasado nas roupas litúrgicas e festivas \r\nde  candomblé e outras heranças da cultura brasileira ,na cidade de Campinas desde 2014\r\n\r\nIdealizadora do projeto \"Erê Mirim\" \r\nLeitura para crianças com bases na cultura afro dando suporte ao apoderamento de nossa historia\r\ne elevando a auto estima das crianças Afrodescendentes ,na cidade de Campinas desde 2015\r\n\r\nPalestrante \r\nMinistrando palestras e cursos ,sobre :\r\nEcologia ,Tradições Nordestinas e Afro Brasileiras \r\nCaatimbó de Caboclo ,Mitologia Afro Brasileiras \r\n\r\nEmpresaria ,Cantora ,Compositora ,Escritora \r\nGestora Ambiental ,Produtora Cultural  \r\n\r\n\r\n\r\n','casadeboiadeiro@gmail.com','1810296279186069'),(503,'Goretti Queiroz','PARDA','FEMININO','FEMININO','1962-01-17','Goretti Queiroz é jornalista com pós graduacao em jornalismo politico\r\n É presidente do Movimento de Defesa Animal de PE - MDA/PE; participou da reinstalação do Conselho Gestor CVA-Recife, é membro do Núcleo Legal de Defesa Animal do Ministério Público de PE; colaboradora da Comissão de Bem Estar Animal da OAB/PE e membro voluntário da ONG Environmental Conservation Organization – ECO e fundadora  da Associação SOS Dentinho. \r\n\r\nPara ela cuidar dos animais é uma questão ética, de cidadania, de respeito às Leis e de valores cristãos,  além de ser uma questão de saúde pública. \r\n\r\nSua principal  bandeira de luta é  em defesa dos animais e do meio ambiente, sem esquecer a causa das mulheres e dos deficientes,  e  para uma nova política de princípios éticos no Brasil.','cigganna@gmail.com','1785951771644380'),(504,'Gildazio Moura','PRETA','MASCULINO','MASCULINO','1957-04-02','Fisioterapeuta/Sanitarista\r\nGestor Ambiental\r\nGestor Público de saúde\r\nProfessor universitário\r\n\r\nFoi:\r\nCoordenador do Distrito sanitário III\r\nCoordenador estadual de atenção à saúde do trabalhador e trabalhadora.\r\nCoordenador estadual de atenção à saúde da pessoa com deficiência\r\nCoordenador municipal da atenção à saúde da pessoa idosa.\r\nCoordenador municipal de articulação comunitária\r\nProfessor em diversas Faculdades da disciplina de saúde coletiva e outras','gildaziomoura@gmail.com','10205362833070739'),(506,'Denise Coelho','PARDA','FEMININO','FEMININO','1991-08-27','Sou Denise Coelho, sou  mulher, advogada, tenho 25 anos, sou tutora de 5 gatos resgatos e empreendedora. \r\nEste ano decidi ser candidata a vereadora.\r\nPor quê? Porque acredito que as mudanças acontecem de dentro para fora, por isso desejo ir lá para fazer a diferença!\r\nFarei uma política diferente, mais acessível, transparente e focada nas minorias.\r\nA voz das mulheres, dos jovens, dos LGBTs, dos estudantes, dos pequenos empreendedores e de todos que não têm recebido a devida atenção.\r\nQuero representar você que acredita que Manaus pode mudar para melhor!\r\nMas para isso, preciso de sua confiança e do seu Voto, pois juntos podemos fazer uma política melhor.','deniseecoelho@gmail.com','1262350567158998'),(521,'Pedro Tourinho','BRANCA','MASCULINO','MASCULINO','1981-12-19','Sou médico especialista em Medicina Preventiva pela Unicamp e professor de saúde da família da PUC. Exerci ao longo de 4 anos um mandato de vereador de oposição a Jonas Donizette, com forte atuação na defesa de direitos sociais e contra as opressões. ','tourinhopedro@gmail.com','1528264557198997'),(589,'Marilene Silva','BRANCA','FEMININO','FEMININO','1962-06-10','Sou uma pessoa, que não consigo entender,porque a insistência em discutir gêneros e opções sexuais. É muito mais importante o respeito entre seres humanos e que cada um seja feliz a seu modo.Vejo,muitas pessoas infelizes com as suas aparências do que com ok gostariam de estar vivendo.Acredito que mais vale eu ser feliz comigo mesmo do que um adulto reprimido, causando infelicidade a outras pessoas. Somos pessoas e estamos aki para viver em paz, tanto com nossa cor , credo, ou opção sexual. Hoje tenho dois filhos adotivos e ao qual me fazem muito feliz e dou graças a Deus,por ter tido alguém no meu caminho, que preferiu colocar um filho para adoção do que ter criado aos trancos e barranco.Temos que ter mais politicas publicas de integração entre as pessoas ,para que não venhamos a ter pessoas de caráter sim problemáticos. ','mds.marilene@hotmail.com','1109923679091678'),(670,'Gabriela Muniz Ferreira Giraldi','BRANCA','FEMININO','FEMININO','1977-02-10','formada em Pedagogia pela Universidade São Marcos e em Medicina Veterinária na Universidade Santo Amaro\r\nSou uma profissional dedicada a saúde de cães e gatos há 12 anos, realizo campanhas de castração a preços populares, faço eventos de adoção, e palestras para buscar ajudar as ONG´s e protetoras de animais . Busco ampliar meus trabalhos socais e reduzir o índice de abandono e animais nas ruas\r\n\r\n2014 - Dama Comendadora\r\n2014 - Prêmio Quality Brasil\r\n2014 - Prêmio Latin American Quality Awards\r\n2015 - Prêmio Quality Diamante\r\n2015- Prêmio Referência Nacional e Qualidade Empresarial','GABRIELAGIRALDIVEVETA@GMAIL.COM','1129006847178065'),(674,'Roberto Schneider Seitenfus','BRANCA','MASCULINO','MASCULINO','1980-03-01','Militante desde os 12 anos de idade.\r\n\r\nFilho de Ogum, é militante contra a intolerância religiosa e da frente parlamentar da câmara de vereadores do povo tradicional de matriz africana.\r\n\r\nFoi Presidente do Grêmio Estudantil da escola Paula Soares e conjunto com o CPERS sindicato, travou as principais lutas durante anos, como a ocupação do plenário da Assembléia Legislativa em 1997 onde o Governo entregava a CRT à iniciativa privada.\r\n\r\nFoi da direção nacional da Central de Movimentos Populares - CMP.\r\n\r\nFoi Presidente do Diretório Acadêmico da faculdade de Direito do campus Canoas da UniRitter.\r\n\r\nFoi Conselheiro municipal de Direitos Humanos de Porto Alegre.\r\n\r\nÉ apresentador da Parada de Luta LGBT de Porto Alegre.\r\n\r\nCoordenação das Paradas LGBTs de PoA a mais de 17 anos.\r\n\r\nVocê pode saber um pouco mais sobre sua vida em entrevista concedida ao programa Primeira Pessoa da TVE:\r\n\r\nParte 1- http://youtu.be/qAQXSgufL0E\r\nParte 2- http://youtu.be/VZiiXWMsmHc\r\nParte 3- http://youtu.be/ffgcbnmopmQ\r\nParte 4- http://youtu.be/3AUee4O6sXw\r\n','robertos50250@gmail.com','1668076240173713'),(804,'Thiago Ferreira','PRETA','MASCULINO','MASCULINO','1985-12-17','Sou professor, sindicalista, ecossocialista, negro, gay e milito por justiça sócio-ambiental, direitos humanos, qualidade dos serviços públicos, com ênfase na Educação e, principalmente, pelo combate ao racismo, ao machismo, à LGBTfobia, à Intolerância religiosa, ao capacitismo e opressão de classe.\r\nEm Volta Redonda, sou o único candidato Negro e LGBT que milita pelas causas em um partido que realmente defende o direito das mulheres, dos negros e negras e a população LGBT. Luto pelo nosso empoderamento e para que tenhamos representatividade, visibilidade e voz nas Políticas Públicas Municipais.','thiagoferreirapsol@gmail.com','1215667381822886'),(815,'Carlos Murdoch','BRANCA','MASCULINO','MASCULINO','1964-02-20','Arquiteto e urbanista (UFRJ), Carlos Murdoch é mestre em sustentabilidade aplicada à arquitetura (PROARQ- UFRJ). Co-fundador do Curso de Arquitetura da UNESA, professor convidado de MBAs da FGV (gestão) e UFRJ (economia). Estuda e defende a sustentabilidade urbana desde 1998 através de palestras (TED Talks – ONU Rio+), exposições e artigos.\r\n\r\nMembro de conselhos editoriais de publicações, notadamente “Eficiência Energética em Edificações\" (IAB/Eletrobrás) e revista ESCALA (2002 - 2007). Desenvolve pesquisas que correlacionam a economia ao desenvolvimento de cenários urbanos futuros, que visam a elaboração de estratégias políticas sustentáveis. Sócio do escritório Murdoch & Sodré Arquitetos com foco em concepção e gestão de projetos de diversas escalas pricipalmente com o foco educacional e sustentável.','professor.murdoch@gmail.com','10210507841672025'),(834,'Andre Luis Pianca','BRANCA','MASCULINO','MASCULINO','1973-02-16','Andr~e Luis Pianca, André Contador nascido em Campinas há 43 anos, Contador e Economista, Juiz Arbitral, Juiz de Paz Eclesiástico, Contador Perito, Bacharel Teologia, Põs Graduado em Gestão de Pessoas, MBA em Direito Tributário, Pós Graduação em Planejamento Tributário. líder e Presidente de Associação dos Moradores,  com forte trabalho no voluntariado desde 1990 até 2015, sendo na Religião Católica e Evangélica, Comissário do Juizado de Menores, Ong´s.','andrepianca@gmail.com','1192732854081299'),(843,'Lucia Castro','PRETA','FEMININO','FEMININO','1973-04-21','Lúcia Castro, mulher negra, lésbica, religiosa de matriz africana, jongueira, ativista em movimentos sociais das causas LGBT, é fundadora do grupo Aos Brados. Foi conselheira titular do Orçamento Participativo no seguimento LGBT e participou ativamente da criação do primeiro Centro de Referência LGBT do Brasil, em Campinas, entre os anos de 2001 e 2003. Lúcia mora hoje na região do Ouro Verde e é cientista social pela PUC - Campinas.','negralu-campinas@hotmail.com','10208750707039127'),(861,'Bráulio Lopes','BRANCA','MASCULINO','MASCULINO','1976-01-18','Quem é\r\nContabilista mineiro de 40 anos, trabalhando há mais de vinte anos neste seguimento, vive diariamente junto aos seus clientes o flagelo e o desafio de empreender. Mora no bairro Minaslândia (1º de Maio) desde que nasceu, casado com Pâmela, tendo três lindos filhos Ian, Pietro, Pétrus e uma linda enteada Ana Luiza.\r\n\r\nPor que quer ser candidato\r\nApesar de nunca ter se envolvido com política, identificou-se com os valores e desafios do Partido NOVO, percebendo que é essencial o engajamento para que mudanças sejam promovidas e ocorram em nosso país. Com uma nova força política coerente surgindo em nossa sociedade, pretende contribuir com sua experiência e esperança para um futuro digno, onde o NOVO é o único meio para se alcançar  este almejado \r\n\r\nO que vai fazer\r\nSendo explícita a péssima qualidade dos serviços públicos recebidos pelos cidadãos, trabalhará exaustivamente contra a burocracia que inibe o espírito empreendedor e para a qualificação e aperfeiçoamento de todos os processos envolvendo tais serviços, diminuindo custos e agregando qualidade e excelência aos mesmos. A educação como o maior bem que podemos possuir, deve ser o foco de todo e qualquer candidato. Ao fornecer uma educação pública de qualidade, eliminaremos a necessidade de cotas, prevalecendo assim o mérito.\r\n','contato@brauliolopes.com.br','1231501553537256'),(940,'Cathia Cantusio','BRANCA','FEMININO','FEMININO','1959-05-31','Cáthia Cantusio reside em Campinas há 54 é de Penápolis/SP/Brasil, filha e neta de imigrantes portugueses, estudou música, dança, teatro e mímica no conservatório Odette Motta Raia, entre os anos de 1964 a 1977.  Iniciou suas atividades  politicas/sociais em 1995 com associações assistenciais, e promoter de eventos beneficentes para diversas instituições (COF-cetro de orientação família) - Casa S.Vicente de Paula (Vicentinos) - Pro-menor em Br Geraldo - Cada da Amizade Ilce da Cunha Henry entre outras, e Há 22 anos produzindo no Espaço Cultural Lince Negro (festivais - exposições fotográficas, show, cursos, oficinas e workshops todos voltados p/danças de etnias e p/ a mulher). Deu Inicio a sua carreira profissional como RP em comunicação c/1981 o projeto “A Dança das Pirâmides”. E 1991 relações públicas e assessora cultural da ABAL (Associação Brasileira de Artistas Líricos) onde atuou durante anos.\r\n\r\nProdutora Executiva do CD árabe Oásis lançado em 1998 entre outros que vieram a seguir, colocando músicos até então marginalizados no mercado fonográfico. \r\nCriadora -  Produtora Artística e Executiva do 1. Festival da semana da Cultura Árabe em Campinas e Região, lançado 5/07/1998, estando este ano (2016) em sua 19. edição.\r\nProdutora Executiva e autora do vídeo documentário: O milênio e a mulher milenar - Dez./1999.  (Um FOCO sobre a mulher e a discriminação não somente no mundo árabe como no mundo como um todo). \r\nAutora do Livro: Dança do Ventre ... A arte de ser mulher. – ed. Komedi. – Dez./2003 e de diversos textos ligados a educação feminina, cultural e artística.\r\nFundadora da Cooperativa Cultural Lince Negro desde Abril/2004, para a divulgação da Cultura das danças do Oriente Médio, tendo como carro chefe a história da Dança do Ventre e suas modalidades folclóricas além de outras diversas danças típicas folclóricas do mundo. Usando esta modalidade feminina para resgates das mulheres em casos de risco.\r\nAutora da Serie Calendários Culturais Lince Negro  -  (há 13 anos)\r\nTodos com distribuição gratuita e uma tiragem de 7.mil exemplares por ano.\r\n2013 ... Criadora do 1º Festival de Danças Raízes & Etnias de Campinas (2013)  que esta indo para a 4ª edição\r\n2014 ... Criadora do projeto *Workshops  para Todos * colocando em pratica definitivamente em 2016 provando que estudar Arte e Cultura é para todos sem distinção.\r\n2013 ... Criadora do projeto * Sarau – Quanto vale o Show? ... *Arte Cultura e Solidariedade*    descobrindo novos talentos e divulgando escolas e artistas talentosos (músicos, corais, cameratas, danças, teatro, contadoras de histórias e literatura).  Este ano estando na 4ª Edição.\r\nATENÇÃO: \r\nSendo que todos os projetos de cunho CULTURAL e SOLIDÁRIOS, sempre bancados pela autora e comunicadora, sem qqr apoio politico ou partidário. \r\nComo Fotografa profissional em relatos diversos encontrou  através de suas lentes a miséria, violência,  desilusão,  preconceito e o tormento do homem pela NÂO aceitação do próximo, porem em muitos momentos clicou a fé a natureza e o amor onde encontrou o equilíbrio da humanidade. \r\n\r\n\r\nCáthia vai Lutar por mudanças e acredita que se queremos progredir, não devemos repetir a história, mas fazer uma história nova. Acredita que a Educação e Cultura caminham Lado a Lado, abrindo caminhos para um FUTURO de qualidade com melhores cidadãos responsáveis, com autoridade e escolhas conscientes.','lincenegro@bol.com.br','1180209372017954'),(1066,'Celeste Fernandes','BRANCA','FEMININO','FEMININO','1953-08-23','CELESTE FERNANDES NASCI EM BELO HORIZONTE TENHO MUITO ORGULHO DE MINHA CIDADE ,  SOU PEDAGOGA  E DURANTE  25 ANOS   FUI  PROFESSORA E  DIRETORA  DA   ESCOLA INFANTIL SAÕ  JOSÉ. ATUALMENTE  FAÇO TRABALHOS VOLUNTARIOS,  AUXILIANDO AS PESSOAS  CARENTES QUE A MAIORIA DAS VEZÊS  DESCONHECEM  OS SEUS DIREITOS.  Ó MOTIVO PRINCIPAL QUE ME FAZ  ALMEJAR  O CARGO DE VEREADORA Ê  PARA CRIAR PROJETOS  E LUTAR PELAS CLASSES  DOS PROFESSORES,DA SAÙDE, DA SEGURANÇA,DOSTAXISTAS,TRANSPORTES ,DOS ADOLENSCENTES,DAS CRIANÇAS ,DOS APOSENTADOS,DOS DEFICIENTES,E PELA POPULAÇÃO CARENTE E SOFRIDA.  POIS CONHEÇO BEM OS PROBLEMAS DOS BAIRROS DE BELO HORIZONTE. TENHO ORGULHO DE PODER DIZER E TODOS QUE ME CONHECEM ,SABEM  DO QUE SOU CAPAZ.¨SE VOCÊ NAÔ VIVE PARA SERVIR ,VOCÊ NAÔ SERVE PARA VIVER¨. PODEMOS TUDO CONSTRUIR BASTA QUERER E FAZER MAS PARA ISSO EU PRECISO DE VOCÊ.  DE NORTE A SUL DE LESTE A OESTE, VOTE EM CELESTE FERNANDES.40345. PROMETO NAÔ DECEPCIONA-LOS. VAMOS FAZER DE BELO HORIZÉONTE A MELHOR CIDADE DO BRASIL.','celestefernandes40345@outlook.com','153806808404484'),(1082,'Lucas Miranda Lobato','BRANCA','MASCULINO','MASCULINO','1995-07-15','Sou Lucas Lobato, estudante de economia pela universidade de Taubaté e militante LGBT na cidade. Tenho como plataforma a elaboração de politicas publicas para a população LGBT, reforçar a UNITAU para que os preços sejam mais acessiveis para pessoas de baixa renda, atividades culturais nas periferias entre outras propostas','lucasmlobato@gmail.com','10205783088696462'),(1109,'Renata Cordeiro Guerra','BRANCA','FEMININO','FEMININO','1974-03-21','Meu nome é Renata Guerra, sou advogada e diretora do Instituto Todos com Felipe, que atende a 200 instituicoes carentes em comunidades no RJ. Dentre meus projetos estao: construcao da brinquedoteca no Hospital loreto pra 400 criancas, brinquedoteca no\r\ninstituto Fernandes Figueira e ajuda na construcao da emergencia pediatrica do Inca.\r\n\r\nMeus projetos estão focados em:\r\n\r\nEducação infantil: A falta de creches é a maior responsável pela pobreza. As mulheres já são as mais bem educadas entre os cariocas, mas por falta de lugar apropriado para deixar seus filhos, acabam sem recursos e sem opções.\r\nReformaremos creches ja existentes em auto-sustentáveis e criaremos ambientes favoráveis para que a iniciativa privada construa novas creches.\r\n\r\nInteligência na saúde: A falta de integração entre UPAs, clínicas da família e emergências é um dos principais motivos para a falta de eficiência na saúde do nosso município. Tenho projeto de integração dos sistemas de cadastros dos cidadaos.\r\n\r\nFiscalização: Grande parte do trabalho de um vereador é controlar as contas do município. Meu foco na câmara municipal será garantir que nossos recursos estejam sendo aplicados da maneira mais eficiente possível.\r\n\r\nDiminuição da máquina pública: comprometo-me  a reduzir 50% dos custos do meu gabinete e irei legislar no sentido de que todos os vereadores tenham que fazer a mesma economia. Este movimento, em 4 anos, poderá gerar uma economia de até R$158.400.000,00.\r\n\r\nSaiba mais em renataguerra.net.br\r\nConheça mais sobre o NOVO em novo.org.br','renatacguerra@gmail.com','10153941505822532'),(1116,'Bernardo Pilotto','BRANCA','MASCULINO','MASCULINO','1984-02-17','Bernardo Pilotto é assistente administrativo do HC/UFPR. É sociólogo formado pela UFPR e mestre em Saúde Coletiva pela Unifesp. Começou sua militância política no movimento estudantil da UFPR, onde foi diretor do DCE/UFPR por duas vezes e membro do Conselho Universitário. Em 2006, entrou no HC/UFPR como assistente administrativo e sempre participou dos movimentos de luta da categoria, sendo representante dos técnicos-administrativos no COUN/UFPR de 2009 a 2011. \r\n\r\nFoi fundador do PSOL - Partido Socialismo e Liberdade em 2004 e já fez parte de diversas instâncias do partido, em nível municipal, estadual e nacional.','bernardopilotto@gmail.com','1143710272360978'),(1149,'Fabiano Jacob','BRANCA','MASCULINO','MASCULINO','1969-05-10','Sonho em fazer cumprir a Declaração Universal das Crianças. Sonho com o dia em que animais serão vistos pelos olhos da Lei como VIDAS e não mais como simples objetos! Luto para promover o tratamento humanitário a todos os animais, sem descriminação de domésticos, Domesticados, Silvestres ou Exóticos. Sonho em fazer cumprir os direitos mais básicos dos idosos, um grupo segregado pela sociedade, a começar por suas próprias famílias e pior, por nossos governantes que os desprezam, possivelmente por não mais terem a obrigação do voto.\r\nFui coordenador da Comissão de Defesa do Meio Ambiente e Animais da ALERJ e tenho ampla experiência Legislativa.\r\nAmbientalista premiado nacional e internacionalmente.\r\nSalvei mais de 5.000 animais de situação de tráfico e maus tratos e tive obra social que cuidava da educação de 200 crianças carentes com apoio as famílias.\r\nQuero ser seu fiscal na Câmara dos Vereadores do RJ.\r\nAlgumas de minhas realizações:\r\n– Combate ao Tráfico de Animais Silvestres com operações nas feiras de Caxias, Tijuca, São Gonçalo, Honório Gurgel, entre outras.\r\n\r\n– Salvamento de mais de 3.000 animais em situação de tráfico e maus tratos.\r\n\r\n– Projetos sócio-ambientais junto ao Centro Cultural Vencer na Ilha do Governador.\r\n\r\n– Audiências Públicas na Alerj que geraram um grupo de trabalho que desenvolveu o P.L nº 2428/2009, considerado por várias autoridades do meio como o melhor PL jamais criado para a proteção animal (aguardando votação).\r\n\r\n– Primeiro Simpósio de Proteção Animal da ALERJ.\r\n\r\n– Vistoria no Mercadão de Madureira.\r\n\r\n– Fim do Rodeio de Japeri-RJ.\r\n\r\nE tantas outras ações diárias que continuam acontecendo, mesmo nesse exato momento em que você lê este texto.','fabiano@fabianojacob.com.br','1640340969630124'),(1175,'Flavia Bischain','BRANCA','FEMININO','FEMININO','1985-03-18','Sou professora de Sociologia na rede estadual de SP e moradora da Brasilândia. Sou socialista, e aqui na periferia construo o Movimento Mulheres em Luta. Atuei nas ocupações das escolas estaduais e etecs e no dia-a-dia luto por uma educação pública gratuita e de qualidade, além de organizar atividades aqui na região e nas escolas, de combate ao machismo, racismo e lgbtfobia.','flavinha_baixista@yahoo.com.br','10206616586083583'),(1248,'Luciana Tamburini','BRANCA','FEMININO','FEMININO','1978-12-29','     Oi, eu sou Luciana Tamburini, ex agente de trânsito que foi condenada por trabalhar corretamente e cumprir a lei sem distinção. Eu fui humilhada, coagida e só não sofri um procedimento administrativo disciplinar porque os meus colegas de trabalho não permitiram....lutaram por\r\nMim, assim como outras milhares de pessoas que nem\r\nMe conheciam! Essas pessoas me fizeram voltar a acreditar na humanidade, na solidariedade ! Foram várias pessoas que estenderam a mão ,lutaram, sofreram e torceram junto comigo! Por isso eu tô aqui hoje! Alguns vão dizer que é oportunismo, talvez se eu me calasse seria alienação..eu considero como uma oportunidade! Porque se você não buscar a mudança, vai continuar vendo o que não quer, reclamando e não fazendo nada! Eu não tenho medo de me posicionar, fui criada para ser uma mulher forte e lutar por meus ideais!Sou bacharel em administração, estou terminando o curso de Direito, sou servidora pública e preciso de você pra continuar essa luta junto comigo! Não desista da nossa Pátria! Vote consciente, faça a sua parte, seja a mudança!                                                           ','ltamburini@gmail.com','10153737079130124'),(1316,'Micael Amarante','BRANCA','MASCULINO','MASCULINO','1982-11-20','Eu nasci no Rio de Janeiro, estudei no CEAT, formei-me em direito (inspirado por Gandhi, Vinícius e Mandela) pela PUC e fiz mestrado em Direito Internacional em Amsterdã. Sou advogado pela OAB –RJ. Fui Consultor de Educação Eleitoral para a ONU no Timor-Leste, professor voluntário de inglês para refugiados na Palestina, Consultor ONU para empreendedorismo social em favelas no Rio de Janeiro e co-fundador do coletivo musical ETNOHAUS que participou de inúmeras ocupações artísticas no Rio de Janeiro e em outras cidades. Atualmente sou membro co-fundador do Instituto Agenda de Integração Social que atua como implementador de programa da ONU Mulheres de empoderamento feminino em comunidades do Rio de Janeiro alem de ser musico e compositor da banda Mohandas.','depenasse@yahoo.com','10154515468961704'),(1333,'Rose Cipriano','PRETA','FEMININO','FEMININO','1973-12-24','Sou professora da rede Municipal de Duque de Caxias há 17 anos , trabalho com jovens e adultos  com necessidades especiais.  Faço parte da direção do Sepe Caxias .Fui presidenta do Conselho do FUNDEB fiscalizando a verba do governo Federal. Atuo no Conselho de Promoção da Igualdade Étnica e Racial da cidade. Sempre acreditei na mobilização coletiva  para transformar a estrutura excludente da sociedade, por isso comecei minha juventude militndo no PVNC- Pré  vestibular para negros e carentes.','roseebano@uol.com.br','1072871889498631'),(1400,'Robson Ramos','PARDA','MASCULINO','MASCULINO','1981-06-20','Quem é o Robson Ramos?\r\nUm jovem apaixonado por desafios. Psicanalista, acadêmico, professor, pesquisador e consultor. Iniciou sua trajetória aos 15 anos nos movimentos estudantis, trabalhou no rádio, ONG, comércio, empresário aos 19 anos. Aos 21 anos foi trabalhar na construção pesada onde se destacou chegando a ocupar o cargo de gestor de controle de qualidade. Robson Ramos é um exemplo de superação. Atualmente dar palestras e treinamentos in campany para grandes empresas e multinacionais.\r\n\r\nEm 2012 participou do Prêmio Jovens Inspiradores da revista Veja chegando a ser considerado entre os 100 jovens mais inovadores e criativos do Brasil.\r\n\r\nColabora com projetos solidários em país africanos em parceria com as entidade M.C.C e M.E.P.A em obras assistenciais em creches e escolas profissionalizantes.\r\n\r\nRobson Ramos é diretor presidente do Instituto Inovae que tem como objetivo de potencializar talentos e genialidades.','cafecomideiasenegocios@gmail.com','1809079099310109'),(1408,'Guilherme Jaccon','BRANCA','MASCULINO','MASCULINO','1989-02-01','Guilherme Jaccon é militante das políticas públicas de Cultura na cidade de Curitiba. É Gay, produtor cultural tem como pautas a defesa do Estado Laico, políticas de proteção aos LGBTs, aumento no orçamento da cultura e construção de políticas descentralizadoras da cidade.','guilherme.jaccon@gmail.com','1117028515017964'),(1551,'Gregório Jório Santana','BRANCA','MASCULINO','MASCULINO','1986-08-27','Acabo de fazer 30 anos, sou candidato a vereador pela primeira vez, com poucos recursos e sem apadrinhamento político. Nascido e criado em Niterói, comecei a trabalhar aos 12 anos. Após ingresso na Academia da Força Aérea como cadete-aviador, migrei para engenharia mecânica na UFRJ, onde pesquisei e liderei atividades durante três anos. Nesse período, trabalhei na AIESEC Rio, em uma consultoria de gestão e fundei a SIM Consultoria. Concluí minha graduação em administração pela UFF, onde hoje faço mestrado em administração pública.\r\nHá dois anos, mergulhei na atividade política para dar encontro ao meu desejo de transformação social que é um trabalho que venho desenvolvendo no Observatório Social de Niterói realizando o controle dos gastos públicos no Fórum de Transparência e Controle social da minha cidade. Eu sonho com uma cidade melhor. Eu acredito que pode ser diferente. Acredito numa cidade mais consciente, conectada e transparente. Respeitando toda a diversidade.','gregoriojs@gmail.com','10210213907405633'),(1595,'Sarita Bassan','BRANCA','FEMININO','FEMININO','1980-03-23','Meu nome é Sarita Bassan.\r\n\r\nNasci em Ilha Solteira em 23 de março de 1980.\r\n\r\nSolteira, sou filha do fotógrafo mais tradicional da cidade, Cirilo Rodrigues Filho e da enfermeira aposentada, Maria Sebastiana Bassan (Tianinha) e tenho duas irmãs: a Engenheira Química Drª Karina Bassan e a Engenheira Agrônoma Drª Graciela Bassan. Sou mãe de um garotinho de 7 anos chamado Phellipe, que também nasceu aqui em Ilha Solteira.\r\n\r\nEm 1996, fiz parte da primeira formação da Orquestra Municipal de Ilha Solteira como tecladista, situação que muito me honrou e que hoje, lamentavelmente me entristece por ter chegado ao fim devido à falta de recursos.\r\n\r\nEm 2000, conclui o curso Técnico em Informática pela ETEC de Ilha Solteira.\r\n\r\nMe formei em Letras pela UFMS, graduação em que fui bolsista de Iniciação Científica do projeto ALMS (Atlas Linguístico de Mato Grosso do Sul), de relevância singular no estado de Mato Grosso do Sul. Sou bacharel em Direito pela AEMS e atualmente estou cursando pós-graduação em Educação em Direitos Humanos, também pela UFMS (EaD). Sou monitora no Grupo de Pesquisa e Extensão em Direitos Humanos da AEMS desde 2014, a qual continuo participando. Futuramente, pretendo cursar Ciência Política, pois é uma área em que tenho grande afinidade e apreço. Utilizo a rede social para acompanhar o cenário político nacional, onde também costumo postar e debater assuntos de interesse da população em geral de forma saudável e articulada.\r\n\r\nEm 2013 e 2014 fui membro representante da Comissão de Estudantes formada com o propósito de garantir a gratuidade no transporte universitário municipal, uma vez que cursei as duas faculdades na cidade de Três Lagoas – MS, podendo desfrutar do transporte gratuito em ambas as graduações até a conclusão do curso de Direito no final de 2014.\r\n\r\nSou membro suplente do Conselho Curador da Fundação Educacional Eng. Souza Dias, mantenedora do Colégio “Euclides da Cunha”.\r\n\r\nTrabalho desde 2012 no Departamento de Promoção Social do município de Itapura, onde faço atendimentos ao público que incluem entrevistas sociais para cadastramento no Cadastro Único (Bolsa Família), dentre outras ações focadas na promoção do bem- estar social da população.\r\n\r\nEm julho de 2013, passei a integrar a Diretoria Administrativa da AMAIS (Associação dos Moradores Amigos de Ilha Solteira) como 2ª Secretária, e na última eleição, passei a 1ª secretária, mandato que se estenderá até 04 de agosto de 2017, tendo me afastado para concorrer ao pleito eleitoral. É importante que a sociedade saiba que as ações da AMAIS buscam a maior transparência das ações que envolvem o dinheiro público e tentam resgatar na comunidade o espírito de cidadão participativo. Por isso, apoiamos a redução salarial dos vereadores e continuamos dando prosseguimento ao projeto de iniciativa popular que necessita do apoio de 5% de assinaturas dos 21 mil eleitores da cidade, uma vez que irá gerar uma economia de mais de 2 milhões ao município na próxima gestão. Continuaremos a campanha que está em vias de ser concluída e contamos com o apoio da população para atingir nosso objetivo.\r\n\r\nSou candidata a vereadora pelo Partido Verde de Ilha Solteira que integra a coligação MINHA CIDADE e acredito que Ilha Solteira precisa da força jovem para superar essa crise com bastante garra e convicção!!\r\n\r\nTorço para que mais mulheres reforcem sua representatividade no cenário político local e nacional, de forma a promover o fortalecimento da democracia.\r\n\r\n? Partido Verde ? \r\n\r\nColigação MINHA CIDADE \r\n\r\n#mulheresnapolitica #forcajovem #vamosreciclar #contraacorrupcao ','saritabassan@hotmail.com','10210286515336792'),(1634,'Andre Pomba','BRANCA','MASCULINO','MASCULINO','1964-04-10','André Pomba tem mais de 30 anos de militância e é um dos maiores ativistas urbanos da cidade de São Paulo e vai continuar lutando por toda a cidade, principalmente na degradada região central, como sempre fez em toda sua vida. E também vai trabalhar em prol da cultura, da diversidade, da sustentabilidade e pela noite paulistana.\r\nFundador da ONG Dynamite que já formou mais de 3000 jovens, Pomba atua na base. Também já esteve presente em todas conferências LGBT, de Brasília até nas periferias de Sampa!\r\nMúsico, DJ, rockeiro e produtor cultural: #oPombaÉdoBem #votenopomba43969','andrepomba@hotmail.com','191039234659948'),(1669,'David Michael Miranda','PRETA','MASCULINO','MASCULINO','1985-05-10','De infância pobre, David sentiu na pele o que é viver em uma favela carioca. Aos 13 anos saiu do Jacarezinho para ganhar o mundo. Casado com o jornalista Glenn Greenwald há 11 anos, David enfrentou o preconceito e protagonizou grandes enfrentamentos. Ao lado de Edward Snowden ficou conhecido mundialmente por sua luta em defesa da liberdade na internet.\r\n\r\nEm 2014, esteve com Luciana Gerno mostrando a possibilidade da construção de uma alternativa para o Brasil, democrática e tolerante à diversidade. Com o coletivo Juntos! impulsiona a Casa da Juventude, projeto que mistura ativismo, midialivrismo e produção cultural. Este 2016, coordenou uma campanha contra o fim do programa “Rio Sem Homofobia” e enfrentou o poderoso Grupo Globo ao denunciar sua falsa imparcialidade em artigo no The Guardian. Uma batalha de Davi contra Golias!\r\n\r\nQueremos David Miranda na bancada do PSOL na Câmara dos Vereadores, defendendo nosso projeto coletivo. Juntos podemos fazer a diferença!','amd1144@hotmail.com','1394330853929319'),(1690,'André Miranda','BRANCA','MASCULINO','MASCULINO','1972-05-01','Biografia\r\n\r\nSoteropolitano, 44 anos, casado e pai de três filhos. Bacharel em Educação Artística, especialista em Design e Internet, Pós-Graduando em Comunicação em Mídias Digitais pela Estácio de Sá e em Marketing Político e Mestrando em Educação pela Uma (Portugal). Sou Professor. Fui Analista Técnico/Instrutor do SENAI, Bahia onde tive a oportunidade de viver localmente a realidade das comunidades de diversos municípios e de que forma eu poderia ensinar as técnicas que aprendi para fomentar mais renda às comunidades e consequentemente melhorar a qualidade de vida dos mesmos. Fui chefe de gabinete do município de Senhor do Bonfim, Bahia. Esse sim, foi meu maior desafio! Passei a compreender melhor como as leis e a administração municipal funcionam. Sou Presidente do Partido Verde de Senhor do Bonfim, Bahia.\r\n\r\nO que defendo\r\n\r\nTransparência nas ações, mandato colaborativo, maior participação da juventude na política, mais investimentos na Educação, política apartidária, igualdade perante as leis, setor público mais eficiente.','andreluismiranda@msn.com','1824019531164063'),(1757,'Sara Azevedo','INDÍGENA','FEMININO','FEMININO','1985-08-25','Mulher, lésbica, Professora da rede pública estadual, atualmente preside o PSOL-MG e pré candidata a vereadora pelo PSOL-BH. Militante e uma das fundadoras do coletivo de juventude Juntos! e coordenadora da Rede Emancipa de Cursinhos Populares.\r\nSara é uma de nós!','sara@juntos.org.br','10154387422335549'),(1763,'Ana Carolina Alencar Nunes','BRANCA','FEMININO','FEMININO','1979-04-30','Moradora de Franco da Rocha, Carol é arquiteta e urbanista, casada e mãe de 3 filhos.\r\nDesde 2004 atua na área de habitação e de desenvolvimento de projetos sociais. Já foi presidente do Conselho Municipal de Habitação e coordenadora de projetos sociais em diversas ONGs.\r\nComo Diretora de Habitação do Governo Kiko em Franco da Rocha, esteve à frente do maior programa habitacional realizado em nossa região, com a construção de 1160 unidades do Programa Minha Casa Minha Vida e a entrega de 224 unidades na Vila Palmares.\r\nJunto com o Kiko foi responsável por uma verdadeira revolução na política de desenvolvimento urbano, com a regularização de imóveis, o mapeamento das áreas de risco e a revisão do Plano Diretor.\r\nTambém atuou na área de meio ambiente com a implantação do projeto piloto de coleta seletiva de lixo.\r\nQuer defender na Câmara Municipal políticas publicas de habitação, de desenvolvimento urbano sustentáveis e sociais.','anacanu@yahoo.com.br','1128025917277867'),(1772,'Ewelyn Pureza','PARDA','MASCULINO','MASCULINO','1985-04-19','ALEX DA ROCHA RODRIGUES, 31 anos de idade, ambientalista.\r\nEstudou no São Francisco Xavier, colégio este onde iniciou sua militância junto ao Movimento Estudantil, atuando no \r\ngrêmio da respectiva instituição. É membro do conselho diretor do IFPA - Campus de Abaetetuba, representando os \r\nestudantes egressos, cursa Engenharia Ambiental na IESAM. \r\nAtuou profissionalmente na iniciativa privada e na gestão pública nas esferas federal, estadual e municipal (INCRA, \r\nSETRAN e SEMOB). Participa de Associações de bairros e Conselhos Municipais, defendendo as bandeiras de luta \r\nda juventude, mulheres, diversidade e do acesso à moradia. \r\nÉ filiado e dirigente do Partido dos Trabalhadores (PT - Abaetetuba), tendo uma trajetória política com grandes \r\nmarcos, engajando-se em lutas em defesa do campo e da cidade. ','alexrochavereador13@gmail.com','710940145722886'),(1906,'Sofia Cavedon','BRANCA','FEMININO','FEMININO','1963-08-02','Eleita para mais um mandato pelo PT, a professora Sofia Cavedon define o seu mandato como de combate, sintetizado na luta pelo Direito à Cidade e à Cidadania versus a cidade mercadoria.\r\nNa presidência da Câmara, em 2011, Sofia baixou nas comunidades, subiu nos ônibus, circulou nas escolas, movimentou a cultura popular e a produção local – “contrapondo-se ao culturalismo de mercado” - para criar consciência do processo em curso, empoderar a cidadania e apoiar a resistência.\r\nA reeleição do seu mandato tem o compromisso de fortalecer o movimento de reação que se organiza, desde os bairros populares à classe média critica, que percebe o destino nefasto de uma cidade que não consegue construir paz e sustentabilidade, fruição e fluidez, se continuar sendo um grande negócio a serviço da acumulação de riquezas e privilégios.\r\n\"Acreditamos na mudança pela luta e mobilização popular. Estamos sempre alerta contra a injustiça, a corrupção e políticas que aprofundem a desigualdade.nosso mandato é de enfrentamento desta lógica, de empoderamento popular, de construção de cidadania!\" - Sofia Cavedon/PT','vereadorasofia@gmail.com','10154514685398498'),(1938,'Nika Bressane','PARDA','FEMININO','FEMININO','1990-08-29','Tenho 26 anos e, como descrito na página #MeRepresenta, sou candidata pelo PMDB, porém, por ser de uma cidade com apenas 100 mil eleitores, cujos partidos perdem facilmente seus ideais. Infelizmente o partido não me representa, mas meus ideais sempre foram a favor dos Direitos Humanos. Eu luto pelo espaço da mulher na política, pelos direitos LGBT, pela igualdade racial e de gênero. Minha descrição sobre mim é: empática. Procuro, em todos os momentos, desconstruir meus preconceitos ainda existentes. ','nibressane@gmail.com','10211135546930501'),(2120,'Thiago Saraiva','PRETA','MASCULINO','MASCULINO','1995-08-15','','thiagosarayva@gmail.com','253137185087731'),(2141,'Henrique Rosseti','BRANCA','MASCULINO','MASCULINO','1968-04-10','Olá! Eu sou Henrique Rosseti, também conhecido como Henrique PUNK!\r\nNasci em 1968, na maternidade Gota de Leite, filho do dito Sergio poeta (Sergio Rosseti) com Maria Aparecida. Tenho 2 filhos que amo Jacqueline (27)e Luca(5 meses) e 9 irmãos. \r\nTive uma infância bastante difícil, vendia limão e engraxava sapatos quando criança, cheguei a passar fome e receber auxílio do governo para estudar, pois a vida era bastante dura; minha mãe precisava lavar roupas para fora para conseguir sustentar os filhos. Ela me ensinou os bons princípios e valores da vida (não fazer coisas erradas e jamais desrespeitar o próximo). Tive uma base familiar muito forte e positiva, apesar das dificuldades financeiras.\r\nSempre batalhei muito para sobreviver e nunca me deixei abater pelas dificuldades. Posso dizer com clareza que sou um resiliente, pois passei por situações bastante difíceis no passado e consegui aprender com estas, tirar lições de vida e consegui vencer, driblando as adversidades.\r\nConsidero-me sim um vencedor, tenho meu trabalho que amo e trabalho com o coração, pois é assim que sei fazer! Tenho amigos por todos os lugares onde passo pela cidade, sou um cara simples, gosto de coisas simples, gosto do ser humano, gosto de trabalhar com as pessoas e para as pessoas.\r\nGraças a Deus não tenho inimigos! \r\nAmo minha cidade, onde nasci e fui criado, e movido por esta paixão por Araraquara e por amor ao ser humano, quero poder contribuir mais do que atualmente faço em meu trabalho, quero poder ajudar mais minha cidade e os moradores de Araraquara!\r\nSobre minha história ainda, na adolescência me envolvi no movimento PUNK, chegando a ser cronner da banda FUNERAL; e lá se foram anos de luta a favor do punk, do rock e do punk rock. A funeral participou de diversos festivais, inclusive na MTV, foram anos de estrada por aí com a banda.\r\nJá adulto em 1993 montei o ESPAÇO ALTERNATIVO, um sebo que até hoje está em funcionamento e faz sucesso no meio daqueles que gostam de antiguidades e peculiaridades. Hoje em dia esse sebo é administrado pela minha filha Jacquelline.\r\nFui fundador do Sindicato Têxtil de Araraquara.\r\nCriei o antigo Seresteiro bar, que depois se transformou o Alternativo Bar (na Praça Pedro de Toledo), onde comecei a apoiar bandas de garagem e organizar festivais de rock. \r\nEm 97 criei a primeira rádio comunitária de Araraquara, a \"ATIVA FM\" em conjunto com o Zé Pedro Antunes, professor da Unesp, uníamos a cultura da universidade com a periferia, fazíamos muitos eventos sociais, e coletávamos alimentos e assim ajudávamos as instituições de caridade.\r\nFui sócio proprietário do primeiro Pub de Araraquara o PUB Alternativo CAIBAR.\r\nAtualmente sou proprietário do Espaço Cultural Arte e Bola, onde busco incessantemente incentivar toda e qualquer manifestação artística na cidade; apoiando artistas diversos, tanto de Araraquara quanto de toda região. \r\nCada vez mais o Arte e Bola vem se destacando na noite Araraquarense, isso por ser um espaço alternativo e descontraído que promove a arte em geral. Todo mês no Arte Bola acontece o evento \"noite das Divas” onde cantoras talentosas em início de carreira em parceria com renomadas cantoras da cidade apresentam-se em memoráveis shows; outro famoso evento que é anual no espaço arte bola é o “Zombie Walk Caminhada dos Mortos\", onde as pessoas vestem-se a caráter semelhantemente ao halloween day nos EUA; \r\nO “Araraquara Punk”, festival anual de bandas de garagem que dão oportunidades as novas bandas que estão iniciando no cenário musical.\r\nProcuro na maioria dos eventos que realizo no Arte Bola ajudar a comunidade, cobrando apenas 1 kg de alimento ou 1 kg de ração, e assim fazendo doações para ajudar pessoas que carentes e ONGs de animais.\r\nHoje minha bandeira no Arte Bola são as manifestações artísticas em geral, pois são essas que alegram e \"dão cor\" a diversão e noite de meus clientes/amigos.\r\nSou também um dos promotores do projeto \"Nossa Feirinha do Parque\" que está acontecendo mensalmente no parque infantil. Estou engajado nesse projeto que abre espaço para vendas de produções artesanais e têm como objetivo integrar pessoas, difundir produtos e arte no Parque. A feira foi criada por artistas em geral, colecionadores de vinil juntamente com a Associação amigos do parque. E é com muita alegria que posso dizer que a feira está sendo um grande sucesso!\r\nAinda sobre minha vida profissional, recebo constantemente convites para realizar meu trabalho em outras cidades, o que me deixa lisonjeado, mas não me convence, pois minha vida e raízes encontram-se na cidade que amo, juntamente ao lado de meu grande alicerce que é minha família e de meus queridos amigos (que, diga-se de passagem, são muitos, graças a Deus!).\r\nE sem vaidade digo que tudo que faço, faço com raça, com empenho, com vontade e amor. Os que me conhecem, estão aí para não me deixar mentir. Sou muito PUNK para fazer e acontecer no meu trabalho! E é assim, dessa forma que quero continuar, e poder contribuir com meu povo Araraquarense! \r\nSei que tenho muito a ajudar Araraquara a crescer. Quero lutar como sempre lutei em minha vida e sempre venci, fazendo o melhor para meu povo no que for necessário, seja na saúde, na educação, nas necessidades da comunidade em geral. Procuro constantemente superar obstáculos, e é exatamente dessa forma que irei trabalhar em prol da minha cidade e meu povo, dando sempre o melhor de mim! \r\nEu e você juntos somos mais fortes, venha comigo e vamos fazer nossa cidade evoluir e crescer com honestidade, transparência, luta, amor e muita garra!\r\n\r\nPaz para todos nós!!!!','Henriquepunkro7@gmail.com','1261966827149268'),(2183,'Alonso Bonfim','PARDA','MASCULINO','MASCULINO','1950-09-22','Natural de Tupã, Estado de São Paulo, 65 anos. Meu primeiro emprego na Indústria de Papel foi na Companhia Melhoramentos em 1971, mesma empresa onde aposentei. Ingressei no sindicalismo em 1989, como Secretário de Finanças. Em 1994, assumi a Presidência da Entidade e estou no quinto mandato consecutivo, sendo o primeiro a obter tal conquista, sempre lutando com muita garra, força e determinação para o bem estar do trabalhadores. Também abrangemos os aposentados do setor de papel, proporcionando: plano de saúde, materiais ortopédicos, fraldas e transporte particular para hospitais e clinicas. Em minhas gestões construímos um clube de campo com 1200 metros onde possuímos, quadra poliesportiva, campo de futebol, 2 piscinas e espaço para lazer com churrasqueira. Estamos inaugurando a nova sede do sindicato em caieiras, uma grande obra de um prédio de 3 andares, com um salão na cobertura onde os associados terão o direito de locação para alguns eventos, uma obra que veem sendo programada por 10 anos e ano passado colocamos em pratica. Também sou secretário-geral da Federação do Mercosul (FESPAM) e da Federação do Papel de São Paulo, tendo atuado como Classista na Justiça do Trabalho em Caieiras e São Paulo. Fiz vários cursos na área de formação sindical.','alonso.bonfim@terra.com.br','1076685472438265'),(2198,'Caio Dezorzi','BRANCA','MASCULINO','MASCULINO','1982-05-14','Professor, dirigente da Esquerda Marxista (seção brasileira da Corrente Marxista Internacional), Caio Dezorzi ajuda a impulsionar a Frente Povo Sem Medo e o movimento pelo FORA TEMER. Começou atuando no movimento estudantil, foi diretor de Grêmio nos anos 90, diretor do Diretório Acadêmico Manuel Bandeira, do IA-Unesp a partir de 2000, do DCE da Unesp/Fatec e da UEE-SP. Depois foi conselheiro da Apeoesp.\r\n\r\nMilitante do Movimento das Fábricas Ocupadas, apoia a luta da fábrica ocupada Flaskô pela estatização sob controle operário. Militante pelo Passe-Livre estudantil desde 2000, participou ativamente das Jornadas de Junho de 2013, e como professor apoiou ativamente o movimento de ocupação de escolas pelos estudantes secundaristas.\r\n\r\nCom duas filhas nascidas através de partos naturais, junto com sua companheira Isabela Penov, tornou-se ativista contra a violência obstétrica e pelo direito ao parto humanizado.\r\n\r\nUm internacionalista, ajudou a impulsionar a campanha pela retirada das tropas do Haiti e a campanha em solidariedade à revolução venezuelana “Tirem as Mãos da Venezuela”. É também um militante da causa palestina e contra a guerra na Síria.','caiodezorzi@gmail.com','10210652556610951'),(2276,'André Barros','BRANCA','MASCULINO','MASCULINO','1966-04-26','André Barros, 50 anos, carioca, advogado, mestre em Ciências Penais, entrou na Comissão de Direitos Humanos da OAB/RJ em 1989, onde foi delegado, membro, Secretário-Geral e Vice-Presidente até junho deste ano. É membro do Instituto dos Advogados Brasileiros. Seu pai foi cassado e sua tia, Vera Silvia, foi torturada e banida do país pela ditadura militar. Vera passou-se por sua babá quando tinha 3 anos, a fim de realizar o levantamento do sequestro do embaixador norteamericano Charles Elbrick em 1969. Desde muito jovem, militou nas lutas pela redemocratização do Brasil. Participou ativamente do movimento estudantil e foi membro da Exscutiva Nacional dos Estudantes de Direito. Faz política na rua desde 1985. É ativista da luta pela legalização da maconha, tendo sido um dos advogados que fez a representação ao Supremo Tribunal Federal que garantiu a realização da Marcha da Maconha em todo o país.','advandrebarros@gmail.com','1118584958248824'),(2290,'Cláudia Regina Mallmann','BRANCA','FEMININO','FEMININO','1986-08-26','Feminista, socialista, artista, mãe de dois filhos, sou graduada em Ciências Sociais pela UNIOESTE, e fui professora na rede pública. Sou militante do PSOL e pretendo dar voz aqueles que são historicamente excluídos das decisões políticas da cidade. Para assim atuar na construção de uma sociedade mais justa, humana, igualitária e plural.','claudiamallmann@gmail.com','10210831896342446'),(2377,'Tete Oliveira','PRETA','FEMININO','FEMININO','1992-02-18','Candidata à vereadora de Bauru, pelo PSOL. Nossa luta e programa tem as mulheres, as negras(os), as LGBTs e as trabalhadoras(es) como prioridade.\r\n\r\nConfira nossa página no face: https://www.facebook.com/TeteOliveiraBauru/?fref=ts','Te_the_oliveira@hotmail.com','10207849808023924'),(2385,'Rodrigo Caetano','BRANCA','MASCULINO','MASCULINO','1975-06-21','Sou filho de Funcionários Públicos, tenho 41 anos de idade, sempre estudei em Escolas Públicas, me formei em Ciências Jurídicas pela UNIP. Sou filho de Funcionários Públicos, sou Servidor Público concursado a 21 anos, prestei serviços por 4 anos na Secretária Municipal de Comércio, Industria, Serviços e Turismo e 3 anos na Sanasa.\r\nTenho experiência e conhecimento sobre o Setor Público, por isso quero ser a diferença na Câmara Municipal de Campinas e realmente trabalhar para a população de Campinas. Precisamos de renovação, de ideias novas, de gente nova. Precisamos acabar com a “Profissão Política”, não deve existir carreira política, devemos lutar pelo fim da Reeleição.\r\n','rodrigo.caetano@me.com','10154613697868514'),(2391,'Flávio Oliveira Bezerra','PARDA','MASCULINO','MASCULINO','1981-01-19','Flavio Bezerra é trabalhador da área de enfermagem e advogado, morador do bairro de Presidente Altino. Flávio é candidato a vereador, porque acredita que a situação de exploração e corrupção que vivemos em nossa cidade e no país mudará somente quando os trabalhadores tomarem os rumos da politica.\r\n\r\nMilitante do PSOL, partido que se negou a seguir os caminhos da política tradicional no Brasil e se opõe ao governo golpista de Temer que deseja acabar com os direitos sociais, mas que também não poupa críticas aos anos de acordo dos governos petistas com os partidos conservadores. Somos o único partido que defende uma reforma política que enfrente os interesses econômicos! Temos moral para cobrar as investigações, pois não temos nenhum investigado. Não temos rabo preso com velhos governos e empresas! Por isso denunciamos do bandido Eduardo Cunha no Congresso Nacional. A Câmara Municipal de Osasco é um triste exemplo da política tradicional, basta ver a repercussão dos casos de nepotismo, grande quantidade de cargos comissionados e má utilização de recursos públicos.\r\n\r\nEm Osasco, Flávio esteve na linha de frente na luta contra o ROUBO diário que é o preço da passagem de ônibus, pela implementação do bilhete único e para abertura dos contratos prejudiciais à população. Na educação, Flávio apoiou a luta contra o fechamento de escolas promovido pelo governo Alckmin e derrotado pelos estudantes.\r\n\r\nFlávio Bezerra na câmara municipal é afirmação de compromisso com a independência e a ética para defender os direitos da população e a luta por serviços públicos de qualidade.\r\n\r\n','flavio_oliveirabezerra@yahoo.com.br','1457026940980580'),(2403,'Wilton Vital','BRANCA','MASCULINO','MASCULINO','1991-03-14','Formado em Administração, Arte Dramática e Informática, Wilton mantém uma escola gratuita em Araraquara com cursos de artes e humanidades. Apresenta um programa de televisão onde entrevista artistas e personalidades da cidade, é empresário, produtor cultural e membro do conselho de diversidade sexual.','wilton@wiltonvital.com','10207202445248830'),(2450,'Djalma Nery','BRANCA','MASCULINO','MASCULINO','1987-08-06','Graduado em Ciências Sociais, aluno de pós-graduação do programa de Ecologia Aplicada da USP. Educador ambiental, social e popular; professor de sociologia e permacultura. Djalma Nery tem acompanhado e proposto diversas políticas públicas (ambientais, sociais, administrativas, etc) para melhoria de seu município e de municípios vizinhos. Fundador de uma entidade ambientalista em São Carlos chamada Veracidade (estação de permacultura urbana), há anos vivencia e apresenta outras possibilidades sociais e de relação com a terra e com as pessoas: tem estimulado a prática de hortas comunitárias, compostagem e outras tantas técnicas de sustentabilidade a partir de aulas, encontros, oficinas, etc, além de produzir vídeos e materiais de incentivo à essas ações.','faladjalma@gmail.com','10208023819408176'),(2457,'Geane Barbosa','PARDA','FEMININO','FEMININO','1975-10-08','\r\n\"Sou Geane Barbosa, tenho 40 anos de idade, casada e mãe de dois filhos. Sou administradora de empresas e psicóloga e resido no bairro do Retiro.\r\n \r\nDeixei a casa dos meus pais com 18 anos e fui caminhar com minhas próprias pernas, aprendendo muito com minhas escolhas, com meus erros e acertos. \r\n \r\nMinha experiência profissional foi desenvolvida em Gestão de Pessoas, na qual atuei por dez anos e, há cinco, venho me dedicando a ser mãe em período integral.\r\n \r\nFui fundadora do PEAC, Projeto Encaminhado uma Ação Cidadã, cujo objetivo era integrar a universidade na vida da comunidade e também atuei como voluntária do Greendacc e o do Gav (grupo de apoio a vida).\r\n \r\nAtualmente faço parte do grupo CompostAção, o qual pretende levar o conhecimento de compostagem a cada residência de Jundiaí, pois precisamos começar a cuidar dos resíduos que produzimos. Cada um de nós deve ser responsável por ações que cuidem do planeta.\r\n \r\nHoje, como candidata a vereadora desta cidade, acredito na renovação e na mudança da forma de se fazer política. Uma política que ajude as pessoas a serem mais felizes. Uma politica onde ações são tomadas para o bem de todos, ou não faz sentido.\r\n \r\nVamos fazer política juntos, buscando a igualdade de direitos.\r\n\r\nPor um mandato participativo, popular e transparente.','geanecleia@gmail.com','336810396659224'),(2590,'Paulo Roberto Bufalo','BRANCA','MASCULINO','MASCULINO','1967-05-23','Paulo Bufalo é um atuante vereador em Campinas, eleito em 2012 com a 5ª maior votação na cidade.  É professor de escola pública no Centro Paula Souza, formado em engenharia e mestre em Educação. \r\nMilitante das causas populares foi coordenador do Fórum Municipal dos Direitos da Criança e do Adolescente. Na Câmara, combate toda forma de preconceito, defende o Estado laico e democrático e exerce fiscalização intensa da Prefeitura, doa a quem doer. \r\nVem enfrentando os projetos que visam reproduzir na cidade o dogmatismo da chamada \"escola sem partido\" como o que proíbe o debate de gênero e orientação sexual nas escolas e o que inclui a disciplina de moral e cívica no currículo da educação pública. Além disso, denunciou contratos superfaturados da merenda escolar, os funcionários fantasmas do atual governo, o grande número de comissionados e o mau uso do dinheiro da educação pública.\r\nÉ do PSOL, um partido que não é investigado em nenhum escândalo de corrupção.','paulobufalo@uol.com.br','336579686675164'),(2596,'Áurea Carolina','PARDA','FEMININO','FEMININO','1983-11-20','Áurea Carolina é ativista de lutas feministas, negras e juvenis, educadora popular e cientista política. Sua história de engajamento foi construída nas ruas, em diálogo com movimentos que defendem os direitos humanos e a justiça social. \r\nÉ uma das fundadoras do Fórum das Juventudes da Grande BH. Participa da movimentação Muitas pela Cidade que Queremos e do coletivo Pretas em Movimento.\r\n','aureacarolinax@gmail.com','10154521110637232'),(2617,'Cabessa Pe','PARDA','MASCULINO','MASCULINO','1983-07-14','','deyversonf@gmail.com','1177158369022499'),(2637,'Luiz Paulo Gama','PRETA','MASCULINO','MASCULINO','1995-04-12','Militante no movimento LGBTS e movimento Afro, lutando por um espaço na sociedade.\r\n\r\nPresidente do PSDB DIVERSIDADE\r\nPresidente do TUCANAFRO\r\n','luizpaulogn@gmail.com','10202244526590426'),(2679,'Bruno Coitinho','PARDA','MASCULINO','MASCULINO','1988-04-04','Servidor público municipal e morador de Campo Grande, Bruno Coitinho atua há alguns anos na luta dos Auxiliares de Controles de Endemias da Prefeitura do Rio. \r\n\r\nSua luta não começou hoje, Bruno Coitinho sempre trabalhou por melhorias para a Zona Oeste, seja dentro dos movimentos do Centro Universitário Estadual da Zona Oeste (UEZO) onde estuda, seja de dentro da área da Saúde, onde trabalha ou mesmo em atuação independente onde cobra dos gestores melhorias para a região. ','bruno.pereira1988@gmail.com','1163045363759291'),(2692,'Antonio Biagio Vespoli','BRANCA','MASCULINO','MASCULINO','1965-10-16','Toninho Vespoli está em seu primeiro mandato como vereador de São Paulo, tendo assumido o cargo em 2013. É atualmente o único parlamentar do PSOL na Câmara e candidato à reeleição. Ao longo de sua trajetória, Toninho ficou reconhecido por ser um político coerente, que atua ao lado dos movimentos populares e não de grandes empresários.','toninhovespoli@gmail.com','1785094031737558'),(2708,'Fabiana Martins','PRETA','FEMININO','FEMININO','1995-07-05','Olá sou a Fabi, tenho 21 anos e atuo nos movimentos sociais desde os 16 anos. Fui presidenta da UMES, hoje sou conselheira de cultura popular e presido a União da Juventude Socialista. Sou negra e bissexual, o que me faz protagonizar a luta pelo estado laico e pelo respeito aos direitos humanos.\r\n','nuncadigasempre@hotmail.com','1210830245635890'),(2919,'Deotti Daniel','BRANCA','MASCULINO','MASCULINO','1998-02-15','','cuidadoperigo4@gmail.com','1139740946116973'),(3121,'mário','PRETA','MASCULINO','MASCULINO','1963-01-19','Natural da capital baiana de Salvador, Hamilton Moreira de Assis nasceu em 1963 e é pedagogo. Iniciou sua vida política como militante em associações de bairro da sua cidade natal e foi filiado ao PT por 23 anos antes de entrar para o PSOL em 2005.\r\n\r\nHamilton já foi presidente estadual do PSOL, e em 2010 foi candidato à Vice-Presidência da República na chapa de Plínio Arruda Sampaio. Em 2012 concorreu à Prefeitura de Salvador, mas não obteve a vitória com os 33.650 votos alcançados.','hamassis@yahoo.com.br','10201909259330205'),(3147,'Marco Beletti','BRANCA','MASCULINO','MASCULINO','1958-09-07','Marco Beletti, engenheiro civil, sabe que com a somatória de ideias se resolve diversas situações de maneira mais equilibrada. Busca soluções que combinem a técnica, a lei, a praticidade e a satisfação de todos os cidadãos. Homem sem preconceitos, que respeita a individualidade de cada um e valoriza a família, pois sabe que ela é a base da sociedade.\r\nVai defender na Câmara:\r\n- Mobilidade Urbana\r\n- Meio ambiente e sustentabilidade \r\n- Otimização das obras públicas \r\n- Maior incentivo ao terceiro setor\r\n- Maior apoio ao esporte\r\n\r\n','marcobeletti@hotmail.com','1217421334945857'),(3165,'Luciana Martins','BRANCA','MASCULINO','MASCULINO','1967-05-23','\r\n','lucianamartins02@yahoo.com.br','1120299461397678'),(3186,'Cibele Ferreira','PARDA','FEMININO','FEMININO','1989-02-22','Tenho 27 anos, sou ativista feminista, funcionária pública municipal e candidata a vereadora.','cibeleaof@gmail.com','1096965053714637'),(3281,'Chrystian Silva','PARDA','MASCULINO','MASCULINO','1974-07-05','Nascido em Colorado, Pr; vim para Maringá mto cedo. Sou funcionário da UEM desde 1995. Acadêmico de História. Viúvo desde 2010. Participei por favor duas gestões do Conselho Universitário da UEM, tb estive três gestões na diretoria da AFUEM (Associação dos Funcionários da UEM) e três gestões do SINTEEMAR.  \r\nFui membro da Fanfarra do Colégio Estadual Branca da Mota Fernandes; autor da exposição de trabalhos a bico de pena \"Assim na Terra como no céu\", realizada no Museu da Bacia do Paraná em Maringá, no ano de 2005.  Autor das noveletas noir \"O homem de olhos tristonhos\" e \"Desvios de conduta\"; de \"Micrônicas de essências e formas\" e presente em duas coletâneas em inglês da editora Poetry.com com meu nome civil:Chrystian R. Silva.\r\nVivo com meus filhos que miam e meus filhos que latem (todos resgatados).','ursomalvado@gmail.com','1290920634252572'),(3311,'Bárbara Barros Botega','BRANCA','FEMININO','FEMININO','1984-10-18','Pós graduada em Direito, estudei também Ciências Sociais na UFMG, hoje trabalho como advogada e tenho uma empresa de logística jurídica que presta serviços à escritórios de advocacia e empresas.\r\n\r\nSou candidata a vereadora pelo NOVO, um partido que não se coligou com nenhum outro partido por entender que nenhum deles tem a isonomia e histórico ético e moral alinhados com nossos valores e princípios.\r\n\r\nA minha candidatura está basilada exatamente por princípios inegociáveis. \r\n\r\nGestão eficiente, fiscalização rigida dos atos do executivo. Sempre atentas à competência legal do papel do vereador. Pautas prioritárias. Gabinete enxuto. Fim de privilégios. \r\n\r\nÉtica e coerência.','barbarabarrosbotega@hotmail.com','10153930019458733'),(3339,'Mari Tamari','PRETA','FEMININO','FEMININO','1985-04-09','Talíria Petrone é professora de história, mestranda em serviço social e desenvolvimento regional, estuda o papel das mulheres nas lutas urbanas. \r\n\r\nAs salas de aula sempre foram espaço de resistência e construção de um outro mundo. Bem como as ruas, de onde não se furta a estar para lutar pela ampliação do direito das mulheres, contra o genocídio do povo negro, por uma educação libertadora e de qualidade, em prol da saúde pública e de uma cidade de direitos. \r\n\r\nÉ militante do PSOL, hoje na direção estadual do partido e parte dos setoriais de mulheres e de negras e negros. Militante socialista, negra e feminista.','mari.tamari@gmail.com','10154619260302608'),(3391,'Dani Santana','PRETA','FEMININO','FEMININO','1987-07-29','Mulher, Jovem e Negra, nascida e criada no Subúrbio de Duque de Caxias, militante do movimento social, atuo na defesa e na promoção de direitos das minorias. Construí o primeiro plano de combate ao extermínio da juventude negra, contemplada com a medalha Zumbi dos Palmares e coordenadora de Juventude.','Danisantana12355@gmail.com','1018078348291341'),(3628,'Viviane Modesto','PRETA','FEMININO','FEMININO','1965-02-14','Eu defendo a política pública para corrigir as fslhas na saúde e segurança e unirmos educação,cultura e lazer.fazer uma política a favor das mulheres e contra o racismo aos negros.','latresta@hotmail.com','950076845102259'),(3640,'Álvaro Denny','BRANCA','MASCULINO','MASCULINO','1962-12-27','Com tantas coisas que acontecem na política desde sempre, é comum ficarmos desesperançosos e perdidos. A mudança, porém, só acontece quando a população utiliza seu voto para fazer a diferença. Precisamos começar a partir da nossa cidade, analisando os políticos e suas propostas, para fazermos o Brasil e o mundo que queremos viver.\r\n\r\nEu e minha família sempre estivemos envolvidos com o cenário político de Indaiatuba. Minha mãe, Dalva Denny, sempre esteve envolvida com diversos trabalhos sociais como o Funssol e, junto com meu pai e amigos, fundou a Associação dos Aposentados de Indaiatuba. Atuei 28 anos em grandes empresas, na área de manutenção e há 6 anos administro condomínios. Isso me proporciou uma vasta experiência no relacionamento com pessoas e resolução de diversos tipos de problemas, o que considero qualidades essenciais e que faltam no cenário político hoje. \r\n\r\nAgora almejo uma oportunidade de trabalhar para Indaiatuba, modificando a relação que a população tem com a política. É preciso ter uma política que atue por uma sociedade mais justa, transparente e que vise o bem-estar das pessoas. \r\n\r\nSe tornar vereador em Indaiatuba é uma grande meta e espero que com o seu apoio possamos atingi-la. Exponho algumas das minhas propostas abaixo. Gostaria que você analisasse as nossas ideias e desse sua opinião. A eleição agora define qual projeto teremos para Indaiatuba e é muito importante a sua participação, com o entendimento e sugestões. \r\n\r\nCaso você concorda com essas ideias e acha que Indaiatuba pode ser mais com elas, gostaria do seu apoio! Curte e compartilhe! Meu número é 15051. Há braços!','alvaroadenny@bol.com.br','1204540746275309'),(3739,'Eva Cordeiro','PARDA','FEMININO','FEMININO','1974-09-19','Economista, Professora Universitária, ativista do empoderamento feminino e da humanização do parto e nascimento. Mãe de um casal de filhos, acredito que é preciso se posicionar para tecer uma nova política que vise o coletivo e não o favorecimento de pequenos grupos.','Cordeiro.eva@gmail.com','10210396357290604'),(3746,'Nick Scherer','BRANCA','MASCULINO','MASCULINO','1991-06-20','NICK SCHERER É ATIVISTA SOCIAL, FORMADO EM DIREITO E CANDIDATO A VEREADOR EM ESTEIO/RS, NA LUTA POR LIBERDADE, IGUALDADE E JUSTIÇA É #NICK13020 POR #MAISESTEIO ?','nicolas_scherer@hotmail.com','1467290803299707'),(3763,'Pablo Scherrer','BRANCA','MASCULINO','MASCULINO','1988-03-21','Conheça as ideias e projetos do Pablito e acompanhe a sua vida política. Curta: facebook.com/VereadorNecessario','pablo@outlook.com.br','1248584661892537'),(3822,'Alcides Amazonas','BRANCA','MASCULINO','MASCULINO','1962-10-03','Alcides Amazonas nasceu em Cidade Gaúcha (PR), em 1962. Quando tinha dois anos de idade sua família se estabeleceu na Zona Leste de São Paulo, primeiro em São Miguel Paulista, depois no Itaim Paulista.\r\n\r\nAos dez anos de idade Alcides já trabalhava como vendedor ambulante. Com treze anos veio o primeiro registro em carteira, como office-boy no centro de São Paulo. Atuou na função até entrar no Exército, que serviu por quatro anos em Altamira, no Pará, onde conheceu Cleonice dos Santos, a Nice, com quem casou e teve três filhos: Sabrina, Renan e Suzana.\r\n\r\nNo retorno a São Paulo trabalhou como segurança em jornadas diárias que duravam 12 horas. No começo da década de 80, Amazonas foi aprovado em concurso púbico para trabalhar como cobrador de ônibus na CMTC (Companhia Municipal de Transportes Coletivos). Depois de seis anos como cobrador, passou para motorista de trólebus, função que desempenhou por quase vinte anos. Trabalhou também na viação Tabú e filiou-se ao PCdoB no ano de 85. Entre os anos de 93 e 95, Alcides chegou ao posto de diretor da CTMC. A partir de 1997, tornou-se secretário-geral do Sindicato dos Motoristas e Trabalhadores em Transporte Rodoviário Urbano de São Paulo, conhecido como Sindicato dos Condutores.\r\n\r\nNas eleições municipais de 2000, Alcides Amazonas tornou-se o primeiro vereador motorista de ônibus na história da cidade de São Paulo. Os eleitores que depositaram os dezoito mil e quatrocentos e noventa e oito votos não se decepcionaram. Amazonas chegou a vice-líder do governo na Câmara de Vereadores e foi relator dos projetos que criaram o Bilhete Único e a Secretaria Municipal de Segurança Urbana na cidade de São Paulo. Criou a Lei 13.207/01, que garantiu a manutenção dos cobradores nos ônibus, assegurando milhares de postos de emprego. Assim como a Lei 13.542/03, que obrigou as empresas de ônibus do sistema de transporte coletivo municipal a renovarem a frota com veículos de motor traseiro. Além disso, participou das lutas pela criação das subprefeituras, dos CEUs (Centros Educacionais Unificados) e pela regularização fundiária de muitos bairros que não tinham nenhum tipo de reconhecimento pelo poder público.\r\n\r\nEm 2005, Amazonas foi convidado para coordenar o escritório regional da Agência Nacional do Petróleo, em São Paulo. Ao assumir travou uma cruzada para moralizar o mercado de combustíveis. Com trabalho de inteligência e investigação, os fraudadores foram presos. Em 2005, quando assumiu, o índice de adulterações e fraudes era de 20%. Porém, quando saiu da ANP, em 2013, esse índice estava em 2%. O trabalho realizado garantiu a leal concorrência do mercado e protegeu os consumidores. Na ANP também teve participou nas discussões sobre a diversificação da matriz energética nacional e sobre a descoberta do pré-sal, além de ter coordenador o programa Gás Legal. Enquanto ainda estava na ANP, Amazonas disputou a eleição para deputado estadual, em 2010. Com quase 29 mil votos, ficou com a primeira suplência da chapa do PCdoB.\r\n\r\nEm 2013, assumiu a legislatura na Assembleia Legislativa de São Paulo (Alesp). O foco do mandato foram os trabalhadores com a criação da Frente Parlamentar em Defesa dos Trabalhadores em Transportes, do Dia do Revendedor de Gás (17 de maio).\r\n\r\nEm março de 2014, o prefeito Fernando Haddad, convida Amazonas para assumir a subprefeitura da Sé. No período, diversas ações de requalificação dos espaços públicos foram aplicadas. Além das funções tradicionais de zeladoria e limpeza urbana, a subprefeitura atuou para ampliar o convívio urbano no centro da capital com a retirada de grades que cercavam as praças, instalações de áreas de convívio do Programa Centro Aberto, instalação de Parklets (minipraças), a Paulista Aberta aos domingos e feriados, requalificação do Mirante 9 de Julho, realização de audiências públicas junto com Ações Integradas, valorização e ampliação de vagas nas Feiras de Artes, Artesanato, Antiguidades e Gastronomia. Todas essas medidas devem ser ampliadas e estendidas para as outras regiões de São Paulo.\r\n\r\nAlcides Amazonas saiu do cargo de subprefeito para ser candidato a vereador por São Paulo. Venha participar dessa caminhada para ocuparmos mais e melhor a cidade! Cuidando das pessoas vamos conquistar a cidade que queremos!','alcidesamazonasoficial@gmail.com','313351785700555'),(3852,'Karina Somaggio','BRANCA','FEMININO','FEMININO','1973-04-22','Karina Somaggio parte pra luta! \r\nDepois de ficar conhecida em todo o país por denunciar as falcatruas do publicitário Marcos Valério, que desencadearam o esquema do mensalão, a ex-secretária ingressa em definitivo na política para voltar a fazer a diferença. \r\nCandidata a vereadora pelo PTN, em São Paulo, Karina promete trabalhar dignamente por três bandeiras: combate à corrupção, sustentabilidade ambiental e proteção aos animais, tema aos quais se dedica últimos anos. \r\nE sua estreia na política não poderia ser mais contundente: Karina registrou em cartório seus projetos sob as Penas da Lei, isto é, caso eleita, se ela se compromete perante as penas da Lei lutar por seus compromissos com a população paulistana, e caso alguns dos projetos não seja feito, VOCÊ poderá processá-la.\r\nIsso mostra comprometimento com suas causas e seus eleitores, pois só quem tem certeza que quer o melhor para São Paulo faz com seriedade. ','karina.somaggio19199@gmail.com','10208967493737194'),(3901,'Luccas Cechetto','BRANCA','MASCULINO','MASCULINO','1987-11-07','Luccas Cechetto tem 28 anos, está concluindo a graduação em Psicologia pela Universidade Tuiuti, é funcionário do Diretório Estadual do PSOL Paraná e candidato a vereador pelo PSOL Curitiba.\r\nA partir do entendimento de que Psicologia e política devem se relacionar intimamente, Luccas se inseriu no movimento estudantil, inicialmente no Grupo de Estudantes do Sindicato dos Psicólogos do Paraná e, na sequência, no Centro Acadêmico de Psicologia da Tuiuti. Além disso, a convicção sobre o papel do sistema em que vivemos  o adoecimento da sociedade fez com que se inserisse e começasse a defender bandeiras dos direitos dos migrantes, pelo Núcleo de Psicologia e Migrações do Paraná; da luta antimanicomial, pelo Coletivo Um Passo A Frente e; dos direitos da população LGBT, pelo Transgrupo Marcela Prado.\r\n','ldmc87@gmail.com','10153851764222314'),(4296,'Ciro Rameck Wallerstein','BRANCA','MASCULINO','MASCULINO','1985-03-05','Eu, Ciro Rameck, candidato a vereador em Paraty pelo PSOL (Partido Socialismo e Liberdade), gostaria de contar um pouco sobre quem sou, minha trajetória de vida e o que me motivou a ser candidato nessas eleições.\r\nVivi meus primeiros 18 anos em Paraty, sempre com um laço muito forte com o mar e a cidade. Cresci junto com a fase em que nossa cidade mais se expandiu e tenho lembranças de uma vivencia que hoje em dia, por diversos fatores, não é mais possível. Por outro lado no mar, desde pequeno já velejava pela nossa baía, e aos 16 participei da fundação do instituto náutico de Paraty (INP) como voluntário e, posteriormente, como instrutor.\r\nDeixei a cidade para cursar arquitetura e urbanismo em São Paulo. A formação da universidade era mais voltada para projeto de edificações, entretanto sempre me interessei pela discussão urbana e social. Apresentei como trabalho de conclusão de curso o tema \"Relação entre o Cidadão e o Território\" resultando como proposta de edificação o \"Pólo Náutico de Paraty\". Neste período estagiei em alguns escritórios de arquitetura e em uma maquetaria. Além da universidade e dos estágios participei também de alguns concursos de arquitetura.\r\nApós viver 7 anos em São Paulo voltei à Paraty para buscar uma alternativa ao mercado da arquitetura das grandes cidades, principalmente por falta de grandes perspectivas de evolução profissional. Logo após o retorno me envolvi no projeto educativo de fazer a rota Darwin na América do sul, participando da manutenção do navio veleiro. O projeto acabou reduzido, mas em paralelo tive a oportunidade de navegar entre Florianópolis e búzios.\r\nJá em 2011 recebi a proposta de trabalhar no escritório de arquitetura Galvez & Marton em São Paulo. Voltei para São Paulo e trabalhei lá por 2 anos, adquirindo conhecimento, desenvolvendo projetos, detalhando e acompanhando obras. Uma experiência profissional bem diversificada na área da arquitetura, no que diz respeito à hierarquia, ao trabalho em equipe, as discussões e aprimoramentos das metodologias. Nesse período tive a oportunidade de realizar outra navegação, desta vez uma travessia do Oceano Atlântico das Ilhas Canárias (ESP) à Salvador, realizada de 2012.\r\nEm 2013 fui convidado a integrar a equipe da Prefeitura de Paraty, como coordenador técnico na Secretaria de Desenvolvimento Urbano e Meio Ambiente. Participei de processos importantes como: lei de abairramento, regularização fundiária da Fazenda Independência e Novo Horizonte, grupos de trabalho de revisão da portaria do Iphan, Plano Diretor e diversos licenciamentos. Elaborei o anteprojeto do Terminal Pesqueiro e o Projeto Básico do Cais de Turismo, mas ambos não foram a diante por falta de recurso e mudanças dos planos dos governos. E por último, elaborei para licitação o Projeto Básico do Velório Municipal, atualmente em construção.\r\nApós 2 anos na prefeitura, abalado moral e eticamente pelas condições de trabalho, solicitei minha exoneração para poder exercer minha profissão como autônomo e colaborar como cidadão em conselhos, audiências públicas e associações. Deixei a prefeitura em abril de 2015. Logo depois me filiei ao PSOL e comecei a participar de debates e reuniões do núcleo PSOL Paraty.\r\nQuando entrei no PSOL, nunca imaginei ser candidato, me filiei em primeiro lugar por ser a favor das bandeiras do partido e depois pela experiência no poder público. Como servidor percebi a necessidade da população ou grande parte dela participar da vida política do município. O PSOL se mostrou um caminho para começar a nos organizar, debater, propor alternativas, de reconquistar uma esperança política, construir, marcar referência e apresentar propostas sólidas. Posteriormente, apesar de pouco tempo de construção do partido, decidimos que participar do processo eleitoral seria interessante para expor nossas propostas, mostrar que pode existir outra política, outra cidade e pela importância da participação popular.\r\nA candidatura a vereador vem com a missão de lançar uma proposta alternativa, diferente de outros candidatos dos outros partidos, não temos coligações, somos contra participar de “arranjos” para chegar ao poder a qualquer custo. Nós do PSOL Paraty defendemos os ideais do partido e desejamos a população fazendo política, participando das decisões, dialogando e pensando junto o que queremos para nossa cidade. Só assim vamos poder combater os interesses econômicos em favor do interesse coletivo e construir uma cidade melhor para todos!','cirorw@hotmail.com','1285944488091814'),(4307,'João Victor Tayah','BRANCA','MASCULINO','MASCULINO','1986-01-15','Delegado de Policia, professor de cursos preparatórios e unuversidades, ativista dos movimentos estudantil e sindical há mais de 15 anos.\r\n\r\nwww.joaovictortayah.com.br','jvtayah@gmail.com','1176657459066188'),(4513,'Camila Pakulski Betsch','BRANCA','FEMININO','FEMININO','1992-12-12','Sou jovem, estudante, feminista!\r\nTenho 23 anos, sou estudante de Direito, ProUnista, filha de trabalhadores e mãe.\r\nConcorro a vereadora para dar voz as mulheres, jovens e trabalhadores na Câmara Municipal. A juventude precisa de  mais trabalho, educação, lazer, cultura, saúde, esporte... Me disponho a ser a porta voz da juventude, para termos uma política com a rebeldia consequente, com a cara da juventude! \r\nPor uma nova política, inclusiva e participativa.\r\nCamila Pakulski 65000\r\n#juventudeparticipa','camila.pakulski@gmail.com','1258060960879106'),(4523,'Marcelo Soares','BRANCA','MASCULINO','MASCULINO','1959-09-13','Sociólogo, com larga experiência em gestão pública nas áreas da habitação e assistência social. Sócio da AGAPAN e membro do Fórum Ambiental de Porto Alegre, participou de diversas ações de defesa dos direitos animais, plantio de árvores e de movimentos contra a privatização dos espaços públicos, como o Cais Mauá de Todos. Ativista pelos direitos humanos, está sempre presente na linha de frente das lutas pelos direitos de negros, mulheres, povos indígenas e LGBTs. É um dos fundadores da RAiZ – Movimento Cidadanista, que pretende reencantar a política com princípios como o ubuntu, o bem viver e o ecossocialismo. Marcelo Soares se define antes de mais nada como um ativista e pretende fazer do legislativo municipal um instrumento na construção de uma democracia real em Porto Alegre.','fmarcelopsoares@gmail.com','1106015012823672'),(4786,'Shi Mario Schneider','BRANCA','MASCULINO','MASCULINO','1987-01-22','Militante dos movimentos sociais, jovem, formado em Turismo e Hotelaria, estudante de Licenciaturas em Humanidades e futuro psicólogo.','mbsmariombs@hotmail.com','10208978567560115'),(4820,'Fábio Galdino','BRANCA','MASCULINO','MASCULINO','1988-07-18','Meu nome é Fábio Galdino, 28 anos, formado em Sistemas de Informação. Luto pela valorização da cultura e dos artistas independentes de Campinas; pela igualdade social, visto que infelizmente, na sociedade em que vivemos ser LGBT ainda está configurado como uma situação de risco, porém frear essa progressão de modo que os LGBTs possam se sentir cada vez mais seguro em ser quem se é, é um compromisso a ser firmado em minha campanha. Sendo que, do meu ponto de vista, uma maneira promover e proteger os direitos LGBTs seria fazer algo levando à sociedade informações capazes de traduzir as diferentes realidades de se viver; luto pela igualdade de gênero, combate a violência contra a mulher, melhoria do sistemas de ensino e das escolas municipais, transporte de qualidade, projetos de auxílio a proteção dos animais, incentivo ao esporte e outros muitos projetos que pesquisamos e estudamos muito para desenvolver! Peço que conheça mais sobre mim e sobre minhas propostas: Acesse eu site: www.fabiogaldino44088.com.br','fabiogaldino44088@gmail.com','332846773714729'),(4838,'Laiz Perrut Marendino','BRANCA','FEMININO','FEMININO','1991-05-28','Sou Historiadora e estou concluindo o mestrado na UFJF. Atuante nas causas feminista e de juventude, iniciei no Movimento Estudantil como coordenadora geral do Centro Acadêmico de História da UFJF e depois como coordenadora geral do Diretório Central dos Estudantes (DCE UFJF). Fui também conselheira do Conselho Municipal de Juventude, espaço em que contribuí para elaboração do Plano Municipal da Juventude, finalizado e entregue à prefeitura esse ano.\r\nPor entender que para construir um mundo mais justo e igualitário é preciso que as mulheres tenham seus direitos respeitados, ampliados e sejam sujeitas ativas do processo político, me integrei ao Coletivo Maria Maria Mulheres em Movimento, núcleo da Marcha Mundial das Mulheres em Juiz de Fora. Atuamos ativamente pela aprovação do Plano Municipal dos direitos das mulheres, que infelizmente foi rejeitado pela atual câmara municipal; na construção de ações e manifestações pelo fim da violência contra as Mulheres e mais recentemente contra o projeto de lei “Escola sem Partido”, que impossibilitaria uma educação inclusiva e livre de preconceitos.\r\n\r\nQual é dessa candidatura?\r\n\r\nMais de 54% do eleitorado juizforano é composto por mulheres. Entretanto, das 19 cadeiras da Câmara Municipal, apenas uma é ocupada por mulher e nenhuma é ocupada por jovens. Na verdade, não temos nenhum jovem ocupando os espaços elegíveis da política de nossa cidade.\r\nJuiz de Fora vive em estado de abandono. Não temos políticas sociais que de fato melhorem a condição de vida da população, principalmente relacionadas aos grupos historicamente excluídos do direito de viver a cidade, como mulheres, jovens, negras e negros e LGBTTIs. Não temos políticas públicas para evitar que todos os dias as manchetes dos jornais sejam as mortes dos jovens das periferias, os estupros e os casos de violência contra as mulheres, sejam elas crianças, jovens ou adultas. Não temos políticas públicas eficientes de mobilidade urbana, de incentivo a cultura, de segurança e de educação.\r\nNossa candidatura vem em consonância com a de Margarida Salomão à prefeitura, tendo em vista sua experiência e seus esforços na defesa e na luta cotidiana para transformar Juiz de Fora em uma cidade mais humana, tolerante, que respeite as diferenças e seja compartilhada por todas e todos nós. Estamos juntas na luta em defesa da democracia e da garantia dos direitos sociais e trabalhistas, o que se torna ainda mais importante no momento político que nosso país está passando. \r\nAssim, estamos encarando o grande desafio de construirmos em conjunto essa candidatura a Vereadora para que lutemos diariamente pelo direito à cidade e em defesa das mulheres, dos jovens, dos negros e das negras e da comunidade LGBTTI. Um desafio para que batalhemos todos os dias para que os movimentos e coletivos tenham cada vez mais espaço na construção das políticas de nossa cidade. Assim poderemos construir a Juiz de Fora de todas e todos nós!\r\n','laizperrut@hotmail.com','10157493291595646'),(4878,'Welliton Cordeiro Pires','BRANCA','MASCULINO','MASCULINO','1990-05-15','Welliton Pinguim tem 26 anos, é morador da Ilha dos Valadares há 11 anos e trabalha desde os 16 como designer gráfico freelancer. No mesmo período começou a se interessar por política, participando de entidades representativas de estudantes secundaristas, tornando-se presidente do Grêmio Estudantil do Colégio Estadual \"Helena Viana Sundin\" em 2009. Recentemente, presidiu o Diretório Acadêmico de História da UNESPAR - Campus de Paranaguá. Candidato pela primeira vez, Welliton Pinguim deseja ser uma nova alternativa para representar a população residente na Ilha dos Valadares, além de atuar nas áreas de cultura e de políticas públicas para a juventude em nossa cidade.','wellitonpinguim@hotmail.com','1820908888145151'),(4972,'Bruno Sartori','PARDA','MASCULINO','MASCULINO','1989-05-16','Sou jornalista, tenho 27 e trabalho com críticas e fiscalização do poder público há cerca de 12 anos. Fui criado até meus 8 anos na fazenda quando meus pais se separaram e nos mudamos para cidade. Minha mãe, foi a primeira mulher mototaxista de Unaí e sustentou sozinha eu e meu irmão mais novo. Ela trabalhou por mais de 15 anos nessa profissão. Desde os meus 11 anos trabalhei pra ajudar em casa e por isso, acabei repetindo a 7ª série. Vendi picolé na rua, salgados, fui entregador. Aos meus 15 anos, minha mãe precisou se mudar novamente para fazenda e eu passei a morar na cidade com a minha segunda família para estudar, Eles me acolheram e eu até brinco que Jesus teve a sorte de ter dois pais, e eu tive mais sorte ainda de ter dois pais e duas mães. Na casa dessa família, tive a oportunidade de usar meu primeiro computador. Internet em casa era um sonho, não tinha em praticamente residencia nenhuma. Me formei na escola Maria Assunes Gonçalves em 2007 e no ano seguinte meu pai apareceu e me levou para cursar a faculdade em São José do Rio Preto, em São Paulo. Tive a oportunidade de trabalhar em mídias importantes da cidade e até para emissoras grandes, como o SBT. Tive também a honra de fazer um teste pro CQC em 2014, mas acabou não dando certo. Coisas da vida. Desde os meus 15 anos eu produzo conteúdo humorístico aqui para Unaí voltado a crítica ao poder público e sempre obtive resultados. Há poucos dias, fazia 8 anos que eu dava uma entrevista pra TV rio preto por ter feito uma horta comunitária em um buraco do calçadão do Corguinho. A administração na época agiu rápido e o consertou no dia seguinte. Cada um dos meus trabalhos, por mais cômicos que sejam, são pautados na seriedade para receber uma resposta positiva do poder público. Atualmente, por exemplo, depois de duas mortes terem ocorrido por afogamento no Rio Preto, convidei meus amigos e seguidores a assinarem uma petição online que exigia a instalação de placas de aviso aos banhistas. O poder público agiu e fez a instalação desses placas. Após isso, nenhuma morte foi registrada mais no Rio Preto. Não é uma medida que irá resolver o problema, mas certamente, amenizará. Tenho uma paixão incontrolável pela serra do Taquaril que eu faço questão de subir sempre e todas as vezes fico admirado com a vista indescritível de Unaí ao por do sol, e é claro, não deixo de fotografar, é um dos meus hobbies favoritos. Talvez você até já tenha visto alguma das minhas fotos circulando aí pelo Facebook. Bem, Isso é um pouco sobre mim. \r\n','brunosartori@outlook.com','1224522747607885'),(5126,'Marcos Mello Osasco','BRANCA','MASCULINO','MASCULINO','1970-12-17','Quero trabalhar com criatividade, garra e determinação... e acreditem, terão orgulho de mim! Ainda existe gente do bem que se preocupa com o município e eu sou uma dessas pessoas! :D\r\nMarcos Mello\r\nEmpreendedor, publicitário... criador do Projeto \"Osasco Capital do Cachorro Quente\" e da Feira Gastronômica MasterChefs e recentemente inaugurou o Padrinho Rock Bar.\r\nNatural de São Paulo/Capital – 24/11/1970\r\nBiografia publicada no Livro \"Quem é Quem em Osasco\"\r\nViveu a infância na cidade de Caieiras. Aos 9 anos de idade chorou a morte do pai, brutalmente assassinado. Diante da tragédia, a mãe decidiu se mudar para Buritama, interior de São Paulo. Foi onde o então garoto Marcos Mello conheceu sua primeira ferramenta de trabalho: uma enxada. Trabalhou na lavoura até seus 12 anos. A partir daí, deixou sua casa para trabalhar como aprendiz de drogaria, em Birigui. \r\nMudou-se para Osasco em 1988, onde seguiu trabalhando no ramo de farmácias, sendo responsável por trazer uma das primeiras redes de franquia para o município. Em 1995, com a internet ainda engatinhando, começou a desenvolver sites. Profissionalmente, formatou cerca de 60 páginas eletrônicas. \r\nEnvolvido em tecnologia, abriu uma escola de informática no Conjunto dos Metalúrgicos, sendo seguida de uma segunda unidade. Uma rede com 1.100 escolas tornou-se destaque, com Marcos Mello sendo citado como empreendedor-inovador. \r\nFoi colaborador do PROERD - Programa Educacional de Resistência às Drogas -, e também precursor e criador da primeira convenção partidária informatizada, atraindo a atenção de vários políticos de expressão, dentre outros, Orestes Quércia e Michel Temer.\r\nDurante cinco anos produziu shows e empresariou artistas da região. É considerado um dos maiores publicitários da cidade, sendo formado na faculdade \"da vida e do trabalho\", como costuma afirmar. Em 2012 decidiu criar um festival para buscar o reconhecimento de Osasco como a “Capital do Cachorro Quente”. O estrondoso sucesso do festival colocou Osasco em rede nacional, com manchetes em jornais e reportagens nas principais emissoras de TV do País. Foram mais de 60 horas de mídia espontânea. Por conta disso, Marcos Mello foi recebido pelas principais autoridades do País, entre outros: a presidente Dilma Rousseff, o governador Geraldo Alckmin e o ex-presidente Lula. \r\nCom a repercussão do Festival do Cachorro Quente de Osasco, a cidade entrou para o círculo gastronômico do Estado de São Paulo. Com isso, Marcos Mello teve a feliz ideia de criar a Feira Gastronômica Master Chef´s, em outubro de 2014. Em menos de 2 anos o evento expandiu-se para mais oito cidades. Folha de São Paulo, Diário de São Paulo, Veja São Paulo, Jornal Agora, entre tantos outros, já o entrevistaram sobre essas atividades, sendo capa de três revistas da cidade.\r\nAlgumas de minhas idéias que quero trabalhar com garra e determinação para executa-las:\r\n> Criação do “Hot Dog Park”, sendo esse, matéria da Veja São Paulo e aprovado pela presidente do Brasil esse projeto está hoje protocolado no Ministério do Turismo apenas aguardando investidores! Além de 2.000 empregos diretos, com esse parque atrairá o público do Playcenter (que teve suas atividades encerradas), que seria em média 10.000 pessoas diárias, Osasco passa a ser uma estancia turística com maior arrecadação de verbas e como todos sabem, toda cidade turística tem por obrigação possuir atendimento de saúde de qualidade, segurança e boa pavimentação na cidade, aumentando ainda mais o comércio na cidade! \r\n> Criar um time de assessores especializados e responsáveis por fiscalizar secretarias e atender a população por departamento! Ou seja eles vão trabalhar mesmo e com conhecimento de causa!!!\r\n> Criação de Creches Verticais (edifícios), isso irá criar um número significante de vagas com o reaproveitamento dos espaços! \r\n> Criação de Albergues Interativos para moradores de rua, com atendimento Médico/Odontológico/Psicológico e cursos de especialização para a reintegração dos mesmos a sociedade, além do espaço conter quadra de esportes, canil, jantar e atividades recreativas! Os albergues atuais são semelhantes a prisões e por isso os mesmos não o frequentam!\r\n> Reaproveitamento das escolas municipais no período noturno, com cursos de gastronomia, informática, cursos técnicos, cursinhos para o Enem e polos universitários on line... tudo em parceria com a iniciativa privada! \r\n> Criação da Expo Arte Osasco, um espaço para atender a todos os artistas de Osasco... músicos, artesões, artes cênicas, Artistas plásticos, etc...\r\n> Além desses projetos, se compromete a fiscalizar com punho forte todas as secretarias da cidade prestando contas a população com eficácia e transparência!\r\nPreciso muito da força dos amigos para chegar lá! #Compartilhe\r\n#Gratidao\r\n','marcosmello@gmail.com','10208747362819080'),(5224,'Luna Meyer','BRANCA','FEMININO','FEMININO','1980-05-24','Nasci em São Carlos, mas me mudei para Araraquara em 1996 onde resido até hoje, por ser completamente apaixonada pela cidade. Desde pequena, aprendi dentro de casa valores de igualdade social e amor aos animais.\r\n\r\nFormei-me em Comunicação com habilitação em Propaganda e Marketing, porém acabei me especializando na área digital, com enfoque em Construção de Sites e posteriormente em Marketing Digital.\r\n\r\nSempre realizei serviço voluntário em todos os aspectos possíveis, pois acredito que ao ajudar o próximo, ajudamos a nós mesmos.\r\n\r\nTenho como crença o fato de que a comunicação é uma ferramenta eficiente para organizar, informar e educar uma sociedade e sempre utilizei de minha profissão para contribuir nas causas em que atuo diariamente e por isso meu lema é:\r\n\r\nA comunicação muda o mundo.\r\n\r\nQue se alia facilmente à célebre frase de Gandhi: Seja a mudança que você quer ver no mundo.\r\n\r\nE cá estou eu buscando ser essa mudança, mas não sem a ajuda e apoio dos outros, pois sozinhos não somos nada.','lunameyer@gmail.com','1307390202618399'),(5372,'Higor Mamede','PARDA','MASCULINO','MASCULINO','1990-11-20','','higormamedem@hotmail.com','1175949352466386'),(5383,'Érica Siqueira','BRANCA','FEMININO','FEMININO','1983-03-02','Professora universitária, mestre e doutoranda em administração. Feminista, ciclista e socialista!\r\nMoro desde os 6 anos em Osasco. Já morei em Quitauna, Cidade das Flores, Vila Yara e Bonfim. Tenho desejo de renovar a política, incluindo espaços coletivos e comunitários para trabalho e trocas. Valorizar a educação, especialmente novos modelos, lutar por espaço para as mulheres e por projetos sociais/ambientais.\r\n','erica_ssiqueira@hotmail.com','1205612902794596'),(5559,'Flavia Abreu','PRETA','FEMININO','FEMININO','1985-03-17','Flavia Abreu, nascida e criada no Bairro Vila Monteiro. Trabalho como manicure e é formada em podologia e atua como coordenadora do Projeto Cultural Samba D\'ellas.\r\nFlavia Abreu é militante incansavel no  Combate ao Racismo por meio do Coletivo Raça e Pluralidade.\r\nAcredita que um mandato popular, onde todas as decisões respeite a voz dos moradores da idade.','eucurtoflaviaabreu@gmail.com','1102853669811179'),(5704,'Rafael Boff','BRANCA','MASCULINO','MASCULINO','1989-10-08','Nascido em Redenção-PA, vive em Palmas desde 2007, Engenheiro Ambiental, 26 anos, professor universitário, líder da Rede de Ação Política Pela Sustentabilidade. Foi o Secretário de Energias Sustentáveis que implantou o mais arrojado Programa de Incentivos ao uso de Energia Solar do País, o Palmas Solar.\r\n\r\nFoi candidato a deputado federal em 2014 junto com Marina Silva. Gosta de astrologia, astronomia, música popular, meditação, tênis de mesa, andar de bicicleta e de, principalmente, conversar e conhecer novas pessoas. Tem dentro de si a indignação diante de todas as injustiças e acredita com todas as forças que a maioria das soluções acontece quando unimos forças pensando no bem de todas as pessoas, dos seres vivos e do planeta. Carrega o lema de que sustentabilidade é a qualidade de vida de tudo aquilo que habita neste planeta, seja nossa, dos nossos filhos e netos. \r\n\r\nAcredita que quando pessoas boas se unem em prol de uma causa, temos um lindo e próspero futuro para acreditar.','rafaelboff@live.com','1098916650196136'),(5881,'Alexandre Mafu','BRANCA','MASCULINO','MASCULINO','1977-02-18','Músico na cidade de uberlândia a 15 anos  , direciona sua atenção  a classe artística junto a secretaria de cultura  para aumentar os recursos da cidade e extender a arte onde ela não tem alcance hoje.Como cidadão  usuário do sus  entende que o caos no setor se agrava ainda mais com a quantidade de desvios das verbas para o setor a idéia é esclarecer a população e conscientizar a fiscalização garantindo  que os recursos cheguem. Garantir a cidadania dos grupos  que lutam  pela distinção de gênero,  raça  e credo e o direito de  cidadania plena independente de suas escolhas.','alebaixo@hotmail.com','10210438379300921'),(5925,'Denis Duck','BRANCA','MASCULINO','MASCULINO','1965-04-06','Paulistano, Cristão, 51 anos, arquiteto e urbanista. Defendendo o planejamento da cidade com desenvolvimento sustentável. Apoio a escola pública de qualidade em tempo integral.','denisduck@hotmail.com','1236623153044043'),(5933,'Anisio Batista','PARDA','MASCULINO','MASCULINO','1966-06-26','Sou o Anísio Silva e moro em Campinas desde 1978. sou guarda municipal há 15 anos e uma das minhas principais bandeiras será atuar por uma segurança pública eficiente e com as polícias integradas. Me candidatei a vereador para ser a voz da população na Câmara. Sendo eleito, vou lutar pelo povo incessantemente, me comprometendo a ter um gabinete de portas abertas para atender os cidadãos. Serei transparente como sempre fui. Vou trabalhar junto à população por saúde e educação de qualidade, lutando ainda para melhorar a condição de vida do cidadão campineiro. Conto com o seu voto pra fazer a diferença no dia 02 de outubro, pela renovação na Câmara Municipal e para dar voz à população. ','anisiotaruga@yahoo.com.br','1111528372216553'),(5983,'Nilton Dos Anjos','BRANCA','MASCULINO','MASCULINO','1972-08-15','Professor da Faculdade de Filosofia da Universidade Federal do Estado do Rio de Janeiro (UNIRIO). Doutor em Ciência da Literatura (UFRJ/Universidad de Salamanca). Presidiu o Conselho FUNDEB/Petrópolis (2012-2014) e assessorou a formulação do Plano Municipal de Educação (2015). Participou de movimentos populares de autogestão e realizou cursos políticas públicas promovidos pela Controladoria Geral da União (CGU) e pela Escola Nacional de Administração Pública (ENAP).','niltanjos@yahoo.com.br','1283509145001858'),(6074,'Aretha Melo','BRANCA','FEMININO','FEMININO','1992-06-24','Aretha Melo, 24 anos, bióloga, militante feminista, LGBT e ecossocialista, iniciou sua trajetória de militância em 2013. Foi sua indignação diante das injustiças e, sobretudo, de toda forma de opressão que a empurrou para as lutas naquele momento histórico. Foi o movimento feminista que procurou primeiro, em rodas de discussão para a construção da Marcha das Vadias, mas o ato do dia 20, o auge das jornadas de junho, em que milhares de jovens ocuparam as ruas pela redução do aumento da tarifa em todo o país, foi seu primeiro ato de rua. \r\n\r\nFoi assim que firmou a conclusão de que nenhum direito é dado, mas sim conquistado por meio de muita luta. A partir daí, reconhecendo-se num projeto político coletivo, filiou-se ao PSOL e à tendência interna Liberdade, Socialismo e Revolução (LSR). Desde então, passou a militar cotidianamente pelas pautas da juventude e dos trabalhadores em Natal, no Rio Grande do Norte e no Brasil. \r\n\r\nHoje, além de integrar o PSOL, atua na Frente Feminista de Natal e no movimento estudantil da UFRN. Participou também de movimentos como a Marcha das Vadias, a Revolta do Busão, o Fora Cunha, a primavera feminista e, mais recentemente, o Fora Temer! Este é o tipo de experiência que falta na Câmara Municipal de Natal.\r\n\r\nEstamos cansados dos políticos de carreira que passam 20, 30, 40 anos dentro de gabinetes a partir de falsas promessas e votam contra nossos interesses, como votaram pela manutenção ao veto de Carlos Eduardo ao Passe Livre e pela exclusão do debate sobre diversidade sexual e identidade de gênero nas escolas. \r\n\r\nQueremos um mandato participativo, diverso, que fortaleça as lutas populares e denuncie as velhas práticas e as injustiças votadas na Câmara Municipal! Nossa construção coletiva começa desde agora, acompanhe a página e participe de nossas atividades!','aretha.kd.melo@hotmail.com','1192941927444792'),(6086,'Adilson Gomes','BRANCA','MASCULINO','MASCULINO','1968-12-23','Transportador escolar a 10 anos, casado 2 filhos ,47 anos. \r\nFundador da GATEC ( associacao d transporte escolar ) , foi a Brasilia 4 vezes no ultimo ano em defesa da seguranca das criancas e da regulamentacao do transporte escolar e fretamento ( universitario , e turismo )luta pela proteção da criança e adolescente,melhoria nos servicos de transporte contra os oligopolios, extensão do horario de atendimento nos postos de saude, melhoria na acessibilidade das vias publicas, aumento de vagas em salas de período integral, e construção de mais escolas e EMEIs em áreas carentes.\r\n','adilsongomes1@hotmail.com','1108656009226122'),(6132,'Ivan Leite Neves','BRANCA','MASCULINO','MASCULINO','1973-08-02','Trabalho a dois anos em favor de vários bairros de Campinas, do qual pode ser comprovado em minha página: Ivan Neves-Pr\r\nPretendo colocar em cada bairro e comunidade que se interessar, um Núcleo Voluntário de Capitação de Petições do Vereador Ivan Neves.\r\nUm lugar onde as pessoas possam levar suas reclamações desde a mais simples a mais complexas tais como: buracos, esgoto céu aberto, lâmpadas postes queimadas até médicos que faltam em posto de saúde , asfalto e etc...\r\nO Núcleo encaminha a petição para o Gabinete do Vereador Ivan Neves, lá nós oficializamos e encamingamopara o executivo para que possa ser executado.\r\nAbraços.\r\nIvan Neves\r\nJuntos Chegaremos lá!\r\n22567\r\n\r\n\r\n','Ivannevespr@gmail.com','10206667246510489'),(6137,'Carine Martins','PRETA','FEMININO','FEMININO','1982-08-06','Após anos participando das lutas desde a juventude, resolvi dar mais um passo! Hoje sou trabalhadora bancária da Caixa Econômica Federal, sou feminista e estou na luta contra o racismo que nós mulheres negras sofremos cotidianamente. Faço parte do MAIS – Movimento por uma Alternativa Independente e Socialista e juntos queremos apresentar uma candidatura que ajude a organizar e mobilizar as trabalhadoras e trabalhadores de BH para lutar contra toda forma de opressão e exploração. Esta é uma candidatura por todas as nossas lutas!\r\n\r\nBH tem vivido ao longo dos anos um processo de privatização e higienização social, que tem se aprofundado com prefeito Márcio Lacerda (PSB). Os aumentos abusivos da tarifa do transporte público, as tentativas frustradas de privatizar o carnaval de belô, a perseguição aos lutadores, os despejos e a repressão aos movimentos sociais têm sido aplicados a base de ponta pés e temperados com muito gás de pimenta da PM do governo Pimentel (PT). Nossa cidade viveu a contradição de sediar dois grandes eventos esportivos mundiais e ao mesmo tempo ter o 7º maior déficit habitacional do país.  Em BH, nos tem sido negado o direito de morar e transitar pela cidade. Também nos tem sido negado a alegria de expressar toda a forma de amor, pois cada vez aumenta a violência LGBTfóbica.\r\n\r\nApesar de ter me candidato na legenda do PSTU, faço parte do MAIS - Movimento por uma Alternativa Independente e Socialista. Um movimento novo no Brasil que veio para somar!\r\n\r\nMinha candidatura é por uma sociedade MAIS justa, uma sociedade socialista! Por todas nossas lutas!','carinegeo@yahoo.com.br','10202157965628147'),(6246,'Leo Bittencourt','BRANCA','MASCULINO','MASCULINO','1967-02-03','Sou teresopolitano, fotógrafo e produtor audiovisual, um dos realizadores dos documentários da série “Reminiscências de Teresópolis”, que trata do resgate da história e memória local, no que me tornei referência. Sou um dos fundadores do Fórum Municipal de Cultura e luto pela identidade cultural e pela valorização dos artistas locais. Sou protetor animal e luto por politicas públicas de amparo e pelo cumprimento das leis de proteção dos animais, sobretudo as não cumpridas na cidade. Defendo programas de reciclagem e sustentáveis na gestão do lixo e saneamento básico, fatores vitais na saúde das pessoas. Há 6 anos acompanho e aponto, como cidadão, os malfeitos da Câmara e do Governo Municipal. Fui responsável pela denúncia que levou o Ministério Público a investigar as obras da Praça Olímpica, onde promovi um abraço simbólico de protesto. Sonho com a criação de um parque público na área onde funcionou a fábrica da SUDAMTEX.\r\nAlgumas propostas:\r\n· Reforma do Regimento Interno da Câmara Municipal? - obsoleto e injusto.?\r\n· Defesa da Lei Orgânica e do Plano Diretor do Município?, violentados frequentemente?\r\n· Aumento do orçamento municipal para a cultura?, sempre deixada de lado.?\r\n· Defesa da memória local e do patrimônio público\r\n??· Melhores condições de vida aos idosos\r\n· Fortalecer a agroecologia\r\n?· Defesa intransigente da causa animal e do meio ambiente local\r\n· ?Luta pela transparência, moralidade e qualidade nos serviços públicos\r\n\r\nObrigado por ler até aqui, será uma honra contar com seu voto, e mais ainda com o seu apoio à nossa campanha, seja da maneira que puder.\r\n\r\nMeu número é 50000.?\r\nSó a luta muda a vida!','leobittencourt@gmail.com','1288882764464619'),(6253,'Guilherme Prado','BRANCA','MASCULINO','MASCULINO','1990-07-08','Não é novidade para aqueles mais próximos dos debates políticos o fato de que o PSOL é o partido que tem a discussão acerca dos Direitos Humanos mais aprofundada e muito além do processo eleitoral. Seja na defesa das LGBT, negras e negros, luta das mulheres, etc, o PSOL não se omite! Sou candidato em Santos em defesa de um cidade justa e que dê voz aos calados pelo soterramento histórico. Nada sobre eles, sem eles!','guilherme.prado1@hotmail.com','1069152543138242'),(6269,'Mauricio Dvorak','BRANCA','MASCULINO','MASCULINO','1972-08-02','Vivo política desde os meus 10 anos, quando minha mãe, líder comunitária ajudou a fundar uma associação de moradores e assumindo cargos na associação de pais e mestres do colégio, trabalhou também como cabo eleitoral por muitas eleições, daí veio a minha paixão por fazer política, por lutar pelos direitos e necessidades daqueles que não tem voz!\r\nTrabalhei em campanhas desde que me conheço por gente e fui desde panfleteiro a coordenador de campanha. Ajudei a eleger muitos e a grande maioria me decepcionou, por depois de eleito abandonar as bandeiras que levantou antes da campanha. Esse é um dos motivos pelo qual agora sou candidato! Fui presidente de gremio estudantil, assessorei na montagem e regularização de algumas associações de moradores e centros acadêmicos, ainda hoje luto pelo ensino e suas necessidades (estou cursando administração pública). Estou numa luta pela melhora no transporte coletivo em Matinhos desde 2013.\r\nCargos públicos ocupados: técnico responsável pelos eventos do prefeito de Curitiba na gestão 93-98 e coordenador da guarda mirim em São José dos Pinhais.','mauriciodvorak@hotmail.com','1360748357310994'),(6293,'Beto Dalmonte','BRANCA','MASCULINO','MASCULINO','1965-02-06','Ex-biomédico, Gestor ambiental e Urbano.','camonte27@yahoo.com.br','10205677431450159'),(6302,'Val Metzner','BRANCA','MASCULINO','MASCULINO','1967-05-26','','val_metzner@yahoo.com.br','1289350024432941'),(6381,'Luiz Eduardo Fares','BRANCA','MASCULINO','MASCULINO','1959-09-15','Resido em Paraty a 17 anos, 57 anos e moro no Bairro da Mangueira, tenho o Titulo de Cidadão Paratiense em 2007, sou psicologo social, atuei 10 anos de forma clinica, atuei na Instituição ITAE por 8 anos, onde fui responsável de projetos sociais, em destaque o acompanhamento do Judô e Cidadania, Projeto Pequeno Artesão, Colônia de Camping, gincanas culturais e de educação ambiental, Projeto Vamos ao Cinema, surfe e educação ambiental na Trindade em 2005, Projeto Corrida das Estrelas, Percussor do Miss Universo Paraty por três anos, sócio fundador onde criei a Cia Dança e Arte Paraty já a 13 anos, coordenador do projeto na minha Gestão do Ferias na Pista com coletivos de arte de rua, durante quatro anos de 2008 a 2011, criei com o professor Tiago Louzada a Cia de Dança Folclórica de Paraty pela Cia Dança e Arte, percussor da Cia de Dança de Rua em 2010 ate 2015, junto com o MV Freitas e Duda, minha atuação junto a dois conselhos municipais o CMDCAP de 2004 a 2016, e o conselho CMASP de 2009 a 2015, como secretario administrativo dos conselhos municipais do CMASP e do Idoso de 2015 a 2016, fui psicologo de recursos humanos da Prefeitura de 2006 a 2011, ajudei a implantar o programa QVT (qualidade de vida dos servidores). Agora tenho meu curriculum fora de Paraty:\r\nAtuo em projetos sociais e comunitários desde meus 16 anos de idade em São Paulo cidade onde nasci, fui membro da JUC - Juventude Católica na década de 70, entrei para o movimento estudantil secundarista e apos universitário, por onde permaneci muito tempo, liderança de CA na Universidade por dois anos, trabalhei como monitor arte educador na FEBEM por dois anos, atuei como psicologo de recursos humanos na Secretaria do Estado do Menor por dois anos, participei da implantação dos programas PIT (Iniciação do Trabalho), Casa Aberta com menores de rua, psicologo clinico em São Paulo por 10 anos, atuação de um projeto construído e supervisionado pelo sedis sapiensi e PUC - SP na comunidade Vale das Virtudes e Turma da Toca durante dois anos, trabalhei pela FUNDAP e CIEE como psicologo na FABES Campo Limpo - SP - dois anos, participei como psicologo social do programa do Instituto Pichon Rivieri junto ao núcleo da Pastoral do Menor com o Padre Julio Lanceloti em comunidades e favelas de SP.\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n ','ciadancaearteparaty@yahoo.com.br','1531574240201855'),(6444,'Denise Carvalho','BRANCA','FEMININO','FEMININO','1962-09-11','Em 1983 Denise foi eleita presidenta do DCE-UFG e liderou o movimento “pula catraca” que conquistou o meio passe estudantil no transporte coletivo de Goiânia.\r\nEm 1984 foi eleita a primeira presidenta da União Estadual dos Estudantes (UEE) e nesse período liderou um dos maiores momentos históricos do Brasil. O movimento das Diretas Já!\r\n\r\nEm 1985 Denise participou da construção da União da Juventude Socialista, UJS. E lutou pela legalização do Partido Comunista do Brasil, pelo voto aos 16 anos, liderando e participando de vários atos públicos e passeatas estudantis, visando a construção de uma sociedade mais democrática e com oportunidades para todos e todas.\r\n\r\nDenise foi eleita vereadora de Goiânia em 1988, destacando se por ser autora de mais de 200 emendas à lei orgânica municipal e por defender a juventude, as mulheres, os trabalhadores e a liberdade religiosa em nossa capital.\r\n\r\nEm 1990 é eleita a deputada estadual mais votada de Goiânia e a primeira comunista na Assembleia Legislativa após 43 anos. Durante seu primeiro mandato como deputada estadual, Denise presidiu a comissão de educação e cultura da Assembleia Legislativa defendeu e participou de discussões em relação a criação da Universidade Estadual de Goiás e lutou em defesa dos professores e funcionários da Universidade Federal de Goiás e dos servidores públicos. Ainda em seu primeiro mandato Denise presidiu a comissão pela reforma agrária e lutou contra a privatização das empresas estatais.\r\n\r\nEm 1992, Denise participou ativamente das manifestações do “fora Collor”. Em 1994, Denise é reeleita deputada estadual e mais uma vez, é a deputada mais votada de Goiânia. Neste segundo mandato, Denise se destaca como protagonista na luta pelos direitos das mulheres, participando de conferências, encontros e discussões das nações unidas (ONU) sobre o assunto em países como China, Chile e Cuba. Ainda em seu segundo mandato, Denise idealiza e cria o Fórum Goiano sobre Cultura, provocando uma ebulição cultural em Goiás com discussões sobre as políticas culturais do nosso estado. Neste período, Denise foi autora de importantes projetos transformados em lei na Assembleia Legislativa, como a lei de incentivo à cultura estadual (lei Goiazes) e a lei que concede meia entrada para estudantes em espetáculos e no transporte coletivo.\r\n\r\nMais uma vez reeleita a deputada mais votada de Goiânia, Denise, em seu terceiro mandato participou efetivamente da criação da UEG e deu prosseguimento às lutas em defesa das mulheres,dos jovens, dos trabalhadores e da cultura, além de lutar cotidianamente contra o preconceito e a discriminação, seja ela social, por gênero, étnica ou sexual.\r\n\r\nNa década seguinte Denise assumiu funções no poder executivo de Goiás. Em 2003, foi nomeada secretária de ciência e tecnologia do estado e defendeu a popularização da ciência, a pesquisa científica e a inovação tecnológica. Destacou-se nacionalmente como presidenta do Fórum Nacional de Secretários e membro do Conselho Nacional de Ciência e Tecnologia, presidido pelo presidente Lula. Defendeu com vigor o desenvolvimento científico para o nosso estado.\r\n\r\nEntre os anos de 2007 e 2010 teve o desafio de construir a primeira Secretaria de Política para a Mulher e Promoção da Igualdade Racial do Estado de Goiás, a SEMIRA, onde atuou na luta pela igualdade na diversidade para mulheres, negros, ciganos, povos indígenas, LGBTTs e jovens e idosos.\r\n\r\nEnquanto secretária da mulher e igualdade racial, Denise atuou com destaque no enfrentamento a violência doméstica e familiar, além de combater o tráfico de mulheres.\r\n\r\nDenise contribuiu com a aplicação da Lei Maria da Penha em Goiás, triplicando o número de Delegacias da Mulher no Estado e inaugurando o Centro de Referência da Igualdade que conta com atendimento jurídico e psicológico, assistência social e terapia para vítimas de violência e preconceito. Por este trabalho recebeu o primeiro Prêmio Nacional da Lei Maria da Penha concedido pelo governo federal. À frente da secretaria, Denise apoiou o trabalho das entidades de mulheres, como o Cevam (Centro de Valorização da Mulher) e recebeu do Estado, em sua gestão, o espaço\r\nfísico que reivindicava há mais de 15 anos. Implantou o Projeto Mulheres da Paz, além de promover diversos fóruns de discussão sobre desigualdade de gênero. Denise atuou ativamente no apoio e afirmação dos direitos humanos e contra a discriminação aos povos negro, indígena e cigano e a população jovem, idosa e LGBTTs com a criação de conselhos estaduais e do comitê gestor de quilombos.\r\n\r\nDenise Carvalho trabalha pela cultura de paz há mais de 10 anos, atuando junto à Unipaz e outras instituições em vários municípios, especialmente em Goiânia. Denise entende que a Paz e a Justiça Social sejam o caminho para que as pessoas possam viver verdadeiramente em segurança nas cidades e no campo.\r\n\r\nIncansável na defesa da democracia brasileira tão duramente conquistada, Denise Carvalho logo se posicionou contra o processo de impedimento da presidenta Dilma, denunciando-o como um golpe contra a soberania popular. Em 2015 e 2016 tem participado ativamente das manifestações para que voto do povo brasileiro seja respeitado, para que toda corrupção seja punida e contra qualquer tentativa de retirada de direitos dos trabalhadores, das mulheres e da juventude hoje claramente ameaçados pelo governo ilegítimo de Michel Temer.\r\n\r\nDenise Carvalho sempre se dedicou à construção de melhores dias para o povo de nossa capital. Em 2015 propôs e encabeçou a criação do Movimento Ouvindo Goiânia, integrado por pessoas, instituições, organizações do movimento popular e da intelectualidade progressista goianiense que propõem uma ampla escuta à população para construirmos juntos o Direito à Cidade Democrática, Inclusiva e Viva.\r\n\r\nDenise tem dedicado sua vida aos sonhos coletivos, por uma sociedade mais humana e igualitária e é assim que ela busca construir o Direito de Todos à Cidade. \r\n\r\nQue Goiânia se torne exemplo de um lugar onde o trabalho seja valorizado, a segurança seja aliada da paz, as pessoas possam se mover com dignidade, a saúde e a educação sejam priorizados, a diversidade seja respeitada e todo o povo tenha direito à felicidade.','denisecarvalho6565@gmail.com','1706875929636875'),(6544,'Valeryah Rodrigues','PARDA','FEMININO','FEMININO','1979-09-15','Sou mulher transexual 37 anos , conselheira municipal lgbt da cidade de SP ,presidente do instituto Nice voltado à mulheres transexuais e mulheres travestis na reinserção socioeducativa e profissionalizante ,diretora lbt da UBM CAPITAL, milito a 8 anos comecei em Franco da Rocha SP , moro em São Paulo há 4 anos e venho acompanhando às necessidades básicas de nossa população Lgbt e das minorias ,sou do culto a orixá , atuei na luta na votação do plano municipal de educação ano passado , nas ruas pelos nossos direitos no fora temer .','valeryahaje@outlook.com','541541349376610'),(6683,'Maurílio Gajão','BRANCA','MASCULINO','MASCULINO','1959-09-15','Iniciou militância na Pastoral da Juventude\r\nFez parte da diretoria do sindicato dos Metalúrgicos de São José dos Campos\r\nComo professor da rede estadual de São Paulo fez parte do Conselho de Representante da Apeoesp\r\ncomo professor da rede municipal de São José dos Campos fez parte por duas vezes da diretoria do sindicato dos servidores público de São José dos Campos\r\nParticipou da assessoria do vereador mauro Kano, presidente da comissão de direitos humanos da Câmara de São José dos Campos\r\nAtualmente é professor efetivo de Sociologia da rede estadual de São Paulo e Assistente de Direção da rede municipal de São José dos Campos.','gajao1@yahoo.com.br','10210606406220094'),(6718,'Bruno Fernandes de Lima','PRETA','MASCULINO','MASCULINO','1984-03-06','Bruno Fernandes é professor, formado em Letras pela UFPE e pós-graduando em Língua Portuguesa e Literatura Brasileira. É membro de A Igreja de Jesus Cristo dos Santos dos Últimos Dias. É casado e tem três filhos. Bruno Fernandes sempre defendeu a igualdade social, a igualdade de gênero, a igualdade racial e a liberdade religiosa. Defende a causa LGBT, os direitos das mulheres, dos negros, dos indígenas, das populações quilombolas, das religiões de matriz africana. Acredita na emancipação humana e defende os direitos de todos os seres humanos, dos animais e a preservação do meio ambiente.','brunofdelima@hotmail.com','10209137127178292'),(6977,'Nowhah Luiza','BRANCA','FEMININO','FEMININO','1986-04-12','Iniciou sua vida artística no Núcleo de Dança Elza Cavancante, tendo feito parte do  no Spazzinho Cia. Juvenil e Spazzio Cia. De Dança, entre os anos de 1992 a 2005. Em 2008, partiu para uma proposta de gestão colaborativa na fundação do Coletivo Pequi, reunindo músicos, artistas, mídia livristas e ativistas culturais. Cursou Comunicação Social e aperfeiçoamento em diferentes áreas da produção cultural. Um novo desafio foi o Centro Cultural Joana Dark, que com seus atuais 5 anos, gera uma economia criativa na qual cria uma dinâmica de diferentes repertórios de cover artístico na cidade, revezando com apresentações de músicos com produção autoral e independente. Dois festivais sob sua produção se tornaram os pontos de maior difusão da música independente em Anápolis, sendo eles o Berro de Carnaval e Paralelo Sonoro, que integra a Rede Brasil de Festivais. Desde o surgimento do Conselho Municipal de Cultura, em 2009, vem atuando na atividade conselheirista, na fiscalização e fortalecimento das políticas públicas no Município. Antes disso tudo, é esposa e mãe de três filhos, desde sempre uma anapolina.\r\n\r\n\r\nAs eleições municipais deste ano, em nossa cidade, reservaram a surpresa de muitos nomes novos e jovens. São empreendedores criativos, entusiastas da cultura, educação, esporte, saúde, meio ambiente, segurança pública e diversas áreas. Isso tudo cheira a muita mudança e vontade de fazer melhor, fazer diferente. Uma nova forma de encarar a gestão pública, de maneira coletiva e com mais diálogo.\r\n\r\nEm toda essa vontade de oxigenação, coloco o meu nome por uma nova geração política, levando a nossa forma de produzir e viver para as políticas públicas!\r\n\r\nVenho do setor Cultural para dialogar com toda a cidade, principalmente para que Anápolis descubra o que ela tem e aonde pode chegar. Caminho para renovação da Câmara Municipal junto à juventude com o seu inconformismo quanto ao que há de injusto e desigual, com a energia de quem quer fazer. Não será o início de um trabalho, pois desde o começo deste século estamos na consolidação da cultura na cidade e toda a transformação de comportamento e identidade que acompanha ela.\r\n\r\nQuando digo nós, coloco a força do trabalho coletivo, entendendo que esta nova forma de fazer política pelo mandato público não parte de somente uma personalidade, mas sim de um grupo. Grupo este com a experiência acumulada em cada evento e expressão cultural baseado na integração do artista/produtor com o outro. Esse outro que aconselha, reveza, fortalece, faz críticas construtivas e constrói junto. Essa reunião de “outros” forma uma cadeia produtiva e é nesse raciocínio que a Cultura poderá através de um mandato legislativo municipal protagonizar as mudanças.\r\n\r\n- Quer resolver os problemas da cidade só com Cultura?\r\nEntendemos que não somente ela, mas sempre na companhia dela. A rede de ensino aliada à produção cultural pode levar a um saber cada vez mais integrado e tornando a escola um lugar mais acolhedor, sendo um espaço de realização coletiva e pertencimento para crianças e jovens. A Segurança Pública com a Cultura abre novos horizontes e novas maneiras de pensar a vida, para que o caminho não se reduza ao do crime, da morte. A Saúde e a Cultura na educação do corpo e na conscientização por meio do lúdico para mais prevenir do que ser socorrido. O Desenvolvimento Social e a Cultura combatendo as intolerância, principalmente as que nossa história nos herdou pelo machismo, homofobia, racismo, intolerâncias religiosas, rechaço a sua imagem corporal e também pela discriminação quanto à sua condição financeira.\r\n\r\nOs artistas e produtores culturais na cidade são protagonistas desta estratégia para a transformação, também assistidos pelas políticas públicas para que possam difundir seu trabalho. A profissionalização da classe artística vem tornando cada vez mais a Cultura, não como hobby ou segunda opção, mas como seu projeto de vida. Nas lutas de artistas e produtores foram possíveis importantes destaques levando Anápolis à Goiás, ao Brasil e ao Mundo. Se por suas lutas já alcançam o Mundo, imaginem com a força de mais investimentos privados e de políticas públicas?\r\n\r\nApesar de ser movida pela visão de futuro, temos que arregaçar as mangas construindo o presente. São necessárias leis e ações políticas no Município para que se consolide uma gestão participativa nos equipamentos públicos voltados à cultura, de forma que a população abrace o que é seu. A descentralização dos locais de acesso das realizações artísticas e de formação fazem urgentes em uma cidade que já rompe o limite de seus 300 mil habitantes, com uma vasta área urbana e rural. Consolidar a presença da Cultura junto à Educação tanto no espaço da escola, como também nas diferentes oportunidades em face ao meio ambiente, à saúde e à integração social.\r\n\r\nEntendendo que as mulheres tem um impacto indiscutível na dinâmica da cidade, porém ainda lutam contra as desigualdades de gênero, que não são poucas. A violência contra a mulher conserva uma realidade cruel, onde ainda o agressor tem mais vantagens, seja pela morosidade do Poder Público, seja por falta de conscientização da sociedade. Muitas famílias anapolinas contam somente com a mãe para fazer sustento da casa e também cuidar do desenvolvimento dos filhos. Temos que ser aliados dessas mães ao propiciar pelo poder público cada vez mais condições para realizar estas tarefas e principalmente viver bem e feliz. A gravidez é um fator importante que deve ter atenção seja para planejá-la melhor. Ao dar a luz, a mulher deve ter ao seu alcance o acompanhamento de saúde pública que lhe é de direito.\r\n\r\nEnfim, neste pique e com muitos desafios pela frente é que o seu voto fará toda a diferença! Quero continuar com você transformando a cidade, te representando na Câmara Municipal de Anápolis!!!\r\n\r\nVamos juntos? Vote Nowhah Luiza 90.062!','nowhahluiza@gmail.com','1161332693914187'),(7017,'Fernanda Camargo','BRANCA','FEMININO','FEMININO','1976-01-26','Fernanda Camargo é feminista, assistente social no TJPR, docente no curso de serviço social do Centro Universitário UNIBRASIL, especialista em Família e Políticas Públicas. Filiou-se ao PSOL após as eleições presidenciais de 2014, por entender a necessidade de estar em uma organização política que fizesse enfrentamento ao avanço neoliberal e que se pautasse na defesa dos direitos humanos. Tem atuação articulada aos movimentos que lutam por direitos humanos e políticas sociais. Conselheira da atual gestão do CRESS - 11ª Região, atualmente licenciada por ser candidata a vereadora pela Frente de Esquerda (PSOL/PCB) em Curitiba. Ao longo de sua trajetória foi conselheira em instâncias de controle social e delegada em conferências de políticas públicas e militante de direitos humanos.','asfernandacamargo@gmail.com','10206973206315368'),(7052,'Ricardo Rocha','BRANCA','MASCULINO','MASCULINO','1985-09-12','Natural da cidade de Toledo no Oeste do Paraná, o professor Ricardo completa 31 anos em Setembro de 2016. Casado, pai de família. É professor de Sociologia na rede pública estadual de Santa Catarina. Defende uma renovação no legislativo de Jaraguá do Sul, onde mora desde 2012. Neste espaço de tempo esteve engajado em diversos movimentos sociais, como os movimentos de juventude e de luta dos trabalhadores através do movimento sindical. Da união destes dois segmentos, participou do Encontro Nacional dos Jovens Educadores da CNTE, (Brasília) entidade máxima de representação dos profissionais da educação a nível nacional, representando o estado de Santa Catarina. Neste encontro foram deliberadas algumas ações em prol desta categoria, em especial a valorização destes profissionais.','ricardinhosmaftor@hotmail.com','1325316034175893'),(7101,'Danilo Siqueira','BRANCA','MASCULINO','MASCULINO','1983-07-03','Sou Danilo Siqueira, empresário no ramo de auto peças (Dlssom) empresa que administro a 15 anos. \r\nSou casado com Emanuele e pai de 2 filhos, Davi e Laura \r\nSou natural de Limeira e amo minha cidade \r\nTrabalho desde meus 8 anos de idade e tudo que conquistei em minha vida foi com muito esforço e suor \r\nO que me motivou entrar para a política foi o meu sentimento de inconformidade com a ma administração da minha cidade e a falta de respeito com nós contribuintes. \r\nQuero trabalhar em prou da minha cidade e quero ser lembrado como uma pessoa idônea e de muitas façanhas alcançadas, quero que os Limerenses tenham orgulho de mim \r\nMesmo sabendo que não poderei agradar a todos vou trabalhar e fazer o melhor que eu puder \r\n\"Quando os bons não se apresentam os maus é que governam\"\r\n\r\n','dlssom@hotmail.com','1245781548817949'),(7110,'Henrique Jambo','PRETA','MASCULINO','MASCULINO','1982-09-19','Quando decidi iniciar minha caminhada política, sabia que muitos seriam os desafios. Ser negro e morador da periferia são apenas alguns preconceitos que enfrentei. Hoje, posso dizer que encontrei o caminho certo. No PTB fomos ouvidos e conquistamos nosso espaço. Trabalhar para as comunidades carentes da cidade é nosso foco. Nosso projeto de trabalho contempla áreas prioritárias para elas: melhorias no transporte, educação, lazer, segurança e moradias. Muito atento a situação dos jovens e adolescentes das periferias da cidade também labutaremos para a criação de áreas de lazer e democratização do uso dos espaços públicos. Cursos profissionalizantes e programas de incentivo a manutenção deles em salas de aula fazem parte do nosso objetivo.  Os problemas das comunidades serão discutidos em audiência públicas realizadas nas subprefeituras locais e em horário flexível para garantir a participação do maior número de pessoas. Por isto, conto com seu voto. Henrique Jambo, 14123.','aperiferiatambempode2@gmail.com','1781594045456242'),(7201,'Dilvano Brum Psol','BRANCA','MASCULINO','MASCULINO','1977-09-06','Dilvano Brum é Educador social, luta também pelo fim do monopólio das empresas de ônibus, defendendo passagens com preços populares e grátis para estudantes de escolas públicas e privadas. Defende o respeitos a todas as religiões e o movimento LGBT.  Não tem condições financeiras para campanha e é denunciante ativo de políticos corruptos. Não se alia a grandes empresários que oprimem as classes mais pobres. \r\n','dilvanopsol@gmail.com','978893992255125'),(7296,'Andre Sapanos','BRANCA','MASCULINO','MASCULINO','1986-10-28','André Sapanos, ou simplesmente SAPANOS, como é popularmente conhecido, tem 29 anos, é professor da rede pública estadual de SP, diretor da APEOESP (Sindicato dos Professores do Ensino Oficial do Estado de São Paulo), tesoureiro da APROFFIB (Associação dos Professores de Filosofia e Filósofos do Brasil), membro da APROFFESP (Associação dos Professores de Filosofia e Filósofos do Estado de São Paulo), além de coordenador nacional de comunicação da TLS e tesoureiro do Partido Socialismo e Liberdade - PSOL Mauá. Foi candidato a vice-prefeito em 2012 e a deputado estadual em 2014.\r\nCom trajetória de luta em defesa dos reais interesses da classe trabalhadora, SAPANOS tem se destacado na luta no combate as opressões, em defesa de uma educação pública, totalmente gratuita, laica, inclusiva e de qualidade, de um transporte coletivo de qualidade, da comunidade LGBT e no combate a corrupção.\r\nAgora, SAPANOS é candidato a vereador e acredita que é preciso contrariar interesses daqueles que lucram com algo que é direito da população, direito este que deve ser garantido pelo poder público para que juntos, possamos construir a cidade que tanto sonhamos.','sapanos@bol.com.br','1065625160172511'),(7474,'Renato Almeida Freitas Jr.','PRETA','MASCULINO','MASCULINO','1983-12-12','Hoje, com três décadas de existência, nada pode resumir mais minha caminhada do que a sorte. Sorte por estar aqui, por ter estudado, por ter saúde, por ter a família que tenho, por ter atravessado o Vale da Sombra da Morte, intacto, ou quase, algumas cicatrizes, nariz e dentes quebrados, mas íntegro.\r\nMinha trajetória política teve início no sertão paraibano, raiz da minha família, onde as plantas e as pessoas desenvolvem capacidades de sobrevivência em meio à escassez, de água, de comida, de afeto, de paz.\r\nMinha mãe fugiu de casa ainda criança, foi a São Paulo, imenso cativeiro dos nordestinos, tentar a sorte, lá nasci, tal qual meu irmão. Mãe solteira, dona Raimunda, mais forte que o mundo, estava grávida de mim quando meu quase desconhecido pai sucumbiu às estatísticas, preso, por 15 anos, transferido para o Paraná, Piraquara.\r\nMudamos para o Paraná, Vila Macedo, ao lado da visita. Agora, com minha irmã, eramos três. Cresci descalço nas ruas de terra, vendendo picolé, furtando garrafas para trocar por doces, derrubando pequenas árvores para fazer trave nos campinhos da vila, enquanto minha mãe trabalhava em casa de família para que sua família pudesse existir.\r\nGanhei a sabedoria e astúcia que só as ruas podem oferecer, gostei. Trabalhei de empacotador de mercado, repositor, balconista de sorveteria. Fui humilhado, ofendido, desprezado; subemprego, subcidadão, subhumano, subraça.\r\nDecidi ser mais do que sub, não me agradava a ideia de andar pelos esgotos da vida, sempre amei o sol, a grama, a vida. Sai dos subempregos, ainda cedo, fui para rua com meus parceiros, descobri estratégias diversas para ter as duas coisas que queria; a vida (com sol) e o dinheiro suficiente para comer e comprar uma camiseta aqui, um tênis ali. Afinal de contas, tudo indicava, parecia ter nascido pra isso.\r\nMas a vida, com sol, fora das humilhações do subemprego, não poderia ser alcançada dessa forma. Logo cedo entendi; aquilo era uma versão resumida do que poderia ser, e logo meus amigos morreram, um por um, Diego Droe, Diego dig-dig, Ronaldinho, Marquinhos Crep, Marquinhos Normal, Bone, Sisi, Fimose, Rica, Troco e tantos outros, mortos ou presos.\r\nO jogo era claro, sanguinário e objetivo: Ou um escravo do patrão, ou um número no presídio.\r\nMas esses trabalhos não garantiam vida, ou se morria um pouco por dia, de apatia, de banzo, ou se morria de uma vez, vítima da violência. E assim foi com meu irmão, que morreu trabalhando, vítima da violência sem rosto daqueles que já não têm mais nome.\r\nA mudança do país abriu uma janela até então impossível, estudar, qualquer coisa, mas estudar. Lá não tinha patrão, violência policial e você existia, os estudantes olhavam no seus olhos, e assim, como num passe de mágicas, você passava a existir. Às vezes para ser chacota, às vezes para ser coitado, mas existia!\r\nE não há nada melhor que existir, tomei gosto por isso. Estudei, bastante. Tomei contato com as explicações sociológicas da desigualdade social e da violência, racionalizei claramente o que já sabia, agora eu também poderia explicar, mais que isso, poderia me organizar para mudar, para que todos existissem.\r\nNão foi tão fácil, os estudantes querem muito melhorar o mundo, mas tem que ser a partir deles, e, de preferência, começando pelo mundo deles.\r\nNovamente a questão da existência para os subhumanos do Jd Graziele, Vila Macedo, Jardim Cláudia, Atuba, Colombo, Barreirinha não encontrava resposta à altura.\r\nE acredito que por isso, por ter sido um sem teto, um sem pai, um sem emprego, um sem comida, um sem paz é que posso construir, junto com os de baixo, uma alternativa verdadeiramente libertadora para quem vive sob o jugo dos poderosos, pra quem vive enterrado vivo nas prisões da miséria.\r\nEu luto para que todos existam, e para que essa existência não seja um fardo, mas sim uma aventura satisfatória, solidária e justa no mundo que desejamos construir.\r\nE por isso me lancei, humilde, mas orgulhoso, nessa Candidatura, e posso dizer, eu sou um de vocês, porque vocês são um de nós!\r\n','renatofreitasjr@gmail.com','10202396841320587'),(7607,'Luciel Brasil','PRETA','FEMININO','FEMININO','1963-04-21','Professora, formada em Letras, pela Universidade Estadual da Paraiba (UEPB), ANGELA CÂNDIDA CHAVES SILVA, nascida em 1963, inicia a sua militância social, na luta por melhores condições de vida para populações historicamente excluídas com a participação nas lutas estudantis na cidade onde nasceu, Sapé, interior da Paraíba.\r\n\r\nFilha adotiva de uma dona de casa e um carpinteiro, estudou a vida inteira em escolas públicas, sempre engajada politicamente através da luta no Movimento Estudantil. Começou a trabalhar aos 13 anos para ajudar na renda familiar. Aos 18, imigrou para a cidade de Campina Grande, para estudar, concluindo o ensino médio no Colégio Estadual da Prata. Mais tarde se forma professora na Universidade Estadual (UEPB), em Guarabira.\r\n\r\nEm 1994, almejando melhores condições de estudo e trabalho, vem morar na capital, enquanto trabalhava como professora no Colégio Sagrado Coração, em Santa Rita.\r\n\r\nAngela Chaves é professora concursada da rede estadual de ensino, desde 1994, tendo sempre atuando nos movimentos sindicais da categoria, lutando pela melhoria das condições de ensino e reconhecimento para as professoras e trabalhadores do ensino. Em 1995 se filia ao Sindicato dos Trabalhadores e Trabalhadoras na Educação na Paraíba - Sintep, dando inicio a sua militância no movimento sindical neste mesmo ano. Como professora sempre saiu em defesa dos temas das minorias nas escolas, pautando o acesso à educação.\r\n\r\nEm 1998 conhece o Movimento Feminista na Paraíba, o que muda profundamente sua visão sobre o empoderamento das mulheres e seu papel na sociedade. Inicia a sua militância junto aos Movimentos de Mulheres como “Promotora Popular”, oferecendo formação para grupos e mulheres em comunidades urbanas e assentamentos rurais. No Grupo de Mulheres Lésbicas e Bissexuais Maria Quitéria, do qual faz parte, fortalece seu ativismo pelos direitos de LGBT.\r\n\r\nFilia-se ao PSB em 2004, integrando o segmento de Mulheres do partido. Atualmente, está Secretária Municipal do Segmento LGBT Socialista como uma defensora intransigente dos direitos das mulheres lésbicas, bissexuais e transexuais.\r\n\r\nCoordenou, de 2005 a 2011, o Centro de Referência de Cidadania dos Bancários, na Gestão do então Prefeito Ricardo Coutinho. Nesse período participou como Conselheira do Segmento de Mulheres da Associação de Moradores Bairro dos Bancários (AMCBU) empenhada em dar continuidade a sua luta pela cidadania e pelos direitos das mulheres.\r\n\r\nPela força, determinação e coragem na frente da citada Instituição e pela sua trajetória junto aos movimentos feministas e LGBT, em 2011, depois a saída da Prefeitura, é convidada pelo Governador Ricardo Coutinho para coordenar o Centro Estadual de Referência dos Direitos de Lésbicas, Gays, Bissexuais, Travestis e Transexuais e de Enfrentamento à Homofobia da Paraíba – Espaço LGBT, no qual permaneceu até o mês de junho de 2016, a frente desse mecanismo de Politicas Públicas que se tornou referência nacional pela sua excelência nos serviço e pelo diálogo estreito com o movimento LGBT.\r\n\r\nE é no ano de 2016 que essa ativista social, feminista, militante LGBT, comprometida com os Direitos Humanos, com a democracia e com a inclusão social, assume o desafio de entrar na vida pública colocando seu nome pela primeira vez como pré-candidata a um cargo eletivo para representar a população de João Pessoa na Câmara de Vereadores.\r\n\r\nEsse ano também se coloca num novo desafio na luta pela cidadania LGBT no Brasil. A partir de sua participação na III Conferência Nacional de Politicas Publicas para LGBT conhece e se propõe a compor um grupo, com articulação nacional, de Mães e Pais pela Diversidade que luta pela não discriminação dos filhos LGBT. Angela Chaves é mãe de dois filhos e mesmo diante dessa grande responsabilidade, e pelo bem dos próprios filhos e da sociedade excludente e discriminatória em que vivemos, nunca fugiu a luta ou se furtou de colocar a própria vida em risco proteger sua família. Foi vitima de violência doméstica e encontrou no movimento feminista o apoio para denunciar o agressor publicamente e nos serviços de proteção. Também foi vítima de lesbofobia por uma empresa privada, no bairro onde morava, e encontrou força no movimento LGBT, de mulheres e de religiões de matrizes africanas para lutar e expor sua vida numa atividade pública de denúncia à LGBTfobia da sociedade paraibana e brasileira.','angelacanndida@gmail.com','867803206687124'),(7760,'Rafael Lucas','BRANCA','MASCULINO','MASCULINO','1988-01-12','       Tenho 28 anos, graduado em História. Leciono a 8 anos, porem trabalho com Cultura e Educação desde meus 17 anos, e quando entramos nessa área, acreditamos que podemos fazer a diferença: Podemos passar em diante o nosso aprendizado, nos importamos com o futuro da sociedade, com a força dos jovens\r\n     Me perguntaram o porque de entrar na política e esbravejavam: \"SÓ TEM LADRÃO!\"... \"NINGUÉM LEVA A SÉRIO!\"... \"VOCÊ SÓ QUER O DINHEIRO!\".... \r\n     De fato, quanto mais nos afastarmos da vida política, tão essencial a nossa Nação, mais corrupta ela será e continuará na mão de quem não merece nos representar.','rafael.lucas.historia@gmail.com.br','1014024872029809'),(7786,'Tulio Mota','BRANCA','MASCULINO','MASCULINO','1982-12-14','','tulio@professortulio.com.br','1300185866660826'),(7807,'Edna Demétrio','PRETA','FEMININO','FEMININO','1971-01-20','Edna dos Santos Souza Demétrio, Funcionária pública; Ativista  em Movimentos Sociais em Defesa de Direitos Humanos e de Combate à Violência contra Mulher. Prestou serviços voluntários em entidades não governamentais no município de Imbituba como: Pastoral da Criança, Força Positiva, AIPODEF, dentre outras. Atuou nos Conselhos: Municipal de Assistência Social (CMAS) e Municipal dos Direitos da Mulher de Imbituba- SC (COMDIM); participou das várias conferências, estaduais e municipais da Saúde, Assistência Social e Políticas para Mulheres, defendendo ativamente as políticas públicas do município. Siga-a no Facebook: www.facebook.com/edna.demetrio','ednassdemetrio@yahoo.com.br','1076096625792838'),(7810,'Gustavo Merlo','BRANCA','MASCULINO','MASCULINO','1975-10-04','Professor, Diretor e Gestor Público, atuante nas áreas de Educação e Direitos da Pessoa com Deficiência.','prof.gustavomerlo@gmail.com','10205717441654145'),(7871,'Mila Milani','BRANCA','FEMININO','FEMININO','1964-12-15','Há sete anos venho me preparando e trabalhando para ser vereadora de Porto Alegre. Fui assessora parlamentar na Câmara de Vereadores e na Assembléia Legislativa do RS. Somando essas experiência aos 30 anos de advocacia, me sinto preparada para assumir esse desafio. Tenho projetos que são plenamente viáveis para melhorar a nossa cidade. Eles podem, sim ser soluções definitivas para velhos problemas.\r\n \r\n\r\nComo vereadora, trabalharei para ajudar a organizar a vida Porto Alegre, das pessoas e dos bens do município. Não farei apenas leis. Também fiscalizarei a administração, a aplicação dos recursos públicos, a execução do orçamento, além dos pedidos de informações.\r\n\r\n\r\n\r\nApoiarei e discutirei as políticas públicas, os programas governamentais, o plano plurianual, a lei de diretrizes orçamentárias e a lei orçamentária anual. Como integrante da Câmara, apreciarei as contas públicas da prefeitura com rigor e comprometimento. Trabalharei com o objetivo de aumentar nossa segurança, gerar ações de sustentabilidade, garantir a proteção das mulheres e das  minorias, defender a causa animal. ','amilanisadv@gmail.com','10154336978461210'),(8050,'Lília Liliá Zebalho','PARDA','FEMININO','FEMININO','1976-03-07','Sou campineira, concursada no cargo de Monitor Infanto Juvenil l, readaptada em função administrativa na Coordenadoria de Gestão de Pessoas da Secretaria Municipal de Educação, formada em Contabilidade pela PUC - Campinas e em TIC- Tecnologia da informação e Comunicação - PQi - CPqD, portadora de Artrite Reumatoide doença degenerativa, com as degenerações ósseas ocorridas hoje sou PCD- Pessoa com Deficiência, moradora de um bairro na região Rod. Santos Dumont. ','liliazebalho@hotmail.com','1302523229781991'),(8141,'Débora Almeida','BRANCA','FEMININO','FEMININO','1990-03-13','Débora Almeida, Assistente Social, formada na UERN. Sou militante social, faço parte da Marcha Mundial de Mulheres e me organizo no Grupo feminista Nova Mulher em Assu. Filiada ao PT desde 2007, participo ativamente da vida partidária desde 2011, quando na faculdade fazia parte do movimento estudantil. Desde então participei de diversas lutas sociais. Como a Jornada de lutas da Juventude em 2013, de onde tivemos como conquista o Estatuto da Juventude; a Campanha do Plebiscito pela Constituinte soberana e exclusiva para Reforma Política em 2014. Participei da Organização da 3° Conferência Estadual de Juventude, realizando tbm a 1° Conferência Municipal de Juventude de Assu.','deboralmeida13@gmail.com','10154547976983827'),(8187,'Sandra Marrocos','PRETA','FEMININO','FEMININO','1971-03-06','Mulher, feminista, mãe, negra, Assistente Social. Vereadora de João Pessoa com atuação em defesa dos direitos das mulheres, população negra e LGBTTs. Advinda dos movimentos pauta sua vida em defesa dos direitos humanos e da Democracia. ','sandramarrocos@yahoo.com.br','1102432456517896'),(8242,'Débora Andrade','BRANCA','FEMININO','FEMININO','1976-03-12','Débora Andrade é Mestre em Agroecossistemas pela Universidade Federal de Sergipe (2006) e graduada em Agronomia pela Universidade Federal de Uberlândia (2003). De 2007 a 2013 atuou como gestora no movimento cultural social Circuito Fora do Eixo, onde desenvolveu atividades de elaboração, gestão e administração financeira de projetos culturais junto aos mecanismos de incentivo, gestão de equipe e participação na produção de diversos festivais, congressos, shows e outras atividades relacionadas. De 2013 a 2015 foi assessora de projetos na Prefeitura Municipal de Uberlândia, através da Secretaria Municipal de Gestão Estratégica, Ciência e Tecnologia. Atualmente trabalha no setor administrativo do Colégio Nacional.\r\n','deboraber12@yahoo.com.br','1291179080900350'),(8272,'Vitor Cadillac','BRANCA','MASCULINO','MASCULINO','1991-07-18','Coragem para enfrentar figurões e seus posicionamentos políticos preconceituosos e conservadores. Sensibilidade para escutar e reconhecer a diversidade entre as pessoas de Goiânia. É com essas características em evidência que Vitor Cadillac busca espaço na Câmara dos Vereadores de Goiânia para promover Transformação Cultural, na casa legislativa e na capital.','vitorcadillac@gmail.com','10208839308251383'),(8281,'Diogo B. Castro','BRANCA','MASCULINO','MASCULINO','1983-10-10','','diogocastrosr@hotmail.com','1095090970571182'),(8329,'Zé Nildo','PARDA','MASCULINO','MASCULINO','1982-07-05','Advogado professor de Etec, militante dos direitos humanos da infância e juventude. Nordestino, dos movimentos sociais e da teologia da libertação das comunidades Eclesiais de base e assessor da Pastoral da Juventude.','joniac@gmail.com','1140737512640580'),(8334,'Bernardo Portes','BRANCA','MASCULINO','MASCULINO','1991-02-10','Sou formado em História. Trabalho em prol da juventude de Teresópolis. Quero um transporte de qualidade para os universitários que precisam ir a outros municípios para chegar ao nível superior. Quero trabalhar pela cultura com as praças da cultura. Quero implementar o Pare Seguro que irá ajudar a mulheres e idosos de descerem a noite e madrugada perto de casa em vez de só parar no ponto do ônibus.   ','becoruna@hotmail.com','10153941025012218'),(8475,'Natália Bonavides','BRANCA','FEMININO','FEMININO','1988-06-15','Natália Bastos Bonavides é primeiramente uma jovem mulher e, como tal, convive diariamente com o machismo e com a negação de espaços que historicamente são reservados aos homens. Mas nunca se resignou diante da opressão de gênero.\r\n \r\n# Movimento Estudantil\r\n?\r\nIniciou sua militância política quando estudante do curso de Direito da UFRN, onde participou ativamente da construção do projeto de extensão popular Lições de Cidadania (hoje chamado Motyrum) e foi dirigente do Centro Acadêmico Amaro Cavalcanti, um dos centros acadêmicos mais ativos da Universidade Federal do Rio Grande do Norte, sempre a defender a democratização do acesso ao ensino superior público e a função social da universidade. É formada em Direito (UFRN) e mestre em Direito Constitucional (UFRN).\r\n \r\nParticipou ainda do Observatório da Câmara, que realizou os debates sobre mobilidade urbana e aumento da tarifa de ônibus que antecederam os movimentos Revolta do Busão e Fora Micarla, onde teve atuação destacada como militante e como estudante de Direito, participando da comissão que escreveu o Habeas Corpus impetrado junto ao STJ, que impediu que a histórica ocupação da Câmara Municipal do Natal realizada em 2011 terminasse com a polícia invadindo a CMN e retirando os manifestantes de forma violenta.\r\n# Movimentos Sociais\r\n?\r\nDesde 2009 participa de projetos de educação popular, através dos quais atuou em assentamentos rurais e em comunidades como Leningrado e Mãe Luiza, construindo conhecimento com as populações em situação de elevada vulnerabilidade social na luta em defesa dos direitos sociais.\r\n?\r\nFoi uma das fundadoras do Escritório Popular, primeira organização de assessoria jurídica de movimentos sociais do estado, que possibilitou o contato íntimo com diversas demandas populares, destacando-se no combate à criminalização dos movimentos sociais e na assessoria a vítimas de violência institucional.\r\n \r\nParticipou da assessoria política e jurídica da Associação Potiguar dos Atingidos pelas Obras da Copa em Natal, defendendo as comunidades que seriam desapropriadas; e do Comitê Popular da Copa, atualmente Comitê Popular de Direitos.\r\nÉ advogada do MST, com atuação em diversos acampamentos em todo o estado.\r\n \r\nAssessora o Movimento de Luta nos Bairros, Vilas e Favelas, que luta em defesa do direito à moradia na cidade de Natal; o Movimento da População em Situação de Rua, vítima cotidiana de violência institucional; e o Movimento pela Humanização do Parto em Natal.\r\n \r\nAdvoga também na área sindical, por exemplo para o Sindicato dos Servidores Públicos Municipais de Natal, conhecendo de perto a realidade dos serviços públicos no município e a necessidade de valorização dos profissionais.\r\n \r\n# Direitos Humanos\r\n \r\nFez parte da Comissão de Direitos Humanos e da Comissão da Memória e Verdade da OAB; e foi Conselheira do Conselho Estadual de\r\nDireitos Humanos e Cidadania (COEDHUCI), onde atuou, dentre outras temáticas, com mulheres familiares de pessoas em privação de liberdade. Foi ainda Conselheira do Conselho Gestor do Programa de Proteção a Vítimas e Testemunhas Ameaçadas (PROVITA).\r\n \r\nParticipou da elaboração do projeto do Centro de Referência em Direitos Humanos da UFRN, compondo atualmente sua coordenação.\r\n \r\nDurante o seu mestrado em Direito Constitucional pela UFRN, estudou o oligopólio dos meios de comunicação e a necessidade de democratização da mídia, especialmente no que se refere a políticos que detêm meios de comunicação. Participa do Fórum Potiguar de Comunicação Social e do Intervozes (Coletivo Brasil de Comunicação Social), dentre outros espaços de militância e atuação profissional.\r\n \r\nEstagiou no Departamento de Cooperação Jurídica da Organização dos Estados Americanos (OEA), onde trabalhou com a Convenção Interamericana contra a Corrupção e participou de audiências da Comissão Interamericana de Direitos Humanos. Assessorou imigrantes de países da África que tiveram pedido de refúgio negado (caso dos náufragos do litoral potiguar e caso do primeiro apátrida do Brasil).\r\n \r\n# Partido dos Trabalhadores e Candidatura\r\n?\r\nÉ dirigente estadual da tendência petista Articulação de Esquerda, que historicamente disputa os rumos do PT e dos governos liderados pelo partido, defendendo as bandeiras históricas da classe trabalhadora e criticando a política de conciliação de classes, responsável por interditar as necessárias reformas do Estado brasileiro, como a reforma agrária, a reforma tributária e a democratização dos meios de comunicação. Integra também a direção estadual do PT no Rio Grande do Norte, como secretária estadual de movimentos populares do partido.\r\n \r\nEm 2016 aceitou o desafio de ser candidata a vereadora de Natal, movida pelo desejo de superar a sub-representação das mulheres e da juventude na Câmara Municipal de Natal e na política de uma forma geral, tendo como principal objetivo representar os movimentos sociais e as vítimas das opressões no âmbito do parlamento, apresentando propostas concretas para melhorar a vida das pessoas em situação de vulnerabilidade social e amplificando o grito das excluídas e dos excluídos em defesa de outro mundo possível, liberto de toda e qualquer forma de opressão.\r\n','nataliabonavides@gmail.com','10205822012583002'),(8496,'Marzeni Pereira','PARDA','MASCULINO','MASCULINO','1964-01-19','Nasceu no sertão da Bahia, começou a estudar aos 14 anos, depois se formou em tecnologia e  pós graduou em Engenharia de Saneamento Básico. Foi professor voluntário de cursinhos populares por mais de dez anos. Em  2015 foi demitido da Sabesp por denunciar a lógica de lucro da empresa e mostrar os verdadeiros culpados pela crise de abastecimento de água.\r\n\r\n','marzenips@yahoo.com.br','10207521163968224'),(8542,'Jéssica Pires','PARDA','FEMININO','FEMININO','1984-06-17','MILITANTE DO MOVIMENTO GOVERNO COLETIVO, DEFENDE QUE O MANDATO DEVE PERTENCER AOS SEUS ELEITORES E NÃO A PARTIDOS POLÍTICOS. ASSUMIU O COMPROMISSO DE OBEDECER AO QUE SEUS ELEITORES DECIDIREM NO GRUPO DA REDE DE SOCIAL <www.facebook.com/groups/covereadores>.\r\n\r\nPESSOALMENTE, DEFENDE OS PRINCÍPIOS DO BEM COMUM COLETIVO, DA SUSTENTABILIDADE E DOS DIREITOS HUMANOS.','jeupires@hotmail.com','1184867868236443'),(8722,'Ana Luiza Halfen','BRANCA','FEMININO','FEMININO','1963-03-21','Sou uma pessoa comum, não exerço cargo ou atividade que mereça destaque. Como a maioria, desejo uma sociedade mais humana. Acredito na política como ferramenta de transformação da realidade social de uma comunidade.\r\nSou candidata por entender que, como vereadora, posso contribuir para tornar a cidade mais humana, mais sensível aos problemas sociais, mais aberta às questões da diversidade, mais cuidadosa sobre as questões ambientais, onde o progresso resulte em qualidade de vida.','luizah_rs@hotmail.com','1446389368708882'),(8753,'Thiago Nascimento','BRANCA','MASCULINO','MASCULINO','1993-07-07','\r\nThiago Nascimento, 23 anos. Estudante de Administração na UNIDAVI. Candidato a vereador de Rio do Sul para defender aqueles que mais precisam do poder público e atender aos interesses do coletivo. Ser inclusivo em todas as proposições ao legislativo municipal. ','thi_ago_h@hotmail.com','10210363212026922'),(8812,'Filipe Binotti Pessoa','BRANCA','MASCULINO','MASCULINO','1998-07-21','Filipe Pessoa, 18 anos, sou microempreendedor individual e fundador de alguns projetos sociais em Caxias do Sul.\r\nSou o mais jovem candidato à Vereador, pois acredito que a política deve ser comandada diretamente pelo povo através das seguintes propostas:\r\n- criar o Conselho Cidadão para decidir como serão as votações do Vereador,\r\n- criar mecanismos para receber a opinião e projetos de leis dos caxienses,\r\n- selecionar os assessores do Gabinete do Vereador através de um concurso,\r\n- doar o valor do salário de vereador que exceder ao Salário Mínimo Necessário (DIEESE).\r\nEu poderei ser denunciado por qualquer pessoa, respondendo por falsidade ideológica e perder o meu mandato caso eu não cumpra com alguma dessas propostas pois eu assinei e registrei em cartório os meus compromissos.\r\nPesquise sobre mim através do meu Facebook ou pelo Google, você encontra várias reportagem de projetos sócio ambientais com o meu nome: Filipe Binotti Pessoa.\r\nAbraçooo','filipebpessoa@gmail.com','1117691898318473'),(8830,'Fabíola De Azevedo Lemos','BRANCA','FEMININO','FEMININO','1974-04-26','Sou Fabiola, cientista social e professora na rede privada de Ensino. \r\nTomada de uma boa dose de constrangimento é que disputo uma vaga pra vereadora na câmara municipal de Teresina, porque entendo que é enfrentando as contradições e os simbolismos estéreis, que poderemos fazer resistência a uma onda conservadora que avança sobre nossa sociedade. \r\n\r\nGrupos fundamentalistas se alargam no espaço político como uma verdadeira corporação voltada para constranger, intimidar e aniquilar todas as categorias identitárias que destoam do padrão imposto em nossa sociedade patriarcal, racista e heteronormativa.\r\n\r\nColocar-me-ei como guerreira incansável na luta pela promoção dos direitos das minorias, setores marginalizados que são a cada dia vitimados por uma política dogmática de indiferença e intolerância.\r\nMesmo entendendo o voto nulo como uma forma válida de protesto, peço que avalie o preço dessa decisão ante a possibilidade de contribuir para a garantia de direitos e conquistas que hoje se encontram seriamente ameaçadas.\r\n\r\nTendo como base um mandato voltado para a defesa das questões de gênero, identidades sexuais, direitos das mulheres em todas suas subjetividades sócio-culturais, é que adotaremos uma postura de amplo diálogo com os movimentos sociais e sociedade civil organizada.','biolalemos@yahoo.com.br','1402212359807784'),(8842,'Paulo Sergio Basto','BRANCA','MASCULINO','MASCULINO','1985-11-28','juventude, trabalho e compromisso ','sergio281185@hotmail.com','771000636374744'),(8861,'Isabella de Roldão','BRANCA','FEMININO','FEMININO','1975-08-23','Isabella de Roldão é advogada, casada, mãe de dois filhos e presidente municipal do PDT . Está em seu primeiro mandato como vereadora do Recife.  Educação, Empoderamento da Mulher, Mobilidade Urbana, Juventude, Gênero, Direito dos Animais e Sustentabilidade estão entre as suas prioridades. \r\n\r\nIsabella acredita que a cidade tem que ser para as pessoas!  E tem muito trabalho pela frente! A transformação está em nossas mãos!','paulosmborges@gmail.com','1104852459600761'),(9083,'Fabrício Araújo','BRANCA','MASCULINO','MASCULINO','1989-04-17','Assistente social, militou no Movimento Estudantil de Serviço Social, da Universidade Federal do Triângulo Mineiro - UFTM e do movimento secundarista de Uberaba. ','fabricioriber@hotmail.com','1192486077474749'),(9109,'Néia Urias','BRANCA','FEMININO','FEMININO','1973-08-24','Néia Urias, formada em LETRAS e Gestão Pública,  gerente dos Correios,  43 anos, primeira candidatura. ','neiaurias@hotmail.com ','1063935123684430'),(9124,'Lenilso Silva','PRETA','MASCULINO','MASCULINO','1985-04-21','Lenilso Luís da Silva é educador popular e acadêmico de História.  Iniciou sua trajetória  no movimento estudantil,  na Escola Básica Municipal Leoberto Leal e EEB Predro II. Também foi  aluno da PROMENOR. \r\n\r\nPor ser gay, negro e trabalhador tem sua história marcada no ativismo pelos Direitos  Humanos em Blumenau. Ajudou a construir vários coletivos de luta na cidade, como  por  exemplo,  contra  o  racismo  e  por  igualdade  racial e  na  defesa  dos  direitos  da  população LGBT (Lésbicas, Gays, Bissexuais, Travestis e Transexuais). \r\n\r\nSua sensibilidade  também direcionou a militância na promoção e democratização da cultura e apoiou os  movimentos feministas e de  mulheres em busca de igualdade. \r\n\r\n Ao  longo  de  toda sua  vida  esteve  presente  nos  principais  debates  por  uma  cidade  voltada à sustentabilidade e  respeito ao meio ambiente.  \r\n\r\nA  defesa  do  Estado  laico  e  o  reconhecimento  das  religiões  de  matrizes  africanas  (Umbanda e Candomblé) fazem parte das pautas defendidas por Lenilso. \r\n\r\n A  luta  pela  implementação  do  Estatuto  da  Juventude  e  o fortalecimento  do  Serviço  Público e valorização dos servidores têm sido um de suas eixo de debate e defesa de Lenilso.\r\n\r\nPor sua competência e liderança,  Lenilso foi assessor parlamentar da vereadora  Maria Emília e da deputada estadual Ana Paula  Lima, pautando o fortalecimento das  lutas sociais. \r\n\r\n  Lenilso é uma referência na defesa dos Direitos Humanos em Blumenau e Santa Catarina.  É um candidato a vereador necessário porque representa a diversidade do povo de Blumenau.\r\n\r\n Lenilso quer ser seu vereador, para honrar as pessoas, defender a vida justa, proteger  os mais frágeis e trabalhar para todos. Lenilso 13400\r\n\r\n','lenilso13@yahoo.com.br','10153750453647102'),(9287,'Marcelo Pereira','PRETA','MASCULINO','MASCULINO','1984-05-25','* Pai de Ygor (11 anos)  e Yago (2 anos). Casado com Fabiana.\r\n\r\n* Conhece bem e conviveu com os dramas das vilas e comunidades de Porto Alegre.\r\n\r\n* Foi reciclador de materiais na adolescência\r\n\r\n* 1996 Delegado do OP região Partenon\r\n\r\n* 1997 Coordenador de serviços voluntários na escola Padre Balduino Rambo\r\n\r\n* 1998 Departamento de Cultura da Associação de Moradores da Vila Maria da Conceição\r\n\r\n* 1999 eleito pelo voto direito delegado OP/RS representante Porto Alegre\r\n\r\n* 2000 Coordenou projeto Futebol Cidadania na escola Padre Balduino Rambo\r\n\r\n* 2001 participou da criação da Temática de Cultura do OP Porto Alegre\r\n\r\n* 2002 Trabalhou na Cootravipa como gari\r\n\r\n* 2002 Tornou-se conselheiro da associação da Associação de Moradores da Vila Maria da Conceição, até 2008\r\n\r\n* 2008 candidato a vereador, conseguindo 1069 votos em uma campanha militante (gastou menos de R$500,00 no total)\r\n\r\n* 2009 Vice-presidente da Associação de Moradores Vila Maria da Conceição (AMVMC)\r\n\r\n* 2009 trabalhou em uma das maiores rede de supermercados do Brasil\r\n\r\n * 2010 proprietário de uma agência de turismo\r\n\r\n * 2011 eleito presidente por unanimidade na AMVMC\r\n\r\n* 2012 conselheiro municipal de justiça e segurança de Porto Alegre\r\n\r\n * 2013 reeleito presidente da AMVMC com 63% dos 426 votantes\r\n\r\n* 2014 conselheiro do Conselho Municipal dos Direitos da Criança e Adolescente (CMDCA)\r\n\r\n* 2015 Reeleito presidente AMVMC\r\n\r\n* 2016 corregedor dos Conselhos Tutelares de Porto Alegre\r\n\r\n * Até hoje mora no meio da comunidade\r\n','marcelopereira1069@gmail.com','1048504491911420'),(9302,'Heitor Cesar Oliveira','PARDA','MASCULINO','MASCULINO','1981-07-11','Professor e educador, Heitor Cesar é candidato a vereador pelo Partido Comunista Brasileiro, onde milita há mais de 10 anos - Atualmente é membro do Comitê Central do PCB.\r\nO PCB e o PSOL estão aliados tanto na candidatura de Marcelo Freixo quanto na chapa de vereadores.\r\n Heitor, que faz questão de ressaltar que é Comunista, Portelense e Botafoguense, participou de diversas lutas da juventude e do povo carioca como a luta pelo passe livre, a defesa da educação pública, contra as privatizações do patrimônio público e outras. Atualmente militante do movimento sindical, atuando na oposição do sindicato dos professores do Rio.\r\n Foi diretor da Associação Municipal dos Estudantes Secundaristas (AMES) e da União Nacional dos Estudantes (UNE). Em 2006, foi um dos refundadores da União da Juventude Comunista (UJC). Sempre presente também no movimento cultural, participa de diversas resistências no âmbito da cultura, blocos de carnavais de esquerda e de defesa da cultura popular.  A campanha de Heitor tem como eixo central a luta pelo poder popular, e por uma cidade voltada aos interesses da classe trabalhadora. \r\nA campanha articula como elementos centrais a ampliação dos espaços democráticos no processo decisório e político como a criação de conselhos populares.\r\nLutamos contra a máfia dos transportes, defendendo a criação de uma empresa municipal de transportes públicos, o transporte precisa ser controlado e planejado pelo poder públicos.\r\nLutamos contra a privatização da saúde através das OSs ou qualquer outra forma de presença privada na saúde.\r\nDefendemos as escolas em tempo integral, assim como a realização de concursos para professores, funcionários e outras áreas importante para a educação, como psicólogos, nutricionistas, enfermeiros, médicos. Defendemos também creches em tempo integral. Defendemos a municipalização dos restaurantes populares e suas ampliação. defendemos a produção cultural popular, com o poder público criando as condições para a manifestação e produção cultural popular, bem como defendemos a cração de distritos culturais com a criação de espaços, museus, teatros e cinemas por bairros.','heitor.pcb@hotmail.com','1182547791803746'),(9321,'Osmar De Camargo','PRETA','MASCULINO','MASCULINO','1979-12-08','Sou professor de História,tenho 36 anos,e tenho um histórico de luta na área de Educação,Esporte,Cultura ,políticas públicas,e Direitos Humanos.','odcamargo@hotmail.com','1312129615478481'),(9435,'Indianara Sophia','PARDA','MASCULINO','MASCULINO','1971-05-18','Puta transfeminista vegana e Protetora animal.\r\nMoradora da zona oeste do Rio de Janeiro,luto por uma cidade e uma sociedade verdadeiramente livre,libertaria e solidária para todes,construida pelo afeto.\r\nTravesti e prostituta sou uma das referências de luta no Brasil pelo direito das pessoas transvestigeneres de serem chamadas por seu nome social e respeitadas independentemente de sua genitália,de como se portam,vestem ou se apresentam.\r\nSou idealizadora da CasaNem abrigo LGBTIQ e do PreparaNem pré vestibular para pessoas LGBTIQs.\r\nAtua na luta e prevenção às doenças sexualmente transmissíveis como HIV/AIDS e na inclusão das pessoas vivendo com hiv na sociedade.\r\nTambém foi organizadora da Marcha das Vadias de 2011 à 2016.\r\nDesde 1995 participa do encontro nacional de Travestis e transexuais sendo co fundadora desse movimento organizado no Brasil.\r\nFoi Presidente fundadora do Grupo Filadélfia da baixada santista ,também\r\nPresidente do Tranrevolução-RJ e co-fundadora da RedTrans Brasil.\r\n\r\n\r\n','indianarasiqueira@gmail.com','213700135713813'),(9490,'Jose Alberto Gomes Gomes','PRETA','MASCULINO','MASCULINO','1956-08-13','Sou professor há 25 anos,fui vereador de 97 a 2000 onde apresentei alguns projetos de relevância social,onde destacam-se, a luta contra o nepotismo,a defesa do meio ambiente e a defesa dos serviços públicos para atender a papulação com qualidade.Pretendo cumprir o papel do vereador de forma a atender dignamente os votos a mim confiados.','tete-prof@hotmail.com','1051090625007893'),(9519,'Diego Fernandes','BRANCA','MASCULINO','MASCULINO','1991-07-08','Sou um dos mais jovens candidatos à Vereador da nossa Cidade. Filho do Seu João e da Dona Maria dos Sorvetes Paloma, resido na Rua Pará de Minas, no Jardim Ipê, desde meu nascimento. Em 1998 iniciei meus estudos na Escola Municipal Ipê. Posteriormente estudei no Colégio Maria Lopes de Paula, até ingressar no glorioso Colégio Estadual do Paraná. Com meus 17 anos fui aprovado em Engenharia Elétrica na UFPR e na UTFPR. Optando pela segunda Universidade, conquistei meu título de Engenheiro aos 23 anos, em 2014, tornando-me ainda mestre em Engenharia em 2016, também pela UTFPR. Mesmo que para alguns isso não signifique nada, o conhecimento é a chave para mudarmos o mundo.\r\nDurante esses anos trabalhei como professor de Física e Matemática nos maiores Cursinhos Preparatórios para o vestibular de Medicina de Curitiba. Além disso, trabalho como professor particular para alunos das Engenharias de todas as Universidades da Capital.\r\n\r\n\r\nQuando ao questionário:\r\nCreio que um SIM ou NÃO é vago diante de uma grande discussão que deve ser feita nos temas. Existem situações que é preciso estabelecer sérias condições antes de se radicalizar por um ou outro lado!','diegofernandes.mdf@gmail.com','314589672238644'),(9559,'Davi Taborda','PARDA','MASCULINO','MASCULINO','1987-08-13','Sou líder comunitário há 3 anos,Presidente e orgazador de projetos sociais, vice-Presidente do PPL, ganhei destaque por lutar e reivincar por direitos sociais, tenho como objetivo baixar os salários dos vereadores,Prefeito,vice-Prefeito e cargos de comissão. Em nosso município não falta apenas asfalto, quero discutir e trazer para câmara de vereadores vários temas e assuntos antes esquecido, dou como exemplo a inclusão social, cultural, de lazer, de esporte e digital . Discutir sobre uma cidade mais humana é preciso , conto com seu voto no dia 2 de outubro 54000PPL','davi.taborda@yahoo.com.br','612238748937053'),(9615,'Eliana Souza','BRANCA','FEMININO','FEMININO','1980-01-13','Trabalhadora, universitária, mãe e militante de causas sociais há 20 anos. A militância junto a agricultura familiar e áreas urbanas de grande vulnerabilidade social me mostrou a necessidade de ocupar o espaço da política para buscar melhorias relevantes nas condições de vida das pessoas.\r\nLuto para que todos tenham acesso aos direitos constitucionalmente garantidos, porém não implementados.','eliluta@hotmail.com','1145270205527363'),(9760,'Ana Paula Coelho','PARDA','FEMININO','FEMININO','1983-06-06','Ei gente, sou Ana Paula Coelho Pereira Lopes, mais conhecida como Ana Coelho, a caçula de 4 filhos da professora Antônia de Padua e do administrador Pacifico Pereira. Sou ex atleta de futebol feminino com passagem pelos principais clubes de Belo Horizonte e pela Seleção Brasileira, sou professora da rede pública de BH a 12 anos, trabalhei muitos anos em projetos sociais com crianças carentes e pessoas com necessidades especiais e atualmente estou na vice direção de uma escola, eleita pelo segundo mandato consecutivo graças ao bom trabalho realizado na escola junto aos professores, funcionários, direção, alunos e comunidade. Nasci, cresci e moro no Sagrada Familia. Sempre fui uma pessoa interessada em política, sempre gostei de debater as propostas dos candidatos e acompanhava o que o meu candidato estava fazendo na câmara e assembléia. Me envolvi em projetos sociais, que estão presentes em minhas propostas, pois através deles conseguimos salvar a vida de muitas famílias, crianças e jovens carentes. O vereador é o canal mais rápido entre a população e a prefeitura, é através dele que as necessidades da população ganham voz e se tornam realidade!!! A população de Beagá merece respeito, o vereador está lá para trabalhar e é isso que vou fazer. Com minha experiência profissional percebi que com uma boa administração as coisas acontecem, e é isso que vou fazer na câmara dos vereadores,  por isso peço o seu voto e o de sua família, vamos renovar Belo Horizonte!!!!','anapcoelhoef@yahoo.com.br ','1135960133118346'),(9792,'Marcelo Tomate','BRANCA','MASCULINO','MASCULINO','1969-05-07','Meu nome é Marcelo moro em campinas à vinte sete anos ,sou servidor público de campinas sou candidato pois tem a intenção de melhorar à cidadão campineiro de trabalho e seriedade com hierárquico público.','Marcelo Tomate 11@gmail.com','1819503818281181'),(9868,'Paulo Malerba','BRANCA','MASCULINO','MASCULINO','1984-06-22','Paulo Eduardo Silva Malerba nasceu em 1984, em Jundiaí; Graduado em Sociologia e Política, Unicamp; Especialista em Políticas Econômicas, Berlin School of Economics and Law, Alemanha; Mestre em Ciência Política, Unicamp; Doutorando em Ciência Política, Unicamp; Funcionário Concursado do Banco do Brasil, desde 2003. Diretor da Federação dos Bancários da CUT-SP e do Sindicato dos Bancários de Jundiaí e Região. Eleito vereador pelo Partido dos Trabalhadores, com 3.288 votos no pleito de 2012 para a 16.ª Legislatura (2013/2016).','pauloemalerba@gmail.com','1112427458811802'),(9953,'Luciano Frontelle','BRANCA','MASCULINO','MASCULINO','1990-05-06','Somos dois compartilhando esse processo, Luciano Frontelle, candidato, com experiência em desenvolvimento, aplicação e avaliação de projetos com foco na juventude, atualmente tem trabalhado em projetos locais de empoderamento de comunidades  e é ativista em direitos humanos e justiça climática e Denise Oliveira, Co-candidata,  trabalha com projetos de empoderamento feminino e afrobetização. É co-fundadora do Adeola, ativista em causas de feminismo e negritude e empreededora social.','luciano.frontelle@gmail.com','10208883555339540'),(10186,'Dan Barbier','BRANCA','MASCULINO','MASCULINO','1985-10-28','','barbier.daniel@gmail.com','10210360005054924'),(10226,'Diego Martins','BRANCA','MASCULINO','MASCULINO','1995-03-21','Estudante de Direito, militante na área de educação, gestão pública transparente e desenvolvimento sustentável, Diego Martins é formado técnico em eventos no eixo de turismo e lazer e entrou na política através da luta por maior auxílio aos estudantes do município que tem de se deslocar do município para buscar um curso profissionalizante, técnico e graduação. Envolvido com a temática do meio ambiente organizou ações neste sentido como o grupo para limpeza do Parque do Lago. Possui um histórico na busca pela transparência e moralidade da administração pública. ','diego_wm2103@hotmail.com','1481958421830919'),(10234,'Luisa Tardem','BRANCA','FEMININO','FEMININO','1990-07-20','Luisa Tardem tem 26 anos, é formanda em Serviço Social pela UFF- Universidade Federal Fluminense e graduanda em Gestão de Turismo no CEFET- Centro Federal de Educação Tecnológica Celso Suckow da Fonseca. Milita no Movimento Estudantil desde 2011, participando do DCE da UFF e dos Centros Acadêmicos de Serviço Social-UFF e de Gestão de Turismo- CEFET. \r\nIngressou no PSOL em 2012 e atualmente é a presidente do Diretório Municipal do PSOL Cachoeiras de Macacu. \r\nLuisa é feminista, sensível as causas LGBTQ e participou de diversos eventos e projetos de pesquisa destes temas em sua vida acadêmica e enquanto militante. \r\nEstagiou durante um ano na UnATI- Universidade Aberta da Terceira Idade-UERJ, onde se aproximou das problemáticas que envolvem o envelhecimento humano, as demandas e os direitos dos idosos. \r\nRecentemente estagiou também no Hospital Municipal Celso Martins e teve a oportunidade de conhecer diretamente os aspectos positivos e negativos da saúde pública em nosso município. \r\nEm 2015 participou das manifestações pelo Transporte Universitário Municipal e acabou exercendo o cargo de presidente da Associação de Estudantes Universitários de Cachoeiras de Macacu durante dois semestres. \r\nLuisa Tardem acredita na importância da participação popular na tomada de decisões e por isso sempre que possível frequentou os conselhos municipais de políticas públicas e foi conselheira do Fórum Local da Agenda 21. \r\n\r\nO PSOL Cachoeiras de Macacu nasceu do anseio de jovens que gostariam de participar da política, de serem ouvidos e se sentirem representados. Diante disto, não poderíamos deixar de apresentar uma alternativa da Juventude!\r\nEsta é a Luisa Tardem, candidata a Vereadora pelo Partido Socialismo e Liberdade- PSOL com o número 50.000. \r\n\r\nPSOL 50! Você tem opção! ','luisatardem@hotmail.com','10209574118810340'),(10442,'Jucelio Andrade Jr.','BRANCA','MASCULINO','MASCULINO','1994-03-25','Tenho 22 anos, estudante de técnico enfermagem,  trabalhador do comércio e prezo pela união do povo para a mudança, em nosso município. Para que tenhamos voz, e sair da zona de conforto, de ficar só reclamando.  Quero ser a representatividade do povo e quem irá fazer a diferença no legislativo de nossa cidade.','jr.cgla@outlook.com','901907706580047'),(10444,'Anna Paula Assis','PRETA','FEMININO','FEMININO','1987-09-22','Sou Anna Paula Assis, nascida em Resende, filha de Ana Lúcia Lopes da Costa Assis e Luiz Eduardo Gomes de Assis (mais conhecido como Major do CDB). \r\nSou bacharel em Direito pela Universidade Estácio de Sá- Campus Resende, onde me formei em 2012. \r\nTrabalhei como estagiária de direito na Prefeitura Municipal de Resende e na Defensoria atuando na área cível e de família. \r\nMe candidatei com o intuito de ser uma representante da mulher na Câmara, precisamos de políticas públicas voltadas ao bem estar das mulheres e suas famílias, lutando pela mãe trabalhadora. Bem como para lutar pelas minorias e assim fazer com que tenham voz diante da nossa cidade. Para que possamos ter mais qualidade de vida e uma cidade melhor. ','annapaula.aasis@gmail.com','1463552666993844'),(10461,'Paula Faria Dias','BRANCA','FEMININO','FEMININO','1988-07-15','Juventude, mulher, mãe e professora. Uma existência que demanda muita luta pra combater as injustiças e desigualdades, muitas delas vividas na pele. Atuante no movimento social Levante Popular da Juventude, militante do Partido dos Trabalhadores e do sindicato dos professores de São Paulo (APEOESP). Propõe um mandato Coletivo e Popular para vereadora e acredita que a participação política tem o potencial de transformar a vida das pessoas e a cidade.','paulaof@msn.com','10154543936699730'),(10610,'Rafael Prata','BRANCA','MASCULINO','MASCULINO','1980-04-22','A candidatura de Rafael Prata é a expressão pública das ideias da Esquerda Marxista, seção brasileira da Corrente Marxista Internacional. Portanto, é uma candidatura coletiva, construída pelo esforço e dinheiro dos próprios militantes e trabalhadores que nos apoiam. \r\nRafael Prata é bancário e participa do movimento sindical da categoria. Formado em jornalismo pela UNESP/Bauru, com pós-graduação em Economia do Trabalho pela UNICAMP, escreve para o jornal “Foice & Martelo” e para o site www.marxismo.org.br. Já trabalhou como assessor de imprensa para os trabalhadores da Fábrica Ocupada Flaskô e para entidades sindicais. É militante socialista desde o movimento estudantil.\r\nNessas eleições, os mesmos políticos e partidos que sempre participaram desse regime de exploração e corrupção chamado capitalismo irão pedir seu voto. Desconfie de suas campanhas milionárias e de seus discursos vazios! Faça do seu voto um protesto e venha se organizar e lutar com a Esquerda Marxista!\r\nVamos à luta pelo Fora Temer e o Congresso Nacional, por uma Assembleia Popular Nacional Constituinte e um governo dos trabalhadores! Venha lutar com a Esquerda Marxista por um futuro radiante de socialismo e liberdade!\r\n\r\nfacebook.com/Prata50670 ','rafaelprataem@gmail.com','1433567449991412'),(10616,'Severino Souto Alves','BRANCA','MASCULINO','MASCULINO','1984-04-12','Severino iniciou sua militância ainda na adolescência. Durante o ensino médio, militou na União de Estudantes Secundaristas de Pernambuco (UESPE), seguindo no movimento estudantil, após ingressar no Curso de Direito da UNICAP, onde participou de várias gestões do Diretório Acadêmico Fernando Santa Cruz (DAFESC). Nesse período, participou ativamente do movimento contra o aumento das passagens de ônibus e das jornadas contra a mercantilização do ensino e em defesa das políticas estudantis inclusivas. Teve, ainda, atuação significativa na Comissão de Desenvolvimento Acadêmico da OAB, defendendo as iniciativas de proteção aos direitos do estagiário e a formulação de um ensino jurídico pautado pelos direitos humanos e demandas sociais.\r\n\r\nApós esse período, deslocou sua atuação política para o campo, quando atuou junto à Federação de Trabalhadoras e Trabalhadores da Agricultura Familiar (FETRAF), que milita em defesa da reforma agrária e do desenvolvimento solidário e sustentável.\r\n\r\nEm 2010, passou a militar na pauta da reforma urbana, articulando a criação do Coletivo de Luta Comunitária - CLC, que proporcionou organicidade e maior alcance à defesa do direito à moradia digna e do direito ao trabalho. A partir desse movimento, surgiram diversas associações de ambulantes, como as dos Hospitais Barão de Lucena e Agamenon Magalhães e a União de Barraqueiras e Barraqueiros da UFPE. Esse processo resultou na fundação do Sindicato das Trabalhadoras e dos Trabalhadores do Comércio Informal do Recife (SINTRACI) e da União de Comerciantes Ambulantes do Brasil (UNICAB), entidades empenhadas no reconhecimento dos direitos dos comerciantes informais e no combate do processo de “higienização” crescente nos centros urbanos.\r\n\r\nCom mesmo empenho, participou ativamente da luta por moradia no Recife, ao lado de comunidades como o Casarão da Jaqueira, a Ocupação do Bom Jesus, a Vila Oliveira, a Comunidade Deus Proverá e a comunidade do Zeppelin.\r\n\r\nAtualmente, tem se dedicado à rearticulação do Movimento de Trabalhadoras e Trabalhadores Sem Teto (MTST BRASIL), em Pernambuco. Também ajudou a fundar a Frente de Mobilização Povo Sem Medo, da qual participam diversos segmentos e movimentos sociais do Brasil. \r\n\r\nSe filiou ao PSOL, por se identificar com a defesa das causas populares e com a ética na política. É candidato a vereador por acreditar em uma vereança coletiva e popular construída com #AForçaDasRuas.\r\n\r\n#Severino50123','severino50123@gmail.com','10205451856575561'),(10627,'Rute Barbosa','PRETA','FEMININO','FEMININO','1972-09-12','Nascida e criada em Guarulhos, no Jardim Tranquilidade, Rute Barbosa é mãe de 5 filhos e filhas. Rute sempre foi reconhecida pela sua atuação em prol da cultura e por sua militância política. Durante a década de 90, manteve um Coletivo Cultural na sua residência e foi responsável por diversas produções culturais. No ano 2010 tornou-se mãe de gêmeos e dois anos mais tarde descobriu que um deles portava o autismo. Isso a incentivou ainda mais em suas lutas e a fez batalhar por mais uma causa: o atendimento especializado gratuito para os portadores de autismo na cidade. Hoje ela mora no Jardim São João Batista , na região do Cocaia.\r\n\r\nFoi colaboradora na primeira pesquisa de “Política e Cidadania”, realizada pela fundação Perseu Abramo, sendo a única entrevistadora da cidade e pode, desde então, conhecer todas as regiões de Guarulhos e obter conhecimento da opinião da população sobre seus valores democráticos, sua visão sobre as politicas afirmativas e concepções de democracia.\r\n\r\nA partir de 2001 começou a trabalhar na Prefeitura de Guarulhos. Em sua trajetória, ajudou a atender diversas demandas da cidade quando trabalhou como Gerente na Coordenadoria de Ação Local (CAL), encaminhando os problemas de estrutura da cidade para as secretarias da Prefeitura. Coordenou também importantes espaços na cidade, como o Centro Municipal de Educação Adamastor. Enquanto coordenadora sempre incentivou as iniciativas para a produção cultural, abrindo espaços para grupos de teatro, agentes, associações e ONGs, sempre respeitando os artistas locais e as iniciativas culturais independentes.\r\n\r\nComo responsável pelo Centro de Incentivo à Leitura Luís de Camões, implementou cine-debates, trouxe oficinas de capoeira , teatro e contação de histórias, com foco étnico racial e de luta contra o preconceito e o racismo.\r\n\r\nRealizou o planejamento de todas as Casas da Mulher, inclusive a Casa das Rosas Margaridas e Beth’s ao ser chamada para a Coordenadoria de Políticas para Mulheres. Neste período desengavetou o processo nº 59857/2010, que dá origem à criação do Conselho de Políticas para as Mulheres e em março de 2014 tornou-se a primeira presidente do Conselho.\r\n\r\nApoiou a criação do Centro Municipal de Educação e Artes (CEMEAR) e estruturou o projeto Projeto de Iniciação às Práticas Artísticas (PIPA). E ainda luta para a volta dos projetos de arte e educação que foram extintos e pelos direitos dos Arte Educadores.\r\n\r\n\"Luto para que as mulheres tenham autonomia na sociedade e espaço na política. Acredito que a arte deve ser considerada política pública prioritária, porque é peça fundamental para a libertação e inclusão de mulheres, jovens e crianças\". ','ruteguarulhos@gmail.com','1135673823169074'),(10802,'Otaviano Maia','PARDA','MASCULINO','MASCULINO','1983-11-21','O bairro da Gleba E foi onde passei toda a minha infância com minha mãe Luzia Maia e meus irmãos Marcelo, Juliana e Fernanda. Por influência da família, a minha militância começou desde cedo, aos 16 anos, período que participei de vários movimentos sociais e políticos em Camaçari. \r\n\r\nSou filiado ao Partido dos Trabalhadores (PT) desde 1999. Em 2000 ajudei a fundar a Juventude Petista e ocupei a função de secretário geral. Já em 2001/02 ocupei a vaga de dirigente da Associação Baiana de Estudantes Secundaristas (ABES). Atualmente faço parte da Esquerda Popular Socialista (EPS) do PT.\r\n\r\nA vivência política me conduziu a candidatura de vereador em 2012 e fui eleito com 1.587 votos. Atualmente, ocupo na Câmara a Presidência da Comissão de Cultura, Desporto e Lazer e sou relator da Comissão de Promoção da Igualdade Racial e Políticas Públicas para as Mulheres.\r\n\r\nCuidar das pessoas é a minha principal missão  desde quando ingressei na política. Nosso mandato é educativo, de mobilização e construção coletiva. Nossa campanha é militante. Nosso projeto é resultado do trabalho de esportistas, de mulheres, de jovens, de negros que resolveram se juntar para construir algo novo. A nossa campanha é a junção de um sonho, a força de uma ideia. Votar no 13 467 é apostar nessa ideia! É acreditar num projeto que está em construção, movimento constante para defender aquilo que acreditamos .\r\n','otavius.maius@gmail.com','1331126193571679'),(10833,'Douglas G Carlos','BRANCA','MASCULINO','MASCULINO','1967-02-24','Meu nome é Douglas Gomes Carlos, sou eletricista aposentado, após trabalhar por 28 anos na CEMIG. Sou casado há 26 anos e tenho 3 filhos, com 27, 25 e 22 anos, sendo duas filhas já casadas e um filho solteiro (o de 25 anos). Sou eletrotécnico e comecei a graduação em Gestão Pública. Faço parte do Conselho Municipal de Turismo de Gonçalves, onde estou como presidente. Pretendo usar meu tempo livre para escutar e atender os anseios de nossos cidadãos, defender o meio ambiente e as politicas sociais inclusivas. Trabalharei para que a Câmara seja de fato a casa do povo, onde todos tenham voz e vez! Conto com vocês para me ajudar nesta missão! Votem 13333- Douglas da Cemig','douglasgcarlos@gmail.com','1194202620641242'),(10862,'Fabio Pereira Bueno','PARDA','MASCULINO','MASCULINO','1983-11-11','Fabio Pereira Bueno, 32 anos, advogado, pós-graduando em Direito Constitucional, experiência profissional na Robert Bosch, Serviço de Saúde “Dr. Cândido Ferreira” e Corpo de Bombeiros, formação acadêmica na PUC-Campinas, formação escolar na ETEC Bento Quirino e EE Professor Carlos Lencastre.','fpbueno@yahoo.com.br','1112216855529970'),(10893,'Marcos Fontini','PRETA','MASCULINO','MASCULINO','1996-09-12','Tenho 20 anos, fiz parte da liderança comunitária do bairro Bela Vista em Vitoria-ES, sou membro ativo no fórum estadual LGBTT do ES, é minha primeira eleição e sou muito ativo na minha região com demandas de Direitos Humanos.','marcosfontini76@gmail.com','321814181511524'),(10920,'Adriana Vasconcellos','PRETA','FEMININO','FEMININO','1972-11-18','Professora , há 20 anos , sendo 10, completos esse ano, em Rede Municipal de Ensino.\r\nAtivista política pelas causas da população negra, mulheres , LGBTT e pela verdadeira inclusão das pessoas com alguma deficiência ,nas escolas e mercado de trabalho.\r\nEstá candidata por perceber que através da educação problemas que impedem a promoção da igualdade social e racial, são sanados.\r\nE com esse avanço do retrocesso o risco de perda dessa incersão social e promoção para uma igualdade racial e equidade de direitos estão ameaçados.\r\nPor isso me coloquei nesse desafio.\r\nAmo minha profissão e na força de transformação que ela possui.\r\n#Nóspornós','adrianavasconcellosadriana@outlook.com','1827349037551419'),(10930,'Daniela Pellizzari','BRANCA','FEMININO','FEMININO','1972-12-23','Professora de música, casada, 43 anos, catequista, conselheira Municipal de Saúde, conselheira Municipal de Proteção e Defesa da Causa Animal, presidenta do PT de Indaiatuba e suplente de vereador.\r\nFiliada ao PT desde 1991, tem uma trajetória política e partidária baseada no respeito e na coerência.\r\nSua atuação nos conselhos municipais preza pelo diálogo constante, sem perder o maior objetivo: fiscalizar os investimentos em políticas públicas. \r\nDa mesma forma, representará as mulheres, já que não há vereadoras eleitas na cidade, e, sem dúvida nenhuma, é preciso equilibrar a forma de se fazer leis, tendo também o ponto de vista feminino! ','dani.pellizzari@uol.com.br','1203109503044081'),(11191,'Mônica Alves','BRANCA','FEMININO','FEMININO','1960-07-22','Mônica  Alves é professora há 32 anos no município de vila velha , mestra em educação, aposentado pelo estado e trabalha na escola municipal próxima sua residência em Itapoa.  Atuante nas reivindicações do magistério e por uma educação pública de qualidade.  Apóia a luta dos servidores de vila velha e  sendo eleita quer da voz  aos grupos minoritários como mulheres, grupo lgbt, grupo afro descendente entre outros.','papisam@gmail.com','1254054751295434'),(11197,'Giane Souza Silva','BRANCA','FEMININO','FEMININO','1966-08-29','Professora de História ensino fundamental e médio\r\nMestre em Educação\r\nDirigente Sindical da APP-Sindicato\r\nParticipante da Marcha Mundial das Mulheres\r\nRealiza atividades nas escolas sobre diversidade\r\nParticipante da Equipe multidsciplinar do Colégio Tsuru Oguido\r\n\r\n','gianemarilia@gmail.com','10206958401192675'),(11483,'Liety Caruso','BRANCA','FEMININO','FEMININO','1971-08-10','Liety Caruso, empresária, contabilista e professora, é filha de uma tradicional família cotiana e neta do saudoso Maestro Manoel Vitorino dos Santos, autor do Hino de Cotia.\r\nÉ Granjeira, casada, tem um filho universitário e é conhecida na cidade por sua história de dedicação ao trabalhador; está à frente do EMPREGA COTIA SOCIAL - projeto estritamente social, onde soma mais de 40 mil membros atuantes e onde já recolocou mais de 9 mil trabalhadores de volta ao mercado formal de trabalho.\r\nÉ formada em Administração de Empresas, área que conheceu ainda criança, quando ia ajudar seus pais na antiga Fundição Munck e sua mãe lhe apresentou o RH, foi paixão instantânea e desde então não parou mais!\r\nÉ Pós-graduada em Controladoria, especializada em Orçamentos & Custos. \r\nLiety Caruso está preparada para assumir a responsabilidade de representar o povo de Cotia.\r\nPossui uma bagagem de mais de 22 anos na administração e gestão de grandes empresas e desde 2010 é proprietária do EMPREGA COTIA ASSESSORIA;\r\n“-Atendemos os jovens e apoiamos o trabalhador na busca de recolocação, oferecendo cursos profissionalizantes, treinamento, elaboração de currículos e preparo para entrevistas”, diz.\r\nPelo bom resultado do programa, Liety Caruso foi incentivada a disputar uma vaga na Câmara Municipal de Cotia e contribuir, de forma positiva, com sua cidade natal e que tanto ama.','lagartixa04@yahoo.com.br','1810667299180018'),(11516,'Ricardo José Colin Filho','PARDA','MASCULINO','MASCULINO','1997-04-30','Apesar de uma boa parte de vocês já saber, vou anunciar \"oficialmente\" minha decisão agora.\r\nSou pré-candidato a vereador de Itatiba pelo PSOL.\r\nA pouco mais de um ano eu me filiei ao PSOL e hoje luto junto ao Domínio Público. Ano passado fui eleito delegado para representar a juventude itatibense na conferência estadual da juventude em Atibaia.\r\nSou formado em técnico de informática, cursado integradamente ao ensino médio pelo Rosa Perrone e hoje estou indo para o 2° semestre da faculdade de Direito na Universidade São Francisco de Itatiba.','r.j.c.filho@gmail.com','1190716120990336'),(11546,'Diego Tormes','BRANCA','MASCULINO','MASCULINO','1980-10-10','Graduado em Letras. Especialista em Direito educacional. Mestre em educação e políticas públicas. Professor há 17 anos. Ex.conselheiro de educação e do FUNDEB. Filiado ao PSDB desde 2001. Já atuou em trabalho voluntário na comunidade e nos bastidores da política municipal e estadual. Presta consultoria e assessoria sobre legislação e educação. Durante 4 anos coordenou os 497 municípios do RS na área da educação, foi um dos criadores do projeto \"Caminhos da Leitura\" uma política púnica de leitura premiada nacionalmente.','diego_tormes@yahoo.com.br','1211136502240383'),(11584,'Cristiano Setragni','BRANCA','MASCULINO','MASCULINO','1976-02-17','Jornalista, colunista no Portal Corrente e estudante de Direito na UESPI.\r\nEx representante da sala, ex representante do colegiado de direito, ex representante do conselho da UESPI.\r\nCandidato à vereador com propósito de trabalhar 40 horas semanais, estar diariamente nas localidades do interior e bairros.\r\nAbrir espaço para o cidadão poder falar na tribuna em todas as sessões, levar uma vez por mês a sessão da câmara para um bairro.\r\nLutar pela juventude buscando recursos para praças com WI-FI, pistas de skates, campos de futebol.\r\nBuscar apoio para uma reforma geral da UESPI.','cristianoset@hotmail.com','936634513109539'),(11697,'Roberto Rosa','BRANCA','MASCULINO','MASCULINO','1970-08-26','Meu nome é Roberto Fernandes Rosa,  nasci no estado do Paraná, e moro em Campinas-SP desde 1989. Campinas é uma das cidades que me acolheu e me deu tudo que tenho hoje. \r\nDurante muito tempo morei em zonas menos favorecidas da cidade, acompanhei de perto as dificuldades das períferias; como a falta de pavimentação asfáltica, saneamento básico, de investimentos na saúde e educação;  Devido à todos os problemas decorrentes em nossa cidade, resolvi me candidatar à vereador em Campinas pela primeira vez, e meu maior sonho é poder ver que as pessoas moram em uma cidade onde tudo funciona melhor, onde a prioridade é a população e a voz do povo é levada em consideração. Quero fazer o que nenhum outro faz; fazer a cidade crescer; porque eu acredito que Campinas pode  mais !','robertofernandes1382@gmail.com','1205957659467342'),(11741,'Cristina Aydar Arantes','BRANCA','FEMININO','FEMININO','1966-08-15','Eu sou Cristina Aydar Arantes,  formada em Magistério, Geografia e Pedagogia, sendo pós graduada em geografia. Atualmente trabalho nas duas redes públicas de ensino: EE Sansara Singh Filho(Ouroeste), como Diretora de Escola e na EMEF Othaydes Luiz Arantes, como Professora Orientadora, sendo que no estado trabalho desde 1988, portanto há 28 anos.Já fui promovida em sete concursos públicos estaduais, do estado de São Paulo e três municipais, sendo um pelo município de Palmas e outros dois pelo município de Indiaporã. \r\n	Dentro do nosso Município já trabalhei como professora de geografia nas escolas João Luiz de Souza(Tupinambá) e Dathan Cervo, como Coordenadora Pedagógica nas escolas Othaydes e Dathan, diretora e vice diretora da escola Othaydes.\r\n	Dentre tantos sucessos profissionais alcançados, recebe destaque a inovação do ensino, promovida pela Equipe de Professores e gestores, implantando o sistema de etapas o que gerou a elevação meteórica dos índices da qualidade da educação municipal durante minha gestão (2013 a 2015), que em nível federal(IDEB), superou a meta de 2021 que seria 6.7, atingindo 7,6, classificando-se em 5º lugar no estado de São Paulo e 1º na Redião de São José do Rio Preto. Em nível estadual(IDESP), A escola Othaydes superou a meta do estado para 2030, que é 7.0, atingindo 7,48.\r\n	Uma de minhas características é defender os direitos dos profissionais sob minha responsabilidade e valorizar a  importância de cada um na equipe, portanto eu defenderei sempre a melhoria e valorização da educação e de todos os serviços públicos, buscando justiça quando os direitos de cada um forem desrespeitados.\r\n\r\n\r\n\r\nVOTE CRISTINA\r\n\r\nVOTE 15.123\r\n','cristinaydar@hotmail.com','1028899937222772'),(11767,'Nivanea Maria Rodrigues Soares','PARDA','FEMININO','FEMININO','1981-03-13','','nivanea@hotmail.com','1561861867172770'),(11801,'Carlos Arthur Faustini','BRANCA','MASCULINO','MASCULINO','1991-01-09','Olá, sou o Nino, candidato a vereador. Sou comerciante, tenho 25 anos, ativista político e membro diretor da AAMA, Associação dos Amigos dos Mananciais de São José do Rio Preto. Além da causa ambiental, defendo a participação popular no cotidiano político, com a construção de mandatos pluriparticipativos e implantação de mecanismos de consulta popular! Sou contra a reeleicao, tanto para o legislativo, quanto para o executivo. Política é missão, jamais profissão.\r\n','faustinino@gmail.com','10211405845520896'),(11830,'Wesley Silva','BRANCA','MASCULINO','MASCULINO','1987-04-05','Presidente do PTB Cotia Diversidade\r\nRelaçao estável / 29 anos / Ariano / Morador do Atalaia\r\nCriado em família de baixa renda, superou preconceitos, conquistou seu espaço e respeito dando o exemplo e respeitando todos a sua volta.\r\n?\r\nGraduando em Sociologia com cursos em ética e ciências políticas. Luta pelas minorias, pela inclusão social, diversidade cultural, inter religiosidade respeitando o estado laico, público LGBT e combate à exclusão social, preconceito, racismo, xenofobia e segregação.\r\n?\r\nDesde os 16 anos engajado com projetos de apoio ao jovem e público LGBT. Foi coordenador do projeto xteens na cidade de São Paulo que prestava apoio aos jovens LGBT no auxílio a aceitação social, auto aceitação, inclusão social e luta contra o preconceito, além de promover espaços culturais, eventos e encontros interacionais. Participou do JAH, núcleo de organização da parada LGBT de São Paulo e da construção da associação casusa em Cotia/SP - projeto LGBT pioneiro no município - que buscava trazer as conquistas já obtidas na capital para a cidade.\r\n?\r\nCansado de ter as ideias podadas pelas gestões municipais e interesses políticos contraditórios dos próprios integrantes dos projetos, aceitou o convite do PTB Cotia para presidir o PTB Cotia Diversidade e se lançar como candidato a vereador pelo município.\r\n?\r\nAcredita que somente a sociedade unida por um bem comum, com direitos igualitários, oportunidades a todos e respeitando o espaço e individualidade do outro, pode se tornar uma sociedade próspera e de bem.\r\n?\r\nVenha conosco nessa luta!','wesleyguto@hotmail.com','1182377485155518'),(11893,'Eduardo Beganskas','BRANCA','MASCULINO','MASCULINO','1979-08-02','Entrei na política para fazer a diferença como cidadão não aguento mais ficar olhando os crimes cometidos por políticos sou pai de três filhos e quero fazer a minha parte para que todos possam se orgulhar do Brasil , estamos em uma crise moral acima de tudo as pessoas não acreditam na política é isso que eu quero resgatar através de um trabalho sério e de igualdade para todos! ','eduestacionamentos@hotmail.com','648528961972465'),(11919,'Iara Bernardi','BRANCA','FEMININO','FEMININO','1952-06-02','Iara Bernardi é professora e Mestre em Biologia da Conservação e Biodiversidade pela UFSCar. No final da década de 70, engajada na luta pela Anistia Política, tornou-se Coordenadora Regional do Comitê Brasileiro pela Anistia (CBA). Participou de greves e lutas dos professores como liderança da APEOESP (Sindicato dos Professores do Ensino Oficial do Estado de São Paulo) e foi a primeira vereadora mulher eleita a tomar posse em Sorocaba, em 1982, juntamente com Diva Prestes de Barros, permanecendo na Câmara Municipal até 1996.\r\n\r\nComo vereadora, sempre teve na educação e nos direitos humanos (sobretudo da mulher) suas maiores bandeiras. Lutou por um transporte público mais digno, eficiente e livre do monopólio, por mais leitos para mulher nos hospitais públicos e pela regularização fundiária de diversos bairros de Sorocaba, como Aparecidinha, Jardim Refúgio, Parque das Laranjeiras, Humberto de Campos, Retiro São João e Itanguá II.\r\n\r\nIara atuou para obter melhorias no Conjunto Hospitalar de Sorocaba, foi autora do projeto que instituiu classes de educação especial nas escolas de 1o e 2o grau e trabalhou por melhorias na educação e construção de prédios escolares em bairros afastados. É autora da primeira proposta de lei que criou o Conselho Tutelar na cidade e também da lei, de 1992, que criou a Casa Abrigo para mulheres e crianças vítimas de violência doméstica, uma das primeiras do gênero no Brasil.\r\n\r\nEm 1998, Iara elegeu-se deputada federal, cumprindo três mandatos em Brasília, onde continuou a defender importantes causas, agora por toda a região de Sorocaba. Foi relatora do FUNDEB (Fundo de Manutenção e Desenvolvimento da Educação Básica e de Valorização dos Profissionais da Educação) - onde por seu intermédio as creches foram incluídas para receber recursos desse Fundo - e integrou a comissão especial que discutiu e aprovou o Plano Nacional de Educação (PNE). A articulação política de Iara deu a Sorocaba sua primeira universidade federal, a UFSCar. Ela também foi responsável por trazer a cidades do Estado (incluindo Sorocaba) unidades do Instituto Federal de Educação e Tecnologia do Estado de São Paulo (IFSP), oferecendo ensino técnico e gratuito de qualidade.\r\n\r\nEm 2007, foi convidada pelo então presidente Lula para representar o Ministério da Educação (MEC) no estado de São Paulo, onde conseguiu excelentes resultados incentivando a implantação de Programas Federais na área da educação para as redes de ensino. Voltou para a Câmara em 2013.\r\n\r\nOutro ponto de destaque na vida política de Iara Bernardi foi sua participação como membro da Comissão Especial que discutiu a Lei Maria da Penha e muitas outras ações em defesa dos direitos humanos, das mulheres e da educação. Durante seus três mandatos, Iara aprovou quatro leis e uma resolução (veja abaixo).\r\n\r\nPelas ações de Iara em Brasília, Sorocaba e região receberam mais de R$ 16 milhões em recursos do governo federal somente nos últimos dois anos de mandato, vindos por meio de emendas ao Orçamento e outros projetos, para investimentos em cerca de 40 municípios nas áreas de Saúde, Educação, Infraestrutura, Turismo, Comunicação e Tecnologia, Desenvolvimento Social, Agricultura e Patrimônio Histórico. \r\n\r\nAutora de cinco leis e um projeto de resolução:\r\n\r\nResolução 205/2013 - Prêmio Nelson Mandela - Institui o Prêmio Nelson Mandela de Ensino da História da África e das Relações Étnico Raciais, destinado a agraciar, anualmente, três pessoas físicas ou jurídicas, escolhidas entre as indicadas, cujos trabalhos ou ações mereceram especial destaque na promoção da igualdade racial.\r\n\r\nLei 12.845/ 2013 - Atendimento às vítimas de violência sexual - Esta lei visa o atendimento imediato, multidisciplinar e gratuito às vítimas de violência sexual, num hospital público ou credenciado ao Sistema Único de Saúde (SUS).\r\n\r\nLei 11.106/2005 - \"Mulher honesta\" - Prevê, dentre outras alterações, a extinção do crime de adultério e a substituição de termos como \"mulher honesta\" e \"mulher virgem\". A lei sancionada também prevê a extinção dos incisos do Código Penal que permitiam a impunidade do estuprador se a vítima casasse com o agressor ou com terceiro.\r\n\r\nLei 10.886/2004 - Violência Doméstica - Acrescenta parágrafos ao art. 129 do Decreto-Lei nº 2.848, de 7 de dezembro de 1940 - Código Penal, criando o tipo especial denominado \"Violência Doméstica\". Esta foi mais uma vitória aos brasileiros, na preservação do bom convívio familiar e proteção daqueles que estão vulneráveis à violência.\r\n\r\nLei 10.224/ 2001 - Assédio Sexual - A lei n° 10.224/ 2001 criminaliza através do Código Penal Brasileiro o ato de assédio sexual àqueles que, pela posição hierárquica, se beneficiem sexualmente de outra pessoa.\r\n\r\nLei 3925/1992 - Casa Abrigo - Institui o albergue municipal para a mulher vítima de violência e dá outras providências.\r\n','iarabernardi@gmail.com','1452364028111970'),(11929,'Leonardo Broilo','BRANCA','MASCULINO','MASCULINO','1990-10-28','Tenho 25 anos, sou Secretário Municipal de Juventude do PSOL-NH, designer, militante da juventude e cultura popular.','leonardo.broilo@hotmail.com','1159346140780443'),(11944,'Nilvan Bajona','PARDA','MASCULINO','MASCULINO','1958-11-11','Militante do PT e movimentos sociais e populares há mais de 30 anos. Participante do Movimento Negro. Um dos fundadores do PT no Municipio de Rio Preto e fui durante dois anos presidente da Asociação dos Deficientes Físicos de Valença (RJ). ','nilvan.bajona.rp@gmail.com','1195776757146030'),(11977,'João Ferraz','BRANCA','MASCULINO','MASCULINO','1985-02-20','Pré-candidato: João Francisco Ferraz de Lima - PC do B – Ourinhos nº 65.789\r\n\r\nMini – Currículo:\r\n\r\nIniciou-se sua carreira profissional como Guarda Mirim em Ourinhos, onde ficou dos 14 aos 17 anos e posteriormente foi trabalhar na Livraria Nobel.\r\n\r\nAos 18 anos ingressou no Exército Brasileiro na cidade de Curitiba – PR onde foi soldado de primeira categoria no Parque Regional de Manutenção da 5º Região Militar (Paraná e Santa Catarina)\r\n\r\nBacharel em Serviço Social Pela Faculdades Integradas “Espirita” Curitiba - PR. Membro do Centro Acadêmico de Serviço Social e Coordenador Regional da Executiva Nacional de Estudantes de Serviço Social - ENESSO\r\n\r\nPós – Graduado em Educação Meio Ambiente e Desenvolvimento pela Universidade Federal do Paraná – UFPR – Curitiba – PR. Publicando o um capitulo no livro “Socio-ecologismo: Clamores dos povos do Sul” pela Editora da UFPR.\r\n\r\nConcursado como Assistente Social na Prefeitura de Santa Cruz do Rio Pardo por 3 anos atuando como Coordenador de CRAS, Coordenador de Central de Penas e Medidas Alternativas e Presidente do Conselho Municipal do Idoso por dois anos.\r\n\r\nProfessor de Sociologia na Escola Estadual Esmeralda Soares Ferraz, lecionando para o Ensino Médio.\r\n\r\nProfessor de Participação Cidadã do PROJOVEM – Urbano da Prefeitura Municipal de Ourinhos.\r\n\r\nAtualmente é Assistente Social, concursado no CREAS – Centro de Referência Especializado da Assistência Social de Ourinhos – SP atuando principalmente com idosos na defesa e proteção contra violações dos direitos dos idosos em nosso município. Com artigos publicados sobre o assunto em Congressos na USP - Leste, UNICAMP e na UNESP – Assis.\r\n\r\n \r\n\r\nPropostas de campanha:\r\n\r\n1º Criar em nosso município a “Tarifa Social da Agua” as famílias que estão cadastradas no Cadastro Único de Programas Sociais (Famílias de renda total até 3 salários) passaram a pagar uma tarifa mínima de 15 reais mensais.\r\n\r\n2º Criação do Conselho Municipal da Juventude: Este conselho irá formular de forma coletiva e com amplo debate as políticas publicas de Acesso ao emprego, uso dos espaços públicos, lazer, esporte e responsabilidade socioambiental, direcionadas a jovens de 14 a 29 anos.\r\n\r\n3º Criação da Coordenadoria de atenção ao Idoso: Este equipamento terá a missão de integrar as ações de proteção e promoção de direitos das pessoas idosas, atendendo e referenciando os idosos vítimas de violências organizando as parcerias com a rede de serviço socioassistencial para promover um envelhecimento ativo e saudável. \r\n\r\n4º Apresentar projeto de lei para que todas e todos funcionários públicos tenham o auxílio alimentação sem distinção de cargos e salários. Atualmente apenas quem recebe até R$ 1.800,00 tem esse direto garantido.\r\n\r\n5º Ampliação das vagas nas CRECHES e com a possibilidade de atendimento das 7 da manhã as 19 horas, assim as famílias poderão buscar os filhos a partir das 17 até as 19, contemplando os trabalhadores do comercio entre outros.  .\r\n\r\n6º Na área da Saúde criaremos em cada Unidade Básica de Saúde, um Controle social que será exercido por um conselho local formado pela coordenadora(o) do equipamento, um médico, um enfermeiro, um agente comunitário de saúde e 5 membros da comunidade usuária do serviço. Este conselho irá se reunir uma vez por mês e discutirá, horário de atendimento dos médicos, a falta de medicamento, as campanhas e como promover a saúde básica na comunidade.','j.ferraz21@gmail.com','1144137278959095'),(12106,'Wangy Alves','PARDA','MASCULINO','MASCULINO','1973-07-17','WANGY  ALVES\r\n13017\r\nCULTURA NÃO PODE FALTAR!!!\r\nAgente Cultural, Professor, Historiador, Pesquisador, Ator e Diretor de Teatro.\r\nAtua no Movimento Cultural de São José dos Campos há mais de 20 anos.\r\nFuncionário concursado da Fundação Cultural Cassiano Ricardo a 23 anos, agente cultural, coordenou a Casa de Cultura Chico Triste nos anos de 1995 a 1998 e 2003 a 2011, o Cine Santana (1998 a 2003), e o CET – Centro de Estudos Teatrais (desde 2011). Participou da curadoria do Festivale e da Mostra Joseense de Teatro. Idealizador dos projetos Semana Chico Triste, Domingo no Parque e Noites em Processo,  além de ter atuado em diversos movimentos culturais da cidade.\r\nFundador do Ponto de Cultura Velhus Novatus , atuando como ator, diretor e gestor, tendo desenvolvido diversos projetos tais como:  Arte na Feira, Bloco Uai Folia, Saraus Poéticos, Pesquisas sobre a história do bairro de Santana , da cidade e do Vale do Paraiba.\r\nCandidato a vereador,  propõe atuar na valorização da arte, cultura, educação e cidadania cultural da nossa cidade.\r\nAtua e trabalha para a valorização e o entendimento da arte e da cultura enquanto direito e fator transformador da nossa sociedade.\r\nPropõe a construção de ações que valorizem a arte, a cultura, o patrimônio cultural, material e imaterial, natural, e a consolidação da Cidadania Cultural em nossa cidade. Por quê?\r\nCULTURA NÃO PODE FALTAR!!!\r\n','wangyalves@gmail.com','1158384314225305'),(12109,'João Felipe','BRANCA','MASCULINO','MASCULINO','1992-03-31','','jflacerda65@gmail.com','1095494390528614'),(12172,'Sacomory Antonio','BRANCA','MASCULINO','MASCULINO','1962-06-16','ANTONIO LUIS BERED SACOMORI, nasceu em Porto Alegre,casado,duas filhas,Diretor de cinema,Pós-graduado em Jornalismo,professor universitário,mestre em comunicação social.Na TV, cobra os políticos.Como Super Sacomory,resolve problemas das comunidades.É o povo pode desabafar e \"chutar o balde\".leva alegria e otimismo a população,mas também vê de perto suas dificuldades. Como vereador,irá cobrar as soluções com o estilo que é a sua marca:Firmeza,energia e irreverência.','sacomoryportoalegre@gmail.com','1140718372675042'),(12211,'Ronaldo Bragança','','','','1981-11-10','','bragancapjcs@yahoo.com.br','1086745031403122'),(12215,'Eder Máximo','PARDA','MASCULINO','MASCULINO','1986-07-19','Sou Eder Alberto Ramos Maximo, conhecido como Eder B2, isso por conta do comércio de minha família no km 18, uma loja de roupas e calçados, a B2. Certamente você já me viu por lá, afinal de contas e graças a Deus são 16 anos somente neste local.\r\n\r\nEu nasci e fui criado em Osasco, conheço os quatro cantos desta cidade, tenho um diálogo permanente com os movimentos sociais, comerciantes, moradores e trabalhadores. Sou comerciante, empreendedor social e produtor cultural, tenho 30 anos, sou casado e pai.\r\n\r\nVenho para esta eleição com a certeza de que além de promover o debate, vou representar os desejos e pautar as causas coletivas daqueles que não se sentem representados há anos.\r\n\r\nNa última eleição para vereador em 2012, fui candidato e obtive quase 2000 votos de confiança, o que me tornou 1º suplente do PSL – Partido Social Liberal.\r\n\r\nEu proponho abrir o mandato, discutir as propostas e dar publicidade aos nossos atos e trabalhos, que este seja o \'\'nosso mandato\'\' na Câmara Municipal.\r\n\r\nNesses quatro anos que se passaram, andei muito pela cidade, conversei e ouvi pessoas de vários bairros e das mais diversas opiniões. Acumulei conhecimentos sobre os principais problemas da cidade, participei de debates e me especializei em políticas públicas, me preparando para o momento de representá-lo como vereador. Agora, com a tranquilidade de quem não está sozinho, posso afirmar, estou preparado para este desafio!\r\n\r\n	\r\n	\r\n','eder_b2_psl@ig.com.br','1122652887788776'),(12332,'Fernando Coelho da Silva','PARDA','MASCULINO','MASCULINO','1987-10-08','Vamos de 13333 para vereador Fernando Coelho ','Fernando-181@outlook.com','1190187961025005'),(12437,'Fernando Coelho','BRANCA','MASCULINO','MASCULINO','1984-04-19','Militante pelos direitos humanos e minorias. ','fernandocoelho.psol@hotmail.com','1119834851441294'),(12479,'André Castelo Branco Machado','BRANCA','MASCULINO','MASCULINO','1981-09-16','André Castelo Branco Machado é historiador, formado pela UFPR – Universidade Federal do Paraná. Fez mestrado na área de tecnologia e trabalho pela UTFPR, pesquisando as mudanças tecnológicas do setor bancário brasileiro. Trabalha, desde 2004, no Banco do Brasil. \r\n?Começou sua militância desde jovem, no movimento estudantil. Foi Coordenador Geral do Diretório Central dos Estudantes da UFPR e posteriormente da diretoria da União Nacional dos Estudantes (UNE). Destacou-se como uma liderança jovem na luta contra a venda da COPEL, em 2001, e na campanha \"UFPR VIVA\", defendendo nossa universidade federal que estava ameaçada de fechar as portas nos últimos anos do governo FHC. \r\n?No banco, André Machado se tornou uma liderança sindical, sendo secretário de comunicação do sindicato e indicado como representante dos funcionários do Paraná na comissão nacional de negociação com o Banco do Brasil, em 2013. No ano seguinte, foi eleito presidente do Conselho Estadual das Associações Atléticas do Banco do Brasil, coordenando projetos culturais, sociais e esportivos e a gestão do sistema AABB no Paraná.     \r\n É um dos coordenadores da Plenária Popular do Transporte de Curitiba e participou, em 2013, como um dos representantes da sociedade civil na auditoria do transporte coletivo, identificando os graves indícios de fraude na licitação da operação dos ônibus da capital. Tornou-se um incansável lutador contra os privilégios da máfia do transporte e as demais máfias que controlam Curitiba.\r\nEscreve cotidianamente no seu blog sobre política e cultura. Fez parte do Conselho de Ética dos Jornalistas. Publica mensalmente a coluna \"Nossa cidade\" na revista do Sindicato dos Servidores Municipais de Curitiba (SISMUC).','andrecbm@yahoo.com.br','1251600258217618'),(12521,'Olimar Müller de Queiroz','BRANCA','MASCULINO','MASCULINO','1974-11-29','PROFESSOR OLIMAR 18123\r\nProfessor Olimar, 41 anos, é professor das Ciências Exatas há 23 anos. Casado com Jaqueline, servidora do Hospital Centenário, com quem tem 3 filhos. Acadêmico de Direito. Exerce a função de porta-voz da REDE Sustentabilidade e foi assessor parlamentar na Assembleia Legislativa RS e na Câmara dos Deputados. De uma década de experiência na ONG Parceiros Voluntários, constatou que promovendo o voluntariado nas escolas podemos reforçar a autoestima dos nossos jovens. Busca a resolução de conflitos pelo diálogo permanente, sendo um dos coordenadores do Movimento pela garantia do Turno Integral nas Escolas de Educação Infantil (creches), e também um forte defensor dos servidores públicos. Professor Olimar 18123, é a escolha para a renovação inteligente, uma voz firme, atuante e independente na Câmara de Vereadores.','jaquehq@gmail.com','10208564979454627'),(12563,'Linoberg Almeida','PRETA','MASCULINO','MASCULINO','1976-10-30','Natural do Gama, cidade satélite do DF, professor Linoberg concluiu graduação e mestrado em Sociologia e doutorado em Relações Internacionais e Desenvolvimento Regional da Amazônia pela Universidade de Brasília (UnB). É professor efetivo da Universidade Federal de Roraima (UFRR) no curso de Ciências Sociais e do Programa de Pós-Graduação em Desenvolvimento Regional da Amazônia. É diretor do Centro de Ciências Humanas (CCH/UFRR). Participa de eventos científicos nacionais e  internacionais, com publicações científicas de relevância no campo social.\r\nPor meio de projetos de educação continuada para guardas municipais, policiais e agentes, faz capacitação com Direitos Humanos, Sociologia Antropologia aos servidores do sistema. Pesquisador do  Sistema Carcerário local, sistema de segurança pública, é comumente convidado aos debates sobre gênero, raça/ etnia, preconceitos, violências contra mulheres, LGBTs, indígenas. ','linoberg@yahoo.com.br','1211230122270738'),(12582,'Ricardo Dutra','BRANCA','FEMININO','FEMININO','1966-11-19','Protetora independente que se dedica a anos ao resgate, tratamento e doação de animais abandonados ','ricardodutrarp@yahoo.com.br','1057495257700916'),(12588,'Soninha Francine','BRANCA','FEMININO','FEMININO','1967-08-25','\r\nSoninha Francine, 49 anos, nasceu em Santana, na Zona Norte de São Paulo. Fez Magistério no segundo grau e Cinema na USP. Trabalhou dez anos na MTV como produtora, redatora, diretora e apresentadora. Criou, dirigiu e apresentou um programa diário para jovens na TV Cultura e foi comentarista esportiva na ESPN-Brasil, Folha de São Paulo e Rádio Globo-CBN. Participou do programa Saia Justa, no canal GNT. Eleita vereadora pelo PT em  2004, foi autora, entre outros projetos, da lei que obriga a prefeitura a adquirir materiais reciclados; que obriga toda a administração pública a publicar na internet o nome de seus funcionarios e a função que exercem; que cria os Conselhos de Meio Ambiente nas Subprefeituras e o Conselho Municipal de Juventude; que obriga a instalação de bebedouros em casas noturnas; que institui o Preio Sabotage na Camara Municipal. Defendeu, junto com Carlos Gianazzi, do PSOL, o projeto que concede poder a prefeitura para punir atos de LGBTfobia, mas o PL nao foi aprovado. Destinou Emenda Parlamentar à recem-criada Coordenação de Politicas para a Diversidade. Foi uma das responsáveis pela retomada do projeto dos CEUs, criados por Marta Suplicy, na gestao Serra, bem como defensora dos Telecentros, que foram ampliados. Lutou pela aprovação do Projeto de Lei do vereador Paulo Teixeira que regulamentava a classificação de imovel sub-utilizado ou abandonado para fins de aplicação do IPTU progressivo, mas o PL foi boicotado pelos demais vereadores (inclusive do PT). Deixou o partido em 2007. Disputou a prefeitura de São Paulo em 2008 pelo PPS e assumiu a Subprefeitura da Lapa no ano seguinte.  Articulou a criação do Parque Leopoldina - Villas Boas, organizou mutiroes em praças, desemperrou parcerias para requalificação de areas publicas e usou intensamente a internet como ferramenta de controle social e participação. Em 2011 exerceu a função de superintendente da Sutaco (Superintendência do Trabalho Artesanal nas Comunidades) e em 2012 concorreu novamente à prefeitura. Em 2015 assumiu a Coordenação de Políticas para a Diversidade Sexual do estado de São Paulo. Há dois anos, fundou a Associação Casa Bodisatva, que trabalha com moradores de rua e de favelas (principalmente Moinho, Recanto Suave em Cotia, e Caboré, no Jardim Iguatemi). Faz palestras em escolas sobre temas como preconceito, orientação sexual, questoes de genero, drogas, politica, meio ambiente etc. Tem 3 filhas, uma neta, 2 caes e quatro gatos adotados.','rp@soninha.com.br','1308331855852629'),(12602,'Hamilton Assis','PRETA','MASCULINO','MASCULINO','1963-01-19','Natural da capital baiana de Salvador, Hamilton Moreira de Assis nasceu em 1963 e é pedagogo. Iniciou sua vida política como militante em associações de bairro da sua cidade natal e foi filiado ao PT por 23 anos antes de entrar para o PSOL em 2005.\r\n\r\nHamilton já foi presidente estadual do PSOL, e em 2010 foi candidato à Vice-Presidência da República na chapa de Plínio Arruda Sampaio. Em 2012 concorreu à Prefeitura de Salvador, mas não obteve a vitória com os 33.650 votos alcançados.','hamassis@yahoo.com.br','10201911801792557'),(12611,'Alexandre Galdino da Nóbrega II','PARDA','MASCULINO','MASCULINO','1980-12-20','Analista de Tecnologia da Informação, 35 anos, especialista em Gestão Pública, servidor público na UFCG, militante sindical atuando na resistência contra a flexibilização dos direitos trabalhistas e ex-Conselheiro Universitário.','nalexandregaldino@gmail.com','905835072856328'),(12650,'Neila Batista','PARDA','FEMININO','FEMININO','1961-03-12','POR QUE NEILA BATISTA PARA VEREADORA?\r\n\r\nPorque Neila já foi vereadora, por oito anos, e deixou um legado de leis e iniciativas importantes. A Semana Paulo Freire, que discute educação. A defesa das mulheres, na luta contra a violência. Da juventude, no direito à educação, ao trabalho e ao lazer. Da moradia, no fortalecimento da Política Municipal de Habitação. No “direito à cidade”, realizando em 2001, um dos maiores seminários do país, às vésperas da aprovação do Estatuto da Cidade, no Congresso Nacional; um seminário que contou expressivas lideranças de lutas por moradia e estudiosas do tema, como Ermínia Maricato e Raquel Rolnik, dentre tantas.\r\n\r\nPorque Neila tem ampla experiência nos poderes executivos. Foi secretária regional da Noroeste (governo Patrus); assessora “especial do para assuntos de defesa social” do então prefeito Célio de Castro; diretora no Ministério do Desenvolvimento Social (governo Lula) e, recentemente, integrou a equipe do governo Pimentel, responsável por criar o primeiro “orçamento participativo” do estado de Minas Gerais.\r\n\r\nPorque Neila iniciou sua militância, em movimentos de bairros, de grupos de jovens, na defesa de melhorias para os bairros da região do Glória e do Pindorama. Depois, participou da construção do PT. Foi sindicalista, fundadora da CUT e dirigente do Senalba.  \r\n\r\nNeila é assistente social, pós-graduada em sociologia, pela PUC-MG. Foi do Conselho Estadual da Criança e do Adolescente. Trabalhou no Projeto Providência (Taquaril) e no Fundo Cristão para Crianças. Neila tem 55 anos. Trinta e sete dos quais dedicados à luta pelas conquistas e garantias de direitos às classes trabalhadoras e às suas famílias.','neilabatistaafonso@gmail.com','921268324644141'),(12719,'Gregori Haag','BRANCA','MASCULINO','MASCULINO','1996-11-04','GREGORI HAAG tem apenas 19 anos, mas muita disposição para mudar a cidade e o mundo para melhor. Acredita na boa política, renovada e sem corrupção. Com juventude e disposição, quer trabalhar pela inclusão social e pelo respeito aos direitos individuais. Para ele, a democracia e a participação são fundamentais para a construção de uma sociedade mais justa e fraterna.\r\nDesde muito cedo, Gregori Haag se interessou pela política por influência do pai, Airton Haag. No tempo de escola, foi vice-presidente do Grêmio Estudantil da Escola Municipal de Ensino Fundamental Otávio Rocha. Aos sete anos, começou a frequentar o CTG Gaudérios da Saudade, onde foi Peão de Brasão por dois prendados e Capataz da Cultura, por dois anos. Nasceu em Canela, mas veio morar em Estância Velha nos primeiros meses de vida. Considera a cidade como sua terra do coração. Quer levar a garra e a força da juventude para a Câmara Municipal. Acredita que a construção de um mundo melhor é possível e quer começar pelo seu Município.','gregorihaag.ev@gmail.com','1127528873998348'),(12823,'Vinícius Assarisse Martins','BRANCA','MASCULINO','MASCULINO','1988-09-30','Sou Vinícius Assarisse Martins, tenho 27 anos, nascido e criado em Piracicaba. “Maria” é o apelido que recebi na ESALQ/USP, onde me formei em Economia no ano de 2011.\r\nAcredito que a educação e a participação cidadã na política são os meios para uma cidade e um mundo mais desenvolvidos, sem discriminação e verdadeiramente plural.\r\nLogo que iniciei meus estudos universitários comecei a participar de atividades políticas estudantis, como Diretor do Centro Acadêmico Paulo Cidade (CAPC) e do Centro Acadêmico Luiz de Queiroz (CALQ).\r\nSou professor voluntário no Cursinho Avante há oito anos, uma instituição que oferece capacitação pré-vestibular para quem não tem condição de pagar um curso particular.\r\nAtualmente, sou funcionário público, atuando na Justiça Estadual como Escrevente Técnico Judiciário. Fui, também, funcionário do Banco do Brasil por três anos, tendo trabalhado na Agência de Laranjal Paulista.\r\nColoco-me, agora, como pré-candidato a vereador porque acredito que é preciso renovar, com pessoas jovens, capacitadas e dispostas a buscar uma nova política, com transparência, honestidade e vontade de mudar!','viniciusamartins@hotmail.com','10208551462882313'),(12857,'Nildão Freire','BRANCA','MASCULINO','MASCULINO','1965-02-18','Nildomar Freire, o Nildão, tem 51 anos, mora em sambaqui, é trabalhador concursado da justiça do trabalho e é casado com a dentista Doris Gomes há 27 anos. \r\nTambém trabalhou como office-boy no antigo IAPAS, foi comerciário e professor de inglês.\r\nSua caminhada tem a marca da participação nas lutas para construir uma sociedade mais justa. Ao mesmo tempo que tem posições firmes em tudo que acredita, também tem no respeito às diferenças uma de suas principais características, o que o levou a estar desde cedo engajado e liderando movimentos pela democracia e justiça social.\r\nEm 1980, aos 15 anos de idade, inicia sua participação no movimento estudantil secundarista, auxiliando na reorganização da UBES - União Brasileira dos Estudantes Secundaristas. Junto com sua geração, lutou pela redemocratização do país e pelas Diretas já.\r\nIntegrou também o movimento estudantil universitário, sendo fundador do Centro Acadêmico e da direção do DCE.\r\nFoi um dos fundadores do Sintrajusc - Sindicato dos Trabalhadores no Judiciário Federal de Santa Catarina e diretor de sua Federação Nacional, a FENAJUFE.\r\nComo dirigente da CUT-SC na década de 90, destacou-se na defesa dos direitos e lutas gerais dos trabalhadores catarinenses.\r\nEm 2000, foi eleito vereador de Florianópolis e considerado um dos mais atuantes da história da cidade. As marcas de seu mandato foram a presença constante na luta social, a defesa de melhor infraestrutura para a população, transporte acessível e de qualidade. As questões ambientais, desenvolvimento sustentável, a defesa dos direitos humanos e sociais, sempre estiveram no centro do seu trabalho.\r\nFoi autor de várias iniciativas parlamentares como a lei que criou o programa municipal de reuso de água, medidas protetivas ambientais nos postos de combustíveis, o que exige quórum mais elevado para mudanças no Plano Diretor, bem como, projetos como o de incentivo fiscal ao primeiro emprego aos jovens, vedação da demissão de cobradores diante da instalação da catraca eletrônica, o projeto que buscava criar programa municipal para pessoas em situação de rua, entre tantos outros.\r\nA candidatura a vereador do Nildão é uma construção coletiva. participe desse processo. Dia 02 de outubro, é Nildão 13456, nosso vereador.\r\n\r\n\r\nFLORIANÓPOLIS: QUEM AMA, CUIDA.\r\n\r\nA Florianópolis que a gente quer, deve necessariamente, cuidar com imenso carinho do seu principal patrimônio: suas belezas naturais, seu rico e diversificado ecossistemas.\r\nPara ser um bom lugar pra se viver, nossa cidade deve também priorizar uma política de diminuição das desigualdades, superar o processo de segregação que divide os espaços urbanos  \"ricos\" e  \"pobres\", uma vez que os investimentos e presença de equipamentos públicos são desproporcionais entre as regiões centrais e o interior da ilha, morros e periferia, em geral.\r\nEmbora sejam eleições locais, a disputa desse ano, ao meu ver, será emoldurada não só pelos ingredientes da política da cidade, mas também, sofrerá o reflexo da crise política nacional que tem como vertente principal, as consequências da quebra dos principais alicerces do estado democrático de direito, a confecção de um golpe político-institucional que buscou camuflagem no debate sobre a questão da corrupção.\r\nO fato é que o que está sendo atacado é o próprio estado social e suas fundamentais políticas públicas. Vivemos a ameaça concreta da volta dos ventos liberais que anunciam o retorno do estado mínimo e da retirada de direitos sociais, combinada com a ascensão das ideias conservadoras que paqueram sem nenhuma vergonha, os tristes legados do nazifascismo e suas terríveis relações de intolerância e ódio. Todo esse cenário nos obriga a renovar nossos compromissos com a defesa dos direitos sociais e dos trabalhadores, bem como, da presença do estado, como elemento fundamental para fomentar políticas públicas e o combate as desigualdades sociais. \r\nEstou seduzido pela necessidade também de questionar e debater esse processo de banalização da atividade política. A quem interessa incentivar o desinteresse e enojamento geral pela atividade política? Enquanto muita gente decente \"torce a cara\" para a temática da política, os velhos lobbies econômicos, os corruptores e corruptos, estão cada vez mais preparados para influenciarem o poder político local. Claro que há uma crise não só no atual modelo político-eleitoral. Considero que a chamada democracia representativa, ou seja, o ato apenas de votar e ser votado de quatro em quatro anos, é importante no processo democrático, mas,  está em crise e padece muitas vezes de falta de legitimidade. É preciso \"reinventar\" a política a partir do incremento, empoderamento da chamada democracia participativa. Florianópolis necessita incorporar efetivamente os ricos instrumentos constantes do Estatuto da Cidade, visando a participação da sociedade nas decisões acerca das principais temáticas da cidade, materializando a chamada democracia participativa.\r\nTambém sinto que as próximas eleições podem ter um ingrediente pedagógico extraordinário. Vislumbro a necessidade de resgatar os valores humanistas e libertários que embalaram as gerações de vários lutadores por liberdade, democracia e justiça social. \r\nE claro, pretendo inserir nesse debate, a questão central da cidade. Embora o discurso acerca da necessidade de humanizar a cidade esteja na boca de muitos agentes políticos, lhes faltando apenas, em sua maioria, adequar o discurso à prática, estou embalado pela minha volta aos estudos e o interesse particular pelo Direito Urbanístico, o chamado Direito à Cidade. \r\nPretendo questionar o modelo que é proposto em Florianópolis de urbanismo, convencional ao de boa parte das cidades brasileiras que é o da segregação socioespacial e do desequilíbrio de olhar administrativo entre regiões e bairros da cidade. Como abordar a questão da segurança pública, por exemplo, deslocada da necessária oportunização de equipamentos e políticas públicas para a nossa juventude em seus bairros periféricos e morros centrais?\r\nQuais as causas para não intervenção decidida, para além do discurso, de um processo de revitalizarão do centro histórico da cidade?\r\nEssas e outras temáticas vitais, como a da mobilidade urbana (que já está transformando-se em discurso enfadonho), tem que estar vinculadas, no meu entendimento, ao modelo de gestão que pretendemos imprimir na cidade.\r\nCom base, nessas ideias, deixo uma síntese dos nossos compromissos, do nosso pensamento que buscaremos honrar no exercício do mandato de vereador caso seja essa a vontade dos eleitores da nossa bela e merecedora de cuidados profundos, Florianópolis.\r\n\r\nUm forte abraço,\r\nNildão\r\n\r\n','nildao13456@gmail.com','1065153300199954'),(12937,'Margot Ramalhete','PRETA','FEMININO','FEMININO','1966-07-09','Enfermeira e Administradora aposentada pela Universidade Federal de Juiz de Fora. Especialista em Gestão Pública e Gestão do Terceiro Setor. Ativista Social e Política atua ativamente mas causas das Mulheres e LGBTI.\r\nBuscar representatividade dos que são invisíveis ao poder público e vivem a margem dos serviços sociassistenciais.\r\nEscola integral \r\nAtenção primária até 21 horas\r\nProjeto Comunidade.\r\n\r\n#NÃOSEREMOSCALADOS.\r\n ','margarete.ramalhete@hotmail.com','1286811394663388'),(12982,'Ricardo Oliveira','PARDA','MASCULINO','MASCULINO','1981-01-03','Militante dos Movimentos Sociais, universitário no curso de Ciências Sociais, Trabalhador e defensor das minorias e excluídos socialmente. Acredito que a arte e cultura podem ajudar na transformação de uma sociedade mais justa e inclusiva. ','ricardo_silva166@hotmail.com','10207216526274795'),(13094,'Luís Horta','BRANCA','MASCULINO','MASCULINO','1963-01-31','Professor de História na Rede Pública Estadual e membro da direção estadual e coordenação regional da APEOESP.','luishortaourinhos@gmail.com','1196236013772442'),(13118,'Daniel Beretta','BRANCA','MASCULINO','MASCULINO','1976-09-27','Candidato pela primeira vez, busco caminhar pelos preceitos da moral cristã, valorizar a criança e o adolescente, lutar pela igualdade social, repudiar, fiscalizar e denunciar qualquer tipo de ato de corrupção ativa ou passiva, repudiar qualquer ato comunista bolivariano de esquerda, lutar pela segurança publica, educação e saúde e principalmente fiscalizar o executivo, coisa que em SP não se ve a muito tempo.\r\nNos últimos anos decidi lutar pelo meu país de uma forma mais ativa, sempre presente nas manifestações porém vi que se eu quisesse mudar algo teria que me engajar mais na vida publica e decidi me candidatar a vereador.\r\nMeu projetos abrangem o município de SP em geral, tais como:\r\nGCM em escolas municipais todos os dias da semana e em todos os períodos de aula;\r\nFiscalizar e tentar amenizar os efeitos causados pelas cracolândias espalhadas por SP;\r\nAtendimento medico e exames para pessoas portadoras de doenças cronicas em até 72 hrs;\r\nFim da cobrança em estacionamento de shopping, desde que o usuário comprove gastos dentro do estabelecimento; \r\nApoio a Uber ou a outros aplicativos semelhantes, trazendo melhorias para o serviço prestado a população de SP;\r\nNo transporte publico buscar em parceria com a PMSP e Governo do Estado a implementação de vagão 100% preferencial, estações da CPTM com elevadores e rampas de acesso para pessoas com necessidades especiais, tais como: cadeirantes, gestantes, deficientes visuais, etc.\r\nImplementar em parceria com a PMSP, Governo do Estado e iniciativa privada, fraldários e lactários  nas principais estações da CPTM, Metro e Terminais de Ônibus;\r\nPrincipalmente fiscalizar o novo prefeito e as contas publicas.\r\nDeixo claro que não faço nenhuma PROMESSA e sim apresento PROJETOS, afinal para que algo aconteça na Lei Orgânica de SP é preciso a aprovação na câmara municipal e depois do prefeito.\r\nPara São Paulo mudar tem que inovar, tem que dar a chance para o novo mostrar do que é capaz.','danielberetta@outlook.com','171996703240132'),(13145,'Thiago Gorte','BRANCA','MASCULINO','MASCULINO','1995-02-15','Meu nome é Thiago Vinicius Mattoso Gorte (Thiago Gorte), tenho 21 anos e sou filiado ao PDT. Sou acadêmico de direito da UEPG. Trabalho na prefeitura municipal de Irati desde 2013, estando atualmente exercendo o cargo de Mediador da Rede de Proteção e Enfrentamento às Violências de Irati. Sou conselheiro municipal dos direitos da criança e do adolescente. Atuo junto aos conselhos municipais da pessoa idosa, da pessoa com deficiência e da mulher. Sou ativista LGBT, participando da fundação do Coletivo LGBT Iratiense, sendo casado com o presidente do referido movimento social, Sr. José Adilson de Souza Junior. Meu lema de campanha é: \"Juntos por uma Irati mais humana\", pois pretendo trazer essas temáticas de direitos humanos para o debate nas políticas públicas do meu município. ','thiago.gorte@irati.pr.gov.br','892972980835380'),(13181,'Fabrício Rosa','BRANCA','MASCULINO','MASCULINO','1980-01-09','Sou mestre em Direitos Humanos pela UFG e professor em diversas instituições. Sou policial rodoviário federal e trabalho no combate à violência sexual contra crianças e adolescentes, contra o trabalho escravo, o tráfico de pessoas, o trabalho infantil e a diversas violações a grupos vulnerabilidades. Faço parte de diversos coletivos que discutem e atuam na proteção dos direitos humanos, em nível municipal, estadual e federal. Sou porta-voz da associação internacional de policiais Law Enforcement Against Prohibition - LEAP, que vem lutando contra a política de guerra às drogas. Sou Presidente da Comissão de Direitos Humanos da PRF em Goiás, grupo que já presidi nacionalmente. Idealizei e desenvolvo um projeto para ajudar crianças com câncer chamado \"Policiais Contra o Câncer Infantil\". Realizo também projetos sociais pela população de rua e moradores de lições. Atuo junto a associações que trabalham com juventudes das periferias. ','fabriciorosa@me.com','1123553714390437'),(13209,'Gabriel Miceli','BRANCA','MASCULINO','MASCULINO','1990-04-28','Tenho 26 anos, sou advogado, atualmente presido a Comissão de Apoio a Assuntos Legislativos da OAB/Santos, sou coordenador do Projeto \"Caravana do Riso\".  Sou movido por dois diferentes motivos: a insatisfação com a política atual e a paixão pela boa política (o verdadeiro instrumento de transformação social). Em 2013 estive nas manifestações de junho, e de lá pra cá, pude me relacionar e dialogar com diversas pessoas e instituições preocupadas com a formação de novas lideranças e com novas práticas na política. Sou membro da RAPS (Rede de Ação Política pela Sustentabilidade). ','gabrielmiceli@hotmail.com','10154596431494468'),(13271,'Renato Pires de Paula II','BRANCA','MASCULINO','MASCULINO','1980-04-26','Professor de Sociologia, pai, apaixonado pela vida, família e amigos. Militante da luta por uma sociedade mais desenvolvida, justa e livre de todos os tipos de preconceito. Atua no movimento sindical desde 2006. É dirigente da CTB-MS e do PCdoB-MS. Ajudou a reorganizar a UJS e a fundar a Nação Hip-Hop Brasil MS. Sua atuação leva em conta um Projeto Nacional de desenvolvimento soberano, com valorização do trabalho e respeito às diversidades.','rpdp22@hotmail.com','157810634668962'),(13279,'Marlon Régis Soares','BRANCA','MASCULINO','MASCULINO','1989-05-07','Sou Marlon Régis Soares, tenho 27 anos, sou advogado e tutor de EAD na Unijuí, e vivo em união estável com Maykon Zimmermann. Nasci em Horizontina/RS, mas moro em Ijuí desde 1994. Sou filho de Nancí Tânia Soares, servidora pública da Corsan, e de Vanir Soares, músico. Tenho um irmão, Maicon Luan Soares. Sou bacharel em Direito pela Unicruz, onde concluí meus estudos em 2011.\r\n\r\nSou religioso (afinal, o fato de ser gay não me impede de ter uma crença), cristão luterano, membro da IECLB (Igreja Evangélica de Confissão Luterana no Brasil), participando da Comunidade Evangélica Ijuí, onde já tive a imensa honra de desempenhar o voluntariado como orientador de cultos infantis (mais ou menos entre 2008 e 2013).\r\n\r\nApós a faculdade, aproximei-me dos movimentos sociais, especialmente os de militância LGBT, inclusive integrando o grupo que fundou o Movimento LGBTS Pensar, de Ijuí, do qual, atualmente, sou coordenador licenciado. Também sou o secretário de comunicação da UJS (União da Juventude Socialista) de Ijuí, membro do movimento Inclusão Luterana, membro da UNA LGBT (União Nacional LGBT) e membro do Movimento dos Advogados pela Democracia, Justiça e Cidadania. Também, já fui membro da Comissão de Defesa e das Prerrogativas da Advocacia na Subseção da OAB Ijuí (2013), e membro da Comissão de Direitos Humanos também da Subseção da OAB de Ijuí (2014/2015).\r\n\r\nFiliei-me ao PCdoB em 2014, buscando espaço para aprofundar minhas lutas e dar maior visibilidade para as causas pelas quais milito, e, já em 2015, fui convidado a integrar o Comitê Municipal do partido, onde me tornei membro da Comissão Política.\r\n\r\nPela primeira vez me lanço como candidato a um cargo eletivo, convicto de que, como cidadão ijuiense, é dever também meu retomar os espaços no legislativo em favor da população e de seus interesses, fazendo oposição ao sistema político podre, que serve aos interesses apenas de alguns. Além disso, sinto que é chegado o momento de levar para dentro da Câmara Municipal de Vereadores de Ijuí as pautas da juventude local e dos cidadãos LGBT’s, escanteando o conservadorismo, o preconceito e o retrocesso, fazendo valer o título de terra da diversidade a nossa cidade.\r\n\r\nEnfim, como vereador, quero mostrar que é possível, sim, fazer política com transparência, seriedade, competência, eficiência e honestidade, como se poderá notar especialmente a partir das propostas que apresento.','marlonrsoares@gmail.com','1183263985067649'),(13384,'Joice Eslabão','BRANCA','FEMININO','FEMININO','1996-06-19','Militante dos movimentos sociais desde muito cedo,  iniciei minha trajetória na política através do movimento estudantil secundarista. Fui presidente do grêmio estudantil da escola Dr. Augusto Duprat e Diretora de Grêmios Estudantis da União Riograndina dos estudantes secundaristas. Hoje sou estudante de licenciatura em História da FURG e sigo nas lutas sociais através do PCdoB e da UNE. ','joiceeslabao@gmail.com','1325423454136399'),(13392,'Rodrigo Mendes Rodrigues','BRANCA','MASCULINO','MASCULINO','1979-12-05','Rodrigo Mendes Rodrigues tem 37 anos é professor da Fundação Municipal de Ensino Superior de Bragança Paulista (FESB), professor efetivo da Rede Estadual do Estado de São Paulo (no momento afastado) e de instituições particulares de Bragança Paulista. Mestre em Educação - Currículo (PUC - SP), Especialização stricto-senso em Filosofia Contemporânea Ética (UFSJ), Especialização em Gestão Escolar (Educon) e Especialização lato-senso em Filosofia Clínica (Instituto Packter - POA). Possui graduação em Filosofia pela Universidade Federal de São João del-Rei (2005) e Pedagogia (Faculdade Paulista São José).  \r\n\r\nEstudou 3 anos de engenharia agronômica na Universidade Federal de Lavras, onde foi presidente do Centro Acadêmico de Agronomia da UFLA, militou na Federação de Estudantes de Agronomia, regionais Minas Gerais, Espírito Santo e Rio de Janeiro, de 1999 a 2001. De 2001 a 2002, representou a FEAB na executiva nacional. Durante este período militou junto a movimentos sociais populares, como MST, MAB, desenvolvendo atividade de alfabetização de adultos e orientações técnicas agrárias. \r\n\r\nApresentou cursos de formação política junto ao PSTU e articulação de esquerda do PT em 112 faculdades no Brasil e exterior. De 2003 a 2005 foi presidente do centro acadêmico de filosofia da UFSJ e diretor do DCE. \r\n\r\nEm Bragança ministrou aulas em cursinhos voluntários, grupo escoteiro, coletivos ambientais e desde o início da fundação do movimento outra Bragança (MOB) vêm desenvolvendo participação efetivas em reivindicações e manifestações. \r\n\r\nDefendendo as bandeiras da esquerda: igualdade racial, de gênero, LGBT, mobilidade urbana, ambientalismo e sustentabilidade, entre outros setores. \r\n\r\nMembro da Associação dos Escritores de Bragança Paulista (ASES) tem participação em livros, artigos jornalísticos e científicos, tendo ganhado concurso internacional de poesia, publicado na Revista cubana \"El Caimán barbudo\". Filiado ao PSOL, apresenta-se em 2016 sua candidatura à vereador, onde objetiva transpassar as paredes da sala de aula no processo do educar, levando como proposta o debate, reflexão, sobre o fazer político como tarefa de todos os cidadãos.\r\n\r\nMaiores detalhes em no currículo http://buscatextual.cnpq.br/buscatextual/visualizacv.do?id=K4717079D6','rodrigofilosofiaclinica@hotmail.com','1384831808212189'),(13442,'Hilda Ferreira','PRETA','FEMININO','FEMININO','1951-04-12','Ainda criança comecei a trabalhar na roça para ajudar no sustento da família, casada deixei minha cidade natal na Bahia e há mais de 45 anos vim morar em São Bernardo do Campo em busca de uma vida melhor. Trabalhei como empregada doméstica e consegui realizar o sonho de me formar em Serviço Social.\r\nEm reconhecimento pelo trabalho sério nos bairros atuei como assessora no mandato do Deputado Federal Vicentinho, e agora me disponho para essa missão como candidata a vereadora, junto com o apoio dos moradores, e de organizações que atuam nas questões voltadas a juventude, mulheres e idosos. Quero defender o acesso da população às políticas públicas do município e construir com as comunidades leis que avancem nos direitos de todos.\r\n\r\n','hildaferreirasbc@yahoo.com.br','780168242086350'),(13533,'Eduardo Francisco','BRANCA','MASCULINO','MASCULINO','1973-07-18','PROFESSOR DE HISTÓRIA E COORDENADOR PEDAGÓGICO DA REDE MUNICIPAL DE ENSINO. MESTRE EM EDUCAÇÃO PELA PUC-SP. SEMPRE NA LUTA PELOS NOSSOS DIREITOS. ACREDITO EM UMA OUTRA POLÍTICA, DE ESQUERDA E SOCIALISTA.','eduardo.francisco2006@yahoo.com.br','1216035405102837'),(13542,'Mauro Kovtun','BRANCA','MASCULINO','MASCULINO','1970-05-31','FORMADO EM RELAÇÕES INTERNACIONAIS E NO CURSO DE PROTOCOLO EM WASHINGTON  NOS ESTADOS UNIDOS , TENHO 30 PROJETOS DE LEI PARA LEVAR A CÂMARA DESDE  UMA GESTÃO MAIS EFICIENTE PARA OS POSTOS DE SAUDE COMO FINANCIAMENTO ADEQUADO   E ADMINISTRAÇÃO DOS GASTOS , PARA SABERMOS NÃO SOMENTE NO QUE SE GASTA MAS TAMBÉM COMO SE GASTA IO DINHEIRO PÚBLICO, PRECISAMOS OXIGENAR ESTA POLITICA E COLOCAR SÃO PAULO  COMO UM DAS MELHORES CIDADES PARA SE VIVER.','maksbrasil1@gmail.com','1187753594633302'),(13712,'Cadu Carlos Eduardo','BRANCA','MASCULINO','MASCULINO','1979-02-03','Oriundo de escolas públicas, é graduado em História (UDESC) e pós-graduado em Gestão Pública (Unicamp). Como milhares de brasileiras e brasileiros, conciliou estudos e trabalho desde os 13 anos. Já aos 16, começou a atuar na política.\r\n\r\nLíder estudantil, líder sindical e partidário, esteve à frente de várias lutas. Mais recentemente, na defesa da democracia brasileira.\r\n\r\nTem 37 anos, casado com Giovanna Poeta e pai de Raul, de 4 anos, mora em condomínio popular no Jardim Atlântico em Florianópolis.\r\n\r\nFoi dirigente estadual do PT de Santa Catarina e presidente do PT de Florianópolis. Atuou na coordenação do Programa Luz para Todos em SC (Eletrosul). Foi diretor do Sindicato dos Trabalhadores em Educação (Sinte-SC), dirigente estadual e nacional da CUT e assessor dos sindicatos de Trabalhadores na ECT (Sinte-SC) e de Servidores da Assembleia Legislativa (Sindalesc).','carlos.jpt@gmail.com','1341418632565008'),(13724,'José Vinagre','BRANCA','MASCULINO','MASCULINO','1964-10-28','Vinagre é meu sobrenome (José Augusto). Tenho 51 anos, sou casado, nascido em Bauru na Vila Cardia e tenho dois filhos também bauruenses. Filho da saudosa professora de matemática Henriqueta. Fui Secretário Municipal de Cultura de Bauru na gestão do Tuga, entre os anos de 2005 e 2008. Militei ativamente no movimento estudantil, quando fui presidente do Diretório Acadêmico IX de Julho, da Faculdade de Direito de Bauru (ITE – de 1984 a 1985). Profissionalmente, atuei no SESC, SENAC, Secretaria de Estado da Justiça e Cidadania (Fundação ITESP) e Oficina Cultural Glauco Pinto de Moraes (de 1990 a 1995). \r\n Quando secretário municipal de cultura, fui responsável pela ocupação do Automóvel Clube (como sede da Banda e Orquestra Sinfônica de Bauru), pelo início da implantação da casa Ponce Paz (atualmente ocupada pela Pinacoteca Municipal) e pelo início da recuperação da antiga Estação da Paulista (que abrigará o MISB e o Museu Histórico). Na minha gestão, ocorreu a primeira Virada Cultural na cidade e o evento de cultura tradicional “Revelando São Paulo” (descontinuado em 2010). Foram retomadas as festividades do Aniversário da Cidade com a Festa do sanduíche Bauru no Vitória Régia (modelo que segue até hoje). Também durante a minha gestão, aconteceu a primeira Conferência Municipal de Cultura, dois Fóruns Estaduais de Teatro e um Encontro Estadual de Performance.\r\nApós a experiência com a Secretaria, continuei na área cultural, quando tive a oportunidade de trazer a Bauru e região dezenas de eventos culturais. Nesse período, atuei por todo estado de São Paulo em cidades como Franca, Lençóis Paulista, Pirajuí, Cafelândia, Pongaí, Presidente Alves, Promissão, Itaí, Oscar Bressane, Echaporã, Júlio de Mesquita, Sorocaba, Marília, São Carlos, Botucatu, Araçatuba, Presidente Prudente, São José do Rio Preto, Araraquara, Praia Grande, Mongaguá, Cubatão, São Vicente, Peruíbe, Itanhaém, Guarujá, Bertioga e Campinas.\r\nAtualmente, tenho uma empresa que presta assessoria a municípios na área cultural e produz eventos culturais. A experiência fez com que eu me especializasse na elaboração de projetos para as diversas Leis de Incentivo à cultura e aos editais da área.\r\n Como vereador, pretendo focar minha atuação no apoio e no incentivo à economia criativa com cultura, educação e tecnologia. Por um desenvolvimento sustentável e por uma cidade mais humana.\r\nConto com seu voto!\r\n','vinagrecultura@yahoo.com.br','10153892370417286'),(14025,'Fabiane Carvalho','BRANCA','FEMININO','FEMININO','1979-10-10','Por uma política diferente, honesta e transparente.\r\n\r\nSou a professora Fabiane exerço minha profissão com amor e dedicação há 15 anos. Casada com Moacir (PROERD), mãe da Marina e Mariana. Novaodessense de coração há 33 anos e atualmente moradora do residencial Jequitibás. \r\nCatólica, participo da comunidade Bom Jesus, na pastoral do dízimo juntamente com minha família, pois acredito que a família e o amor ao próximo são fundamentais para uma sociedade melhor.\r\nComo vereadora, mãe e educadora vou lutar pelos direitos das minorias, procurando assegurar a qualidade de vida da população com um mandato participativo, fiscalizador e transparente, defendendo os diretos das Mulheres e a Educação como base da transformação da sociedade.\r\n','biafabi10@hotmail.com','979174358875051'),(14106,'Danilo Otero','BRANCA','MASCULINO','MASCULINO','1980-04-05','Candidato pela primeira vez acreditando na renovação da política!\r\nSecretário de multiculturalismo pelo partido PROS buscando trabalho de inclusão das minorias, com um trabalho pela base educacional, trazendo informação e tendo como lema que ser diferente é legal! \r\n','danilo_ot@hotmail.com','1044822398919282'),(14127,'Héverton Angelo Caldas de Figueiredo','BRANCA','MASCULINO','MASCULINO','1986-12-03','Minha Biografia: Casado, Evangélico, Bacharelado em Direito, Pós Graduado em Direito Ambiental e Urbanístico com Docência Superior,  Técnico em Meio Ambiente, Normal em Nível Ensino Médio e Técnico em Serviços Públicos.  Trabalhei como Garçom Free Lance dos 16 aos 21 anos. Trabalhei 06 anos na área de Transporte,  hoje atuo como  Analista de Prevenção de Perdas,  analisando e prevenindo as perdas em uma grande rede de supermercados em Volta Redonda - RJ,  minha formação e experiência profissional servirá de experiência para recepcionar, os problemas,  necessidades,  ideias da população,  analisar, direcionar,  acompanhar até conseguir colocar em prática. INOVAR PARA RENOVAR!!! HÉVERTON FIGUEIREDO 13013','hevertonacf@gmail.com','955795274563841'),(14150,'Francisco Oliveira Chicão','PARDA','MASCULINO','MASCULINO','1983-09-26','Sou professor da rede pública estadual, militante da educação e da mobilidade urbana. Participei ativamente dos movimentos contra o aumento de tarifas de ônibus em 2013 e da greve de professores de 2015. Atualmente, exerço a função de Secretário Geral do PSOL na cidade de Santo André. ','fran_geo2006@yahoo.com.br','1197832953609217'),(14187,'Aldenir Dida Dias','PRETA','FEMININO','FEMININO','1956-12-03','Professora doutora em ciências sociais, feministra, negra, ex-empregada doméstica. Ativista pelos direitos da mulher e do povo negro. ','dias.dida@gmail.com','1205715626154181'),(14191,'Rodrigo Cuia','PARDA','MASCULINO','MASCULINO','1974-01-26','Defender  uma participação  mais efetiva da comunidade  nas decisões  do município. ','rodrigoalexdacosta31310@Gmail.com','187793288319808'),(14225,'Filipe Dos Santos','BRANCA','MASCULINO','MASCULINO','1984-08-31','Filipe Luís dos Santos é barbacenense do Bairro do Campo. Filho da professora Cláudia Santos Falco e do ferroviário Nilton Silveira, é Biólogo formado pela Universidade Federal de Viçosa. Atua como Professor desde 2009 em cidades da região e está em Barbacena desde 2011. Na rede municipal, lecionou Ciências nas Escolas Municipais Embaixatriz Corina Andrada (Comunidade José Luiz) e Crispim Bias Fortes (Torres). No mesmo ano, lecionou Biologia Colégio Aprendiz e Ciências no Instituto Maria Imaculada (Salesianas), ambas na rede privada. Atualmente segue lecionando Biologia no IMI/Salesianas, além de trabalhar em mais três instituições privadas: SESI, Curso Professor Viol e Papiro Concursos. \r\nEm 2012 começou sua trajetória político-social acompanhando as seções da Câmara Municipal e participando ativamente da Greve dos Servidores Municipais Contratados. Ainda em 2012, passou a integrar o Movimento Cidadania Já e, a partir daí, participou de diversos manifestos como aqueles contra a implantação de Leis Delegadas, ações contra o aumento da passagem de ônibus, protestos contra a nucleação e o fechamento de Escolas Municipais, entre outros.\r\nÉ filiado ao Partido dos Trabalhadores desde 2013, no qual vem participando do Conselho político do vereador Kikito e esteve presente em todos os movimentos em defesa da Democracia. \r\nRecentemente, em 2015, foi eleito para a nova diretoria do Sinpro Minas – Sindicato dos Professores de Minas Gerais – e empossado em janeiro deste presente ano.\r\nAcreditamos que todo e qualquer mandato eletivo está baseado na soberania e na vontade popular. O representante eleito nada mais é que um porta-voz daqueles que o elegeram. Por isso, desde o início de nossa campanha propusemos que os cidadãos nos ajudassem a construir coletivamente, de forma participativa e democrática, as nossas propostas e ideias de trabalho parlamentar. A Câmara Municipal é o espaço onde os problemas da cidade devem ser discutidos intensamente e onde as soluções devem ser apresentadas sob a forma de Projetos de Lei e Resoluções, além da fiscalização irrestrita e imparcial do Poder Executivo Municipal. Por fim, acreditamos também ser necessária uma renovação do Poder Legislativo para que possamos tratar a política como ela deve ser tratada, sem os vícios do passado e com visão para a coletividade.','filipesantos.bio@gmail.com','1261739013865648'),(14249,'Rhayana Meirelles','PRETA','MASCULINO','MASCULINO','1976-04-20','Sou  mulher trans de família evangélica, nascida em Jambeiro e que mora em São José dos Campos já a 22 anos.\r\n\r\nLuta pelos Direitos Humanos das minorias, atua em prol de um serviço de saúde digno e sem preconceitos para as comunidades mais carentes e é a favor da igualdade e respeito para todos os cidadãos LGBT e a socialização e apoio a suas famílias.\r\n\r\nCandidata a vereadora em São José dos Campos, militante dos movimentos sociais desde  1998 passando pelo movimento de LUTA  de combate ao vírus HIV/AIDS e enfrenta as resistências políticas que tentam atrasar o avanço de políticas públicas na área da saúde e dos Direitos Humanos para a população LGBT e seus familiares em nossa região.\r\n\r\nDentro do movimento LGBT, já ocupou diversos cargos de destaque na esfera estadual e nacional, e em 2010, tive meu trabalho reconhecido pela UNAIDS (Secretaria da ONU), o que levou ter minha história contada na revista OUTLOOK, que tem circulação em mais de 260 países no mundo. \r\nFui  conselheira estadual de políticas da diversidade do Estado de São Paulo,  e em 2014 recebi o premio Diversidade  da  OAB do Rio de Janeiro , sou  articuladora social em nossa região e atualmente sou presidente da ONG ORIENTAÇÃO, que promove o debate contra o preconceito e a busca pelos Direitos Humanos da comunidade LGBT, tendo participado de vários momentos históricos das conquistas dos Direitos Humanos em nível estadual, nacional e em diversas cidades da região do vale do Paraíba,  trabalhei  também como articuladora da Rede de Saúde na prefeitura de Caçapava de 2009 a 2011 \r\n\r\nJá passou da hora de abrir espaço para  quem entende verdadeiramente desta  luta, pois  surgiu das mesmas minorias que sofrem com o preconceito e a ignorância, sobrevivi às agressões e ofensas, e estou firme e forte na decisão de enfrentar aqueles que não querem que nossa sociedade avance com dignidade e justiça na conquista da igualdade para todos e todas!\r\n\r\n\r\n\r\n\r\n','rhayanasjc@gmail.com','1347666495273595'),(14328,'Greice Keli','BRANCA','FEMININO','FEMININO','1988-04-13','Greice Keli é Pedagoga, trabalha como Supervisora Escolar na rede municipal de ensino e como Professora na rede estadual. \r\nMilitante feminista e Sindical, sempre esteve na luta por direitos humanos. Se candidatou pela primeira vez este ano, a fim de representar mulheres, juventude, trabalhadoras e trabahadores que não se sentem representados pela velha política. Pretende impulsonar a luta dos movimentos populares de sua cidade para que a luta por direitos se fortaleça cada vez mais.','greicekeli.alves@gmail.com','10209273835895489'),(14407,'Roberta de Andrade','BRANCA','FEMININO','FEMININO','1985-07-11','Sou professora há quase 6 anos. Formada em pedagogia. Trabalho na rede pública de ensino. Sou nova na militância, porém determinada em mudar os rumos não somente da educação, mas de toda uma sociedade oprimida, em que o trabalhador, os negros e a mulher são tratados com descaso. Faço parte de um coletivo feminista. Sou artesã desde muito nova. Percebo que ainda falta valorização da arte e do artista.\r\nSou filha de professora e de jornalista. \r\nA maior parte das mulheres da minha família são professoras, cresci nesse meio. Ser educadora é um orgulho, lutar por uma educação de qualidade é minha luta.','roberta-magia11@hotmail.com','1267869903263552'),(14409,'Julia Monson','BRANCA','FEMININO','FEMININO','1995-01-28','Nasci em Osasco, tenho 21 anos, sou mãe de um bebê de 1 ano e estudante de ciências políticas. Comecei a ter contato com o meio político no ano de 2012, quando me filiei ao PT, e mais tarde no ano de 2014 comecei a participar da JPT Osasco. \r\n\r\nDurante o ano de 2015 estive um pouco afastada da Juventude do PT por conta de uma gravidez complicada, e a dificuldade de conciliar a descoberta da maternidade com as demandas políticas. Porém toda dificuldade que passei no meu recesso foi bom para ver e entender a sociedade de uma forma diferente, e me encorajou mais ainda a lutar pelas minorias, e contra qualquer tipo de discriminação.\r\n\r\n\r\n\r\n','Julia.monsonc@gmail.com','1016935665071091'),(14418,'Márcia Gori','BRANCA','FEMININO','FEMININO','1963-07-05','•	Técnico em Contabilidade-1980;\r\n•	Bacharel em Direito-2004;\r\n•	Presidente-Fundadora da Ong Essas Mulheres;\r\n•	Ex-presidente do Conselho Estadual para Assuntos da Pessoa com Deficiência - CEAPcD/SP 2007/2009; \r\n•	Ex-Conselheira Estadual do CEAPcD/SP 2009/2011;\r\n•	Ex-Presidente do Conselho Municipal da Pessoa com Deficiência de São José do Rio Preto/SP 2009/2012;\r\n•	Idealizadora do I Simpósio sobre Sexualidade da Pessoa com Deficiência do NIS – Núcleo de Inclusão Social da UNORP em 2009;\r\n•	Idealizadora do Seminário sobre Sexualidade da Pessoa com Deficiência na REATECH 2010/2011/2012/2013/2014; \r\n•	Co-realizadora do I Encontro Nacional de Políticas Públicas para Mulheres com Deficiência na REATECH em 2012;\r\n•	Palestrante sobre Sexualidade, Deficiência e Inclusão Social da Pessoa com Deficiência; \r\n•	Modelo fotográfico da Agência Kica de Castro Fotografias.\r\n\r\n','marcia_gori@yahoo.com.br','10202059782053737'),(14447,'Gianfranco Lopes','BRANCA','MASCULINO','MASCULINO','1975-06-20','Tenho 41 anos, superior incompleto, técnico em informática, formado pelo IFSULDEMINAS, eterno estudante e aprendiz. Trabalhei como empregado na indústria, no comércio, construção civil, prestação de serviços e hotelaria. Sou morador de um bairro localizado em uma região da cidade que sempre foi ignorada pela Administração Municipal, com ruas sem asfaltamento, saneamento básico, locais de difícil acesso, etc. Sempre lutei, muitas vezes sozinho, pelo fim da exploração das classe trabalhadora e pela igualdade de oportunidades para todos, possibilitando assim, que haja uma evolução cultural e estrutural que acabe com preconceitos de cor, raça, religião, gênero, instrução, idade, etc. Acredito que devido às diversas áreas profissionais que tive a oportunidade de conhecer e por não representar um grupo em especial, exceto a classe trabalhadora, e pela vontade de aprender, conhecer e ajudar os que são vítimas dessa sociedade egoísta e desonesta, poderei trabalhar por um número maior de pessoas de forma mais justa e imparcial. Se o povo estiver bem representado e bem informado poderá mostrar que não há ninguém melhor que ele mesmo para melhorar sua vida.','gianrancolopes@gmail.com','1429621593722559'),(14513,'Heloísa Barrozo de Assiz','BRANCA','FEMININO','FEMININO','1985-09-23','Heloísa Barrozo\r\n\r\nAtriz, arte educadora e produtora cultural, formada pelo Instituto de Artes da UNESP, em São Paulo, pós graduada em Psicodrama e Criminologia, e estudante de Psicanálise. Participação efetiva na área cultural, em Cosmópolis, como produtora cultural do show beneficente do Rosa de Saron em prol do Hospital de Câncer Infantil – Boldrini; organização junto com grupo voluntário de almoços beneficentes em prol do projeto Reviver e Casa da Criança; produtora executiva da Semana Cultural de Cosmópolis realizada em janeiro 2015; preparadora de elenco e atriz dos curtas metragens produzidos na cidade: Soneto e Gertrudes a grande, e da montagem teatral de 2015 da Paixão de Cristo das comunidades de Cosmópolis. Acredita na voz do povo, com participação do mesmo em Conselhos populares que direcionem suas reais necessidades.','heloassiz@hotmail.com','10210714053031958'),(14534,'Mariahmarques Marques','PARDA','FEMININO','FEMININO','1961-09-06','Professora, psicologa, sertaneja, militantes dos movimentos sociais, defensora da cultura popular e tradicional.','mariahmarques.marques@gmail.com','1069627626417583'),(14555,'Laura Alves','BRANCA','FEMININO','FEMININO','1982-08-25','Laura Alves candidata a vereadora pelo Partido Socialismo e Liberdade, na cidade de Jaguarão.\r\n\r\nTem experiência na Comissão de acompanhamento e Avaliação de Ações Afirmativas da UFSC, Projeto Conexões de Saberes - Comunidades populares urbanas, Pre Vestibular Comunitário da UFSC.\r\n\r\nProjeto em Tecnologias Assistivas - Audiodescrição com professor  Elton Vergara Nunes na UFPel (doutorado). \r\n\r\nLecionou no programa federal do MEC Idiomas sem Fronteiras, do qual fez parte da equipe de criação do material didático, e atuou como dubladora de personagens no material  audiovisual do idioma espanhol do mesmo programa, que é ofertado pelo IFSul.\r\n\r\nDefende intransigentemente os Direitos Humanos. \r\n\r\nTem ênfase nos direitos da mulher, da criança e dos idosos.\r\n Luta pelo parto humanizado, fim da cultura do estupro, segurança alimentar com projetos de agricultura urbana, estimulo da criação de trabalho e renda. Contra a violência doméstica,a invisibilidade do trabalho doméstico, e a valorização e reconhecimento do papel que a mulher tem o direito de cumprir na sociedade.\r\n\r\nPra ter a Jaguarão que a gente quer \r\nLaura Alves 50123\r\nVote 50 \r\nVote PSoL \r\n\r\n','laura.alves82@hotmail.com','1225402714165997'),(14561,'Marcio Tom','PRETA','MASCULINO','MASCULINO','1972-12-28','11 anos de trabalho social, com o seu voto posso fazer mais e melhor! \r\nConheça mais em: www.cccmsp.com.br  ou  www.marciotom.com.br ','tomcajudobox@hotmail.com','1071295619657586'),(14667,'Rosa De Oliveira Morgado','BRANCA','FEMININO','FEMININO','1952-07-16',' Sociologa , Prof de História na rede pública. Estive no movimento estudantil , na luta contra a Ditadura. Implantei diversos projetos sociais como Sociologa na Pref de Monte Alto. Como coordenadora dos conselhos comunitário Presidi o Fundo Social de Solidariedade em Monte Alto Sp. Presidi o COnselho da Criança e Adolescente ,  onde exigimos políticas públicas  para terminar o Trabalho Infantil no municipio,. Preside a Com- Emprego. Sindicalista , na Apeoesp e tantas outras coisas ..sempre pensando na defesa dos direitos humanos.Essa é uma breve biografia..','rosamorgado@yahoo.com.br','1110150399065002'),(14770,'Paula Vielmo','BRANCA','FEMININO','FEMININO','1984-06-11','Paula Vielmo tem uma trajetória de lutas em favor da justiça social desde os 15 anos de idade. Seu compromisso com os movimentos sociais é cotidiano. Dentre eles destacamos: \r\n\r\n• A luta pelos Direitos para a juventude e estudantes; \r\n• A luta por qualidade no transporte coletivo e mobilidade urbana; \r\n• A luta do movimento feminista pelo combate às violências contra as mulheres e por igualdade de direitos \r\n• A luta em defesa da Educação Pública, gratuita e de boa qualidade.\r\n\r\nPaula Vielmo é Pedagoga graduada pela UNEB, Servidora Pública Federal no IFBA/Campus Barreiras, foi recreadora no município de Barreiras de 2009 a 2011, participou ativamente do Movimento Estudantil no CEFET-BA/Barreiras e UNEB, participa do Grupo de Estudos sobre Gênero numa perspectiva Feminista, é membro da Executiva do PSOL Barreiras e do Diretório Estadual do PSOL e autora do “Blog Ideias são à prova de bala” (http://ideiasaprovadebala.blogspot.com.br/)\r\n\r\nVisite e conheça a nossa Página no facebook: @nosacreditamosoficial \r\n','paulavielmo50777@gmail.com','1070395586377698'),(14791,'Lorena Aguiar','PRETA','FEMININO','FEMININO','1985-10-24','Lorena Aguiar tem 30 anos e nasceu em Feira de Santana, onde também iniciou sua trajetória de militância. Começou participando de manifestações contra o aumento da tarifa do transporte coletivo e por melhorias nas universidades do estado da Bahia. É advogada e assessora jurídica popular, representando causas de movimentos de luta por moradia em Feira de Santana desde 2008.\r\n\r\nA partir de 2013 iniciou um trabalho coletivo de assessoria jurídica, atuando junto a movimentos sociais e organizações que lutam pelo direito à permanência de populações tradicionais e trabalhadores e trabalhadoras rurais na terra e em seus territórios.\r\n\r\nEm 2015 fortaleceu o acompanhamento profissional a partir do olhar feminista, combatendo a violência doméstica em casos que envolvem a Lei Maria da Penha. Desde então, tem dialogado com outras causas que dizem respeito às mulheres, a exemplo do parto humanizado com a garantia de atendimento integral e interdisciplinar a todas elas. Em suas lutas, Lorena tem questionado também a política de “guerra às drogas” e seus impactos sociais sobre a população jovem, negra e periférica.\r\n\r\n#LorenaAguiar50420\r\n#PraAmpliarNossaVoz','lore.aguiar@yahoo.com.br','1394996927181997'),(14858,'Ihsmmaell Limmah','PARDA','MASCULINO','MASCULINO','1991-03-27','Graduando em Licenciatura em Filosofia pela Universidade Federal do Cariri (UFCA), em Juazeiro do Norte, Ismael Lima já atuou como professor polivalente substituto do ensino infantil ao ensino de jovens e adultos.  \r\n\r\nÉ defensor das pautas da educação pública. Escritor, cantor e compositor, também passou pela dança e o teatro, militando em defesa da arte e da cultura há mais de 10 anos. Idealizou e fundou, em uma iniciativa coletiva, o Instituto Trilhas, que em parceria com o Instituto Assum Preto abriu a Casa de Culturas e Ponto das Artes de Senador Pompeu. É ativista pela preservação do patrimônio histórico, artístico, cultural, material e imaterial, e na luta pela igualdade de gênero e pelos direitos humanos. \r\n\r\nIsmael tem uma base política alicerçada nos movimentos e pastorais da Igreja Católica, sendo o atual coordenador pastoral da Capela de São Sebastião, no Bairro Patu, onde atua há mais de 15 anos. Agora, Ismael Lima está candidato ao Legislativo Municipal de Senador Pompeu.','ismaellimasp@gmail.com','962578330537535'),(14908,'Paolo Emendabili Souza Barros De Carvalhosa','BRANCA','MASCULINO','MASCULINO','1956-04-29','Nascido em São Paulo, casado, dois filhos, cursou Medicina (Florença Itália), Odontologia (Metodista - SBC) e Direito (USP).\r\n\r\nTrabalhou por 25 anos nos serviços de emergência nos pronto-socorros e hospitais públicos do Município de São Paulo.\r\n\r\nConcomitantemente atua em Direito na área de Direito Criminal e Tribunal do Júri. Outra área de interesse é a defesa do patrimônio artístico e arquitetônico públicos (inclusive Direito Moral Autoral) e a defesa em juízo do transsexual visando a adequção pessoal, médica e social, ao gênero com o qual se identifica. \r\n\r\nTem interesses em Literatura, Escultura, História da Arte e da Arquitetura. \r\n\r\nEscreveu e escreve esporadicamente em jornais e revistas de São Paulo, sobre Cultura e Política.\r\n\r\nÉ a primeira vez que se candidata a um cargo eletivo.','paoloemendabili@hotmail.com','10209309329482275'),(14921,'Thainara Faria','PARDA','FEMININO','FEMININO','1994-12-07','Sou Thainara Faria, estudante de Direito, ex vice-presidente do Conselho Municipal de Juventude, ex membro da Comissão da Verdade Sobre a Escravidão Negra no Brasil e há anos venho lutando por uma sociedade mais justa.\r\nPor meio do meu blog A Voz da Morada e da minha página Thainara Faria no Facebook você pode acompanhar meu trabalho e meu posicionamento a partir de vários temas.\r\nPor ser mulher, negra e criada na periferia, conheço os dramas diários das minorias do nosso país.\r\nEspero sua visita na página e no blog!\r\n\r\nThainara Faria, candidata a vereadora, 13016.','contatothainarafaria@hotmail.com','1181608271910326'),(14977,'Raquel Migliorini','BRANCA','FEMININO','FEMININO','1968-03-05','Sou bióloga, professora. Tenho experiência em gestão pública. Fui responsável pelas campanhas de castrações de cães e gatos na cidade e pela campanha de plantio de árvores.\r\nFiz parte de diversos  Conselhos (meio ambiente, cultura, turismo) e de Comitês de Bacias Hidrográficas.','raquel.migliorini@gmail.com','10207710013774392'),(14979,'Marcos Camargo','PRETA','MASCULINO','MASCULINO','1963-08-10','Meu nome é Marcos Bueno de Camargo \r\nSou de família humilde  nasci e cresci na periferia \r\nCom 7 anos eu vendia limão ,abacate e banana para poder ajudar minha mãe \r\nPois fui adotado pela Dona Francisca que já era viúva  e já de idade \r\nPois agradeço À Deus porque ela fez de mim esse homem que hoje sou  de caráter e diguino e honrado \r\nCom dez anos minha querida mamãe me colocou em uma Oficina mecânica e ate hoje eu trabalho de mecânico são 43 anos de profissão .\r\nSou uma pessoa lutadora é com vontade de mudar a desigualdade  de nosso povo.\r\nPor  isso entrei na política e juntos seremos um povo forte e vencedores !!!\r\n','bueno.mcamargo1@hotmail.com','1358622637488991'),(15070,'Rosemary Longhini','BRANCA','FEMININO','FEMININO','1963-03-22','ATIVISTA SOCIAL NA LUTA POR DIREITOS E QUALIDADE DE VIDA PARA TODAS AS PESSOAS HÁ MUITOS ANOS.\r\nTRABALHADORA EM EDUCAÇÃO, SEMPRE ATUANDO DIRETAMENTE EM ASSOCIAÇÕES E SINDICATOS DA CATEGORIA.\r\nFUI SECRETÁRIA E PRESIDENTE DA ASSOCIAÇÃO DE MORADORES DA VILA MACENO - AMOVIMA - POR 10 ANOS.\r\nPRATICAMENTE DA FÉ RACIONADA NO ESPIRITISMO.\r\nFEMINISTA NA LUTA CONTRA TODAS FORMAS DE OPRESSÕES DE GÊNERO, RAÇA E ETNIA, PELA EQUIDADE PARA TODOS.\r\nFUI ATIVISTA NO MOVIMENTO #VERGONHARIOPRETO QUE IMPEDIU O AUMENTO DO NÚMERO DE 17 PARA 23 CADEIRAS NA CÂMARA MUNICIPAL, O AUMENTO DO SALÁRIO DOS VEREADORES DE 87% E OS MAIS DE 300 CARGOS APADRINHADOS (QUE AINDA ROLA NA JUSTIÇA). NO #VERGONHARIOPRETO - QUE DUROU 3 ANOS - TIVEMOS MUITAS LUTAS PELO MEIO AMBIENTE, DEFESA DOS ANIMAIS, CONTRA A CORRUPÇÃO, MÁ QUALIDADE DO TRANSPORTE COLETIVO, FAZENDO VÁRIAS DENÚNCIAS AO MINISTÉRIO PÚBLICO COM ABAIXO-ASSINADOS E MANIFESTAÇÕES PÚBLICAS.\r\nO ATIVISMO CONTINUA NO PSOL: MUITAS DENÚNCIAS E ATOS PÚBLICOS: MARCHA DAS MULHERES CONTRA CUNHA, FORA TEMER, DENÚNCIA CONTRA VEREADOR QUE PRATICA COMÉRCIO COM A PREFEITURA, ETC.\r\nA MILITÂNCIA É RAZÃO DE VIVER E A CANDIDATURA NÃO É PROJETO PESSOAL, É PROJETO DE UM COLETIVO INCONFORMADO COM O AVANÇO DAS TENDÊNCIAS FACISTAS QUE SE DESENVOLVEM NO PAÍS.\r\nESTAMOS NA LUTA!! PELOS DIREITOS DE TODAS AS PESSOAS, POR UMA CIDADE DO BEM VIVER, POR UMA POLÍTICA LIVRE DA CORRUPÇÃO.\r\n\"NENHUM DIREITO A MENOS!\" \"POR TODOS OS SONHOS TODA LUTA!\"','rose.longhini@hotmail.com','10154572940432156'),(15101,'Alice Reis','BRANCA','FEMININO','FEMININO','1970-08-23','Mãe de duas meninas, trabalhadora na area da saúde, como agente comunitaria de saúde, sou o elo de ligação entre a população e o ESF, curso o oitavo semestre de serviço social, fui voluntaria na Pastoral da criança.','alice-schinato@hotmail.com','1188704047884633'),(15120,'Marcos Nascimento','BRANCA','MASCULINO','MASCULINO','1960-01-04','Brasileiro, casado, 3 filhos, formação escolar em técnico em publicidade propaganda e Tecnólogo em Logística. atua a mais de 40 anos com  pré adolescentes e adolescentes , fundador do Projeto Sal e Luz de Teatro, dança e esportes.','marcasrepresentacoes2014@gmail.com','1210059495728124'),(15153,'Jô Oliveira','PRETA','FEMININO','FEMININO','1981-05-29','Eu, Jô Oliveira, sou filha de trabalhadora doméstica/costureira, Dona Basta, que me criou sozinha, com a certeza de que ser mulher, pobre e negra, são motivos mais que suficientes para enfrentar o mundo de cabeça erguida e seguir na luta por espaço na sociedade.\r\nA minha base educacional foi em escola pública e hoje sou Assistente Social e mestranda em Serviço Social pela UEPB.\r\nCreio que a minha atuação política se iniciou no movimento estudantil, fiz parte do centro acadêmico de Serviço Social e concorri às eleições do Diretório Central dos Estudantes da UEPB. No segmento juventudes, a minha militância se inicia com a aproximação das atividades da Pastoral da Juventude do Meio Popular – PJMP, e depois integrando a Associação de Juventude pelo Resgate a Cultura e Cidadania – AJURCC, onde fui sócia-fundadora.\r\nEnquanto integrante desses espaços, tive a oportunidade de discutir sobre políticas públicas de juventude e de gênero, com vários outros grupos similares e com organismos de Estado nacionais e internacionais, especialmente no âmbito do MERCOSUL.\r\nIntegrei o conselho municipal do Orçamento Participativo, a Rede de Jovens do Nordeste, e o Conselho Estadual de Juventude da Paraíba – CEJUP. Em 2015 tive o prazer de participar da organização estadual da Marcha Nacional das Mulheres Negras.\r\nParticipei da equipe do mandato da deputada estadual Estela Bezerra, do qual me afastei recentemente para disputar uma vaga na Câmara Municipal de Campina Grande.\r\nFoi a partir dessas experiências e a partir dos processos formativos que vivi que me senti desafiada a ocupar um espaço de decisão como o Legislativo Municipal, por entender que representatividade importa sim!\r\nSou mulher, sou negra, sou fruto dos movimentos sociais e de juventudes, e acredito que um legislativo mais eficaz se faz com mais representatividade e mais participação.\r\n\r\n#JôOliveiraVereadora40000\r\n#aCORdeCampina\r\nfacebook.com/jooliveiracg','assessoriajooliveira@gmail.com','1444782255536895'),(15218,'Carlos Santos','BRANCA','MASCULINO','MASCULINO','1983-08-04','Carlos Santos 13789\r\nMunicípio: Governador Valadares/MG\r\nFacebook: www.facebook.com/CarlosSantosgv\r\nInstagram: @CarlosSantosgv\r\nMais Informações \r\n[MINI BIO]\r\nCarlos Henrique Viveiros Santos nasceu em 04 de agosto de 1983, na cidade de Governador Valadares / MG.\r\nFoi enviado para a Cidade dos Meninos, onde morou dos 7 aos 14 anos de idade, quando voltou a morar no bairro São Paulo. Inseriu-se nas atividades pastorais da Comunidade do Bairro São Paulo integrando a Pastoral da Criança e a Sociedade São Vicente de Paulo e, principalmente, a Pastoral da Juventude através do Grupo de Jovens CEU (Cristo Estamos Unidos).\r\nNa atuação política, a partir de 2006, assessorou vários programas de Juventude, tais como Agente Jovem de Desenvolvimento Social e Humano, ProJovem Adolescente – PJA, Programa Poupança Jovem, Programa ProJovem Urbano e Programa Vale Juventude (antigo PEAS-VALE).\r\nFiliou-se ao PT em 2007. Em 2009 é convidado pela Prefeita Elisa Costa para integrar o Governo coordenando as políticas de juventude na Coordenadoria Especial de Juventude, como o Programa ProJovem Urbano, a eleição do Conselho Municipal de Juventude e o Orçamento Participativo da Juventude – o OPJovem.\r\nNo segundo mandato da prefeita Elisa, em 2013, no Departamento de Políticas Públicas de Juventude da Secretaria Municipal de Cultura, Esporte Lazer e Juventude atuou como Chefe de Departamento. Realizou atividades junto a diversos coletivos, escolas, colégios, secretarias municipais, organizando eventos culturais, estudantis, de formação política, esportivos e voltados para o público LGBTs. Como Chefe de Departamento construiu o Plano Municipal Decenal de Juventude que servirá para definir os projetos e ações para as juventudes de Valadares ao longo dos próximos 10 anos. Seu objetivo é ser discutido entre os coletivos organizados da cidade e seguir para aprovação na Câmara Municipal. Assessorou e acompanhou vários coletivos como o Coletivo Quilombo Secundarista, o Coletivo Pedra Negra, Coletivo Do Mergulhão pra Cá – DMC, Associação Valadarense de Skate, Coletivo de Grafiteiros, Bboys e Associação de BMX.\r\nDo Bairro São Paulo para toda a cidade. É assim a marca da militância. Carlos apresenta seu nome e sua luta de quase 20 anos de atuação em organizações sociais e espaços de gestão pública, representando várias Bandeiras de grupos organizados. \r\nNossa campanha é feita de forma solidária, colaborativa, coletiva e conta com o apoio daquelxs que querem uma reforma política.\r\nVenha conosco e fortaleça um projeto popular para Valadares!\r\nPor todos os nossos direitos!\r\n\r\nEducador Social\r\nEstudante de Ciências Econômicas da UFJF – Campus GV\r\nAssessor Diocesano da Pastoral de Juventude – Diocese de Gov. Valadares MG\r\nAssessor Pedagógico de Coletivos de Juventude \r\nMembro do Coletivo Quilombo – Núcleo GV MG\r\nMembro do Núcleo de Debates sobre Diversidades e Identidades – NUDIS\r\nMembro da Esquerda Popular Socialista – EPS do PT – Núcleo GV MG\r\nDiretor no Departamento de Políticas Públicas de Juventude, Diversidade e Igualdade da Secretaria Municipal de Cultura Esporte Lazer e Juventude da Prefeitura Municipal de Governador Valadares MG','carlos.pj.gv@gmail.com','10208739233610842'),(15224,'Queila Normando','BRANCA','FEMININO','FEMININO','1976-01-06','Mãe trabalhadora, professora de yoga para crianças, terapeuta corporal e feminista socialista.\r\nAtivista pelos direitos das mulheres: humanização do parto, legalização do aborto, amamentação, parto domiciliar, enfrentamento da violência doméstica e por uma educação pública, laica, gratuita e integral.\r\nFiliada ao PSOL porque entende que a luta feminista é também anticapitalista e a saída para os dilemas do capitalismo é a construção de uma sociedade sem exploração e opressões. \r\n','Lanapaula_luna@yahoo.com.br','1190874134284854'),(15260,'Carlos Guto Lopes','BRANCA','MASCULINO','MASCULINO','1980-06-08','NENHUMA PROMESSA!!\r\nChegou a época dos \"salvadores da pátria\". Como não sou um deles, não PROMETO coisas que não poderei cumprir e que não será o meu papel. Agora, prometo continuar LUTANDO incansavelmente contra as injustiças e pelo direito do povo.\r\nRepresentar quem não tem representação. Não esquecer nunca das minhas raízes e das lutas que me forjaram em Itapuã e Águas Claras. Lutar pelas minorias e não abandonar minhas bandeiras.\r\nCombater a Máfia dos Ônibus, até que tenhamos um serviço de transporte coletivo decente, é uma das minhas prioridades.\r\nPortanto, minha promessa é de LUTAR, LUTAR E LUTAR. Com muita coragem e coerência, que sempre acompanhou minha vida.\r\nEstarei junto aos amigos e camaradas de lutas, Romer Guex e Professora Maria Darcila Tinoco, porque são honestos e os mais preparados para governar nossa cidade. São quase 30 anos dos MESMOS governando, e estes afundaram nossa cidade. Precisamos de uma transformação radical. E esta transformação pode ser feita pelo advogado e grande guerreiro Romer Guex Viamão 50.\r\nQuero teu apoio e tua ajuda nesta caminhada, e pode contar comigo sempre!\r\nÀ luta!\r\nGuto Lopes','paracarloslopes@gmail.com','750528115089626'),(15268,'Luciana Lopes Nominato Braga','PARDA','FEMININO','FEMININO','1985-05-30','','Lulonobra@gmail.com','10154112561433049'),(15283,'Fabiana Virgilio','BRANCA','FEMININO','FEMININO','1984-05-18','Fabi é multifacetária! Uma operária em construção! \r\n\r\nFilha da lavadeira Angelina e do motorista Hélio, Fabi é a caçula de 4 filhos: Edi, Flaviano e Luis Henrique.\r\n\r\nComo toda pessoa oriunda da classe trabalhadora precisou trabalhar desde muito cedo.\r\n\r\nEla foi babá aos 12 anos. Aos 14, balconista em banca de jornal. Aos 15, doméstica. E aos 16 trabalhou como menor aprendiz pela CEPROESC no Hospital Santa Casa de Misericórdia de Araraquara, permanecendo lá até seus 21 anos. \r\n\r\nNessa idade, já formada pelo curso Técnico Ator, opta em seguir a carreira profissional de professora de teatro. Por cinco anos ministrou aulas de arte dramática em várias cidades da região e, particularmente, em Araraquara. \r\n\r\nCom seu engajamento como militante cultural, é eleita Conselheira Municipal de Cultura pela cadeira de Teatro, e seu gosto pelas leis e pela política é aguçado. Com seu temperamento forte, Fabi começa a protagonizar debates importantes dentro das instâncias democráticas. E junto com sua companheira de partido, Gabriela Palombo, articulam a classe artística na votação da Plenária das Cidades, em 2006, para a construção do Centro de Artes e Ofícios Judith Lauand e em 2011 investigam e escrevem representação ao Ministério Público sobre o Escândalo da Fundart, que 3 anos depois torna-se uma Ação Civil Pública que pede o retorno de R$ um milhão de reais aos cofres públicos. \r\n\r\nEm 2007 filia-se ao Partido dos Trabalhadores e passa a se engajar em pautas importantes como Combate a Violência contra à mulher e protagonismo da Juventude.\r\n\r\nComo militante cultural, Fabi encabeçou diversos projetos culturais na cidade, de exposições fotográficas até a realização de um sonho: a revitalização da Praça das Bandeiras, um espaço em constante degradação, ocupado por traficantes que inviabilizava o local para a convivência.\r\ne de maneira coletiva, reunindo moradores da região, mudou aquele espaço público em processo de degradação em arte e cultura para a população. \r\n\r\nFabi sempre sonhou com as praças sendo de pertencimento do povo e ocupadas com muita cultura.\r\n\r\nEm 2010 integra o gabinete da então vereadora Márcia Lia, no qual acompanhava e fiscalizava as políticas públicas para a cidade.\r\n\r\nEm 2011, Fabi ingressa no curso de Direito e dentro da Universidade realiza várias atividades importantes para a formação humanística dos alunos.\r\n\r\nEm 2012 com a vitória da sua companheira de partido Gabriela Palombo, Fabi integra o gabinete e se torna o seu braço direito. \r\n\r\nJuntas, atuam de maneira incisiva na fiscalização do Executivo e denunciam ao MP várias das mazelas protagonizadas pelo atual prefeito que tem dezenas de inquéritos abertos por possíveis irregularidades.\r\n\r\nEm 2016 Fabi se coloca como pré candidata a vereadora na possibilidade de renovação dentro do Legislativo, acredita que para haver mudanças profundas em nosso sistema democrático há a necessidade de termos representantes capazes de conhecer e exercer a real função de um vereador. \r\n\r\n\r\n','fabi.virgilio@hotmail.com','1210880038933088'),(15305,'Stefany Avelino','BRANCA','FEMININO','FEMININO','1995-07-28','Sou Stefany Avelino. Mobilizadora social, artista e feminista. Sou candidata a vereadora pelo partido Solidariedade na cidade de Cataguases. Tenho 21 anos, sou mãe da Flora e conciliar politica e maternidade tem sido um grande desafio. Milito no coletivo Mulheres Ativistas de Cataguases, onde venho defendendo os direitos das mulheres atraves de rodas de conversa e mobilizaçao nas escolas. Minha luta principal e de toda a minha vida é o combate ao abuso sexual infantil, desenvolvi de forma colaborativa uma campanha com o CEDECA Interlagos a exposição Todo dia é dia 18 na rede municipal de Cataguases. Em 2013 organizei junto com o Coletivo Motivaço o fórum da juventude em Cataguases, com o intuito de discutir, planejar e realizar açoes e projetos na cidade. Implantei o projeto de incentivo a leitura \" Leia no Ponto\", que posteriormente virou lei municipal. Atuei na criação da Area de Proteção Ambiental Serra da Neblina, onde realizou diversas atividade culturais e ambientais. No que se refere a preservação do patrimonio cultural, tem destaque a atuação na criação e implantação do projeto biciclotrem. projeto Biciclotrem que busca ampliar sua atuação na formação de guias patrimoniais com menores infratores na Estação de Sinimbu, um dos setores socioculturais da referida Unidade de Conservação. No dia 2 de outubro vote por mais inclusão. Vote por mais participação.\r\n\r\n','stefanysavelino@gmail.com','1204284866299964'),(15380,'Neyl Santos','PRETA','MASCULINO','MASCULINO','1990-12-13','NEYL SANTOS, 25 anos, é estudante bolsista de Direito e um jovem militante da esquerda, do PT e do movimento popular, hoje secretário do CONSELHO DE MORADORES da Vila Nossa Senhora da Conceição em PASSARINHO.\r\nComeçou sua atuação política ainda adolescente no movimento estudantil secundarista. Foi presidente do GRÊMIO ESTUDANTIL da Escola Estadual Almirante Tamandaré, localizada no bairro de SANTO AMARO.\r\nMas foi na Igreja que teve boa parte de sua formação ideológica, tendo atuado na PASTORAL DA JUVENTUDE DO MEIO POPULAR - PJMP, chegando até a ser da COMISSÃO NACIONAL desta Pastoral.\r\nIntegrou a COORDENAÇÃO NACIONAL  da campanha CONTRA A VIOLÊNCIA E EXTERMÍNIO DE JOVENS, promovida pelas PASTORAIS DE JUVENTUDE DO BRASIL.\r\nNEYL é um jovem com a cara da mudança social promovida pelos Governos de coalizão encabeçados pelo PT, faz parte da parcela da classe trabalhadora que melhorou de vida e atribui isso a algo além de seu esforço: a um projeto coletivo de nação que foi exitoso, mas que, para continuar avançando é preciso promover mudanças estruturais, radicais, em todas as áreas de nosso país.\r\nVOTAR EM NEYL é garantir um mandato popular. Na câmara dos vereadores NEYL vai defender o projeto democrático e popular encabeçado pelo PREFEITO JOÃO PAULO 13, que devolverá o RECIFE DO POVO DE NOVO.','NEYL13133@GMAIL.COM','1188541931209044'),(15404,'Milton Gonçalves Júnior','BRANCA','MASCULINO','MASCULINO','1983-01-03','MILTINHO 13.133 iniciou sua história no Movimento Estudantil (ME) em Goiânia quando ainda no Ensino Médio. Os secundarias da época lutavam por lanche e livros didáticos, quando ventilador e água gelada nas escolas eram luxo. Mas os desmontes da política neoliberal naturalmente os tornou cada vez mais politizados. Por isso MILTINHO 13.133 Se tornou vice-Centro Oeste UBES, entidade que teve participação decisiva na vitória do tão sonhado Governo Lula. Nesta época Miltinho participou da criação do “Projeto Nova Escola” que defendia a bandeira das cotas para estudantes oriundos da rede pública em instituições de ensino superior (IES). \r\n\r\nApós o período no ME, fui eleito por duas vezes secretário da Juventude do Partido dos Trabalhadores (PT) aqui em Goiânia, ajudando na construção das políticas para a Juventude aqui no Estado de Goiás. Após isto me tornei chefe de Gabinete da Secretaria Municipal de Cultura da Prefeitura de Goiânia, participando de um projeto inovador, articulando e formulando políticas públicas culturais que acabaram servindo de alicerce para pleitear mandato inovador e participativo na Câmara Municipal e dar sustentação à prefeita ADRIANA ACCORSI 13. MILTINHO 13.133 acredita no Educação e na Cultura como os principais mecanismos de inclusão social e de transformação de um povo.','miltonpt13@gmail.com','1236461486376454'),(15543,'Professora Nilva','BRANCA','FEMININO','FEMININO','1958-06-10','Professora na PSP e ESTADO moradora da região  de Pirituba  no bairro Jaraguá  desde 1978. Principais  bandeiras....educação  de qualidade ...defesa dos menos favorecidos....crianças...idosos....quero ensinar os politicos  trabalhar bem para o povo.\r\n','profnilva@bol.com.br','10206276906235848'),(15588,'Mariana Conti','BRANCA','FEMININO','FEMININO','1985-07-23','               Sou  socióloga,  funcionária pública na Unicamp, e candidata a vereadora. Reconhecida por lutar pelos direitos das mulheres, contra toda forma de opressão e por justiça social. Nesse sentido, estou na luta pela criminalização da LGBTfobia, em defesa da delegacia especializada da mulher 24h, e pelo fim da cultura do estupro e do genocídio da população negra.\r\n             Estive nas mobilizações com a juventude pela redução das tarifas e contra o fechamento das escolas.  Temos uma proposta de campanha coletiva,  voluntária e combativa, em defesa da conquista de direitos e pelo fim da corrupção. Para tal, acredito ser essencial a fiscalização da Prefeitura, do uso do dinheiro público, dos contratos no transporte, da merenda e da contratação abusiva dos comissionados, lutando por saúde e educação públicas e de qualidade!\r\n              Em 2012, fui uma das mulheres mais votadas de Campinas, e estive no movimento que barrou a proposta de aumento de salário dos vereadores em 126%. Levantamos na cidade a bandeira contra a \"emenda da opressão\", e a nossa luta continua contra o projeto \"Escola sem partido\". \r\n\r\n#PormaisMulheresnaPolítica\r\n#VamosColoriraCãmara\r\n\r\n','marianacontipsol@gmail.com','283201418740092'),(15597,'Ocilene Cantidio','PARDA','FEMININO','FEMININO','1971-01-01','Sou professora, acredito que temos o dever de lutar e combater as injustiças sociais, e buscar mecanismos que possam punir aqueles q ue abusam do poder e o utilizam como forma de discriminação e de dominaçao.','ocilenecantidio@gmail.com','1578962712129123'),(15634,'Rafaelly Wiest','BRANCA','FEMININO','FEMININO','1983-02-11',' Rafaelly Wiest da Silva quer colocar toda sua experiência política e capacidade de trabalho para ajudar a fiscalizar e melhorar as políticas públicas do município de Curitiba. Com mais de 15 anos de acúmulo de experiência nos campos da política, da educação e da saúde, das lutas sociais e na área dos direitos humanos, Rafaelly Wiest é uma candidata apta para fazer renovação na Câmara Municipal de Curitiba.\r\n Rafaelly Wiest desde 2009 atua diretamente na construção, formulação e debates sobre questões de Direitos humanos, Gênero, Identidade de Gênero, Machismos, Racismo, Xenofobia e Orientação Sexual. Sua trajetória de lutas é testemunha de seu compromisso com a justiça social em Curitiba, Paraná, Brasil e cenário Internacional, sendo anfitriã em 2010 da ILGA-LAC (Associação Internacional de Lésbicas, Gays, Bissexuais, Transexuais e Intersexuais para a América Latina e o Caribe) participação na abertura do PRIDE Toronto – Canadá 2015 e Palestrante convidada pela Organização Mundial de Saúde para a IAS (International AIDS Society) 2015 Vancouver-BC – Canadá. É a Mulher que fará a diferença na Câmara Municipal de Curitiba, comprometida com o respeito à cidadania plena de todas e de todos.\r\n Na sua atuação, sempre teve como diretriz, e continuará tendo como legisladora, o respeito aos princípios constitucionais da igualdade, da liberdade e da dignidade humana, assim como os valores da autonomia, do acesso e das oportunidades. Somos todas/os livres e iguais em dignidade e direitos, pois a nossa sociedade curitibana é plural e diversa\r\nPrioridades: Sua área de atuação de prioridade será a promoção e defesa dos direitos iguais para Mulheres, Pessoas Trans, LGB, pessoas em situação de vulnerabilidade e população Negra, defesa de uma saúde pública de qualidade com acesso e permanência aos serviços SUS, educação pública gratuita e de qualidade, inclusive com a valorização da política participativa, através do controle social.','rafaellywiest@yahoo.com.br','1131984240215989'),(15689,'Lucas Postinguel','BRANCA','MASCULINO','MASCULINO','1995-06-13','Sou Lucas Postinguel, tenho 21 anos, sou estudante de Engenharia Agronômica pela Unesp, tambem produtor rural e agora político.\r\nNa verdade sempre me interessei pela política desde pequeno e agora tive a oportunidade de entrar como candidato a vereador.','lucas_postinguelmc@hotmail.com','1120725101381259'),(15693,'Sergio Moraes','BRANCA','MASCULINO','MASCULINO','1972-12-22','Sergio Moraes nasceu em Campinas, tem 43 anos de idade é casado, tem três filhos cursa Faculdade de Gestão Publica ,é empresário no ramo de prestação de serviço e sempre encontra tempo para estar envolvido na luta comunitária em favor da comunidade local.  \r\nSérgio Moraes é morador da Região dos Amarais no Conjunto Habitacional Prefeito Edvaldo Orsi(CDHU SAN MARTIN) desde que foi entregue em 2003 e sempre esteve envolvido na luta por melhorias do bairro e da região. É idealizador do Projeto Mãos Dadas que anualmente leva Ações de Cidadania,Saude,Cultura,Esporte e Lazer gratuitamente a população dos Amarais, é membro da  ONG Soka Gakkai Internacional que desenvolve ações pela Paz ,Educação e Cultura baseado na filosofia Humanista da criação de valor que começa com cada um e se expande para o ambiente onde vivemos, já foi coordenador do Bolsa Familia, Gestor da Farmacia Popular, Conselheiro Habitacional ajudando na regularização fundiciária , criou o Centro de Referencia do Trabalhador Autônomo, ajudou a implantar o MES-Municipios Sustentaveis, Conselheiro Local e Distrital de Saude e Conselheiro Escolar.\r\nNos 13 anos como morador e líder comunitário do Cdhu San Martin, foi responsável pelas maiores conquistas do bairro como a ampliação do centro de saúde e como conselheiro distrital a construção do centro de saúde san martin, a construção da Nave Mãe, a exclusão postal, possibilitando aos moradores não necessitar pagar para receber cartas, ainda a conquista do ônibus para levar as crianças para creche no San Martin e quando os moradores do bairro tiveram sua linha de ônibus limitada a ir apenas até a estação de transferência e obrigados a desembolsar duas tarifas para ir até o centro, imediatamente Sergio Moraes revindica que o ônibus volte a ir até o centro e consegue ajudar os moradores do bairro, entre outras lutas e conquistas, ajudando mais de  18 mil moradores desse bairro e região, fundou a Associação de Moradores do Bairro em 2009 embora nunca tenha feito parte da  diretoria e com isso ajudou o bairro a ter representação e a conquistar outras melhorias que vemos hoje no bairro.\r\nSérgio Moraes, nunca quis ser candidato, mas sempre lutou por melhorias no local em que vive.\r\nCom a crise politica , ao invez de ficar esperando ver a mudança nesses políticos que ai estão, resolve ser candidato e fazer a mudança, pois a Politica só muda quando nós mudamos a politica.\r\nSergio Moraes tem um sonho: ver uma Campinas mais humana, justa, solidária e sustentável.\r\nMesmo sem ser Vereador, Sergio Moraes lutou e fez muito pela região dos Amarais, agora precisa do seu voto para fazer muito mais pela região e por toda Campinas.\r\nUm bom politico precisa governar pelas pessoas e para as pessoas e não em prol de seus próprios interesses e vantagens.\r\nSonho que se sonha só, é apenas sonho, mas quando se sonha junto, transforma em realidade. Peço seu voto de confiança para juntos construirmos  uma Campinas melhor.\r\nPara que essa mudança aconteça precisamos também eleger um Prefeito comprometido com o bem estar das pessoas, honesto, transparente e que saiba realizar uma gestão elencando as prioridades e sobretudo sempre pensando nas pessoas, por isso Sergio Moraes esta com Artur Orsi 55 para Prefeito.       ','falecom_sergiomoraes@hotmail.com','1335393686491597'),(15753,'Fernanda Pinto Miranda','BRANCA','FEMININO','FEMININO','1982-01-29','Sou Fernanda Miranda, mãe do Sebastian, Professora Municipal de Pelotas/RS e estudante de Psicologia da UFPel. Licenciada em Letras/Espanhol e especialista em Linguística Aplicada, ambas pela UFPel. Já trabalhei como Conselheira Tutelar de Pelotas, no comércio e como secretária.\r\n\r\nDe família pobre, sempre tomei como exemplo minha mãe e seu pai, pessoas trabalhadoras e que resistem a essa sociedade injusta.\r\n\r\nComo mulher, resisto e luto para romper com todas as formas de opressão. Enquanto alfabetizadora, tento ensinar além das letras, tornando os alunos cidadãos críticos, questionadores, participativos e, principalmente, transformadores. Acredito na escola Pública e estou sempre na luta por uma educação crítica, transformadora e emancipatória.\r\n\r\nAcredito na luta de classes, na participação popular e na democracia.\r\n\r\nAo assumir mais essa luta, compreendo que representatividade importa e que precisamos ocupar cada vez mais os espaços de poder. É preciso mudar o quadro político de Pelotas, porém, a mudança exige, além de vontade, a compreensão de que a luta das mulheres na câmara municipal de Pelotas deve ter como foco o combate ao machismo e a construção de uma nova sociedade.','fpintomiranda@hotmail.com','10207494452621256'),(15812,'Nana Oliveira','PRETA','FEMININO','FEMININO','1977-12-06','Nana Oliveira  é mulher, negra, candidata a vereadora de BH, advogada popular formada há 15 anos, atuante na área criminal. Militante antiprisional e antiproibicionista, sempre lutou pelo fim do genocídio da população negra e pela desmilitarização da segurança pública da cidade.\r\nConstruiu a assessoria jurídica do Grupo de Amigos e Familiares de Pessoas em Privação de Liberdade até meados de 2012 e foi Presidente do Conselho da Comunidade na Execução Penal da Comarca de BH. É advogada popular do Coletivo Margarida Alves e participa da construção do Coletivo Maria Felipa que atuará exclusivamente na área criminal.\r\nAcredita que uma sociedade onde caibam todas e todos não pode ser construída por um Estado violento e opressor e sim pelo poder popular e pelo exercício da democracia.','nana_vieiraoliveira@hotmail.com','1536582943034062'),(15831,'Silvana Mendes Dos Santos','BRANCA','FEMININO','FEMININO','1971-03-07','Boa tarde ....\r\nSou Candidata a Vereadora.\r\nSão inúmeras e divergentes temáticas municipais que devem ser contempladas quando se pensa em desenvolvimento local e regional dos municípios, como por exemplo: agricultura, ciência e tecnologia, comércio, cultura, educação, esporte, habitação, indústria, lazer, meio ambiente, saúde, segurança, serviços, setor social, transporte, turismo etc.','silbambam@hotmail.com','10206067119592000'),(15865,'Marquinhos Costa','PARDA','MASCULINO','MASCULINO','1960-12-22','Marcos Antonio da Costa Jiupato, 55, casado, pai de três filhos, estudante de filosofia/sociologia\r\nAuxiliar administrativo, Sindicato dos Químicos Unificados, sub sede Paulínia,  líder comunitário, ex-dirigente sindical, ex-militar, cristão protestante, defensor do Estado laico.\r\nNão sou dominado nem dominador quem eu sou?\r\nSe a vossa luta for justa, pode contar comigo!!!','marquinhoscostabnv@yahoo.com.br','1170617642981929'),(15912,'Luciana Dantas Andrade','BRANCA','FEMININO','FEMININO','1956-08-26','Caxambuense, casada. Graduada em Odontologia, Mestre em Política Social. Candidata à vereadora.','lucianadantasandrade@gmail.com','1078638802173105'),(15954,'Conrado Carrasco','BRANCA','MASCULINO','MASCULINO','1987-09-26','Conrado Carrasco é graduado em Relações Internacionais e Ciências Políticas pela PUC-SP e pela Universidade de Copenhague, na Dinamarca.\r\nIniciou sua vida profissional trabalhando para o Ministério da Indústria e Comércio Exterior do Governo de Cingapura, antes de juntar-se ao ICLEI-Governos Locais pela Sustentabilidade, onde desenvolveu projetos de políticas públicas sustentáveis para municípios no Brasil e no mundo.\r\nEm paralelo, militou no movimento estudantil, onde foi Diretor do Centro Acadêmico de Relações Internacionais “Barão do Rio Branco” da PUC-SP por duas gestões.\r\nFoi eleito Vereador em 2012 com 1.104 votos, sendo o mais votado da oposição.\r\nAlém da vereança, leciona Sociologia ao Ensino Médio, concede palestras em colégios e faculdades, e é pesquisador na área de políticas públicas.\r\nHoje, está filiado à Rede Sustentabilidade, construindo um novo projeto de futuro para Itanhaém.','conrado.carrasco@gmail.com','10153938032473527'),(15973,'Rogério Dias','BRANCA','MASCULINO','MASCULINO','1977-12-09','Rogério Dias tem 38 anos, é vegetariano, é nascido e criado em Campinas/SP (região do Pq. Via Norte/vl. Boa Vista), é Policial Militar há 19 anos e milita na proteção animal (com postura abolicionista e contra o especismo).\r\n\r\nPromoveu em 2013 uma petição com cerca de 6 mil assinaturas, solicitando a castração gratuita de cães e gatos em Campinas. A petição foi entregue nas mãos do prefeito Jonas, que disponibilizou as castrações, além de microchipagem e identificação dos animais. Atualmente, encabeça a petição pela proibição de fogos de artifício no município, principalmente pela grande quantidade de animais (domésticos e silvestres) vitimados pelo estresse, morte, fuga, atropelamentos, mutilações, etc.\r\n\r\nDevido sua militância em defesa dos animais, onde muitas vezes incomodou algozes de animais em situação de maus tratos, foi vítima de um atentado em sua própria residência (Pq. Via Norte). Onde covardemente jogaram carne envenenada para 6 cães. Já no interior da residência, picharam os olhos de um deles e suas casinhas e esparramaram lixo por cima de seus corpinhos. Além de picharem todas as paredes com dizeres ofensivos pelo fato de ali moram um \"protetor de animais\", além de jogarem ovos e quebrarem os vidros da residência.\r\n\r\nRogério Dias não tinha qualquer pretensão em se candidatar. Porém, devido aos fatos cruéis envolvendo seus animais, além de sua dedicação em prol deles, decidiu participar da disputa eleitoral ao cargo de vereador em seu município.\r\n\r\nCaso eleito, assumirá também, o compromisso de ouvir as demandas de todos os segmentos da sociedade, incluindo os direitos das comunidades LGBT, negros, mulheres, crianças e adolescentes, portadores de deficiências, moradores em situação de rua, dependentes químicos, entre outros. Pois acredita que todo servidor público tem por obrigação atender e servir todos sem distinção. E como representante do legislativo isso será uma prioridade. ','diasr13@yahoo.com.br','653562154803453'),(15978,'Fabricio J. F. Ezhno','BRANCA','FEMININO','FEMININO','1959-12-09','Candidata a vereadora em Vitória, ES, Lena Signorelli atuou no Ministério da Cultura acompanhando a criação da Secretaria Nacional de Diversidade Cultural. Um momento importante para a consolidação do apoio ao direitos sociais, a expressão e singularidade das populações negras, LGBT, da mulher e demais grupos, como culturais tradicionais, ribeirinhas, indígenas e populares. Em Vitória, foi secretária de Cultura, dinamizando as ações de arte e cultura pela periferia e imprimindo um movimento forte e criativo em termos culturais. \r\n','fabriciofernandesproj@hotmail.com','313289612380288'),(16074,'Inês Paz','BRANCA','FEMININO','FEMININO','1952-03-19','Inês Paz é uma mulher de luta. Defende as trabalhadoras e os trabalhadores há mais de 40 anos. \r\nFoi vereadora durante dois mandatos e o povo de Mogi conhece o seu trabalho junto aos bairros mais pobres e junto aos movimentos sociais.\r\nNeste momento de crise econômica, de crise política, de crise ambiental e de crise moral; neste momento de autoritarismo e de retirada de direitos do povo trabalhador, eleger Inês Paz vereadora é uma necessidade para fiscalizar a prefeitura. \r\nNa Câmara, Inês Paz será uma voz das mulheres e da juventude; dos negros e negras e da comunidade LGBT; dos trabalhadores e das trabalhadoras\r\n\r\nInês Paz, um mandato de luta. Um mandato necessário. \r\n','inespaz.50050@gmail.com','1190176307672558'),(16106,'Antonio Januzzi Marchi De Godoi','BRANCA','MASCULINO','MASCULINO','1978-07-09','Antonio Januzzi é advogado criminalista e professor universitário. Luta pela construção de uma sociedade livre, em que a consciência das necessidades coletivas e das aspirações comunitárias seja um dever e a individualidade, um valor reconhecido. Na esfera municipal, deseja viver em uma cidade humanizada, onde o bem-estar comum seja medida de racionalidade para as ações e escolhas de uma Administração Pública democrática, responsável e transparente. Entende que a força popular é o único instrumento legítimo para redesenhar-se a esfera pública brasileira, obrigando ao desmonte dos complexos sistemas de privilégios estabelecidos sobre as bases históricas do favorecimento familiar, das preferências afetivas e dos laços pessoais. Se a superação dos entraves da miséria e da ignorância é a principal condição para a emancipação coletiva do cidadão, ao Estado cabe oferecer possibilidades sólidas, democráticas e solidárias para que todos os indivíduos possam explorar todas as potências de suas personalidades. É esta a luta pela liberdade.','antoniogadv@gmail.com','10210573144713089'),(16143,'Cristiano Oliveira','BRANCA','MASCULINO','MASCULINO','1982-06-24','Família: Cristiano é natural de Registro-SP, 34 anos, filho do Sr. Daniel de Oliveira (policial federal aposentado e ex-juiz de paz de Registro) e Sra. Neuza Fragoso Martins (professora aposentada), irmão da Prof. de Matemática Clenilde Martins Oliveira. É casado há 5 anos com a registrense Gislene de Oliveira e pai do Theo, de 1 ano e 7 meses.\r\n \r\nFormação Profissional: Aprovado em seu primeiro exame da Ordem dos Advogados do Brasil, desde os 22 anos é Advogado (OAB/PR 39.430 e OAB/SP 246.073) e também ator e professor universitário.\r\n \r\nFormação Educacional Superior: É Mestre em Direito pela Universidade Católica de Santos; Doutorando em Direito pela Universidad del Museo Social Argentino; pós-graduado especialista em Sociologia Política pela Universidade Federal do Paraná - UFPR e também em Direito Criminal e Criminologia pela UFPR.\r\n \r\nExperiência Profissional: Advogado com escritório próprio em Registro desde 2006; Professor Universitário desde 2006 da Unisepe/Scelisul, lecionando Direito Administrativo e Direito Criminal para os cursos de graduação superior em Direito, Administração, Ciências Contábeis, Processos Gerenciais, Hotelaria e Processamento de Dados. Foi Diretor do Departamento Jurídico da Prefeitura de Iporanga em 2006/2007; Coordenador do Curso de Direito da Unisepe/Scelisul de 2008 a 2010, conduzindo o processo de formação das primeiras turmas do curso e ao seu reconhecimento pelo Ministério da Educação-MEC. Atua também desde 2010 como Agente público do MEC como Avaliador Nacional de Cursos de Graduação em Direito. Foi Secretário de Cultura e Turismo de Registro de 01/2013 a 03/2016.\r\n \r\nReconhecimentos Profissionais: premiado sete vezes consecutivas como o profissional ‘Top of Mind’ (mais lembrado) de Registro na área de Direito Criminal em pesquisa realizada na cidade nos anos de 2010 a 2016. Também foi premiado três vezes pela mesma pesquisa como Secretário Municipal ‘Top of Mind’ de 2014 a 2016. Recebeu Moção de Aplauso da Câmara Municipal de Registro pelo sucesso na realização do Carnaval.\r\n \r\nFormação Artística: Ator formado pelo Núcleo de Profissionalização Teatral do Paraná, se profissionalizou como ator em 2005 perante o Sindicato dos Artistas do Paraná (DRT/PR 21.135). Em sua carreira artística, possui 17 peças no currículo, com temporadas de sucesso em Curitiba, São Paulo, Rio de Janeiro, Portugal e Registro. De 2008 a 2012 atuou como produtor cultural independente em Registro, trazendo inúmeras peças das grandes capitais para a cidade.','cristianomartinsoliveira@yahoo.com.br','10210113456888479'),(16181,'Gilson Gabriel','BRANCA','MASCULINO','MASCULINO','1962-02-24','Professor de Sociologia da Rede Estadual de Educação do RJ e poeta, atua junto aos movimentos sociais de Valença desde o início da década de 1980. Ajudou a fundar o PT na cidade durante a década de 1980, vindo afastar-se dele no início de 2002. Filiado ao PSOL há menos de dois anos, aceitou a tarefa de compor a nominata de Vereadores por acreditar ser possível um projeto de cidade diferente, onde direitos não sejam apenas peças de discurso, mas realidade para a toda a população trabalhadora.','gilsonluizgabriel@gmail.com','1245778438808154'),(16454,'Lavinho OitavaNota','PRETA','MASCULINO','MASCULINO','1958-12-11','Olavo de Roma mais conhecido como Lavinho OitavaNota ou LAVINHO.\r\nPrimeira vez como candidato á Vereador por Sto André pretende representar toda Comunidade Andreense com toda dignidade e respeito que ela merece se comprometendo com  todas as causas sociais e necessárias para um bem estar uma população que à muito já não se sente representada com honestidade.\r\nSou nascido em Sto André,tenho 58 anos,casado com 4 filhos e 4 netos,músico e empresário na cidade,a mais de 40 anos faço parte da cultura e lazer do nosso município.\r\nAos 7 anos de idade comecei a trabalhar como engraxate e vendedor para ajudar minha Família.Aos 12 anos fui carregador de sacolas na feira,catador de papéis e cobrador de ônibus.Nos anos 70/80 trabalhei como DJ de bailes,dançarino de equipes de dança e passista de Escolas de Samba.\r\nCom 18 anos iniciei minha carreira de músico percussionista e back-vocal.\r\nPor 11 anos fui Metalúrgico,depois tapeceiro e comerciante,profissão que sigo até hoje na área de fabricação.\r\nEstou sempre participando de reuniões sociais para planejamento de melhores condições para todo Comunidade, principalmente atuando contra o racismo em todas ás áreas,contra á descriminação do idoso,apoio á projetos da Cultura,saúde e educação em prol de toda população Andreense.','grupoitavanota@gmail.com','314261538928460'),(16457,'Cristal Lopez','PRETA','MASCULINO','MASCULINO','1982-09-20','Sou Cristal,tenho 34 anos sou negra trans e periférica,sou atriz e bailarina é participo de movimentos sociais e artísticos como redeafrolgbt,mooca,pretas em movimento,toda Deseo e Perifericxs','cristallopezdiva@gmail.com','1205694912820529'),(16472,'Olavo Jurevicius Jurevicius','BRANCA','MASCULINO','MASCULINO','1969-08-13','Morador a mais de trinta anos na cidade, o prof Olavo, já foi candidato ao conselho tutelar do município e é militante do sindicato dos professores na região. A educação e a garantia dos direitos da população são suas principais causas, além, é claro, da fiscalização da lisura que todos os que trabalham com o bem público deve manter.','Olavojurevucius1@gmail.com','10210053802209182'),(16541,'Mariângela Jacomini','PRETA','FEMININO','FEMININO','1967-08-14','Tenho atuação nos movimentos sociais, ONGs e Conselhos Municipais ligados à defesa dos direitos humanos sobretudo dos negros, mulheres, pessoas com deficiência, população LGBT e moradores da periferia. Atuo também na defesa dos direitos dos animais. Sou professora universitária porém atuo em educação na rede pública estadual e na rede particular há 28 anos. Atualmente leciono nos cursos de Pedagogia e Letras e sou supervisora de ensino na rede estadual de São Paulo sendo responsável pela garantia do direito à educação dos alunos LGBT e com deficiência além de desenvolver projetos de qualificação profissional para professores na área de direitos humanos e inclusão social. Sou formada em Pedagogia e Letras, com pós-graduação em Gestão da rede pública pela USP e Mestrado em Educação na linha de pesquisa Políticas Públicas em Educação pela PUC Campinas. Atuo juntos a ONGs que acolhem animais abandonados e recebem denúncias de maus tratos organizando campanhas de adoção e posse responsável. Todos os meus projetos são voltados para minha área de atuação pois tendo feito parte dos segmentos minoritários desde que nasci (mulher, negra, pobre, filha de pais não casados, irmã de pessoa com deficiência - paralisia cerebral) sei exatamente quais são os desejos, angústias e principais problemas enfrentados pelos meus pares. Atuo, também, junto ao sindicato dos professores Apeoesp desde que ingressei no serviço público do estado de São Paulo  e sou militante do Partido dos Trabalhadores desde 1989 tendo sido candidata a vereadora em 1996 e a vice-prefeita em 2000. Tenho experiência e formação para ser uma representante atuante nas causas humanitárias colaborando para a inclusão social das minorias e levando para a Câmara Municipal questões que a sociedade sanjoanense reluta em discutir como violência doméstica, comércio de animais, falta de oportunidades de estudo e trabalho para a população LGBT, racismo, sexismo, homofobia, discriminação social, centralização e elitização da cultura, acessibilidade e inclusão. Meu compromisso é com o povo que não tem voz, que não é ouvido, que é oprimido pela falta de informação e de acesso aso serviços públicos. ','mljacomini@bol.com.br','1214976105241812'),(16591,'Glauco Giuliano Vicentin Gobbi','BRANCA','MASCULINO','MASCULINO','1989-03-18','Glauco é advogado especialista em Direito do Trabalho, tem 27 anos e milita pelos Direitos Sociais.','glaucojus@hotmail.com','1167633089941433'),(16628,'Alex Eduardo','BRANCA','MASCULINO','MASCULINO','1977-11-24','Sou Alex Eduardo GM, candidato a vereador pelo PTB. Sou morador de Paulínia a 25 anos, trabalho como Guarda Municipal a 17 ano, sempre desenvolvendo minha função com dedicação e presteza junto a população. Sou casado, pai de 04 filhas, formado Tecnólogo em Logística e com determinação para cumprir com minhas obrigações na Câmara Municipal, lutando pelos interesses da população.','alex.edu77@hotmail.com','249363102131115'),(16648,'Alexandre Lopes','BRANCA','MASCULINO','MASCULINO','1989-02-07','Filho de militantes de movimentos sociais que representavam a luta dos trabalhadores rurais em Minas Gerais, estou na vida politica desde que me entendo por gente. Sou estudante e conselheiro da juventude em SBC. Uma sociedade mais igualitária, a luta pela garantia dos direitos da população em risco social e defesa das minorias marginalizadas são as bandeiras do PSOL e as minhas.','alexandre.lopes.sbc50@gmail.com','1036573619744833'),(16653,'Viviane Atalaia','BRANCA','FEMININO','FEMININO','1979-03-26','Meu Trabalho começou em 2000 com atividades para Crianças e adolescentes na Santa Rosa e Vila da Quinta, em 2004 fui Presidente da Associação de Moradores da Quinta até 2012, em 2013 concluí a Faculdade de Gestão Pública na UFPEL e a convite do Prefeito Alexandre Lindenmeyer em 2015 assumi a Subprefeitura da Quinta.\r\n\r\nEm todos essas e outras atividades que não mencionei, meu objetivo sempre foi lutar por melhor qualidade de vida e garantir os direitos de Todos, sem diferenças.\r\n\r\nTenho um histórico de lutas comunitárias e experiência Administrativa, este ano fui delegada Municipal e estadual nas Conferencias LGBT Estadual e Nacional.\r\n\r\nLuto por Igualdade Social e para que o direito de todos seja respeitado, sem exclusão Étnica, Social, de Religião e de orientação sexual e identidade de gênero.','vivimrof@hotmail.com','1214746491880233'),(16714,'Cleo Teixeira','BRANCA','MASCULINO','MASCULINO','1981-10-13','Cléo é professor da rede de ensino estadual. Através do seu trabalho, busca ajudar na formação da juventude para fazermos uma cidade melhor. Juntos vamos destruir os muros que dividem a sociedade e impedem que todos tenham acesso a uma vida digna.\r\nMinha trajetória como educador tem me mostrado que precisamos investir pesado na formação das crianças e jovens.\r\nDiferentemente de alguns que defendem menos recursos para a educação e querem mais jovens presos, para nós, o caminho é cada vez melhores escolas e cada vez menos prisões!\r\nNão podemos aceitar que algumas famílias ricas, continuem controlando a política na cidade. Pelo fim da privatização das políticas públicas! Contra o cabide de empregos que só serve à política do \"toma lá da cá\"!','cleofastb@yahoo.com.br','1201770559845076'),(16716,'Diana Assunção','BRANCA','FEMININO','FEMININO','1985-11-14','Sou Diana Assunção, 30 anos, historiadora formada pela PUC-SP, trabalhadora da Faculdade de Educação da USP e Diretora licenciada do Sindicato dos Trabalhadores da USP. Organizei o livro \"A precarização tem rosto de mulher\" sobre a greve das trabalhadoras terceirizadas da USP. Escrevi o prólogo do livro \"Mulher, estado e Revolução\", da historiadora norte-americana Wendy Goldman, publicado pela Boitempo Editorial e Edições ISKRA. Escrevi a orelha do livro \"Reivindicações do direito da mulher\", de Mary Wollstonecraft, uma das fundadoras do feminismo mundial, publicado pela Boitempo Editorial. Participei ativamente das greves de trabalhadores, estudantes e professores da USP contra a privatização da universidade, assim como de diversas greves de trabalhadores em São Paulo e das lutas da região onde vivo, a Zona Oeste em defesa da educação e da saúde pública. Sou parte da redação do portal Esquerda Diário (www.esquerdadiario.com.br) e militante do Movimento Revolucionário de Trabalhadores, assim como do grupo de mulheres Pão e Rosas. Minha candidatura é pra fortalecer uma voz anticapitalista, lutando por nossos direitos e contra a exploração deste sistema, ampliando a luta dos trabalhadores, das mulheres, dos negros, da juventude e das LGBTs.','diana.assuncao17@gmail.com','10201847577907278'),(16731,'Roberto Barros','PARDA','MASCULINO','MASCULINO','1963-04-07','O guarulhense Roberto Paulo de Barros, 53 anos é casado há 25 anos, pai, atuou por 23 anos no corpo de bombeiros e hoje administra a Associação de Cabos e Soldados da Policia Militar Regional Guarulhos.  Barros, como  é atualmente o presidente do Rotary Club Guarulhos Leste e vem à frente da luta por melhores condições para a população, através de vários projetos sociais, com o intuito de dar oportunidade de uma vida digna e da garantia dos direitos à todos. O Bombeiro Barros é Candidato a Vereador para representar a população guarulhense nos próximos 4 anos.\r\nAtravés do Rotary Club Guarulhos leste, o bombeiro Barros vem à frente de vários projetos sociais visando sempre ajudar e fortalecer a comunidade.\r\nUm destes projetos é o Centro de Assistência e Motivação de Pessoas (CAMP), que vem oferecendo gratuitamente aos jovens de Guarulhos a preparação para começarem suas vidas profissionais e a oportunidade do primeiro emprego, através de parcerias e muito trabalho com o objetivo de construir uma cidade justa. Já foram atendidos neste primeiro semestre mais de 100 jovens carentes e muitos deles já estão trabalhando e ajudando suas famílias a viver com mais dignidade. Barros conhece de perto a realidade da população guarulhense e esta disposto a se dedicar à luta por uma cidade melhor, melhorando a segurança pública, a saúde, a educação e a infra estrutura da cidade através de seu trabalho e da sua experiência buscando sempre a melhoria de condições de vida a todos.','robertopaulo.barros@gmail.com','1438192636197966'),(16739,'Adriana Marestoni Spadoni','BRANCA','FEMININO','FEMININO','1974-08-08','\r\nMulher batalhadora, está em Campinas há 30 anos, casada, mãe de três filhos, Psicóloga e Funcionária Pública como Guarda Municipal há 18 anos, trabalhou com muito empenho e carinho na instituição de deficientes visuais realizando atendimentos Psicológicos, acolhendo e orientando às famílias e usuários daquela instituição, também é pós graduada em Psicologia do Trânsito.\r\n\r\nSempre estudou em escola pública, sua graduação foi cursada com programa estudantil baseado em melhor empenho e sabe o quanto é importante ter um ensino forte e eficiente como base de apoio para as crianças e adolescentes.\r\n  \r\nTem experiência na área de segurança há 18 anos e  como Psicóloga, acredita que essas duas atividades unidas possam proporcionar uma grande melhoria à população de Campinas.\r\n\r\nLutar pela dignidade de vida dos menos favorecidos, fiscalizando e fazendo valer o direito do cidadão com relação à sociedade em que vive. Melhor educação, segurança e saúde mais adequada.\r\n\r\nTrazer um novo olhar para área de segurança, um olhar mais aprofundado de quem tem conhecimento e experiência. A segurança não é feita apenas de equipamentos, ela é feita de humanos para humanos, não se esquecer de cuidar dos profissionais que cuidam e promovem a segurança é fundamental.\r\n\r\nÉ necessário  ampliar o atendimento para os portadores de necessidades especiais, reorganizar programas de saúde preventivos, criar em cada unidade de saúde atendimento prioritário para estes pacientes com aplicação efetiva das leis já aprovadas, aumentar a rede de atendimento escolar para alunos com necessidades especiais, criar projetos de assistência psicológica que atenda efetivamente alunos, funcionários e familiares da rede pública que tragam proporcione melhor qualidade de vida à sociedade.','adrianamarestoni@yahoo.com.br','1215843305139029'),(16773,'Soninha Cipriano','PRETA','FEMININO','FEMININO','1961-03-16','Bom sou mãe sou vó e mulher que luta pelos seus ideais;\r\nsou nascida na z/s de São Paulo , mais ultimamente vivo na z/n.\r\nSou viuva mais moro com duas filhas e tres netos em Jaçanã ,\r\ntrabalho e muito em uma hamburgueria em pinheiros no periodo \r\nnoturno , como operadora de caixa ,, gostaria muito de ganhar para \r\npoder tentar melhorar algumas coisas como a area da saúde que esta totalmente debilitada,\r\ne a area da saúde que se nossas crianças forem bem educadas podemos contar com um Brasil\r\nmelhor. que posso dizer mais sobre mim meu pai era musico nas noites paulistanas , mais porem tocava com bastante pessoas internacinais era trompetista , minha mãe era dona de casa .\r\nsou mae de tres filhos , Marcio , Sheyla e Kamila , moro de aluguel e bem dificil as coisas\r\nmais porem tenho muita fé e persistencia e sou muito feliz por ter essas pessoinhas ao meu lado familia a base de tudo \r\n','sosoninha10@hotmail.com','1166664583390267'),(16786,'Jackson Barboza','PRETA','MASCULINO','MASCULINO','1965-12-14','#vamosjuntoseducarcampinas\r\n Formado em Engenharia Elétrica USF, Pedagogia UNIMEP, Administração e Política USP, Petróleo e Gás UNICAMP, Prof. Jackson Barboza 14100, é natural de Campinas, dedica a vida à Família, as Comunidades e a Educação.\r\nProfessor das Escolas Técnicas ETEC Bento Quirino, Data Way, Arquimedes, SENAI, CEPROCAMP e Faculdades Anhanguera e Policamp,  Prof. Jackson Barboza 14100 esta sempre preocupado com assuntos relacionados à Educação e Justiça Social.\r\nDesde a adolescência lutando por educação de qualidade fui Militante na UCES (União Campineira dos Estudantes Secundaristas) e UNE (União Nacional dos Estudantes).\r\nCom a bandeira de luta pela Educação e Justiça Social disputei as ultimas 4 eleições defendendo a mesma bandeira e para conseguir ocupar o cargo de Vereador preciso do seu voto, o voto de sua família, voto de seus vizinhos e voto de seus amigos para podermos fazer com que Campinas possa ser exemplo de Qualidade de Vida para todo o Brasil.\r\n                                                     QUERO SER SEU REPRESENTANTE, VAMOS JUNTOS  NESTA CAMINHADA\r\n                                                 ','jackson_barboza@hotmail.com','10210414743946332'),(16805,'Hugo Leonardo','PRETA','MASCULINO','MASCULINO','1984-06-28','Olá sou o candidato que vai lutar, pelas minorias, sou candidato LGBT que vai te representar pois assim com uma sociedade mais justa Vamos Construir um futuro melhor pois a igualdade é o caminho sou seu candidato da igualdade e da diversidade!','hugo_leonardo_23@hotmail.com','671918279634650'),(16816,'Lena Signorelli','BRANCA','FEMININO','FEMININO','1959-12-09','Candidata à vereadora em Vitória, ES, Lena Signorelli atuou no Ministério da Cultura acompanhando a criação da Secretaria Nacional de Diversidade Cultural. Um momento importante para a consolidação do apoio ao direitos sociais, a expressão e singularidade das populações negras, LGBT, da mulher e demais grupos, como culturais tradicionais, ribeirinhas, indígenas e populares. Em Vitória, foi secretária de Cultura, dinamizando as ações de arte e cultura pela periferia e imprimindo um movimento forte e criativo em termos culturais.','lenasignorelli@uol.com.br','1426947607319877'),(16833,'Marcos Vinicios H. Moreira','BRANCA','MASCULINO','MASCULINO','1989-07-27','Marcos Vinicios Habib Moreira nascido e criado em Teresópolis/RJ. Desde muito moço faço militância comecei através da militância estudantil e em conselhos, fóruns municipais e um conselho regional. Graduei-me em Teologia na Universidade Metodista de São Paulo (UMESP). Hoje sou professor de teologia publica e ativista na área de direitos humanos, desenvolvo trabalho de dialogo inter-religioso. Tenho um olhar através da teologia da missão integral da igreja e da teologia reformada. Tenho posições progressistas dentro da religião cristã. Sou do Partido Socialismo e Liberdade (PSOL/RJ) em Teresópolis-RJ, pois sou socialista e congrego na Primeira Igreja Batista em Teresópolis/RJ que é ligada a Convenção Batista Brasileira (CBB).\r\n\r\nTenho a honra de ser e participar da Rede Ecumênica da Juventude, Rede FALE, Equipe de Voluntários da Visão Mundial - RJ, Coletivo Ame a Verdade - Evangélicos contra Corrupção, Evangélicos pela Justiça, Movimento Evangélico Progressista, Frente Evangélica pelo Estado de Direito, P3 - Pastoral Popular Progressista, ONG Diversidade, Coletivo Cristãos pela Democracia e do Movimento Cristianismo Relevante.','marcoskhabbaz@gmail.com','308597382848498'),(16946,'Juliana Soares Do Nascimento','BRANCA','FEMININO','FEMININO','1987-11-19','Sou professora na rede estadual, socióloga pela PUC-Campinas, mãe, feminista e militante do Partido dos Trabalhadores. Por mandatos coletivos, populares e democráticos. Pela ampliação e qualificação da participação das mulheres no legislativo. Por projetos políticos comprometidos com políticas sociais e pautados pelas reais demandas da população que vive e constrói a cidade. ','jusoarescs@yahoo.com.br','779471035489110'),(16947,'Clistenes Silva','BRANCA','MASCULINO','MASCULINO','1977-05-31','Clistenes Carvalho da Silva é munícipe de Campinas, empregado público e empreendedor. É casado com Cintia Pereira de Oliveira e juntos têm um filho, Gabriel Henrique Carvalho de Oliveira.\r\nMora em campinas desde 1984 no bairro Jd Novo Campos Elíseos, cursou o ensino fundamental na E.E.P.S.G Prof.ºPedro Salvetti Netto localizada no bairro vizinho Parque Ipiranga e também na E.E.P.S.G.Padre José dos Santos no Jardim Novo Campos Elíseos, para depois iniciar e concluir o ensino médio integrado com o ensino técnico na Escola Técnica Estadual Bento Quirino, sendo assim formado em Eletrotécnica e curso superior em Tecnologia em Gestão Pública na Faculdade Anhanguera no Jardim Londres.\r\nSua trajetória de vida na maioria das vezes convergia para o empreendedorismo numa parte devido a escassez de empregos e em outra por vocação mesmo, seu primeiro emprego foi num supermercado do bairro onde empacotava e levava até os carros as compras dos clientes em troca de gorjetas, isto aos 13 anos.\r\nTrabalhou posteriormente vendendo roupas de porta em porta, como camelô, funileiro e pintor de automóveis, ajudante em montagens industriais, atendente de call-center, ajudante geral, motorista e instalador de Tv a cabo. Alguns anos depois construiu com um sócio uma lanchonete de médio porte, passado algum tempo vendeu este comércio e iniciou uma lan house na garagem de sua residência, este empreendimento foi muito próspero pois Clistenes antecipou o sucesso da internet com as redes sociais e jogos em rede. \r\nDurante este período inaugurou um salão de beleza, o Cintia Hair Estúdio que ainda atende mulheres de toda a cidade, foi quando Clistenes se inscreveu para concorrer em concurso dos Correios, Sanasa, Guarda Municipal de Vinhedo e Prefeitura de Sumaré. Foi aprovado em todos, destacando a 1ª posição para Eletrotécnico em Sumaré e 2º colocado na prova para Guarda Municipal de Vinhedo.\r\nOptou, porém em trabalhar nos correios e depois na Sanasa, onde trabalha atualmente, em relação à política Clistenes diz: \r\n_Acredito que a política é lugar de gente comum, igual eu e você sim, discordo de quem diz que política é complicada, que é lugar de doutores, advogados e pessoas com perfil totalmente diferente do perfil das pessoas comuns. Política é lugar deles sim, mas é também lugar de pessoas comuns que também precisam que alguém as represente.\r\nQuando elegemos alguém para nos representar, esperamos que esta pessoa ao menos entenda o nosso dia a dia, como esperar melhorias na saúde se as pessoas eleitas para tentar melhorar a situação nunca precisaram entrar num posto de saúde ou hospital super-lotados, ver um ente querido ser atendido após horas de espera numa rápida conversa de no máximo cinco minutos, onde a maioria dos médicos nem olham para o paciente.\r\n\r\nO mesmo se repete com transporte e educação, resumindo, a população precisa interromper este ciclo vicioso na política, precisa eleger pessoas que saibam de verdade como é a vida do povão, que já tenham usado transporte público, precisado do S.U.S, ou seja que tenha vivido ou viva a vida como a população vive.\r\nPor exemplo, quando um deputado vota a favor da terceirização, não tenha dúvidas que este político nunca foi empregado numa terceirizada para saber os prejuízos da terceirização para o trabalhador, sendo que a terceirização só favorece as grandes empresas, aí você pesquisa e descobre que o tal deputado é dono de algumas destas empresas ou recebe doações delas. \r\nÉ simples, não é complicado entender, mas os meios de comunicação inundam a vida do povo com mensagens, notícias, comentários e tudo mais que afirmam que a política é muito complicada e que não é lugar para qualquer um, curiosamente é lugar para todos que atendam seus interesses.\r\nQuando ouvimos pessoas afirmando que sentem pavor da política, criticando as pessoas que decidem se filiar a algum partido político e por fim enumeram os problemas no bairro, cidade e país estão na verdade fazendo o que a maioria dos atuais políticos querem, que você e eu, pessoas comuns fiquem longe da política e não dêem suas opiniões e nem interfiram no sistema em favor da população.\r\nCada cidadão tem sua parcela de responsabilidade, pois quando uma pessoa decide que a política não é lugar para gente “comum” e abri assim mão da oportunidade de participar diretamente das decisões que promovem mudanças no bairro, cidade e país onde vivem, está ao mesmo tempo em que abre mão de seu lugar, permitindo que pessoas corruptas tanto criticadas ocupem este vazio. A conseqüência é resumida nos problemas que tantos criticam e reclamam solução.\r\nAcredito que nós podemos contribuir para a construção de uma sociedade mais justa, começando pelo bairro, cidade e país. A política é uma ferramenta para amplificarmos nossas vozes, evidentemente é decisão de cada um participar ou não de um partido político sendo que também é de livre arbítrio a escolha do partido, mas a conseqüências das decisões afetarão a todos quer queiram ou não.\r\nEscolhi participar diretamente da construção de um país melhor para todos, minha luta é “por dias melhores para todos”.\r\nConvido você a participar de um grupo com este objetivo, vamos debater idéias e projetos, precisamos participar politicamente, venha conosco!','clistenescps@gmail.com','340212716317576'),(16959,'João Scarpa','BRANCA','MASCULINO','MASCULINO','1975-03-02','Ator, produtor e diretor teatral e audiovisual. Está envolvido com movimentos em prol de políticas públicas de cultura nas esferas municipal e estadual, além de ações para melhoria da qualidade de ensino e valorização dos professores. Está empenhado, ainda, na criação de uma coordenadoria municipal de direitos humanos junto à Secretaria Municipal de Governo.','joaoscarpaator@gmail.com','1240129109378075'),(16967,'Rachel Fogaça','BRANCA','FEMININO','FEMININO','1964-08-21','Servidora do Hospital das Clínicas desde 1993, trabalha no Serviço de Psicologia. Foi Delegada Sindical do SINDSAÚDE-SP, da direção da Associação dos Servidores do HC (ASHC) e Cipeira. Rachel Fogaça tem uma intensa luta em defesa da Saúde Pública e dos direitos dos trabalhadores, contra a política do PSDB de desmonte dos Serviços Públicos. Liderou diversas mobilizações como a reabertura do CMSC Vila Lobato e a criação da Praça no Parque Ecológico da Pedreira de Santa Luzia. Lutou arduamente contra o fechamento do Centro de Cnvivência Infantil  do HC (CCI) e pela criação do Bom Prato no HC. \r\n\r\nComo Petista, Rachel Fogaça defende as bandeiras que fundaram o partido. Os ataqes ao PT, apesar dos anos de conciliação com inimigos do povo, fazem parte do plano dos poderos de atacar os trabalhadores e nossa capacidade de luta, destruindo nossas organizações. A verdade é que o sistema eleitoral do País é apodrecido e não representa a vontade do povo. Por isso, Rachel Fogaça apoia a luta por uma Assembleia Constituinte  para fazer a reforma política, que permita ao povo começar a passar o País a limpo e combater a corrupção, como as que agora são denunciadas no desastroso governo de Darcy Vera e envolve vários vereadores da cidade. É o caminho para ter nossas reivinidcações mais urgentes atendidas. Rachel Fogaça é aderente do Diálogo e Ação Petistas, na luta pela reconstrução do PT. Internacionalista, defende a retirada das tropas do Haiti. ','rachelfmhcrp@gmail.com','1338601986180583'),(16971,'Bigton Eduardo','BRANCA','MASCULINO','MASCULINO','1976-05-14','Projeto PILOTO de Arborização Urbana usando árvores nativas da Região (Mata Atlântica e Cerrado - Custo Zero (Convênio USP (Ribeirão Preto) e UEMG (Passos) ) visando as melhorias e benefícios que Arborização Urbana traz: Valorização imobiliária - Saúde Física e Mental (Comprovado Cientificamente) - Atenuação do Calor e Raios Solares - Mantêm o Equilíbrio do Eco-sistema Local (insetos, pássaros e animais(Seres Vivos)) Atenuação Sonora - Embelezamento da Paisagem - Atrair Turismo - Gerar Renda - Tudo isso com Acessibilidade e Inclusão e Participação de TODOS Cidadãos da Comunidade - Cuidar do Ar - da Terra (Lavouras) e Água da Cidade (Tratar 100% do Esgoto) - Incentivar e Investir na Mudança de Matrizes Energéticas (Sol - Vento - Água de Chuva - Força dos Rios)\r\nPromover o Crescimento SUSTENTÁVEL de maneira Plena e Consciente com a União de Todos com Base na Moral e nos Bons Costumes.\r\nPromover a AGREGAÇÃO de VALOR em Produtos Produzidos na Cidade (ex.: CAFÉ) 1 saca = $500,00 = 2500 cafézinhos de $1,00 cada = $2500,00 - $500,00 (café) - $500,00 (açucar e gás) = $1500,00 de LUCRO em 1 saca ( o cara da padaria fez 3 sacas em cima de 1, isso é AGREGAR VALOR AO PRODUTO, isso é GERAÇÃO DE RENDA, Transformar a Matéria Prima ANTES de VENDER.','eduardobigton@hotmail.com','10208945646371040'),(17001,'Elisangela Kelly Delarica Lica','PRETA','FEMININO','FEMININO','1980-02-12','Nasci e fui criada em Campinas, tenho 36 anos, moro no Jardim São Pedro, casada, mãe de 6 filhos, sendo 3 biológicos e 3 adotados, somos membros da igreja Batista Ágape em Campinas, me formei em Pedagogia pela Unicoc. Trabalhei por mais de 10 anos na educação infantil e também já fui professora contratada do Estado de São Paulo, ministrando aulas para ensino fundamental e médio.\r\n Vim de um lar simples, sem muitas condições e casei-me aos 17 anos sem ainda concluir os estudos, mas com força de vontade voltei às salas de aula, pois acredito que a educação e conhecimento podem nos abrir portas!\r\nAtualmente estou envolvida em um Projeto Social totalmente voluntário que oferece as crianças alimentação, reforço escolar e ensinamentos que agregam valores e ética, dando –lhes estímulos para valorização a vida. Faço da minha própria casa lar temporário para meninos e meninas carentes que precisam de atenção e cuidado. Nessa iniciativa, pude cuidar de mais de 15 crianças.\r\nAmo e respeito cada ser humano e acredito que todos precisam de oportunidades. Por isso, quero lutar para trazer dignidade a muitas crianças e adolescentes, pois eles representam o nosso futuro assim como um belo jardim que para manter-se lindo e frutífero tem que ser regado e cuidado, sem nenhuma negligencia. Quero lutar contra o abuso, a exploração infantil, os maus tratos e a desconstrução da infância.','elysangelakelly@hotmail.com','1266768653354609'),(17019,'Jorge Veiga Junior','BRANCA','MASCULINO','MASCULINO','1959-03-11','','jveigajr@terra.com.br','10202394972471107'),(17026,'Luiz Henrique Dos Santos','PRETA','MASCULINO','MASCULINO','1979-12-25','Luiz Henrique dos Santos, 36 anos, casado com Erika e pai da Gabriely, músico há 18 anos e produtor musical. Mais conhecido como MONTANHA. Iniciou sua militância na Pastoral da Juventude da Arquidiocese de Campinas, paróquia São Judas Tadeu a mais de 20 anos, trabalhando na capacitação de novas lideranças de grupos e movimentos. \r\nDefende que é preciso capacitar, sempre, novos líderes para que haja um mundo melhor.\r\nEx-Funcionário da Petrobras, onde atuou no planejamento de manutenção. \r\nEm sua formação acadêmica estão: \r\nTecnologia da Construção Civil (FT-UNICAMP)\r\nTécnico em Bioquimica (ETECAP)\r\nTécnico em Eletrônica (Fundação Bradesco)\r\n\r\nPropostas:\r\n**** Mandato Coletivo*****\r\nTrabalhar diretamente com apoio da população dando voz para os anseios da população\r\n\r\n***** Melhorar a Lei de Ocupação do Solo *****\r\nAlterar a lei atual para permitir que artistas da cidade possam realizar eventos e atividades de maneira mais facilitada sem tanta burocracia.\r\n\r\n***** Polos Culturais ****\r\nElaborar leis que incentivem o desenvolvimento de artistas regionais transformando espaços públicos em espaços permanentes de cultura e educação.','montsacustico@gmail.com','298975797140463'),(17055,'Daniel Finizola','PARDA','MASCULINO','MASCULINO','1980-06-10','Daniel Finizola é caruaruense, jovem, formado em publicidade e propaganda, ciências sociais, professor há 16 anos, servidor concursado do município, músico, compositor, agitador cultural, membro do Conselho Municipal de Cultura, responsável pela condução do premiado Gabinete Digital Caruaru, da Secretaria de Participação Social. \r\n\r\nÉ militante pela cidadania por meio das mídias digitais, ferrenho defensor dos direitos trabalhistas, articulador do projeto São João com Acessibilidade, ação vencedora do prêmio nacional de Direitos Humanos do governo federal. É vice-presidente do Partido dos Trabalhadores, filho da professora Valquíria Antônia com o compositor e médico Janduhy Finizola e pai do pequeno Bento.\r\n\r\nNa perspectiva de que renovar é preciso, queremos lhe fazer um convite: fortalecer esta luta, compreendendo que passa por todas e todos nós a responsabilidade de questionar e modificar essa Câmara de Vereadores, que pouco tem representado os interesses da população. Se você quer algo de novo na política, alguém que proponha um diálogo permanente, venha com a gente fazer diferente.\r\n','contatofinizola@gmail.com','570759063110963'),(17080,'Celimar Gomes da Silva','PARDA','MASCULINO','MASCULINO','1976-02-26','Contem comigo\r\n\r\nCelimar Gomes da Silva, mais conhecido como PROFESSOR CELIMAR, reside em Campinas a mais de 35 anos sendo quase 20 anos na região do Campo Grande, mais especificamente no Jardim Lisa, Hoje Distrito Campo Grande – Campinas.\r\n\r\nNa área profissional trabalhou doze (12) anos no comercio, supermercados, chegando a gerenciar um dos supermercados da rede Batajão, hoje Paulistão; Área que requer bastante atenção. E com o conhecimento adquirido iremos apoiar os comerciantes com estratégias conjuntas em Campinas.\r\n\r\nGraduado em Educação Física – Licenciatura Plena pela PUC-Campinas desde 2005 pôde atuar na rede publica de ensino onde foi possível observar os anseios da área, principalmente em relação aos professores, quanto à falta de valorização e meios matérias para apoio aos mesmos. Queremos junto aos mesmos buscar soluções para a valorização, o bom rendimento e o reconhecimento profissional.\r\n \r\nGraduado em Superior Técnico de Polícia Ostensiva e Preservação da Ordem Pública (PM), onde desempenha suas funções atuais a mais de quinze (15) anos, pôde se especializar em diversos cursos, como:\r\n \r\nExtensão Universitária em Sistema para detecção do Uso abusivo e Dependência, Encaminhamento, Reinserção e Acompanhamento. SUPERA - 5ª Edição;\r\n\r\nExtensão Universitária Capacitação para Conselheiros e Lideranças Comunitárias ·Prevenção ao Uso Indevido de Drogas - 5ª Edição;\r\n\r\nExtensão Universitária Capacitação para Conselheiros e Lideranças Comunitárias ·Prevenção ao Uso Indevido de Drogas - 1ª Edição;\r\n\r\nOs quais lhe proporcionaram ser autor de diversos projetos sociais e palestras comunitárias;\r\n\r\nFormação também que lhe proporciona plenos conhecimentos na área da segurança publica, as quais têm diversos projetos, como: Criação da Ronda Escolar da Guarda Municipal.\r\n\r\nPossui diversas outras formações, como: Professor de Artes Marciais, que lutará em defesa das academias e profissionais liberais da área.\r\n\r\nPós Graduado também em MTC - Medicina Tradicional Chinesa · Acupuntura Turma de 2010 · Lato Senso.\r\n\r\nCelimar Gomes da Silva\r\nEducador Físico – Acupunturista\r\nCREF 057148-G/SP','celimarkungfu@hotmail.com','10205599618149231'),(17108,'Leandro Rodriguez','BRANCA','FEMININO','FEMININO','1960-08-13','Rose (Igreja do Bonfim), conhecida como \"Professora Rose\". \r\n\r\nNasci e cresci na cidade de Santo André, minha infância e adolescência foram nos bairros Camilópolis, Santa Terezinha e Vila Sá, e a mais de 20 anos resido no Parque das Nações.\r\n\r\nSou Bacharel e Licenciada em Educação Física pela FEFISA, com especialização em Técnica de Futsal, arbitragem em Futebol e Atletismo pelas federações paulistas. E também sou Formada em Fé e Política pela Diocese de Santo André.\r\n\r\nAtuei no ensino em escolas estaduais, municipais, particulares, centros esportivos, fui atleta e jogadora de futebol, onde atuei em diversos times inclusive o Santo André e Seleção Paulista de Futebol Feminino.\r\n\r\nEm 2002, comecei meu trabalho social com a melhor idade, promovendo o bem estar físico, mental, social e espiritual, dentro de igrejas católicas, empresas, associações, escolas e praças. Neste mesmo ano, juntamente com o Frei Josemar e a Direção da Cidade dos Meninos \"Maria Imaculada\",  começamos o desenvolvimento e a implantação do Centro de Convivência Franciscana e da Melhor Idade, além do Centro de Reabilitação e Equoterapia, que hoje atende 400 crianças com necessidades especiais. Há 4 anos com os grupos da melhor idade começamos a dar assistência aos moradores de rua.\r\n\r\nFui conselheira escolar municipal, estou Diretora Social da Sociedade Esportiva Curuçá (S.E.C), e recentemente assumi a Coordenação das Mulheres da ONG ABCD\'S.\r\n\r\nApós anos de trabalhos voluntários promovidos pelos meus projetos sociais voltados a minorias como melhor idade,  e as diversidades como raciais, sexuais, culturais, e etc. Veio a necessidade de ser mais atuante no cenário político, e com a maturidade adquirida decidi me tornar candidata a Vereadora por nossa Cidade.','professorarose.santoandr@gmail.com','1207337979338347'),(17123,'Überkönnenstein Anderson','PRETA','MASCULINO','MASCULINO','1979-08-09','Eu,  Überkönnenstein (ou simplesmente Über), sou Professor efetivo no Estado,  Leciono Filosofia, sou ex-seminarista da Igreja Católica, atuo junto aos grêmios estudantis pela construção de uma identidade e cidadania crítica. Em busca de exercício do conhecimento como expressão de autonomia individual e social,  por isso eu milito em um autêntico coletivo de lutas pelas minorias que é o PSOL, tenho enraizado em mim a luta pela desconstrução destes miseráveis e famigerados preconceitos de uma sociedade que não reconhece o outro, o diferente é tratado com indiferença e não com acolhimento, isto demonstra quão necessário é o conhecimento;  olhar além do horizonte de visões morais e religiosas que se põem como unilaterais e que não devem ser impostas para todos, do contrário teremos uma sociedade recrudecida pela intolerância e não liberta, fadada à miséria e ao caos , sujeita à uma eugenia sanguinolenta e que elimina a diversidade de gêneros, posto que,  aqui não se faz necessário dizer que só uma visão de mundo que permite-se aberta ao conhecimento será capaz de enxergar outras culturas como parte da humanidade. Não somos iguais - ainda bem -  e precisamos desenvolver esta capacidade de reconhecimento nos alunos,  uma vez que eles já saem e seus bojos domésticos carregados de intolerâncias. Portanto,  reafirmo continuar o trabalho que já faço em sala de aula na defesa e desenvolvimento dos direitos da cultura LGBTT como cultura da diversidade de gênero e também contra o racismo, porque, de fato, todos somos variantes de uma única raça: a humana. Felicidade só existe quando eu reconheço a diversidade! \r\n','uberkonnenstein@gmail.com','860735780692571'),(17126,'Cris Rocha','PARDA','FEMININO','FEMININO','1979-09-23','Sou moradora do bairro Gutierrez e represento a ONG Acolhe  Belo Horizonte, grupo de apoio a animais de rua. Se eleita quero ampliar meu trabalho onde já realizo resgates e cuidados veterinários tudo por conta própria.\r\nMeu projeto prevê uma sede própria para atendimento veterinário gratuito aos animais de rua. Castrando, vacinando e realizando feiras periódicas de adoção, assim teremos uma redução considerável no número de abandonos e maus tratos. Atenderemos moradores de comunidades carentes que possuam animais adultos em fase de reprodução. \r\nO projeto também disponibilizará transporte para fazer os resgates solicitados. Faremos palestras em todas escolas da rede pública, com orientações de como cuidar dos animais e dicas de saúde. Muitos animais são abandonados por falta de informação de como cuidar de suas patologias. Educando a população conseguiremos alcançar nosso objetivo, não ter nenhum animal abandonado mais.','kitinhafr@hotmail.com','10202292148940683'),(17241,'Luís Cláudio Messa Longo','BRANCA','MASCULINO','MASCULINO','1975-02-26','Coordenador do Coletivo Juarez Braga, atuou na Secretaria de Desenvolvimento Urbano de São Paulo, na gestão Haddad e contribuiu com a construção do Plano Diretor e de Zoneamento da Capital. Trabalhou na gestão do PT (2005-2012) em Suzano, na Secretaria de Governo, no Gabinete do Prefeito e na Secretaria de Participação e Descentralização, na qual foi um dos responsáveis pela implantação do Orçamento Participativo na cidade.\r\n\r\nIntegrou o Coletivo Nacional de Juventude do PT, atuou no movimento sindical dos professores pela APEOESP, cursou Filosofia e foi diretor do DCE da Universidade de São Paulo, do Centro Acadêmico de Filosofia e diretor de Escolas Públicas da UNE.\r\n\r\nFiliado ao PT desde 1994, Luis Cláudio foi candidato pela primeira vez em 2012 e é pré-candidato a vereador em Suzano.','luisclaudiopt@gmail.com','1192529454138773'),(17248,'Uilson Alves','PARDA','MASCULINO','MASCULINO','1974-01-30','SIMPLESMENTE MAIS PELA FAMÍLIA ','uilsonmanaim@hotmail.com','1229188203769203'),(17282,'Sonia Aparecida','BRANCA','FEMININO','FEMININO','1956-02-16','MEU NOME É SONIA SECCON, NASCIDA E RESIDENTE EM CAMPINAS.\r\nNão tenho nenhuma formação acadêmica, possuo apenas o 2 grau completo,mas como muitos possuo as experiências que a vida me deu dentro de um mundo tão conturbado, mas como a maioria das pessoas, também sonho com um mundo melhor.\r\nSou a  favor da diversidade, contra  qualquer tipo de preconceitos.Sonho com uma sociedade mais justa, mais humana e sei que se juntarmos nossas forças tudo isso é possível.\r\nQuero junto com  todos, me unir aos trabalhos participativos, lutando pelos direitos humanos cobrando o que nos são de direito, como professores nas escolas, remédios, postos de saúde com médicos disponíveis para melhor atendimento publico.\r\nTenho como prioridade a saúde, educação e transporte, não esquecendo de que aos poucos podemos fazer uma CAMPINAS MELHOR.\r\n','soniaseccon64@gmail.com','531852730357082'),(17290,'Ezequiel Costa','PRETA','MASCULINO','MASCULINO','1973-08-06','Sou Ezequiel Costa, com mais de 20 anos de militância em lutas sociais e em diversos espaços, como o movimento estudantil e em diretorias de bairros. Formado em Economia e nesse momento estou candidato a uma vaga para o legislativo ijuiense. \r\nMinhas bandeiras são a busca por ampliação dos direitos sociais e dos direitos humanos para os trabalhadores e para os grupos sociais que estão em busca de espaço e respeito na sociedade.','hezequielcosta@yahoo.com.bt','1030329087083883'),(17291,'Nazareno Antonio da Silva','PRETA','MASCULINO','MASCULINO','1983-12-28','Candidato a vereador pela primeira vez,Buiu atua na comunidade de Heliopolis e região lutando pela melhoria da saúde ,cultura,esporte ,moradia sua principal bandeira de luta será a luta para  transforma as comunidades em bairros educadores como exemplo que foi feito em Heliopolis que hoje é exemplo para o mundo de transformação social ,buiu é exemplo foi aluno de projetos da unas e hoje quer construir juntos com outras comunidades a garantia de direitos .\r\n\r\nVamos juntos construir comunidades educadoras \r\n\r\nBuiu do povo para o povo vereador \r\n\r\nConheçam mais nossas proposta no face /buiudopovoparaopovo','buiunas@yahoo.com.br','1482333255114049'),(17320,'Doraci Lopes','BRANCA','FEMININO','FEMININO','1947-11-20','Nasci em Atibaia (SP) e vivi com a família de tapeceiros em São Paulo, onde estudei e trabalhei desde os 16 anos de idade. Vim para Campinas em 1973 e desde então dediquei-me a conhecer e participar de diferentes campos de interesse público da cidade, seja como estudante, pesquisadora e militante do Partido dos Trabalhadores desde a sua fundação. Sou Bacharel e Mestre em Sociologia pelo IFCH UNICAMP e doutora em Sociologia pela FFLCH USP. Profa. titular aposentada da PUC-CAMPINAS fui Docente e duas vezes diretora da Faculdade de Ciências Sociais (1982 a 2011), como também atuei em outras faculdades. Fui professora colaboradora da Pós Graduação de Arquitetura e Urbanismo e da Pós Graduação de Educação da PUC-CAMPINAS. Sou do Núcleo de Mulheres do PT e da Marcha Mundial de Mulheres, além de ter atuado em movimentos sociais pelo direito à cidade e moradia. ','doraci.lopes@gmail.com','1294589257240652'),(17325,'Teresinha de Carvalho','BRANCA','FEMININO','FEMININO','1956-02-17','Ha 30 anos luto pelos direitos das mulheres. Criadora do CEAMO e Guarda Amigo da Mulher. Veradora (2000 a 2008) com 116 leis aprovadas. Fui a primeira  Delegada da Mulher de Campinas. Professora e especialista na lei Maria da Penha (Acadepol) \r\nCompromisso: DDMn24hrs\r\nCentro de reabilitação do agressor.\r\nPolíticas Públicas para pessoas em dituação de rua.\r\nDelegada Teresinha 45190 PSDB Jonas 40.','suporteteresinha@hotmail.com','888356651297006'),(17346,'Marcos Paquito Maciel','BRANCA','MASCULINO','MASCULINO','1973-06-15','Belo-horizontino de nascimento, Marcos Lima Maciel é POLICIAL FEDERAL há 26 anos. Na Polícial Federal auta no combate a repressão ao tráfico ilícito de entorpecentes. Membro da Fundação Nosso Lar, é conhecido pelo trabalho social que realiza na comunidade. Na Câmara Municipal quer trabalhar por uma nova visão de auxílio aos dependentes químicos, para combater a corrupção em todos os seus níveis, além de lutar para priorizar o investimento na educação e saúde. !Dediquei toda minha vida pública no combate à corrupção e quero ser seu representante para garantir uma melhor aplicação dos recursos públicos e combater o desvio de verbas. a forma mais DEMOCRÁTICA para reduzir a desigualdade social e fazer uma sociedade mais justa é por meio d política!. Eleja quem sem combateu a corrupção MARCOS LIMA POLICIAL FEDERAL n. 51999.','marcoslima2525@hotmail.com','1384877458193310'),(17378,'Naiara Camargo','PRETA','FEMININO','FEMININO','1989-03-21',' Naia Camargo-65033, é uma jovem empresária da área de organização de eventos e uma trabalhadora voluntária das causas sociais. Solteira, filha de Ricardo e Rita de Cássia, de uma família de mais 3 irmãos, Naia Camargo-65033 tem 27 anos e muita garra para trabalhar em prol da cidade. \r\n\r\nComo empreendedora, Naia Camargo-65033 conhece as dificuldade de se manter um negócio e gerar emprego e renda. Por isso, na Câmara Municipal vai trabalhar por incentivar e promover novos empreendedores. Em seu trabalho, leva cultura e entretenimento à população e quer atuar para que haja incentivo às iniciativas culturais e de lazer na cidade. Seu objetivo como vereadora é trabalhar pela assistência social e apoiar as entidades que trabalham com crianças na cidade. \r\n\r\nBANDEIRAS\r\n\r\n- Apoiar e incentivar ações de assistência social em toda a cidade; \r\n\r\n- Atuar em prol das entidades assistenciais que trabalham com crianças;\r\n\r\n- Trabalhar por moradias dignas; \r\n\r\n- Mais ações culturais e de lazer para os moradores da periferia;\r\n\r\n- Atuar para incentivar a criação de novas empresas e geração de emprego.','nhayara_show@hotmail.com','1067629696607851'),(17398,'Danilo Magrão','BRANCA','MASCULINO','MASCULINO','1987-12-31','Sou professor de Sociologia da rede estadual e dou aula na EE Maria Julieta. Me formei na Unicamp e também sou colunista do portal de notícias Esquerda Diário. Propomos que todos os políticos recebam igual a um professor e eu, se eleito, continuarei recebendo o meu salário atual de professor.','parizyn@hotmail.com','1139841479428150'),(17400,'Carolina Ca Cau','PRETA','FEMININO','FEMININO','1988-11-23','Carolina Cacau, candidata a vereadora do MRT pelo PSOL. É estudante e foi por 2 anos do Centro Acadêmico de Serviço Social da UERJ, professora da rede estadual e moradora do Méier. É colunista do Esquerda Diário. Participou ativamente da greve da UERJ e dos professores da rede estadual que duraram 4 meses combatendo o sucateamento e a precarização da educação pública. Luta junto as terceirizadas da UERJ contra a precarização do trabalho. É militante feminista e negra. Defende que todo político ganhe o salário de uma professora. Se eleita seguirá vivendo com o salário de professora da escola pública e o restante doará para a luta dos trabalhadores, da juventude, das mulheres, negros e LGBT’s. Nosso mandato irá combater os privilégios dos políticos.','carolinabondezan@gmail.com','1099370673491098'),(17411,'Iaci Maria','BRANCA','FEMININO','FEMININO','1984-02-15','Sou professora licenciada de Sociologia da rede estadual de MG e dou aula na EE Helena Guerra. Sou também colunista do portal de notícias Esquerda Diário. Propomos que todos os políticos recebam salário igual a uma professora e eu, se eleita, continuarei recebendo o meu salário atual de professora.','ia.maria1917@gmail.com','1390244494336192'),(17451,'Ronildo Cabral','PRETA','MASCULINO','MASCULINO','1970-07-14','Ronildo Cabral é Professor, graduado em Letras (UFCG - Universidade Federal de Campina Grande) com Especialização em Educação EJA, concluinte do Curso de Direito pela UEPB (Universidade Estadual da Paraíba) Gestor Cultural, eleito membro do CNPC (Conselho Nacional de Políticas Culturais), também é membro do CONSECULT (Conselho de Cultura do Estado da Paraíba) e membro do CONCULT (Conselho de Cultura do Município de Campina Grande. É Sócio fundador da AGRUP-CG (Associação dos Grupos de Danças Populares de Campina Grande) e atua a frente da Companhia Raízes há mais de 20 anos, onde desenvolve um trabalho sociocultural com crianças e adolescentes, em bairros periféricos, através do \"Ponto de Cultura Raízes do Amanhã\". ','ronildo.cabral@gmail.com','10205585186748859'),(17473,'Fernando Padilha','BRANCA','MASCULINO','MASCULINO','1973-01-26','Oi, meu nome é Fernando Padilha, sou candidato a Vereador pelo partido REDE SUSTENTABILIDADE e gostaria de me apresentar.\r\nTenho 43 anos, casado, nasci em Campinas e em minha vida estudantil passei pelos colégios Liceu Salesiano, Farroupilha e Objetivo.\r\nCursei direito na UNIP e Ciência da Computação na Anhanguera, profissionalmente já atuei como bancário, depois como analista de desembaraço aduaneiro no aeroporto de Viracopos, depois como analista de TI em uma multinacional fabricante de pneus, depois como gerente administrativo e de TI em um fabricante de alimentação animal, hoje trabalho em minha própria empresa onde tenho como responsabilidade a gestão da mesma junto com minha sócia  e também o desenvolvimento de projetos de infraestrutura de informática e suporte técnico a clientes.\r\nAcredito que tenha condições de cumprir o papel de vereador em função da experiência adquirida ao exercer as diversas atividades nas empresas que atuei, sempre com dedicação, honestidade e transparência.\r\nComo candidato assumo o compromisso com a transparência na gestão pública.','fernando_padilha@hotmail.com','10207114362365429'),(17490,'Belo Everson','PRETA','MASCULINO','MASCULINO','1973-07-01','Sou Bacharel  e Licenciado em Geografia e Cursando o ultimo semestre de Engenharia Ambiental;\r\nRepresentante da Comunidade Negra de Campinas;\r\nParticipo do Movimento negro de Campinas desde de 2006;\r\nSou funcionário publico na Empresa Sanasa. ','eversonprofessor@gmail.com','1223582227699643'),(17528,'Bene Lima','PARDA','MASCULINO','MASCULINO','1988-02-07','Estudante de Direito pela Pucc.\r\nMinha proposta é a redução do salário do vereador em 50% para que possamos ter pessoas interessadas em trabalhar em prol a população e não por dinheiro .','limabene@gmail.com','2230116800460574'),(17568,'Jair da Famácia','BRANCA','MASCULINO','MASCULINO','1954-12-15','Nascido em Campinas, no bairro São Bernardo, aos 17 anos começou sua carreira profissional como aprendiz de farmacêutico. Há 40 anos trabalha na mesma farmácia e se consagrou como um profissional de excelência. Conhecido em toda região como “Jair da Farmácia” cuidando da saúde e bem estar de inúmeras famílias. Na Câmara quer dar continuidade e intensificar seu trabalho social que sempre desenvolveu ao longo da sua vida. Como vereador acredita que poderá apresentar propostas e projetos que beneficiarão não apenas um grupo de pessoas ou famílias, mas beneficiarão centenas de moradores de diversas comunidades, principalmente as que mais necessitam de atenção do poder público.\r\n','jair.quinalia@gmail.com','177578409316238'),(17630,'Gabriela Cabral','BRANCA','FEMININO','FEMININO','1987-02-10','Nascida na cidade de São Paulo em 1987. Se interessou por política ainda criança e aos 16 anos se filiou ao PT, onde já atuava politicamente nas campanhas eleitorais. Dai em diante, passou a acompanhar a vida política. \r\n\r\nAos 18 anos ingressou na faculdade de Direito na Universidade São Judas Tadeu, onde fez Iniciação Científica por meio do Programa Voluntário de Iniciação Científica (PVIC), com o tema “O Vereador e a Participação Popular: o caso do município de São Paulo”, onde entrevistou os vereadores e a população para analisar a interação entre o Poder Legislativo e o cidadão.\r\n\r\nAinda na época da faculdade, fez o curso de Promotoras Legais Populares, coordenado pela União de Mulheres de São Paulo. Um curso específico para as mulheres, a fim de que elas se empoderem adquirindo conhecimentos sobre seus direitos, cidadania, acesso à justiça e igualdade de gênero.\r\n\r\nParticipou do Estágio-Visita da Câmara dos Deputados, um curso de curta duração sobre Processo Legislativo.\r\nFez estágio em diversos órgãos públicos como concursada, sendo no Ministério Público de São Paulo, na Procuradoria Geral do Estado, na Procuradoria Geral do Município e no Poder Judiciário.  Foi conciliadora voluntária no Juizado Especial Cível.\r\n\r\nApós o término da faculdade, continuou seus estudos nas temáticas da cidadania e política, assim fez os cursos de Formação Cidadã e Formação de Governantes, ambos na Escola de Governo.\r\n\r\nFoi integrante da Associação dos Consultores, Assessores e Articuladores Políticos do Estado de São Paulo (ACAAPESP), onde atuou de forma voluntária no departamento jurídico, prestando assistência jurídica à população. \r\nPosteriormente, se especializou em Direito Constitucional e Político pela FMU, onde desenvolveu na monografia o tema “A necessidade da participação popular para a efetiva construção da democracia participativa nos municípios”.\r\nRealizou sua segunda pós-graduação em Direito Previdenciário pela Faculdade Legale, área onde atua profissionalmente, na defesa dos aposentados e dos dependentes dos segurados da Previdência Social.\r\n\r\nFaz cursos na Escola do Parlamento da Câmara Municipal, no Instituto do Legislativo Paulista da Assembleia Legislativa, na Oficina Municipal e em diversas ONGs, sempre em temas relativos à política, cidadania, participação popular, controle social, Poder Legislativo, Poder Executivo, Lei de Acesso à Informação e afins.\r\n\r\nAtualmente foi eleita Conselheira Participativa Municipal pelo distrito da Vila Formosa, onde atua no exercício do controle social da Prefeitura e na priorização das demandas da população da região da Subprefeitura Aricanduva/Formosa/Carrão.\r\n\r\nÉ integrante do Adote um Vereador, rede que acompanha a atuação do mandato dos vereadores paulistanos, onde também escreve artigos relacionados ao tema. \r\n','pcgrm@yahoo.com.br','1126616657434523'),(17652,'Leonel Guterres Radde','BRANCA','MASCULINO','MASCULINO','1981-01-08','Agente da Polícia Civil do RS, ator, músico e faixa-preta de Aikido. Formado em Direito e História, mestrando em Direitos Humanos.','radde@aikido.com.br','10211230638580622'),(17716,'Eduardo Guimarães','BRANCA','MASCULINO','MASCULINO','1959-12-04','Eduardo Guimarães nasceu em São Paulo em 4 de dezembro de 1959. Em 1982, casou-se com Cristina, com quem teve quatro filhos – Carla (34), Gabriela (30), André Luis (28) e Victoria (17). Profissionalmente, atua em comércio exterior, tendo fundado uma empresa comercial exportadora e um escritório de representação de indústrias brasileiras em países latino-americanos e africanos.\r\nA vida de Eduardo como ativista político e blogueiro começou no ano em que estourou o escândalo do mensalão, em 2005. Inconformado com o arbítrio e a censura praticados por órgãos de imprensa, Eduardo resolveu criar o Blog da Cidadania. A partir dali, a vida do comerciante mudaria radicalmente.?\r\nNos anos seguintes, Eduardo fundou a ONG Movimento dos Sem Mídia (MSM), responsável por propor representações ao Ministério Píblico Federal, ao Conselho Nacional de Justiça, à Polícia Federal e até ao Supremo Tribunal Federal contra autoridades, órgãos de imprensa e até empresas que cometeram abusos contra a liberdade de expressão e à cidadania. Além disso, o MSM promoveu vários atos públicos, como o da “Ditabranda” da Folha de São Paulo, em 2009 (em alusão ao fato de o jornal ter dito que a ditadura militar brasileira foi “branda” porque matou “pouca gente”). A ONG fundada por Eduardo promoveu ato público de repúdio diante do jornal.\r\nPor conta de sua luta, Eduardo recebeu reconhecimentos públicos, como o do ex-presidente Luiz Inácio Lula da Silva.\r\nEduardo também foi escolhido para receber o 1º prêmio CUT a blogs progressistas, em 2011, e prêmio do Movimento Negro de Juiz de Fora (MG), em 2012, por sua luta contra o racismo.\r\nEduardo Guimarães determinou que sua vida não seria levada como tantas outras: ter uma renda, pagar as contas, fugir das pedras no caminho, não ter realização alguma para o mundo e, lá na frente, morrer. Para ele, não é possível uma vida sem lutar pelo que se acredita, sem lutar pelos Direitos Humanos. E isso só é possível na Democracia. Diante do golpe parlamentar que derrubou uma pessoa inocente e que ameaça suprimir direitos civis, sociais, trabalhistas e políticos, Eduardo decidiu não se calar. A candidatura, para ele, é uma forma de colocar sua força de trabalho à serviço do restabelecimento da democracia e da criação e efetivação de ações que tornem a cidade e o país melhores.','edu.guim@uol.com.br','1206856662698409'),(17744,'Sérgio Sá','PRETA','MASCULINO','MASCULINO','1953-01-11','Sérgio Sá, com mais de 47 anos de carreira profissional artística repleta de êxitos, aceita o desafio para tornar-se candidato a vereador pelo PSDC com o número 27700.\r\n\r\nConfira minhas propostas e ideias:\r\nwww.facebook.com/sergiosa27700\r\n\r\nAcostumado a superar barreiras (cego de nascença) Sérgio agora traz toda a sua experiência em lidar com o público para a política, em uma plataforma ousada e diretamente conectada a algumas das mais sérias dificuldades dos paulistanos e principalmente das pessoas com deficiência e idosos: \r\n\r\nMobilidade, acesso à informação, tecnologia assistiva, entre outras.\r\n\r\nSua grande aspiração? O que mais o inspira? \r\n\r\nFazer de São Paulo a capital da inclusão, dar a mesma chance a todos, renovar, desenvolvendo e retomando políticas públicas capazes de incluir de fato estes mais de sete milhões de pessoas com deficiência e idosos.\r\n\r\nRecolhidas de sua vivência nesta cidade nação, Sérgio Sá traz idéias simples, propostas possíveis de serem realizadas, dentre as quais um mapeamento preciso de quem são, onde estão, quando e como se tornaram deficientes aqueles que convivem com quaisquer incapacidades.\r\n\r\nIsto por si já permitirá atendimento de qualidade aos que necessitam, pois propiciará estudo detalhado de condições da pavimentação, acessibilidade a postos de saúde, escolas, ruas e avenidas, dependendo de sua topografia e número de pessoas com esta ou aquela dificuldade.\r\n\r\nEste mapeamento também facilitará a distribuição de facilidades como designar professores especializados para atender alunos com deficiência de acordo com número e tipo de incapacidade.\r\nSérgio Sá também vai oferecer uma equipe de especialistas em tecnologia assistiva para criar e melhorar softwares já existentes. Esta equipe ficará à disposição de lojas de departamentos, farmácias, super mercados, ETC. E o objetivo da iniciativa é produzir páginas acessíveis às pessoas com deficiência e paralelamente aos idosos que venham a desenvolver algum distúrbio visual ou auditivo.\r\n\r\nNo esporte, Sérgio Sá procurará parcerias público-privadas buscando a criação e patrocínio de cursos de natação, ginástica e demais esportes paralímpicos, ampliando aqueles que já existem.\r\n\r\nNa educação, um grupo de pedagogos será instituído para auxiliar os educadores e professores que estejam lecionando para alunos com quaisquer deficiências. Palestrantes especializados ministrarão cursos e palestras em comunidades, oferecendo aos pais e amigos das pessoas com deficiência apoio e orientação.\r\n\r\nEstas são algumas das propostas que Sérgio Sá vai levar à câmara municipal de São Paulo.\r\n\r\nSabe-se que há muito mesmo o que fazer já que até agora não contamos com vontade política para incrementar a inclusão. E esse é mais um bom motivo para darmos nosso voto ao Sérgio Sá. \r\nComo ele próprio diz: \"Honestidade é condição fundamental para elegibilidade, mas está longe de ser o bastante”.\r\n\r\nÉ preciso gente criativa, corajosa e persistente. Gente solidária e capaz de transformar obstáculos em alavancas! Gente mais do que interessada em fazer de São Paulo a capital da inclusão!\"','musicosergiosa@gmail.com','1237146096327436'),(17807,'Rondinele Pereira','PARDA','MASCULINO','MASCULINO','1985-11-26','Busco representar o povo pobre da periferia de bh , e venho me preparando para isso, moro em comunidade carente e quero ajudar as pessoas daqui .','rondinelepereira2007@hotmail.com','796363330505494'),(17854,'Rosa Duarte','BRANCA','FEMININO','FEMININO','1960-06-01','Trabalho comunitário a 22 anos assistência a alcoólicos e dependentes quimicos, fundações de novas comunidades em prol dos menos facorecidos.','rosasantospiche@outlook.com','1052691858182038'),(17860,'Paulo Roberto Fiorilo','BRANCA','MASCULINO','MASCULINO','1964-01-25','Paulo Fiorilo é formado em Filosofia, mestre em Ciências Políticas pela PUC-SP e professor da rede municipal de ensino de São Paulo.\r\nIniciou sua militância política em Araraquara (SP) ligado às Comunidades de Base da Igreja Católica. Em 1982, participou da primeira campanha eleitoral do Partido dos Trabalhadores. Mudou-se para São Paulo em 1984 e foi morar no Parque São Rafael, na Zona Leste. Contribuiu com a construção do PT e trabalhou no Departamento de Formação do Sindicato dos Metalúrgicos do ABC.\r\nAcumulou experiência no Legislativo e no Executivo. Atuou como chefe de gabinete na Câmara Municipal de São Paulo por 14 anos e chefiou o gabinete da prefeita Marta Suplicy em 2003.\r\nEntre 2005 e 2008, Paulo Fiorilo exerceu seu primeiro mandato de vereador em São Paulo e presidiu o PT da Capital, quando coordenou a campanha de Lula à presidência do Brasil. Seu primeiro mandato caracterizou-se pela oposição à gestão Serra-Kassab. Aprovou, entre outras, a lei que torna o Movimento de Alfabetização de Jovens e Adultos (MOVA-SP) um programa regular da rede de ensino municipal.\r\nEntre 2009 e 2011, foi secretário de Administração em Osasco, na gestão do prefeito Emídio de Souza. \r\nEm 2012, foi eleito novamente vereador de São Paulo pelo PT. Vem atuando na Câmara Municipal na defesa do governo do prefeito Fernando Haddad e na propositura de leis de interesse da cidade, ao mesmo tempo em que trabalha pelo desenvolvimento regional, especialmente dos bairros da periferia. \r\nAprovou leis importantes, como o fim da burocracia para emissão do Cartão de Estacionamento do Idoso; a criação dos Grupos de Defesa Civil Escolar e das Comissões de Mediação de Conflito nas Escolas; e as medidas para o combate da dengue que incluem a entrada em imóveis fechados. ','paulofiorilo@gmail.com','917051401772215'),(17883,'Olmir Cadore','BRANCA','MASCULINO','MASCULINO','1953-12-23','Sou cirurgião dentista, comprometido com a saúde, direito básico de todo cidadão, e com o esporte, importante ferramenta para a inclusão social. Vote bem, vote Cadore 14100!','cadore09@outlook.com','536736869866127'),(17915,'Carlos Alexandre Silva','BRANCA','MASCULINO','MASCULINO','1965-05-24','Eco Urbanista, formado em Gestão Ambiental, Pós Graduado Arquitetura, Cidades e Sustentabilidade.\r\nAmbientalista Presidente  ONG TV NATUREZA, Presidente COMDEMA- Conselho de Meio Ambiente de Campinas 2° Mandato, Empresário CEO MKT Agência Ambiental\r\n....\"Nosso desafio, Sermos elos bons e fortes na cadeia da vida\".... \r\n#PenseEcologicamentePenseVerde43343\r\n#VOTEPV43\r\nhttps://www.facebook.com/CarlosAlexandre.eco.br/\r\nhttp://www.votepv43.com/carlos-alexandre','alexandre.comdema@ gmail.com','942552225890534'),(18062,'Daniel Moreira','PARDA','MASCULINO','MASCULINO','1967-03-01','Missão social','danimeca@ig.com.br','558910180961528'),(18164,'Annalucia Garcia','PARDA','FEMININO','FEMININO','1963-10-20','Tenho 52 anos. Sou índio e afro descendente. Artesã por vocação e professora de história por profissão.  Mãe especial de um lindo rapaz com síndrome de angelmam de 26 anos e de uma linda garota universitária de 19. Mãe de sete gatos que por mim ronronam...\r\nNão aceito preconceito, bullyng, ou qualquer tipo de discriminação. Luto incansavelmente para mostrar a meus alunos que somos todos iguais. Que todo ser humano deve ser respeitado não importando sua opção sexual. Que as mulheres tem os mesmos direitos que os homens e que nossa raça é bela. Luto pela criação de um centro de apoio aos deficientes e seus familiares, com oficinas, atividades diversificadas inclusive para as mães que não podem trabalhar para cuidar de seus filhos. Sim, porque as entidades assistenciais tem seus turnos reduzidos a quatro hs diárias. Conhece algum emprego de quatro hs diárias? Chega de assistencialismo. Queremos igualdade para os nossos especiais. Essa inclusão é  conversa. Meu filho não cabe na inclusão, não é aceito nas filantrópicas por motivos financeiros e não posso pagar uma escola particular. Queremos respeito, Igualdade e Sustentabilidade social e ambiental.','annaluciagarcia2@gmail.com','1225228167550641'),(18197,'Deny Eduardo','BRANCA','MASCULINO','MASCULINO','1991-09-24','Deny Eduardo tem 25 anos, é advogado militante, formado em Direito pela Faculdade de Direito de Franca (2014).\r\n\r\nFoi Deputado Estadual Jovem (2006) pela Assembleia Legislativa de São Paulo no Programa Parlamento Jovem Paulista, com projeto na área de educação e cultura. Foi Deputado Federal Jovem (2009) pela Câmara dos Deputados no Programa Parlamento Jovem Brasileiro, com projeto na área de certificação ambiental.\r\n\r\nJovem destaque (2013) da Semana Municipal da Juventude, homenageado pela Câmara Municipal de Franca.\r\n\r\nÉ membro da Comissão de Diversidade Sexual e Gênero da OAB Franca. Foi delegado da Conferência Estadual de Direitos Humanos (2016) e das Conferências Conjuntas de Direitos Humanos do Governo Federal (2016).\r\n\r\nFoi servidor público estadual (2011-2014) do Centro de Detenção Provisória de Franca, atuando no setor administrativo e financeiro. Foi estagiário do Ministério Público de São Paulo (2014) atuando na Promotoria de Justiça Cível e Criminal de Patrocínio Paulista. ','deny_eduardo@hotmail.com','1211706748900653'),(18203,'Ana Lúcia Campos Moreira','PARDA','FEMININO','FEMININO','1964-01-12','\r\n“COM BOA EDUCAÇÃO TEMOS: SAÚDE, SEGURANÇA PÚBLICA, MOBILIDADE URBANA, PRESERVAÇÃO AMBIENTAL E SOCIEDADE MAIS JUSTA”.\r\n\r\nProfessora em readaptação. Formada na Federal – FAE – UFMG, Pedagogia. Pós-graduada em Psicopedagogia pela UVA – Universidade Veiga de Almeida - RJ. \r\nAtualmente atuo como auxiliar de secretaria na E.E. Olímpia Rezende Pereira com vida escolar dos alunos e Professora Coordenadora no CES – Centro de Educação em Saúde – SMSA – PBH, com certificação de cursos promovidos pela Secretaria Municipal de Saúde.\r\n\r\n•	Fiscalizar a aplicação dos recursos financeiros principalmente na área de educação, saúde, preservação ambiental e mobilidade urbana.\r\n•	Discutir e votar projetos que realmente reflitam os anseios dos cidadãos de Belo Horizonte.\r\n•	Participar ativamente sem faltas, das atividades parlamentares de apoio e discussão das políticas públicas a serem implantadas por programas governamentais.\r\n•	 Implementar emendas pertinentes.\r\n•	Abrir as portas da Câmara para a participação da sociedade mineira.\r\n•	 Realizar audiências públicas para solucionar, dirimir, comunicar o que se fizer necessário.\r\n•	Apreciar as contas públicas dos administradores e apurar as infrações político administrativas por parte do Prefeito e vereadores.\r\n\r\nMeu foco principal de atuação será: Fiscalizar ações da PBH em obras de: reforma, construção, ampliação executadas em Escolas, UMEI’s, Centro de Saúde, UPAS, Hospitais, Parques, obras de infraestrutura, mobilidade e segurança urbana. Atenção para preservação de áreas verdes, limpeza da cidade. \r\n\r\nMonitorando o correto uso do dinheiro público, participando ativamente e gerenciando as atividades dentro da Câmara Municipal, estarei lutando por uma Belo Horizonte melhor!\r\n\r\nAnaLuta Campos\r\n','ana.moreira@pbh.gov.br','1416809791681420'),(18253,'Mirian Pereira','PARDA','FEMININO','FEMININO','1971-11-29','Mirian, 44 anos, natural de Igarapava e residente em Campinas desde 1973. Costureira, Professora em escolas estaduais com formação em Ciências Biológicas, pós graduada na subárea socioambiental com ênfase na gestão de resíduos sólidos e vitalização e adequação de espaços. Possui pós graduação em psicopedagogia com ênfase na alfabetização, e pós graduação em Educação Especial na perspectiva da Educação Inclusiva. Até meados de 2015, não possuía atuação partidária, mas desde a tenra idade é preocupada com o meio ambiente, e procura desenvolver ações de mitigação de efeitos prejudiciais à natureza, da qual fazemos parte. Preservar o meio ambiente é cultura, a qual não está dissociada da causa social. Assim, filiada ao partido Rede Sustentabilidade decidiu ser vereadora em Campinas, porque durante sua trajetória e percursos de vida concluiu que a cooperação e colaboração entre duas ou mais pessoas nos trazem mais qualidade de vida do que a competição. Acredita que como legisladora pode promover maior interação entre as pessoas em parceria com a educação e comunidade.\r\nNo currículo da plataforma Lattes há informações mais detalhadas sobre sua formação: http://lattes.cnpq.br/9128795247750747','lopes_r_m@hotmail.com','1173608359364377'),(18302,'Messias Valadão','BRANCA','MASCULINO','MASCULINO','1966-09-16','Contra a corrupção vote em Valadão da construção','mmvconstrucoes@hotmail.com','529927143867108'),(18345,'Alcino Vilela','BRANCA','MASCULINO','MASCULINO','1980-06-09','Vilela tem 36 anos, dois filhos, é sociólogo formado pela Unicamp, trabalhou com sustentabilidade por 11 anos, sendo 4 anos na área de auditoria de uma multinacional do ramo.\r\n\r\nNa cidade de Campinas, fundou o Instituto Campinas Sustentável e o Campinas que Queremos, foi conselheiro na ONG Minha Campinas e no COMDEMA (Conselho de Meio Ambiente).\r\n\r\nEm 2015, iniciou o Fórum de Conselheiros Municipais e Movimentos Sociais de Campinas para potencializar e integrar a atuação dos conselheiros e líderes sociais da cidade. \r\n\r\nCom base nos seus conhecimentos de sustentabilidade e auditoria, atua para melhorar a eficiência na SANASA e cobrar uma tarifa justa dos consumidores de Campinas.\r\n\r\nIniciou o projeto Promessômetro de auditoria cidadã, que surgiu da sua experiência com auditoria e sustentabilidade e está em prática auditando a gestão do atual prefeito.\r\n','alcino.vilela@gmail.com','1017149365050144'),(18456,'Hosana Piccardi','BRANCA','FEMININO','FEMININO','1980-10-05','Sou bióloga, militante do meio ambiente desde sempre. Acredito num meio ambiente como uma questão social como a base pra todos nossos direitos. Quero lutar por uma cidade com qualidade de vida e ambientalmente equilibrada. Lutar por mais feiras orgânicas, maior representatividade das mulheres na gestão pública , propor a implementação de hortas urbanas comunitárias , implementar um zoneamento ecológico econômico e zelar pelo patrimônio natural.','Mendigoto@yahoo.com.br','1205498319509237'),(18482,'Alessandra Ribeiro Ribeiro','PRETA','FEMININO','FEMININO','1975-08-11','Acredito em direitos igualmente para todos','Alessandraribeirooficial @gmail.com','632825176897349'),(18486,'Wesley Santos','BRANCA','MASCULINO','MASCULINO','1978-04-25','Empresário no ramo de segurança eletrônica a 18 anos , neste momento tentando fazer a diferença. No meu ramo de trabalho busco sempre a qualidade técnica e equipamentos de qualidade sendo assim fazendo sempre o sistema de manutencao preventiva , levo isto para minha vida e realmente da certo com a vida profissional e saúde , quero levar este método preventivo para câmara municipal , nosso projeto está no Facebook e só acessar , muito obrigado ','simwesleysantos@gmail.com','165538373891828'),(18589,'Claudio Silva','PRETA','MASCULINO','MASCULINO','1976-01-02','Ronaldo Alves de Oliveira Brandão - RONI\r\nEnsino Superior Completo \r\nCursando Pós Graduação em Gestão Pública \r\nProfessor Efetivo Rede Secretaria Educação Estadual\r\nTemente a DEUS\r\nDefensor das causa Sociais\r\nBandeiras Principais: Educação, Saúde, Meio ambiente, Cultura, Esporte e lazer, Agricultura, Sustentabilidade \r\nPrincipais qualidades: Sou Ético, Transparente e Honesto\r\n\r\n','vereadorroni@gmail.com','1848233562065608'),(18670,'Regina Bento','BRANCA','FEMININO','FEMININO','1960-12-17','Hoje eu só quero agradecer. Agradecer à classe política pela má conduta inercial, pelos desvios do dinheiro público, pelas práticas de corrupção, tráfico de influências e favorecimentos pessoais. Por todas as mazelas que desmoralizaram os poderes públicos e cristalizaram um sistema inoperante, ineficiente e perverso, especialmente com quem necessita destes serviços para sobreviver. A corrupção, esta endemia política, dificultou, e muito, o pedido do voto de confiança daqueles que, como eu, amam a política; que acham que salário de político deveria ser o mínimo; que políticos deveriam fazer teste psicológico, vocacional e educacional antes de saírem candidatos. Que ao ganharem, deveriam fazer “pós-graduação”, em cima de uma cadeira de rodas, andando pelas ruas, descaracterizados, interpretando cegos, mendigos e velhinhos, para conhecerem a dor desta gente que tem que passar por tanta humilhação, para verem exercidos os seus direitos constitucionais mais básicos. E fazer isto depois de eleitos, periodicamente, destituindo dos cargos os maus servidores, inclusive cortando na carne da própria autoridade “competente”. A correlação entre corrupção e educação, é uma via de mão dupla, pois países com mais educação, países que estão no topo da avaliação do Pisa (Programa Internacional de Avaliação de Alunos), também estão entre os menos corruptos. \r\nEu sou Regina Célia de Souza Bento, brasileira, casada, bacharel em Direito pela Universidade Estácio de Sá, pós-graduada em Responsabilidade Civil e Direito do Consumidor, acadêmica de jornalismo pela Unigranrio, juíza arbitral, atriz e protetora de animais (se bicho e criança votasse, eu já estava eleita!). \r\nPropostas - Minha batalha na Câmara, além de “encher o saco” do prefeito, será: \r\n- Hospital público veterinário, feira de adoção municipal, animalterapia nos hospitais e asilos.\r\n- Abrigo para idosos no estilo do Retiro dos Artistas, com Lazer Completo, bailes, teatro, cinema e cursos profissionalizantes.\r\n- Fim das carroças, doando aos carroceiros que precisam dela para ganhar o seu sustento, um triciclo motorizado.\r\n- Piscinão da Venda Velha, com estrutura poliesportiva.\r\n- Centro de coleta e tratamento de reciclagem de lixo, com cursos para os catadores.\r\n- Em cada igreja um Polo de apoio a estudantes da melhor idade, com encaminhamento às Faculdades particulares (estabelecendo-se cotas de parceria municipal).\r\n- Ensino religioso e Constituição brasileira incluso na grade escolar.\r\n- Lixeiras subterrâneas nas ruas, no estilo do estado da Bahia, contêineres de coleta seletiva.\r\n- Em cada praça, um Pokéstop com wi-fi, 3G, (sem equipe rocket), água, luz, assentos, tomadas, banheiros químicos e segurança municipal.\r\n\r\nA mais preparada, quer ser vereadora! Vem sem medo! Nunca é tarde para ser feliz! \r\n','zefaja@oi.com.br','1257347217642731'),(18747,'Reanolfo Cláudio de Siqueira','BRANCA','MASCULINO','MASCULINO','1964-05-10','\"RENOVAR PARA MUDAR\".','rcs2010@outlook.com','10206146706421713'),(18819,'Rodrigo Salomé','PRETA','MASCULINO','MASCULINO','1981-08-24','Rodrigo Salomé nasceu em 1981, na cidade de São Paulo, no bairro da Liberdade. Filho de um engenheiro paulistano e uma técnica de enfermagem baiana de Bom Jesus da Lapa.\r\n\r\nNo ano de 1986 se mudou para o bairro do Jabaquara junto com seus pais e seu irmão mais velho.\r\n\r\nEntre 1986 e 2000 estudou no Colégio São Luís e de 2001 a 2006 na Faculdade de Engenharia Industrial de São Bernardo do Campo.\r\n\r\nHoje é engenheiro metalurgista, pós graduado em Administração Industrial pela Fundação Vanzolini em parceria com a Poli-USP.\r\n\r\nEm 2013 se casou e mudou para o interior do estado de São Paulo.\r\n\r\nDesde muito jovem sempre esteve envolvido com atividades relacionadas à comunidade em que vivia.\r\n\r\n\r\n1998- 1º COLEGIAL – REPRESENTANTE DE CLASSE.\r\n\r\n2004 – 4º ANO DE FACULDADE  - VICE PRESIDENTE DO DIRETORIO DOS ESTUDOS METALURGICOS.\r\n\r\n2006 A 2010 – SINDICO DO CONDOMINIO EMILIA ROMAGNA – 104 APTOS.\r\n\r\n2010 A 2011 – PRESIDENTE DA ASSOCIAÇÃO ESPORTIVA TEMPESTADE PAULISTA – SÃO PAULO STORM (1º CAMPEÃO PAULISTA DE FUTEBOL AMERICANO).\r\n\r\n2016 – MEMBRO TITULAR DA CIPA Toyota do Brasil Eleito pelos Trabalhadores.\r\n','rodrigofsalome@gmail.com','1118168884931496'),(18848,'Irismeire Corgosinho','BRANCA','FEMININO','FEMININO','1963-10-13','SOU MISSIONÁRIA EVANGELICA E ATIVISTA SOCIAL.TRABALHO POR VILAS E FAVELAS CONTRA ALAGAMENTOS EM BELO HORIZONTE, TENHO PROJETOS NA AREA DE SAUDE DO IDOSO E CRIANÇA,NA PROFISSIONALIZAÇÃO DO MENOR INFRATOR,CONTRA A VIOLENÇIA CONTRA A MULHER, CONFIRA MEUS PROJETOS NO MEU GRUPO DE APOIADORES, \'\'VEREADORA IRISMEIRE, PEÇO HUMILDEMENTE SEU VOTO E DE SUA FAMILIA ,MISSIONÁRIA IRISMEIRE 19130. PARA PODER MOS,MELHORAR ESTAS AREAS ENTRE OUTROS.','iriscalixto1310@gmail.com','572496666273745'),(18933,'Severino Gonçalves Gonçalves','PARDA','MASCULINO','MASCULINO','1962-03-10','Legitimo representante do TURISMO de OLINDA, minha trajetória iniciei como Guia Mirim nas Ladeiras de Olinda e ali cresci e aprendi tudo da cidade e desde cedo a representa la tive a oportunidade e ser convidado por JÔ SOARES e mostras meu trabalho com os jovens e falar de nossa bela cidade OLINDA, hoje eu homem adulto vi poucos fazerem algo pala cidade e principalmente pelo turismo que hojeesta mais acabado do que nunca. Peço que vejam em minha fan page BIU TUR no Facebook os trabalhos já realizados e propostas para a cidade.','biutur@hotmail.com','927156257388688'),(19036,'Robertinha Lagoa Santa','PARDA','FEMININO','FEMININO','1980-10-29','1. Possuo formação superior compatível para exercer a função de vereadora;\r\n2. Desenvolverei políticas públicas voltadas para valorização da mulher;\r\n3. Tenho conhecimento da Lei Orgânica do Município;\r\n4. Conheço o Plano Diretor;\r\n5. Detenho conhecimento da Constituição Federal;\r\n6. Conhecedora do Estatuto dos Servidores Públicos Municipais;\r\n7. Vou lutar para reforma do PCCV - Plano de Cargos, Carreiras e Vencimentos dos Servidores, para melhor enquadrar o Servidor;\r\n8. Exigirei a volta do quinquênio aos Servidores, já que não há pagamento do anuênio e nem das progressões previstas no Plano;\r\n9. Lutarei para o pagamento do Vale Transporte aos Servidores;\r\n10. Reajuste salarial dos Servidores de acordo com o índice inflacionário do salário mínimo, aplicável sempre no mês de janeiro;\r\n11. Convênio com clínicas veterinárias para realização de castração de cães e gatos de famílias de baixa renda;\r\n12. Parceria Público-Privado para construção de um Canil Municipal;\r\n13. Incentivo fiscal para quem plantar e cultivar árvores em sua calçada, de acordo com a legislação a ser aprovada;\r\n14. Obrigação dos comércios a disponibilizar uma lixeira em frente ao seu estabelecimento, com tamanhos e padrões a serem definidos em lei;\r\n15. Parcerias privadas com comércios e empresas adotarem uma praça, disponibilizando o direito delas beneficiarem com propagandas no limite estipulado em lei especifica;\r\n16. Implantarei o programa \"Adote uma caneca\" em todos os setores públicos. Onde todos os servidores serão conscientizados da importância de se levar sua própria caneca para o trabalho, evitando gastos excessivos com descartáveis;\r\n17. Implantarei o projeto \"Uma Vida, Uma Árvore\". Cada bebê registrado no município, planta-se uma árvore em área pública, dando-lhe o nome da criança à árvore;\r\n18. Arborização da beira da lagoa e das ruas de maior circulação de pessoas, afim de oferecer sombra e frescor aos pedestres;\r\n19. Buscarei recursos federais, com o Ministério da Agricultura, para reforma do Parque de Exposições (como já acontece em outros municípios);\r\n20. Conseguirei recursos federais, estaduais e municipais para construção do Mercado Municipal em área institucional em frente a Praça Floriano Peixoto (Praça da Florença);\r\n21. Introduzirei o projeto \"Escola Aberta\", onde todas escolas municipais estariam abertas oferendo oficinas de arte, prática de esportes com instrutor, \"palco aberto\" para incentivar a iniciação musical e dança;\r\n22. Disponibilizarei em toda rede municipal de ensino, mudas de árvores nativas para doação àquela comunidade;\r\n23. Iniciar a \"Horta Orgânica Escolar\", em que as escolas, com ajuda dos alunos, cultivarão hortaliças para uso na própria escola;\r\n24. Aderir o Programa \"Transporte Gratuito aos Docentes\", onde todos os professores da rede pública municipal de ensino terão acesso gratuito ao transporte público (como já acontece em outros municípios);\r\n25. Expandirei o atendimento do CRAS - Centro de Referência de Assistência Social, aos adolescentes da comunidade LGBT e suas famílias, no intuito de orientar a inclusão social;\r\n26. Estabelecerei políticas municipais de promoção da cidadania LGBT e enfrentamento da homofobia;\r\n27. Implantar junto ao Executivo a marcação de consultas do SUS via internet (como acontece em planos de saúde privados);\r\n28. Incentivarei a cultura regional, promovendo festivais, exposições, oficinas, mostras culturais, em áreas públicas e de forma itinerante;\r\n29. Fomentarei o turismo promovendo festivais de cultura, gastronômico, artes visuais e cênicas;\r\n30. Estacionamento prioritário à gestantes e carros que transporte bebês de até 03 anos, mediante autorização expedida pela Prefeitura;\r\n31. Ampliação de funcionamento da Farmácia Municipal, estendendo o atendimento aos sábados, domingos e feriados; \r\n32. Redução das verbas de gabinete dos vereadores, bem como de benefícios que ferem a moral do exercício de agente público;\r\n33. Exigirei que todas as votações no Plenário da Câmara sejam feitas de forma aberta, vedando o voto secreto;\r\n34. Que todo projeto que vá interferir, alterar e/ou atingir uma comunidade local, que seja aberta audiência pública para ouvir as reivindicações da comunidade;\r\n35. Incentivarei a \"Horta de Quintal\" disponibilizando sementes de hortaliças para todo e qualquer cidadão, no Departamento de Meio Ambiente e na Emater da cidade;\r\n36. Fiscalizarei de forma criteriosa, autônoma e imparcial todos os atos do Executivo, solicitando, sempre que necessário, esclarecimento formal;\r\n37. Exigirei abertura de Concurso Público, a fim de selecionar o quadro de funcionários;\r\n38. Reivindicarei às empresas de transportes públicos que atuam no município, a adequação IMEDIATA dos ônibus adaptando calhas/canaletas e/ou similares, a fim de se evitar que chova nos usuários;\r\n39. Implantação do sistema MOVE com linha direta Lagoa Santa x Belo Horizonte em ônibus articulado;\r\n40. Buscarei parcerias para realizações periódicas de \"Ações Sociais\" para garantir direitos fundamentais, tais como: identidade; Carteira de Trabalho; declaração de paternidade; casamento coletivo; divórcio direto e consensual; \r\n41. Resguardarei, protegerei e restaurarei nosso patrimônio cultural e imaterial; nossos recursos hídricos, fauna e flora; \r\n42. Exigirei da Prefeitura a revitalização da Lagoa Central;\r\n43. Reivindicarei à Copasa divulgação mensal nas contas de água, dos resultados das análises da qualidade da nossa água, a fim de que possamos cobrar melhores resultados;\r\n44. Transparência dos gastos públicos, tanto do Legislativo como do Executivo, mantendo o site da \"Transparência Pública\" sempre atualizado;\r\n45. Pleitear a reestruturação da rotatória da Dilasa, na entrada da cidade, a fim de se evitar acidentes;\r\n46. Buscar parcerias para oferecer mais vagas no programa \"Jovem Aprendiz\";\r\n47. Cobrarei da Prefeitura adequação das vias públicas para melhor acessibilidade dos portadores de necessidades especiais;\r\n48. Colocarei na previsão do orçamento, as obras de duplicação da Rua Pinto Alves (Centro - Vila Maria);\r\n49. Criação do \"Fundo Municipal de Desenvolvimento Solidário\", que terá como objetivo combater a pobreza e o desemprego, aplicando recursos para geração de trabalho, renda e empreendimentos solidários;\r\n50. Instituição do \"Programa de Incentivo ao Planejamento Familiar e a Saúde da Mulher\", com o objetivo de adotar ações preventivas e educativas de forma igualitária à mulheres que já tenham filhos;\r\n51. Regulamentação fundiária dos imóveis rurais que não possui registro e CCIR.','robertasantosconsultoria@yahoo.com.br','10209538490395454'),(19056,'Antonio Lino da Silva','PARDA','MASCULINO','MASCULINO','1957-07-10','Antonio Lino é vereador em Mogi das Cruzes pelo PSD. Tem quase 30 anos de vida pública e já foi presidente da Câmara Municipal por 3 vezes. Também foi o coordenador das Administrações Regionais de Mogi das Cruzes, quando participou ativamente de importantes conquistas para a cidade, como o Hospital Municipal, em Braz Cubas, a canalização do Córrego dos Canudos e a construção da Avenida Júlio Simões.','verlino@uol.com.br','850197598414900'),(19082,'Nilton Bobato','BRANCA','MASCULINO','MASCULINO','1967-01-30','Perfil\r\n\r\nIguaçuense de coração, Nilton Bobato é filho de barrageiro e chegou em Foz do Iguaçu há mais de 35 anos, junto com os pais que vieram em busca de emprego na construção da Usina Hidrelétrica de Itaipu. Foi guarda-mirim, editor de televisão, operador de rádio, músico e jornalista, formou-se em letras pela Unioeste, é escritor e professor na rede pública estadual de ensino.  Atualmente, cumpre o segundo mandato de vereador.\r\n\r\nLiteratura\r\n\r\nApaixonado pela literatura, Nilton Bobato é autor de sete livros, sendo o romance “A sorte não sorriu para César Rondicato” o mais recente. Presidiu a Academia de Letras de Foz do Iguaçu e sempre atuou em defesa das políticas públicas na área de cultura e leitura. Em 2010, foi eleito representante da região Sul do país no Colegiado Nacional do Livro, Leitura e Literatura e integrante do Conselho Nacional de Política Cultural (2010-2012), onde participou de marcos importantes para o país, como a constituição do Fundo Nacional de Cultura. Divide a paixão pela literatura com a música, ele é vocalista da Banda Morthal. \r\n\r\nOposição\r\n\r\nA luta de Nilton Bobato contra os desmandos do governo Reni Pereira, hoje conhecido nacionalmente pelos escândalos de corrupção, começou desde o primeiro dia de mandato, em uma luta que começou solitária e aos poucos, foi ganhando mais parceiros no front de batalha contra os abusos e fraudes. Ele é autor de várias denúncias na Câmara, no Ministério Público e Tribunal de Contas do Estado do Paraná, que já apontavam os esquemas mais tardem deflagrados pela Operação Pecúlio, da Polícia Federal. É dele a autoria das denúncias dos supersalários no hospital municipal, dos contratos superfaturados em terceirizações no hospital municipal, fraudes na terceirização do laboratório municipal, sucateamento do hospital, favorecimento com empresas de Pato Branco e empresas de mão-de-obra de merenda escolar, entre outros.  ','niltonbobato@gmail.com','1019537851478196'),(19083,'Denis Alves Rizzoli','BRANCA','MASCULINO','MASCULINO','1990-05-04','Militante libertário e pacifista, defensor da diversidade e das minorias e contra toda forma de preconceito, discriminação, autoritarismo e opressão. Vê na educação, na cultura e no esporte os caminhos para integração da sociedade, especialmente em relação aos jovens.\r\n\r\nEntre suas propostas para a Câmara Municipal de Fundão estão a recriação da CPI dos Royalties; a criação da Comissão de Diversidade, Direitos Humanos e Cidadania, da Comissão de Educação, Cultura, Esporte, Lazer e Juventude e da Comissão de Saúde, Assistência e Bem-Estar Social; o aumento da quantidade de sessões ordinárias, de duas por mês para uma por semana; a volta das sessões itinerantes aos distritos de Praia Grande e Timbuí; a transmissão das sessões e das reuniões das comissões ao vivo pela internet; o fim da reeleição para cargos da Mesa Diretora e das comissões; diminuição das restrições à participação da população durante as sessões.\r\n\r\nPara mais propostas e detalhes, acesse https://www.facebook.com/denis43666/','denisrizzoli@hotmail.com','1276708209029843'),(19093,'Paulo Medeiros','BRANCA','MASCULINO','MASCULINO','1988-03-09','da Filosofia, ingressou no ano de 2009 na Educação Pública como Professor autorizado Regente de aulas nas disciplinas de Filosofia e Sociologia  até o ano de 2014.\r\nFormou-se em Vigilância em saúde  pelo Coltec/UFMG (2015) \r\nDiplomado no curso de qualificação profissional no curso de Política Nacional de saúde Integral LGBTT pela Universidade do Estado do Rio de Janeiro(UERJ)/UNA-SUS\r\nNo ano de 2015 concluiu o curso de Organização de Gabinete Parlamentar realizado pelo Instituto Legislativo Brasileiro em parceria com o Senado Federal.\r\nCapacitação na Lei de Acesso a Informação( Parceria Senado Federal/UFMG) -2015\r\nRecentemente concluiu no modo de extensão profissional  o curso de Zika: abordagem clínica na atenção básica pela Universidade Federal do Mato Grosso do Sul(UFMS)/UMA-SUS.\r\nLecionou Filosofia e Sociologia nas Escolas:\r\nE.E. Professora Francisca Malheiros\r\nE.E. Clóvis Salgado\r\nE.E. Odilon Behrens \r\nE.E. Dr. Paulo Diniz Chagas\r\nAtualmente trabalha na empresa Ação contact Center.\r\nContribui como escritor na página “Olhos de Minerva”\r\nE administrador e escritor das páginas: “ Ágora” e “ A arte da Poesia”\r\nUm dos Fundadores do Grupo Alice no País LGBT \r\nPARTICIPAÇÃO EM EVENTOS:\r\n?	Seminário Internacional Rede de Pesquisadores de Crime Urbano da América Latina (UFMG/2015)\r\n?	I Simpósio de Psico Oncologia( FUMEC/2015)\r\n?	33° Congresso Mineiro de Municipios ( BH/2016)\r\nPainel:  Exercicio da Atividade Parlamentar: Os Desafios da Função Política\r\n?	Voluntário  da Copa das Confederações no Brasil( BH/2013)\r\n?	3° Fórum de Ciência e Tecnologia da FUNED\r\nDefesa de Projeto:  Proposta de Metodologia para Elaboração de Mapa de Risco para os Laboratórios do Instituto Octávio Magalhães( FUNED/2005)\r\n?	Voluntário da 19° Parada LGBT de BH( julho/2016)\r\nDefensor dos Direitos e Cidadania LGBT, da Educação Pública de qualidade e da saúde Integral  pelo viés da Educação em Saúde.\r\nPela primeira vez   é   candidato a  vereador de BH pelo Partido Progressista.\r\n','seminarista.medeiros@gmail.com','1188348694559384'),(19143,'Tuga Martins','BRANCA','MASCULINO','MASCULINO','1970-12-02','A trajetória desse metalúrgico de 45 anos começou no chão de fábrica e, somada à participação nos movimentos populares, fez nascer esse jeito humano de fazer política.\r\nA receita é simples, mas desafiadora: ouvir companheiros e companheiras e tomar decisões em conjunto a fim de defender os interesses dos trabalhadores e das trabalhadoras e estreitar a distância entre a população e a elaboração de políticas públicas para os diversos setores, especialmente, os menos favorecidos.\r\nPôr isso em prática exige força, determinação e coragem. Wagner Lima é a resposta positiva para pessoas que estão cansadas do político profissional. É preciso mais do que nunca acreditar, apostar e oportunizar a participação popular.\r\nWagner Lima é trabalhador aguerrido e exemplo de resistência. A experiência de militante vai além do confronto capital e trabalho no sindicato e é colocada em prática frente à Associação dos Moradores do Jardim Itapoan (ACJIT).\r\nDefensor de um mandato participativo, assume os seguintes compromisso:\r\n•	Atender aos anseios do coletivo formado pela diversidade dos segmentos organizados, movimentos sindicais e populares e entidades de bairro;\r\n•	Dar voz e oportunidade à juventude;\r\n•	Promover a inclusão e valorização da terceira idade;\r\n•	Garantir a plena acessibilidade;\r\n•	Lutar pelo direito à moradia e regularização fundiária;\r\n•	Defender a descentralização dos serviços públicos, cultura, esporte e lazer.','tuga.martins@gmail.com','10210583345001473'),(19144,'Glauber Bittar','PARDA','MASCULINO','MASCULINO','1988-07-30','                Professor Glauber Bittar, filho do Gilmar relojoeiro e da professora tia Su, entrou na Universidade do Estado de Goiás aos 17 anos, onde fundou o Projeto Risco Zero, que beneficiou mais de 250 crianças e adolescentes, assim que se formou participou como voluntario de um projeto social na Inglaterra, o mesmo projeto que deseja implantar na cidade de Piracanjuba, recentemente formou-se em Inglês e desenvolve um projeto social na cidade de Piracanjuba que conta com aproximadamente 100 alunos, foi presidente do Conselho Tutelar dos Direitos das Crianças e Adolescentes e dedica à 10 anos sua vida a projetos sociais e ao esporte, professor no Colégio Estadual José Feliciano Ferreira, aprendeu muito a realidade das crianças do município de Piracanjuba, hoje sonha em ser vereador para que assim possa desenvolver seus projetos e suas idéias para o município.\r\n          Glauber Bittar é um candidato ficha limpa e merece o apoio e o voto dos moradores de Piracanjuba!\r\n\r\n          Professor Glauber Bittar 55000.','glauberbittar@hotmail.com','1108769995844091'),(19217,'Fabio Augusto Manzano','BRANCA','MASCULINO','MASCULINO','1978-05-27','SOU ADVOGADO ESPECIALISTA EM DIREITO CIVIL E PROCESSO CIVIL, JA ATUEI EM MINHA  CIDADE EM VARIOS CONSELHOS MUNICIPAIS DENTRE ELES DESTACO O DO IDOSO, O DA SAUDE E O DOS PORTADORES DE DEFICIENCIA FISICA, SOU CIDADAO VINHEDENSE NASCIDO EM SAO CAETANO DO SUL E AQUI CHEGUEI HA 30 ANOS.SEMPRE PARTCIPEI ATIVAMENTE DAS ENTIDADES SOCIAIS DE NOSSA QUERIDA VINHEDO E MEU FOCO SEMPRE  FOI EM FAZER O MAXIMO PELO NOSSO SEMELHANTE.FIZ PARTE DO LIONS CLUBE, FIZ PARTE DA LOJA MACONICA TEMPLARIOS DE VINHEDO. ESTOU CANDIDATO AO CARGO DE VEREADOR PORQUE SINTO A NECESSIDADE DE MUDAR E DE FISCALIZAR O EXECUTIVO PARA QUE NAO TENHAMOS NENHUM TIPO DE CORRUPÇAO OU IMPROBIDADE ADMINISTRATIVA, SINTO QUE HA MUITOS ANOS O LEGISLATIVO DEIXOU DE SONHAR E OUSAR.\r\nNA OAB DE VINHEDO TRABALHEI EM UM PROJETO DENOMINADO CIDADAO DO FUTURO ONDE MINISTRAVAMOS PARA A SCRIANÇAS E ADOLESCENTES DE TODAS AS ESCOLAS PUBICAS E PARTICULARES NOÇÕES SOBRE ETICA MEIO AMBIENTE TRÂNSITO E ESTATUTO DA CRIANÇA E ADOLESCENTE ENSINANDO DESDE CEDO DE QUE PARA ADQUIRIR DIREITOS TEMOS QUE PRATICAR NOSSOS DEVERES.','fabio-manzano@hotmail.com','10207332404374947'),(19328,'Marta De Paula','BRANCA','FEMININO','FEMININO','1983-07-21','Professora Marta de Paula. Desde sempre lutando pela Educação na cidade de Manaus, querendo um país livre da desigualdade social.','poetisadorei@hotmail.com','10209896382500111'),(19383,'Érika Monteiro Moraes','BRANCA','FEMININO','FEMININO','1968-01-09','Meu nome é Erika Monteiro Moraes, sou natural de Limeira. Sou filha de Herculano Monteiro Moares e Etelvina Vantini Moraes. Meu pai foi padeiro e poeta, enquanto minha mãe, uma mulher muito sábia, viveu como dona de casa, criando 10 filhos. Meus pais foram proprietários da famosa Padaria América, na região central de Limeira.\r\nMinha formação inicial foi na área de Letras, pela PUC Campinas e, posteriormente, cursei Pedagogia na UNESP. Sou Professora de Educação Infantil na rede municipal e do Ensino Médio, na rede estadual de Educação. No município encontro-me afastada do cargo para exercer a vereança, enquanto no estado continuo a lecionar língua inglesa, na EE Brasil. Minha aproximação como movimento dos professores aconteceu no início dos anos 90, mais especificamente em 1993, quando participei de uma grande greve, onde nós educadores cobrávamos a valorização de nosso trabalho. Foi neste período que conheci e me aproximei do grupo de professores que é a base desde mandato, sendo que todos somos amigos até hoje. Lá aproximei-me da Apeoesp, entidade representativa dos professores e maior sindicato da América Latina. Tive a oportunidade, nos anos 2000, de ser eleita coordenadora da subsede Limeira da Apeoesp em dois mandatos e, por atuar e participar de várias atividades de caráter político em nossa cidade, fui indicada a disputar as eleições como vereadora em 2012, onde fui eleita para ocupar uma das cadeiras da Câmara de Limeira no quadriênio 2013-2016.\r\nNestes anos, nossa atuação parlamentar, com qualidade técnica, apoiada emminha formação acadêmica, experiência política e profissional como educadora e militante da Apeoesp, me permitiu realizar um trabalho diferenciado e marcante, que desejo dar continuidade, com destaque as ações voltadas aos interesses da ampla maioria da população de Limeira, em particular no que se refere à fiscalização de atos do Executivo, das ações da Secretaria da Educação, das políticas públicas relacionadas à Habitação e Saúde, ao Empoderamento da Mulheres e as demais demandas que surgiram em nosso gabinete.\r\nNa área da Educação, gostaria de destacar a alteração da legislação para mudança de nível, a articulação para o deferimento e publicação destes processos, a agora o pagamento do valor retroativo a que os profissionais da Educação têm direito. Conseguimos também articular a efetivação de mais de 450 servidores na Educação, além da implantação da Escola de Tempo Integral (um dos pilares de nossa campanha em 2012), o não fechamento de escolas municipais e estaduais e a aprovação, na integra, do Plano Municipal de Educação, em minha opinião, a Lei Mais importante de nossa cidade. \r\nNa Habitação, atuamos em parceria com o saudoso líder comunitário Nelson Cadeiras (in memoriam) no acompanhamento de famílias em situação de vulnerabilidade social, muitas contempladas nos empreendimentos do Governo Federal, Recanto dos Pássaros, Geada e Residencial Rubi. Em viagens a Brasília conseguimos também a aprovação do Projeto Habitacional Nelson Caldeiras, que contemplará mais 740 famílias de Limeira, cooperadas da Associação Habitacional de Limeira. Fui também eleita para representar nossa cidade na Conferência Nacional das Cidades.\r\nJá em relação aos Mulheres, criamos ainda em 2013 a Procuradoria Especial da Mulher e conseguimos articular a inserção de Limeira no calendário da vacinação contra o HPV, câncer do colo do útero que pode ser evitado com a vacinação de meninas de 9 a 13 anos. Trabalhamos também pela implantação em Limeira da Vara de Violência Doméstica e Familiar contra a Mulher, situação muito próxima de acontecer, ainda em 2016.\r\nAtuamos também na criação do Conselho Municipal de Defesa dos Direitos dos Animais, defendendo que o Executivo realiza políticas públicas que tragam qualidade, como a microchipagem e a castração. ','erikamonteiro@limeira.sp.leg.br','10209401644250918'),(19386,'Joaquim Mota','PARDA','MASCULINO','MASCULINO','1977-06-08','Por um município melhor, um vereador de verdade. Vote JOAQUIM DE SALVIANO NR 90123 ','joaquimetb@gmail.com','1180436398662160'),(19477,'Elton Carvalho','PARDA','MASCULINO','MASCULINO','1981-11-13','','elton111381@hotmail.com','1231742126876615'),(19587,'Luiz Antonio Martins','BRANCA','FEMININO','FEMININO','1965-04-27','Em minha história de vida, e isso por muitas coisas que vivi e também por muitas outras com que convivi, sempre tive muitas convicções, e uma das maiores delas sempre foi a de que infelizmente nosso sistema faz com que um certo grupo de pessoas seja favorecido enquanto outro seja prejudicado. Quem conhece a realidade de quem sofre a desigualdade social sabe também que quem começa a sofrer o processo na pele, desde que vem ao mundo, é a criança. A criança que nasce em uma família desfavorecida, esquecida pelo governo, é a primeira a ter o seu mundo de sonhos da infância interrompido para emergir na difícil realidade do mundo adulto, muitas vezes inclusive sendo inclinada para o trabalho ou para a exploração infantil. Foi pensando nisso que há 16 anos, no distante ano de 2000, comecei a distribuir bolo e doces no Dia das Crianças, além de, a partir de 2006, começar a me vestir de Papai Noel anualmente para entregar presentes arrecadados, levando a mensagem do Natal principalmente para bairros mais simples e afastados, como o do Lixão e o Campos Salles. Nessa minha caminhada, conheci muitas pessoas e muitas histórias de vida, a maioria delas, infelizmente, marcada pelo descaso dos políticos com suas situações, simplesmente as esquecendo nas condições em que viviam para priorizarem somente aqueles que podem os fortalecer no alto campo da disputa política. Da minha forma, tentei melhorar a vida delas, mas percebi que muitas vezes faz falta um representante que faça voz a essas pessoas na Câmara Municipal, ajudando na prática a fazer com que elas tenham suas pautas ouvidas e atendidas, como deve ser com qualquer cidadão, independente de cor, classe social, credo, orientação sexual e etc. Foi por isso que resolvi lançar a minha candidatura a vereadora neste ano, para levar esse projeto a frente e fazer com que muitos que vem sendo há décadas negligenciados pelos políticos de Barra Bonita possam finalmente se fazer ouvidos e representados! Se você acredita e confia nesse projeto, venha construir conosco! Junte-se à nossa campanha e vote 90.151!','luiz.antonio29@hotmail.com','1466098343416546'),(19651,'Rodrigo Reis Mumu','BRANCA','MASCULINO','MASCULINO','1975-06-08','Presidente da associação dos conselheiros e ex conselheiros tutelares do Rio Grande do Sul, ex conselheiro tutelar de Porto Alegre por 8 anos.\r\nPedagogo, pós graduando em direito da criança e do adolescente, gestão escolar e direito a educação','rodrigoreismumu@gmail.com','965958766864271'),(19725,'Ten Silva Rosa','BRANCA','MASCULINO','MASCULINO','1977-01-30','39 anos, Tenente da Policia Militar do Estado de Sao Paulo. Com 15 anos de profissao, sendo 6 anos na ROTA. \r\nPaulistano, nascido no Hospital e maternidade Sao Paulo, possui vasta experincia profissonal e conhece os problemas e dificuldades do dia a dia das pessoas da nossa cidade, pois alem de ser de origem humilde ascendeu na carreira mas sempre com o trabalho voltado ao povo e a a sua proteçao. Conta c centenas de servicos relevantes prestados a sociedade, tendo realizado ate parto durante o patrulhamento. Assim, vem como uma nova e promissora opção ao cidadao paulistano que clama por uma renovaçao na Camara de Sao Paulo e por mais Segurança Publica.','silvarota33@gmail.com','1812760435673303'),(19728,'Mateus Simões de Almeida','BRANCA','MASCULINO','MASCULINO','1981-03-09','Professor universitário, advogado, procurador concursado da ALMG. Tenho 35 anos idade e acredito em um modelo de estado menos intervencionistas, em que a máquina pública seja menor, para que haja mais recursos para os serviços públicos essenciais.','mateussimoesdealmeida@gmail.com','1784543178450699'),(19772,'Kadu Silva','BRANCA','MASCULINO','MASCULINO','1982-03-16','Campineiro de certidão e coração, atualmente resido no distrito do Campo Grande (Satélite Íris). Um cara incomodado e inconformado, no sentido literal do termo e, por isso, faço uso constante dos \"por quês?\", pois não concordo com o status de \"sempre foi assim\".\r\n\r\nAtualmente Engenheiro de Software, formado pela Faculdade de Tecnologia de Americana (FATEC), atuo na área de TI há pelo menos 12 anos, em diversos setores e mais recentemente na área de gestão de projetos ágeis.\r\n\r\nEntendo que a tecnologia pode ajudar a transformar a sociedade, colaborando para que tenhamos uma administração pública mais transparente e eficiente, assim como uma melhor qualidade de vida, baseada numa cidade sustentável e inclusiva.\r\n\r\nAcredito na cooperação, no diálogo e na sinergia de idéias. Ninguém é uma ilha e ninguém faz política sozinho. Por isso priorizo ouvir ao invés de prometer, tendo certeza de que há muitos que querem participar e não somente receber.\r\n\r\nAssim como você, eu também não me sentia representado por ninguém e, por não me sentir representado, decidi passar a representar. Nesse sentido, me coloca a disposição para representá-lo também.\r\n\r\nO voto é sua arma e o caminho mais curto para o início de uma transformação social. Não anule essa oportunidade. Ao invés disso, venha comigo provar que é possível fazer a diferença, juntos.','contato@carlostrevisolli.com.br','1174030069335313'),(19776,'Adriana Collares','BRANCA','FEMININO','FEMININO','1969-06-11','Adriana Collares tem formação superior em Comunicação Social\r\ne pós em Gestão Pública. Funcionária pública concursada há \r\nmais de uma década, trabalhou na Secretaria de Comunicação, \r\nna Casa Civil e na Secretaria de Educação do Estado , onde atuou como Presidente da Comissão de Licitações.\r\nFilha de Dona Antônia e de Alceu Collares, Adriana orgulha-se \r\ndo que seus pais fizeram por todos os portoalegrenses. Hoje, como trabalhadora, mulher e mãe, compreendendo a situação delicada da política atual, propõe seu nome como vereadora de Porto Alegre para resgatar a boa política, inspirada em nomes com os quais cresceu, como Collares, Brizola e Darcy Ribeiro.\r\nLutará pela escola integral em tempo e qualidade de educação, por mais cultura, por mais amparo às comunidades, pelo respeito à diversidade e redução das desigualdades sociais e em defesa dos direitos das crianças, jovens e mulheres.','adriana_collares@yahoo.com.br','10209752527382476'),(19898,'Abel Camillo','BRANCA','MASCULINO','MASCULINO','1983-03-15','Abel Camilo casado,morador de Uberlândia ha 25 Anos.esta disposto a mostrar para os vereadores viciados em câmera que  vereador e missão não profissão.vamos mudar essa Uberlândia 36012','abelcamilod@gmail.com','588202214700490'),(20009,'Mauricio D Melo','PRETA','MASCULINO','MASCULINO','1967-09-20','Mauricio D Melo 50555 é Militante do Psol 50 , Membro do Diretório Municipal , Coordenador do Núcleo de Base Pq Jurema Psol 50 ,  Integrante da Pastoral Fé e Política da Igreja Católica .\r\n\r\nMorador do Pq Jurema na periferia de Guarulhos a 26 anos .\r\n\r\nEntende bem dos problemas da Periferia e a descriminação dos Jovens Preto Pobre da Perferia .\r\n\r\nOs LGBT , Mulheres que sofrem com a cultura do estupro .\r\n\r\n','mauricio_melovieira@terra.com.br','1128767527203520'),(20018,'Leiloeiro Lázaro Cesar Rodrigues','BRANCA','MASCULINO','MASCULINO','1951-08-16','Psicólogo Clínico de Formação\r\nLeiloeiro Rural - FAEMG (Federação da Agricultura e Pecuária do Estado de Minas Gerais)\r\nNascido, Criado e residente em São Gonçalo do Sapucaí.\r\nCandidato a vereador, se eleito seguirei o regimento interno da Câmara e as obrigações legislativa do vereador.\r\nNão serei Executivo, serei legislativo.','lazaro.carela@gmail.com','1778299602439803'),(20159,'Denise Rivera','BRANCA','FEMININO','FEMININO','1960-02-18','Sou funcionária pública estadual e veterinária. Como funcionária pública sei o quanto é importante valorizar e respeitar os bons servidores. Tenho projetos que visam a valorização do servidor público, além de campanhas de proteção animal, com programas de esterilização animal, tratamento e incentivo à adoção. Retirar os animais da rua evitará a transmissão de doenças, além de ser um gesto de amor.\r\nFormada em Medicina Veterinária pela UFF, Perita Criminal Estadual , Presidente da Associação de Peritos do Estado do Rio de Janeiro (APERJ) e Vice-Presidente da Associação Brasileira de Criminalística (ABC). Pela valorização do funcionário público, venho atuando na perícia criminal em conjunto com as organizações de direitos humanos. Pela criação do Serviço de Perícia casos de maus tratos animais','denisegmrivera@gmail.com','10208902799741465'),(20283,'Pedrinho Renzi II','BRANCA','MASCULINO','MASCULINO','1961-03-17','sociólogo, jornalista.\r\nescritor em Araraquara.\r\nAssessor Legislativo. \r\nProfessor universitário.  Morador no bairro do Carmo.','pdrenzi@outlook.com','222292948186180'),(20388,'Daniella Araújo','PARDA','FEMININO','FEMININO','1987-08-03','\"Mulher, jovem, desportista, \r\ninstrumentista, cantora, artista\r\nMilitante estudantil, pessoa de Fé\r\nCandomblecista\r\nFilha de uma grande guerreira\r\nSeu espelho, exemplo de vida!\r\n\r\nConvive com o machismo diariamente\r\nSente na pele a negação dos espaços\r\nreservado aos homens, historicamente\r\nTeve coragem de denunciar na Maria da Penha\r\ntamanha opressão\r\nSofreu violência física, psicológica, institucional, moral, patrimonial\r\nCom a luta feminista, segue de cabeça erguida, empoderada, fortalecida\r\nNão baixou a cabeça não!\r\n\r\nO esporte te ensinou valores na vida\r\nNas quadras iniciou sua carreira desportista\r\nFoi atleta ouro no basquete, seguiu jogando na seleção\r\nFez parte de uma equipe vitoriosa, teve treinador exemplar\r\nSendo a primeira equipe Feminina Potiguar \r\nNo Brasileiro universitário conquistar o prestigio da 1ª divisão!\r\n\r\nSe formou no IFRN em Gestão Desportiva e do Lazer,\r\ntambém foi atleta da instituição\r\nMas, foi no Direito que acendeu a chama por justiça\r\nLutou, fundou e presidiu o Centro Acadêmico do curso e o DCE da Maurício de Nassau logo em seguida\r\nNa UFRN ingressou em Educação Física\r\nEsteve na coordenação geral do DCE da UFRN desde 2013 até a ultima gestão.\r\n\r\nNo movimento estudantil universitário iniciou sua militância\r\nAssumiu a Vice Presidência Regional da União Nacional dos Estudantes/UNE (2013-2015)\r\nMas, em 2014 renunciava o tão sonhado espaço na majoritária da UNE,\r\nAcredita que concessões espúrias na política devem ser combatidas na juventude\r\nCaminhar com ética, perseverança e respeito ao povo brasileiro, respeitando suas bases\r\nIsso sim deve ter relevância\r\n\r\nNa Educação Física fez história\r\nJogou poesia, arte, política e mexeuo caldeirão\r\nTornou-se exemplo vivo na memória\r\nCom estudantes, servidores, professores e ambulantes \r\nFez sua base, lutou como leão\r\n\r\nNa música... Ahhhh...\r\nSeu samba tem muito axé\r\nSua voz imprime força e união\r\nAo batuque da musica popular brasileira\r\nCompõe com emoção\r\nRoda de samba feminista, ciranda a dançar\r\nCanta para todos ouvirem\r\ne acredita piamente,\r\nÉ com arte e cultura que a educação vai se transformar!\"\r\n#vamosjuntos #OcuparaCidade #fazerdiferenteépossível','daniellaaraujodias@gmail.com','1242905175729820'),(20530,'Lênora Peixoto','BRANCA','FEMININO','FEMININO','1968-06-20','Sou mulher, sou sertaneja, luto por maior representatividade feminina na Câmara Municipal e combate a violência de gênero. Fui secretária do Trabalho, Assistência Social e Habitação, atuei junto ao Programa de Erradicação de Trabalho Infantil e desenvolvi diversas atividades junto a crianças e adolescentes em meu município. Pretendo continuar trabalhando junto a homens e mulheres do campo no convívio com a seca e dando mais oportunidades para a juventude.','Iris.santos.jardim@gmail.com','930933097011593'),(20562,'Derivaldo Damazio Pereira Damazio','BRANCA','MASCULINO','MASCULINO','1970-07-28','Sou graduado em Filosofia, Sociologia e História. Pela segunda vez concorro a um cargo eletivo. Se eleito for, irei trabalhar pela ampliação da educação inclusiva, mobilidade urbana sustentável e valorização de todos os trabalhadores.','ddamazio@ig.com.br','1170232589705066'),(20902,'Max Coelho','BRANCA','MASCULINO','MASCULINO','1969-12-17','Funcionário público a 27 anos, 3 grau completo três filhos !','maxmccoelho@hotmail.com','1088389497917730'),(21140,'Dú Penterson','PRETA','MASCULINO','MASCULINO','1988-03-19','Nós somos Dú Pente\r\n\r\nDú Pente é produtor cultural, publicitário por formação e ativista do movimento negro por necessidade. Sempre lutou pela representatividade da população excluída, atuando no coletivo \"Pretas em Movimento\" e no movimento “Muitas pela Cidade que Queremos”, realizando o Festival Raízes UFMG, organizando o Mostra Rai?zes – Afirmac?a?o do negro no audiovisual, trabalhando como afro-educador em escolas públicas e participando de movimentos que ocupam e transformam o espaço público da cidade, como a Praia da Estação. Em 2016, foi eleito conselheiro municipal de cultura pela regional centro-sul e desde 2015 integra a Comissão Estadual da Verdade da Escravidão Negra no Brasil da OAB/MG. Sua luta é pela construção de políticas públicas que construam uma cidade mais inclusiva e que garantam oportunidades para todos.','contato@djdupente.com','10207394852735619'),(21177,'Raphael Rondow','BRANCA','MASCULINO','MASCULINO','1989-12-22','Olá! Eu me chamo Raphael Von Rondow Nascimento, sou psicólogo, tenho 26 anos e sou candidato a vereador pelo PSOL. Sou nascido, criado e um apaixonado por Itabirito! Me formei há dois anos e desde então, me envolvi em alguns projetos que buscam interagir de modo especial com a sociedade. Faço parte do Projeto Basquete Itabirito, o qual desenvolve ações dentro da modalidade esportiva visando o treinamento de jovens. Realizei o projeto \"Cinema é Ressocialização\" junto a Casa de Apoio para moradores de rua do município. Integro o projeto \"Papo Cabeça\", quadro que vai ao ar semanalmente pela Rádio e tem por objetivo dialogar temas que estejam envolvidos com a juventude de Itabirito. Em síntese, essa é a minha história nos últimos dois anos, acreditando que os acontecimentos vividos anterior a este período, foram fundamentais para que eu escolhesse caminhar por este caminho, que se pauta em acreditar na justiça social.','raphaelrondow@gmail.com','1070437826409253'),(21180,'Samuca Oliveira','BRANCA','MASCULINO','MASCULINO','1997-03-25','Eu, Samuel Oliveira, um jovem de 19 anos que iniciei minha militância em 2013 através do Grêmio estudantil  da Escola Estadual Prof.  Moacyr Campos, em defesa dos estudantes. A partir disso, participei do movimento estudantil ocupando as ruas, minha escola, entre outros espaços, na luta  por uma educação e escola pública de qualidade, através da UPES (União Paulista dos Estudantes Secundaristas) e UMES SP. Militante da União da Juventude Socialista, contribuí na luta do último período pelo direito dos diversos setores (trabalhadores, estudantes, mulheres, LGBTs, negros e juventude) e em defesa pela democracia do país. Sempre presente em movimentos de assistência social com trabalhos voluntários a pessoas em situação de rua e necessitados\r\nAgora me coloco em mais um desafio de fazer parte do corpo legislativo para construir uma São Paulo mais humana, perpassando pelas dificuldades com mobilidade urbana, moradia, saúde, educação, segurança, ampliação e ocupação dos espaços públicos, entre outras diversas necessidades de cidade, sobretudo com a participação e construção coletiva dos cidadãos paulistanos. \r\nFaça parte da construção dessa luta, vote nessa ideia, compartilhe e contribua para a construção dessa campanha que é de todos nós!','samuca7oli@gmail.com','1121659451255378'),(21342,'Carlitão Silva','PARDA','MASCULINO','MASCULINO','1968-07-08','Sou Carlitão, nascido em Campinas. O esporte sempre fez parte da minha vida, o basquete foi determinante e contando com apoio da minha família, conseguimos construir um futuro melhor.\r\nFui jogador de basquete, atuando em clubes como Tênis Clube de Campinas e Palmeiras. Tive ainda oportunidade de jogar e estudar no basquete universitário dos E.U.A por meio de bolsa de estudo.\r\nSempre atuei em questões sociais e fiz trabalhos voluntários em vários grupos e igrejas.\r\nHoje faço parte do projeto Social Esportio da Vila IAPI e da LCBR, onde fazemos várias atividades com o basquete para ajudar as crianças e adolescentes a terem uma vida mais saudável e condições de se desenvolverem para um futuro melhor.\r\nMinha proposta como vereador é trabalhar diretamente com as comunidades, ver os problemas pontuais e alinhar as ações com o nosso governo.\r\nAlguns projetos já foram apresentados, precisamos é tirar do papel.','carlito.verador1@gmail.com','10210809639619704'),(21372,'Custódio Campos','BRANCA','MASCULINO','MASCULINO','1956-03-17','-Minha Paulínia, minha Vida\r\n\r\nAos 18 anos fui convidado por meus tios a me mudar para Paulínia. Saí de Marília/SP com a confiança que estava a caminho de uma cidade de oportunidades, emprego, e realização pessoal. Era jovem e já sabia que aqui faria minha vida. Há + de 40 anos vivo em Paulínia e minha vida está totalmente atrelada ao desenvolvimento dessa cidade.\r\n\r\nEm 1977 trouxe minha mãe irmãs. Morei no bairro Santa Terezinha, Vila Bressani, Medici, Monte Alegre e Calegaris. Sei que a Educação é importante, por isso, busquei formação profissional, ingressei no COTUCA (Colégio Técnico de Campinas) e em seguida comecei o curso de Administração na PUC Campinas. Assim, o sonho de uma  profissão melhor começou a ser concretizada. Sei o que é correr pra não perder  o último ônibus e a dificuldade de ter que se esforçar para ter um futuro melhor.\r\n\r\nPaulínia é onde vivi minha juventude, amadurecí, solidifiquei minha vida e família. Hoje sou pai de duas filhas, dois filhos e avô!\r\n\r\nO ano de 1982 foi marcante em minha vida. Fui eleito pelos colegas da empresa em que trabalhava como representante da Comissão de Trabalhadores. Daí em diante atuei mais intensamente na vida política, tempos em que ser liderança era um “problema”. Fui investigado pelo regime militar por minha liderança e atuação em defesa do direito dos trabalhadores. Esse trabalho me levou ao Partido dos Trabalhadores em 1989. \r\n \r\nSei o quanto é difícil estudar, trabalhar e manter família. Com esforço conclui pós graduação em Gestão de Meio Ambiente na Unicamp e em 2014 Gestão em Políticas Públicas na Fespp/Perseu Abramo. \r\n\r\nJá fui candidato a prefeito e estou vereador no 2º mandato. O que me traz  honra e responsabilidade. Isso mostra que a população aprovou nosso trabalho e a experiência  nos permite aprimorar e dedicar ainda mais. Das minhas ações que impactaram a vida da população o trabalho para que Paulínia fizesse a adesão ao Programa Minha Casa Minha Vida foi uma conquistas que me orgulho, já são mais de 3 mil família que adquiriram sua moradia digna. Além disso, a inclusão de uniformes de verão e inverno no kit escolar, além de diversas sugestões de reformas na rede escolar e melhorias aos profissionais que atendem aos estudantes locais.\r\n\r\n- Por que o 3º mandato? \r\n O desafio agora é o terceiro mandato. Tenho experiência e me preparei para as inovações da gestão pública. Conheço toda a rede municipal e sei  o que necessita de melhorias.\r\n \r\n- O que faz um vereador?\r\n\r\nO vereador trabalha para a população. Elabora leis, fiscaliza o trabalho do prefeito e representa as demandas. Acredito que o maior desafio de um vereador seja o de manter as pessoas  mais próximas de tudo que acontece o poder público e atende-las com atenção. É para isso que o nosso mandato trabalha dia a dia.\r\n\r\n-Motivação\r\n\r\nContar com a confiança da população para a busca de soluções de problemas de nossa cidade. Coragem para estar sempre ao lado da população e do bem público.\r\n\r\n-Sonho\r\n\r\nÉ ver a cidade mais justa, mais segura, onde as pessoas possam ser mais felizes e contempladas com serviços públicos de qualidade, com dignidade e com transparência. Acredito que podemos juntos trilhar o caminho. Algumas das áreas de minhas propostas:\r\n1- Educação, Escolas em período integral;\r\n2- Saúde;\r\n3-Segurança;\r\n4-Servidores públicos;\r\n5-Políticas urbanas;\r\n6- Planejamento urbano;\r\n7-Juventude;\r\n8-Emprego e valorização da mão-de-obra local;\r\n9-Pessoa com deficiência;\r\n10-Meio Ambiente;\r\n11- Fiscalização de órgãos públicos.\r\n12- Moradia;\r\n13- Infância.\r\n\r\nConto com seu apoio. Contribua com ideias e participe de nossa campanha. Custódio 13613. Confiança e coragem.\r\n\r\n','custodiocampos@uol.com.br','1306554956021787'),(21456,'Dorberto Carvalho','PARDA','MASCULINO','MASCULINO','1963-08-15','QUEM É DORBERTO CARVALHO? \r\nEscritor, dramaturgo e professor. Formado em Letras pela Universidade de São Paulo é co-autor do livro \"A luta dos grupos teatrais de São Paulo por políticas públicas para cultura\", autor do romance “Vertigem” e diversos textos teatrais. Conhecido por sua atuação na Cooperativa Paulista de Teatro foi um destacado articulador da Lei que instituiu o Prêmio Zé Renato de Teatro. \r\n','dorbertocarvalho@yahoo.com.br','1848817312006554'),(21494,'Lino Peres','PRETA','MASCULINO','MASCULINO','1951-12-27','É arquiteto pela Faculdade de Arquitetura da Universidade Federal do Rio Grande do Sul (1977), mestre em Arquitetura (1986) e doutor em Urbanismo pela Universidade Nacional Autônoma do México (1994). Professor do Departamento de Arquitetura e Urbanismo da Universidade Federal de Santa Catarina desde 1978 e do Programa de Pós-Graduação - \"Urbanismo, História e Arquitetura da Cidade\". Atualmente coordena o GEMURB (Grupo de Estudos da Mobilidade Urbana/ARQ/UFSC) e orienta o AMA (Ateliê Modelo de Arquitetura/ARQ-UFSC). É pesquisador e tem experiência, há muitos anos, na área de planejamento urbano, habitação de interesse social e plano diretor. Coordenou os Seminários Interuniversitários sobre Plano Diretor Participativo e mobilidade urbana. Participou da fundação do Núcleo de Estudos Negros e é militante na luta contra a discriminação racial. Participou da fundação e foi presidente do PT Municipal. É pai de duas filhas e tem dois netos.','linoperes13@gmail.com','588367391347632'),(21578,'Jales Silva','BRANCA','MASCULINO','MASCULINO','1951-04-16','Vicente protetor dos animais, O candidato que realmente atua na causa animal!\r\n\r\nHOSPITAL VETERINÁRIO PÚBLICO COM CASTRAÇÃO EM MASSA!\r\nPrecisamos urgente de um Hospital Veterinário Público gratuito em Campinas, como o que já existe em São Paulo, porém com um Programa de Castração e Identificação em massa permanente.\r\n \r\nEste Hospital Veterinário Público, terá funções vitais: \r\n \r\n1- A primeira é dar atendimento gratuito para os animais da população carente e de baixa renda, pois não suportamos mais ver famílias inteiras sofrendo, por assistir seus animaizinhos morrendo a mingua, sem ter condições de levá-los ao veterinário.\r\n \r\n2- Somente com o Programa de Castração e Identificação em Massa, conseguiremos diminuir o numero de cães e gatos nas ruas e consequentemente, diminuir o seu sofrimento.\r\n\r\nA USP fez uma pesquisa na cidade  de  São Paulo, entre 2004 e 2010, que serve de referência para qualquer lugar do Brasil. Em seis anos a população humana cresceu 3,5%, no mesmo período a população, canina cresceu 60% e a felina (gatos) cresceu 152%. De acordo com a projeção, se nada for feito em termos de controle populacional pelos governos, em 2030 teremos mais cães e gatos do que seres humanos. Por  conta disso e pela inércia do poder público, aprovei na Câmara Municipal de Campinas um projeto de lei que autoriza a prefeitura a fazer convênio com o Estado, podendo assim receber verbas para instituir políticas \r\npúblicas de castração e identificação de animais no município em convênio com o governo do Estado. Está Lei, de minha autoria, possibilitará a busca de recursos para castrar e identificar cadelas e gatas em Campinas. Temos que trocar o pneu do carro com ele andando, ou seja, enquanto o Hospital Veterinário Público estiver executando os programas de castração e identificação em massa dos animais, também estará dando atendimento aos animais doentes, atropelados, de rua e da população carente e de baixa renda. Por isso precisamos, urgente, de um Hospital Público Veterinário Gratuito.','vicoc.silva@gmail.com.com','1118956091520075'),(21679,'Wanderley Cardoso','PRETA','MASCULINO','MASCULINO','1966-09-29','ESTUDANTE DE ENGENHARIA ESTÁCIO SE SÁ  MESTRE DE OBRAS UFMG,PROFESSOR DE MUSICA ,DIRETOR DE EDUCAÇÃO E CULTURA DA REDE ESPORTIVA SOCIAL,,DIRETOR DE HARMONIA DA ESCOLA DE SAMBA ACADÊMICOS DE VENDA NOVA,COORDENADOR DE IGUALDADE RACIAL PT MG,REPRESENTANTE DOS MÚSÍCOS NO CONSELHO NACIONAL DE CULTURA,CONSELHEIRO DO PARQUE SERRA VERDE ,MEMBRO DA TELE JUSTICA ,CONSELHEIRO REGIONAL DE TRANSPORTE E CONSELHEIRO MUNICIPAL DE CULTURA FOI CONSELHEIRO POR DOIS MANDATOS NO CONSELHO DE EDUCAÇAO DE BH','wanderleycardoso593@yahoo.com.br','889230151212016'),(22615,'Sara Lee','PRETA','FEMININO','FEMININO','1989-11-29','Educadora social trabalhando pelo empoderamento do cidadão.','saralee_unai@hotmail.com','10202437979187962'),(22744,'Cintia Sales','PRETA','FEMININO','FEMININO','1990-02-18','Sou jovem, militante de esquerda e essa é minha primeira candidatura à cargo eletivo. Atuo na cidade com o coletivo Nós de Oz (de arte e CULTURA) e com o Fórum Municipal da Juventude desenvolvendo projetos, diálogos e ações, principalmente nas periferias. Nossa campanha é um projeto coletivo e pretende ser um mandato coletivo. Nossas propostas foram criadas junto aos movimentos sociais que se somaram a nossa luta e pautaram nossa intervenção nessa eleição; são jovens, trabalhador@s, mulheres, militantes do movimento lgbt, movimento negro e principalmente do movimento cultural que se expressam no posicionamento que se enquadra essa campanha: na luta pela democracia e no combate aos retrocessos dos direitos que conquistamos! Através desses grupos construo uma intervenção séria e propositiva na sociedade osasquense, criamos ações culturais como o Fórum Hip Hop e com ele eventos nas periferias de música e arte como o \"NaQbrada\", criamos uma revista para dar voz aos movimentos de luta na cidade, ajudamos na construção do Conselho Municipal de Política Cultural da cidade (com maioria da sociedade civil e o primeiro a ser deliberativo no país). Com a oportunidade de trabalhar na gestão pública local, encarei o  desafio de ser a primeira Coordenadora de Juventude da cidade e durante um ano junto a minha equipe e com a participação permanente em todas as fases da sociedade civil, conseguimos implantar na cidade o Plano Juventude Viva (um plano de 10 anos que virou lei! e agora queremos tirá-lo do papel) - que visa diminuir a vulnerabilidade que vivem os jovens negros em nossa cidade (estamos no mapa de violência contra a juventude na posição 103ª). Participei em 2013 junto aos aguerridos jovens de nossa cidade, das manifestações pelo transporte público gratuito e de qualidade e formamos a Frente de Lutas Pelos Transportes de Osasco. E porque a luta continua diariamente contra toda a opressão, o Coletivo Nós de Oz coloca a minha candidatura!','cintias.poroz@gmail.com','1514345831914555'),(22776,'Pricila Teixeira','PARDA','FEMININO','FEMININO','1981-07-12','Ola pessoal, tudo bem? \r\n\r\nEu sou Pricila, tenho 35 anos e sou candidata ao cargo de vereadora em belo horizonte. Sou bacharel em direito, tendo trabalhado com com o desembargador Alexandre de Carvalho e, no Tribunal de Justiça. Há dez anos luto para defender as vítimas de preconceito, pelos direitos dos idosos, aposentados, crianças e adolescentes, além de militar pelos direitos da comunidade LGBT e principalmente das mulheres. Por falar nesse assunto, você sabia que na câmara municipal da nossa querida cidade  existem 41 vereadores sendo que desses apenas uma mulher? Você pode ajudar a corrigir este absurdo.. Ajude a fazer justiça e coloque uma mulher forte na Câmara!\r\n\r\nE acredite, com a ajuda do seu voto irei fazer muito mais!!\r\n\r\nMe comprometo a  lutar pela maior transparência nos gastos públicos dos vereadores; para que o orçamento participativo se torne lei e as obras sejam realizadas por critério cronológico, e não de acordo com a vontade do Prefeito; por olho vico nas principais ruas dos bairros; e por uma educação que inclua no currículo, em todas as matérias, o ensino sobre a diversidade.\r\n\r\nComo disse antes eu já estive na câmara e possuo vários projetos que refletem essa minha luta por esses ideais como a Instituição da Política Municipal de Prevenção e Atendimento à Gravidez na Adolescência e a implantação de sistema eletrônico de alarme detector de gás nos estabelecimentos que menciona e dá outras providências, bem como outro muito importante como a Lei que Institui o Dia Municipal de Combate à Intolerância no Município de Belo Horizonte. Segue abaixo a lista completa:\r\n\r\nLEI Nº 10.614 - Institui o Dia Municipal de Combate à Intolerância no Município de Belo Horizonte.\r\nLEI Nº 10.553 - Dispõe sobre a desafetação de via pública, autoriza a alienação, na forma de venda ou permuta, das áreas que menciona e dá outras providências\r\nLEI Nº 10.537 - Cria a Feira de Arte, Artesanato, Variedades, Comidas e Bebidas Típicas do Bairro Miramar.\r\nLEI Nº 10.520 - Altera a Lei nº 8.616/03, que contém o Código de Posturas do Município.\r\nLEI Nº 10.420 - Promove a revisão geral anual da remuneração dos servidores da Câmara Municipal de Belo Horizonte e dá outras providências.\r\nLEI Nº 10.412 - Altera a lei nº 7.863/99, que “Institui o Estatuto dos Servidores da Câmara Municipal de Belo Horizonte e dá outras providências”.\r\nLEI Nº 10.408 - Institui a política municipal de qualidade total dos serviços públicos do Município de Belo Horizonte.\r\nLEI Nº 10.270 - Dispõe sobre a implantação de sistema eletrônico de alarme detector de gás nos estabelecimentos que menciona e dá outras providências.\r\nLEI Nº 10.251 - Declara de utilidade pública a Tenda Espírita Xangô e Ogum Xoroquê.\r\nLEI Nº 10.191 - Institui a Política Municipal de Prevenção e Atendimento à Gravidez na Adolescência.\r\nLEI Nº 10.117 - Obriga o uso de tarja ou placa de identificação em equipamento a serviço do Município, por empresas que menciona, e dá outras providências.\r\nLEI - 10.600 - Institui a Semana Municipal de Apoio à Adoção de Crianças e Adolescentes.\r\nEmenda à Lei Orgânica - 24 - Acrescenta à Lei Orgânica do Município de Belo Horizonte o art. 108-A e parágrafo único aos arts. 125 e 127.\r\nLei - 10415 - Institui a Política Municipal de Combate aos Acidentes com Vítimas no Município.\r\nLei - 10220 - Dispõe sobre o exercício da atividade de transporte remunerado ou vinculado ao trabalho de pequenas cargas em motocicleta, motoneta ou triciclo motorizado. \r\n\r\nAlém dos meus antigos trabalhos, estou baseando minha campanha em quatro pilares que eu acredito serem essenciais para um bom governo. Acredito fortemente no pilar da Educação Transversal da Diversidade, onde dentro da estrutura curricular atual, sejam trabalhadas questões sobre a aceitação da pluralidade, seja racial, sexual, religiosa, étnica e física, ou seja que todas as pessoas sejam aceitas como de fato são, sem julgamentos e preconceitos. Além da questão da segurança onde vou propor que o Programa Olho Vivo seja ampliado para as ruas de grande circulação dos bairros e, não fique restrito apenas á área central de Belo Horizonte.\r\n\r\nTransparência nas contas e o Orçamento participativo também entram nesse compromisso, muito por serem pontos essenciais para uma boa administração pública. É justo para com toda a sociedade os parlamentares informar mensalmente sua evolução patrimonial, para que os cidadãos saibam quem os estão representando. Com relação ao Orçamento Participativo a idéia é que ele seja impositivo e que as obras contempladas sejam realizadas de forma cronológica obedecendo à ordem em que foram aprovadas.','prikscardoso@yahoo.com.br','10154432785793700'),(23201,'Beto Miranda','BRANCA','MASCULINO','MASCULINO','1971-08-31','Sou formado em análise de sistemas, tenho 45 anos, pai de três filhos e me interesso por política desde o início dos anos 80. Não vejo com bons olhos o uso político das causas LGBT e muito menos a infantilização do problema. A garantia dos direitos fundamentais tem que ser preservados e uma sociedade menos conservadora para vivermos todos em harmonia','betomi@bol.com.br','1257170217668267'),(23321,'Nádia Gerhard Cmt I','BRANCA','FEMININO','FEMININO','1968-05-26','Natural de Porto Alegre, tem 48 anos, filha única de sargento da BM e de professora estadual, é casada e mãe de três meninos.\r\nSou Tenente Coronel da Brigada Militar, onde atuo há 27 anos. Tive a honra de ser a primeira mulher a comandar um Batalhão de Polícia Militar no Estado.\r\nTambém fui professora, formada em Letras, com especialização em psicologia escolar pela PUCRS, curso de Prevenção ao Uso Indevido de Drogas pela Universidade Federal de Santa Catarina e formada em Policiamento Comunitário, pela Secretaria Nacional de Segurança Pública.\r\nImplementei e coordenei a Patrulha Maria da Penha no RS,  projeto ousado e pioneiro em âmbito nacional, onde pela primeira vez na história a Polícia Militar tem como objetivo fazer cumprir as medidas protetivas de urgência, protegendo as mulheres, vítimas de violência doméstica. Sobre o tema palestrei em vários Estados, em Quito e em Washington, fomentando a reprodução do seu projeto premiado pelo BID, em diversas PMs e GM de Curitiba/PR.\r\nRecebi o prêmio Troféu Guri na sua 16ª edição em 2013, um evento consolidado que homenageia apenas 10 personalidades que levaram o nome do RS além fronteiras.\r\nFui vice presidente do Conselho Estadual dos Direitos da Mulher, do Conselho Deliberativo do Programa de Proteção a vítimas e testemunhas ameaçadas de morte, e autora do Livro “Patrulha Maria da Penha, o impacto da ação da Polícia Militar no enfrentamento da violência doméstica” \r\nAtuei como Diretora de Justiça na Secretaria Estadual de Justiça e Direitos Humanos onde fui responsável pela elaboração e publicação do Plano Decenal de Medidas Socioeducativas do Estado.\r\n','comandantenadia@gmail.com','675770189237713'),(23410,'César Brisolara','PRETA','MASCULINO','MASCULINO','1983-12-19','César Brisolara aprendeu desde pequeno a dureza da vida. Aos 6 anos, saía às ruas para pedir pão. Menino ainda, estudava e trabalhava para auxiliar a mãe. Adulto, resolveu ajudar outros meninos iguais a ele. E, na Guabiroba, onde nasceu, criou o Projeto Social Futuros Campeões – que trabalha com 390 crianças, por meio de Artes Marciais; É autor da Lei da Semana do Hip Hop em Pelotas; É presidente da Associação dos Moradores da Guabiroba. É secretário parlamentar na Câmara dos Deputados, em Brasília.\r\nComo vereador, o Cesinha vai trabalhar para garantir que: Os meninos ainda nas ruas tenham projetos para protegê-los da violência e das drogas; As mães e pais desses meninos sejam atendidos com respeito na rede pública de saúde de pelotas; Os jovens tenham acesso a programas profissionalizantes, a atividades de lazer e a escolas nos bairros que ofereçam o EJA; As gestantes recebam o apoio assistencial e médico que precisam desde o início da gravidez; A população dos bairros garanta acesso à cultura; Os idosos tenham seus direitos reconhecidos; O povo negro seja respeitado.\r\nVamos deixar o Cesinha falar por todos nós!\r\n\r\nVAMOS JUNTOS MUDAR ESSA HISTÓRIA \r\n\r\n\"O NOVO COM A CARA DO POVO\"\r\n\r\n#CesinhaVereador #40080','cesarbrisolara@hotmail.com','1364838060223021'),(23415,'Cida Reis','PRETA','FEMININO','FEMININO','1958-12-12','atua na área de recepcionista, facilidade em lidar com público.extrovertida, acredito em mudanças desde que setrabalhe para isto.','cidacape@hotmail.com','980104928765521'),(23665,'Noemia Fonseca','BRANCA','FEMININO','FEMININO','1952-11-24','Advogada - formada pela PUCSP - turma de 1981 - Advogada da Eletropaulo por 12 anos - 3 anos no Depto de Programas sociais realizando os seguintes trabalhos: Centro de Convivência da 3ª Idade em Mogi das Cruzes - trabalhos com escolas - eletrificação de comunidades carentes . Na área da saúde realizou programa de Doenças do Coração em 16 favelas - trabalhos de valorização da Polícia Militar junto à Escola Superior de Formação de Soldados da Polícia Militar - na educação participou do Programa OAB  vai á escola e de alfabetização de Adultos - Empreendedorismo no EJA - Quanto aos direitos da Mulher é presidente da Comissão da Mulher Advogada da OAB Lapa - realiza palestras sobre Abuso Sexual e Violência Doméstica - Atua na área da Segurança Pública - Foi presidente por 3 mandatos do Conselho Comunitário de Segurança da Freguesia do Ó - atualmente é diretora jurídica do CONSEG  Brasilândia - iniciou em 2015 Campanha para  abertura das delegacias em PLANTÃO 24 HORAS  - inclusive da Delegacia de Defesa da Mulher - com 11.000 assinaturas. Defende a extensão da Operação Delegada para os policiais que fazem o PROERD - a integração das polícias e a autonomia da Delegada da DDM para determinar MEDIDA PROTETIVA em casos de violência e risco à Mulher. Encaminhou projeto para firmar convênio ou parceria entre a OAB e a PMSP para oferecer consultoria jurídica gratuita para os Conselheiros Tutelares. Defende a criação de novos Ecopontos nas periferias aliado à programa de Reeducação ambiental para  a comunidade, iniciando pelas crianças.\r\nAlém disso, entende que o direito de ir, vir e ficar é inerente ao ser vivo e é garantido pela Constituição Federal, por isso, para evitar a aglomeração de jovens e adolescentes nos chamados Pancadões não basta por a Polícia em ação,  é necessário que a Prefeitura  e o Estado passem a ampliar e distribuir de forma mais justa os equipamentos públicos destinados ao esporte, à cultura e ao lazer.  Abertura de  Escolas Técnicas em parceria com o SENAI, o SENAC e com empresas de grande porte, na periferia, uma em cada Subprefeitura. Do seu ponto de vista,  a vereança deve ser exercida mediante representação participativa e total transparência das contas públicas. Gasto zero com publicidade mediante adesão total à tecnologia eletrônica e digital.  ','dranoemia19999@gmail.com','1095174263870788'),(23712,'Angenira Lennon','BRANCA','FEMININO','FEMININO','1960-08-08',' ANGENIRA AP. DIAS , 56 anos, mogiana, vegana e ativista da Causa Animal. \r\nProfessora de Educação Física da rede estadual e Conselheira da Apeoesp. \r\nHá mais de trinta anos, luta por direitos e igualdade sociais, tanto na escola como na comunidade em que vive.\r\nOBJETIVOS DA CANDIDATURA:\r\nBuscar alternativas e implantar políticas públicas para a causa animal no que se refere : \r\n- Ao abandono de animais nas ruas e a super população de cães, ocasionando um problema de saúde pública\r\n- Tornar transparente e eficaz a política de “trabalho” da Zoonose e do Hospital Público Veterinário do município para todos que necessitarem destes serviços\r\n- Fiscalizar se as leis para proteção animal estão sendo cumpridas pela Zoonose e pelo Município\r\n- Criar e Divulgar leis para conscientizar a população sobre a responsabilidade no abandono e maus tratos animais\r\n- Colocar em prática a política de castração para conter o abandono dos animais revitalizando e facilitando o a utilização do “castramóvel”\r\n- Incentivar e criar meios para a realização de feiras de adoção responsável \r\n- Lutar para que nunca mais seja permitido o uso de animais para entretenimento em nosso município\r\n- Trazer para o município a lei que permite animais nos albergues\r\n- Promover audiências periódicas para que o povo possa se envolver com a causa, que possam opinar, dar a devolutiva de tudo que estiver sendo realizado pela causa e assim torná-la um exemplo para outros municípios\r\n- Conscientizar mentes e corações para o bem estar animal de toda a espécie e pelo respeito às pessoas que optaram pelo vegetarianismo e pelo veganismo\r\n- Criar um canal de comunicação para tornar público tudo o que está sendo feito a respeito, bem como informar sobre eventuais impedimentos que puderem ocorrer durante o processo.\r\nEspero contar com seu apoio, amizade , confiança e seu voto, é claro!\r\nObrigada queridos & queridas!\r\nSaudações Socialistas!','angenira@gmail.com','1469624503051494'),(23736,'Marcelo Monteiro','PARDA','MASCULINO','MASCULINO','1992-04-20','Estudante da UFMG e professor de Filosofia no ensino médio, músico e agente cultural independente.','marcelomont.cand@gmail.com','156224294831596'),(24062,'Érica Mota','BRANCA','FEMININO','FEMININO','1978-01-13','Graduada em filosofia, educadora dos anos iniciais e coordenadora do Sindicato Estadual dos Profissionais da Educação.','jurandinamuniz@yahoo.com.br','10209496445060902'),(24063,'Swami Cordeiro Bérgamo','BRANCA','MASCULINO','MASCULINO','1974-07-24','Nasci em Itaguaçu e moro em Santa Maria de Jetibá há 17 anos. Trabalho na Escola Graça Aranha e curso mestrado em Ensino de Humanidades (IFES), onde estudo a história do povo pomerano.\r\n\r\nSou militante ativo dos movimentos sociais, apoiando a luta e a organização do povo. Minha trajetória é marcada pela defesa de uma educação pública, democrática, de qualidade, que valorize seus profissionais e garanta os direitos dos estudantes do campo e da cidade.\r\n\r\nPossuo especialização em História do Brasil (UFES) e Gestão Pública (IFES). Atuei em vários Conselhos na área da Educação. Fui servidor concursado da Câmara Municipal e participei do movimento popular do GAL (Grupo de Acompanhamento ao Legislativo). \r\n\r\nTenho o compromisso claro com a luta da classe trabalhadora e o respeito à diversidade humana. Fiz parte da direção do Sindiupes (Sindicato dos Trabalhadores da Educação) e fui assessor do Sindijetibá (Sindicato dos Servidores Municipais). \r\n\r\nAgora, como candidato à vereador, tenho o desafio de merecer o seu apoio e seu voto. ','swamicb@yahoo.com.br','1126523744092177'),(24351,'Machado Setembrina','BRANCA','FEMININO','FEMININO','1936-08-19','MINHAS  PROPOSTAS\r\nOrganização das mulheres,especialmente mulheres de carcerários em vista da geração de trabalho e renda;\r\n-Promover encontros e reuniões nos bairros para defender e definir as prioridades;\r\n-Defender os direitos dos idosos , dos agricultores, dos professores, das pessoas menos favorecidas pelo poder econômico;\r\n- Ela quer garantir outros direitos .   Básicos da cidadania como direito a saúde, à educação, à habitação , ao emprego.direitos prezados pela justiça social. É por esta Justiça  que ela quer lutar na câmara de vereadores de Santo Ângelo.\r\n\r\nNão venda seu voto!\r\nele pode custar  caro nos próximos 4 anos.\r\n\r\nVereadora: 13030\r\nPrefeito  13\r\n-','setembrinamachado@bol.com.br','1162907093798698'),(24518,'Ana Paula Mira','BRANCA','FEMININO','FEMININO','1976-12-28','Ana é professora no ensino superior e jornalista. Tem 39 anos e há 15 anos trabalha com educação e com ensino de questões relacionadas à democratização da comunicação. Foi militante do movimento estudantil, como diretora de Centro Acadêmico de Jornalismo, do Diretório Central dos Estudantes da Universidade Federal do Paraná e membro da Executiva Nacional dos Estudantes de Comunicação Social. Sempre teve vontade de participar da política e viu no PSOL a defesa de causas e valores muito caros a ela, como respeito às diferenças, igualdade social, igualdade de gênero e acesso irrestrito à comunicação. Entre suas bandeiras, estão a luta pelas questões feministas, o uso da comunicação como instrumento efetivo de cidadania e a valorização da educação.\r\n','anapmira@gmail.com','10155373682294465'),(24561,'João Paulo Bramusse','BRANCA','MASCULINO','MASCULINO','1982-02-19','Saudações!\r\nMeu nome é João Paulo Bramusse, e sou o candidato a vereador pela Cultura e pelo Desenvolvimento Econômico do Caratinga.\r\nMinha motivação é espiritual, honrada e positiva, de quem nasceu e cresceu aqui, tendo valores que foram formados pelo exemplo de meus avós, Moacir Rorigues, Zonilca Dalva, Geraldo Bramusse e Izabel Bramusse, além de minha amada família composta por meu pai Getúlio Bramusse, Jussara Rodrigues e de meu irmão Getúlio Bramusse.\r\n\r\nReafirmo meu compromisso com a Cultura de nosso tempo, pelos 3 anos em que ocupei a Diretoria da Juventude, como membro da Secretaria de Cultura de Caratinga, onde também estive à frente da presidência do COMPAC (Conselho \r\nMunicipal do Patrimônio Histórico e Cultural) e do CONTUR (Conselho Municipal de Turismo).\r\n\r\nContribui também meu histórico acadêmico, onde possuo a formação em Economia pela UFRRJ (2008), intercâmbio na Irlanda onde aprimorei meu inglês, estou cursando Direito na FIC, além de pós-graduação em Direito Público, o que amplia meu entendimento de cidadania para a construção das leis e uma visão ampla de nossas potencialidades econômicas, sociais, humanas.\r\n\r\nMinhas principais propostas são:\r\n1) Uma legislação voltada para atração de empresas, oferecendo benefícios como oferta de terrenos em comodato, incentivos fiscais e outros, que possam explorar o potencial para industrialização e geração de empregos de Caratinga;\r\n2) Uma legislação que dê oportunidade ao próprio cidadão ou empresa, de aplicar certa porcentagem de seus tributos municipais na preservação ou incentivo a instituições e projetos que apelem ao bem estar social e cultural;\r\n3) Que os repasses da Câmara Municipal ao executivo sejam feitos por regulamentação pertinente, com condicionantes e para as localidades mais carentes de assistência pública: a Casa do \r\nPovo atendendo aos anseios da comunidade.','petruquio73@hotmail.com','10206234638778858'),(24600,'Laysla Aquino','BRANCA','FEMININO','FEMININO','1996-12-21','Mulher, Pansexual, Pobre, Feminista (não misândrica), Cotista, Gorda (sou linda assim).\r\nCursando Relações Internacionais na Universidade Federal da Grande Dourados.\r\nProvei da desigualdade e do preconceito apenas por ser quem eu sou.\r\nFilha de mãe solteira, empregada doméstica, criada sem luxo, porém com muito caráter. \r\nAo meus 19 anos, já fiz de tudo um pouco, sempre busquei tornar cada dificuldade uma experiência. Trabalhei como empregada doméstica, diarista, auxiliar de cozinha, office girl, telemarketing e até arrisquei como tratorista.\r\nProvei da desigualdade e do preconceito por ser quem eu sou. \r\nQuem vai dar confiança pra uma mina de cabelo raspado? Quem vai dar credibilidade pra quem não tem \"status\"? \r\nSempre escutei : \"Vai ter que corre atrás!\". E eu sempre provei que É ISSO QUE EU FAÇO!\r\nSou filha da luta! Minha valentia vem de berço! O jovem no Brasil tem que ser levado a sério!','laysla.quino@gmail.com','899763510168738'),(24712,'Sávio José','BRANCA','MASCULINO','MASCULINO','1983-01-14','Fui militante do Movimento Estudantil da Universidade Federal de Viçosa e dos direitos da Juventude. Sou professor de História e vereador de 1° mandato em Viçosa. Filiado ao Partido dos Trabalhadores desde 2002.','saviojcsilva@yahoo.com.br','1131496080272914'),(24729,'Cleomar Zanchet','BRANCA','MASCULINO','MASCULINO','1991-03-16','','nene171zanchet@yahoo.com.br','1470565182960192'),(27163,'Leandro Pereira','BRANCA','FEMININO','FEMININO','1974-02-19','Moradora de ribeirão pires há 24 anos, Marta de Souza é mãe de 2 filhos e tem uma história de lutas na cidade. Atualmente trabalhando na área de promoções e eventos. Marta quer poder ajudar e atender as necessidades dos munícipes. \r\nNa câmara municipal, Marta, quer lutar para que os idosos tenham assistencia e cuidados garantindo qualidade de vida e bem estar.\r\n\"Nossos idosos precisam de atenção, e eu quero lutar por um centro de apoio que possa auxiliar com todos os cuidados necessários colaborando Também com os familiares\".\r\n','Martambproducoeseventos@hotmail.com','1000590593385622'),(27357,'Rennan Cantuária','BRANCA','MASCULINO','MASCULINO','1986-04-18','Rennan Cantuária é graduando em Ciências Sociais pelo IFCS/UFRJ, colaborador cultural, incentivador de uma educação libertadora e da construção de uma noção identitária, territorial e de pertencimento da pessoa periférica e baixadense.\r\n\r\nConheça as propostas da campanha coletiva 50.000: www.fb.com/rennancantuaria / www.rennancantuaria.com.br\r\n\r\nNascido em Nova Iguaçu, passou seus primeiros anos em Natal, capital do Rio Grande do Norte, e cresceu em Macaé, no litoral norte do Rio de Janeiro. Filho de petroleira, acompanhou desde cedo a luta sindical em defesa dos direitos trabalhistas e da soberania nacional sobre o petróleo brasileiro. Lá desenvolveu sua primeira iniciativa com o objetivo de divulgar e sensibilizar a população sobre a situação dos animais ameaçados de extinção.\r\n\r\nJá na adolescência, após a crise do modelo neoliberal em 1998, mudou-se com a família para a Nilópolis. Aqui, sua primeira ação foi criar o Viva Parque Sara Areal, movimento em defesa do parque municipal até então abandonado pelo poder público local e desconhecido por muitos moradores. Através de financiamento coletivo para auxiliar em sua manutenção inicial, de abaixo-assinado por transporte público no entorno e da publicização do estado crítico do parque, provocou a efetiva ação do poder público e a reforma do espaço.\r\n\r\nTambém é fundador do coletivo Nilópolis Debate, grupo pioneiro na discussão sobre o município a partir das redes sociais. Teve como principal objetivo a desconstrução da cultura do medo desenvolvida pelas décadas de domínio coronelista e dos grupos de extermínio na região que impunham a lei da mordaça entre os moradores. Através do coletivo, moradores puderam indagar diretamente representantes públicos locais, se organizar em novos campos de luta e dar vida a outros movimentos autônomos e independentes. No ND e junto a outros movimentos sociais, ajudou na amplificação da pressão popular sobre o poder público, na mobilização social via redes, na realização de plantios e mutirão de limpeza no Parque Natural do Gericinó e participou ativamente das Jornadas de Junho Nilopolitanas, que levaram mais de três mil pessoas às ruas da cidade por mudanças na política.\r\n\r\nAlém disso, é cofundador do Cineclube Toca da Coruja junto ao educador e ativista social João Lellis. Diante da necessidade de formação política percebida na experiência do Nilópolis Debate, a proposta é exibir filmes com temáticas sociais, políticas e/ou culturais e propor seu debate de forma horizontal e democrática com o objetivo de incentivar o pensamento crítico e uma visão de mundo contra-hegemônica. Como colaboradores no Sarau RUA, levaram o Toca da Coruja nas últimas sextas-feiras de cada mês à Praça dos Estudantes.\r\n\r\nEntre outras lutas, é colaborador do Núcleo Emílio Araújo e está secretário de comunicação no diretório municipal do PSOL em Nilópolis. Socialista, libertário e baixadense, defende uma alternativa anticapitalista, ecossocialista, libertária, empática, radicalmente democrática, com ampla participação popular, contra todas as opressões e por mais direitos como saída para a crise, como contraposição à velha política e, mais do que isso, como modo de transformação da nossa realidade.','rennancs@gmail.com','339280403071835'),(27492,'Marcos José de Abreu','BRANCA','MASCULINO','MASCULINO','1979-12-06','Marcos José de Abreu, o Marquito, é natural de Florianópolis, Engenheiro Agrônomo e pós-graduado em Agroecossistemas com título de Mestrado pela Universidade Federal de Santa Cataria (UFSC). Referência na cidade e no Brasil em Compostagem, Agricultura Urbana, Permacultura, Agroecologia e Alimentação. Uma trajetória de coerência entre a prática cotidiana e uma proposta de sociedade mais igualitária, fraterna e equilibrada ecologicamente.\r\n \r\nAtualmente cumpro as seguintes funções:\r\n \r\n a)   Presidente do Conselho Estadual de Segurança Alimentar e Nutricional de Santa Catarina (CONSEA/SC);\r\n \r\n b)   Coordenador de Agricultura Urbano do Centro de Estudos e Promoção da Agricultura de grupo (CEPAGRO);\r\n \r\n c)   Idealizador do Projeto Revolução dos Baldinhos, na Comunidade Chico Mendes, no Bairro do Monte Cristo;\r\n \r\n d)   Conselheiro da Associação Slow Food Brasil;\r\n \r\ne) Integrante do Fórum Catarinense de Combate aos Impactos dos Agrotóxicos e Transgênicos.','marcosjosedeabreu@gmail.com','1273672889318583'),(27557,'Juan Savedra','BRANCA','MASCULINO','MASCULINO','1988-01-19','Graduado em Direito pela UniRitter, especialista em Direito e Processo do Trabalho pela Fundação da Magistratura do Trabalho do Rio Grande do Sul - FEMARGS. Filiado ao Partido Social Liberal desde março de 2016, ingressou na legenda a partir do movimento LIVRES, tendência interna do PSL e que está renovando o partido por todo o Brasil e, inclusive, no Rio Grande do Sul e em Porto Alegre. Defende as liberdades individuais de forma absoluta, bem como as liberdades econômicas por acreditar que a sociedade, por meio da livre cooperação e da concorrência, possa corrigir as desigualdades criadas pelo próprio Estado que, ineficiente e agigantado, mais retira da população do que oferece a ela, inclusive, no que diz respeito à qualidade dos serviços prestados. Ainda, é um ferrenho defensor da laicidade e das liberdades religiosas, por entender que todos os indivíduos devem viver livres e de acordo com suas próprias convicções, escolhas e condições naturais e biológicas, o que inclui professar a crença que melhor lhe convir.','juansavedra@gmail.com','10210506654846962'),(28608,'Caic Henriques','BRANCA','MASCULINO','MASCULINO','1987-12-28','Militarmente Direitos Humanos e Politica Sobre Drogas em Minas Gerais.\r\n\r\nFundador do Movimento LGBT de Muriaé desde 2010 que atua contra o racismo, machismo e a LGBTfobia.','caichenriques13@gmail.com','1446101895418867'),(30037,'Natalia Pressuto Pennachioni','BRANCA','FEMININO','FEMININO','1992-08-31','Sou Natália Pennachioni, tenho 24 anos. \r\nAcredito que mudar o mundo pede coragem! Coragem e disposição para disputar os espaços políticos e instituições públicas, porque serão neles que lutaremos contra velhas perspectivas e projetos de discriminação. Acreditando nessa resistência, comecei a militar no coletivo Juntos e no PSOL em 2012, inclusive em um processo eleitoral como esse. Em 2014, quando ingressei na UFSCar, comecei a militar mais ativamente – principalmente no movimento estudantil e no movimento antiproibicionista, construindo a Marcha da Maconha em São Carlos. Em 2015 ajudei a organizar uma chapa para concorrer ao DCE e vencemos, então estive como diretora geral do DCE Livre UFSCar até o fim de 2015. \r\nEsse ano aceitei o desafio de me candidatar a vereadora pelo PSOL com o enfoque de Redução de danos e saúde mental, já que é o viés da política de drogas que cabe ao âmbito municipal.\r\nSe quiser mais informações, procure na minha página: https://www.facebook.com/natipennachioni/?fref=ts rs','nataliapennachioni@gmail.com','10154726369063816'),(31076,'Bruno Pickles','BRANCA','MASCULINO','MASCULINO','1981-12-03','Meu nome é Robson Bruno, mais conhecido como Bruno Pickles. Sou estudante de Pedagogia na UFU, dirigente do PDT além de coordenador da Fundação Leonel Brizola do triangulo mineiro. Neste ano coloco meu nome a disposição para disputar uma cadeira na câmara Municipal.\r\nDevido minha formação, meu histórico na luta em torno da pauta educacional e principalmente pela falta de interesse pela política da população, fiz um compromisso e arquivei em cartório para que os eleitores sintam-se empoderados. Nele afirmo que o cidadão tem o direito de cassar meu mandato, se não houver luta em defesa da redução das regalias dos políticos. Minha justificativa é totalmente política. As vezes se é investido em uma campanha mais do que se ganha em salários por todo um mandato, já parou pra pensar nisso?\r\nCaso seja eleito meu salário, que seria pouco mais de R$15 mil, não passará do Piso Nacional do Professor, R$ 2135,64 sendo doado a diferença, de forma direta, para projetos sociais de educação e cultura indicados não por mim, mas pelos conselhos de Juventude, Educação e Cultura de Uberlândia, pois defendo políticas públicas que são construídas pela sociedade civil.\r\nNo ano de 2011 em BH ,estava nas ruas ocupando com o povo barrando o aumento abusivo de 61% dos vereadores, e também no mesmo ano de 2011, tivemos 112 dias de greve na rede estadual de ensino em defesa do Piso Nacional. Esta ficou marcada para a história, violencia polícial e tudo mais. Neste ano o lema era: \"OU AUMENTA O SALÁRIO DO PROFESSOR, OU ABAIXA O DO VEREADOR\". Nós iremos atrás disso!\r\nREALMENTE QUERO BOTAR O DEDO NA FERIDA, sofremos um GOLPE no dia de ontem, nem mesmo meu partido, com a história toda que carrega, de ter sido apeado em 1964, votou pelo povo. Tenho convicções políticas muito definidas, e se lá nós chegarmos, este será um mandato popular, de luta e que se inspira não em um partido, mas na luta popular. Viva Brizola, Viva Darcy Ribeiro, Viva João Goulart. Chegando lá, nosso grande objetivo será defender uma escola justa, de tempo e formação integral a exemplo dos CIEPs e CAICs, pois só ela será capaz de dar perspectivas às próximas gerações!\r\nTenho um site (www.brunopickles.com.br) onde coloco minhas idéias e propostas. Peço que acessem e tomem conhecimento, e caso seja merecedor, compartilhe com seus familiares e conhecidos para fortalecer nossa campanha, que é feita de maneira colaborativa, sem cabos eleitorais pagos. Contamos apenas com materiais impressos que o partido nos garantiu.\r\nEstamos fazendo também um abaixo assinado pela redução de 50% dos salários de vereadores, secretários, prefeito e vice, para que independente do meu resultado das eleições, garantirmos que os eleitos discutam e votem a proposta na câmara. Com 25 mil assinaturas, os vereadores são obrigados a discutir a pauta. Entre em contato pelo facebook ou email (brunopickles12@gmail.com) para assinar e pegar lista para coletar assinaturas também!\r\nDesde já, agradeço pela sua atenção.\r\n#BrunoPickles12120','tiopickles@hotmail.com','1239805599420267'),(31126,'Vanderlei Coelho','BRANCA','MASCULINO','MASCULINO','1953-07-22','Sei,  que nada sei .!! ex isso e aquilo.','barebar356@yahoo.com.br','1342147169159250'),(31308,'Rafael Bruxellas','BRANCA','MASCULINO','MASCULINO','1993-09-08','Nascido em Franca em 1993, Bruxellas é\r\nmúsico violonista e estudante de educação física.\r\nFiliado ao PT desde os 16 anos, começou sua construção política enquanto estudante secundarista, participando da fundação e tendo sido eleito presidente do primeiro grêmio estudantil do  colégio.\r\nPosteriormente ingressou no cursso de educação física na UEL (Universidade Estadual de Londrina), aonde participou da atlética, de espaços de cultura e de políticas esportivas da cidade. Após esse período, iniciou uma viagem de bicicleta por diversos estados brasileiros para conhecer as culturas locais e as comunidades auto-sustentáveis das regiões percorridas. Ao retornar à Franca, trabalhando na primeira grande academia de escalada da cidade, participando de eventos e movimentos esportivos, culturais e estudantis, foi eleito Secretário da Juventude do PT de Franca no maior Congresso da JPT do Estado de São Paulo. De lá pra ca participou ativamente das ocupação contra a \"reorganização\" escolar nas escolas Suely Machado e Orlik Luz, trabalhou com projetos de musicalização para população de baixa rendae em diversos setores da área de educação física. E vem desde então construindo junto aos movimentos culturais da cidade, ao coletivo jovem da JPT, aos secundaristas que participarão das ocupações e aos setores de esporte, saúde e qualidade de vida um novo projeto para nossa cidade.  Com base nessas experiências e enxergando na realidade de franca atores políticos que não respresentam esses segmentos da sociedade, aceitou o desafio de candidatar-se para vereador de Franca.\r\nPor uma outra  política, por uma nova cidade','rafaelbruxellas@gmail.com','1141225169304839'),(32079,'Jair Lapa','BRANCA','MASCULINO','MASCULINO','1973-11-19','Nascido no sertão do Piauí passou muitas necessidade na infância, é radicalizado em Poá a mais de trinta anos, ainda na adolescência vendia pipoca no trem pra sobreviver....nos anos 90 vai para o Japão tentar uma nova vida ao voltar inicia a licenciatura em geografia,leciona em duas grandes escolas do município MAF e padre Simon, mais tarde ingressa no funcionalismo municipal na área do trânsito onde trabalha até hoje.','oprofessorjair@hotmail.com','1298976650136743'),(33277,'Odisséia Pinto de Carvalho','PARDA','FEMININO','FEMININO','1964-01-19','Sou Odisséia Carvalho, professora da rede pública, sindicalista, militante e ex vereadora.\r\nPretendo fazer um mandato com projetos de leis voltados para defesa da educação, da saúde, das mulheres, crianças e adolescentes; sempre em defendendo os direitos humanos. Campos merece um mandato verdadeiramente popular e participativo. Vou também fiscalizar as ações do futuro prefeito, um dos papéis fundamentais de um vereador.\r\n\r\n\r\n\r\n\r\n\r\n(a resposta sobre descriminalização está errada)','odisseiacarvalho13@gmail.com','1270930589618140'),(34208,'Pedro Mendonça','BRANCA','MASCULINO','MASCULINO','1997-02-19','Pedro Mendonça- Candidato a vereador pelo PSOL, estudante de Gestão de Políticas Públicas (USP) e integrante do coletivo Juventude por + Direitos.\r\n\r\nEssa campanha é construída coletivamente pelos integrantes da Juventude por + Direitos e do PSOL. Queremos construir uma alternativa política para que a Câmara dos Vereadores tenha um mandato independente dos coronéis e em profundo diálogo com a população. É preciso radicalizar a democracia em São Caetano do Sul.\r\nNão recebemos nenhum centavo de empresas e todo nossa mobilização é pela força na ideia de que um novo futuro é possível.\r\nPor isso, nos ajude! Curta nossas páginas, compartilhe as publicações e entre em contato para receber nossos materiais.\r\nEssa campanha é de todos e todas!\r\n\r\nCARTILHA DE PROPOSTAS;\r\nhttps://www.facebook.com/pedromendoncacb/posts/1777295335874441','pedroararas2@gmail.com','1197087753683281'),(34527,'Rita Di Cassia','PARDA','FEMININO','FEMININO','1977-05-22','\r\nOlá \r\nSou Escritora e contadora de histórias. Sou diretora de uma Ong que se chama Reinserir, onde promovo a cidadania através  de cursos de teatro, dança de rua, jazz. aula de instrumentos musicais, capoeira, apoio psicológico, tratamento da dependência química e informática. A Ong possui duas unidades, uma no céu azul e bairro Menezes( Justinópolis). \r\nTrabalho com projetos sociais desde 2003.  Vejo na politica uma forma de ampliar os atendimentos sociais da minha Ong e acredito na arte como forma de transformar a vida do individuo para melhor.','ritadicassia01@gmail.com','879392808858471'),(35258,'Cleber Schroeder','BRANCA','MASCULINO','MASCULINO','1983-01-28','Sou Cleber Schröeder graduado em Relações Públicas pela instituição Feevale.\r\nQuero ser vereador para prestar um serviço a população caiense, e não fazer da câmera de vereadores uma carreira política infinita.','Cleber_bc@hotmail.com','654226024746529'),(37182,'Elanir Santos','BRANCA','MASCULINO','MASCULINO','1976-11-17','Elanir Santos\r\nPaulistano, 39 anos, casado, terceira geração no bairro da Lapa, formado em economia pela PUC, pós-graduado em gestão de negócios, MBA pelo Insper e 20 anos de carreira no mercado financeiro. Fundou a própria empresa de investimentos em 2013 e sentiu na pele, a realidade de um sistema que é contra a livre iniciativa… Sempre buscou preservar os valores e a história de sua cidade, seu estado, seu país, um dos motivos que o levou a se tornar membro da Sociedade Veteranos de 32 – MMDC.\r\n\r\nPorque quer ser candidato\r\nAficionado por São Paulo, cresceu assistindo à degradação contínua da cidade, e seus cidadãos, cada vez mais reféns dessa realidade aterrorizante. Enquanto muitos fugiram do país, decidiu trabalhar pela cidade que sempre quis! Nunca foi político e isso é o que na atual conjuntura, mais o qualifica a iniciar esta jornada de reconstrução de uma São Paulo em ruínas.\r\n\r\nO que vai fazer\r\nLegislará ferrenhamente pela redução dos impostos e taxas municipais, baseado na premissa que os serviços estão sendo pagos pelo cidadão, mas não estão sendo entregues pelo poder público! Trabalhará pela preservação e valorização do patrimônio histórico paulistano, que atualmente está sendo destruído e tem apagado as raízes paulistanas da memória de todos! Defenderá um planejamento urbano mais coerente e sobretudo, mais alinhado aos interesse dos moradores de cada região da Cidade de São Paulo.','santos.elanir@gmail.com','10208726277807733'),(37844,'Conrado Machado','BRANCA','MASCULINO','MASCULINO','1988-09-01','Conrado Machado, 28 anos, psicólogo, natural de Londrina - PR\r\n\r\nAqueles mais próximos de mim sabem muito bem da minha posição política. Sou comunista e revolucionário, não acredito em mudança significativa através da via institucional da democracia burguesa, uma democracia na qual até mesmo o sistema de leis funciona para garantir o poder do Capital sobre o Estado e os trabalhadores. Apesar disso, advogo a favor da existência de partidos, pois é através dessas organizações (assim como de outros movimentos sociais) que nossas vozes podem se organizar, debater e realizar mudanças de consciência. Ainda que por essa via não seja possível realizar mudanças estruturais, a conscientização e o debate com os trabalhadores podem ser ampliados através de um mandato, e é através da união da classe trabalhadora que nasce a revolução.\r\n\r\nTendo em vista que a cidade de Londrina foi fundada sobre valores conservadores que perpetuam até os dias de hoje, a ponto de as últimas disputas municipais se resumirem entre um herdeiro do populismo e um latifundiário que não desvia dinheiro público mas esquece que nas periferias habitam seres humanos, faz-se extremamente necessário um debate a respeito do direito à cidade. A quem a cidade deve servir, e a quem a cidade serve atualmente? E quais são os mecanismos que proporcionam essa dinâmica atual? Através dessa e de outras pautas que serão posteriormente abordadas, gostaria de anunciar publicamente a minha candidatura à vereança da cidade de Londrina pelo Partido Socialismo e Liberdade (PSOL). Sinto-me honrado em compor uma chapa formada por militantes excelentes e ativos, com os quais construo e debato cotidianamente, e também por fazer parte da Frente de Esquerda com os companheiros e companheiras do PSTU e do PCB.\r\n\r\nLondrina ainda é a cidade do político branco e rico trajado em ternos feitos sob medida, a cidade da política construída dentro dos gabinetes e dos jantares privados, a cidade comandada pela elite e para a elite. É a cidade na qual pelo menos 20 cidadãos da periferia, em sua maioria negros, são baleados na calada da noite enquanto se estabelece informalmente um “toque de recolher”. É a cidade que formou e elegeu dois governadores famosos por espancar professores da rede pública em plena luz do dia. E é esse quadro, já tão antigo e consolidado, que estamos dispostos a enfrentar. Vamos propor mandatos, no legislativo e no executivo, com a intenção de dar voz àqueles que têm seus direitos mais básicos relativizados e negociados diariamente. Vamos trabalhar para a maioria, que é a classe trabalhadora explorada pela tradicional elite do estado do Paraná. E é isso que os incomoda tanto. Sendo assim, apesar de repudiar os ataques, eles não nos desanimam, pois vêm daqueles que pretendemos combater. A classe trabalhadora, a classe estudantil, os negros, os LGBT, as mulheres e os excluídos terão voz e participação ativa nos nossos mandatos. A elite vai se retratar e pagar o que deve à sociedade. Londrina vai ser nossa, vai ser dos trabalhadores.','conradohenrique@gmail.com','10210580905418573'),(38874,'Deividy Carlos','PARDA','MASCULINO','MASCULINO','1992-05-19','Meu nome é Deividy Carlos, sou professor, filho da Dona Vanilma e do Sr. Gilmar, noivo da Lilia, defensor dos direitos humanos e da democracia. \r\n\r\nEssa é a segunda eleição que disputo.\r\n\r\nAcredito na necessidade de termos uma representatividade de fato vinda do povo.\r\nMe coloco à disposição da sociedade maceioense pra ser a voz da juventude na câmara de vereadores. ','deividycarlos@hotmail.com','1081824585227337'),(40159,'Henrique César Silva','BRANCA','MASCULINO','MASCULINO','1984-04-28','Professor da rede pública municipal de Osasco desde o ano de 2004, militante político de esquerda desde os movimentos de juventude, militante dos movimentos trabalhistas com atuação em sindicatos e atualmente Diretor da APOS - Associação dos Professores de Osasco e Região, além disso atua no mercado imobiliário como corretor com um pequeno escritório na região do Pestana.\r\nAcredita na política como propulsora das mudanças necessárias na sociedade. Se opõe à ideia de que a política é algo ruim e que não deve ser discutida. Ao contrário, defende que numa sociedade civilizada os avanços necessariamente ocorrem pela política, porém esta deve ter a participação popular e representar a verdadeira cidadania. O poder deve ser do povo e deve servir à sociedade. Por isso convida toda sociedade para fazer um diálogo em torno das causas sociais e populares, contra a homofobia, contra a xenofobia, contra o racismo, contra a misoginia e o machismo, pela inclusão social de todas as minorias.\r\nNa Câmara municipal pretende defender essas bandeiras e lutar por Educação de qualidade, melhorias no sistema educacional e nos salários dos profissionais desta área, bem como de todos os serviços públicos e seus servidores.\r\nÉ hora de renovação de verdade em nossa Câmara, o melhor voto de protesto não é aquele dado para candidatos que não representam nada, e sim para candidatos que podem efetivamente defender a sociedade, assumir compromissos e fazer a diferença com Ética e muita disposição.\r\nFacebook: https://www.facebook.com/ProfessorHenriqueCesar/ ; e http://www.facebook.com/ProfHenriqueCesarVereador \r\nWhatsapp: 94745-7643','hcesar84@bol.com.br','1105501649487424'),(40817,'Rosana Branquinho','BRANCA','FEMININO','FEMININO','1963-02-25','Eu sou Rosana Branquinho, candidata a Vereadora e gostaria de me apresentar a você.\r\n\r\nMeus pais se mudaram para Franca quando eu tinha 8 anos. Viemos de Pedregulho, onde meu pai sempre teve uma atuação forte na política. Hoje percebo que além dos valores morais e éticos, ele me deixou como herança essa vocação.\r\n\r\nMorei na Av. Brasil e Rua São Paulo na infância e adolescência, e na Rua Goiás, onde passei a minha juventude e de onde saí para constituir a minha família. Há 16 anos resido na Rua Ceará, no Jardim Bueno.\r\n\r\nSou de família humilde, honesta e que me ensinou que o trabalho enobrece e dignifica. Acredito nisso, porque minha carteira de trabalho foi assinada pela primeira vez, quando eu tinha 14 anos de idade, pela Rádio Difusora de Franca. Atuei em diversos veículos de comunicação, como: TV Record, Bandeirantes, Nova TV e atualmente apresento um programa na TV Franca, canal 23 da Net.  Como jornalista, sempre tive um olhar mais humano e ao mesmo tempo crítico em relação às políticas de nossa cidade. \r\n\r\nCom dificuldade e muita luta, cursei duas faculdades e hoje faço Mestrado em Desenvolvimento Regional no Uni-FACEF.\r\n\r\nMovida pelo senso de justiça e igualdade aceitei o convite para concorrer como vereadora nas próximas eleições.\r\n\r\nPenso que podemos construir juntos melhores condições de vida para toda a comunidade. Penso também que é papel do vereador ir aonde o povo está e descobrir quais são as necessidades e o que deve ser feito. É assim que pretendo trabalhar: De portas abertas para ouvir as reivindicações da comunidade e indo ao encontro de seus interesses.\r\n\r\nPor isso, venho até você para pedir o seu voto e dizer que terei muito prazer em representá-los na Câmara Municipal.\r\n\r\n“A mulher tem força e poder de transformar a realidade a sua volta”.\r\nRosana Branquinho','robranquinho@hotmail.com','1352905168070396'),(43608,'Pedro Loss','BRANCA','MASCULINO','MASCULINO','1974-04-08','Minha caminhada não começa nesta campanha eleitoral. O compromisso que estou assumindo publicamente vem de longa data, pautado na vida cotidiana, baseado no direito à cidade. Sou ativista das causas sociais, ambientais e culturais, bancário concursado, formado em Administração, pós-graduado em Ética e Educação em Direitos Humanos (Ufrgs). Nasci e vivo em Porto Alegre, filho do Pedro, contador, e da Lucy, professora estadual. Sou uma pessoa com deficiência auditiva, assim como meu pai e meu irmão, e superei a barreira da comunicação no dia a dia de uma sociedade excludente. Aos cinco anos, para assistir desenhos animados, ficava com os ouvidos bem próximos da televisão. Professores e professoras tinham dificuldades para perceber a minha condição, não entendiam, por exemplo, o quanto era importante o contato visual comigo e davam aula de costas para mim. Indicavam que eu fosse para uma escola específica para crianças surdas. Porém, essa escola não era acessível para a minha família, e eu tive que superar essa dificuldade. Meu irmão, também deficiente auditivo, e eu ganhamos acesso, através de sorteio, a vagas no Colégio de Aplicação. Inquieto e comunicativo, cresci nos finais de semana da Redenção, na efervescência cultural do Bom Fim, dos carnavais de rua, da cidade ocupada pelas mais diversas culturas, com brique, Hare Krishnas convocando para banquetes na Tomaz Flores, música do Carlito e do Urgaretti em frente ao arco. O simpático bigodudo Olívio Dutra convocava as pessoas para ter coragem de mudar. A ditadura havia caído, a cidade fervia de cultura. Já adolescente, conheci as tardes do Escaler, a noite boêmia do Bom Fim, o Ocidente, o Garagem. Aprendi a valorizar não só o aspecto humano da cidade, mas também o meio ambiente. Minha família era sócia da Cooperativa Ecológica Coolmeia, umas das experiências ambientais mais exitosas do país. Aprendi que a alimentação é também um ato político, e a questionar por que comida industrializada era tão mais barata e chamativa. No início dos anos 90, a vivência política de Porto Alegre me mostrou que só existe democracia com participação popular. Cursei a faculdade de Administração da Unisinos, com ênfase em comércio exterior. Esse meu interesse influenciou também no ativismo – fui co-fundador e primeiro diretor do Instituto de Justiça Fiscal e ajudei a fundar o núcleo gaúcho da Attac, associação que quer reverter aos cidadãos os impostos sobre transações financeiras. Em 1999, essa entidade foi uma das organizadoras do primeiro Fórum Social Mundial. O mundo conhecia a experiência democrática e cidadã de Porto Alegre, e eu conhecia a Sigrid, minha esposa, parceira e companheira de lutas e ativismo. Estamos juntos há 15 anos. Em 2004, passei em um concurso e entrei no Banco do Brasil. Dentro desta empresa, passei a trabalhar pelos direitos das pessoas com deficiência. Virei diretor da Apabb – Associação de Pais e Amigos de Pessoas com Deficiência do Banco do Brasil e da Comunidade. Em 2008, assumi a direção do Sindicato dos Bancários, ficando até 2014 – ano em que concluí minha especialização em “Ética e Educação em Direitos Humanos na Ufrgs”. Também presidi o Comitê de Cidadania do BB, responsável por ações sociais nas periferias da cidade. Já sabia, naquela época, que a política ia muito além das eleições. Integrante de ONGs e associações ambientais e ligadas à acessibilidade e às pessoas com deficiência, percebi a necessidade de ocupar ruas, praças e parques por meio da realização de movimentos sociais e culturais independentes. Foi assim que, em 2012, surgiu a Serenata Iluminada, fruto de uma mobilização via Internet a qual me somei e colaborei na organização desde então. A ideia deu tão certo que passei a movimentar novas ações para as pessoas se apropriarem da cidade e do meio onde vivem, como os Piqueniques Noturnos, os Piqueniques Culturais no Museu e a Caminhada Iluminada por mais Segurança Cidadã. Também em 2012, fui candidato a vereador de Porto Alegre pela primeira vez, com a pauta “Recicle a Política”. Fiz 1.619 votos, com uma das menores campanhas. Fui membro do Conselho Nacional das Pessoas com Deficiência (Conade), de 2013 a 2015. Integro ainda o projeto Porto Alegre Mais Limpa e Verde, tendo me unido à instalação, em 2012, da primeira Ecobarreira da cidade, impedindo que a sujeira do Arroio Dilúvio chegasse ao Guaíba. Defendo o direito de todo cidadão e toda cidadã de usufruírem dos espaços públicos com igualdade de direitos. Amo Porto Alegre. Quero ajudar a Capital a desenvolver ainda mais a sua cidadania, a ser mais acessível, responsável, sustentável, construindo políticas públicas para as pessoas que mais precisam delas. Quero construir com você uma Porto Alegre mais cidadã. Uma Porto Alegre viva! Vamos juntos? #?PoaViva13400','pedrolosspoa@gmail.com','173656446372618'),(43723,'Canha Rodrigues','BRANCA','MASCULINO','MASCULINO','1956-08-06','Moro em Canoas há 52 anos, sou empresário, casado há 36 anos, possuo 3 filhos, 4 netos.\r\nFaço parte da militância do PTB há 12 anos, e com a vontade de fazer mudanças pela cidade que tanto amo, resolvi me candidatar a vereador.\r\nConheço bastante a cidade, e sei que do jeito que ela está é uma ofensa a todos os canoenses. A nossa cidade tem todas as condições de estar melhor, mais segura, com a educação mais valorizada, a saúde mais com mais investimentos, dentre diversas áreas.\r\nE saturado de tantos políticos corruptos, que se aproveitam da nossa cidade para benefícios próprios, deixando os canoenses de lado.\r\n\r\n \"Uma pessoa que podemos seguir e confiar!\"\r\n\r\n\r\n','rodrigues.canha@gmail.com','1047891731994062'),(44749,'Fabiano Elias','BRANCA','MASCULINO','MASCULINO','1968-09-11','Presidente de Grêmio Estudantil\r\nFundador e Presidente de Cineclube\r\nRotaryano\r\nAdvogado militante formado em 1993\r\nProfessor Universitário nos cursos de Administração, Sistemas de Informação e Direito\r\nCoordenador do Núcleo de Prática Jurídica do Curso de Direito\r\nCoordenador do Curso de Direito\r\nSecretário Municipal de Segurança\r\nControlador Geral do Município\r\nPresidente da Fundação Municipal de Esportes\r\nVice-Prefeito\r\nPrefeito em Exercício\r\n\r\n','fabianovelias@gmail.com','1243559958999630'),(45238,'Alexsandro Vilela','PARDA','MASCULINO','MASCULINO','1982-05-06','Alexsandro Vilela 34 anos Solteiro tenho 1 filho de 9 anos acompanho política em desde dos 14 anos e estou me colocando a disposição da população paraisense voltada para o bem estar e a renovação de verdade da nossa cidade com justiça e igualdade para todos. Já fui Guarda Mirim de Ipatinga trabalhei em várias cidades e Estados do Brasil tenho o ensino médio completo. Iniciei o técnico mas por ter que trabalhar fora do estado tive que abandonar. E tem projetos de oferecer cursos profissionalizantes para os jovens e adolescentes. Para que consigam adquirir experiência para ingressar no mercado de trabalho. ','alexvilela72@gmail.com','1323192977714228'),(47390,'Vitor Porto Fonseca Gonçalves','BRANCA','MASCULINO','MASCULINO','1991-07-03','Sou Vitor Porto, jovem, cristão e advogado, bastante determinado, comprometido e não abro mão dos meus valores e princípios. Um legado que herdei! Acredito que a cidade é uma grande família que precisa ser ouvida, para ser mais entendida, e atendida.\r\n----\r\n*Porque ser vereador?*\r\nPorque assim como você, estou cansado de uma política que não muda. A política precisa ser exercida com AMOR e RESPEITO, já que o eleito representa a sociedade que o escolheu.\r\n----\r\n*E, por que escolher um vereador jovem?*\r\nPorque é tempo de mudança, renovação, é tempo de acreditar em ideias e ideais diferentes, podemos fazer a diferença! Juntos podemos construir a cidade que queremos.\r\n---\r\n\r\nEstou à disposição para ouví-los.\r\n#VamosEmFrente #14.123 #VitorPortocomvocês ','vitorportofg@gmail.com','1489700437710455'),(47867,'Rafael Adam','BRANCA','MASCULINO','MASCULINO','1994-03-28','Sou o Rafinha, tenho 22 anos, marido da Endi, pai do Joaquim e da Giovanna. Gramadense, colorado e sonhador. Candidato a vereador em Gramado!','rafinhacolorado@hotmail.com','1115448271854104'),(48272,'Ingryd Fraga','BRANCA','FEMININO','FEMININO','1997-06-19','Ingryd Fraga é mulher, tem 19 anos e cursa Gestão Pública para o Desenvolvimento Econômico e Social na UFRJ. Iniciou sua militância a partir do PSOL Nilópolis em 2014, após conhecer a luta dos militantes locais. As especificidades das mulheres periféricas tornou-se uma das pautas prioritárias em sua atuação política.\r\n\r\nAtualmente, Ingryd está secretária de combate às opressões no PSOL Nilópolis e constrói a plataforma de cidade “Por Uma Nilópolis Nossa”. Sua candidatura à vereança no município traça a luta da mulheres, da joventude e dos LGBTs. ','fragaingryd@gmail.com','1196383090418924'),(48373,'Henrique Vieira','PRETA','MASCULINO','MASCULINO','1987-04-15','Henrique Vieira tem 29 anos e é professor, historiador, cientista social, teólogo, pastor, ator e está vereador de Niterói pelo PSOL. É militante de direitos humanos e participa de movimentos sociais na cidade desde a adolescência. Eleito em sua primeira candidatura, em 2012, tem enfrentado os interesses dos empresários de ônibus e das grandes construtoras e lutado ao lado dos trabalhadores da educação e da saúde, estudantes, pescadores, marisqueiras, garis, desabrigados, bombeiros, guardas municipais, ciclistas, mulheres, LGBTs, negro(a)s, ambientalistas. Atua em defesa do Estado Laico, contra todas as formas de preconceito e intolerância e por uma Niterói que combata privilégios e garanta direitos.','hrkvieira@gmail.com','1022291741217105'),(48883,'Helio Ramos de Oliveira','BRANCA','MASCULINO','MASCULINO','1967-08-01','Professor, Biólogo, pós graduado em Direito Ambiental, Mestrando em Gestão  Auditorias Ambientais e Poeta.\r\nCom um olhar voltado para os valores da humanidade, primo pelo bem comum, para então vivermos em uma sociedade solidária, possuo como virtudes a crença no convívio entre as pessoas e para com o planeta.\r\nQuero promover as mudanças de atitudes e das praticas humanas, em prol da melhoria do ser humano para com seus semelhantes, em sintonia com o meio ambiente e do planeta, oferecendo meu trabalho e dedicação na busca de soluções.\r\nAcredito na igualdade do ser humano e nas atitudes de convivência nas diferenças.','biohelioramos@hotmail.com','1190780340943774'),(49155,'Tom Santos','BRANCA','MASCULINO','MASCULINO','1984-10-20','Professor de História com pós-graduação em Juventude no Mundo Contemporâneo.\r\nAtuei como militante de Pastoral da Juventude sendo coordenador em diversos níveis, desde o grupo de base até a coordenação estadual e como militante da Pastoral da Juventude contribuiu diretamente na formulação de políticas públicas para a população jovem de todo o país dentro dos processos de conferências de 2008 e 2011. \r\nEntre 2011 e 2013 fui presidente do Conselho Municipal do Jovem (COMJOV), coordenando os trabalhos propositivos de políticas públicas para juventude em Sorocaba. Contribui em diversas articulações de Movimentos Sociais e Culturais e atualmente contribuo com as Comunidades Eclesiais de Base (Cebs) e com a Secretaria de Formação do Partido dos Trabalhadores de Sorocaba.\r\n','tom.juv13@gmail.com','10202147694411996'),(49187,'Francisco Athayde','BRANCA','MASCULINO','MASCULINO','1982-08-03','Sou educador humanitário e há mais de 8 anos realizo aulas de campo, palestras e projetos em locais  como escolas e faculdades. Mais de 20 mil alunos já aprenderam sobre respeito, ética, compaixão, direitos humanos, direitos animais, veganismo, alimentação vegetariana, vida simples, consumo consciente, meditação, yoga, parto humanizado, permacultura, meio ambiente, educação política entre outros temas da educação humanitária. Ativista pela vida. Sou também documentarista de vegano há 8 anos. Salvador/Bahia.\r\n','educacao.humanitaria@yahoo.com.br','571823629670489'),(49261,'Ivair Santos','BRANCA','MASCULINO','MASCULINO','1969-10-08','Casado, 46 anos, pai de três filhos, um neto.\r\nConcursado  na Prefeitura de Suzano há 8 anos como auxiliar administrativo.\r\nIngressou na política pois acredita que a cidade precisa de renovação com pessoas capacitadas e que estejam comprometidas realmente em resolver os problemas.\r\nSuas principais propostas são voltadas  para  a melhoraria da qualidade e eficiência dos serviços públicos.','ivairfsantos@yahoo.com.br ','163151177468279'),(49531,'Vitorino Baseggio','BRANCA','MASCULINO','MASCULINO','1967-11-29','Sou Vitorino Baseggio. Fui agricultor: trabalhei na agricultura familiar até 1985; ex-sindicalista: trabalhei como bancário por dezoito anos, período em que fui delegado sindical e diretor do sindicato dos bancários; Professor: atuo como voluntário no projeto Mais Educação desde 2008 como oficineiro de Informática, História e Letramento e professor de curso pré-vestibular popular. \r\nHistoriador, graduado pela Universidade Federal do Rio Grande do Sul e Faculdades Porto Alegrense; Técnico em informática, atuando desde 2008 e graduando em análise e desenvolvimento de sistemas pelo IFRS.\r\n\r\nSou ferrenho defensor da educação, carrego como bandeira a escola de turno integral. Além da questão educação-cultura, tenho como prioridade a defesa e a busca de um relacionamento mais estreito entre o poder público e a PERIFERIA da cidade, de forma que haja um olhar especial às demandas sociais, em especial as mais emergenciais como: creches, escolas, saneamento básico, calçamento, segurança e investimentos em habitação popular, ações tão necessárias a esta grande e esquecida parcela do povo porto alegrense. \r\nComo morador do Bairro Restinga, conheço sua história, e sinto na pele o abandono do poder público e a luta desse povo por uma vida digna. \r\n\r\nSÓ A EDUCAÇÃO CONSCIENTIZA E LIBERTA!\r\n#ProfessorVitorino #18888 #RedeSustentabilidade','vbaseggio@bol.com.br','1069095739878029'),(49592,'Ana Luiza Liborio','BRANCA','FEMININO','FEMININO','1959-07-06','Arquiteta urbanista, sergipana, especialista em restauro e planejamento urbano, responsável por diversas obras de grande porte em Aracaju e interior do estado dediquei grande parte da minha vida profissional ao ativismo político e estudos sobre Aracaju.','analib@ibest.com.br','1258516857500864'),(49685,'Nadilza Guilherme','BRANCA','FEMININO','FEMININO','1968-10-21','Mãe de 8 filhos sendo 7 meninas, decidi entrar na política para ser a representar das necessidades femininas. Já que as mulheres ainda são as maiores vítimas de violência e assédios além de sofrerem muitos preconceitos na nossa sociedade.','nadilzaleon@gmail.com','664948870321385'),(50024,'Fabio Pando','BRANCA','MASCULINO','MASCULINO','1965-05-23','Empresário, administrador de empresas, professor há quase 30 anos dos cursos de MBA e Pós graduação em uma importante universidade de São Paulo. \r\nFoi executivo de empresas líderes em diferentes segmentos da economia, como indústria, varejo, serviços e financeiro.\r\nCoach executivo e membro da ICF - International Coach Federation.','fabio.pando@gmail.com','702455193245244'),(50070,'Zé Renato de Viamão','BRANCA','MASCULINO','MASCULINO','1956-01-27','Defender políticas públicas pela inclusão social, defesa dos animais, idosos. Por políticas públicas relacionadas à saúde da infância e idosos.','jorerocas@terra.com.br','10208791845207308'),(50467,'Nilo Mandelli','BRANCA','MASCULINO','MASCULINO','1967-10-23','Sou especialista em cirurgia vascular e atuo na área há 25 anos. Atualmente\r\ntrabalho na Prefeitura de Porto Alegre, mas também já trabalhei na Santa Casa de\r\nPorto Alegre e em diversos outros locais.\r\nÉ deficiente físico há 48 anos, vivo realidade do desrespeito a acessibilidade, a\r\nfalta de respeito da saúde no brasil, luta por melhoras das regiões, só você e seus\r\nvizinhos podem saber o que pode ser bom e não uma pessoa que nem participa.\r\nPropostas\r\nŸ Defender o respeito ao deficiente físico.\r\nŸ Defender a educação como primórdio dos nossos filhos, pois quem valoriza\r\nprofessor valoriza seu filho.\r\nŸ Saúde: Organizar o sistema e facilitar a prevenção evitando mutilamento da\r\npopulação.\r\nŸ Valorizar os profissionais da saúde, pois deles depende um bom atendimento.\r\nŸ Lutar para termos a população na rua e não encerrados em suas casas por\r\nfalta de policiamento.\r\nŸ Luta pela reforma com mudanças drásticas no judiciário. Não se pode\r\ndemorar 10 anos para um processo terminar. Isto facilita ao culpado de não\r\npagar pelo seu erro.\r\nŸ Equiparar os salários dos funcionários, evitando que somente o Legislativo\r\nseja privilegiado.\r\nŸ Lutar para que o Legislativo tenha aumento igual aos funcionários e não\r\nlegislar pelos seus salários.\r\nŸ Convidar a população a participar da administração pública, visando a\r\nmelhora nos mecanismos de controle sem relação direta com a\r\nadministração.','ncbm@outlook.com','10202181251448253'),(50523,'Pedro Victer','BRANCA','MASCULINO','MASCULINO','1977-09-30','Vereador em Belo Horizonte, foi presidente da comissão de direitos humanos e da comissão de participação popular da CMBH. Teve uma atuação a favor das minorias.','pedropvicter@gmail.com','1728980967369293'),(50655,'Éverton Gonçalves Lima','PARDA','MASCULINO','MASCULINO','1986-02-12','www.goncalveslima33.com.br','everton.g.lima@gmail.com','893518217450697'),(50993,'Francieli Teixeira','BRANCA','FEMININO','FEMININO','1995-07-01','Participo do movimento estudantil desde 2011, quando fui presidenta do Grêmio do Colégio Fagundes dos Reis, onde aprendi a importância da participação e representatividade. Em 2013 participei da direção da União Gaúcha de Estudantes Secundaristas - UGES, como secretária de mulheres. Em 2014 conselheira municipal do Conselho dos Direitos da Mulher. Contribui com a Coordenadoria de Juventude de minha cidade até julho deste ano, quando me afastei para concorrer.','francieliteixeira65@gmail.com','983923901717109'),(51136,'Larissa Vianna Neveu','PRETA','FEMININO','FEMININO','1989-01-25','Sou mulher, negra, feminista, LGBT e estudante de Serviço Social, da Universidade Federal de Santa Catarina. Filiada ao PSOL há três anos. Militante da Juventude Socialismo e Liberdade. E duas vezes candidata. Em 2014, candidata a deputada federal (401 votos). Hoje, candidata a vereadora. É urgente e necessário mulheres na política. E eu não sou só mais uma, estou na luta para fazer diferente. Tenho vontade política para mudar. Afinal, outra Florianópolis é possível. \r\nEstou ao lado das negras e negros, das mulheres, da juventude, da população LGBT, dos trabalhadores e dos desempregados. Estou ao lado do povo oprimido. Defendo a igualdade sem ressalva. \r\nAs políticas pra educação não podem deixar ninguém de fora. Pra isso, é preciso votar em candidatas e candidatos que vão lutar pra que as escolas discutam questões de gênero e sexualidade. Isso vai servir pra combater não só o preconceito contra LGBTs, mas também a violência contra mulheres e outras formas de opressão. \r\nResistimos e existimos. Sem as mulheres não há revolução!','larissaneveu@gmail.com','10154453149365185'),(51154,'Carmem Reyes','BRANCA','FEMININO','FEMININO','1955-09-10','CANSEI!!!!!!!!!!\r\nA CADA 4 ANOS APARECEM UM MONTE DE CANDIDATOS, AJUDAMOS A ELEGE-LOS E NO ENTANTO NA SUA GRANDE MAIORIA ESTÃO PARA NADA COM OS MUNÍCIPES.\r\nCARROS DE SOM INFERNIZANDO QUEM TRABALHA À NOITE OU ATRAPALHANDO OS DESCANSO DE PESSOAS DOENTES OU TRABALHANDO, CARREATAS  QUE ENTOPEM AS CIDADES DE TRANSITO E PAPEIS SUJANDO AS CIDADES. PARA MIM CHEGA!!!! SE QUISER VER BEM FEITO FAÇA VC MESMO.\r\nSOU FARMACÊUTICA INDUSTRIAL, PÓS GRADUADA EM SAÚDE PUBLICA E GESTÃO INTEGRADA DA QUALIDADE,\r\nQUERO SER ELEITA A VEREADORA AOS MEUS 61 ANOS,EM LAURO DE FREITAS PARA FAZER DIFERENTE MESMO, NUNCA TIVE E HOJE MENOS AINDA  NÃO TENHO TEMPO DE BRINCAR EM FAZER.\r\nASSINEI O TERMO DE COMPROMISSO NO CONSELHO DE CIDADÃOS DA OAB COM O COMPROMISSO COM A VERDADE E A TRANSPARÊNCIA.\r\nPARA COMEÇAR VOU DESTINAR 50% DO MEU SALÁRIO DE VEREADORA PARA ONGS E ASSOCIAÇÕES LAUROFREITENCE.\r\nQUERO FAZER AS INDICAÇÕES DA CRIAÇÃO DE PARQUES LINEARES AS MARGENS DOS NOSSOS RIOS,  COM A REDUÇÃO DE DANOS , APERFEIÇOANDO O TRATAMENTO DAS AGUAS DE ESCOO PARA DENTRO DOS RIOS, PRECISAMOS DA NOSSA PRAIA LIMPA,\r\nATENÇÃO ESPECIAL AOS ANIMAIS E ZOONOSE MUNICIPAL,\r\nVIABILIDADE DO PASSE LIVRE PARA ESTUDANTES,\r\nFOMENTOS DE POLITICAS PUBLICAS MUNICIPAL DE MORADIA,\r\nIMPLANTAÇÃO DA COLETA SELETIVA ,\r\nREQUALIFICAÇÃO, REEQUIPAÇÃO DO AGRUPAMENTO DE SALVA VIDAS,\r\nPOLITICAS QUE FOMENTEM EMPREGO E RENDA PARA OS JOVENS E MULHERES,\r\nESPAÇO PARA RECREAÇÃO DE IDOSOS,\r\nPOLITICAS MUNICIPAIS PARA REMANESCENTE QUILOMBOLAS E INDÍGENAS,\r\nPRECISAMOS DE UMA CIDADE MELHOR PARA VIVER, MORAR E AMAR.\r\nBUSCANDO A HARMONIA E RESPEITO ENTRE TODOS OS SERES  VIVOS.\r\nEU APAREÇO COM BICHO, MAS AMO E TRABALHO DE VERDADE PELOS BICHOS, NÃO SOU COMO MUITOS QUE APARECEM BONITOS OU BONITAS NA FOTO E DEPOIS DO DIA 02/10/16 MALTRATAM ATÉ OS DELES.\r\nOBRIGADA PELA OPORTUNIDADE E DESDE JÁ PELO SEU VOTO.','carmemreyes@hotmail.com','10205270464280804'),(51325,'Bruno D\'Almeida','PARDA','MASCULINO','MASCULINO','1975-09-17','Professor, escritor, cineasta e militante de movimentos sociais. Na luta para construir um mandato popular centralizado pelos trabalhadores.','linguaportuguesa@hotmail.com','10208455881489231'),(51624,'Marcos Mendes','PARDA','MASCULINO','MASCULINO','1965-02-28','GEÓLOGO, BANCÁRIO DA CAIXA, ESPECIALISTA EM GESTÃO PÚBLICA MUNICIPAL E GOVERNAMENTAL, ESPECIALISTA COMO PROFISSIONAL DE MEIO AMBIENTE, MESTRE EM GEOLOGIA AMBIENTAL, PROFESSOR UNIVERSITÁRIO, COORDENADOR DO INSTITUTO BÚZIOS, COORDENADOR DO CAMPO ÉTNICO E POPULAR.','sednem@terra.com.br','10205564141861460'),(51746,'Ari Areia','PARDA','MASCULINO','MASCULINO','1991-03-24','Meu nome é Ari Areia, 25 anos, nasci no Pirambu, moro em Messejana, sou ator e jornalista formado pela UFC. \r\nMe lanço candidato a vereador de Fortaleza com a meta de ocupar a Câmara com nossas vozes, artistas, mulheres, LGBTs, mulheres, estudantes, trabalhadores, negros e jovens. Vozes que a política tem silenciado.\r\n\r\nEsse espaço de discussão e de lutas precisa ser ocupado e modificado por nós. O legislativo precisa ter a nossa cara, a cara da cidade, não a cara dos engravatados políticos de tradição. Vamos ocupar juntos?','ariareia@gmail.com','1174675775945061'),(51779,'Renan Amaral','PARDA','MASCULINO','MASCULINO','1989-02-12','Sou  um  jovem  pai  de  família,  que  como  muitos  cidadãos  de  Belém,  sente  a  necessidade de  melhorar  nossa  cidade  para  a  população  como  um  todo,  pois,  sinto  na  pele  as dificuldades  e  injustiças  a  que  estão  expostos  os  habitantes  de  Belém.  Tenho  27  anos, nasci  no  Amapá,  cresci  na  cidade  de  Laranjal  do  Jari/AP,  vendo  meus  pais  se envolverem  com  a  vida  pública  lutando  por  melhores  condições  de  vida  para  aquela localidade,  logo,  nasci    e  cresci  dentro  de  um  ambito  politico  e  desde  minha  infância  a política  me  inspira  como  ferramenta  de  mudança  e  melhoria  da  vida  das  pessoas  e  da sociedade,  na  adolescência  já  em  Belém,  fui  convidado  inumeras  vezes  para  participar de  eventos  políticos  fato  que  despertou  dentro  de  mim  o  sonho  de  um  dia  poder ingressar  na  Câmara  Municipal  e  representando  a  população  da  minha  cidade  poder ajudar  a  melhorar  a  vida  e  o  convivio  dos  munícipes  e,  hoje,  ao  assumir  o  desafio  de  ser candidato  a  vereador  de  Belém  vejo  essa  missão    como  a  oportunidade  de  lutar  pelo  que acredito,  olhando  para  o  presente  e  buscando  um  futuro  de  oportunidades  como  quem sonha  com  dias  melhores. ','Dn.renanamaral23@gmail.com','1096504897123490'),(51965,'Fabiana Ferreira II','BRANCA','FEMININO','FEMININO','1975-03-21','Sou natural de Itajaí, tenho 41 anos, cresci e morei no loteamento Bambuzal até 2008, hoje sou moradora do bairro Barra do Rio.\r\nGraduei-me em medicina pela Universidade Federal de Santa Cataria, fiz residência médica em Saúde da Família em 2001 na cidade de Joinville, e especialização pela Escola Nacional de Saúde Publica em São Paulo em 2006, na área de saúde publica e saúde da família, hoje curso o 6º período do curso de Direito na Univali.\r\nSou médica de família há 17 anos, fui professora do curso de Medicina na Univali por 12 anos. Como médica do Município de Itajaí, trabalhei em diversas comunidades, entre elas: Promorar II, Dom Bosco, São João, Imaruí, Canhanduba, Murta, Bambuzal e também atuo no Pronto Atendimento São Vicente.\r\n\r\n\r\n','vempraurnaitajai@gmail.com','186593671774877'),(52129,'Pedro Cabral Filho','PRETA','MASCULINO','MASCULINO','1960-07-03','Nascido em Florianópolis, no bairro Trindade, sempre como professor e diretor da Escola Básica Municipal Beatriz de Souza Brito no bairro Pantanal, participou ativamente na construção de uma escola pública de qualidade e acreditou na educação. Graduado em Artes pela UDESC, fez Mestrado na UFSC e Doutorado na USP. Tem atuação no movimento do canto coral da cidade e na cena cultural de Florianópolis. ','pecabral@uol.com.br','1206525662703160'),(52289,'Aparecida Pereira Damasceno','BRANCA','FEMININO','FEMININO','1966-02-12','Sou moradora de Contagem há 43 anos,Cidinha do Bar,sou formada em Pedagogia e técnica em Contabilidade.Sou voluntária em serviços sociais.Atuei como feirante na área de alimentos e também artesã.Fundadora e presidente do projeto Todos em defesa das mulheres,que tem por objetivo o combate à violência,concientização,assistência jurídica e informações às mulheres sobre seus direitos.Também quero trazer mais médicos para a cidade,investindo no atendimento humanizado em casa e instalar mais câmeras de Olho Vivo em pontos estratégicos,principalemte próximo as travessas,.','aparecidap@ymail.com','1262746200455792'),(52483,'Juscelino V. Mendes','PRETA','MASCULINO','MASCULINO','1954-02-04','Advogado empresarial e professor universitário da graduação e pós-graduação em Direito; mestre em Filosofia pela PUCC e especialista em Filosofia pela Unicamp; graduado pelo Haggai Institute, Mauí, Havaí, EUA em liderança avançada e aperfeiçoamento em Direito Tributário Penal pela Universidade de Paris, Sorbonne. Experiência em abertura de filiais de empresa transnacional nas cidades de Córdoba e Mendoza, Argentina, e Santiago, Chile. Casado, três filhos.','drjuscelinovmendes@outlook.com','10206872927077546'),(53206,'Marcio de Colombo','BRANCA','MASCULINO','MASCULINO','1979-08-13','Sou professor de Geografia da rede estadual, represento a APP SINDICATO no município de Colombo,  leciono nos colégios Helena Kolody e Genésio Moreschi.','marcio.dealmeidaramos@gmail.com ','1286943401318198'),(53280,'Amara Moira','BRANCA','MASCULINO','MASCULINO','1985-02-26','Amara Moira é travesti, prostituta, doutoranda em teoria literária pela Unicamp, feminista e militante dos direitos de LGBTs e de profissionais do sexo. Ela integra a Associação Mulheres Guerreiras (profissionais do sexo), o Grupo Identidade (LGTB) e o Coletivo TransTornar, primeiro coletivo trans de uma universidade brasileira, todos sediados em Campinas. Além disso, é a autora do livro polêmico recém publicado \"E Se Eu Fosse Puta\" (hoo editora), em que escreve das suas experiências como profissional do sexo de uma perspectiva feminista ao mesmo tempo que literária, explicitando as vivências e violências que enfrenta quem exerça esse trabalho numa sociedade tão absurdamente machista.','amoiramara@gmail.com','1775173322770384'),(54656,'Anita Ramos','BRANCA','FEMININO','FEMININO','1970-02-10','Comecei militando no Movimento Estudantil aos 14 anos no ano de 1984, me formei no Magistério  e posteriormente em Ciências Sociais e sou especialista em Gestão de Políticas Públicas.\r\nMinha atuação profissional além da sala de aula se deu em temas de muita relevância social mas com pouca visibilidade como a questão das mulheres do ponto de vista de políticas públicas e o Direito à Cidade,  dos catadores de papel no centro da cidade de São Paulo no inícios dos anos 1990, do Orçamento Participativo e atualmente atuo com rede de pequenos empreendimentos de Economia Solidária em Rio Grande da Serra.\r\n','anita.sramos@gmail.com','1290125740999784'),(54709,'Laércio Zancan','BRANCA','MASCULINO','MASCULINO','1988-09-27','','laerciozancan@yahoo.com.br','1268668173172894'),(55389,'Northon Dias','PARDA','MASCULINO','MASCULINO','1995-04-28','Northon Dias Sores. 21 Anos.\r\nUniversitário, estudante de DIREITO pelas Faculdades Kennedy.\r\nNascido e criado na região de Venda Nova - BH.\r\nDe família militar, perdi meu pai com 11 anos, desde então me vi no dever de amadurecer e se tornar o homem da casa.\r\n\r\nDesde os 16 anos atuando em meio a política, trabalhei e auxiliei diversos políticos, sendo, de forma indireta, um porta voz da juventude.\r\nSendo assim, em 2014 tomei a frente da Iniciativa jovem , ganhando assim maior efetividade em reger pelos interesses da sociedade.\r\n\r\nEm 2015 recebi o convite para que deixasse de ser um representante indireto da Juventude e regesse pelos maiores interesses, não somente de um grupo específico, mas da sociedade em geral.\r\n\r\nO problema que enfrentamos com nossos projetos, assim como demais projetos não financiados, é a falta de efetividade junto aos nossos representantes, com essa eventual candidatura, passamos de ser um representante indireto para sermos mais efetivos com nossas ideologias.\r\nDe forma bem resumida, nosso #ProjetoNovoRumo tem a como base a EDUCAÇÃO, a qual, considero ser o pilar de toda a sociedade. Além disso O nosso dever, também é atrair o jovem para a política, para que assim, possamos fazer as mudanças acontecerem, afinal, a sociedade não se interessa por política, e o problema do país é exatamente esse, pois a sociedade é leiga e não rege por seus interesses, por consequências, nossos governantes, os que retém tal conhecimento, são tidos na sociedade como SOBERANOS, fato o qual não deveria ocorrer, pois são meros SERVIDORES PUBLICOS e que de acordo com o exposto no caput do Art. 1° da Constituição de 88, somos uma forma DEMOCRATICA de Direito, sendo o POVO soberano. Tem muitas pessoas que acompanham essa minha linha de raciocínio, e implementa algo do tipo : \"O problema é a corrupção!\". Concordo fatalmente ! mas uma coisa é mais certa ainda, não existe Governantes honestos em sociedade corrupta, como da mesma forma não existe sociedade honesta e governantes corruptos.\r\n\r\nA mudança tem que ser em conjunto, e com total certeza, nos, Do Projeto Novo Rumo, contamos com seu apoio e colaboração, para que assim possamos reger por uma sociedade mais justa!\r\n \r\n#ProjetoNovoRumo #11999 #NãoReeleja #RENOVAÇÃO\r\n','northon.dias@hotmail.com','1116203165153824'),(55447,'Eqp Marília Arraes','BRANCA','FEMININO','FEMININO','1984-04-12','Marília Valença Rocha Arraes de Alencar nasceu em 12 de abril de 1984, no Recife-PE, e cresceu em um ambiente de intensa atividade política. Neta do ex-governador Miguel Arraes, pôde conviver com a realidade do povo de Pernambuco e do Recife. Seu principal aprendizado foi defender os mais necessitados, movida pelo ideal de transformação da sociedade, sempre participando das movimentações e campanhas políticas ao lado do avô.\r\nFiliou-se ao PSB em 2005, partido que foi presidido por Arraes. Marília sempre teve um trabalho ativo, militando em diversas campanhas socialistas. Em 2007, formou-se em direito pela Universidade Federal de Pernambuco. Durante o curso, engajou-se no movimento estudantil, debatendo gênero e a pluralidade de direitos, além de trabalhar em projetos de melhorias para conservação do patrimônio da universidade.\r\n\r\nAos 24 anos, elegeu-se vereadora do Recife com 9.533 votos, sendo a parlamentar mais nova na 15ª legislatura. Durante o biênio 2009/2010, atuou atuou como presidente da Comissão de Políticas Públicas da Juventude. Em 2011, tornou-se a primeira mulher a presidir a Comissão de Legislação e Justiça. Em 2012, reelegeu-se vereadora com 8.841 votos. Logo após as eleições, assumiu a Secretaria Municipal de Juventude e Qualificação Profissional.\r\nMarília voltou à Câmara Municipal do Recife em abril de 2014. Mas, devido à guinada à direita do partido, renunciou à candidatura de deputada federal. Também denunciou interferência da cúpula do PSB na juventude do partido. Em julho do mesmo ano, Marília anunciou o apoio à candidatura do senador Armando Monteiro ao governo do Estado de Pernambuco, à do ex-prefeito do Recife João Paulo ao Senado, e também à candidatura da reeleição à Presidência da República de Dilma Rousseff.\r\n\r\nDiscordando veeementemente das ações conduzidas pela cúpula do partido na Prefeitura do Recife e no governo do Estado, em especial após a morte do ex- governador Eduardo Campos, em agosto de 2014, Marília começa a fazer uma forte oposição dentro do seu mandato, na Câmara Municipal. Em fevereiro de 2016, oficializou sua desfiliação do PSB, justificando falta de democracia interna, além da mudança das convicções e ideologias.\r\nApós duras críticas ao PSB, Marília ingressa no Partido dos Trabalhadores. A vereadora teve sua ficha de filiação abonada pelo ex-presidente Luiz Inácio Lula da Silva, durante a festa dos 36 anos do PT, no Rio de Janeiro. O ato de filiação aconteceu no dia 3 de março de 2016, na Câmara dos Vereadores do Recife.','equipemarraes@gmail.com','1682483115412874'),(55667,'Renatão Do Quilombo','PRETA','MASCULINO','MASCULINO','1967-06-08','José Renato da Costa Bonfim, o Renatão do Quilombo, nasceu em 1967 e se criou no bairro do Engenho do Mato, em Niterói, onde hoje preside a Associação da Comunidade Tradicional do Engenho do Mato (ACOTEM). É remanescente de quilombo e exerce importante liderança na Comunidade do Quilombo do Grotão, localizado na Serra da Tiririca. Sua família vive há quase um século no local, onde teve papel fundamental na luta que originou a primeira reforma agrária do Brasil, na década de 1960, no município de Niterói. Conhecido como defensor do Meio Ambiente e dos Direitos das Comunidades locais, Renatão do Quilombo tem importante papel na defesa do Parque Estadual da Serra da Tiririca (PESET). Logo após a Eco 92, ajudou a fundar a Associação dos Sitiantes Tradicionais da Serra da Tiririca (ASSET), primeira entidade representativa da comunidade local que até hoje cumpre importante papel no Fórum das Comunidades Tradicionais. \r\n\r\nÀ frente do Quilombo do Grotão, resgatou costumes e tradições da região como: a deliciosa feijoada na lenha, a Roda de Capoeira, o Jongo, as rodas de Samba de Raiz e a religiosidade de matriz afro-brasileira ressurgiram na comunidade. Neste sentido, foram realizadas importantes iniciativas de defesa da Cultura e do Meio Ambiente. Inúmeras pesquisas da Universidade Federal Fluminense (UFF), da Universidade Estadual do Rio de Janeiro (UERJ) e da Universidade Federal do Rio de Janeiro (UFRJ), mostram a importância deste resgate feito pelo Quilombo do Grotão. Renatão do Quilombo obteve 1.013 votos para vereador em 2012 e tornou-se 1º Suplente do PSOL Niterói, com uma campanha ficha limpa, pautada pela ética e por princípios socialistas, sem aceitar doação de empresas e sem contar com cabos eleitorais pagos, acreditando que política não pode ser vista como emprego ou moeda de troca. Desta forma, sua campanha foi construída nas ruas, junto a estudantes e trabalhadores.\r\n\r\nPela primeira vez, uma cadeira na Câmara Municipal foi ocupada a fim de resgatar as bandeiras históricas dos movimentos sociais, ouvindo às diversas lutas dos trabalhadores da cidade. Em Niterói, município dominado por empresários que defendem seus próprios interesses, é fundamental termos vereadores com esse histórico de resistência e compromisso na defesa dos direitos da população.\r\n\r\n Diante de sua importante atuação no parlamento, onde apresentou 13 Projetos de Lei, conseguindo aprovar 04 deles, conseguindo impulsionar na cidade as lutas populares, o PSOL indicou Renatão em 2014 para ser candidato a Vice-Governador na chapa com Tarcísio Motta. Juntos eles obtiveram mais de 700 mil votos no estado e mais de 50 mil só em Niterói. Em nossa cidade a chapa de Tarcísio e Renatão ficou em segundo lugar na disputa para o Governo do Estado. Esta foi uma experiência muito importante, que levou Renatão a conhecer outras comunidades em todo o estado e ampliar seus horizontes para buscar as melhorias que Niterói precisa.  \r\n\r\n Hoje, Renatão do Quilombo, segue com ainda mais firmeza e convicção atuando nas mais diversas lutas para a construção de uma outra história para Niterói. Com mais um mandato, efetivamente de quatro anos na Câmara, Renatão seguirá agindo sempre com firmeza e coerência representando diretamente a população da cidade no parlamento.\r\n\r\n Em uma Niterói dominada pelos empresários que defendem seus próprios interesses, é fundamental elegermos vereadores com histórico de resistência e compromisso na defesa dos direitos da maioria da população. Renatão é de luta, é PSOL, é Mudança de Verdade! Vamos juntos!','renataodoquilombo@gmail.com','793441447464776'),(56048,'Lai Pereira','BRANCA','FEMININO','FEMININO','1976-10-12','Lai Pereira trabalha há 20 anos nos setores de cultura e alimentação, como produtora e gestora. Formou-se em Design de Produto e é MBA em Gestão de Negócios. Morou 3 anos na Itália, onde se aprofundou na importância da alimentação na defesa da cultura e identidade de um povo. Desde que retornou a Curitiba, é militante pela defesa dos Direitos Humanos à Alimentação Adequada, pela Cultura Alimentar e pela Sustentabilidade, fazendo parte dos Grupos de Trabalho Rede ODS Brasil, da ONU. É Coordenadora do Conselho da Cultura Alimentar e Titular do Conselho Nacional de Políticas Culturais – Patrimônio Imaterial – do MinC.','laibpereira@gmail.com','1057409151045268'),(56171,'Lurdes Ágata Guiconi','BRANCA','FEMININO','FEMININO','1959-06-24','Lurdes Ágata Guiconi é candidata a vereadora de Porto Alegre pelo PSB na coligação NÃO VAMOS DESISTIR DO BRASIL.\r\nCarinhosamente conhecida como Lurdes da Lomba devido sua atuação junto a comunidade onde reside há 30 anos, teve participação importante em diversas conquistas para a região como o Posto de Saúde 24h, a construção do Ginásio de Esportes da Parada 10 e a instalação do CEITEC no bairro. Lurdes sempre esteve na linha de frente da luta por melhorias e construção de projetos que transformem a partir da realidade local. Criou  e coordenou o grupo ECO, atual Mãos Unidas, formado por mulheres donas de casa que produzem materiais de limpeza e reciclagem. Atualmente faz parte da coordenação da Horta da Lomba do Pinheiro, projeto que conta com a colaboração de diversas instituições e visa contribuir com o meio ambiente, o desenvolvimento sustentável, a saúde e a qualidade de vida.','lurdesdalomba@yahoo.com.br','891563804307238'),(56756,'Leticia Moreira','BRANCA','FEMININO','FEMININO','1994-10-22','Sou estudante de história na UNIRITTER, Conselheira Municipal de Educação e da Coordenação Nacional da Juventude Pátria Livre. Fui presidente da União Gaúcha dos Estudantes - UGES e da UMESPA, também integrei o Conselho de Desenvolvimento Econômico e Social do Estado do Rio Grande do Sul - CDES/RS.\r\nNatural de Porto Alegre, comecei a militância aos 15 anos. Organizei passeatas e atos em defesa da Educação Pública de qualidade, em defesa da Petrobrás, pelo Passe Livre, luta pela meia entrada, por novas eleições e contra a corrupção.','leticiauges@gmail.com','1171665682896404'),(56789,'Cézare Pastorello','BRANCA','MASCULINO','MASCULINO','1976-02-19','Olá! Sou Cézare PASTORELLO, estou em Cáceres há 10 anos. Não foi aqui onde eu nasci, mas, é aqui onde vou passar o resto da minha vida!\r\nSou servidor público federal concursado, da Justiça do Trabalho, casado com a Suyane e pai de 7 filhos. Sempre participei de clubes de serviços e conselhos comunitários, mas, nunca pensei em me candidatar.\r\nPorém, quando as pessoas de bem não ocupam o espaço político, deixam o espaço para quem?\r\n\r\n`Para que o mal triunfe, basta\r\nque os bons não façam nada!\r\n\r\nEssa frase, atribuída ao historiador Edmund Burke, sempre me ajudou a interpretar os fatos sociais.\r\nMovido por essa responsabilidade é que assumi o ônus de sair da minha zona de conforto e encarar as mazelas de uma política nada bela.\r\nUma política nova, propositiva e construtiva é a vontade minha e de muitas pessoas. Neste folder estão apenas os tópicos dos planos de trabalho. Acesse nossa página e veja na totalidade.\r\nSe você também tem vontade de mudança política, venha!','cpastorello@hotmail.com','10210564683776928'),(57025,'Adriano Medeiros','PARDA','MASCULINO','MASCULINO','1990-11-22','Olá, Caxienses!\r\n\r\nSou Adriano Medeiros, candidato a vereador em Caxias pela primeira vez representando a juventude! Fato inédito, pois Caxias terá um candidato a vereador específico da juventude! \r\nSou filho do Caxiense José Medeiros Correia e da Paraibana Maria de Fátima Santos Medeiros e integrante de uma das maiores famílias de Caxias, a família Medeiros. \r\nNatural de Brasília-DF, nascido no dia 22 de novembro de 1990, atualmente estou com 25 anos, vim para Caxias, muito cedo, e aprendi a amar essa terra, exemplo maior que hoje quero lutar por cada cidadão de nossa cidade, em especial a cada jovem!\r\nMuitos de vocês já me conhecem pela TV, através de propagandas, de eventos e em programas culturais de nossa cidade. Agora é a vez de conhecer o Adriano Político!\r\nVim para Caxias, aos 08 anos de idade devido a uma doença que tinha, (Artrite Reumática Juvenil) uma doença que me deixava acamado com fortes dores musculares. Quem me vê hoje não imagina o que já passei. Sinto que tenho uma eterna dívida com essa cidade, pois aqui tive minha filha e tenho a boa parte de minha família e amigos os quais tenho orgulho de dizer que são muitos! \r\n\r\nSou formado em Jornalismo pelo Instituto Brasileiro de Estatística, Cultura, Educação e Comunicação- IBECEC, Acadêmico de Ciência políticas e Administração Pública pela Universidade Estadual de São Paulo- USP/EAD, e ainda curso Direito. Exerço o cargo de presidente da Associação de Moradores do Residencial Vila Paraíso, Presidente do Movimento Nacional Jovens Pela Mudança - MJM e Conselheiro Estadual de Juventude.\r\n\r\n Comecei minha vida política bem cedo. Em 2001, fui eleito presidente de turma na escola Inácio Passarinho e logo em seguida, em 2002, presidente do Grêmio Estudantil os Balaios. Já em 2004, fui convidado para integrar a antiga União dos Estudantes Secundaristas de Caxias- UMES. Em  2006, fui um dos fundadores do famoso grupo de articulação política o G7, que buscava dar oportunidades aos jovens na capital São Luís. Participei e coordenei o Seminário de Direitos Humanos e o projeto Juventude em Ação que teve atuação em mais de 12 municípios no Maranhão e trabalhei também como parte da coordenação local do programa “Viva meu primeiro emprego” em Caxias, Pro - Jovem Urbano (2008) e no Ciclo de Palestras com o tema protagonismo juvenil de minha autoria (2012)\r\n\r\n\r\n Já em 2014, fundei o movimento Pro-Arte, que tinha uma visão de cultura urbana em ruas e avenidas de Caxias (Teatro e Dança).  No mesmo ano, consegui articular junto com as principais entidades de representação de juventude no estado do Maranhão, a ONG MJM que também fundei, uma entidade responsável em trabalhar com Teatro, Dança e auxiliar aos jovens de Caxias nos estudos, através do pré-vestibular Social e dos cursos profissionalizantes, projeto que funciona atualmente no antigo prédio da União Artística Operária Caxiense, que já conta com parte da reforma que fizemos no prédio antigo.\r\n \r\nNão gosto de ficar parado, e com todo esse trabalho, recebi o reconhecimento do Ministério da Cultura de Brasília com o Prêmio de Ordem ao Mérito, com a indicação de reconhecimento de nossas atividades em Caxias, e o Prêmio Amigos da Igualdade pela Acessibilidade, do partido Igualdade pelo apoio ao projeto de inclusão de deficientes físicos no Maranhão.\r\n\r\nAjudei ainda, na criação de duas leis federais, a primeira que vai liberar passagens gratuitas de ônibus para jovens que queiram viajar e o segundo projeto é o ensino da constituição federal nas escolas municipais, estaduais e federais.\r\n\r\nE agora, quero ser vereador para continuar lutando pela juventude de  nossa cidade, dando oportunidade a cada um, assim como recebi. Por isso, assumi ao convite do Partido da Mobilização Nacional- PMN o dever de ser candidato a vereador em Caxias no ano de 2016. Portanto, peço o seu voto! Vote diferente. Vote pela juventude Vote em Adriano Medeiros 33010 e para prefeito Léo Coutinho 40, no dia 02 de outubro. Vamos à luta, juventude!\r\n\r\nObrigado a todos!\r\n \r\nAdriano Medeiros\r\n','adrianomedeirosm@hotmail.com','1281015748607767'),(57271,'Carla Barone','BRANCA','FEMININO','FEMININO','1959-02-17','Empreendedora indignada com a política!\r\nPorto-alegrense, 57 anos, Farmacêutica-Bioquímica pela UFRGS, dois filhos. \r\nConheci o Projeto do NOVO, de longo prazo, de cidadãos de fora deste sistema viciado e pela primeira vez filiei-me a um partido político. \r\nQuero fazer uma representação austera na Câmara em Porto Alegre, começando por rejeitar privilégios absurdos e assim mostrar pelo exemplo que política não combina com dinheiro. Chega!\r\nConheço muito bem a dificuldade dos empreendedores, muita burocracia e regulamentação, precisamos diminuir impostos para criação de novos postos de trabalho.\r\nEducação e Cultura precisam de atenção especial!\r\nSegurança URGENTE! \r\nObrigada, Carla Barone\r\n','carlacoutobarone@gmail.com','958517094295022'),(57290,'Márcia Sá Motta','PARDA','FEMININO','FEMININO','1976-04-06','Meu nome é Márcia Sá Motta, tenho 40 anos, sou casada, mãe de 4 filhos e trabalho com gestão imobiliária. Nunca me arrisquei na política por acreditar que a realidade era muito distante dos meus ideias. Mas surgiu a oportunidade de entrar e penso que se não nos envolvermos de fato as coisas não vão passar a ser do jeito que gostaríamos. Acredito que o crescimento sustentável é possível, que uma cidade que preserva seus recursos naturais, que planeja e viabiliza empreendimentos sustentáveis também valoriza a vida. Acredito também que é possível ocupar o espaço urbano gerando renda através de hortas urbanas, e que mais do que isto é possível que estas famílias produzam alimentos limpos.\r\nCreio que é possível revitalizar nossos cursos d\'agua. Dar mais atenção ao tratamento de esgoto e ao tratamento do lixo.\r\nPlanejamento e infra-estrutura  já!  Chega de crescimento desordenado!','marciasamotta@hotmail.com','10205836506791881'),(57765,'Loreny Caetano Roberto','BRANCA','FEMININO','FEMININO','1991-07-11','Sou taubateana, tenho 25 anos, estudei nas escolas públicas municipais da cidade, uso a saúde pública, cresci no bairro do Cecap e hoje resido no centro, graduei em Gestão de Políticas Públicas na USP e me especializei em Controle da Gestão Pública Municipal na UFSC. Formei em ballet clássico na escola municipal de artes da cidade, sou catequista na Paróquia Santa Luzia. Trabalhei como estagiária no legislativo municipal, fui gestora da política pública de inclusão digital do estado de SP e assessora do Dep Federal Roberto Freire e da Senadora Rose de Freitas. Tenho uma empresa de consultoria em fortalecimento de cidades, a Planus do Brasil e, iniciei minha participação política mais consciente em 2011 em movimentos sociais de combate à corrupção em Taubaté. Desde então participo das audiências públicas sobre o orçamento, principalmente, forma que acredito tem o poder de nos levar à uma sociedade mais justa, participativa, democrática e que trará melhorias à qualidade de vida de todas e todos. Luto também por transparência e procedimentos claros e por politização e cidadania.      ','loreny.mcr@gmail.com','1141302022606200'),(57962,'Ludimilla Alves Fagundes','BRANCA','FEMININO','FEMININO','1992-06-23','Em 2009, foi presidente do Grêmio do Julinho e ficou conhecida na luta pelo \"Fora Yeda\". Foi responsável pela aproximação do grêmio estudantil da sua escola com o CPERS/Sindicato.\r\nNeste mesmo ano filiou-se ao PSOL, época em que conheceu a Construção Socialista (CS) - corrente interna do partido - organização na qual milita desde então.\r\nEm 2010, já na UFRGS, ajudou a organizar o movimento de oposição à direção do DCE, então dirigido por um grupo identificado ideologicamente com a direita (Marcel Van Hattem).\r\nDe 2011 a 2013 foi integrante do DCE da UFRGS e do CABAM - Centro Acadêmico da Biblioteconomia, Arquivologia e Museologia. Concluiu o curso de Museologia em 2013.\r\nPela relação da sua corrente política com o CPERS, seguiu lutando pela unidade  do movimento universitário e dos secundaristas. Foi assim que teve participação ativa nas mobilizações contra o Ensino Politécnico (projeto educacional imposto no Governo Tarso (PT).\r\nNas Jornadas de Junho, em 2013, fez parte do Bloco de Lutas pelo Transporte Público e participou intensamente deste momento histórico da juventude de Porto Alegre.\r\nFilha de pais separados, desde muito cedo precisou trabalhar, foi babá aos 14 anos e bolsista na Universidade. A partir de 2014 foi trabalhar como estagiária de pedagogia na Escola de Educação Infantil Brincar e Aprender, que atende os filhos das trabalhadoras e dos trabalhadores da Santa Casa.\r\nEste último trabalho foi decisivo para que Ludimilla definisse sua profissão. Voltou para a Universidade e atualmente está cursando Pedagogia. Aprovada no concurso para funcionária de escola no Estado, espera ser nomeada e defender que o CPERS chame os concursados para organizar a luta pelas nomeações.','ludimilla.fagundes@gmail.com','1122562714500365'),(57991,'Julio Ribeiro II','BRANCA','MASCULINO','MASCULINO','1967-04-09','Professor Julio Ribeiro, 49 anos, iniciou sua trajetória política no movimento estudantil. Formado em Ciências Sociais, pós-graduado em Filosofia e Economia Política pela PUCRS e Sociologia Jurídica e Direitos Humanos pela UNISINOS e atualmente mestrando em Ciências Sociais. \r\n\r\nComo candidato a vereador, acredito na boa política, feita para as pessoas e pensando nas pessoas. Quero ser a voz daqueles que lutam diariamente para construir uma Canoas melhor, mais humana, mais inclusiva, mais acolhedora, com justiça social e livre de todas as formas de opressão e preconceito. \r\n\r\nVem com a gente! Sou Professor Julio Ribeiro, 65650! ','profjulio.ribeiro@gmail.com ','1768727276700962'),(58515,'Adriano Bueno','PRETA','MASCULINO','MASCULINO','1977-07-13','Casado com Cibele Rodrigues, tenho 4 filhas. Comecei minha militância no hip hop, cantando rap. Milito no movimento negro também e na cultura popular. Sou trabalhador da cultura na Biblioteca de Sousas. Defendo o direito à cidade e à cultura, por acreditar que somos seres humanos e não apenas força de trabalho e consumo. Defendo uma Lei de Fomento às Culturas da Periferia. Sou ativista contra o genocídio da juventude negra e contra o racismo institucional praticado pela polícia.','adrianobueno.ae@gmail.com','10206681642388930'),(58569,'Efraim Costa','PARDA','MASCULINO','MASCULINO','1993-04-29','Aos 23 anos, Efraim Costa é morador do bairro da Compensa. Estudante de Engenharia Mecânica no IFAM, onde é militante do movimento estudantil e membro do Conselho Superior (CONSUP). É secretário escolar e atua na área da educação há 4 anos.','efraimlima.t@hotmail.com','1357499617613320'),(58617,'Alexandro Velho','BRANCA','MASCULINO','MASCULINO','1979-10-20','Nasci em outubro de 79 no hospital Bethesda em PIrabeiraba. Cresci em Joinville, minha infância foi toda no bairro Rio Bonito. Quando criança, meu pai ainda garçom, trabalhava em turnos alterados e pouco ficava em casa, minha mãe cuidava de minha irmã e eu, e ali comecei a aprender sobre o trabalho. Ela do lar e artesã, realizava trabalhos para outras pessoas e lembro de ainda criança ajudá-la a montar abajur de madeira e outros itens.\r\nTive uma infância muito feliz, morávamos próximo aos postos de combustíveis em frente ao Canela, e sempre que possível nosso campinho de barro para chutar uma bola, juntávamos todos os vizinhos e fazíamos a festa.\r\nEstudei até meu ensino médio em escolas públicas, em 86 comecei a estudar no Guilherme Züege onde fiquei até a oitava série, fiz muitos amigos, e em 87 meu pai e minha mãe iniciaram na jornada de Empreendedores, iniciando o Mercado Pereira, já nesta época ia para a escola, e fazia amigos na região.\r\nMesmo com pais Donos de comércio, nossa vida sempre foi muito simples, até brinco com amigos, que fiquei muito alto (1,95cm alt) por conta de tanto iogurte vencido que tomava :D\r\nTerminei meu ensino médio em 93, e fatídicamente no início de 94 meu pai o Seu Juca veio falecer. Ele sempre motivado a fazer o bem na comunidade, nunca fechou os olhos para os que estavam ao seu redor.\r\nCom a perda dele, minha Mãe a Dona Darci, continuou com o comércio, porém, depois de diversas dificuldades acabou fechando as portas e alugando o espaço.\r\nComecei a trabalhar com a pessoa que alugou o comercio, e aos 14 anos, estudava na época no Olavo Bilac, onde me formei técnico em contabilidade, e trabalhava durante o dia.\r\nSempre me dediquei a tentar buscar o melhor para mim e para todos que estavam ao meu redor, sempre busquei tentar fazer as coisas sem precisar pedir algo aos outros, e ai também reside uma de minhas dificuldades, pois em diversos momentos precisamos de ajuda e isto só se aprende no decorrer da vida.\r\nDepois desta passagem como entregador, boy, empacotador, açougueiro no comércio que hora foi nosso e agora era de outra pessoa, fui buscar espaço fora.\r\nAi trabalhei como jardineiro (por 3 dias somente, não aguentei), fui chapa(para quem não conhece, é o famoso carregador) no ceasa, posteriormente motorista entregador de hortifruti, e almoxarife.\r\nDe almoxarife a comprador, fiz parte de minha carreira.\r\nPorém em 2003 ao buscar mudar o rumo da carreira, finalizando o primeiro ano da faculdade, sim, comecei ela tarde, até então além de não ter recursos, não tinha definição sobre o que seria de minha carreira, me acidentei. Acidente este que deu um 180º em minha vida, tornei-me deficiente, e parece que nada muda, quando se olha de fora, mas para quem é, muda tudo.\r\nVocê tem receio de como será visto, para quem eu busquei emprego, não era visto mais como profissional, e sim como PCD, e foram longos anos, tentando buscar meu lugar ao sol. Tornei-me paratleta, joguei em diversos campeonatos, estaduais, regionais, e nacionais, tendo participado inclusive da primeira divisão do nacional, jogando contra os melhores do pais.\r\nLongos por que foram 8 anos até que participei de uma entrevista que me trataram novamente como Pessoa e não como deficiente.\r\nDeste período até hoje, tenho atuado em defesa dos direitos da pessoa com deficiência, criança e adolescente.\r\nNão vejo deméritos, e sim, presentes.\r\nA vida me deu um presente que na época eu não via direito.\r\nHoje tenho a sensação de que posso dar retorno positivo a sociedade e posso sim, ajudar aos que estão ao meu redor com diversas ações que possibilitam a melhoria da vida de outras pessoas me satisfaço com isto.\r\nFalo a todos, AMO o que faço e ainda recebo por isto. Não existe no mundo melhor sensação que a do dever cumprido.\r\nPorém, sei que todas as ações que realizo, ainda são poucas, preciso fazer mais e contribuir ainda mais ao longo de minha vida.\r\nE diante disto, e em conversas com vários amigos, a resposta deles e uma em especial me motivou ainda mais a me colocar a disposição na vida pública.\r\nUm destes incentivos foi: \"Olha Velho, nós já realizamos um grande trabalho com essa juventude, e você além da juventude com as pessoas com deficiência, porém, para tentarmos ampliar nosso trabalho, só poderemos fazer isso se conseguirmos entrar diretamente na política. Sei que você é uma pessoa jovem e de princípios, e quer fazer a diferença, quer ser diferente. Vai fundo que estamos com você!\"\r\nE é nisto que acredito, ser vereador nos abre as possibilidades de trabalhar por quem não tem voz, nem vez. Quero atuar, fiscalizar e legislar para que as políticas públicas que hoje existem, sejam cumpridas e implementadas em nossa cidade.\r\nQuero fazer diferente.\r\nQuero fazer a diferença.\r\nQuero Inovar.','alexpvelho@hotmail.com','303832826650365'),(58738,'Lidia Kamiyama','BRANCA','FEMININO','FEMININO','1984-11-15','Lidia Kamiyama\r\nNatural de Taubaté, casada, mãe de três filhos, empresária. Sonho em trabalhar para a nossa cidade pois acredito na renovação social das nossas crianças e jovens, através da educação e cultura. Com certeza farei tudo para ajudar o seu bairro e melhorar a sua qualidade de vida.\r\n\r\nPorque decidi ser candidata à vereadora? \r\nA nossa cidade necessita de mudança! E de representantes que defendam e acompanhem os interesses da população, se comprometam com a democracia e realmente fazem acontecer! E eu sou alguém que acredita que possa melhorar a vida das outras pessoas! Acredito firmemente na renovação política da nossa amada cidade, para juntos, andarmos lado a lado com o progresso.','lidialopesribeiro@gmail.com','1075331135896912'),(58795,'ProfAlex Fraga','BRANCA','MASCULINO','MASCULINO','1976-09-26','Professor de Biologia, vereador, fundador do Emancipa Cursinho Popular Pré-Universitário, militante da causa da educação e da sustentabilidade.','profalexfraga@gmail.com','10207167388963426'),(59723,'Mariana Pahim Hyppolito','BRANCA','FEMININO','FEMININO','1991-07-05','Mari tem 25 anos. Estudante e trabalhadora,\r\niniciou na política em 2010 no movimento estudantil e\r\nparticipou da primeira greve ao lado dos trabalhadores da universidade em 2011. Lutadora pelos direitos das mulheres trabalhadoras, das LGBTs e da juventude, agora apresenta uma candidatura para ser vereadora em Porto Alegre que está e estará na linha de frente da defesa dos direitos dos trabalhadores da nossa cidade. ','marianahypp@live.com','1125017524213256'),(60091,'André Abreu','BRANCA','MASCULINO','MASCULINO','1986-08-23','Sou ANDRÉ ABREU, advogado e candidato a Vereador pela primeira vez em minha cidade (Dionísio/MG). Dionísio precisa de representantes políticos que identifiquem as necessidades da população, da cidade, e trabalhem sempre por melhorias. Sabemos que criar leis para município pequeno como o nosso não é tarefa fácil. Por isso jamais devemos prometer o que não poderemos cumprir. Devemos ter compromisso e manter os pés no chão. Sabemos que o orçamento é menor comparado com outras cidades, mas isso não impede de sermos honestos, dignos e sinceros com o eleitor que confia em nós, candidatos, o seu voto. Não posso deixar de dizer que é importante a participação ativa da população na vida politica da cidade.','andreabreu.advogado@gmail.com','1410998135596300'),(60254,'Alisson Julio','BRANCA','MASCULINO','MASCULINO','1988-05-17','Meu nome é Alisson Endi Julio, tenho 28 anos, nasci e sempre morei em Joinville, sou apaixonado por esta cidade e pelo JEC. Tenho Amiotrofia Muscular Espinhal, uma doença genética degenerativa que atinge músculos e ossos. Devido a isso utilizo de cadeira de rodas para me locomover.\r\nMini Currículo:\r\nFrequentei todo o jardim de infância e ensino fundamental em escola municipal.\r\nNo ensino médio consegui bolsa de estudos num colégio particular.\r\nEm 2006 ingressei na UDESC, universidade estadual, no cursos de Tecnologia em Sistemas de Informação.\r\nConcluí o MBA em Gestão Empresarial na FGV em 2012.\r\nTrabalho há 10 anos na maior empresa de sistemas do Brasil, com atendimento, consultoria e manutenção de softwares de gestão empresarial.\r\nSou palestrante nos temas de resiliência, superação, motivação e inclusão de Pessoas Com Deficiência nos meios social e profissional.\r\nFalo inglês e espanhol.\r\nPorquê quero ser vereador?\r\nAs dificuldades de mobilidade e acessibilidade que enfrento diariamente, a crise na saúde e segurança, o sucateamento da educação e o cenário de abandono urbano provocados por uma crise política generalizada são os principais motivos que me levam a concorrer a uma vaga na câmara de vereadores.\r\nAcredito que a política deva ser ocupada por pessoas boas, profissionais e qualificadas. Acredito que não há vereador de uma causa só, ou vereador de um bairro só. Acredito que um vereador deva legislar para todas as boas causas e demandas da população, deva defender todos os bairros do município.\r\n','alisson.endi@gmail.com','1099695070106757'),(60421,'Paulo Eduardo Gomes','BRANCA','MASCULINO','MASCULINO','1950-10-24','Paulo Eduardo nasceu em 1950. Ainda jovem foi professor de física do Liceu Nilo Peçanha onde também estudou. Engenheiro formado pela Universidade Federal Fluminense – UFF, trabalhou 26 anos na Embratel e presidiu por três mandatos, de 1984 a 1990, a Associação de Empregados – AEBT/RJ que ajudou a fundar. Neste período, Paulo Eduardo foi atuante na organização de sua categoria.\r\nDiretor de Pesquisa e Tecnologia do Sindicato dos Telefônicos do Rio de Janeiro – SINTTEL/RJ – de 1990 a 1992 e Secretário Geral da Federação Interestadual dos Trabalhadores em Telecomunicações – FITTEL – até 1993, teve importante papel na formulação de políticas públicas e democráticas de telecomunicações e comunicação social defendidas por sua categoria junto à Assembléia Nacional Constituinte de 1986. Representando os profissionais de engenharia, participou do Conselho Regional de Engenharia e Arquitetura (CREA).\r\nEm 1996, Paulo Eduardo foi, pela primeira vez, candidato a Prefeito de Niterói pelo PT. O segundo lugar obtido expressou a vontade de mais de 29 mil eleitores que se opunham à administração populista do PDT de Jorge Roberto Silveira na cidade.\r\nEm 2000, aceitou a tarefa de representar a unidade da esquerda petista em Niterói para recuperar o mandato perdido com a morte do saudoso e combativo vereador João Batista Petersen. Paulo Eduardo foi eleito vereador pela primeira vez com uma das maiores votações da história da cidade: 6.550 votos.\r\nPaulo Eduardo exerceu o seu mandato popular ao lado dos trabalhadores e estudantes. Sua luta constante contra os interesses da especulação imobiliária, contra o aumento dos gabaritos e da construção desenfreada dos espigões na cidade tornou seu mandato uma referência para os movimentos populares e sociais de Niterói. Sendo reeleito novamente com expressiva votação, seguiu firme e coerente na defesa de um projeto de mudança para Niterói.\r\nEm 2002, foi o primeiro parlamentar do PT a questionar nas ruas o projeto de reforma da previdência proposto pelo governo Lula recém eleito. Junto com os deputados Luciana Genro e Babá participou dos primeiros movimentos para criação de um novo partido socialista. Em 2005, diante da traição e degeneração irreversível do PT, que se entregou à lógica do capital e se afundou em escândalos como o do mensalão, Paulo Eduardo se desfiliou do partido juntamente com centenas de militantes e ingressou no Partido Socialismo e Liberdade (PSOL). Em 2008, foi o primeiro candidato do PSOL à prefeitura de Niterói, articulando uma Frente de Esquerda com o PCB e o PSTU. Enfrentando as milionárias campanhas de Rodrigo Neves (PT) e de Jorge Roberto Silveira (PDT), recebeu mais de 22 mil votos, obtendo assim um dos maiores resultados do PSOL naquelas eleições nos municípios do Brasil.\r\nEm 2012, Paulo Eduardo Gomes novamente foi eleito vereador. Agora 8.011 eleitores fizeram dele o vereador mais votado da cidade de Niterói. Na Câmara Municipal, disputou a presidência do Poder Legislativo apresentando um projeto de transparência, acesso às informações e profissionalização da Casa.\r\nEleito presidente da Comissão de Saúde e Bem Estar da Câmara Municipal, Paulo Eduardo vem atuando em conjunto com os usuários e trabalhadores para valorizar os funcionários municipais de saúde além de melhorar os equipamentos e as condições das unidades de saúde da cidade. Como conselheiro de saúde do município, reforça o controle social do SUS e combate todas as formas de privatização da saúde através das Organizações Sociais (OSs), fundações de direito privado e a Empresa Brasileira de Serviços Hospitalares (EBSERH). Para isso, defende o fortalecimento da Frente Nacional de Saúde, do Fórum Estadual de Saúde e do Fórum contra a Privatização das Políticas Públicas de Niterói.\r\nAo lado dos trabalhadores e estudantes, o novo mandato Paulo Eduardo segue na defesa da ampliação dos direitos sociais contra as tentativas de privatização da saúde, educação, dos espaços e recursos públicos. Seu mandato está a serviço da construção de uma sociedade verdadeiramente democrática com participação e justiça socioambiental. ','mandato@pauloeduardo.org','539715089567878'),(61081,'Camila Costa Valadão','PRETA','FEMININO','FEMININO','1984-08-29','Camila é assistente social e professora universitária. Começou a militância no movimento estudantil mas sempre esteve em contato com a política na Serra, onde vem de uma família de militantes. Ingressou no Partido Socialismo e Liberdade (PSOL) em 2005 pois acredita que viver é tomar partido e não estava satisfeita com os rumos que o PT estava tomando. Nesse partido chegou a ser da Executiva Nacional e também foi candidata ao governo do Espírito Santo em 2014. Sua militância sempre foi voltada à luta pelos Direitos Humanos, direitos da juventude, da população LGBT, das mulheres, nas negras e negros e da classe trabalhadora.','milacvaladao@gmail.com','1103358173074935'),(61216,'Gimena Dipp','BRANCA','FEMININO','FEMININO','1988-01-24','Gimena Dipp, 28 anos, a Gi, é empresária no ramo de \r\nbar/restaurante. Como ela própria se define, é uma cidadã como \r\nvocê, que deseja uma cidade mais inclusiva e efetiva. Candidata \r\npela primeira vez, pretende, na Câmara Municipal, contribuir não \r\napenas nas questões que envolvam saúde, segurança, educação e \r\nlazer, mas também defender a criação de espaços para discussão \r\nde políticas públicas efetivas para população LGBT. \r\nGimena se preocupa ainda com a inclusão social, motivo pelo qual \r\nquer buscar o desenvolvimento da economia local de maneira \r\nsustentável e lutar pela mobilidade urbana. Gimena tem, como \r\npropostas de campanha, fortalecer a rede de proteção e defesa da \r\nmulher?? propor leis municipais de defesa e proteção aos animais e \r\nmeio ambiente? e agir para garantir o acesso à cidade por meio da \r\nmobilidade urbana, do transporte coletivo em tempo integral e por \r\nmeio do uso dos espaços públicos para atividades de cultura, esporte e lazer.','gi@ataribar.com','1742869039314103'),(62271,'Diêgo Brito','','','','1991-02-18','Estudante de Engenharia de Produção da Universidade Estadual de Santa Cruz (UESC), foi presidente do Centro Acadêmico do curso e militante ativo nas lutas em defesa da educação: por mais verbas para a educação em todos os níveis, em defesa de políticas de permanência estudantil, contra o autoritarismo na gestão das instituições de educação. Atuou no Coletivo \"Só Podia Ser Preto\", que tem como pauta a luta contra o racismo, e é do Coletivo Juntos!, um coletivo nacional de jovens que se articula em torno de democracia real nos mais diversos âmbitos. Acompanhou a ocupação da Câmara que evitou a privatização da EMASA. Em Itabuna está lutando por investimento e transparência na cultura, lazer, esporte e educação, por oportunidades para que a juventude, especialmente a juventude negra, pare de morrer seja pela mão da polícia ou do tráfico.','degobrito@yahoo.com.br','1131524676927820'),(62804,'Linna Ramos','PRETA','FEMININO','FEMININO','1986-02-28','Sou Linna Ramos, professora de Educação Física na UEFS, tenho 30 anos e construo o PSOL há 10. Sou militante feminista e antiproibicionista. Defendo e luto pela legalização da maconha contra o genocídio e o encarceramento da negritude. As experiências antiproibicionistas tiveram como primeiro impacto a redução de mortes relacionadas ao tráfico. Em mais de 40 anos de política de guerra ás drogas, o número de usuários não diminuiu e o número de mortes aumentou. Não pelo uso da maconha, mas pela bala do revolver do tráfico ou da Polícia. Legalizar e reduzir o número de mortes associadas ao tráfico no Brasil é salvar vidas negras! Vamos juntos por uma Salvador feminista negra e antiproibicionista, pois vidas negras importam!','linna.psol@gmail.com','10154564600863320'),(62916,'Vereador Carlos Comassetto','BRANCA','MASCULINO','MASCULINO','1958-09-18','Carlos Roberto Comassetto nasceu em Santa Maria, em 18 de setembro de 1958. Cursou Agronomia na Urcamp, em Bagé, onde atuou no movimento estudantil de 1979 1983, como presidente do Diretório Acadêmico e do Diretório Central dos Estudantes.\r\nIniciou sua atividade profissional na Cotrijuí, em Dom Pedrito, onde trabalhou com agricultura ecológica e desenvolvimento sustentável, áreas em que se especializou na Suécia e na Argentina. Começou na atividade político-partidária em 1986, com seu ingresso no PT, vindo a ser eleito presidente do partido em Dom Pedrito e suplente de vereador.\r\nVem para a Capital em 1989 para atuar na primeira gestão da Administração Popular, assumindo funções na direção da Secretaria Municipal da Produção, Indústria e Comércio (Smic), onde permanece até 1995. Coordena então a implantação da Festa da Uva e da Ameixa, em Belém Velho, e da Feira Ecológica de Porto Alegre, entre outras.\r\nAtuou, de 1989 a 1991, na sua entidade de classe, sendo eleito presidente da Sociedade de Agronomia do Rio Grande do Sul (Sargs). De 1998 a 1999, contribuiu como assessor da bancada do PT na Câmara Municipal de Porto Alegre, durante as discussões para aprovação do Plano Diretor de Desenvolvimento Urbano Ambiental (PDDUA).\r\nParticipou da organização do maior movimento de agricultura alternativa do Brasil, o EBAA. Na condição de consultor, orientou a constituição de cooperativas pioneiras, como a Arcooiris (de produtores ecológicos de Porto Alegre), a Coopeixe (Ilha da Pintada), a Associação dos Pescadores do Parque Itapuã e várias cooperativas habitacionais.\r\nTomou parte, desde 1995, das discussões realizadas no Conselho do Orçamento Participativo, como conselheiro da Temática Desenvolvimento Econômico e Tributação de Porto Alegre. De 2000 a 2004, atuou como conselheiro do Plano Diretor destacando-se na luta permanente pela implantação do modelo rururbano, atuando pelo fim dos loteamentos irregulares na Região Sul, pela implantação do Projeto Urbanizador Social e pela isenção tributária para os produtos rurais da Capital. Como consultor de desenvolvimento sustentável, desenvolveu projetos ambientais, atuando na elaboração dos planos diretores das cidades de Imbituba (SC), Pelotas (RS), Barra Mansa (RJ) e Santa Maria (RS).','vereadorcomassetto@gmail.com','1191550287534617'),(63059,'Carlos Henrique Caetano','PARDA','MASCULINO','MASCULINO','1984-01-20','Professor Carlinhos é um lutador pela educação pública, pelo fim das opressões contra as LGBTs, pela construção do socialismo. Fora Temer! Fora Todos Eles!','carloshenriquecaetano@gmail.com','10207206770468401'),(63255,'Verônica Sepúlveda','BRANCA','MASCULINO','MASCULINO','1960-03-22','Morador de Guarulhos há 20 anos, estudei enfermagem no nível técnico e me graduei em gestão financeira. Fui eleito Conselheiro gestor do Hospital Municipal da Criança e do Adolescente e também sou funcionário do Hospital do Servidor Público Municipal de São Paulo. \r\nConsidero que a política precisa da participação popular e da interação da sociedade. Defendo que todos os guarulhenses devem se unir e lutar pela reconstrução da cidade.\r\nQuero que Guarulhos seja um município modelo, em todos os aspectos, sendo a saúde a primeira frente a ser defendida. Pretendo batalhar contra a corrupção com fiscalização firme, promovendo a saúde, educação e esporte, porque esse é o nosso forte.','martinescmsp@yahoo.com.br','1132485003499013'),(63751,'Renata Mallet Guena','BRANCA','FEMININO','FEMININO','1981-12-06','','Renataguena@yahoo.com.br','1789747784628347'),(63841,'Lisiane Mutti','BRANCA','FEMININO','FEMININO','1971-12-04','Sou Lisi Mutti,  nasci e trabalho na cidade do Rio de Janeiro. Sou formada em Administração, com especialização em Gerência de Projetos. Trabalhei no mercado editorial, por um período de 12 anos, como assistente de direção e mais tarde como diretora da Elo Editora e Distribuidora. Atuei, de 2004 a 2008, na administração pública, como coordenadora de administrativa do CEAV - Centro de Artes Visuais da Funarte, onde realizei a gestão administrativa e financeira de diversos projetos do Governo Federal, como a Rede Nacional Funarte de Artes Visuais, Projéteis Funarte de Arte Contemporânea, Conexão Artes Visuais e Conexão Contemporânea. Desde 2009 sou gestora da produtora cultural e editora Fase 10 - Ação Contemporânea. Sou voluntária da instituição internacional humanitária Arte de Viver desde 2002, sendo uma das responsáveis pelo fortalecimento da instituição no Rio de Janeiro. Em 2006 realizei a minha formação como instrutora de técnicas de respiração para redução do estresse na Índia, tendo me tornado a primeira instrutora para adultos da instituição no Rio de Janeiro. Desde então venho ministrando cursos, palestras e seminários sobre tema. Fui coordenadora de projetos sociais de 2009 a 2016 e uma das responsáveis pela implementação dos projetos: Prison Smart e RAS (Respiração, Água e Som) - cursos de redução de estresse no sistema prisional e para pessoas em vulnerabilidade social. Criei ainda os projetos: Cuidando de Quem Cuida, tendo como foco a educação emocional de funcionários e voluntários de instituições que cuidam de outras pessoas (hospitais, escolas, creches, ongs etc) e o Edital do Bem, projeto que tem o objetivo de implementar projetos sociais idealizados por voluntários. Liderei, ainda, projetos de ajuda humanitária aos desabrigados em Niterói, RJ 2010, em Teresópolis, RJ em 2011, Duque de Caxias, 2013 e Mariana, 2015.','lisiane.brito@gmail.com','10210259599948654'),(64871,'Sidomar Costa','PARDA','MASCULINO','MASCULINO','1978-06-09','Sou candidato a vereador de Belém pela primeira vez pelo partido solidariedade e número de votação 77716 SIDOMAR COSTA para vereador de Belém. \r\nVou fazer trabalho específicos e direcionados para os bairros da nossa cidade.  Acredito que com a valorização dos bairros podemos dar uma melhor condições de vida para o nosso povo, mais educação com as escolas de tempo integral,  segurança com a guarda nas ruas dos bairros, valorização dos servidores com projetos de humanização, fiscalizar e dá total opoio à projetos que sejam  de pleno interesse do povo.\r\nVenha fazer parte desta conquista! \r\nMe ajude a fazer uma Belém mais justa com igualdade para todos. ','sidomarcosta@hotmail.com','1256648437720263'),(64965,'Victória Xavier','BRANCA','FEMININO','FEMININO','1992-03-05','24 anos, candidata à vereadora de São José dos Campos pelo Partido Verde #43008','victoriaxavier.pv@gmail.com','793384960801138'),(65479,'Ana Paula Tejano Lelete','PARDA','FEMININO','FEMININO','1983-07-29','Sou Ana Paula, moradora do Bairro Nacional - Contagem  33 anos. Lutarei para proteção e leis mais severas para crimes de homo