nização do meu lar. Mãe de quatro filhos, conto principalmente com meus salários de professora e de auxiliar de secretaria escolar, para gerir a minha casa e para cuidar da minha família. Ser vereadora é fiscalizar as ações do Executivo, o emprego das verbas do município por parte do prefeito e criar leis para o benefício da população, tenho total autonomia, para votar no que acho coerente, no que acredito ser o melhor para a população, mas sempre estarei disposta a estudar a cada dia mais, a fim de atuar com responsabilidade no cargo, para o qual pleiteio uma vaga . Meu conhecimento sobre leis é abrangente na área da educação; conheço a Lei Orgânica Municipal, o Estatuto dos Servidores Públicos Municipais e o Plano de Cargos e Salários dos professores e dos funcionários do SAAETRI - também conheço o plano de cargos e salários dos demais servidores do município, o qual será implementado em novembro deste ano. Lutarei por uma Três Rios mais cidadã tendo a educação como fonte de transformação social! CONTO COM SEU VOTO DE CONFIANÇA. Obrigada. \r\n','carolserpamalta@yahoo.com.br','1513001148725611'),(69799,'Marcos Ramalho','PARDA','MASCULINO','MASCULINO','1982-03-26','','cbramalho@hotmail.com','1111167052293450'),(69965,'Francisco Nunes','BRANCA','MASCULINO','MASCULINO','1968-04-03','Francisco Carlos Nunes, nascido em 1968 no município de Casimiro de Abreu, se mudou para Angra dos Reis através de trabalho e hoje já se somam mais de 29 anos morando no município.\r\nProfissional na área de OFF SHORE, atuando por vários anos em uma plataforma de petróleo.\r\nAtravés dos anos morados em angra dos reis, vi que alguns bairros estavam esquecidos pelo poder público, e então um bairro me chamou a atenção que é a caputera,morro do moreno,lambicada onde não possuía serviço de internet. Resolvi então abrir uma provedor para fornecer internet aquele bairro onde ninguém até então levou. Através dos anos reparei que os problemas iam muito além de não ter apenas internet, sendo os problemas sociais, esportivos, e na área da saúde.\r\nApós um convite feito pelo PSDC para se filiar ao partido, vi a oportunidade para apresentar os problemas dos bairros em geral para que pudessem ser solucionados. Depois de algum tempo veio o convite para ser pré-candidato a vereador, logo aceitei vendo ai uma grande oportunidade para representar a população dos bairros que por anos ficaram esquecidos pelo governo.\r\nSou um homem sério, trabalhador e que não foge dos problemas, uma pessoa que vai representar o povo, que vai trabalhar com dignidade!\r\nComo candidato, vou lutar pela educação, saúde, esporte e infraestrutura da cidade!\r\nna saude . Pretendo trabalhar junto a administração municipal, criando farmácias publicas abastecendo com medicamentos e buscar atingir toda a demanda existente, além de propor a humanização nos postos de saúde, através de leis que obrigam os atendimentos com hora marcada e assim por fim às filas de espera\r\nMelhorar a política de atenção ao idoso, fortalecendo a atenção primária (PSF) e os hospitais\r\nna educação.Ampliar o tempo de funcionamento das creches e pré-escolas para as famílias que necessitam, oferecendo atendimento noturno às crianças cujos pais trabalham à noite\r\nLutar no legislativo por maior remuneração e valorização dos professores além de propor através da administração municipal, a realização de cursos de qualificação e reciclagem aos profissionais gratuitamente. Os jovem também terão acompanhamento. Pretendo desenvolver projetos para reforços escolar, com crianças e adolescentes, que possuem dificuldade de aprendizado \r\nGarantir material escolar, entregando aos alunos, no primeiro dia de aula, um kit completo com livros, cadernos, canetas e mochila\r\nFortalecer a relação escola/família na Secretaria de Educação, reforçando a comunicação entre pais, responsáveis, professores e alunos, garantindo que todos os pais recebam mensalmente uma publicação de qualidade que leve informação sobre o universo escolar, seus avanços e problemas.\r\nno esporte e lazer. Criação de Unidade de Academia nas Comunidades, voltadas para a prática do esporte e geração de saúde, nos bairro do Município de angra dos reis\r\nAmplo programa de atividades desportivas sob orientação de profissionais de educação física \r\nPromover políticas de desenvolvimento do esporte na base, disseminando as diferentes modalidades e seus valores, integrando-as à rede de educação básica e transformando as escolas cada vez mais em centros de formação de atletas e cidadania\r\nExecutar programa de atividades de lazer para famílias, sobretudo em áreas populares, com recreadores e animadores culturais nos fins de semana\r\nFazer convergir os projetos e atividades de esporte, entretenimento e cultura nos bairros. Utilizar os espaços públicos e escolas do município para atividades, inclusive nos fim-de-semana, que sejam gratuitas, de qualidade e com segurança, acompanhada por profissionais do município especializado\r\n\r\nLutando por todas essas ideias, vou chegar ao ponto em que considero mais importante para a população, a qualidade de vida. Como boa educação, saúde, lazer e renovação, as pessoas terão razões cada vez maiores de acreditar que angra é a melhor cidade para se viver\r\n','francisco_nune@hotmail.com','10202085475534944'),(70049,'Joêni Kehl','BRANCA','FEMININO','FEMININO','1995-06-02','Sou estudante da última fase do curso de jornalismo no Centro Universitário Estácio. Trabalho como voluntária da igreja católica há 4 anos, dando catequese e realizando vários outros serviços de manutenção da igreja próxima de minha casa. Sempre tive a vontade de ajudar as pessoas de forma especial, de um jeito que elas tenham voz para aquilo que a vida em sociedade precisa. É por isto que aceitei ser candidata. Desejo ser a voz política dessas pessoas na câmara de vereadores. ','joeni.kehl@outlook.com','1773543239595623'),(70076,'Lula Rocha','PRETA','MASCULINO','MASCULINO','1985-01-17','Lula Rocha iniciou sua luta por direitos muito cedo. Com 15 anos já era liderança do movimento estudantil e foi o primeiro presidente do Conselho de Juventude de Cariacica. Filho de Isaías Santana e Penha, Lula Rocha aprendeu muito cedo a se posicionar e atuar na defesa de direitos.\r\n\r\nLula Rocha também foi coordenador do Fórum Estadual de Juventude Negra     (FEJUNES) e presidente DO Conselho Estadual dos Direitos Humanos. Estudou direito, trabalhou durante dez anos na Secretaria de Justiça (SEJUS)  e foi articulador do Plano Juventude Viva do Governo Federal, que buscava diminuir a violência contra os jovens.\r\n\r\nNa Câmara, Lula Rocha lutará por uma educação de qualidade, políticas públicas de juventude, cultura, assistência social, de enfrentamento à violência, ações afirmativas e pela adoção de um modelo de desenvolvimento que valorize as potencialidades do município e todas as suas regiões.\r\n\r\n','lula.es@bol.com.br','1195779780466012'),(70467,'Francisco De Paula Reis Lima','BRANCA','MASCULINO','MASCULINO','1962-01-08','Advogado, militante de Direitos Humanos,  educador popular, envolvido com as lutas por terra e moradia.','fcoreislima@yahoo ','102003443600478'),(70888,'Raquel Guzzo','BRANCA','FEMININO','FEMININO','1950-07-23','Raquel Guzzo é candidata nestas eleições para defender as lutas e os interesses do povo trabalhador. Esta será uma campanha eleitoral democrática, controlada pela base que, se eleita, assumirá o mandato recusando todo tipo de privilégio proveniente da estrutura parlamentar que hoje é uma grande fonte de pressão e burocratização dos representantes parlamentares.\r\nRaquel Guzzo possui uma prolongada trajetória de luta e resistência, manteve-se distante de todos os vícios políticos que marcam o cenário brasileiro e é uma das fundadoras do PSOL. Ela acredita que no processo de construção de uma nova sociedade, o central é a organização efetiva de uma resistência de lutadores da classe trabalhadora e da juventude contra todas as formas de exploração, opressão e miséria que a nossa sociedade gera. \r\nRaquel Guzzo é natural de Campinas, mãe de quatro filhos, professora universitária e pesquisadora. Desde sua adolescência, se engajou em movimentos da juventude por meio da União Nacional dos Estudantes Secundaristas, das Comunidades Eclesiais de Base e da Juventude Estudantil Católica – JEC.  Foi professora do Ensino Fundamental e do Ensino Médio. Estudou Psicologia na PUC de Campinas durante o difícil período da ditadura militar e hoje é psicóloga e professora universitária dedicada a estudar direitos de crianças e adolescentes, as condições de vida de suas famílias e os desafios enfrentados por profissionais da rede municipal de educação e assistência social. \r\n','rslguzzo@gmail.com','10157514427150416'),(71003,'Cris Freitas','PARDA','FEMININO','FEMININO','1978-11-03','Sou Cristiane Freitas Santana\r\nSolteira,estudante, tenho 3 7 anos, quatro filhos. Moro em São Vicente há 20 anos atualmente faço parte da ASA (Ação Solidária Adventista) Sou protetora de animais, luto contra maus tratos e abandono dos mesmos.','Cristiane_freitas13@hotmail.com','1227003970704632'),(71364,'Cainã Margarida','BRANCA','MASCULINO','MASCULINO','1991-08-23','Sou manezinho da Ilha, tenho 25 anos, moro no Carianos há mais de 20 anos e sou designer gráfico. Gosto de esportes desde pequeno. Sou umbandista apaixonado por minha religião e amo o carnaval. Estou coordenador de harmonia da Escola de Samba União da Ilha da Magia. Meu amor por Florianópolis e a necessidade de transformação da cidade me trouxe para a política.\r\nDefendo a radicalização da democracia, que é a efetiva participação das pessoas na vida pública, debatendo temas como as desigualdades (classe, gênero, etnia, orientação sexual, cultura...), o caráter do autogoverno em um mundo individualizado e a importância da comunicação para o florescimento da experiência democrática.\r\nÉ preciso preservar a diversidade cultural e ecológica da nossa cidade. Por isso, defendo um plano diretor participativo, que inclua as pessoas no espaço público, local da democracia e da diversidade, reconhecendo que a democracia requer reflexividade coletiva sobre os rumos da vida comum. Por isso eu e minha equipe vamos combater a intolerância de toda espécie, seja de classe, étnica, religiosa, de gênero, orientação sexual e com os animais.\r\nComo diz nosso candidato a prefeito de Florianópolis, Elson Pereira, \"nossa capital é uma ilha de utopias possíveis\"!','cainamargarida@gmail.com','10207563212587595'),(72190,'Cláudio Garrafão','BRANCA','MASCULINO','MASCULINO','1983-02-20','','garrafao7b@gmail.com','1135343613211364'),(72260,'Walter Lúcio Celline','BRANCA','MASCULINO','MASCULINO','1955-12-01','~Bacharel em Ciências  Contábeis,  exercendo por vários anos atividades profissionais como Auditor no setor privado. Trabalhei na Assembleia Legislativa em São Paulo e assessorei um Deputado Federal por mais de 06 anos. Sou Posgraduado em Gerente de Cidades pela FAAP- SP, exerci função de secretario de Administração nas Prefeituras de Barrinha, Pitangueiras e 18 meses de Serrana, ocupei o cargo de Diretor de Projetos na Prefeitura de Sertãozinho no período de 2009 a 2012, onde consegui trazer verbas para mais de 25 obras importantes no município, no tocante a infraestrutura, esporte, educação, lazer, cultura, saúde e diversos programas sociais.\r\nFui presidente da APAE em Sertãozinho, diretor do Sertãozinho Hóquei Clube além de outras entidades.\r\nPrimeira vez candidato, com minha experiência tenho  convicção de fiscalizar atentamente as ações do poder executivo além de que com meu relacionamento tanto nos órgãos do governo estadual como federal posso trazer muito mais investimento a nossa querida Sertãozinho e o Distrito de Cruz das Posses.\r\nDefendo com veemência a classe dos professores em todos os níveis e afirmo que não temos advogado, engenheiro, arquiteto, médico, juiz ou qualquer outra profissão que não tenha tido orientação de um professor...\r\n','cellinewl@gmail.com','1610933219207329'),(72677,'Aparecida Carlos','BRANCA','FEMININO','FEMININO','1962-09-08','Profª Cida Carlos, mãe de três filhos, nascida em Uraí, Paraná. Veio para São Paulo com seus pais, apenas com um um ano de idade.\r\n\r\nCom muita dificuldade fez a sua primeira Faculdade em de Itu - SP. Desde os seus 15 anos trabalhava durante o dia e estudava à noite. E foi a primeira de sua família a ter um diploma Universitário. \r\n\r\nComeçou a lecionar História na Rede Pública Estadual em 1981, aos 19 anos e em 1987 foi uma das fundadoras da primeira subsede da APEOESP (Associação de Professores do Estado de São Paulo) em Carapicuíba. \r\n\r\nEm 2007 conquistou o TÍTULO DE MESTRE EM EDUCAÇÃO e de 2009 à junho de 2016 assumiu a pasta da Secretaria da Educação da Rede Municipal de Carapicuíba.\r\n\r\nÁ frente da Secretaria de Educação:\r\n\r\n- Aumentou o número de vagas em \"Creche\" de 995 vagas para mais de 5.000;\r\n- Desde 2009 entregou Kits Escolares e Uniformes para as crianças da Rede Municipal de Ensino;\r\n- Ofereceu Merenda de Qualidade, com Cardápios Elaborados por Nutricionistas;\r\n- Ofereceu o Transporte Escolar Para Crianças Deficientes da Rede Municipal de Ensino;\r\n- Criou o Plano de Carreira Para os Professores;\r\n- Implantou a Formação Continuada para os Profissionais da Educação;\r\n- Distribuiu Bônus para os profissionais do magistério;\r\n- Possibilitou o Aumento do IDEB*.\r\n','profcidacarlos@gmail.com','1407659859247426'),(72742,'Luiz Felipe Esteves Freitas','PARDA','MASCULINO','MASCULINO','1984-07-04','Luiz Felipe, tem 32 anos, atua profissionalmente como professor de informática e é empreendedor do ramo de tecnologia da informação desde os 21 anos de idade. Nasceu em Santos e morou toda sua vida em São Vicente.\r\n\r\nNunca ocupou nenhum cargo público da prefeitura de São Vicente, porem sempre foi ativo na política, seja no movimento estudantil, quando foi presidente do Diretório Acadêmico da FATEC, quando participou da gestão CES (Centro dos Estudantes de Santos), quando foi delegado do congresso da UNE em 2007. Na Juventude do PT foram muitas lutas por políticas públicas para nossa juventude, chegou a ser membro da direção executiva estadual. Atualmente está ajudando a construir a AFAPED, a Associação do Familiares de Pessoas com Deficiência de São Vicente.\r\n\r\nComo professor de Informática, lecionou durante seis anos na ETEC Escolástica Rosa, na ETEC Ruth Cardoso e de ETEC Cubatão, foram muitas aulas nas salas descentralizadas espalhadas pelos bairros de São Vicente, nas escolas Jorge Bierrenbach e Francisco Martins (Jd. Rio Branco), Saulo de Tarso (Parque Continental),  CAIC (Humaitá), Mário Covas (Parque das Bandeiras) e Ênio Vilas Boas (Jd. Pompeba).\r\n\r\nUma de suas principais pautas é modernização da gestão da prefeitura informatizando os serviços públicos. A informatização ajuda a combater a corrupção e melhora a qualidade dos serviços prestados aos cidadãos vicentinos.\r\nOutra pauta importante é a educação inclusiva das pessoas com Transtorno do Espectro Autista, de pessoas diagnosticadas com a síndrome do X frágil, com a síndrome de down entre outras. Vamos batalhar para que a prefeitura cumpra a lei federal 12.764 sancionada pela presidente Dilma que estabelece os mais direitos para as pessoas com TEA.\r\nPrecisamos urgente discutir um novo momento para a São Vicente que queremos, e esse momento é agora!  Clique aqui envie suas proposta para nossa campanha.','professorluizfelipe@gmail.com','10154479303759484'),(73085,'Beto Siqueira','PARDA','MASCULINO','MASCULINO','1960-09-02','Sou formado em Educação Física pela UMC, mas hoje estou como condutor do Samu da cidade de São Paulo.','jrbetosiqueira@yahoo.com.br','142384132887166'),(73179,'Rafael Bezerra','BRANCA','MASCULINO','MASCULINO','1996-08-12','Estudante vestibulando, 20 anos, tendo como principais eixos de intervenção e atuação o movimento estudantil e movimento LGBT. \r\n\r\nO PCO utiliza as eleições para defender seu programa político em favor da revolução socialista. E na atual conjuntura política, se põe para a vanguarda do movimento revolucionário, o combate ao golpe de Estado.\r\n\r\nVote e Lute com o PCO!','rafael_piracikaba@hotmail.com','1160083527371501'),(73358,'Paulinho Coelho','BRANCA','MASCULINO','MASCULINO','1986-05-05','Paulinho, 30 anos, é professor, estudante, músico e militante político há 14 anos. Dirigiu entidades políticas de base no município e no estado. Recentemente ocupou o cargo de Coordenador Municipal de Políticas Públicas para a Juventude, pautando ações de inclusão é participação da Juventude.','paulormcoelho@hotmail.com','1075341795868849'),(73380,'Eliana Patriota','BRANCA','FEMININO','FEMININO','1970-02-16','Eliana Patriota aos 21 anos mudou-se para Florianópolis, sempre com esse pensamento de mudar e fazer a politica de um novo jeito, sai agora para Candidata a Vereadora, com um sonho patriota no coração e uma trajetória em mente, com muitas propostas e idéias que irão transformar Florianópolis!\r\n\r\nEspecialista em Gestão de Eventos pela MBA Uninter Fatec Internacional com atuação em produção e organização de eventos há 18 anos na empresa Cosmopolita Office, já organizou eventos que tiveram como palco o  CentroSul de Florianópolis como Feiras comerciais congressos, atuando também como Editora gráfica e Web designer, programadora visual, locutora, editora e diretora de vídeos e documentários. Estudou e trabalhou no exterior, em Londres Inglaterra e na Itália, na região do Veneto aonde também é de família italiana.\r\n\r\nMinhas bandeiras são: fortalecer o sentimento de patriotismo dos Pais e Mães, das crianças, dos adolescentes e jovens, cuidar e criar políticas sociais mais efetivas, educação com responsabilidade social, mais transporte coletivo e diversificação dele por meio de transporte marítimo, contra turno para aliviar as vias urbanas, entre muitos outros projetos que você pode navegar e conhecê-los agora.\r\n\r\nFui candidata a Vereadora em 2012 por uma Curitiba +Forte! Na época estava fazendo minha graduação lá e muitos caminhos me levaram a ser candidata, um deles é que só podemos mudar uma sociedade por meio da política criando leis e fiscalizando a aplicação efetiva dos recursos públicos. Sou Administradora Tecnóloga em Gestão de Negócios, Produtora e Organizadora de Eventos desde 1998 e atualmente sou Pós graduanda com MBA em Gestão de Eventos. \r\nSou casada com minha alma gêmea e desde 1995 estamos juntos, tenho uma trajetória extensa de trabalho, começando a trabalhar em agência de publicidade desde os 16 anos, em 1986. \r\n','elianapatriota15567@gmail.com','10153898429961569'),(73582,'Leo Moreira','PARDA','MASCULINO','MASCULINO','1985-01-18','','leomoreirafoto@gmail.com','1113221918755325'),(73662,'Aparecido Fonseca','PARDA','MASCULINO','MASCULINO','1982-10-13','Sou Aparecido Silva da Fonseca, Assistente Social, com pós graduação em gestão pública, militei no movimento negro e defendo uma sociedade livre da exploração.','aparecidosf@yahoo.com.br','1221722824553381'),(73710,'Robinson Batista','BRANCA','MASCULINO','MASCULINO','1969-10-26','Aceitei este desafio com a intenção de ganhar estrutura e as ferramentas necessárias para ampliar as ações que venha fazendo à anos na minha cidade... É preciso desenvolver o senso do coletivo e promover o bem comum. Tenho 46 anos, morador de Gravataí, casado, pai de dois filhos e avô do Miguel. Mais detalhes e informações no meu Facebook.','robinsonbatista1@hotmail.com','1234205516600197'),(74971,'Rafael Lima','PRETA','MASCULINO','MASCULINO','1988-07-01','O jovem mobilizador Cultural, Rafael Manga, acredita que a Cultura é um instrumento eficaz para a transformação social. Para ele, democratizar o acesso e investir na produção cultural nas periferias é algo emergencial, que pode elevar a qualidade de vida das pessoas e diminuir as desigualdades em Salvador. \r\n\r\nManga carrega em sua trajetória política as marcas da luta racial, de gênero e da valorização das culturas populares de bairro, a arte de rua, dos becos e largos da capital. Ele traz, como chancela de sua competência, o apoio da deputada estadual Luiza Maia - autora da Lei Antibaixaria.   \r\n\r\nRafael Manga tem forte atuação sociocultural na região da Estrada das Barreiras, Cabula, onde mora. É diretor de Comunicação do Fórum de Legisladores Culturais da Bahia, estuda Publicidade e Propaganda, foi aluno da Escola Olodum e integrante do Bloco Afro Olodum. Também fundou as associações AJUNA e Cultural Calhandra.\r\n','rafaelmanga@hotmail.com','1216458365085744'),(75043,'Denis Carvalho','BRANCA','MASCULINO','MASCULINO','1985-11-18','Nascido em Americana no dia 18 de novembro de 1985, Denis Carvalho cursou seu ensino fundamental praticamente completo no antigo SESI-101 no Frezzarin, bairro onde mora até hoje.\r\n\r\nFormado em Comunicação Social pelo Centro UNISAL, começou a aliar os conhecimentos de Comunicação à dedicação profissional à área da cultura, organizando eventos com artistas independentes e produzindo conteúdos audiovisuais, o que o levou naturalmente à militar na área cultural, sendo, inclusive, vice-presidente do Conselho Municipal de Cultura em 2010.\r\n\r\nNa busca incansável por conhecimento e aprimoramento, aprofundou sua militância social quando iniciou o movimento Pula Catraca – Americana nas Jornadas de Junho de 2013.\r\n\r\nFoi perseguido por adversários, mas não se deixou abalar e até hoje continua firme militando com o Pula Catraca, no grupo de teatro Ocuparte e no Partido dos Trabalhadores, levantando especialmente as bandeiras da Juventude, Cultura, Igualdade e Justiça Social, sempre com coerência, seriedade e responsabilidade.\r\n','denis@disco1.com.br','1266741073376062'),(75492,'Patricia Masan','PARDA','FEMININO','FEMININO','1981-07-11','Eleitora e eleitor, sou Patrícia Masan, tenho 35, sou mãe da Sofia, jornalista, educadora e coordenadora de projetos culturais. Venho me apresentar a você nessa disputa eleitoral.\r\n\r\nO momento pede mudanças efetivas e radicais na forma como fazemos política, nas escolhas que tomamos e no envolvimento que temos no processo de representação. Nesse sentido tomei coragem, escolhi enfrentar toda a velha máquina que sustenta homens no poder há décadas, uma decisão ousada que vem das lutas travadas cotidianamente. Nós mulheres não podemos nos conformar em sermos metade da população da cidade e ocuparmos apenas 15% das cadeiras da Câmara Municipal de Uberlândia, como nas últimas eleições. Essa realidade precisa mudar e espero fazer parte, a partir do seu voto de confiança, como instrumento de mudança.\r\n\r\nSou uma mulher trabalhadora, sempre enfrentei desafios e encaro o novo com convicções em meu potencial criativo e responsável. Como jornalista estive em televisão, busquei aprimoramento profissional e hoje sou  titulada como mestre em Tecnologias, Comunicação e Educação. Atuei em assessoria parlamentar e de comunicação no executivo e legislativo. Atualmente sou professora universitária e presidenta do IAT - Instituto de Artes, Cultura e Ciências do Triângulo. O trabalho não me assusta, gosto de me doar ao máximo em cada projeto que me envolvo e direcionarei essa mesma energia na Câmara Municipal.\r\n\r\nMeu trabalho prioritário está no estímulo à participação popular na política, democratizando a tomada de decisões, impulsionando encontros com eleitores em espaços públicos para que frequentemente, durante o mandato, possa receber demandas diretamente do povo. As pautas que defendo são:\r\n\r\n- Fiscalizar gastos do executivo, garantindo o acesso à informação pública de projetos e ações do governo municipal de acordo com a lei da transparência; \r\n- Propor leis que reduzam os gastos da máquina pública, especialmente no que diz respeito ao favorecimento de gabinetes como o uso excessivo da verba indenizatória (gastos com escritório, combustível, material de consumo, etc); \r\n- Criação de aplicativo para facilitar a comunicação entre o meu mandato e a população, disponibilizando informações que estimulem a democracia participativa e temas relevantes na construção de uma nova prática política;\r\n- Defender o investimento municipal em educação e cultura, bem como em atividades que propiciem o exercício da cidadania e o convívio entre diferentes;\r\n- Incentivar o empreendedorismo feminino, com a criação de mecanismos que as assessorem na abertura de micro-empresas ou formas que incentivem a autonomia financeira de mulheres;\r\n- Realizar pesquisas de opinião com a população uberlandense a fim de identificar demandas relacionadas às diversas áreas sociais,\r\n- Garantia de que a educação municipal seja voltada para a formação humana visando o respeito entre diferentes sexos e o combate à desigualdade de gênero.','patriciamasan@gmail.com','1428353863860733'),(75528,'Vera Do Carmo','BRANCA','FEMININO','FEMININO','1963-02-07','Moradora do bairro Ferrazópolis há 43 anos e irmã da Dep. Estadual Ana do Carmo, milito na política desde 80, lutando em prol daqueles que mais precisam em minha cidade. Sou professora há 25 anos pela rede municipal da cidade e catequista há quinze anos, além de ser atuante nas comunidades e promover trabalhos sociais. Quero ser a sua candidata pois tenho muita coragem e garra para trabalhar, sem contar o fato de nós mulheres sermos a maioria da população e não termos nenhuma representante do gênero presente na câmara dos vereadores. Venha conhecer minhas propostas! Em busca de maior representatividade feminina, de uma política mais inclusiva, abrangente e sem preconceitos. Meu número é 13.313!','veracarmos@yahoo.com.br','1805475723065611'),(75663,'Italo Costa','BRANCA','MASCULINO','MASCULINO','1996-12-07','','italodonizeth@hotmail.com','863927087077107'),(76236,'Marcos Pavanelli Lira','PARDA','MASCULINO','MASCULINO','1982-12-04','A política é como cuidamos da nossa rua, da nossa comunidade. Fazer comunidade significa fazer e dar soluções aos problemas do dia a dia a partir da própria comunidade. Nosso trabalho visa em parceria com as pessoas procurar soluções a partir do que já existe e não está bem organizado. Temos várias propostas, trabalhamos nas comunidades e nossa campanha é limpa. Gostaríamos da sua atenção já que o voto é pessoal e intransferível. Vote consciente e trabalhe pela comunidade. Nesse momento de crise, precisamos de união, precisamos fazer #comUnidade.\r\n\r\nMarcos Lira\r\nDemocratas\r\n25.000','pavanellib2b@hotmail.com','10153979650637358'),(76353,'Victor Vargas de Andrade','BRANCA','MASCULINO','MASCULINO','1972-09-20','Sou aprendiz na vida, apaixonado por música e tecnologia, aspirante a político e admirador da poesia e do cosmos. Meu sonho é fazer com que as pessoas compreendam e exijam seus direitos e levantem suas vozes contra contra todo tipo de injustiça. \r\n\r\nMinhas propostas são na área de educação, sustentabilidade, desenvolvimento urbano, gestão pública e empreendedorismo. Tenho sólida experiência em administração de empresas e gerenciamento de projetos com foco na metodologia PMBOK e Scrum. Atuo há mais de vinte anos como empreendedor, professor, consultor de TI, analista de sistemas e desenvolvedor de software. Tenho forte habilidade em negociação, capacidade para planejar negócios e gerenciar projetos, criatividade, visão estratégica e liderança. Fui premiado duas vezes com projetos de inovação: 2010, Prêmio Programa Prime – Primeira Empresa Inovadora, FINEP. 2012, Prêmio Sinapse da Inovação, FAPESC.\r\n\r\nConheça minha página no Facebook e venha conhecer mais das nossas ideias.\r\n\r\nhttps://www.facebook.com/VictorVargas40007','victor.vargas.de.andrade@gmail.com','10207825885864908'),(77014,'Thiago Beringuel','PARDA','MASCULINO','MASCULINO','1995-03-23','Jovem, 21 anos, nascido em São Paulo Capital, criado em Americana, empresário, estudante de Pedagogia, militante desde os 12 anos, quero fazer politicas públicas voltadas para a juventude, para a melhoria de nossa educação, fiscalizar o poder executivo e com toda certeza cuidar de nossa gente.','thiago_beringuel@hotmail.com','1115850225161178'),(77302,'Melck Aquino de Araújo','PARDA','MASCULINO','MASCULINO','1966-05-05','Meu nome é Melck Aquino. Sou jornalista, radialista, consultor político e produtor cultural. Ex-Secretário da Cultura, e ex-sub-secretário da Comunicação do Estado do TO. Resido na cidade de Palmas-TO, onde sou vice-presidente da Associação de Moradores da Quadra 207-Sul. Sou filho de Goiânia-GO e já morei nas belas cidades de São Luís-MA e Brasília-DF.\r\n\r\nUm defensor da democracia por excelência, ambientalista, a favor da diversidade e do respeito às escolhas individuais que não prejudiquem a coletividade, ecumênico, fã de carteirinha do Papa Francisco, amante das artes (em especial de boa música), sou hoje filiado à Rede Sustentabilidade de Marina Silva, Marlon Reis, Randolfe Rodrigues, Alexandre Molon, Heloísa Helena, e tantos outros nomes que são signatários de uma postura ética, coerente e comprometida com os excluídos deste país. E, pela REDE, sou hoje candidato a vereador em Palmas, com o número 18123.\r\n\r\nComo jornalista trabalhei em jornais, revistas, emissoras de rádio e televisão, além de assessorias de imprensa, nas cidades de Goiás, Brasília e Palmas. Destaco em especial as minhas passagens pela Rádio Difusora de Goiânia, pela TV Serra Dourada de Goiânia, pelo O Popular de Goiânia, pela TV Anhanguera de Palmas, e pelo Jornal do Tocantins, de Palmas.\r\n\r\nFui diretor da FITERT - Federação Interestadual de Trabalhadores em Rádio e Televisão. Integrei também o Sindicato dos Radialistas e Publicitários do Estado de Goias, e quando mais jovem fui diretor da UMES - União Municipal dos Estudantes Secundaristas de Goiânia e depois vice-presidente do Centro Acadêmico de Jornalista da UFG - Universidade Federal de Goiás.\r\n\r\nFui assessor de comunicação e marketing no Senado Federal de três diferentes senadores. Fui subsecretário de Comunicação Social de janeiro a maio de 2015 do Governador Marcelo de Carvalho Miranda (PMDB-TO). Em 05 de maio de 2015 assumi como Secretário Estadual de Cultura, cargo que permaneci até 26 de janeiro de 2016, quando a secretaria foi incorporada à Secretaria de Desenvolvimento Econômico, Ciência, Tecnologia, Turismo e Cultura e eu me tornei o Superintendente de Desenvolvimento da Cultura.\r\n\r\nComo consultor político já prestei serviço para mais de 20 campanhas eleitorais nos estados de Goiás, Minas Gerais, Maranhão e Tocantins, além de ter sido palestrante em eventos de marketing político nas cidades de Brasília, Fortaleza, Aracaju, Maceió pelo CENAPE de Brasília, e em Palmas, pela ULBRA e UFT.\r\n\r\nComo produtor cultural produzi o tradicional Bar Feitiço Mineiro e o Monumental (hoje Bar Brahma do saudoso amigo Jorge Ferreira), em Brasília. Tive uma casa noturna em Palmas, chamada Casa do Melck, cidade em que também produzi em diferentes épocas as bandas Impacto Latino, Mestre Kuca, Albion e Véiétu. Tive o prazer também de produzir shows variados, trazendo para Palmas novas revelações da MPB, do samba, do pop/rock e do blues. Um dos shows mais destacados que produzi em Palmas foi da cantora Alcione, que até 2011 tinha na capital tocantinense a única das capitais dos estados da federação que ainda não tinha recebido um show seu.\r\n\r\nComo poeta tenho um livro lançado em conjunto com o poeta brasiliense Alen Guimarães, chamado \"Frente & Versos\", pela editora paulista Scortecci e publicações em algumas antologias poéticas. Como letrista tenho músicas em parceria com compositores de Goiás, Tocantins, São Paulo, Porto Alegre, Vitória da Conquista-BA e Buenos Aires. Algumas já gravadas em produções independentes.\r\n\r\nNa juventude também atuei no teatro amador, pelo Grupo Espantalho de Goiânia, e fui diretor da Federação de Teatro Amador de Goiás. Época que também, influenciado pela minha irmã Tacilda Aquino, passei a estudar muito sobre cinema tornando-me crítico convidado dos jornais Folha de Goiaz, Diário da Manhã, O Popular, e da Revista Oásis.','melck.aquino@uol.com.br','979962272130813'),(78349,'Silvana Silva','PRETA','FEMININO','FEMININO','1970-01-09','Iniciou sua trajetória como Militante Política no inicio de 2000 atuando junto aos movimentos populares da saúde, da mulher e do negro, filiando se no (Partido dos Trabalhadores) em 2002. Atuou como secretária de organização do Diretório Municipal de Santo André e na Executiva Estadual de São Paulo por dois mandatos consecutivos, foi presidente do Núcleo do PT de Santo André - SP, Conselheira de Saúde por dois mandatos, sempre pautou nas discussões que representava a região da Vila Luzita a necessidade de ampliar o atendimento, sendo necessário ainda um Hospital na região para atender todas as demandas da comunidade, coordenou o Comitê de Saúde da População Negra por dois anos em Santo André, foi delegada do Orçamento Participativo da região da Vila Luzita representando também os bairros adjacentes.\r\nPleiteou uma vaga no legislativo de Santo André pela primeira vez em 2004, obtendo 1452 votos, considerada a terceira mulher mais votada no PT, traçando a partir daí uma linha de crescimento e construção política alcançando cada vez mais, votos, como nas últimas eleições quando saiu candidata á Deputada Federal obtendo 6.959 votos representando a região do ABCDMRPRGS na eleição de 2014, dentro deste resultado conquistou 4000 votos somente na cidade de Santo André - SP.\r\nÉ a primeira Mulher Negra na história da cidade á ocupar cadeira na Câmara Municipal de Santo André como Vereadora. Assumindo em 2010 por 30 dias, pois em 2008 concorrendo às eleições municipais obteve 2.458 votos alcançando a primeira suplência de vereadora.\r\nSilvana Silva 46 anos, lutadora, mãe de três filhos, cristã, nascida em Santo André sempre morou no bairro da Vila Luzita, graduada em Gestão de Políticas Públicas pela Universidade Metodista de SP. Sua passagem pelo legislativo andreense marcou se através de propostas de oito requerimentos e vinte e uma indicações ao executivo, destacando se entre elas a indicação de Farmácia 24 horas nas UPA´s e PA´s da cidade de Santo André, com conquista!\r\n\r\n','silvanaapsilva@yahoo.com.br','1421920317822574'),(78715,'André Furtado da Rosa','BRANCA','MASCULINO','MASCULINO','1974-12-04','Sou servidor público concursado e graduando em Ciências Sociais da UFRGS. Trabalhei como carteiro e assessor parlamentar. Atualmente trabalho com o processo legislativo na Câmara Municipal. Sou candidato a vereador pois acredito na cidade como um direito de todos. ','andrefurtadodarosa@gmail.com','1107154786028116'),(79206,'Charlles Braz','PRETA','MASCULINO','MASCULINO','1986-07-06','Um Cristão, Líder Religioso de uma Igreja Evangélica Kairós que é sem Preconceitos, pois Acolhe a Toda Diversidade Humana, porque tem um Ministério Inclusivo voltado para todos inclusive a Sociedade LGBT.\r\nDepois de anos em Igreja Tradicional, há mais de 4 anos vem trabalhando em favor dos excluídos pela sociedade preconceituosa e convencional.\r\nE agora deseja uma nova oportunidade para poder continuar ajudando a todos com mais recursos.','charllesbraz-86@hotmail.com','1233226453383535'),(79526,'Kizie De Paula Aguiar','PRETA','FEMININO','FEMININO','1981-05-21','Sou Kizie de Paula Aguiar, 35 anos, mulher, mãe, negra, funcionária pública e militante de causas sociais.\r\nIniciei trajetória política atuando no movimento Hip Hop e nos coletivos de juventude que se reuniam nos tradicionais clubes da comunidade negra da cidade, onde aprendi a importância de promover discussões que visam, sobretudo, o fortalecimento das identidades étnicas e culturais. Desses movimentos seguimos para a organização de fóruns e conferências municipais, estaduais e nacionais com a finalidade de aprofundamento desses debates e criação de novos espaços de participação, bem como alternativas para os jovens das periferias.\r\nFui Assessora de Integração Racial na Diretoria de Políticas Especiais da Prefeitura Municipal de Rio Claro/SP entre 2010 e 2016. Tive a oportunidade de implementar políticas públicas e ações transversais que discutiram o papel da comunidade negra, dos LGBTs, das mulheres, dos idosos e da juventude na sociedade rio-clarense. \r\n','kizie.depaula@gmail.com','1314190848591199'),(80003,'Eduardo Rodrigues','BRANCA','MASCULINO','MASCULINO','1988-09-28','Eduardo Rodrigues começou sua militância política nos movimentos estudantil e de juventude. Publicitário, é o atual presidente do PSOL Joinville. Luta contra todas as formas de desigualdades que geram uma sociedade cada vez mais violenta.','edu.rodriguesx@gmail.com','10210302693832980'),(80502,'Terezinha Dos Santos Daiprai','PARDA','FEMININO','FEMININO','1966-08-10','Terezinha dos Santos Daiprai\r\n\r\nSou professora de Língua portuguesa e Literatura há 28 anos, filha de pequenos agricultores, aprendi desde muito cedo que, é preciso ATITUDE e CORAGEM para sobreviver com dignidade no mundo em que vivemos. Descobri na leitura, a fantasia e a inspiração para acreditar que, \"gente nasce para brilhar e não, para morrer de fome\". E que, a política faz parte da nossa vida queiramos ou não, tudo o que fazemos é um ato político, até mesmo quando dizemos que não queremos saber de política, pois delegamos a outros a possibilidade de decidir por nós. \r\n\r\nComo professora militante, aprendi com Paulo Freire, e com a Teologia da Libertação que, a nossa luta tem que estar sintonizada com a nossa vivência, com a nossa fé e com a nossa prática pedagógica.\r\n\r\nEstar candidata a vereadora pelo PT, Partido dos Trabalhadores, neste momento conturbado, da política nacional, mais do que nunca, não é um projeto de uma vaidade pessoal, mas a representação de um projeto coletivo, de resistência da boa política, para muitas pessoas que acreditam num mundo justo e fraterno.\r\n\r\n','tsdaiprai@yahoo.com.br','1235627423124590'),(80506,'Lennon Freitas','BRANCA','MASCULINO','MASCULINO','1991-12-14','Candidato a vereador pelo PCdoB, faz parte do sindicato dos comerciários e do DCE da uri, liderou o movimento passe livre estudantil em sua cidade.','lennon.freitass@hotmail.com','943492092444842'),(81570,'Marilia Leão Fortes','BRANCA','FEMININO','FEMININO','1963-04-18','Advogada atuante há  28 anos . Natural desta cidade , tenho 53 anos, viúva,  2 filhos . Presto assessoria jurídica pata o município de são José do Hortêncio,  capacitação administrativa.','marilialeao@caiweb.com.br','1179021805454123'),(81708,'Talita Tecedor','BRANCA','FEMININO','FEMININO','1985-09-28','Por uma candidatura Feminista, classista e Comunista para a cidade!\r\n\r\n\r\nA cidade de São Paulo foi concebida e continua se desenvolvendo para atender aos interesses do grande capital, dos especuladores imobiliários e dos empresários em geral. A cidade vem crescendo de maneira segregadora, cada vez mais afastando os pobres para as áreas distantes do centro, numa relação promíscua entre o poder público e as elites da cidade. Nesse processo, São Paulo foi privatizada, não só no que se refere aos serviços e equipamentos sociais, mas também no que diz respeito ao espaço público, como a ocupação do solo, o transporte e os equipamentos sociais.\r\n\r\nNós sabemos pela própria experiência que é nas cidades que vive a maior parte dos trabalhadores, é nas cidades que a população pobre é excluída do acesso à infraestrutura e dos serviços públicos. É nas cidades onde se manifestam as mais dramáticas conseqüências do processo de exploração capitalista, como a violência, o desemprego, a pobreza e a miséria, a precariedade dos serviços públicos, o desequilíbrio ecológico, a exclusão de numerosas parcelas da população do convívio social, da cultura e do lazer.\r\n\r\nO PCB desenvolve uma linha política revolucionária, e acha que nas eleições deve ocorrer um debate profundo sobre a vida dos trabalhadores nas cidades e no campo, que não está descolada da situação do país e do mundo. Os candidatos do PCB não participam das eleições apenas para tentar ganhá-las, mas para fazer com que este debate exista, avançando a luta dos trabalhadores e a organização dos movimentos sociais.\r\n\r\nPara podermos construir o verdadeiro Poder Popular, só com muita luta e organização todos os dias, não apenas no calendário eleitoral. Convidamos você a fazer parte desse projeto, não apenas através de seu voto consciente no PCB mas principalmente de sua participação nos movimentos sociais e políticos populares organizados.\r\n\r\n- Por creches noturnas e círculos de cuidado infantil públicos em cada vila da cidade;\r\n\r\n- Pela ampliação e estruturação das casas de parto na cidade, que as mulheres possam decidir como querem parir seus filhos.\r\n\r\n- Por lavanderias publicas e restaurantes públicos;\r\n\r\n- Pelo passe livre e a re-municipalização do serviço de transporte publico na cidade;\r\n\r\n- Pela aprovação no orçamento de saúde de verba especifica para o atendimento dos procedimentos de aborto, e construção deste debate como medida de saúde publica.\r\n\r\n- Por abertura de concurso para admissão e gestão publica das unidades básicas de saúde e sua ampliação;\r\n\r\n- Pela construção e ampliação de centros especializados de saúde;\r\n\r\n- Por projetos de assistência social efetivos e públicos, não a terceirização da assistência social;\r\n\r\n- Pela aprovação do debate de gênero nas escolas;\r\n\r\n- Por moradias publicas e populares, pelo controle e atendimento do interesse publico e social das moradias ociosas na cidade, abaixo a especulação imobiliária;\r\n\r\n- Pelo reconhecimento da identidade de gênero de travestis e transexuais, a ampliação de serviços de atendimento e estimulo a contratação dos LGBT’s nos postos de trabalho;\r\n\r\n- Pela coleta seletiva e gestão coparticipativa dos catadores da cidade;\r\n\r\n- Pela auditoria da divida publica;\r\n\r\n- Pelo fora Temer.\r\n\r\n\r\n\r\nTalita Tecedor, 30 anos, militou no movimento estudantil secundarista pela construção de grêmios livres e contra o fechamento do centros de formação técnica em magistério os CEFAM\'s. Atuou no ensino superior como militante da Executiva Nacional de Serviço Social a ENESSO. Apoiadora das lutas por moradia, movimento de população de rua, de catadores e dos fóruns da infância e juventude. Formada 2010 em Serviço Social na PUC SP, contribuiu para com o debate do Ensino a distância e a Reforma do Ensino Superior. É militante comunista do PCB e do coletivo feminista classista Ana Montenegro.\r\n\r\nhttps://www.facebook.com/talitatecedorPCB/?fref=ts','tani.luzia@hotmail.com','10206756235856461'),(82191,'Rogério Nagai','BRANCA','MASCULINO','MASCULINO','1979-04-08','Rogério Nagai é ator profissional, iniciou sua carreira no Teatro Amador Santista em 2000. Participou de inúmeras montagens e vencedor de vários prêmios com o grupo TEP - Teatro Experimental de Pesquisa da Universidade Santa Cecília. \r\n\r\nFormou-se ator profissional pelo Teatro-Escola Macunaíma em 2003 e estreou profissionalmente com o espetáculo \"A Boa Alma de Setsuan\" de Bertolt Brecht sob a direção de Marcelo Marcus Fonseca e direção musical de Wanderley Martins em 2005 no Teatro Sérgio Cardoso. Cursou pós-graduação em Fundamentos da Cultura e das Artes pela UNESP - Universidade Estadual Paulista ano 2013-2014. Realizou também os seguintes trabalhos:\r\n\r\n2005: Espetáculo \"A Boa Alma de Setsuan\" de Bertolt Brech - direção Marcelo Marcus Fonseca;\r\n\r\n2005: Quadro \"1 dos 3\" do programa Fantástico pela Rede Globo - direção Jorge Furtado; \r\n\r\n2007: (participação) Novela \"Amigas e Rivais\" do SBT - direção Henrique Martins; \r\n\r\n2008/2009: Espetáculo \"À Queima-Roupa\" de Miguel Hernandez - direção Wanderley Damaceno; \r\n\r\n2010:  Espetáculo \"A Santa Joana dos Matadouros\" de Bertolt Brecht - direção José Renato;\r\n\r\n2011: (participação) Novela \"Morde e Assopra\" de Walcyr Carrasco pela Rede Globo - direção Rogério Gomes. \r\n\r\n2011: Espetáculo \"Não Estamos aqui para Desaparecer\" - direção Rodolfo Amorim do Grupo XIX de Teatro, resultado da oficina e pesquisa Núcleo Negativo da Memória;\r\n\r\n2012: Espetáculo \"O Castelo\" de Franz Kafka - direção Pietro Floridia (Compagnia del Teatro Del\'Argine - Bolognha, Itália) resultado do workshop em parceria com o Grupo XIX de Teatro. \r\nEspetáculo sendo eleito Segundo Melhor Espetáculo pelo voto popular e entre as cinco melhores estreias internacionais pela crítica especializada do Guia da Folha.\r\n\r\n2012-2013: Projeto \"Travessias em Conflito\" - Núcleo Hana. Contemplado pela Lei de Fomento ao Teatro de São Paulo. \r\n\r\n2013: Parceria Projeto Ki - Arte e Saúde (coaching). \r\n\r\n2016: Espetáculo \"Os Três Sobreviventes de Hiroshima\" - roteiro e direção Rogério Nagai. Espetáculo de biodrama com 3 sobreviventes reais da Bomba Atômica de Hiroshima.\r\n\r\nRealizou cursos e workshop com profissionais como: Laís Bodanzky, Sérgio Penna, Beto Silveira, João das Neves, José Renato, Chico de Assis, Pietro Floridio (Compagnia del Teatro Dell\'Argine - Bologna, Itália) e Flávio Desgranges. \r\n\r\nRealizou inúmeros filmes publicitários, além de ministrar oficinas e workshops para não-atores com foco no desenvolvimento pessoal com o Projeto Senso Criativo, grupo Transformatores e NAGAI Produções.\r\n\r\nAtualmente é proprietário da NAGAI Produções Artísticas e Culturais. Ministra oficinas e workshops de teatro para grupos, ONG\'s, empresas e associações culturais.\r\n\r\nÉ missionário da IMMB - Igreja Messiânica Mundial do Brasil, sócio do Centro Cultural Hiroshima do Brasil, além de mensageiro da paz e militante político pelo PV - Partido Verde.','rogerionagai@yahoo.com.br','1237886129608524'),(82517,'Pedro Bravo Jr.','BRANCA','MASCULINO','MASCULINO','1984-04-02','Sou morador do município de Guarulhos, há 32 anos, no bairro da Ponte Grande. Cidadão trabalhador que sou, fiz toda a minha vida nesta cidade, profissional e academicamente, e, como acredito que a educação é o meio que conscientiza e emancipa o indivíduo (como dizia Paulo Freire, “educar é um ato político”), escolhi esse ofício com a intenção de ver um amanhã melhor.\r\n\r\nSou professor da rede estadual de ensino desde 2011 e, através desta profissão, conheci a realidade dos municípios e de nossas crianças e as mazelas que assolam diversas regiões da cidade.\r\nPretendo conquistar sua confiança porque, através dos ensinamentos aos educandos, dos quais não podemos apenas reclamar, devemos solucionar os problemas, logo, creio estar preparado para enfrentar este desafio.\r\n\r\nO que mais me motivou a entrar no cenário político foi o dia em que um dos meus alunos se dirigiu a mim e disse: “Se o senhor tem esse ideal por mudança e cultivou em nós o valor do senso crítico, porque não entra na política e tenta mudar as coisas para todos nós?” \r\n\r\nEste foi o grande incentivo e a maior motivação para concorrer a uma das vagas no poder legislativo, para tentar recuperar esse atraso político, econômico e social, campos onde devemos dar um basta nos MESMOS e apostar em POSSIBILIDADES NOVAS, pessoas que não estão carregadas dos maus vícios da politicagem, que não querem legislar em benefício próprio, que querem propor algo positivo para o bem estar público de forma progressista.\r\n\r\nEsta é a ideia e a corrente que quero espalhar: tirar de Guarulhos o rótulo de cidade industrial e propor uma cidade de alto desenvolvimento humano, legislando para TODOS, sem distinção de caráter social e econômico.','peterjr2008@hotmail.com','1378872352142032'),(82942,'Avany Cardoso Leal','BRANCA','FEMININO','FEMININO','1968-10-24','Sou psicóloga, professora universitária  e mãe.  Trabalho há mais de 20 anos na área da saúde mental.  Incentivada pelos alunos, aceitei o desafio de continuar trabalhando com e para os usuários do SUS que precisam desse atendimento.  Defendo a prevenção e a atuação na atenção básica,  bem como a ampliação da atuação dos psicólogos no nível secundário também.  Inevitavelmente,  as propostas visam fortalecer a classe de psicólogos,  bem como dos demais componentes das equipes muktiprofissionais. Conto com o apoio de alunos, ex alunos, colegas, amigos e usuários do SUS. Quero mudança! ','avaleal@hotmail.com','10207418015508697'),(83148,'Wagner Alfonso','BRANCA','MASCULINO','MASCULINO','1984-01-01','Nascido e criado em Campo Grande, casado, empresário no ramo da engenharia civil e defensor da causa animal.','wagneralphonso@msn.com','1125667487526380'),(83234,'Amanda Almeida','PARDA','FEMININO','FEMININO','1987-03-07','Meu nome é Amanda Almeida, sou professora de História na Prefeitura Municipal de Leopoldina. Atuei como Superintendente Municipal de Cultura por mais de dois anos. Sou Membro efetiva da Academia Leopoldinense de Letras e Artes. ','historiadora.mineira@gmail.com','1358823407547198'),(83318,'Romario Vieira de Melo','PARDA','MASCULINO','MASCULINO','1969-05-20','Romário Melo é casado, pai de uma filha e um filho. Psicoterapeuta, Mestre em Gestão Social, Educação e Desenvolvimento Local, Pós Graduado em Psicanálise e Graduado em Filosofia. Já trabalhou em diversos colégios de Belo Horizonte e em várias Faculdades. Atualmente trabalha no consultório e na Faculdade IBS/FGV com as disciplinas de Empreendedorismo, Ética e Gestão Ambiental. Foi, por 13 anos professor de Filosofia e Sociologia na Escola Técnica de Formação Gerencial do Sebrae/MG onde desenvolveu o Programa de Empreendedorismo Social - PES, uma metodologia de aproximação de culturas e minimização das desigualdades socioeconômicas. Atuou em mais de cinquenta municípios do norte de Minas e do Vale do Jequitinhonha, onde levou o PES para mais de 10.000 pessoas e capacitou mais de 1.000 alunos de BH em Empreendedorismo Social. Atualmente o PES está sendo desenvolvido nas nove regionais do município de Belo Horizonte.','pessoa.amazonia@gmail.com','1180378728702896'),(83339,'Heuler David','PARDA','MASCULINO','MASCULINO','1984-06-28','Sou professor de Filosofia e Sociologia, participo de um grupo de estudos em sonhos da Psicologia Analítica Junguiana, sou especialista em Gestão e mestrando na área de Análise do Discurso Político no CEFETMG. Atuei na educação estadual e informal por anos, atualmente sou professor voluntário da ONG EDUCAFRO, também sou professor do cursinho Pré Absoluto Pré Enem e professor da rede agostiniana. Fui diretor e coordenador administrativo de um projeto social em uma comunidade carente em BH. Sempre fui engajado nas grandes lutas de nossa sociedade e sempre me sensibilizei pela luta das minorias e diversidades. Acredito em um modelo político de proximidade com a população e de muita transparência na gestão do dinheiro público, que deve ser completamente destinado ao seu verdadeiro fim, que é fazer as devidas melhorias em nossa realidade. Acredito que a educação seja a grande base social a ser construída, pois com uma educação de qualidade se diminui a violência, distribui-se melhor a renda, cria-se uma sociedade mais justa e mais livre, organiza-se a moral e moraliza a vida social, aonde o público se volta a ser espaço de encontros e harmonias e o outro já não será visto como ameaça, mas sim como companheiro da mesma caminhada, visando o mesmo destino e acreditando na mesma sociedade igualitária. ','heulerjesus@yahoo.com.br','1141188695970227'),(84309,'Genoveva Andrada','BRANCA','FEMININO','FEMININO','1976-10-02','Olá meu nome é Genoveva tenho 39 anos , sou filha natural de Rio Largo, casada com Alexandre Máximo, mãe de Alexandre Júnnior e Anne Karollynne, minha formação é Enfermagem, também sou formada em gestão de Recursos, Faço Faculdade de Gestão Pública, e Pretendo ser vereadora da minha Cidade, Pois posso fazer muito mais pela minha Cidade..','genovevaandrada@hotmail.com','1375604142457755'),(84389,'Victor Godoi','BRANCA','MASCULINO','MASCULINO','1995-12-21','','leite_victor@hotmail.com','1267555943289249'),(84724,'Tércio De Sales Morais','BRANCA','MASCULINO','MASCULINO','1975-01-23','Mestre em Geografia\r\nProfessor \r\nFuncionário Público\r\nGestor Público\r\n\r\nSindicalista\r\nPartidário \r\nAcredito em Deus \r\nTenho a Família como base para a vida\r\n\r\n\r\n','tercio.geo@hotmail.com','1439301196087739'),(84926,'Marcello Eufrasio Vieira','BRANCA','MASCULINO','MASCULINO','1981-11-05','Olá, sou Diego Selau, tenho 34 anos, cresci no Bairro Sangão, onde resido com minha esposa e filha. Sou graduado em Gestão Pública e acredito muito que é possível gerir os recursos públicos de forma eficaz e eficiente, buscando qualidade e transparência. Especialista em Educação, tenho convicção de que é através dela que vamos conseguir realizar as transformações que nossa sociedade tanto precisa! É preciso acreditar na força da juventude, principalmente garantir seu presente, pois não haverá futuro, sem investimentos e realizações de políticas públicas específicas e contundentes! Por este motivo, me coloco a disposição como candidato a vereador.\r\n\r\n Vamos cantar uma nova esperança para Criciúma! Um forte abraço, preciso do seu voto.\r\n Diego Selau 65456\r\n#EuTôComSelau #UmCantoDeEsperança #DiegoSelau65456','Diego.selau@gmail.com','341350562877072'),(86028,'Hylton Sarcinelli Luz','BRANCA','MASCULINO','MASCULINO','1952-10-25','Médico homeopata com mais de três décadas de experiência, tornei-me especialista em homeopatia e Direito e Saúde. Lidero a Campanha \"Democracia na Saúde JÁ!\" e sou um dos principais defensores da inclusão de Práticas Integrativas e Complementares (PICs) - homeopatia, acupuntura, fitoterapia e outras Medicinas Naturais - no Sistema Único de Saúde (SUS).\r\n\r\nNa minha trajetória profissional, dedico-me há 37 anos ao atendimento como médico homeopata, atuando também na formação de médicos especialistas em homeopatia. Além disso, por 15 anos, dirigi a \"Ação pelo Semelhante\" – uma Organização Social fundada em 1999 para consolidar a homeopatia e demais PICs nas políticas públicas de saúde. Por 8 anos estive à frente do \"Ecomedicina\" – portal de informações voltado às Medicinas Naturais e seu papel na saúde pública.','hyltonluz@uol.com.br','10210685580196290'),(86147,'Samira Leutprecht II','BRANCA','FEMININO','FEMININO','1969-09-27','Sou Samira Leutprecht . Estudei em escola pública, me formei em pedagogia pela UNERJ e em 2011 ingressei no curso de Nutrição. Comecei a trabalhar aos 14 anos, como Auxiliar de costura e sei bem as dificuldades de quem inicia cedo no trabalho. Também fui Professora da Rede Municipal por 9 anos, corretora de Imóveis, Assessora Parlamentar e há 18 anos sou consultora de Bem Estar. Sou uma mulher empreendedora, esposa e mãe que, como tantas mulheres, concilia a vida pessoal, familiar e profissional.\r\nTomei essa decisão ao verificar que em nossa cidade, segundo o IBGE temos 163.735 habitantes, sendo metade da população do sexo feminino, logo, precisamos de mais representatividade e igualdade. Temos que lutar por espaços na política e por propostas sérias, voltadas para todas as mulheres e suas famílias, em especial as que não tem seus direitos garantidos! Serei uma representante forte, sem medo de fazer mudanças em prol do bem estar de nossa população.\r\n\r\nQuero usar toda a minha experiência para lutar por melhorias em nossa cidade, por isso concorro pela primeira vez a uma vaga na câmara de Vereadores(as) Jaraguá do Sul.\r\n\r\nVamos renovar nossa câmara. Peço seu voto de confiança!','samira.helena@hotmail.com','1129136740473093'),(86312,'Bruno Stephan','PRETA','MASCULINO','MASCULINO','1990-12-04','Graduado em informática para gestão de negócios na FATEC e atualmente cursando Ciências e humanidades com especialização em Políticas Públicas na UFABC, quero representar as demandas da juventude com idéias novas e participação popular, buscando vias sustentáveis de desenvolvimento e humanização da cidade, onde a cultura, dignidade ao cidadão e respeito ao meio ambiente sejam minhas principais bandeiras','thebruno90@gmail.com','1191209260918534'),(86445,'Rosana Lopes','PARDA','FEMININO','FEMININO','1982-01-19','','rozanalopes15@hotmail.com','1490245187687219'),(86574,'Goura Nataraj','BRANCA','MASCULINO','MASCULINO','1979-11-05','Goura é mestre em filosofia, professor de yoga, ativista por cidades mais humanas, pela mobilidade ativa, pelo parto humanizado, pela ocupação dos espaços públicos e pelos direitos humanos. É pai de duas meninas.','souldefiance108@yahoo.com.br','522332921310477'),(87228,'Wesller Nascimento','PARDA','MASCULINO','MASCULINO','1992-04-21','Sou natural de Jurara – MT. Estou em Toledo a mais de 6 anos, foi na cidade que tive contato com o partido dos trabalhadores e assumi minha sexualidade, desde então passei atuar na área de direitos humanos, muito através de coletivos, como o LGBT espaço da diversidade e o coletivo nacional de juventude negra ENEGRECER, e do próprio partido. Minha candidatura abala a estrutura conservadora do município de Toledo, por eu ser tudo o que eles abomina, jovem, negro, gay e gordo.','wesller_22@hotmail.com','1473339332692663'),(87669,'Paula Cicolin','BRANCA','FEMININO','FEMININO','1985-11-14','Atriz e filósofa (com graduação em artes cênicas e filosofia). Iniciação científica em cinema com projeto em parceria com a FAP e a Unifesp na Cinema Brasileira em São Paulo. Tenho 30 anos, fui militante desde os 17 anos em movimentos com anseio de dar voz a minoria reprimida (movimentos feministas, negro, LGBT, estudantil). \r\nHoje meus projetos são desenvolmento do campo artistico, cultural e ao esporte na minha cidade além da formação de conselhos para discussões de debates políticos.\r\nFoco na criança e no jovem porque acredito que só todos juntos é que podemos propor transformações ao município trilhando pelo caminho da paz, amor e principalmente o respeito, valorizando as diversidades.','paulacicolin@gmail.com','1162313840516170'),(87682,'Marcos Arantes','BRANCA','MASCULINO','MASCULINO','1959-08-27','Dentista na cidade há 34 anos. Minha militância política começa no movimento estudantil, sendo que é a primeira vez que concorro a um cargo eletivo. O mote de minha candidatura é \"cidade criativa\".','marcosmarantes@gmail.com','717697585060699'),(88200,'Maria Jose Silva','PARDA','FEMININO','FEMININO','1961-09-01','“O morro não tem vez\r\nE o que ele fez já foi demais\r\nMas olhem bem vocês\r\nQuando derem vez ao morro\r\nToda a cidade vai cantar”\r\n\r\nPrezados Eleitores,\r\n\r\nMinha expectativa enquanto graduada, divorciada, servidora pública, Presidente do Partido dos trabalhadores de Arcoverde é a de continuar crescendo coletivo, profissional e politicamente. Aperfeiçoar minhas práticas sociais à luz dos diversos autores trabalhados e a vivência entre os beneficiados. Outro fator que considero importante é o desafio de participar desse processo seletivo, considerando a experiência adquirida ao longo desse tempo que tenho atuado na área da Saúde permanentemente.\r\nConsidero este momento de minha carreira como fundamental, pois minha perspectiva é a de investir, intensificar e compartilhar com todos os atores sociais, das diversas áreas, experiências e sonhos, em busca da formação PROFISSIONAL e CIDADÃ.\r\n\r\nAo longo desses anos, pude trabalhar em diferentes áreas na educação Permanente e Popular, começando pelos cursos de inclusão social, proferido pela Fio Cruz. Nesta área, como membro das instâncias do controle, pude colaborar com o trabalho multidisciplinar promovendo a aprendizagem de sujeitos em diferentes fases de desenvolvimento, em diversos níveis e modalidades do processo lúdico-educativo; como membro dos Fóruns, desenvolvi diversas atividades como planejamento, elaboração e execução de projetos, coordenação de congressos, seminários e conferências Municipais, Estaduais e Nacional (em Pernambuco).\r\n\r\nDentro das áreas da saúde, educação permanente, popular e partidária, tive a oportunidade de ser eleita diretora regional e estadual e coordenadora nacional de plenárias. Atualmente sou diretora regional da VI GERES do Sindicato dos Servidores Estaduais da Saúde (SindSaúde-PE) e presidenta do Partido dos Trabalhadores de Arcoverde (PT), uma experiência fundamental que me abre um leque de oportunidades dentro dos processos e relações educativas e sociais.\r\n\r\nAo candidatar-me à vaga de vereadora de Arcoverde, tenho como esperança e perspectiva continuar a realizar este trabalho de tamanha importância, contribuindo para o desenvolvimento, democratização e expansão do nosso município, respeitando nossa MEMÓRIA, nossa IDENTIDADE, nosso POVO.\r\n\r\nHistoricamente, Arcoverde apresenta enorme déficit quanto a estrutura política, os poderes executivo e legislativo são constituídos em sua maioria por pessoas pertencentes a um grupo social elitizado: empresários, médicos, advogados, filhos de políticos, ricos… nenhum originário de movimentos sociais, do POVO. Me coloco como candidata no intuito de representar, como sempre fiz, os diversos grupos sociais de nossa cidade, priorizando as minorias e mais necessitados, dando indescritível atenção ao ensino e saúde públicos, gratuitos e de qualidade.\r\nOcupando a cadeira do legislativo, VALORIZAREI CADA VOTO, defendendo os projetos de nossa cidade de forma construtiva, diversa e plural, rompendo o comodismo e interesses pessoais enraizados no “fazer” político local.\r\n\r\nTendo em vista as ações e disposição acima mencionados, reafirmo o interesse e compromisso, como candidata pra sociedade arcoverdense.\r\n\r\nOs que me conhecem sabem que sou determinada, combatível, resistente, defensora das causas sociais e trabalhistas com INDEPENDÊNCIA e AUTONOMIA.\r\nEu sou MARIA JOSÉ DO SINDICATO e meu número é 13789. Minha prefeita é Nerianny de Zeca, 14.\r\nA VOZ DOS QUE NÃO TÊM VEZ!\r\nParafraseando \"O morro não tem vez\" de Antonio Carlos Jobim:\r\n\r\n“Abram alas pro POVO, Arcoverde vai FALAR!”\r\n\r\n#MeuVotoVale #ForaTemer','mej9092@hotmail.com','1041544805966670'),(88289,'Edson Loreto','BRANCA','MASCULINO','MASCULINO','1988-02-12','Juntos, para construir uma vitória mais inclusiva! Meu nome é André Carvalho e meu número é 50456.\r\n#NósPodemos','dede12te@hotmail.com','1284574514888982'),(88553,'Liana Bahia','BRANCA','FEMININO','FEMININO','1963-05-04','Atuei como professora durante 30 anos, sempre voltada para a participação e conscientização da cidadania e do meio ambiente. Também, fui uma das lideranças em movimentos por melhores condições de trabalho e valorização dos trabalhadores em educação e dos funcionários públicos municipais! Luto pela proteção e defesa do meio ambiente e pelos animais, pois acredito que uma cidade deve ser equilibrada e justa socioambientalmente.','dodebahia@gmail.com','10207957948211169'),(89338,'Joaquim Teixeira','BRANCA','MASCULINO','MASCULINO','1961-11-23','','jtalocacao@hotmail.com','1172408319484308'),(90311,'Carlos Alberto Rezende Lopes Linho','BRANCA','MASCULINO','MASCULINO','1959-11-28','Carlos Alberto Rezende Lopes, o Linho, é Professor de História do Ensino Médio da Escola Dom José de Camargo Barrros. Exerce o Magistério há 29 anos.\r\n\r\nDiretor Estadual do Sindicato dos Professores Públicos do Estado de São Paulo (Apeoesp), eleito pelo voto direto dos professores paulistas. Linho também é Conselheiro Estadual da Apeoesp desde 1986.\r\n\r\nFoi eleito vereador pelo PT pela primeira vez em 1992, com 439 votos. Na eleição seguinte, foi o mais votado da cidade com 1.439 votos. Eleito novamente em 2008 foi o único vereador da oposição ao Prefeito Reinaldo Nogueira deste então. Re-eleito em 2012 com 2.812 votos, é o líder da Bancada do Partido dos Trabalhadores.','contato@blogdolinho.com.br','1791920541025825'),(90433,'Vitória Silvestre','PARDA','FEMININO','FEMININO','1995-11-16','Sou Vitória Silvestre, tenho 20 anos, moradora da zona norte de Osasco do bairro Helena Maria, estudei e iniciei a luta na E.E. Walter Negrelli e atualmente estou cursando Direito na UNIFIEO. Comecei minha militância em 2012, travando lutas dentro da escola. Em 2013 me filiei ao PCdoB, e participei do processo de reconstrução da UJS Osasco (União da Juventude Socialista), a qual assumi a secretaria geral da entidade. Participei, também, do processo de reconstrução da União dos Estudantes de Osasco, o qual assumi a Diretoria de Finanças na gestão. Hoje, estou presidente da UJS e represento, em nossa candidatura, diversos jovens que cantam a esperança de um mundo novo, na busca da transformação da política e também da sociedade. Com a luta da juventude e propostas de inovação, trazemos a força da juventude, das ruas para a Câmara Municipal.','vihsilvestre@gmail.com','1131194210262224'),(90622,'Jovanil Oliveira','PARDA','MASCULINO','MASCULINO','1978-09-20','Em minha trajetória de militância, sempre defendi os direitos humanos e sociais. Em 2015, tive a oportunidade de levar minha luta ao legislativo municipal quando, por seis meses, pude assumir mandato de vereador de Fortaleza.\r\nDefendo políticas públicas para crianças com alergia alimentar, luto pela valorização da educação pública, professoras e professores, população LGBTTT, negras e negros, religiões de matriz africana entre outras temáticas. Queremos fazer muito mais, coragem é o que não falta! Saiba mais em facebook.com/jovanil.oliveira','jovanil.oliveira@gmail.com','330443513971167'),(91051,'Murilo Ferreira','BRANCA','MASCULINO','MASCULINO','1980-04-12','Ao final de meu primeiro mandato como Vereador me deparei com algumas frustrações resultantes da experiência de tentar ser um parlamentar efetivamente participativo, enfrentando toda a oligarquia política da cidade que transforma mandatos em empregos. Uma esperança que guardo para essas eleições é a de ver o processo representativo real, ético e comprometido, sem os vícios que limitam e desiludem grande parte da população. Por um tempo me afastei do legislativo e busquei fazer mais por Uberlândia através do trabalho coletivo e da visão de que é possível fazer um serviço público de qualidade. Foi então que, em 2013, fui confiado para estar à frente da Secretaria de Desenvolvimento Social e Trabalho e posteriormente estive a frente da secretaria de Agropecuária e Abastecimento que me propiciaram a experiência necessária para encarar o futuro de nossa cidade com convicções renovadas. #CrescerComUberlândia se dá no dia-a-dia!','muriloferreira2014@yahoo.com.br','1787270994874342'),(91281,'José Pereira','PARDA','MASCULINO','MASCULINO','1970-06-17','Nasci em Luislândia, Norte de Minas e desde os 16 anos vivo em BH, cidade onde me formei Contador. Fundador da CONAFE, graduando em Direito, Professor Universitário da PUC, morador e líder comunitário do bairro Jardim Felicidade busco fortalecer nossa população através da luta política. Meus principais projetos consistem na revitalização do CÓRREGO TAMBORIL/CATULO e BACIA DO FAZENDA VELHA, na construção do Centro Multi-Uso no “final do R” além de muitos outros objetivos.\r\n\r\nUm vereador sozinho não tem força para modificar uma BH inteira, mas um vereador comprometido somado a uma comunidade atuante e mobilizada, terá sim muita força! ','conafecontabil@gmail.com','1807189566206978'),(91862,'Lelia Carvalho','BRANCA','FEMININO','FEMININO','1964-09-10','Olá amigos e amigas !!\r\nSou Lélia candidata a vereadora, sou servidora publica da saúde há quase 10 anos, Sou graduada Bacharel em Enfermagem, pós graduada em enfermagem do trabalho e Saúde coletiva-PSF. \r\nFui gerente e coordenadora em saúde especializada e em centro de esterilização, trabalhei como gestora e enfermeira na rede municipal.\r\nNão sou política profissional, mais vivo o dia a dia complicado e turbulento da rede, defendo o SUS com unhas e dentes. \r\nSei das deficiências do município e meus objetivos contemplam projetos que melhorem o que já existem e novos também e que se amplie o serviço na medida do possível, valorizar os serviços e servidores públicos, rever e melhorar a estrutura, o atendimento, o fluxo, o quantitativo de profissionais, ampliar todo e qual quer serviço essencial para a população. \r\nMinha campanha esta sendo simples assim, limpa pela internet, sem grandes financiamentos, não devo favores a ninguém. \r\nPeço seu voto de confiança para juntos com gestão participativa e compartilhada, com gabinete aberto a vocês, possamos melhorar o que é nosso!!! Meu numero – 27500, Abraços !!','nurse.carvalho@gmail.com','1229859003733187'),(92022,'Aline Fagundes','PRETA','FEMININO','FEMININO','1981-10-23','Sou Aline Fagundes, tenho 34 anos, sou feminista e ex-coordenadora do Fórum de Mulheres de Pernambuco. Sou filiada ao Partido dos Trabalhadores (PT) há mais de uma década e participo da Frente Brasil Popular. Participei ativamente dos atos de resistência ao golpe tais como o Acampamento do Derby e Caravana da Democracia. Estive nas ruas em defesa da democracia, das conquistas sociais que tivemos nos últimos anos e do mandato da presidenta Dilma Rousseff. Em todo momento, denunciei o caráter machista desse processo – por isso me orgulho de dizer que tenho dedicado minha vida a lutar por uma sociedade mais justa e igualitária para as mulheres. \r\n\r\nTenho a convicção de que o processo de impeachment da presidenta Dilma Rousseff, além de racista e classista, foi claramente machista, revelando a violência e o preconceito contra as mulheres também na política. Essas práticas opressivas têm por objetivo retirar das mulheres o protagonismo na construção de uma sociedade \r\nmais igualitária, por isso acreditamos que sem a efetiva participação das mulheres na elaboração, execução e controle das políticas públicas não há democracia. Atualmente, somente cerca de 12% da câmara municipal é composto por mulheres, por isso precisamos ocupar este espaço para garantir a ampliação e manutenção dos nossos direitos.\r\n\r\nDessa forma, a ideia da minha candidatura surgiu no curso da resistência ao golpe parlamentar/jurídico/midiático promovido pelos setores mais conservadores da nossa sociedade. Nesse processo tive a oportunidade de dialogar com as/os companheiras/companheiros da CUT, do MST e de outros movimentos sociais, bem como com trabalhadoras e trabalhadores. Como resultado dessas relações, cresceu o desejo de dar voz a esses segmentos atualmente pouco representados na câmara de vereadores do Recife. Assim, defendemos um mandato de vereadora que esteja, acima de tudo, comprometido com a melhoria das condições de vida das mulheres, pois esta pauta não tem prioridade para os tradicionais nomes da política recifense. \r\n\r\nÉ importante deixar claro que nos identificamos com um projeto de esquerda e popular, por isso, consideramos que as desigualdades de classe, gênero e raça andam juntas, sendo necessário combatê-las conjuntamente. É preciso diminuir as desigualdades entre ricos e pobres, homens e mulheres e entre brancos e negros.','fagundes_aline@yahoo.com.br','1129764937059362'),(92696,'Alberto Rezende','INDÍGENA','MASCULINO','MASCULINO','1970-11-29','Alberto Rezende, natural de Guarulhos, filho de Irma e Raimundo, de uma família de 06 irmãos.,Márcia (im memorian), Paulo,Patrícia,Alexandre e Emeli..Esposo de Angela e  pai de Gabriel e Sofia.... Tendo como formação acadêmica (História e Pedagogia ) com mestrado em Políticas Sociais..\r\nSou professor há 26 anos, atualmente lecionando no colégio Mauricio Nazar no Bairro Santos Dumont , Guarulhos.','al_rezende@terra.com.br','1113598462011050'),(92983,'Rafael Ambrosio','BRANCA','MASCULINO','MASCULINO','1979-05-25','Meu nome é Rafael Ambrosio. Sou santista, casado e tenho dois filhos. Sou arquiteto urbanista e professor universitário.\r\nHá 12 anos trabalho com projetos de habitação e urbanização em comunidades com baixos índices de desenvolvimento humano. Essa experiência me permitiu perceber o quanto é difícil para essas pessoas terem a atenção merecida por parte do Poder Público.\r\nPor isso resolvi me candidatar à Câmara de Santos. Além de facilitar esse diálogo, farei o possível para defender cada direito esquecido desses cidadãos. Meu objetivo é fazer uma “Santos para as pessoas”, uma cidade ambientalmente responsável e socialmente justa.”\r\n','rafaelpambrosio@yahoo.com.br','1293171414034947'),(94375,'Angelica Lavouras Angelica','BRANCA','FEMININO','FEMININO','1968-05-12','Meu nome é Angelica Lavouras, venho fazendo vários trabalhos sociais em comunidades principalmente no bairro do  Méier. \r\nMinha ocupação profissional no momento corretora de imóveis.\r\nComo Vereadora pretendo reativar o centro de reabilitação no Méier, fazer o Rio de Janeiro mudar com relação a saúde que hoje em dia sabemos que é a maior dificuldade da cidade.\r\n','angelicalavouras.corretora@gmail.com','1788093304763623'),(96071,'Marcela Vitoria','BRANCA','FEMININO','FEMININO','1983-05-22','Sou Marcela Vitoria, candidata a vereadora em Porto Alegre pela primeira vez. Gaúcha, natural de São Borja, resido há 16 anos. Sou conhecedora das virtudes e dos problemas da nossa cidade. Graduada em Administração de Empresas e Comércio Exterior na Unilasalle Canoas. Cursei Pós Graduação em Segurança Privada na faculdade da Serra Gaúcha. Trabalhei 02 anos no Banco do Estado do Rio Grande do Sul e atualmente sou Diretora de uma empresa de Segurança Privada.Como Vereadora, almejo uma maior REPRESENTATIVIDADE dos jovens e das mulheres na política, visando proporcionar a utilização dos espaços públicos com mais SEGURANÇA, INCLUSÃO SOCIAL por meio do ESPORTE e LAZER aos cidadãos porto-alegrenses. ','ma_vitoria@hotmail.com','1221687657904925'),(96202,'Valmir Dionizio','BRANCA','MASCULINO','MASCULINO','1965-03-05','Valmir Dionizio é natural de Assis. Tem 51 anos e é 2º Tenente da Policial Militar, formado em Educação Física. Casado com Vera Lucia de Paiva Dionizio, tem dois filhos: Valmir Dionizio Junior e Vinicius de Paiva Dionizio.\r\n\r\nComo Policial Militar, teve sua formação no 32º BPM I, e serviu no Policiamento Rodoviário em Assis, onde iniciou sua carreira como Soldado PM em 1987, encerrando como Sub Tenente em 2010, passando para a Reserva como 2º Tenente PM.\r\n\r\nAtualmente é Vereador em Assis/SP e voluntário da Associação Assisense de Amor-Exigente, entidade de auto e mutua ajuda no combate as drogas. A liderança nata junto com o espírito de amor e fraternidade, e a esperança de ver uma Assis melhor, o impulsionaram a um novo projeto de vida: continuar auxiliando e servindo a população na Câmara Municipal de Assis como representante eleito pelo voto popular.\r\n','valmir_dionizio@uol.com.br','1116391155074644'),(96767,'Adriano Rosa','PRETA','MASCULINO','MASCULINO','1972-01-31','Militante das causas LGBTs, editor-responsável por mais de 10 anos de uma coluna voltada ao público LGBT em jornal semanal na cidade, promoter de festas LGBTs, funcionário público municipal há 16 anos, solteiro, homossexual assumido.','adrianorosasilva@hotmail.com','1247428775301918'),(96816,'Leila Pizzotti','BRANCA','FEMININO','FEMININO','1986-06-20','Leila Pizzotti PV 43043\r\nAgora a voz é de vocês!\r\n\r\n \r\n\r\nLeila Pizzotti é Diretora Executiva, Webmaster, Jornalista, e Assessora de Comunicação da Agência Interativa Nautilus Publicidade e da Revista Eletrônica Colaborativa Rio Claro Online. Leila Pizzotti também atua como Assessora de Comunicação da Comissão de Direitos Humanos da OAB – Rio Claro/SP – Assessora de Comunicação do NAPEC – Núcleo de Apoio e Proteção às Entidades Civis, órgão da CDH da 4ª Subseção da OAB/SP e vem realizando junto ás Entidades Civis, População e Comissão dos Direitos Humanos diversas campanhas, eventos e ações sociais de nível Estadual.\r\n\r\n \r\n\r\nWebsites: www.rioclaroonline.com.br / www.nautiluspublicidade.com.br\r\n\r\nEmails: contato@rioclaroonline.com.br / leila@nautiluspublicidade.com.br\r\n\r\n \r\n\r\nLeila Pizzotti está tentando a sua primeira candidatura.\r\n\r\n \r\n\r\nLeila Pizzotti sempre estudou em escola pública e sabe como é de extrema importância a melhoria da educação, da infraestrutura e das instalações adequadas de ensino que são oferecidas para suprir a demanda e oferecer um serviço público de direito fundamental básico de qualidade!\r\n\r\n \r\n\r\nO sucateamento dos nossos professores, das nossas escolas, dos nossos alunos e da nossa Educação deve para AGORA! Vamos desenvolver mais políticas sociais de nível Regional e Estadual.\r\n\r\n \r\n\r\nPassei na Unesp de Rio Claro/SP em Pedagogia, mas sou Formada em Comunicação Social na Faculdade Anhanguera de Piracicaba/SP, sou bolsista 100% PROUNI e sou da primeira turma de Comunicação da Faculdade Anhanguera de Piracicaba/SP.\r\n\r\n \r\n\r\n“Eu venho de família de professores e agentes da saúde, e por isso entendo como a educação e a saúde são importantes, eu vejo os trabalhadores dessas duas áreas em apuros todos os dias…eles tentam fazem o possível e o impossível diariamente…”\r\n\r\n \r\n\r\nA saúde necessita de mais atenção e cuidados. A fiscalização dos postos de saúde e luta para buscar mais recursos para os hospitais públicos tem que ser constante! Vamos planejar juntos essa mudança!\r\n\r\n \r\n\r\nPor mais atividade no Lago Azul, por mais cultura e lazer para os nossos jovens!\r\nPara Vereadora Leila Pizzotti – Vote 43043\r\nVamos revitalizar o Lago Azul!\r\n\r\n \r\n\r\nSou Contra as Privatizações Municipais, Estaduais e Federais! O Poder Público tem o dever de reestruturar a ordem e o progresso no país, sem deixar que grandes empresas e interessados a parte aproveitem dessa fase desastrosa a qual o país passa e dos poucos direitos que o povo conseguiu conquistar com muita garra e luta!\r\n\r\n \r\n\r\nLeila Pizzotti realizou diversas pesquisas de opinião pública e ações planejadas para a mídia e campanha eleitoral de 2010, participando da política na cidade – a Campanha “Eu Voto por Rio Claro” para pré-candidatos e vereadores. Disponibilizando mais informações e acessos para a comunidade.\r\n\r\n \r\n\r\nEm 2010, Leila Pizzotti participou do PROAC enviando para o edital o projeto denominado “Primeira Parada LGBT de Rio Claro”, o projeto conta com palestras educativas e sociais durante duas semanas, alertas para a saúde em geral, Leila Pizzotti luta por mais de 10 anos para trazer sempre mais acessibilidade e inclusão ás causas sociais, como a causa LGBT,  o movimento negro, a população carente de Rio Claro/SP, melhor idade entre outras entidades fundamentais na cidade.\r\n\r\n \r\n\r\nLeila Pizzotti em parceria com a comunidade LGBT desenvolveu um Website de apoio ao movimento LGBT que conta com matérias educativas referente ás causas e lutas, e desenvolveu de forma pioneira e independente um canal online de denúncias, acesse o  website e saiba mais: www.movimentolgbt.com.br\r\n\r\n \r\n\r\nLeila Pizzotti trabalha e luta pela causa animal na cidade – “Precisamos resolver os 3 grandes problemas da Causa e Luta Animal, o primeiro é o local para acolher e disponibilizar segurança para os animais que estejam abandonados ou em fase de adoção, o segundo é a alimentação dos animais (vamos angariar mais fundos e investimentos para a alimentação), e o terceiro é a disponibilização de um serviço de tratamento técnico especializado de veterinários (voluntários ou não, estimulando assim e dando a oportunidade também para os jovens recém formados da faculdade adquirirem mais experiências), essa luta não é fácil, mas juntos e com planejamento e seriedade conseguiremos amenizar a situação dos animais que se encontram completamente abandonados e não assistidos pela comunidade”.\r\n\r\n \r\n\r\nLeila Pizzotti também atua como parceira artística e musical, e faz parte da equipe de produção dos festivais e eventos beneficentes como o Festival de Rock Equinócio e o Festival de Rock Rio Claro/SP, eventos que tem como objetivo principal reunir a juventude em eventos culturais e artísticos, arrecadar caixinhas de leite e mantimentos em geral para as entidades carentes na cidade, dando total apoio durante a realização dos eventos e realizando campanhas como “Diga Não às Drogas”, “Diga Não à Violência” e “Bullying NÃO”.\r\n\r\n \r\nA ideia de expandir os projetos para os jovens é de extrema importância! Os locais escolhidos para a realização desses eventos culturais são em locais abertos ao público em geral, como a Estação Ferroviária de Rio Claro, na Rua Um com Avenida Um, Espaço Livre, Lago Azul, Praças Populares nos bairros, entre outros apoios e incentivos para as empresas participarem nos eventos beneficentes e ações para o bem comum.\r\n \r\nO comércio local e regional tem que ter mais incentivo do poder público, vou lutar para ampliar as vagas de emprego na cidade e viabilizar mais apoio/ação para os empresários e prestadores de serviços”\r\n \r\n\r\n“A minha ideia é também criar uma associação de moradores e fiscalizadores em cada bairro!\r\n\r\n \r\n\r\nEu vou desenvolver um Website que promova um maior acesso á comunicação dos munícipes com o poder público, registrando suas necessidades e perspectivas, os valores arrecadados mensalmente em cada instituição e os valores gastos com as respectivas administrações atuante na cidade.\r\n\r\n \r\nVou fiscalizar e monitorar os movimentos sociais existentes na cidade, e com isso vai ficar mais fácil ajustar e principalmente detectar onde deve ser aplicado o trabalho do funcionalismo público com qualidade e também para saber onde e quais são os diversos problemas do momento que cada instituição passa, e quando eu me refiro a cultura de subsistência é justamente a ideia de tentar desenvolver políticas públicas efetivas e de retorno para que cada instituição e entidade possa existir com independência do poder público administrativo vigente, é essa uma das minhas ideias, a cultura de subsistência no nosso país é de extrema importância e urgência, temos que tentar alcançar a cultura de subsistência em todas as esferas da sociedade!\r\n\r\n \r\n\r\nAdianto que cada pessoa enxerga ao nível que alcança, e que cada vereador tem as suas propostas de acordo com a sua vivencia e luta!\r\n\r\n \r\n\r\n– Sobre a atualização da LOM do município, essa tem que ser revista e atualizada sempre que possível SIM a meu ver! Afinal as necessidades e prioridades mudam constantemente. Sendo implementada com mais ações pré ativas e com mais coerência para o município.\r\n\r\n \r\n\r\nA respeito do “rascunho” e Plano Diretor apresentado pela gestão atual, muitas dessas linhas ideológicas não nos representa, e a especulação imobiliária tem que ser combatida!\r\n\r\n \r\n\r\nEm relação a cobrança de transparência do executivo, é necessário criar melhores e mais eficazes mecanismos convergentes de monitoramento e fiscalização SIM!\r\n\r\n \r\n\r\n“Uma das” soluções imediatas que deve ser executada com excelência para a transparência, abatimento e prestação de contas do executivo para com o povo, pode e deve ser o desenvolvimento de um completo Website (eu mesma farei o Website se assim for aprovado esse projeto de transparência que tenho, e se eu for eleita), que acuse todas as contas públicas, a arrecadação do município por todos os meios envolvidos, e deve SIM estar em todos os locais possíveis de divulgação (tanto em papel impresso como na internet!).”\r\n\r\n \r\n\r\nA fiscalização e o monitoramento dos movimentos sociais interligados são a nossa busca para a melhoria do funcionalismo público e da cultura de subsistência!\r\n\r\n \r\n\r\nVote em quem já está fazendo ações colaborativas a anos pela população! Vote Consciente, vote em quem possui a noção e o conhecimento para mudar! A hora da renovação é agora! Vamos somar!\r\n\r\n \r\n\r\nVote 43043 – Leila Pizzotti para Vereadora!\r\n\r\n \r\n\r\n','leiladuckur@gmail.com','1229680110438457'),(97366,'Magda Silva','BRANCA','FEMININO','FEMININO','1975-04-14','Sou Magda Silva, 41 anos, casada, mãe de duas filhas, psicóloga e gerente comercial, pós graduada em Psicologia Organizacional, pós graduada em Psicologia Cognitiva  Comportamental, especialista em orientação profissional, desenvolvimento pessoal e profissional. Sou ainda formada em Naturopatia e Reabilitação Neuropsicológica. Defendo a causa da diversidade sexual e saúde mental.','magpsi2014@yahoo.com.br','1671565679825390'),(97430,'Clelio Araujo','PRETA','MASCULINO','MASCULINO','1964-07-21','','clelioaraujo@gmail.com','10207413703243119'),(97737,'Roberto Mazzocco Mazzocco','BRANCA','MASCULINO','MASCULINO','1967-02-13','Professor e pedagogo,militante dos direitos populares, sindicalista de esquerda,\r\nFORA TEMER  NENHUM DIREITO A MENOS\r\nDefesa da Educaçao inclusiva,dos movimentos socias,por um transporte publico de qualidade 100% publico,defesa dos serviços e servidores públicos.\r\n\r\nA 35 anos militando e construído o Partido dos Trabalhadores\r\nEx liderança na luta pelas diretas Já,puder Universitário pelo Fora Collor\r\nE principal liderança na Resistencia contra o Golpe contra a Presidenta Dilma ,organizando a Frente Brasil Popular,\r\nCoordenador do MLTM  E NUCLEO PAULO FREIRE ,','robertomazzoccom@yahoo.com.br','1187557841267249'),(98135,'Shana Krindges','BRANCA','FEMININO','FEMININO','1981-03-31','Sou formada em Educação Física e em Pedagogia, tenho pós-graduação em treinamento Desportivo e em Atendimento Educacional Especializado. Trabalho em uma escola de Educação Especial e com equipe de treinamento de voleibol. Meus anseios estão voltados a lutar pela Educação com um olhar diferenciado à Educação Especial, e também pelo esporte, responsável por promover a inclusão social.','shanakrindges@hotmail.com','10209958358223260'),(99575,'Cléo Emidio','BRANCA','MASCULINO','MASCULINO','1983-08-23','Cléo Emidio tem 33 anos, é casado e, embora tenha vivido também no Rio de Janeiro e em Capela do Alto Alegre, foi em Feira de Santana que constituiu família e enraizou tanto sua vida profissional na área da educação quanto sua militância. \r\n\r\nÉ pedagogo e, também, professor da Rede Municipal de Educação de Feira. Cléo também trabalhou na assessoria pedagógica para ONG’s e instituições públicas nas áreas de juventude e educação, bem como em experiências de economia popular e solidária. \r\n\r\nParte importante da sua trajetória foi o movimento estudantil da UEFS, atuando no Diretório Acadêmico (DA) de Pedagogia, no Diretório Central de Estudantes (DCE), em movimentos contra aumento da tarifa de transporte coletivo e pela defesa da educação pública de qualidade. Mais recentemente, participou da luta do professorado feirense em torno do plano de carreira e cumprimento da Lei do Piso. Já no PSOL, foi o presidente municipal entre 2012 e 2016 e faz parte de sua atual direção. ','cleoemidio@gmail.com','1296249363759228'),(100427,'Edvaldo Torres','PARDA','MASCULINO','MASCULINO','1963-03-05','Radialista, ex diretor voluntário no Centro Social Urbano  (CSU) e ex-diretor de segurança e disciplina do presídio Cyridião Durval.\r\nComo ex voluntário no CSU, meu papel era possibilitar a prática de esportes e atividades artísticas de graça para homens, mulheres e crianças, em sua maioria, carentes. Os esportes e meio artístico tem um papel fundamental na ocupação da mente, do tempo, e no desenvolvimento de habilidades. Ocupei este cargo por 5 anos, com muito prazer. \r\n\r\nComo diretor de disciplina do Cyridião Durval, segui a mesma linha de pensamento: A ocupação da mente. Dei prosseguimento à política de trabalho dentro de presídio. Não existe ressocialização sem trabalho. Neste regime, os presos poderiam estudar, trabalhar, e plantar. Para me ajudar a ter conhecimento do que precisava realmente fazer, concluí o curso de Direitos Humanos. \r\n\r\nMeu lema é que quem quer ajudar, ajuda com o pouco que tem, mesmo sem recursos.  E vou continuar com esta ideia, ganhando ou perdendo. Agora tento minha candidatura para ter mais possibilidade de ajudar ativamente. ','torresedvaldo@live.com','1756817551234374'),(102412,'João Donizzatti','BRANCA','MASCULINO','MASCULINO','1955-10-18','Tenho 59 anos - 50 anos morando o Grajaú; conheço de perto demandas e deficiências do bairro. Trabalho há 35 anos na rede municipal de ensino e 13 anos na rede estadual. \r\nTambém sou membro de inúmeras articulações na área da saúde e\r\n participei da construção do Hospital do Grajaú e hoje continua lutando pela melhoria das instalações. Trabalho pela ampliação das UPA\'s com mais profissionais, principalmente voltados para as crianças e idosos. \r\n\r\nPropostas \r\n\r\n-Construção de mais creches, EMEI\'s e EMEF\'s para que nenhuma criança esteja fora da escola;\r\n-Valorização e formação dos profissionais da educação;\r\n-Maior participação dos jovens nos políticas educacionais (grêmio estudantil)\r\n-integração do lazer e esporte com a educação, para estimular o aprendizado. ','joaodonizzatti@bol.com.br','1294377717271553'),(102666,'Marcio Ruzon','BRANCA','MASCULINO','MASCULINO','1978-07-17','Pai de uma curiosa, linda e questionadora menina chamada Monique,  namorado e parceiro de uma guerreira e brilhante mulher chamada Patrícia, sou graduando em Direito pela Universidade Paulista e em Administração Pública pela Universidade Federal Fluminense; acredito na Educação como ferramenta de transformação social, com especial olhar às minorias e vulneráveis. \r\n\r\nUm ser em constante construção. ','marcioruzon@gmail.com','710305189116818'),(105896,'Lígia Fernandes','BRANCA','FEMININO','FEMININO','1992-12-11','O PCB apresenta a candidatura de Lígia Fernandes à Câmara dos Vereadores. \r\n\r\nSabendo que as verdadeiras vitórias da classe trabalhadora só virão através de sua organização e luta, entramos na disputa eleitoral como em outras lutas que ocorrem na sociedade. É hora de apontar os limites da política institucional e avançar na construção do Poder Popular.\r\n\r\nPor isso nossa campanha promove a denúncia das injustiças que pesam contra a juventude trabalhadora, vitimada pelas piores condições de trabalho e pelo desemprego. Sabemos que na sociedade em que vivemos, não há saída para a juventude negra, as mulheres e as LGBTs que não passe por contestar a exploração dos grandes empresários sobre nós.\r\n\r\nContra as falsas promessas dos políticos, uma ação política com o protagonismo da juventude e da classe trabalhadora. Só assim poderemos construir uma saída pela esquerda, através da construção do Poder Popular, rumo ao socialismo!','ligia.fernandes.oliveira@usp.br','10210631991816730'),(108653,'Magda Costa','PARDA','FEMININO','FEMININO','1958-03-27','Conselheira tutelar em seu segundo mandato, a 39 anos ajudando a comunidade através da ong ONDAS e através de trabalhos sociais em pastorais. ','magdamsc@hotmail.com','642265069282138'),(119726,'Felipe Esposito','BRANCA','MASCULINO','MASCULINO','1989-08-23','Médico, 27 anos.\r\n\r\n','espositofelipe@hotmail.com','10153805108165894'),(120164,'Sandro Pereira','BRANCA','MASCULINO','MASCULINO','1988-02-01','Sandro Pereira tem 28 anos e vive em Aimorés desde os 10. Participativo e interessado em questões politicas, socioambientais e estruturais, podemos destacar suas atuções no DIRETÓRIO ACADÊMICO DOS ESTUDANTES \"GABRIEL FELIPE DOS SANTOS RIGAMONTE” (DAEGR), na Federação de Estudantes de Agronomia do Brasil (FEAB) , no antigo Grupo JUNTA Aí (que hoje faz parte da organização interestadual Água e Juventude) e no Conselho Tutelar de Aimorés, de onde se encontra afastado de suas funções para concorrer ao cargo de vereador da cidade de Aimorés. ','lucevom@hotmail.com','1096658030423099'),(120388,'Gisele Marangon','BRANCA','FEMININO','FEMININO','1979-12-31','Professora de História. Cursando Gestão Pública e Gerenciamento de Cidades. Nomeada na Escola Estadual Padre Joãozinho. Envolvida em  projetos de Educação e Formação dr Cidadãos.','giselemarangon@yahoo.com.br','1293756760658367'),(122507,'Caio M Carneiro','BRANCA','MASCULINO','MASCULINO','1982-06-09','Caio Miranda Carneiro, nascido em 1982, assume seu primeiro mandato na Câmara Municipal de São Paulo aos 34 anos de idade. Formado pela Faculdade de Direito do Largo de São Francisco, da USP, o paulistano, antes de ser eleito vereador, foi presidente do centenário Centro Acadêmico XI de Agosto, voluntário no Departamento Jurídico dessa mesma instituição para assistência jurídica à população de baixa renda, conselheiro da Associação dos Antigos Alunos da FDUSP e trabalhou no Tribunal de Contas do Estado de São Paulo, com especialização em responsabilidade fiscal e combate à corrupção. Caio também aposta em seus vídeos na internet como uma importante forma de democratizar o debate político e de difundir suas ideias.\r\n\r\nPretende contribuir no sentido de sempre elevar o nível da atividade parlamentar paulistana. As palavras de ordem em sua gestão serão: eficiência, ética e fiscalização.','caio.m.carneiro@gmail.com','687724838085907');
